import{_ as g,o as t,c as n,a as i,t as u,C as h,M as _,U as k,f as p,F as w,p as b,e as f,q as v}from"./chunks/framework.B1z0IdBH.js";const D={name:"PoemCard",props:{poem:{type:Object,required:!0}},methods:{handleImageError(a){a.target.src="/images/logo.svg"}}},B={class:"entry-container"},y={class:"entry"},A={class:"entry-image"},j=["src","alt"],C={class:"entry-content"},z={class:"entry-title"},E=["href"],S={class:"entry-description"};function x(a,e,s,m,o,r){return t(),n("div",B,[i("div",y,[i("div",A,[i("img",{src:s.poem.image_url,alt:s.poem.page_title,onError:e[0]||(e[0]=(...d)=>r.handleImageError&&r.handleImageError(...d))},null,40,j)]),i("div",C,[i("h2",z,[e[1]||(e[1]=i("span",{class:"title-icon"},null,-1)),i("a",{href:s.poem.page_url,target:"_blank"},u(s.poem.page_title),9,E)]),i("p",S,u(s.poem.context_page_description),1)])])])}const P=g(D,[["render",x],["__scopeId","data-v-5bb67760"]]),M=JSON.parse(`[{"page_url":"https://en.wikipedia.org/wiki/Shadrach_Bond","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Shadrach.Bond.png","page_title":"Shadrach Bond","context_page_description":"Shadrach Bond was a representative from the Illinois Territory to the United States Congress. In 1818, he was elected Governor of Illinois, becoming the new state's first chief executive. In an example of American politics during the Era of Good Feelings, Bond was elected to both positions without opposition."},{"page_url":"https://sl.wikipedia.org/wiki/%C3%89tretat","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/The_Manneporte_near_%C3%89tretat.JPG","page_title":"Étretat","context_page_description":"Étretat je občina v departmaju Seine-Maritime v regiji Zgornja Normandija v severozahodni Franciji. To je turistično in kmetijsko mesto, ki leži približno 32 km severovzhodno od Le Havre, na stičišču cest D 940, D 11 in D 139. Nahaja se na obali na območju Pays de Caux."},{"page_url":"https://en.wikipedia.org/wiki/Manchester_Mayfield_railway_station","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Original_Buffers_-_to_be_preserved_evidently.jpg","page_title":"Manchester Mayfield railway station","context_page_description":"Manchester Mayfield is a former railway station in Manchester, England, on the south side of Fairfield Street next to Manchester Piccadilly station. Opened in 1910, Mayfield was constructed as a four-platform relief station adjacent to Piccadilly to alleviate overcrowding. In 1960, the station was closed to passengers and, in 1986, it was permanently closed to all services having seen further use as a parcels depot.\\nAfter years of abandonment and many proposed development schemes, the station roof was dismantled in February 2013. The site was used for Manchester International Festival in July 2013.\\nManchester Mayfield railway station and the surrounding 6.2-acre site is the property of London and Continental Railways, the residual government-owned corporation and former partner in Eurostar."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%B8%80%E7%80%AC%E5%8B%87%E4%B8%89%E9%83%8E","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Death_poem_by_Yuzaburo_Ichinose.jpg","page_title":"一瀬勇三郎","context_page_description":"一瀬 勇三郎は明治時代の司法官僚。従三位勲二等。\\n明治3年大村藩貢進生として大学南校に入学、在学中司法省に出仕し、法学校卒業後、明治19年洋行し、ベルリン、パリを視察した。明治23年帰国し、長崎地方裁判所検事正、横浜地方裁判所検事正、大阪地方裁判所検事正、広島控訴院長、函館控訴院長等を歴任した。大正2年東京に隠棲し、昭和2年故郷大村に帰って余生を過ごした。"},{"page_url":"https://fr.wikipedia.org/wiki/Elisabeth_Vathje","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Elisabeth_Vathje_2017_Lake_Placid_WC_%281_of_5%29.jpg","page_title":"Elisabeth Vathje","context_page_description":"Elisabeth Vathje, née le 17 mars 1994, est une skeletoneuse canadienne. Elle débute en Coupe du monde en décembre 2014 à Lake Placid où elle termine deuxième derrière Elizabeth Yarnold, avant de remporter quelques jours plus tard à Calgary sa première course à ce niveau."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B1%D5%B5%D5%BF%D5%A1%D6%83%D5%B8%D5%BD%D5%AB%D5%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Andrew_Kooman.jpg","page_title":"Այտափոսիկ","context_page_description":"Այտափոսիկ կամ մատնեհար, բնական փոքրիկ փոսիկներ մարդու այտերին և կզակին:"},{"page_url":"https://en.wikipedia.org/wiki/Know_Nothing","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/A_souvenir_with_an_autobiographical_sketch_of_early_life_and_selected_miscellaneous_addresses_and_communications_%281896%29_%2814581882578%29.jpg","page_title":"Know Nothing","context_page_description":"The Know Nothing movement, formally known as the Native American Party, and the American Party from 1855 onwards, was a nativist political party and movement in the United States, which operated nationwide in the mid-1850s. It was primarily an anti-Catholic, anti-immigration, and xenophobic movement, originally starting as a secret society. The Know Nothing movement also briefly emerged as a major political party in the form of the American Party. Adherents to the movement were to simply reply \\"I know nothing\\" when asked about its specifics by outsiders, providing the group with its common name.\\nSupporters of the Know Nothing movement believed that an alleged \\"Romanist\\" conspiracy was being planned to subvert civil and religious liberty in the United States, and sought to politically organize native-born Protestants in what they described as a defense of their traditional religious and political values. The Know Nothing movement is remembered for this theme because of fears by Protestants that Catholic priests and bishops would control a large bloc of voters."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B7%E3%83%A5%E3%83%93%E3%83%A0%E3%83%AF%E3%83%BC%E3%82%B2%E3%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/VW_Schwimmwagen_3.jpg","page_title":"シュビムワーゲン","context_page_description":"シュヴィム ワーゲンは、第二次世界大戦中にドイツ軍が使用した四輪駆動の水陸両用車。大戦中に最も多く生産された軍用水陸両用車である 。"},{"page_url":"https://es.wikipedia.org/wiki/Monasterio_de_Andechs","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Monasterio_de_Andechs%2C_Alemania_2012-05-01%2C_DD_11.JPG","page_title":"Monasterio de Andechs","context_page_description":"La abadía benedictina de Andechs es la meta de muchos peregrinos, estando ubicada en una colina al este del Ammersee en el Landkreis de Starnberg en Alemania, en el municipio del mismo nombre.\\nSiendo la abadía de Andechs, o monasterio de Andechs, famosa por su iglesia de estilo Rococó y su cerveza, así como por los restos del compositor Carl Orff autor de obras como Carmina Burana, que yacen en el interior de la capilla de Andechs."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%AE%AE%E5%8E%9F%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/JR_Miyahara_sta_001.jpg","page_title":"宮原站","context_page_description":"宮原車站是東日本旅客鐵道高崎線的鐵路車站，位於埼玉縣埼玉市北區宮原町三丁目。"},{"page_url":"https://pl.wikipedia.org/wiki/Moncucco_Torinese","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Moncucco_panorama.jpg","page_title":"Moncucco Torinese","context_page_description":"Moncucco Torinese – miejscowość i gmina we Włoszech, w regionie Piemont, w prowincji Asti.\\nWedług danych na styczeń 2009 gminę zamieszkiwały 903 osoby przy gęstości zaludnienia 62,9 os./1 km²."},{"page_url":"https://en.wikipedia.org/wiki/Baotong_Temple_station","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Baotong_Temple_Station_03.jpg","page_title":"Baotong Temple station","context_page_description":"Baotong Temple Station, is a station of Line 2 of Wuhan Metro. It entered revenue service on December 28, 2012. It is located in Hongshan District. Baotong Temple is located to the immediate north of the station."},{"page_url":"https://fi.wikipedia.org/wiki/Rudolf_Rocker","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/RudolfMilly.jpg","page_title":"Rudolf Rocker","context_page_description":"Johann Rudolf Rocker oli saksalaissyntyinen anarkosyndikalistikirjailija ja -aktivisti. Rocker oli itseoppinut anarkisti ilman adjektiiveja, joka uskoi että anarkismin eri koulukunnat edustivat ”vain talouden eri järjestelytapoja”, ja että anarkistien ensisijaisin päämäärä oli ”turvata ihmisten henkilökohtainen, sosiaalinen ja yhteiskunnallinen vapaus”. Rocker pakeni Saksasta Hitlerin ja natsien noustua valtaan vuonna 1933, ja noin vuoden kiertelyn jälkeen hän asettui Yhdysvaltoihin loppuiäkseen.\\nSuomen anarkistiliitto suomensi ja julkaisi vuonna 1996 Rockerin teoksen Anarkosyndikalismi – vapaa työväenliike vuodelta 1938. Rockeria kutsuttiin kirjan esipuheessa ”anarkosyndikalismin tärkeimmäksi teoreetikoksi”."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Schleswig","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/36/Schleswig_Capitolplatz_7.jpg","page_title":"Liste der Kulturdenkmale in Schleswig","context_page_description":"In der Liste der Kulturdenkmale in Schleswig sind alle Kulturdenkmale der schleswig-holsteinischen Stadt Schleswig und ihrer Ortsteile aufgelistet."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A4%E3%83%AA%E3%83%AB%E3%83%BB%E3%83%A9%E3%83%86%E3%82%A3%E3%83%95%E3%82%A3","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Ilir_Latifi_at_UFC_232.jpg","page_title":"イリル・ラティフィ","context_page_description":"イリル・ラティフィは、スウェーデンの男性レスリング選手、総合格闘家。スコーネ県マルメ出身。パンクラスジム・スウェーデン所属。初代Superior Challengeライトヘビー級王者。\\n総合格闘家のアルベン・ラティフィは実兄。"},{"page_url":"https://de.wikipedia.org/wiki/Alfred_C._Harmer","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Alfred_C._Harmer_-_Brady-Handy.jpg","page_title":"Alfred C. Harmer","context_page_description":"Alfred Crout Harmer war ein US-amerikanischer Politiker. Zwischen 1871 und 1875 sowie nochmals von 1877 bis 1900 vertrat er den Bundesstaat Pennsylvania im US-Repräsentantenhaus."},{"page_url":"https://en.wikipedia.org/wiki/Lake_Erie","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b2/Great_Lakes_Steamship_Walk-in-the-Water.jpg","page_title":"Lake Erie","context_page_description":"Lake Erie is the fourth-largest lake of the five Great Lakes in North America, and the eleventh-largest globally if measured in terms of surface area. It is the southernmost, shallowest, and smallest by volume of the Great Lakes and therefore also has the shortest average water residence time. At its deepest point Lake Erie is 210 feet deep.\\nSituated on the International Boundary between Canada and the United States, Lake Erie's northern shore is the Canadian province of Ontario, specifically the Ontario Peninsula, with the U.S. states of Michigan, Ohio, Pennsylvania, and New York on its western, southern, and eastern shores. These jurisdictions divide the surface area of the lake with water boundaries.\\nThe lake was named by the Erie people, a Native American people who lived along its southern shore. The tribal name \\"erie\\" is a shortened form of the Iroquoian word erielhonan, meaning long tail.\\nSituated below Lake Huron, Erie's primary inlet is the Detroit River. The main natural outflow from the lake is via the Niagara River, which provides hydroelectric power to Canada and the U.S. as it spins huge turbines near Niagara Falls at Lewiston, New York and Queenston, Ontario."},{"page_url":"https://cs.wikipedia.org/wiki/Nivsk%C3%A9_louky","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/PP_Nivsk%C3%A9_louky_%2811%29.JPG","page_title":"Nivské louky","context_page_description":"Nivské louky je přírodní památka ev. č. 1214 poblíž obce Niva v okrese Prostějov. Území spravuje Krajský úřad Olomouckého kraje."},{"page_url":"https://ca.wikipedia.org/wiki/Argenteria","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/SilverWashingCup.jpg","page_title":"Argenteria","context_page_description":"L'argenteria és l'art i l'ofici de treballar l'argent, l'or, el platí i d'altres metalls fins. També es coneix per argenteria l'obra de l'argenter, l'obrador i la botiga de l'argenter i la brodadura amb fils d'argent o d'or.\\nD'altra banda, la joieria també en forma part. L'argenteria es destina principalment a la decoració d'edificis, que poden ser religiosos o no, i a habitacions particulars."},{"page_url":"https://sh.wikipedia.org/wiki/Bartolomeo_dei_Vitrei","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Pula11%28js%29.jpg","page_title":"Bartolomeo dei Vitrei","context_page_description":"Bartolomeo dei Vitrei, pulski podestat. Za njegove uprave krajem 13. stoljeća podignuto je zdanje Komunalne palače na pulskom Forumu o čemu svjedoči ploča s uklesanim njegovim imenom. Iznad ploče u kamenom reljefu prikazan je konjanik Bartholomeus, nasljednik prastarog padovanskog prezimena de'Vitrei. Danas njegovo ime nosi jedna ulica u Puli."},{"page_url":"https://zh.wikipedia.org/wiki/Giphy","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Alex_Chung%2C_Giphy_%40_SXSW_2016.jpg","page_title":"Giphy","context_page_description":"Giphy，一般写成GIPHY，是美国的一个GIF搜索引擎，用户可以在这里通过输入文字来搜寻对应的GIF。"},{"page_url":"https://la.wikipedia.org/wiki/Sainte-Savine","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5f/TG_91_-_SAINTE-SAVINE_-_La_Route_de_Sens.JPG","page_title":"Sainte-Savine","context_page_description":"Sainte-Savine est commune Francicum 10'196 incolarum praefecturae Albae in provincia Campania et Arduenna iuxta Trecas."},{"page_url":"https://uz.wikipedia.org/wiki/Vernouillet_(Eure-et-Loir)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Map_commune_FR_insee_code_28404.png","page_title":"Vernouillet (Eure-et-Loir)","context_page_description":"Vernouillet Fransiyaning Centre mintaqasida joylashgan kommunadir. Eure-et-Loir departamenti Dreux tumani tarkibiga kiradi."},{"page_url":"https://ms.wikipedia.org/wiki/Kota_Belanda","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/74/Dutch_Fort_Pulau_Pangkor_2007_016_pano.jpg","page_title":"Kota Belanda","context_page_description":"Kota Belanda terletak di Pulau Pangkor, Perak, Malaysia, kira-kira 100 meter dari pantai."},{"page_url":"https://en.wikipedia.org/wiki/Bitterroot_River","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Skalkaho_Creek_at_Centennial_Grove_July_7%2C_2017.png","page_title":"Bitterroot River","context_page_description":"The Bitterroot River is a northward flowing 84-mile river running through the Bitterroot Valley, from the confluence of its West and East forks near Conner in southern Ravalli County to its confluence with the Clark Fork River near Missoula in Missoula County, in western Montana. The Clark Fork River is tributary to the Columbia River and ultimately, the Pacific Ocean. The Bitterroot River is a Blue Ribbon trout fishery with a healthy population of native westslope cutthroat trout and bull trout. It is the third most fly fished river in Montana behind the Madison and Big Horn Rivers."},{"page_url":"https://nl.wikipedia.org/wiki/Kabinet-Obama","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Hillary_Clinton_crop.jpg","page_title":"Kabinet-Obama","context_page_description":"Het kabinet-Obama was de uitvoerende macht van de Verenigde Staten van Amerika van 20 januari 2009 tot 20 januari 2017. Senator voor Illinois Barack Obama van de Democratische Partij werd gekozen als de 44e president van de Verenigde Staten na het winnen van de presidentsverkiezingen van 2008 over de kandidaat van de Republikeinse Partij senator voor Arizona John McCain, Obama werd herkozen voor een tweede termijn in 2012."},{"page_url":"https://fi.wikipedia.org/wiki/Luettelo_Kiinan_maakunnallisista_moottoriteist%C3%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/S16-CN_%28XJ%29_no_name.png","page_title":"Luettelo Kiinan maakunnallisista moottoriteistä","context_page_description":"Tämä luettelo kertoo Kiinan maakunnallisista moottoriteistä."},{"page_url":"https://ro.wikipedia.org/wiki/M%C4%83gura_Ocnei","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Magura_Targu_Ocna_reservation_plate.jpg","page_title":"Măgura Ocnei","context_page_description":"Măgura Ocnei, numită și Măgura Mare, este o structură anticlinală care face parte din Munții Nemira. În cadrul celei de-a treia Bătălii de la Oituz dusă în Primul Război Mondial în anul 1917, această înălțime a reprezentat un punct cheie în susținerea defensivei trupelor române.\\nDin sectorul nordic al culmii principale a Munților Nemira, se desprind către est culmi secundare. Cu origine din vârful Șandru Mare, pornește astfel către est o culme secundară care duce de-a lungul vârfurilor La Cireș–Pufu–Țega–Cireșoaia spre valea Trotușului, până la Târgu Ocna, culme care se află între văile Dofteanei și Slănicului. Măgura Ocnei se găsește pe versantul drept al Trotușului, în zona munceilor cu aspect de plai desfășurați între văile acestor două râuri. Regiunea în care se află face tranziția între Munții Nemira, Depresiunea Tazlău-Cașin și Depresiunea Comănești-Dărmănești.\\nDin punct de vedere geologic, se situează în zona flișului Carpaților Orientali în sud-vestul Pânzei de Tarcău, la limita cu semifereastra Slănic-Oituz din Pânza de Vrancea. Clima zonei este temperat-continentală. Din punct de vedere biogrografic, se situează în regiunile alpină și continentală."},{"page_url":"https://vi.wikipedia.org/wiki/L%E1%BB%8Bch_s%E1%BB%AD_t%C6%B0_t%C6%B0%E1%BB%9Fng_kinh_t%E1%BA%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/JohnKennethGalbraithOWI.jpg","page_title":"Lịch sử tư tưởng kinh tế","context_page_description":"Lịch sử tư tưởng kinh tế là lịch sử của các nhà tư tưởng và học thuyết kinh tế chính trị và kinh tế học từ thời cổ đại đến ngày nay. Lịch sử tư tưởng kinh tế gồm nhiều trường phái tư tưởng kinh tế khác nhau. Các tác gia Hy Lạp cổ đại như triết gia Aristotle xem xét những ý tưởng về nghệ thuật đạt được sự giàu có và nêu ra câu hỏi liệu tài sản tốt nhất là nên nằm trong tay cá nhân hay công cộng. Vào thời Trung cổ, các học giả như Thomas Aquinas tranh luận rằng các doanh nghiệp có nghĩa vụ về mặt đạo đức phải bán hàng hóa ở mức giá công bằng.\\nTriết gia người Scotland Adam Smith thường được trích dẫn là cha đẻ của kinh tế học hiện đại bởi tác phẩm kinh điển của ông Sự giàu có của các quốc gia. Những ý tưởng của ông được xây dựng dựa trên công trình của những người đi trước trong thế kỷ 18. Cuốn sách của ông xuất hiện vào thời kỳ ngay trước cuộc cách mạng công nghiệp Anh và gắn với nhiều thay đổi lớn trong nền kinh tế.\\nNhững người tiếp nối của Smith bao gồm các kinh tế gia kinh điển như linh mục Thomas Malthus, Jean-Baptiste Say, David Ricardo và John Stuart Mill."},{"page_url":"https://de.wikipedia.org/wiki/Hugo-H%C3%A4ring-Preis","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Stuttgart_Universit%C3%A4t_Campus_Vaihingen_Mensa_2007_by-RaBoe_02.jpg","page_title":"Hugo-Häring-Preis","context_page_description":"Der Hugo-Häring-Preis ist ein Architekturpreis für vorbildliche Bauwerke in Baden-Württemberg. Seit 1969 verleiht der Landesverband Baden-Württemberg des Bundes Deutscher Architekten den nach dem Architekten Hugo Häring benannten Preis an Bauherren und Architekten für ihr gemeinsames Werk.\\nDer Preis wurde erstmals 1969 vergeben, danach in den Jahren 1970, 1972, 1973 und 1974. Seit 1978 findet die Verleihung nur noch im Abstand von drei Jahren statt. In den zwei dazwischen liegenden Jahren findet in den 15 Kreisbezirken ein Verfahren zur „Auszeichnung Guter Bauten“ statt, umgangssprachlich auch „Kleiner Hugo“ genannt. Die so ausgezeichneten Bauten qualifizieren sich für den eigentlichen Preis, der als Hugo-Häring-Landespreis umgangssprachlich auch „Großer Hugo“ bezeichnet wird."},{"page_url":"https://pl.wikipedia.org/wiki/Towarzystwo_Surinamu","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Pieter_Schenk%2C_Afb_010097003419.jpg","page_title":"Towarzystwo Surinamu","context_page_description":"Towarzystwo Surinamu – spółka zarządzająca kolonią Surinam w latach 1683–1795, w skład spółki wchodzili trzej równorzędni udziałowcy: miasto Amsterdam, rodzina Van Aerssen van Sommelsdijck oraz Holenderska Kompania Zachodnioindyjska."},{"page_url":"https://es.wikipedia.org/wiki/Miraflores_(Boyac%C3%A1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/San_Joaquin.JPG","page_title":"Miraflores (Boyacá)","context_page_description":"Miraflores es un municipio colombiano, capital de la provincia de Lengupá, en el departamento de Boyacá. ​"},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_kulturn%C3%ADch_pam%C3%A1tek_v_Teplic%C3%ADch_nad_Metuj%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Zdo%C5%88ov%2C_d%C5%AFm_%C4%8Dp.147.jpg","page_title":"Seznam kulturních památek v Teplicích nad Metují","context_page_description":"Tento seznam nemovitých kulturních památek ve městě Teplice nad Metují v okrese Náchod vychází z Ústředního seznamu kulturních památek ČR, který na základě zákona č. 20/1987 Sb., o státní památkové péči, vede Národní památkový ústav jako ústřední organizace státní památkové péče. Údaje jsou průběžně upřesňovány, přesto mohou obsahovat i řadu věcných a formálních chyb a nepřesností či být neaktuální.\\nPokud byly některé části dotčeného území vyčleněny do samostatných seznamů, měly by být odkazy na tyto dílčí seznamy uvedeny v úvodu tohoto seznamu nebo v úvodu příslušné sekce seznamu."},{"page_url":"https://es.wikipedia.org/wiki/Salsa_de_champi%C3%B1ones","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Filet_mignon_with_mushroom-cream_sauce.jpg","page_title":"Salsa de champiñones","context_page_description":"La salsa de champiñón es una salsa elaborada con champiñón común como principal ingrediente acompañado de un medio graso como puede ser nata de leche o mantequilla.​ Puede ser una salsa que acompañe platos de carne como pueden ser de ternera y ave. Junto con virutas de queso gruyer la salsa suele ser habitual para platos de pasta, ​ así como de preparaciones de falsos risottos. Algunos cocineros suelen emparejar esta salsa de champiñones con platos de pescado.​ Suele presentarse en forma de salsa fresca fluida con la que se acompañan los platos correspondientes, o en forma de polvo seco."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%96%B0%E9%B3%A5%E7%9B%A4%E9%A1%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Parasaurolophuspic_steveoc.jpg","page_title":"新鳥盤類","context_page_description":"新鳥盤類は鳥盤目恐竜の系統群である。装盾類の姉妹群でありともにゲナサウリアを形成する。新鳥盤類は下顎の歯の内側に分厚い非対称なエナメル層があるという共通の特徴を持つ。この歯は咀嚼により不均等になり、縁が鋭くなることで他の恐竜より植物を効率よく破砕することが可能になる。"},{"page_url":"https://simple.wikipedia.org/wiki/La_Uni%C3%B3n_Department","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Bandera_del_Departamento_de_La_Union_ES.jpg","page_title":"La Unión Department","context_page_description":"La Unión is a department of El Salvador. The capital city is also named La Unión. The department was created on June 22, 1865.\\nSome of the tourist sites are the Conchagua Temple, built in 1693, and ruins in Intipucá and Meanguera."},{"page_url":"https://hu.wikipedia.org/wiki/Samebug","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Samebug-logo.png","page_title":"Samebug","context_page_description":"A Samebug egy magyar szoftverfejlesztő vállalat volt. Egy szoftverhibák kijavítására szolgáló adatbázist fejlesztettek, melynek célja a programozók segítése volt hibajavítás közben. A felhasználók előtt a rendszer 2015 márciusában nyílt meg. 2019 februárjában a céget és teljes csapatát felvásárolta az amerikai Rollbar."},{"page_url":"https://en.wikipedia.org/wiki/Comparison_of_Afrikaans_and_Dutch","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/DutchAfrikaans.svg","page_title":"Comparison of Afrikaans and Dutch","context_page_description":"Afrikaans is a daughter language of Dutch and—unlike Netherlands Dutch, Belgian Dutch and Surinamese Dutch—a separate standard language rather than a national variety. As an estimated 90 to 95% of Afrikaans vocabulary is ultimately of Dutch origin, there are few lexical differences between the two languages; however, Afrikaans has a considerably more regular morphology, grammar, and spelling."},{"page_url":"https://ja.wikipedia.org/wiki/%E8%A6%B3%E9%9F%B3%E9%99%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Kannonin_Tottori01o4592.jpg","page_title":"観音院","context_page_description":"観音院は鳥取県鳥取市にある天台宗の寺。詳しくは、補陀落山 慈眼寺 観音院と号する。本尊は聖観世音菩薩。境内にある日本庭園は江戸時代初期を代表する名園、観音院庭園として広く知られる。\\n1630年代前半、僧宣伝により雲京山観音院の号で栗谷に開創、1639年頃に現在地に移り現在の号に改めたとされる。\\n以降、旧鳥取藩主池田家の祈願所八ケ寺の一つとして栄えた。"},{"page_url":"https://ro.wikipedia.org/wiki/Bong","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Bong_glas.jpg","page_title":"Bong","context_page_description":"Un bong este un dispozitiv de filtrare utilizat în general pentru fumatul de canabis, tutun sau alte produse pe bază de plante. În bong-ul prezentat în fotografie, gazul curge din portul inferior din stânga în portul superior din dreapta.\\nÎn construcții și funcții, o bong este similară cu o narghilea, cu excepția celor mici și, în special, mai portabile. Un bong poate fi construit din orice vas cu aer și apă prin adăugarea unui aparat pentru boluri și tije, care ghidează aerul în jos până la nivelul apei, de unde acesta bulează în sus în timpul utilizării. Pentru a obține aer curat în bong și recolta ultimul fum rămas, o gaură cunoscută sub numele de \\"carburator\\", \\"carb\\", \\"sufoc\\", \\"bink\\", \\"rush\\", \\"shotty\\", \\"kick hole\\" \\"gaura\\", undeva în partea inferioară a bongului deasupra nivelului apei, este mai întâi acoperită în timpul procesului de fumat, apoi deschisă pentru a permite tragerea fumului în sistemul respirator.\\nBong-urile au fost folosite de către Hmong, în Laos și Thailanda, și în toată Africa pentru secole."},{"page_url":"https://es.wikipedia.org/wiki/Hongos_venenosos","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Amanita_muscaria_2.jpg","page_title":"Hongos venenosos","context_page_description":"Los hongos venenosos son aquellos hongos cuya ingestión puede provocar trastornos gástricos, somnolencia, fiebre, taquicardia y en algunos casos la muerte segura. Entre las sustancias activas que pueden causar intoxicaciones se encuentran las amatoxinas, la orellanina, el ácido iboténico y el muscimol. Una causa común del envenenamiento por ingestión de hongos venenosos es la falta de conocimiento de las especies tóxicas. Se llama micetismo a la intoxicación o envenenamiento causado por la ingestión de macromicetos que contengan o produzcan sustancias que no pueden ser descompuestas por los procesos digestivos y metabólicos del ser humano y que, al ser absorbidas, provocan reacciones tóxicas que causan desde un cuadro diarreico sin complicaciones hasta la muerte por destrucción hepática y/o renal.​"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D1%8F%D1%82%D0%BD%D0%B8%D1%81%D1%82%D1%8B%D0%B9_%D0%BC%D0%BE%D1%80%D1%81%D0%BA%D0%BE%D0%B9_%D0%B0%D0%BD%D0%B3%D0%B5%D0%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Squatina_tergocellata.jpg","page_title":"Пятнистый морской ангел","context_page_description":"Пятнистый морской ангел, или южноавстралийская глазчатая скватина — вид рода плоскотелых акул одноимённого семейства отряда скватинообразных. Эти акулы встречаются в восточной части Индийского океана на глубине до 400 м. Максимальная зарегистрированная длина 140 см. У них уплощённые голова и тело, внешне они похожи на скатов, но в отличие от последних жабры скватин расположены по бокам туловища и рот находится в передней части рыла, а не на вентральной поверхности. Эти акулы размножаются путём яйцеживорождения. Рацион состоит из небольших рыб и головоногих. Представляют незначительный интерес для коммерческого рыбного промысла."},{"page_url":"https://en.wikipedia.org/wiki/Villa_de_Mazo","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/59/Airport_La_Palma.jpg","page_title":"Villa de Mazo","context_page_description":"Villa de Mazo is a town and a municipality on the island of La Palma, Province of Santa Cruz de Tenerife, Canary Islands, Spain. It is situated in the southeastern part of the island. The population of the municipality is 4,858 and the area is 71.17 km². Villa de Mazo is 9 km south of the island capital Santa Cruz de La Palma. La Palma Airport is located on the coast of Villa de Mazo."},{"page_url":"https://pl.wikipedia.org/wiki/Bia%C5%82eb%C5%82oto-Kobyla","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Cha%C5%82upa_Bia%C5%82eb%C5%82oto-Kobyla_1.jpg","page_title":"Białebłoto-Kobyla","context_page_description":"Białebłoto-Kobyla – wieś w Polsce położona w województwie mazowieckim, w powiecie wyszkowskim, w gminie Brańszczyk. Leży na terenie Puszczy Białej.\\n31 grudnia 2013 roku sołectwo liczyło 403 mieszkańców zameldowanych na pobyt stały, a 31 grudnia 2019 roku 410 mieszkańców."},{"page_url":"https://simple.wikipedia.org/wiki/The_Settlers_of_Catan","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d4/Gen_Con_-_20030724_-_Giant_Settlers_of_Catan_Game.jpg","page_title":"The Settlers of Catan","context_page_description":"The Settlers of Catan, sometimes called Catan or Settlers for short, is a board game. More than one person plays Catan at a time. The Settlers of Catan was designed by Klaus Teuber and first published in 1995 in Germany by Franckh-Kosmos Verlag as Die Siedler von Catan. People play as settlers, each try to build holdings while trading and getting resources. Players get points as their settlements grow. The first player to reach a set number of points, usually 10, wins. The game and its many expansions are also published by Mayfair Games, Filosofia, Capcom, 999 Games, Κάισσα, and Devir.\\nThe Settlers of Catan became one of the first German-style board games to become popular outside Europe. As of 2015, more than 22 million copies in 30 languages had been sold.\\nThe game involves a lot of strategy, while still being fairly easy to learn."},{"page_url":"https://sh.wikipedia.org/wiki/Krunoslav_Jur%C4%8Di%C4%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Krunoslav_Jur%C4%8Di%C4%87_04-2009.jpg","page_title":"Krunoslav Jurčić","context_page_description":"Krunoslav Jurčić bivši je hrvatski nogometni reprezentativac i sadašnji trener."},{"page_url":"https://de.wikipedia.org/wiki/Gliederung_des_Feldheeres_(Bundeswehr,_Heeresstruktur_4)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/GebPzGrenBtl_222..png","page_title":"Gliederung des Feldheeres (Bundeswehr, Heeresstruktur 4)","context_page_description":"Die Gliederung des Feldheeres der Bundeswehr in der Heeresstruktur 4 beschreibt die Truppenteile des Feldheeres im Zeitraum von 1980 bis 1992. Die Heeresstruktur 4 beschreibt damit die Aufstellung des Feldheeres zum Ende des Kalten Krieges.\\nDas Feldheer ist Teil des Heeres der Bundeswehr. Die weitere Gliederung der anderen Teilbereiche des Heeres finden sich in:\\nTeil 1 – Einleitung und Aufbau der Listen, Führung des Heeres, Gliederung des Heeresamtes und nachgeordneter Bereich\\nTeil 2 – Feldheer: Gliederung des Feldheeres (Bundeswehr, Heeresstruktur 4)\\nTeil 3 – Territorialheer: Gliederung des Territorialheeres (Bundeswehr, Heeresstruktur 4)"},{"page_url":"https://es.wikipedia.org/wiki/Planetario_Chile","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Planetario-exterior--2014.jpg","page_title":"Planetario Chile","context_page_description":"El Planetario Chile, también conocido como Planetario de la Universidad de Santiago de Chile o Planetario Usach, está ubicado en las dependencias de dicha universidad en la comuna de Estación Central, Santiago de Chile. Desde su inauguración en la década de 1980 se ha convertido en uno de los principales escenarios turísticos de Santiago.​ Es uno de los 50 centros audiovisuales de difusión astronómica más reputados en el mundo, ​ y su cúpula de 20 metros de diámetro lo sitúan entre los planetarios de mayor tamaño.​"},{"page_url":"https://en.wikipedia.org/wiki/Apostasy","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Rechtsgutachten_betr_Apostasie_im_Islam.jpg","page_title":"Apostasy","context_page_description":"Apostasy is the formal disaffiliation from, abandonment of, or renunciation of a religion by a person. It can also be defined within the broader context of embracing an opinion that is contrary to one's previous religious beliefs. One who undertakes apostasy is known as an apostate. Undertaking apostasy is called apostatizing. The term apostasy is used by sociologists to mean the renunciation and criticism of, or opposition to, a person's former religion, in a technical sense, with no pejorative connotation.\\nOccasionally, the term is also used metaphorically to refer to the renunciation of a non-religious belief or cause, such as a political party, social movement, or sports team.\\nApostasy is generally not a self-definition: few former believers call themselves apostates due to the term's negative connotation.\\nMany religious groups and some states punish apostates; this may be the official policy of a particular religious group or it may simply be the voluntary action of its members. Such punishments may include shunning, excommunication, verbal abuse, physical violence or even execution."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%88%97%E5%A4%AB%C2%B7%E4%BD%A9%E7%BD%97%E5%A4%AB%E6%96%AF%E5%9F%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Count_Lev_Alekseevich_Perovski.jpg","page_title":"列夫·佩罗夫斯基","context_page_description":"列夫·阿列克谢耶维奇·佩罗夫斯基，俄罗斯帝国贵族，伯爵，矿物学家。他曾为沙皇尼古拉一世担任内政部长。\\n1845年，他提议创建了俄罗斯地理学会。\\n他并不是钙钛矿的发现人，但钙钛矿的英文名Perovskite以他的姓氏命名。"},{"page_url":"https://en.wikipedia.org/wiki/Old_City_(Bern)","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/17/Zytglogge_01.jpg","page_title":"Old City (Bern)","context_page_description":"The Old City is the medieval city center of Bern, Switzerland. Built on a narrow hill surrounded on three sides by the river Aare, its compact layout has remained essentially unchanged since its construction during the twelfth to the fifteenth century. Despite a major fire in 1405, after which much of the city was rebuilt in sandstone, and substantial construction efforts in the eighteenth century, Bern's old city has retained its medieval character.\\nThe Old City is home to Switzerland's tallest minster as well as other churches, bridges and a large collection of Renaissance fountains. In addition to many historical buildings, the seats of the federal, cantonal and municipal government are also situated in the Old City. It is a UNESCO Cultural World Heritage Site since 1983 due to the compact and generally intact medieval core and is an excellent example of incorporating the modern world into a medieval city. Numerous buildings in the Old City have been designated as Swiss Cultural Properties of National Significance, as well as the entire Old City."},{"page_url":"https://en.wikipedia.org/wiki/Group_Medal_of_the_Four_Day_Marches","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Vierdaagse_Group_Medal_1977.jpg","page_title":"Group Medal of the Four Day Marches","context_page_description":"The Group Medal of the Four Day Marches is a non wearable bronze presentation medal awarded to each registered group who successfully completes all four days of the International Four Days Marches Nijmegen held annually at Nijmegen, Netherlands."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%B9%AD%EC%A7%B1_%EC%B2%A0%EB%A1%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/TibetanRailwayBridge.jpg","page_title":"칭짱 철로","context_page_description":"칭짱철도는 중화인민공화국 서부의 칭하이 성 시닝 시와 티베트 자치구 라싸 시를 연결하는 철도이다. 청장철로, 청장철도라고도 불린다. 총길이는 1,956km이다.\\n서부 대개발의 대표적인 프로젝트로서 2007년에 완공될 예정 이었지만, 1년 정도 앞당겨져 2006년 7월 1일에 전 노선이 개통되었다.\\n외국인이 라싸까지 승차하는 경우에는 티베트 입역허가서가 필요하고, 여행사에서 주최하는 투어에 참가해야 한다. 때로는 형식상 투어에 참가하거나 개인 여행으로 승차하는 것도 가능하지만, 승차권의 대부분은 단체전용으로 판매되고 있기 때문에 이 방법으로 승차권을 구입하기는 쉽지 않다.\\n철도 부설로 티베트 지역의 경제 발전이 기대되기도 하지만, 티베트 망명 정부는 자치구 내에서 폭동 등이 발생했을 때 중국인민해방군의 전차 부대 등 진압 병력 수송용으로 이용되는 것을 경계하고 있다."},{"page_url":"https://cs.wikipedia.org/wiki/BMW_%C5%99ady_5_(E28)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/E28_BMW_M535i_zinnoberrot.jpg","page_title":"BMW řady 5 (E28)","context_page_description":"BMW E28 je druhá generace BMW řady 5, vyráběná od roku 1981 do roku 1988. jedná se o nástupce E12 a byla zpočátku vyráběna s benzínovými 4válcovými a 6válcovými motory. V roce 1983 přibyl dieselový motor poprvé v historii 5. řady. E28 byla také první nabízející středovou konzoli natočenou pod úhlem směrem k řidiči a s možností systému ABS. E28 byla nahrazena svým nástupcem E34 v roce 1988.\\nBěhem produkce E28 byl také poprvé představen model BMW M5, poháněný šestiválcovými motory S38B35 a M88/3."},{"page_url":"https://en.wikipedia.org/wiki/Khoisan_languages","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/KhoisanLanguagesModernDistribution.png","page_title":"Khoisan languages","context_page_description":"The Khoisan languages are a group of African languages originally classified together by Joseph Greenberg. Khoisan languages share click consonants and do not belong to other African language families. For much of the 20th century, they were thought to be genealogically related to each other, but this is no longer accepted. They are now held to comprise three distinct language families and two language isolates.\\nAll Khoisan languages but two are indigenous to southern Africa and belong to three language families. The Khoe family appears to have migrated to southern Africa not long before the Bantu expansion. Ethnically, their speakers are the Khoikhoi and the San. Two languages of east Africa, those of the Sandawe and Hadza, originally were also classified as Khoisan, although their speakers are ethnically neither Khoikhoi nor San.\\nBefore the Bantu expansion, Khoisan languages, or languages like them, were likely spread throughout southern and eastern Africa. They are currently restricted to the Kalahari Desert, primarily in Namibia and Botswana, and to the Rift Valley in central Tanzania.\\nMost of the languages are endangered, and several are moribund or extinct."},{"page_url":"https://de.wikipedia.org/wiki/Carletonit","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Carletonit_Kristallzeichnung.png","page_title":"Carletonit","context_page_description":"Carletonit ist ein sehr selten vorkommendes Mineral aus der Mineralklasse der „Silikate und Germanate“. Es kristallisiert im tetragonalen Kristallsystem mit der chemischen Formel KNa₄Ca₄[|(CO₃)₄|Si₈O₁₈]·H₂O, ist also chemisch gesehen ein wasserhaltiges Kalium-Natrium-Calcium-Silicat mit zusätzlichen Karbonat-Gruppen und Hydroxidionen bzw. Fluoridionen, das strukturell zu den Schichtsilikaten gehört. Die in den runden Klammern angegebenen Bestandteile Fluorid- und Hydroxidionen können sich in der Formel jeweils gegenseitig vertreten, stehen jedoch immer im selben Mengenverhältnis zu den anderen Bestandteilen des Minerals.\\nCarletonit bildet bis 6 cm große, nach {001} prismatische Kristalle, die entweder farblos sind oder rosa bzw. hell- bis dunkelblaue Farbtöne zeigen und dabei gewöhnlich zoniert sind. Daneben existieren massive derbe Aggregate in Marmor.\\nDas Mineral wird im intrusiven Gabbro-Syenit-Alkalikomplex von Mont Saint-Hilaire gefunden und tritt in Kernbereichen thermometamorph beanspruchter Nebengestein­sxenolithe aus Schiefern und zwischengeschalteten Kalksteinen innerhalb von Nephelinsyeniten auf."},{"page_url":"https://si.wikipedia.org/wiki/%E0%B6%A0%E0%B7%8F%E0%B6%BB%E0%B7%92%E0%B6%AD%E2%80%8D%E0%B7%8A%E2%80%8D%E0%B6%BB%E0%B7%8F%E0%B6%B1%E0%B7%94%E0%B6%9A%E0%B7%96%E0%B6%BD_%E0%B6%B1%E0%B6%BB%E0%B7%8A%E0%B6%AD%E0%B6%B1%E0%B6%BA","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ec/Bharatanatyam_16.jpg","page_title":"චාරිත‍්‍රානුකූල නර්තනය","context_page_description":"චාරිත‍්‍රානුකූල නර්තනය නර්තන වර්ගීකරණයේ ප‍්‍රධාන කොටසකි. එහි පරමාර්ථය චාරිත‍්‍රානුකූල හෝ උත්සවාකාර විය හැක.\\nමෙයට ඇතුලත් නර්තන සම්ප‍්‍රදායෝ නම්\\n- තරගකාරී නර්තනය, ශෲංගාරාත්මක නර්තනය, උපයෝගී නර්තනය, ප‍්‍රසාංගික නර්තනය, සමාජයීය නර්තනය\\nඋත්සව නර්තනය\\nසැනකෙලි නර්තනය\\nඉපැරණි ශිෂ්ටාචාර වල නර්තන\\nපුරාණ ග‍්‍රීසිය\\nපුරාණ රෝමය\\nසාම්ප‍්‍රදායික ඉන්දියානු නර්තන\\nපූජා ඉන්ද්‍රජාලික අත්භූත හෝ ආත්මික නර්තනය\\nසර්කල් ඩාන්ස්\\nකොරොබොර්රී\\nවිශ්වීය සාමයේ නර්තනය\\nආගමික නර්තන\\nඉන්දියානු පූජා නර්තන\\nසේමා හෙවත් ඩර්විශ් නර්තන\\nයුධ නැටුම්\\nආයුධ නැටුම්"},{"page_url":"https://it.wikipedia.org/wiki/Grant_Holloway","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/2018_NCAA_Division_I_Indoor_Track_and_Field_Championships_%2839859882395%29.jpg","page_title":"Grant Holloway","context_page_description":"Grant Holloway è un ostacolista statunitense, campione mondiale dei 110 metri ostacoli a Doha 2019."},{"page_url":"https://it.wikipedia.org/wiki/Lie_to_Me","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Monica_Raymund.jpg","page_title":"Lie to Me","context_page_description":"Lie to Me è una serie televisiva statunitense prodotta dal 2009 al 2011.\\nRealizzata dagli stessi produttori di 24, la serie vede protagonista Tim Roth nei panni di Cal Lightman, uno psicologo esperto della comunicazione non verbale ed infallibile nel capire quando una persona non dice la verità, il quale mette questa sua conoscenza al servizio della giustizia.\\nLa serie è stata trasmessa in prima visione negli Stati Uniti da Fox dal 21 gennaio 2009. In Italia è stata trasmessa in prima visione satellitare da Fox a partire dal 7 settembre 2009, e successivamente trasmessa in chiaro dall'11 settembre 2010, prima da Rete 4 e poi da TOP Crime."},{"page_url":"https://de.wikipedia.org/wiki/U-Bahn-Station_Schlachthausgasse","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Schlachthausgasse.JPG","page_title":"U-Bahn-Station Schlachthausgasse","context_page_description":"Die U-Bahn-Station Schlachthausgasse ist eine Station der Wiener U-Bahn-Linie U3. Sie befindet sich im 3. Wiener Gemeindebezirk Landstraße unter der Markhofgasse und dem Alfred-Dallinger-Platz. Die namensgebende Schlachthausgasse, heute eine wichtige Nebendurchzugsstraße des 3. Bezirks, deren Name sich von den einstmals nahegelegenen Schlachthöfen in Sankt Marx ableitet, verläuft an der Oberfläche über der Station quer zu den Gleisen. Eröffnet wurde die Station am 6. April 1991 mit dem ersten Teilstück der U3.\\nDie zweigleisige Station verfügt über einen Mittelbahnsteig und Ausgänge an beiden Bahnsteigenden. Der stadteinwärts gelegene Ausgang ist mit festen Stiegen und einem Aufzug ausgestattet. Das dortige Aufnahmegebäude besitzt Ausgänge zur Schlachthausgasse und zum Hainburger Weg, die aufgrund der Gegebenheiten des dortigen Geländes übereinander angeordnet und außerhalb der Station durch eine Freitreppe verbunden sind. Der östliche Ausgang zur Markhofgasse verfügt neben einer Festtreppe und einem Aufzug auch über eine Rolltreppe.\\nVor dem Aufnahmegebäude in der Markhofgasse befinden sich die östliche Endstation der Straßenbahnlinie 18 und die Haltestellen der Autobuslinie 77A."},{"page_url":"https://nl.wikipedia.org/wiki/Wapen_van_Duivendijke","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Duivendijke_wapen.svg","page_title":"Wapen van Duivendijke","context_page_description":"Het wapen van Duivendijke werd op 31 juli 1817 bevestigd door de Hoge Raad van Adel aan de Zeeuwse gemeente Duivendijke. Per 1961 ging Duivendijke op in de gemeente Middenschouwen, sinds 1997 onderdeel van gemeente Schouwen-Duiveland. Het wapen van Duivendijke is daardoor definitief komen te vervallen als gemeentewapen. In het wapen van Middenschouwen is één duif uit het wapen van Duivendijke opgenomen."},{"page_url":"https://fr.wikipedia.org/wiki/March%C3%A9_automobile_fran%C3%A7ais_en_2008","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/18/Hyundai_Veracruz.jpg","page_title":"Marché automobile français en 2008","context_page_description":"Le marché automobile français des voitures particulières en 2008 s'est établi à 2 050 289 unités vendues, soit une baisse de 0,7 % par rapport à 2007.\\nLe marché français a connu plusieurs bouleversements en 2008 :\\nLe premier d'entre eux est l'instauration du bonus-malus écologique au 1ᵉʳ janvier. Cela a permis aux petits modèles de bien se vendre, mais a déstabilisé les gros modèles ;\\nLe second bouleversement est la flambée du prix des carburants durant l'été 2008, ce qui a pénalisé les ventes des véhicules les moins sobres ;\\nLe troisième bouleversement est la crise financière survenue en septembre 2008 en France et qui fait chuter les ventes en raison du nombre réduit de prêts accordés par les banques.\\nLe bonus-malus écologique a eu un effet bénéfique sur les ventes de voitures neuves, +4,5 % après six mois d'application. Mais la forte augmentation du prix des carburants et surtout l'arrivée soudaine de la crise financière ont fait que le marché automobile a décru de 6,3 % lors du second trimestre."},{"page_url":"https://ur.wikipedia.org/wiki/%DA%A9%DB%8C%D9%86%D9%B9_%DA%A9%D8%A7%D8%A4%D9%86%D9%B9%DB%8C%D8%8C_%DA%88%DB%8C%D9%84%D8%A7%D9%88%DB%8C%D8%A6%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Kent_County_Courthouse_Dover.jpg","page_title":"کینٹ کاؤنٹی، ڈیلاویئر","context_page_description":"کینٹ کاؤنٹی، ڈیلاویئر ریاستہائے متحدہ امریکا کا ایک کاؤنٹی جو ڈیلاویئر میں واقع ہے۔"},{"page_url":"https://en.wikipedia.org/wiki/Lehigh_Carbon_Community_College","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Lehigh_Carbon_Community_College_Main_Campus.jpg","page_title":"Lehigh Carbon Community College","context_page_description":"Lehigh Carbon Community College is a public community college in Schnecksville, Pennsylvania, in the Lehigh Valley region of the state. The school serves as the primary granter of associate degrees in the Allentown area.\\nLCCC was founded on March 31, 1966 as Lehigh County Community College, and it originally held classes in the former Lehigh County Courthouse. In 1972, modern facilities were constructed, which laid the foundation for its current campus. In order to increase enrollment from nearby Carbon County, the school decided on its current name in 1994.\\nThe college also has learning centers in several off-campus locations, including at the Donley Center in Downtown Allentown, the Carbon Center in Jim Thorpe, and at the John Morgan Center in Tamaqua, Schuylkill County."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%BA%AC%E9%83%BD%E8%BF%8E%E8%B3%93%E9%A4%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Juraku-no-Ma_02.jpg","page_title":"京都迎賓館","context_page_description":"京都迎賓館は、京都府京都市に位置する日本の迎賓館。"},{"page_url":"https://zh.wikipedia.org/wiki/%E5%A4%A7%E5%9C%B0%E5%8B%87%E5%A3%AB%E5%96%AE%E5%85%B5%E4%BD%9C%E6%88%B0%E7%B3%BB%E7%B5%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/LW_high5.jpg","page_title":"大地勇士單兵作戰系統","context_page_description":"大地勇士單兵作戰系統是美軍研發中的未來單兵戰鬥套裝，著重於資訊化戰場C4ISR連線。"},{"page_url":"https://nl.wikipedia.org/wiki/Damas-aux-Bois","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Damas-aux-Bois%2C_Mairie.jpg","page_title":"Damas-aux-Bois","context_page_description":"Damas-aux-Bois is een gemeente in het Franse departement Vosges en telt 236 inwoners. De plaats maakt deel uit van het arrondissement Épinal."},{"page_url":"https://en.wikipedia.org/wiki/Giselle_Washington","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Giselle_Washington.jpg","page_title":"Giselle Washington","context_page_description":"Giselle Monne Washington is an American-born Jamaican footballer who plays as a midfielder for the Tennessee Lady Volunteers and the Jamaica women's national team."},{"page_url":"https://lt.wikipedia.org/wiki/Kretingos_technologijos_ir_verslo_mokykla","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Kretingsodis%2C_profesin%C4%97_mokykla.JPG","page_title":"Kretingos technologijos ir verslo mokykla","context_page_description":"Kretingos technologijos ir verslo mokykla, KTVM – viešoji įstaiga, profesinio mokymo įstaiga, įsikūrusi Kretingos rajone, Kretingsodyje, teikianti pirminį ir tęstinį profesinį mokymą, vidurinį išsilavinimą. Įstaigos kodas – 190804938. Mokyklos steigėja – LR švietimo ir mokslo ministerija. Dėstoma lietuvių kalba.\\nMokoma šių profesijų: virėjo, automobilių mechaniko, technikos priežiūros verslo darbuotojo, logisto ekspeditoriaus, dekoratyvinio želdinimo ir aplinkos tvarkymo verslo darbuotojo. Papildomai galima įgyti TR1 traktorininko bei B kategorijos vairuotojo kvalifikcijas. Gimnazijos skyriuje įgyjamas vidurinis išsilavinimas."},{"page_url":"https://fi.wikipedia.org/wiki/Calgary","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5a/Calgarymontage5.jpg","page_title":"Calgary","context_page_description":"Calgary on kaupunki, joka sijaitsee Kalliovuorten itäpuolella Albertan provinssin eteläosassa Länsi-Kanadassa. Sen väkiluku on noin 1,27 miljoonaa. Calgary on väkiluvussa mitattuna Albertan suurin ja Kanadan kolmanneksi suurin ja nopeimmin kasvava kaupunki. Calgary sijaitsee noin 277 kilometriä etelään Edmontonista, provinssin pääkaupungista."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A3%D8%B1%D9%86%D8%A8_%D8%A8%D8%B1%D8%A7%D8%B2%D9%8A%D9%84%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Tapeti_area.png","page_title":"أرنب برازيلي","context_page_description":"الأرنب البرازيلي أو أرنب البرازيلي قطني الذيل، هو نوع من الثدييات يتبع فصيلة الأرانب ضمن رتبة الأرنبيات. يتبع هذا النوع جنس أرانب قطنية الذيل، يستوطن البلدان من جنوب المكسيك حتى شمال الأرجنتين."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D1%83%D0%BF%D0%B5%D1%82%D0%B0%D1%80","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8c/Supetar%2C_Bra%C4%8D_-_view_from_the_ferryboat.jpg","page_title":"Супетар","context_page_description":"Супетар — місто в Хорватії, розташоване на північному узбережжі острова Брач, найважливіший для сполучення острова з материковою Хорватією поромний порт. Центр однойменної громади, що входить до Сплітсько-Далматинської жупанії. Офіційний центр острова з 1827 р.\\nПри населенні в 3213 осіб, Супетар — це найбільше місто острова, його економічне, культурне і туристичне осереддя, в якому проживає п'ята частина острів'ян, адже місто розростається найшвидшими темпами, будуючи щороку десятки квартир. Офіційною мовою є хорватська, однак більшість жителів говорять також англійською, італійською та німецькою мовами."},{"page_url":"https://en.wikipedia.org/wiki/List_of_mausolea_and_shrines_in_Pakistan","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Darbar.jpg","page_title":"List of mausolea and shrines in Pakistan","context_page_description":"Pakistan has a number of shrines that have become places of pilgrimage. They include mausolea and shrines of political leaders, shrines of religious leaders and pirs and shrines of leaders of various Islamic empires and dynasties."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B0%D0%BB%D0%B8%D0%BD%D0%B0%D0%BB%D1%8C%D0%BA%D0%BE_(%D0%BC%D1%83%D0%BD%D0%B8%D1%86%D0%B8%D0%BF%D0%B0%D0%BB%D0%B8%D1%82%D0%B5%D1%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Escudo_Malinalco.png","page_title":"Малиналько (муниципалитет)","context_page_description":"Малиналько — муниципалитет в Мексике, входит в штат Мехико. Население — 20 157 человек."},{"page_url":"https://fr.wikipedia.org/wiki/Physiologie_des_dinosaures","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ef/Illu_nose_nasal_cavities.png","page_title":"Physiologie des dinosaures","context_page_description":"La physiologie des dinosaures a toujours été un sujet de controverse, en particulier en ce qui concerne leur thermorégulation. Récemment, de nombreuses informations nouvelles ont été apportées sur la physiologie des dinosaures en général, non seulement sur les systèmes métaboliques et de thermorégulation, mais aussi sur les appareils respiratoires et cardiovasculaires.\\nPendant les premières années d'étude de la paléontologie des dinosaures, on a souvent pensé que les dinosaures étaient de gigantesques lézards lents et lourds. Cependant, avec la découverte, commencée dans les années 1870, de beaucoup plus de squelettes complets dans l'ouest des États-Unis, les scientifiques purent faire des reconstitutions plus précises de la biologie et de la physiologie des dinosaures. Edward Drinker Cope, adversaire de Othniel Charles Marsh dans la guerre des os, pensait qu'au moins quelques dinosaures étaient actifs et agiles, comme on peut le voir dans la peinture ci-contre montrant le combat de deux Laelaps, réalisée sous sa direction par Charles R. Knight."},{"page_url":"https://ms.wikipedia.org/wiki/Mentega_syea","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Vitellaria_paradoxa_MS4195.JPG","page_title":"Mentega syea","context_page_description":"Mentega syea ialah lemak yang diekstrak dari kacang pokok shea dari benua Afrika. Ia biasanya berwarna kuning dalam keadaan mentah, dan warna kegadingan atau putih apabila ditapiskan. Mentega ini ialah trigliserida berasal terutamanya dari asid stearik dan asid oleik. Ia digunakan dalam kosmetik sebagai pelembap, salap atau losyen. Shea boleh dimakan dan digunakan dalam penyediaan makanan di Afrika. Ia juga kadangkalanya digunakan dalam industri coklat sebagai pengganti mentega koko dalam campuran dengan minyak lain, walaupun rasa produk akhirnya mempunyai perbezaan ketara.\\nNama \\"syea\\" datangnya dari s'í, iaitu nama pokok ini dalam bahasa Bambara di Mali melalui istilah bahasa Inggeris iaitu \\"shea\\"."},{"page_url":"https://eu.wikipedia.org/wiki/SEAT_1400","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Seat1400.jpg","page_title":"SEAT 1400","context_page_description":"SEAT 1400 SEAT espainiar auto ekoizleak 1953 eta 1963 urteen artean ekoiztutako modeloa da. Dante Giacosa italiarrak FIAT etxearentzat diseinatutako Fiat 1400 modeloan oinarriturik lizentziapean ekoiztu zen. Jatorrizko Fiat 1400 modeloa 1950ean Ginebrako Autoaren Aretoan aurkeztu zen."},{"page_url":"https://de.wikipedia.org/wiki/Hans_Hunold","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Schule_Loogarten_Z%C3%BCrich_1975_Hans_Hunold_01.JPG","page_title":"Hans Hunold","context_page_description":"Hans Hunold war ein Schweizer Maler, Bildhauer und Grafiker. Er war bekannt für seine künstlerische Ausgestaltung öffentlicher Gebäude."},{"page_url":"https://en.wikipedia.org/wiki/List_of_reservoirs_by_surface_area","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Robert-Bourassa_Reservoir.jpg","page_title":"List of reservoirs by surface area","context_page_description":"This is a listing of the reservoirs in the world with a surface area exceeding 500 km². Reservoirs can be formed conventionally, by damming the outlet of a canyon or valley to form a lake; the largest of this type is Ghana's Lake Volta, with a water surface of 8,500 km². Reservoirs can also be formed by damming the outlets of natural lakes to regulate water levels, such as those at Uganda's Owen Falls Dam and Russia's Irkutsk Dam. These are included and indicated with light blue cell background.\\nLarge reservoir area does not necessarily coincide with large volume, as reservoirs with a large area tend to be shallow, such as at Suriname's 1,560 km² Brokopondo Reservoir, with an average depth of just 13 m. In comparison, Canada's Kinbasket Lake, with an average depth of 58 m, has a volume 25 percent greater – but with a surface area of just 430 km², does not meet the cutoff for inclusion in this list."},{"page_url":"https://it.wikipedia.org/wiki/Selenga","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Selenga_River_bridge.jpg","page_title":"Selenga","context_page_description":"Il Selenga o Selenge è un fiume che scorre attraverso la Mongolia e la Russia. Nasce dalla confluenza dei fiumi Iderijn gol e Dėlgėrmôrôn e sfocia, dopo un percorso di 1.024 km - di cui 615 in territorio mongolo - nel lago Baikal, di cui è uno dei principali affluenti. Percorrendo invece anche l'Ideriin gol la lunghezza del fiume arriva a 1.480 chilometri. Copre un bacino di 945.480 km². Da novembre a metà maggio il fiume è ghiacciato."},{"page_url":"https://it.wikipedia.org/wiki/Jin_Shan","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Jinshan_1930s.png","page_title":"Jin Shan","context_page_description":"Jin Shan è stato un attore cinese.\\nIn occasione del centenario della nascita dell'industria cinematografica in Cina nel 2005, la China Film Performance Art Academy l'ha inserito nella lista dei \\"100 migliori attori in 100 anni di cinema cinese\\"."},{"page_url":"https://fr.wikipedia.org/wiki/Paulista_(m%C3%A9tro_de_S%C3%A3o_Paulo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Estacao_Paulista.jpg","page_title":"Paulista (métro de São Paulo)","context_page_description":"Paulista est une station de métro de la ligne 4 - Jaune du métro de São Paulo exploitée par ViaQuatro, et est située dans le district de Consolação. Elle possède connexion gratuite avec la station Consolação, de la ligne 2 - Verte, exploitée par le métro de São Paulo."},{"page_url":"https://en.wikipedia.org/wiki/Jahmir_Hyka","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Jahmir_Hyka.jpg","page_title":"Jahmir Hyka","context_page_description":"Jahmir Hyka is an Albanian professional footballer who plays as a left midfielder for Guizhou Hengfeng in China League One and the Albanian national team.\\nA Dinamo Tirana product, Hyka started his professional career in Norway at Rosenborg where did not make a league appearance. He moved to Greek club Olympiacos in 2007, again failing to make a league appearance and who then sent him on loan to Tirana. Hyka's performances at Tirana earned him a move to 1. FSV Mainz 05 of the 2. Bundesliga in 2008 where he made his German top flight debut in 2009. He played for Panionios in the first half of 2010–11 before returning to Tirana in January 2011 and helping KF Tirana to clinch the Albanian Cup. In the summer of 2011, he left Albania again to join Luzern in Switzerland, where he made more than 150 appearances in six years. In February 2017, he signed with San Jose Earthquakes in Major League Soccer.\\nIn January 2019 Jahmir Hyka signed with Maccabi Netanya a contract for 1.5 years.\\nHyka represented Albania at youth levels, playing for the under-17, under-19 and under-21 levels. He made his senior debut in 2007 and one year later scored Albania's fastest goal in history."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_parcs_d%27%C3%89tat_du_Nevada","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Echocyn.jpg","page_title":"Liste des parcs d'État du Nevada","context_page_description":"Liste des parcs d'État du Nevada aux États-Unis d'Amérique par ordre alphabétique. Ils sont gérés par le Nevada Division of State Parks.\\nBeaver Dam\\nBelmont Courthouse\\nBerlin-Ichthyosaur\\nBig Bend\\nCathedral Gorge\\nCave Lake\\nDayton\\nEcho Canyon\\nFloyd Lamb\\nFort Churchill\\nKershaw-Ryan\\nLahontan\\nLake Tahoe-Nevada\\nMormon Station\\nOld Las Vegas Mormon\\nRye Patch\\nSouth Fork\\nSpring Mountain Ranch\\nSpring Valley\\nValley of Fire\\nWalker Lake\\nWard Charcoal Ovens\\nWashoe Lake\\nWild Horse"},{"page_url":"https://sk.wikipedia.org/wiki/Obi%C5%A1ovce","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Obisovce15Slovakia9.JPG","page_title":"Obišovce","context_page_description":"Obišovce sú obec na Slovensku v okrese Košice-okolie."},{"page_url":"https://es.wikipedia.org/wiki/Carlos_Gardel","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Gardel_coffin_BAires_1936.jpg","page_title":"Carlos Gardel","context_page_description":"Carlos Gardel fue un cantante, compositor y actor de cine. Es el más conocido representante en la historia del tango. Iniciador y máximo exponente del tango canción, ​ fue uno de los intérpretes más importantes de la música popular mundial en la primera mitad del siglo XX, ​ por la calidad de su voz, por la cantidad de discos vendidos, por sus numerosas películas relacionadas con el tango y por su repercusión mundial.\\nNo hay unanimidad sobre el lugar y la fecha de su nacimiento. La hipótesis uruguayista sostiene que nació en Tacuarembó, un 11 de diciembre entre 1883 y 1887. La hipótesis francesista sostiene que nació en Toulouse el 11 de diciembre de 1890.\\nHay unanimidad en el hecho de que vivió desde su infancia en Buenos Aires y se nacionalizó argentino en 1923. Falleció el 24 de junio de 1935 en Medellín, Colombia, en un accidente aéreo.\\nLa persona y la imagen de Gardel ha sido objeto de idolatría popular, especialmente en Argentina y Uruguay, colocándolo en un lugar de mito y símbolo cultural que aún mantiene su vigencia.​"},{"page_url":"https://hu.wikipedia.org/wiki/Teleki%E2%80%93Mikes-palota","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Kolozsvar_Unio_utca_Teleki_Mikes_haz.jpg","page_title":"Teleki–Mikes-palota","context_page_description":"A Teleki–Mikes-palota a kolozsvári Unió utca egyik műemlék épülete. A romániai műemlékek jegyzékében a CJ-II-m-B-07399 sorszámon szerepel."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%BC%97%E9%9B%B7%E8%AE%B7%E8%8E%B1%E8%92%99%E6%89%98%E9%82%A6","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1a/Map_commune_FR_insee_code_62355.png","page_title":"弗雷讷莱蒙托邦","context_page_description":"弗雷訥萊蒙托邦是法國北部-加來海峽大區加來海峽省的一個市鎮，屬於阿拉斯區維特里昂納圖瓦縣。該市鎮2009年時的人口為572人。"},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89lections_de_2010_en_Caroline_du_Sud","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/AlvinGreene1.jpg","page_title":"Élections de 2010 en Caroline du Sud","context_page_description":"Les électeurs de Caroline du Sud ont été appelés aux urnes le 2 novembre 2010. Les élections primaires ont eu lieu le 8 et le 22 juin 2010. Historiquement considéré comme un État raciste et ultra-conservateur, la Caroline du Sud surprend les analystes politiques en 2010, lorsque les électeurs désignent lors des primaires Nikki Haley une ex-sikh d'origine indienne au poste de gouverneur, et deux afro-américains Alvin Greene et Tim Scott à des postes clefs du congrès.\\nLe jour de l'élection générale, les républicains s'imposent largement tant au niveau national qu'au niveau local. À noter que les deux candidats républicains issue de la diversité, Nikki Haley et Tim Scott ont été élus au soir du 2 novembre."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%A2%E3%83%B3%E3%83%90%E3%83%BC%E3%83%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Montbard_-_Rue_Edm%C3%A9-Piot.jpg","page_title":"モンバール","context_page_description":"モンバールは、フランス東部、ブルゴーニュ＝フランシュ＝コンテ地域圏コート＝ドール県西部にある人口約6千人の小さなコミューンである。"},{"page_url":"https://eo.wikipedia.org/wiki/E%C5%ADrazia_kotino","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Purple_Smoke_Bush1.jpg","page_title":"Eŭrazia kotino","context_page_description":"La Eŭrazia kotino aŭ perukarbedo estas specio indiĝena en granda areo de suda Eŭropo, oriente ĝi troviĝas tra tuta Mezazio kaj Himalajo ĝis norda Ĉinujo."},{"page_url":"https://fr.wikipedia.org/wiki/Gaufre_de_pommes_de_terre","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Potato_Waffle_isolated.jpg","page_title":"Gaufre de pommes de terre","context_page_description":"La gaufre de pommes de terre est faite d'une pâte à base de pomme de terre râpée et cuite dans un gaufrier. Elle est fréquemment consommée dans les pays anglo-saxons comme le Royaume-Uni, l’Irlande et les États-Unis où elle est utilisée comme mets d'accompagnement ou pour une restauration rapide.\\nCe type de gaufre se trouve dans le commerce sous forme congelée ; diverses entreprises de produits surgelés, comme Birds Eye et de McCain Foods, en produisent. La gaufre congelée peut être cuite au four, grillée, préparée dans un grille-pain, ou frite."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1811","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Beecher-Stowe.jpg","page_title":"Lijst van personen geboren in 1811","context_page_description":"Dit is een lijst van personen die geboren zijn in 1811.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://it.wikipedia.org/wiki/Crithagra_mozambica","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/3hetes_Serinus_mozambicus_fi%C3%B3ka.JPG","page_title":"Crithagra mozambica","context_page_description":"Il canarino del Mozambico o canarino frontegialla è un uccello passeriforme della famiglia dei Fringillidi."},{"page_url":"https://pt.wikipedia.org/wiki/Merc%C3%BArio_(elemento_qu%C3%ADmico)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Clinical_thermometer_38.7.JPG","page_title":"Mercúrio (elemento químico)","context_page_description":"Mercúrio é um metal líquido à temperatura ambiente, conhecido desde os tempos da Grécia Antiga. Também é conhecido como hidrargírio, hidrargiro, azougue e prata-viva, entre outras denominações. Seu nome homenageia o deus romano Mercúrio, que era o mensageiro dos deuses. Essa homenagem é devida à fluidez do metal. O símbolo Hg vem do grego latinizado 'hydrargyrum' que significa prata líquida.\\nO mercúrio é um elemento químico de número atômico 80 e massa atómica 200,5 u. É um dos seis elementos que se apresentam líquidos à temperatura ambiente ou a temperaturas próximas. Os outros elementos são os metais césio, gálio, frâncio e rubídio e o não metal bromo. Dentre os seis, porém, apenas o mercúrio e o bromo são líquidos nas condições padrão de temperatura e pressão.\\nO mercúrio pertence ao grupo 12 e faz parte da classe dos metais de transição. Tal grupo é ainda chamado família do zinco, na tabela periódica.\\nNormalmente utilizado em instrumentos de medidas, lâmpadas fluorescentes e como catalisador em reações químicas."},{"page_url":"https://ast.wikipedia.org/wiki/Nebulosa_de_la_Flama","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/The_hidden_fires_of_the_Flame_Nebula.jpg","page_title":"Nebulosa de la Flama","context_page_description":"NGC2024 o La Nebulosa de la Flama ye una Nebulosa d'emisión qu'aparenta tar en llapaes. Alcuéntrase cerca de la estrella más oriental del Cinturón d'Orión, Alnitak. Equivocadamente dizse que ye una Nebulosa escura.\\nEsti efeutu dase gracies a la so lluminosidá de color acoloratáu. Los átomos d'hidróxenu de la nebulosa son costantemente ionizados pola lluz de la cercana Alnitak, que la so intensa radiación ultraviola fai-yos perder los sos electrones. Gran parte de la lluminosidá de la nebulosa produzse cuando esos electrones se recombinan col hidróxenu ionizado, dando llugar a la emisión de lluz acoloratao.\\nCerca d'esta nebulosa hai tres objetos candidatos a ser planetes gaseosos."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%B1%B9%E6%96%91%E7%8C%AA%E7%AC%BC%E8%8D%89","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/64/Kinabalu_N.%C3%97_alisaputrana.jpg","page_title":"豹斑猪笼草","context_page_description":"豹斑豬籠草呈片狀的分布於婆羅洲沙巴的金納巴魯山及坦布幼崑山附近。\\n其種加詞「burbidgeae」來源於弗雷德里克·威廉·伯比奇的姓氏「Burbidge」。\\n豹斑豬籠草可能是所有產於金納巴魯山的豬籠草中最稀有的。它典型的原生地為苔蘚森林和山地森林中低矮的灌木叢和開闊的陡峭山脊。根據2000年的評估，豹斑豬籠草已被列入了《2006年世界自然保護聯盟瀕危物種紅色名錄》中，保護狀況為瀕危。"},{"page_url":"https://ro.wikipedia.org/wiki/Comuna_Bogd%C4%83ne%C8%99ti,_Vaslui","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Bogdanesti_judetul_Vaslui.jpg","page_title":"Comuna Bogdănești, Vaslui","context_page_description":"Bogdănești este o comună în județul Vaslui, Moldova, România, formată din satele Bogdănești, Buda, Horoiata, Hupca, Orgoiești, Ulea, Unțești, Vișinari și Vlădești."},{"page_url":"https://la.wikipedia.org/wiki/Gueutteville-les-Gr%C3%A8s","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Blason_Gueutteville-les-Gr%C3%A8s.svg","page_title":"Gueutteville-les-Grès","context_page_description":"Gueutteville-les-Grès est commune Francicum 359 incolarum praefecturae Sequanae Maritimae in regione Normannia Superiori."},{"page_url":"https://de.wikipedia.org/wiki/Waschsee_(Feldberger_Seenlandschaft)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Waschsee.jpg","page_title":"Waschsee (Feldberger Seenlandschaft)","context_page_description":"Der Waschsee ist ein See nahe dem Dorf Mechow im Süden Mecklenburg-Vorpommern. Er liegt im zum Naturschutzgebiet Krüselinsee und Mechowseen. Er besteht aus zwei Becken, dem kleineren Nordbecken und dem Südbecken. Oberirdisch ist er zu- und abflusslos, er entwässert unterirdisch über den naheliegenden Weutschsee.\\nDas Wasser des Sees ist nährstoffarm und sehr klar, die Badequalität wird als ausgezeichnet eingestuft.\\nAm nördlichen und am südöstlichen Ende des Nordbeckens befindet sich jeweils eine Badestelle mit einem Steg. Der See ist durchgängig von Wald umgeben.\\nDer See ist 890 Meter lang, die maximale Breite beträgt 300 Meter im Südbecken, das 16,5 Meter tief ist, und 190 Meter in Nordbecken, das 11 Meter tief ist."},{"page_url":"https://en.wikipedia.org/wiki/Sevanaia_Koroi","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Sevania_Koroi.jpg","page_title":"Sevanaia Koroi","context_page_description":"Sevanaia Koroi is a professional rugby league footballer. He represented Fiji at the 2008 Rugby League World Cup. Koroi signed with the British side Barrow Raiders for 2009."},{"page_url":"https://et.wikipedia.org/wiki/2005._aasta_Euroopa_meistriv%C3%B5istlused_korvpallis","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Hala_Pionir_Beograd.jpg","page_title":"2005. aasta Euroopa meistrivõistlused korvpallis","context_page_description":"2005. aasta Euroopa meistrivõistlused korvpallis olid 34. Euroopa meistrivõistlused korvpallis, mis toimusid 16.–25. septembrini Serbia ja Montenegros.\\nTurniiri võitis Kreeka, kes alistas finaalis Saksamaa 78: 62."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Cormeilles-en-Vexin","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5e/Mairie_Cormeilles-en-Vexin.JPG","page_title":"Cormeilles-en-Vexin","context_page_description":"Cormeilles-en-Vexin sī ūi-tī Hoat-kok Île-de-France toā-khu Val-d'Oise koān ê chi̍t ê commune."},{"page_url":"https://de.wikipedia.org/wiki/Schloss_Beauregard","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Beauregard_castle%2C_aerial_view.jpg","page_title":"Schloss Beauregard","context_page_description":"Das Schloss Beauregard steht im Beuvrontal auf dem Gebiet der französischen Gemeinde Cellettes etwa sechs Kilometer südöstlich von Blois im Département Loir-et-Cher der Region Centre-Val de Loire.\\nDas zu den Schlössern der Loire zählende Anwesen wurde im 16. Jahrhundert als Landschloss erbaut, von seinen späteren Eigentümern aber stark verändert. Besonders während des 19. Jahrhunderts wurde ein Großteil der Gebäude abgerissen. Umgeben von einem großen Park, der zwischen 1912 und 1925 gestaltet wurde, kann das Schloss nach umfassenden Restaurierungsmaßnahmen heute gegen Entgelt besichtigt werden, obwohl es sich in Privatbesitz befindet.\\nDas Schlossgebäude steht seit 1840 unter Denkmalschutz. Sein Park wurde im September 1993 in die französische Denkmalliste aufgenommen."},{"page_url":"https://en.wikipedia.org/wiki/Great_Sandy-Tanami_desert","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Great_Sandy_Desert%2C_Australia.jpg","page_title":"Great Sandy-Tanami desert","context_page_description":"The Great Sandy-Tanami desert is a World Wildlife Fund ecoregion of Western Australia extending into the Northern Territory."},{"page_url":"https://oc.wikipedia.org/wiki/Mazinghien","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c6/Memorial_maquis_mazinghien.jpg","page_title":"Mazinghien","context_page_description":"Mazinghien es una comuna francesa del departament del Nòrd e de la region del Nòrd-Pas de Calais."},{"page_url":"https://fr.wikipedia.org/wiki/Ch%C3%A2teau_de_Chambiers","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Chateau_de_Chambiers_%281%29.jpg","page_title":"Château de Chambiers","context_page_description":"Le Château de Chambiers est un château situé sur la commune de Durtal en Maine-et-Loire."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AD%D8%A8%D8%A7%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Cuttlefish_bone.JPG","page_title":"حبار","context_page_description":"الحَبَابير هي حيوانات بحرية تتبع طائفة رأسيات الأرجل من شعبة الرخويات.\\nوطائفة رأسيات الأرجل تشتمل على الحبابير،والاخطبوطات،والنواتيّ، للحبابير صدفة كلسية داخلية تسمى بلسان البحر. مدة حياتها تتراوح بين سنة إلى سنتين."},{"page_url":"https://en.wikipedia.org/wiki/Samba_Camara","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Lens_-_Le_Havre_AC_%2801-04-2019%29_39.jpg","page_title":"Samba Camara","context_page_description":"Samba Camara is a French professional footballer who most recently played as a defender for Turkish club Sivasspor."},{"page_url":"https://en.wikipedia.org/wiki/Swan_Service","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Swan_Service%2C_teacup_and_saucer%2C_c._1737-1741%2C_Meissen%2C_modellers_Johann_Joachim_Kandler_and_Johann_Friedrich_Eberlein%2C_hard-paste_porcelain%2C_overglaze_enamels%2C_gilding_-_Gardiner_Museum%2C_Toronto_-_DSC00903.JPG","page_title":"Swan Service","context_page_description":"The Swan Service is a large service of baroque Meissen porcelain which was made for the First Minister of the Electorate of Saxony and favourite of Augustus III of Poland, Heinrich von Brühl. Augustus III had made Brühl the Supervisor of the Meissen works in 1733, then in August 1739 its Director. The Swan Service has been called \\"the most famous high baroque production in Meissen porcelain\\", \\"a triumph of modelling and firing\\", and \\"the most fabulous tableware conceived in porcelain\\". After earlier work with prototypes, the Meissen designers and modellers Johann Joachim Kändler, Johann Friedrich Eberlein and Johann Gottlieb Ehder created the service, which consists of over 2,200 individual pieces, between 1737 and 1741 or 1742.\\nA service on such a scale and with such lavish sculptural elements was unprecedented; a later large Meissen service, the Möllendorff Dinner Service of the 1760s had under 1,000 pieces."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%81%8B%E3%81%AA%E3%81%A8%E3%81%93%E9%9B%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Ambo%C3%9F_klein.jpg","page_title":"かなとこ雲","context_page_description":"かなとこ雲とは、成長した積乱雲のうち、頂上部分が広がって平らになっているもの。\\n雲形分類では、部分的に特徴のある雲を細分類した「副変種」として扱われ、積乱雲だけに見られる。\\n金属加工などで用いる金床に形状が似ていることからこう呼ばれている。学術名\\"Incus\\"も、ラテン語で「金床」を意味する。\\nてっぺんに毛羽立ったような雲がくっついている多毛雲とは似ているが異なる。ただ、かなとこは毛羽立ちの1種とみなされ、かなとこ雲は多毛雲に含められる。"},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Lescherolles","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Map_commune_FR_insee_code_77247.png","page_title":"Lescherolles","context_page_description":"Lescherolles sī ūi-tī Hoat-kok Île-de-France toā-khu Seine-et-Marne koān ê chi̍t ê commune."},{"page_url":"https://en.wikipedia.org/wiki/Virginia_Haviland","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a2/VirginiaHaviland-G.jpg","page_title":"Virginia Haviland","context_page_description":"Virginia Haviland was an American librarian and writer who became an international authority in children's literature. She chaired the prestigious Newbery-Caldecott Award Committee, traveled and wrote extensively. Haviland is also well known for her Favorite Fairy Tales series, featuring stories from sixteen countries."},{"page_url":"https://de.wikipedia.org/wiki/Philipp_Oliver_Baumgarten","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/2019-09-16_TV%2C_ARD%2C_Cast_-Rote_Rosen-_Staffel_17_IMG_7774_LR10_by_Stepro.jpg","page_title":"Philipp Oliver Baumgarten","context_page_description":"Philipp Oliver Baumgarten ist ein deutscher Schauspieler."},{"page_url":"https://fr.wikipedia.org/wiki/Festival_franco-ontarien","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/The_Lost_Fingers_at_Festival_Franco-Ontarien%2C_0281.jpg","page_title":"Festival franco-ontarien","context_page_description":"Le Festival franco-ontarien est un événement majeur pour les francophones et francophiles de l'Ontario au Canada. Ce festival, qui propose autant de concerts que d’animations pour les grands comme les petits, a été créé le 23 mai 1976 par Pierre DeBlois et a pour mission première de célébrer la fierté culturelle française et plus particulièrement la communauté francophone ontarienne. C'est aussi un moment pour les anglophones de découvrir davantage la culture française dans le monde entier."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D0%B5%D0%BB%D1%8C%D0%B7%D0%B5%D0%B2%D1%83%D0%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Beelzebub.png","page_title":"Вельзевул","context_page_description":"Вельзеву́л, також — Веельзевул, Вельзебуб, Вельзевуб, Веельзебут, Баал-Зебуб — У ранньохристиянській релігії — володар демонів, друга фігура в Пеклі, найближчий соратник і співправитель Сатани-Люцифера. Вельзевул настільки високопоставлений і могутній, що його нерідко приймають за верховного вождя пекельних сил замість Сатани.\\nВельзевула шанували філістимляни і ханааненяни, найвідоміший оракул цього божества знаходився в місті Екрон. Ізраїльський цар Охозія, занедужавши, відправив послів запитати у Баал-Зебуба, екронського бога, чи видужає він, — за це Яхве прирік його на смерть. У перекладі його ім'я означає «повелитель мух». За однією популярною версією, жителі Ханаана, що шанували Вельзевула, як верховне божество, зображували його у вигляді мухи, якій були додані атрибути вищої влади. Згідно з Жаном Боденом, «в храмі Вельзевула не було жодної мухи», чим і пояснюється його ім'я; в іншому трактуванні — він — «мушиний бог», який захищав людей від укусів мух. Вважається також, що жерці цього божества робили свої прогнози на підставі спостережень за польотом мух. Ще за однією версією, Вельзевул отримав своє прізвисько за те, що разом з мухами наслав чуму на Ханаан."},{"page_url":"https://es.wikipedia.org/wiki/Ciclismo_en_ruta_masculino_en_los_Juegos_Ol%C3%ADmpicos_de_Pek%C3%ADn_2008","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Paolo_Bettini_Kim_Kirchen_LBL2008.jpg","page_title":"Ciclismo en ruta masculino en los Juegos Olímpicos de Pekín 2008","context_page_description":"La prueba en ruta masculina, que formó parte del programa olímpico de ciclismo de los Juegos Olímpicos de Pekín 2008, se celebró el 9 de agosto en un circuito urbano por la ciudad de Pekín. La prueba comenzó a las 11:00 hora estándar de China, y estaba programada para finalizar hacia las 17:30 de ese mismo día. La carrera con un total de 245,4 kilómetros trascurrió por la zona norte de la ciudad atravesando el corazón del área metropolitana y pasando por lugares emblemáticos como el Templo del Cielo, el Gran Salón del Pueblo, la Plaza de Tiananmén y el Estadio Nacional de Pekín. Tras 78 kilómetros de perfil prácticamente llano los ciclistas debían dar 7 vueltas a un circuito de 23,8 kilómetros en las cercanías de Badaling que incluía rampas de hasta el 10 %.​\\nLa carrera fue ganada por el ciclista español Samuel Sánchez que invirtió 6 horas, 23 minutos y 49 segundos imponiéndose en un apretado final a 5 corredores. Davide Rebellin de Italia y Fabian Cancellara de Suiza, finalizaron en segunda y tercera posición respectivamente con el mismo tiempo que el vencedo adjudicándose las medallas de plata y bronce."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B8%D0%BB%D0%B8%D0%B3%D0%BE","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/71/Mesumundu_%28Siligo-_Italy%29.JPG","page_title":"Силиго","context_page_description":"Силиго — город в итальянской провинции Сассари в регионе Сардиния.\\nПокровительницей города почитается святая Виктория, празднование 23 декабря.\\nСоседние коммуны: Ардара, Банари, Бессуде, Боннанаро, Кодронджанос, Флоринас, Морес и Плоаге.\\nДостопримечательности: византийская базилика и римский акведук."},{"page_url":"https://da.wikipedia.org/wiki/J%C3%A4mtland","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Fr%C3%B6s%C3%B6stenen.jpg","page_title":"Jämtland","context_page_description":"Jämtland er et landskab i det sydvestlige Norrland i det mellemste Sverige. Jämtland grænser i vest op til Trøndelag i Norge, i nordøst til Lappland, i øst til Ångermanland og i syd til Härjedalen og Medelpad. Jämtland udgør 8,2 procent af Sveriges landareal, 34.009 kvadratkilometer og er arealmæssigt Sveriges næststørste landskap. Jämtland har en befolkning på lige under 127.000 indbyggere, og er et af landskaperne med flest personer bosat i landsbygderne på landet. Imidlertid bor størstedelen af indbyggerne i den tætbefolkede Storsjöbygden.\\nJämtland var oprindeligt en selvstyrende bonderepublik. Området blev derefter norskt i 1178, hvilket det var i mere end 450 år, og har været svensk siden 1645, i lidt mere end 350 år. Dets særart manifesteres blandt andet gennem at visse, halvt i alvor, halvt i spøg, ser landskapet som en republik indenfor kongeriget Sverige. Carl 16. Gustaf af Sverige er endog Hertug af Jämtland, en titel han fortfarende anvender sig af ved besøg i landskapet."},{"page_url":"https://nl.wikipedia.org/wiki/Slag_bij_Gro%C3%9Fbeeren","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Grossbeeren_Turm.jpg","page_title":"Slag bij Großbeeren","context_page_description":"De Slag bij Großbeeren was een veldslag in de herfstcampagne van 1813 tijdens de napoleontische oorlogen die tot de slag bij Leipzig leidde. Het werd een geallieerde overwinning."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A1%CF%8C%CE%BC%CF%80%CE%B5%CF%81%CF%84_%CE%A6%CF%81%CE%B9%CF%80%CF%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Robert_Fripp.jpg","page_title":"Ρόμπερτ Φριππ","context_page_description":"Ο Robert Fripp είναι Άγγλος κιθαρίστας, συνθέτης και μουσικός παραγωγός και μέλος των King Krimson.\\nΔραστηριοποίθηκε ως κιθαρίστας στο progressive rock συγκρότημα King Crimson, και ήταν παρών σε όλες τις εμφανίσεις των King Crimson από την ίδρυσή τους στα τέλη της δεκαετίας του 1960 έως σήμερα.\\nΤο περιδικό Rolling Stone τον κατατάσσει στους \\"100 μεγαλύτερους κιθαρίστες όλων των εποχών\\","},{"page_url":"https://ca.wikipedia.org/wiki/Quili%C3%A0,_Colman_i_Totnan_de_W%C3%BCrzburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/St_kilian_marienberg_wuerzb.jpg","page_title":"Quilià, Colman i Totnan de Würzburg","context_page_description":"Quilià, Colman i Totnan van ésser monjos irlandesos que van evangelitzar la regió germànica de la Francònia entre 680 i 689. Morts màrtirs, són venerats com a sants per l'Església catòlica."},{"page_url":"https://en.wikipedia.org/wiki/Northern_Vietnam_lowland_rain_forests","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Lake_Song_Muc.jpg","page_title":"Northern Vietnam lowland rain forests","context_page_description":"The Northern Vietnam lowland rain forests ecoregion covers the central eastern coast of Vietnam from the Red River delta in the north to Tam Kỳ in the center of the country. The region is one of wet evergreen forests, with rain over 50 mm in every month. The forests have been highly degraded by human use, and the high levels of biodiversity have been pushed back into relatively small protected areas like Pu Mat National Park."},{"page_url":"https://eo.wikipedia.org/wiki/Georges_Insulo_(Masa%C4%89useco)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Dock_and_Visitor_Center_at_Georges_Island.jpg","page_title":"Georges Insulo (Masaĉuseco)","context_page_description":"Georges Insulo estas unu el la insuloj en Boston Harbor, kiu troviĝas 7 mejlojn for de urbocentra Bostono."},{"page_url":"https://pl.wikipedia.org/wiki/Cebit","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/55/2013-03-04_CeBIT_banner_Poland_CeBIT_Partner_Country_2013_Willkommen_Witamy_Welcome_Deutsche_Messe_Karmarschstra%C3%9Fe_Hannover.jpg","page_title":"Cebit","context_page_description":"Cebit – targi, początkowo technik biurowych, komputerowe, a potem teleinformatyczne, organizowane corocznie w marcu od 1986 do 2018 na terenach Targów Hanowerskich przez Deutsche Messe AG.\\nCeBIT'2001, o powierzchni wystawienniczej 450 tys. m² z 8500 wystawcami i z 870 tys. zwiedzających, był największymi targami teleinformatycznymi na świecie. Zamknięcie targów w 2018 było spowodowane zmniejszającą się liczbą wystawców oraz zwiedzających.\\nPolskie firmy w miarę swoich możliwości były obecne na targach CeBIT w latach 1987–2018 w liczbie około 900 wystawców."},{"page_url":"https://en.wikipedia.org/wiki/Tiyu_Xilu_station","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1e/Tiyixilu_platform.jpg","page_title":"Tiyu Xilu station","context_page_description":"Tiyu Xilu Station is an interchange station on Line 1 and Line 3 of the Guangzhou Metro. It started operations on 28 June 1999 and 26 December 2005. It is situated under Tiyu Road West and Tianhe 1st South Road in the Tianhe District of Guangzhou. It is near Teemall and Guangzhou Books Center, which makes it one of the busiest metro stations in Guangzhou.\\nThe platforms for Line 1 are in the standard island platform layout whilst on Line 3 there are two island platforms serving three tracks. Northbound services to Tianhe Coach Terminal and southbound services to Panyu Square use the outer tracks whilst the train service to the airport uses the single centre track. The doors open on both sides of the centre track to allow cross-platform interchange in both directions.\\nThe station was designated as busiest in the country by a fair margin with 1,252,064 passengers per day in 2017."},{"page_url":"https://pt.wikipedia.org/wiki/K%C3%BCttigen","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/26/K%C3%BCttigen_Altes_Schulhaus.jpg","page_title":"Küttigen","context_page_description":"Küttigen é uma comuna da Suíça, no Cantão Argóvia, com cerca de 5.109 habitantes. Estende-se por uma área de 11,89 km², de densidade populacional de 430 hab/km². Confina com as seguintes comunas: Aarau, Biberstein, Densbüren, Erlinsbach, Oberhof, Rohr, Thalheim.\\nA língua oficial nesta comuna é o Alemão."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A8%D7%95%D7%A0%D7%99_%D7%AA%D7%95%D7%A8%D7%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/%D7%A8%D7%95%D7%A0%D7%99_%D7%AA%D7%95%D7%A8%D7%9F.jpg","page_title":"רוני תורן","context_page_description":"רוני תורן הוא מעצב תפאורה ותלבושות לאופרה ותיאטרון, מורה ומרצה לעיצוב במה, עורך ומגיש תוכניות רדיו וטלוויזיה."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%99%B8%E5%89%8D%E6%B8%AF%E9%A7%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/JR_Kesennuma-Line%28BRT%29_Rikuzen-minato_station%282%29.JPG","page_title":"陸前港駅","context_page_description":"陸前港駅は、宮城県本吉郡南三陸町歌津字港にある、東日本旅客鉄道気仙沼線BRTのバス停留所である。元々は同社の気仙沼線の鉄道駅であった。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A7%D0%B8%D1%81%D1%82%D0%BE%D0%B5_%D0%BF%D0%BE%D0%BC%D0%B5%D1%89%D0%B5%D0%BD%D0%B8%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Clean_room_history_4.jpg","page_title":"Чистое помещение","context_page_description":"Чистое помещение — помещение, где в воздухе поддерживаются в определённом заданном диапазоне размер и число на кубический метр таких частиц, как пыль, микроорганизмы, аэрозольные частицы и химические пары. При необходимости в них также могут контролироваться и другие параметры, например влажность, давление и температура. Такие помещения как правило строятся и используются так, чтобы свести к минимуму поступление, генерацию и накопление таких частиц внутри помещения.\\nЧистым помещением или чистой комнатой называется помещение, в котором счётная концентрация взвешенных в воздухе частиц и, при необходимости, число микроорганизмов в воздухе поддерживаются в определённых пределах.\\nПод частицей понимают твердый, жидкий или многофазный объект или микроорганизм с размерами от 0,005 до 100 мкм. При классификации чистых помещений рассматривают частицы с нижними пороговыми размерами от 0,1 до 5,0 мкм.\\nКлючевым фактором является то, что чистые помещения характеризуются именно счётной концентрацией частиц, то есть числом частиц в единице объёма воздуха, размеры которых равны или превышают определённую величину."},{"page_url":"https://fr.wikipedia.org/wiki/Phare_de_Point_Sur","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Point_Sur_Light_Station_313.jpg","page_title":"Phare de Point Sur","context_page_description":"Le phare de Point Sur est un phare situé sur Point Sur State Historik Park, un parc d'État près de Carmel-by-the-Sea, dans le Comté de Monterey, aux États-Unis.\\nCe phare est géré par la Garde côtière américaine, et les phares de l'État de Californie sont entretenues par le District 11 de la Garde côtière.\\nIl est inscrit au Registre national des lieux historiques depuis le 3 septembre 1991."},{"page_url":"https://sl.wikipedia.org/wiki/Alhambra","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Dawn_Charles_V_Palace_Alhambra_Granada_Andalusia_Spain.jpg","page_title":"Alhambra","context_page_description":"Alhambra, točneje Kalat Alhambra, je utrjen palačni kompleks, ki so ga v 14. stoletju zgradili granadski emirji v Granadi v sedanji avtonomni skupnosti Andaluziji v južni Španiji.\\nNa njenem mestu je bila že leta 889 zgrajena majhna utrdba, ki so jo kasneje večinoma opustili, dokler ni sredi 13. stoletja prvi emir Granadskega emirata Mohamed I. Ibn Nasr na njenem mestu zgradil obzidja in svoje palače. Granadski sultan Jusuf I. jo je leta 1333 preuredil v kraljevo palačo.\\nPalača je bila sedež Ziridov, zadnje muslimanske dinastije na Iberskem polotoku, in njihovega dvora. Po rekonkvisti Izabele I. Kastiljske in Ferdinanda II. Aragonskega leta 1492, sta del palače zasedla oba monarha. Palačo Karla V. je znotraj nasridskega obzidja leta 1527 zgradil cesar Svetega rimskega cesarstva Karel V.\\nAlhambra je zaradi slabega vzdrževanja začela propadati, dokler je niso v 19. stoletju odkrili evropski znanstveniki in popotniki in jo začeli obnavljati. Zaradi izjemne islamske arhitekture, kasneje zgrajenih krščanskih palač in urejenih vrtov je ena od največjih in najbolj obiskanih španskih znamenitosti. Leta 1984 je bila vpisana na Unescov seznam svetovne kulturne dediščine."},{"page_url":"https://pt.wikipedia.org/wiki/Expedi%C3%A7%C3%A3o_39","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/66/Soyuz_TMA-12M_launch_from_ISS.jpg","page_title":"Expedição 39","context_page_description":"Expedição 39 foi uma missão humana de longa duração na Estação Espacial Internacional, realizada entre 11 de março e 13 de maio de 2014. Ela marcou a primeira vez que a ISS esteve sob o comando de um astronauta japonês, o veterano Koichi Wakata. Após a Expedição 21 em 2009 e a Expedição 35 em 2013, é a terceira vez que a tripulação não foi liderada por um astronauta da NASA ou um cosmonauta da Roscosmos.\\nEla contou, no total, com três cosmonautas russos, dois astronautas norte-americanos, e um japonês."},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_dinossauros_da_%C3%81sia","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Hypothetical_Deinocheirus.jpg","page_title":"Lista de dinossauros da Ásia","context_page_description":"Esta é uma lista de dinossauros cujos restos foram recuperados da Ásia excluindo o subcontinente indiano, que fazia parte de um território independente na maior parte do Mesozoico. Mais dinossauros foram descobertos na Ásia do que qualquer outro continente até agora."},{"page_url":"https://en.wikipedia.org/wiki/Tannenfels_Castle_(Palatinate)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Tannenfels_Turm_Winter.jpg","page_title":"Tannenfels Castle (Palatinate)","context_page_description":"Tannenfels Castle is a ruined hill castle of the motte and bailey type which stands at a height of 460 m above sea level above the village of Dannenfels on the Donnersberg hill in the county of Donnersbergkreis in the German state of Rhineland-Palatinate."},{"page_url":"https://en.wikipedia.org/wiki/Scotland_in_the_Middle_Ages","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d7/Robert_the_Bruce.jpg","page_title":"Scotland in the Middle Ages","context_page_description":"Scotland in the Middle Ages concerns the history of Scotland from the departure of the Romans to the adoption of major aspects of the Renaissance in the early sixteenth century.\\nFrom the fifth century northern Britain was divided into a series of petty kingdoms. Of these the four most important to emerge were the Picts, the Gaels of Dál Riata, the Britons of Strathclyde and the Anglo-Saxon kingdom of Bernicia, later taken over by Northumbria. After the arrival of the Vikings in the late eighth century, Scandinavian rulers and colonies were established along parts of the coasts and in the islands.\\nIn the ninth century the Scots and Picts combined under the House of Alpin to form a single Kingdom of Alba, with a Pictish base and dominated by Gaelic culture. After the reign of King David I in the twelfth century, the Scottish monarchs are best described as Scoto-Norman, preferring French culture to native Scottish culture. Alexander II and his son Alexander III, were able to regain the remainder of the western seaboard, cumulating the Treaty of Perth with Norway in 1266."},{"page_url":"https://fr.wikipedia.org/wiki/Ligne_orange_du_m%C3%A9tro_de_Boston","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Northbound_entrance_to_Chinatown_station%2C_March_2008.jpg","page_title":"Ligne orange du métro de Boston","context_page_description":"La ligne orange du métro de Boston est l'une des trois lignes de métro de la ville de Boston, Massachusetts. C'est la plus ancienne ligne de ce métro, mise en service en 1901, en excluant la ligne verte transformée en ligne de tramway. Exploitée par Massachusetts Bay Transportation Authority, la ligne compte 20 stations entre la station de Forest Hills dans le quartier de Jamaica Plain et la station d'Oak Grove à Malden. Elle croise la ligne rouge à la station de Downtown Crossing, la ligne bleue à la station State, et la ligne verte aux stations Haymarket et North Station. Elle est connecté avec l'Amtrak et le Commuter Rail. La ligne a transporté 184 961 passagers en 2010."},{"page_url":"https://hu.wikipedia.org/wiki/Melithaea","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Multicoloured_sea_fan_at_the_wreck_of_SAS_Pietermaritzburg_P7260727.JPG","page_title":"Melithaea","context_page_description":"A Melithaea a virágállatok osztályának a szarukorallok rendjébe, ezen belül a Scleraxonia alrendjébe és a Melithaeidae családjába tartozó nem.\\nAlcsaládjának az egyetlen neme és családjának a típusneme."},{"page_url":"https://de.wikipedia.org/wiki/Chile","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Pir%C3%A1mide_de_poblaci%C3%B3n_-_Chile_2014.svg","page_title":"Chile","context_page_description":"Chile, amtlich República de Chile, ist ein Staat im Südwesten Südamerikas, der den westlichen Rand des Südkegels des Kontinents bildet. Chile erstreckt sich in Nord-Süd-Richtung zwischen den Breitengraden 17° 30′ S und 56° 0′ S; somit beträgt die Nord-Süd-Ausdehnung rund 4200 Kilometer. In west-östlicher Richtung liegt Chile zwischen dem 76. und dem 64. westlichen Längengrad und besitzt eine Ausdehnung von durchschnittlich weniger als 200 Kilometern. Wegen dieser – durch seine Lage am Westhang der Andenkordillere bedingten – ungewöhnlichen Form wird Chile schon seit seiner Entdeckung häufig „das langgestreckte Land“ genannt. Das Land grenzt im Westen und Süden an den Pazifischen Ozean, im Norden an Peru, im Nordosten an Bolivien und im Osten an Argentinien. Die Gesamtlänge der Landgrenzen beträgt 6329 Kilometer. Daneben zählen die im Pazifik gelegene Osterinsel, die Insel Salas y Gómez, die Juan-Fernández-Inseln, die Desventuradas-Inseln sowie im Süden die Ildefonso-Inseln und die Diego-Ramírez-Inseln zum Staatsgebiet Chiles. Ferner beansprucht Chile einen Teil der Antarktis. Über die vollständig zu Chile gehörende Magellanstraße hat das Land Zugang zum Atlantischen Ozean."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D0%B0%D0%BD%D1%96%D1%8E%D0%BB%D1%8C-%D1%81%D1%8E%D1%80-%D0%9C%D0%B5%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Banyuls_sur_mer_6.jpg","page_title":"Баніюль-сюр-Мер","context_page_description":"Банію́ль-сюр-Мер — муніципалітет у Франції, у регіоні Лангедок-Руссільйон, департамент Східні Піренеї. Населення — 4661 осіб.\\nМуніципалітет розташований на відстані близько 720 км на південь від Парижа, 140 км на південний захід від Монпельє, 31 км на південний схід від Перпіньяна."},{"page_url":"https://war.wikipedia.org/wiki/Corylopsis","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/da/Corylopsis_spicata1.jpg","page_title":"Corylopsis","context_page_description":"An Corylopsis in uska genus han Magnoliopsida. An Corylopsis in nahilalakip ha familia nga Hamamelidaceae.\\nAn kladograma hini sumala ha Catalogue of Life:"},{"page_url":"https://it.wikipedia.org/wiki/Vicegovernatore_del_Texas","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/James_Nathan_Browning.jpg","page_title":"Vicegovernatore del Texas","context_page_description":"Il vicegovernatore del Texas è il secondo più alto incarico esecutivo del governo del Texas dopo il governatore. È considerata la carica più potente del governo di questo Stato poiché deve controllare il lavoro del Senato e l'andamento del bilancio.\\nL'attuale vicegovernatore del Texas è Dan Patrick, in carica dal 20 gennaio 2015."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B5%D1%81%D0%B0,_%D0%9C%D0%B0%D0%BA%D1%81%D0%B8%D0%BC%D0%B8%D0%BB%D1%8C%D1%8F%D0%BD%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Maximiliano_Meza.jpg","page_title":"Меса, Максимильяно","context_page_description":"Максимилья́но Эдуа́рдо Ме́са — аргентинский футболист, полузащитник клуба «Монтеррей» и сборной Аргентины. Участник чемпионата мира 2018 года."},{"page_url":"https://en.wikipedia.org/wiki/Higashi-Shimizu_Frequency_Converter","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Power_Grid_of_Japan_as_of_2008.png","page_title":"Higashi-Shimizu Frequency Converter","context_page_description":"Higashi-Shimizu Frequency Converter is the third facility in Japan for interconnecting the power grid of eastern Japan, which operates at 50 hertz, and that of western Japan, which operates at 60 hertz.\\nThe Higashi-Shimizu Frequency Converter Station is operated by Chubu Electric Power Co. and is located at 677-3 Tanakake, Hirose-aza, Shimizu-ku, Shizuoka. It is fed via a 275 kV power line and a 154 kV power line. Its inverters operate at 125 kVDC and have a maximum transmission rate of 300 MW.\\nJapan's other converter stations are at Shin-Shinano in Nagano Prefecture, Sakuma Dam in Shizuoka Prefecture, and Minami-Fukumitsu in Toyama Prefecture."},{"page_url":"https://no.wikipedia.org/wiki/Sprint-NM_p%C3%A5_sk%C3%B8yter_2006","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/RisengaKunstisbaneJan2012.JPG","page_title":"Sprint-NM på skøyter 2006","context_page_description":"Sprint-NM på skøyter 2006 ble avholdt på Risenga kunstisbane i Asker 7.–8. januar 2006.\\nJunior-NM i Sprint for både damer og herrer ble også arrangert samme sted, samme helg. Teknisk arrangør var Asker Skøyteklubb. Dette ble endelig klart etter at skøytetinget i Harstad 2005 hadde gjort noen små endringer i NM-programmet. Dette medførte at alle norske sammenlagtmestere i sprint på skøyter skulle kåres på samme sted, senior- og juniorklasser for både damer og herrer.\\nLøpene startet klokken 12.00 begge dager, og trekningen av parsammensetningen for lørdagens løp foregikk i klubbhuset på fredag den 6. januar kl. 18.00."},{"page_url":"https://sh.wikipedia.org/wiki/Kalijum_format","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Potassium_formate.png","page_title":"Kalijum format","context_page_description":"Kalijum format je organsko jedinjenje, koje sadrži 1 atom ugljenika i ima molekulsku masu od 84,116 Da."},{"page_url":"https://fr.wikipedia.org/wiki/N%C3%A9o-mud%C3%A9jar","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Catedral_mud%C3%A9jar_de_Teruel.png","page_title":"Néo-mudéjar","context_page_description":"Le Néo-mudéjar est un style artistique et architectural qui s'est développé principalement dans la Péninsule Ibérique à la fin du XIXᵉ siècle et au début du XXᵉ siècle. Il fait partie des courants orientalistes de l'architecture historiciste dominant en Europe à cette époque.\\nLe nouveau style fut utilisé particulièrement pour des constructions de caractère festif et de loisir, comme des salons de fumeurs, des casinos, des gares, des arènes ou des saunas.\\nEn Espagne, le style néo-mudéjar fut revendiqué comme un style national, du fait qu'il était basé sur un style proprement hispanique, l'architecture mudéjare. Des architectes comme Emilio Rodríguez Ayuso ou Agustín Ortiz de Villajos commencèrent à concevoir des édifices en utilisant les caractéristiques de l'ancien style, parmi lesquelles les formes abstraites de brique et les arc outrepassés.\\nCependant, ce que l'historiographie a traditionnellement considéré comme néo-mudéjar, sont en fait très souvent des œuvres de style néo-mauresque, étant donné qu'elles utilisent des éléments omeyyades, almoravides et nasrides et que l'unique aspect mudéjar est l'utilisation de la brique visible."},{"page_url":"https://nl.wikipedia.org/wiki/Pronkstuk","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Groot_Pruisisch_wapen_met_legenda.jpg","page_title":"Pronkstuk","context_page_description":"Een pronkstuk is in de heraldiek een van de buiten het wapenschild aangebrachte elementen. De pronkstukken zijn minder oud dan het schild dat de kern van de heraldiek is. Het eerste pronkstuk dook in de dertiende eeuw op; het nieuwe model helm liet door de platte bovenkant een versiering, helmteken genaamd, toe. Ook werd de gekleurde wrong in gebruik genomen.\\nIn de toernooien werden al gauw ook banieren meegedragen die in de wapenboeken samen met het wapen en de helm werden afgebeeld.\\nIn de 15e eeuw deed een papieren heraldiek haar intrede. Er ontstonden wapens die alleen op papier denkbaar waren, waaronder pronkstukken als schildhouders en rangkronen.\\nDe complexiteit van de wapens nam in de loop der eeuwen toe."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%B0%D0%BB%D1%8C%D1%82%D0%BE-%D0%93%D1%80%D0%B0%D0%BD%D0%B4%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Salto_Grande_turbine_room.JPG","page_title":"Сальто-Гранде","context_page_description":"Сальто-Гранде — велика гідроелектростанція на річці Уругвай, розміщена між містами Конкордія та Сальто; таким чином вона працює на дві країни. Знаходячись після ГЕС Фос-ду-Шапеко, становить нижній ступінь в каскаді на Уругваї.\\nБудівництво дамби почалось у 1974 році й завершилось у 1979. Електроенергія виробляється 14 поворотно-лопатними гідротурбінами загальною встановленою потужністю 1 890 МВт."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BF%D1%82%D0%B8%D1%86_%D0%A4%D0%B8%D0%B4%D0%B6%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Streaked_fantail_abaca_jun07.JPG","page_title":"Список птиц Фиджи","context_page_description":"Орнитофауна Фиджи является самой богатой в Западной Полинезии. Многочисленные семейства достигают самого дальнего востока от своего ареала, и остров является родиной нескольких эндемичных видов и родов, а также еще нескольких эндемиков с его близких соседей Тонга и Самоа.\\nПрибытие людей оказало сильное воздействие на птиц Фиджи. Несколько видов вымерли в доисторические времена и известны только по ископаемым останкам. Другие вымерли совсем недавно, а некоторые виды остаются очень близкими к исчезновению. Несомненно, что нынешние знания о предыдущих ареалах многих видов являются неполными, и необходимы дальнейшие исследования.\\nЭто список видов птиц, зарегистрированных на Фиджи. Орнитофауна Фиджи включает в себя, в общей сложности, 150 видов, из которых 28 являются эндемичными, 13 были интродуцированы человеком и 34 вида являются редкими или залётными. Многочисленные перечисленные виды были искоренены на Фиджи и не включены в число видов, хотя они перечислены там, где они известны. Из них 17 видов находятся под глобальной угрозой исчезновения.\\nТаксономический режим этого перечня и номенклатура следуют соглашениям 6-го издания The Clements Checklist of Birds of the World."},{"page_url":"https://de.wikipedia.org/wiki/M%C3%BCnzschatz_von_Lausitz","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Ballon_Lausitz_2_%28Ausschnitt%29.jpg","page_title":"Münzschatz von Lausitz","context_page_description":"Der Münzschatz von Lausitz wurde in einem napfförmigen 10,5 Zentimeter hohen Kumpf, etwa zwei Kilometer nordwestlich der südbrandenburgischen Gemeinde Lausitz gefunden. Er bestand aus 53 Silbermünzen, die vermutlich aus dem Zeitraum 31 bis 180 u. Z. stammen. Wahrscheinlich gelangten sie nur kurze Zeit nach dem Jahr 180 in die Erde. Am selben Fundplatz befanden sich sieben\\nBrandgrubengräber des gleichen Zeitraums, wovon fünf Gräber innerhalb eines Durchmessers von fünf Metern lagen. In diesen Brandgruben befanden sich Asche, Kohlenreste sowie kleine schwarze Steine.\\nDie Münzen, bei denen es sich um Denare handelte, stellten Prägungen der römischen Kaiser Vespasian, Domitian, Nerva, Trajan, Hadrian, Antoninus Pius, Mark Aurel und Hadrians Frau Vibia Sabina dar."},{"page_url":"https://de.wikipedia.org/wiki/Schichtpilzverwandte","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/2013-05-13_Aleurodiscus_aurantius_%28Pers.%29_J._Schr%C3%B6t_344496.jpg","page_title":"Schichtpilzverwandte","context_page_description":"Die Familie der Schichtpilzverwandten besteht aus Arten mit krustenartigen bis teils vom Substrat abstehenden Fruchtkörpern. Viele Arten besitzen Acanthohyphidien. Dabei handelt es sich um zystidenartige Gebilde in der Fruchtschicht mit mehr oder weniger ausgeprägten Kopfteilen, die ähnlich einer Flaschenbürste eng mit Zacken oder haar- bis fingerartigen Auswüchsen besetzt sind. Sie dienen wahrscheinlich als Schutz vor Austrocknung.\\nSchichtpilze und Mehlscheiben bilden die größten Gattungen in der Familie. Beide werden durch Arten dominiert, die an exponierten Stellen wachsen, zum Beispiel abgestorbene, aber noch am Baum ansitzende Äste. Die Mehlscheiben wurden in viele kleinere Satellitengattungen unterteilt, einige davon den Schichtpilzen und den Mosaikschichtpilzen zugeordnet. Mehrere Arten mit corticioiden Fruchtkörpern aus der Gattung Gloeocystidiellum sind inzwischen als Conferticium, Gloeocystidiellopsis und Megalocystidium abgetrennt worden."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%B2%B3%E5%9D%91%E5%9C%9F%E6%A5%BC%E7%BE%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Nanjing_Hekeng_2013.10.04_16-51-23.jpg","page_title":"河坑土楼群","context_page_description":"河坑土楼群位于中国福建省南靖县书洋镇曲江村，由方形的朝水楼、阳照楼、永盛楼、绳庆楼、永荣楼、永贵楼，圆形的裕昌楼、春贵楼、东升楼、晓春楼、永庆楼、裕兴楼，以及五角形的南薰楼等13座组成，分别建于明代至现代，2008年河坑土楼群作为福建土楼的典型代表被列为世界文化遗产。2009年河坑土楼群被列为第七批福建省文物保护单位。"},{"page_url":"https://sr.wikipedia.org/wiki/%D0%8B%D1%83%D0%B1%D0%B0%D1%81%D1%82%D0%B8_%D1%98%D0%B5%D0%BB%D0%B5%D0%BD","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/29/Tufteddeer-1.jpg","page_title":"Ћубасти јелен","context_page_description":"Ћубасти јелен или Елафит је сисар из реда папкара."},{"page_url":"https://en.wikipedia.org/wiki/List_of_birds_of_Great_Britain","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Asian_Desert_Wrabler.jpg","page_title":"List of birds of Great Britain","context_page_description":"This list of birds of Great Britain comprises all bird species that have been recorded in a wild state in Great Britain. In general the avifauna of Britain is similar to that of the rest of Europe, although with fewer breeding species. There are 620 species of birds on the British list as of 1 August 2019, the latest addition being the white-rumped swift. There are an additional three species groups on the British List - Fea's/Desertas petrel; Black-bellied/White-bellied Storm Petrel and Brown/South Polar skua. In addition, six more species are awaiting consideration by the British Ornithologists' Union Records Committee. The species order and scientific names used here follow those of the official British list, maintained by the British Ornithologists' Union. Decisions relating to the British list are published by the British Ornithologists' Union Records Committee in its annual reports in the Ibis, the journal of the BOU. These reports were formerly geographically based and included the whole of the British Isles, but records for the Republic of Ireland and Northern Ireland are now published by their own ornithological associations."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Ahuachap%C3%A1n","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0f/Escudo_del_departamento_de_ahuachapan..png","page_title":"Ahuachapán","context_page_description":"Ahuachapán sī El Salvador Ahuachapán Koān ê chi̍t ê chū-tī-thé."},{"page_url":"https://sv.wikipedia.org/wiki/Onthophagus_transcaspicus","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/CSIRO_ScienceImage_11207_Dung_beetle_Onthophagus_gazella_side_view.jpg","page_title":"Onthophagus transcaspicus","context_page_description":"Onthophagus transcaspicus är en skalbaggsart som beskrevs av Alexander Ferdinand Koenig 1888. Onthophagus transcaspicus ingår i släktet Onthophagus och familjen bladhorningar. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://tr.wikipedia.org/wiki/A%C4%9Fa%C3%A7land%C4%B1rma","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Orman-2.JPG","page_title":"Ağaçlandırma","context_page_description":"Ağaçlandırma, yangın, zararlı biyolojik etkiler, kuraklık gibi doğal veya yanlış uygulamalar sebebiyle insan eliyle bozulan doğal orman alanlarında suni, ormancılık faaliyetidir."},{"page_url":"https://id.wikipedia.org/wiki/Lew_Tabackin","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/ce/Lew_Tabackin_playing_tenor_saxophone_at_the_Artists%27_Quarter_jazz_club_on_November_16%2C_2013.jpg","page_title":"Lew Tabackin","context_page_description":"Lewis Barry Tabackin adalah penyanyi tenor dan pemain suling jazz Amerika. Dia menikah dengan pianis Toshiko Akiyoshi dengan siapa dia memimpin ansambel besar sejak 1970-an."},{"page_url":"https://it.wikipedia.org/wiki/Campagna_siro-palestinese_di_Sennacherib","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/50/Menora_Titus.jpg","page_title":"Campagna siro-palestinese di Sennacherib","context_page_description":"La campagna siro-palestinese di Sennacherib si svolse nel 701 a.C. tra le forze assire di Sennacherib e una coalizione di città stato della Fenicia e della Palestina, affiancate dall'Egitto.\\nDopo aver vinto la coalizione nemica, il re assiro Sennacherib proseguì per stringere d'assedio Gerusalemme, ma presto tornò a Ninive senza che la capitale giudaica potesse essere espugnata.\\nGli eventi della guerra sono rappresentati nei rilievi di Lachish, commissionati dal sovrano per commemorare l'impresa e adornare il proprio palazzo a Ninive."},{"page_url":"https://en.wikipedia.org/wiki/Pandar_Jan","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Shepherd-Dogs-Penderjohn-Markazi-Arak-Iran.jpg","page_title":"Pandar Jan","context_page_description":"Pandar Jan is a village in Hamzehlu Rural District, in the Central District of Khomeyn County, Markazi Province, Iran. At the 2006 census, its population was 67, in 18 families."},{"page_url":"https://en.wikipedia.org/wiki/Liisa_Jaakonsaari","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Liisa_Jaakonsaari_-_Wiki_Loves_Parliament_-_2014_-_P1760851.jpg","page_title":"Liisa Jaakonsaari","context_page_description":"Liisa Anneli Jaakonsaari is a Finnish politician who served as a Member of the European Parliament from 2009 until 2019. She is a member of the Social Democratic Party, part of the Progressive Alliance of Socialists and Democrats.\\nJaakonsaari was a city councillor in Oulu from 1972 until 1995. She was also a member of the Finnish parliament from 1979 until 2009, when she was elected as a Member of the European Parliament. Jaakonsaari was the Minister of Labour in Paavo Lipponen's first cabinet.\\nUnlike her party, Jaakonsaari advocates NATO membership."},{"page_url":"https://de.wikipedia.org/wiki/Nacina_Ves","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Nacina_Ves%2C_R%C3%ADmskokatol%C3%ADcky_kostol_V%C5%A1etk%C3%BDch_sv%C3%A4t%C3%BDch.jpg","page_title":"Nacina Ves","context_page_description":"Nacina Ves ist eine Gemeinde in der Ostslowakei.\\nDie Gemeinde liegt zwischen dem Laborec und der 40 Kilometer parallel fließenden Duša, einem Nebenfluss des Laborec sowie auf halbem Wege zwischen den Städten Michalovce und Strážske in einer nördlichen Ausbuchtung des Ostslowakischen Tieflandes.\\nZu Nacina Ves gehört der westlich jenseits der Bahnlinie liegende Ortsteil Vybúchanec.\\nDie Fernstraße 18 von Prešov nach Michalovce führt durch Nacina Ves, die parallel verlaufende Bahnlinie streift den westlichen Rand der Gemeinde.\\nUmgeben wird Nacina Ves von den Nachbargemeinden Voľa im Norden, Zbudza im Osten, Petrovce nad Laborcom im Süden sowie Pusté Čemerné im Westen.\\nDer Ort wurde im Jahr 1254 erstmals schriftlich erwähnt. Die römisch-katholische Kirche stammt aus dem Jahr 1443.\\nDie Bevölkerung der Gemeinde Nacina Ves besteht zu 87 % aus Slowaken, 13 % der Bewohner sind Roma. 69 % der Einwohner bekennen sich zur Römisch-katholischen Kirche, 28 % der Einwohner gaben als Konfession Griechisch-katholisch an."},{"page_url":"https://az.wikipedia.org/wiki/Astragalus_tricarinatus","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Astragalus_tricarinatus.jpg","page_title":"Astragalus tricarinatus","context_page_description":"Astragalus tricarinatus — paxlakimilər fəsiləsinin gəvən cinsinə aid bitki növü."},{"page_url":"https://sr.wikipedia.org/wiki/Oksetan","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Oxetane-from-xtal-3D-balls.png","page_title":"Oksetan","context_page_description":"Oksetan je organsko jedinjenje, koje sadrži 3 atoma ugljenika i ima molekulsku masu od 58,079 Da."},{"page_url":"https://fr.wikipedia.org/wiki/Stade_du_4-Ao%C3%BBt","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Stade_du_4-Ao%C3%BBt%2C_Burkina_Faso%2C_2009.jpg","page_title":"Stade du 4-Août","context_page_description":"Le stade du 4-Août, ou stade du Quatre-Août ou stade du 4-Août-1983, est un stade multifonction situé à Ouagadougou au Burkina Faso. D'une capacité de 35 000 places, il est principalement utilisé par le club de football de l'Étoile Filante de Ouagadougou et par l'équipe du Burkina Faso de football lorsque celle-ci joue à domicile."},{"page_url":"https://az.wikipedia.org/wiki/T-129","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/BG12-1001_%2814662033896%29.jpg","page_title":"T-129","context_page_description":"T-129 Atak — Atak proqramı çərçivəsində Türkiyə Silahlı Qüvvələri üçün Türkiyənin coğrafi və iqlim şəraitinə əsaslanaraq yaradılmış, Türkiyə və İtaliyanın birgə istehsalı olan hücum helikopteridir. Bu helikopter İtaliyanın A-129 Mangusta helikopterinin gövdə hissəsinin bəzi yerlərinin dəyişdirilməsi və özünə məxsus silah sistemlərinin inteqrasiya edilməsi ilə meydana gəlmişdir. İstehsalı tamamlanan ilk helikopter 28 sentyabr 2009-cu il tarixində İtaliyanın Qallarate şəhəri yaxınlığında bir italyan və bir türk pilot tərəfindən ilk uçuşunu həyata keçirmişdir. Təxminən yarım saat havada qalan helikopter müxtəlif manevr testlərini həyata keçirdikdən sonra uğurla yerə enmişdir.\\nT-129-da Rolls-Royce və Honeywell firmalarının ortaq istehsalı olan iki ədəd LHTEC CTS800-4A motoru istifadə olunmuşdur. 278 km/s maksimal sürətə sahib olan helikopter 6,096 m yüksəkliyə qədər qalxmaq qabiliyyətinə sahibdir. T-129 yaxın hava dəstəyi və çox məqsədli tapşırıqlar üçün iki fərqli tipə sahibdir. T-129A yaxın hava dəstəyi, T-129B isə çoxməqsədli tapşırıqlar üçün istehsal olunmuşdur."},{"page_url":"https://mr.wikipedia.org/wiki/%E0%A4%AE%E0%A4%BF%E0%A4%B8_%E0%A4%AF%E0%A5%81%E0%A4%A8%E0%A4%BF%E0%A4%B5%E0%A5%8D%E0%A4%B9%E0%A4%B0%E0%A5%8D%E0%A4%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/NatalieGlebova_Tiara.jpg","page_title":"मिस युनिव्हर्स","context_page_description":"मिस युनिव्हर्स ही दरवर्षी घेतली जाणारी एक जागतिक सौंदर्य स्पर्धा आहे. सरासरी ६० कोटी दूरचित्रवाणी प्रेक्षक असलेली मिस युनिव्हर्स जगातील सर्वात लोकप्रिय सौंदर्य स्पर्धा मानली जाते. मिस युनिव्हर्स ऑर्गनायझेशन ही अमेरिकेच्या न्यू यॉर्क शहरात स्थित असलेली कंपनी ह्या स्पर्धेचे आयोजन करते.\\n१९५२ साली कॅलिफोर्नियाच्या लॉंग बीच शहरामध्ये ही सौंदर्य स्पर्धा सर्वप्रथम भरवली गेली. आजवर सुष्मिता सेन व लारा दत्ता ह्या दोन भारतीय सुंदरींनी ही स्पर्धा जिंकली आहे. अमेरिकेने ७ वेळा, व्हेनेझुएलाने ६ वेळा तर पोर्तो रिकोने ५ वेळा मिस युनिव्हर्स जिंकण्याचा बहुमान मिळवला आहे. ॲंगोलाची लायला लोपेस ही २०११ सालची मिस युनिव्हर्स आहे."},{"page_url":"https://af.wikipedia.org/wiki/David_Denman","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Daviddenman.jpg","page_title":"David Denman","context_page_description":"David Denman is 'n Amerikaanse akteur. Hy is bekend vir sy rolle in die rolprente The Gift, 13 Hours, Logan Lucky, en Puzzle."},{"page_url":"https://no.wikipedia.org/wiki/Liste_over_Islands_fugler","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Tennessee_Warbler_2.jpg","page_title":"Liste over Islands fugler","context_page_description":"Denne listen over Islands fugler inkluderer 401 arter.\\nRekkefølge er etter Clements-lista versjon v2015\\nDe norske navn følger Norske navn på verdens fugler.\\nStatus på lista:\\nFA - Fremmed art. En art som forekommer utenfor sitt naturlige utbredelsesområde. Arten har blitt frakta dit av mennesker.\\nS - Islandsk sjeldenhet eller tilfeldig.\\nX - Lokalt utryddet\\nEX - Utryddet etter IUCNs rødliste\\nNT - Nær truet etter IUCNs rødliste\\nVU - Sårbar etter IUCNs rødliste\\nEN - Sterkt truet etter IUCNs rødliste\\nCR - Kritisk truet etter IUCNs rødliste"},{"page_url":"https://en.wikipedia.org/wiki/Pravasi_Express_Awards","image_url":"https://upload.wikimedia.org/wikipedia/en/b/b2/Pravasi_Express_Awards_VS.jpg","page_title":"Pravasi Express Awards","context_page_description":"Pravasi Express Awards was introduced in 2013 for appreciating personalities for their outstanding contributions to the society and also the admirable endeavour in their chosen field/profession. The awards are being overseen by Pravasi Publications from Singapore who publishes the Pravasi Express Newspaper."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%8F%84%EC%82%AC_(%EC%9D%8C%EC%8B%9D)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/%E0%B2%B8%E0%B2%82%E0%B2%AA%E0%B2%A3%E0%B3%86.JPG","page_title":"도사 (음식)","context_page_description":"도사는 쌀과 우라드콩을 갈아 만든 발효 반죽을 얇게 부친 음식이다. 남인도와 스리랑카에서 흔히 먹던 음식이지만 현재는 남아시아의 다른 지역에서도 즐겨 먹는다. 전통적으로 도사는 삼바르나 차트니 등과 먹으며, 이들리 포디를 곁들이기도 한다."},{"page_url":"https://en.wikipedia.org/wiki/Dvuhyurtochnoe_Lake","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Kamchatka_Brown_Bear_near_Dvuhyurtochnoe_on_2015-07-23.jpg","page_title":"Dvuhyurtochnoe Lake","context_page_description":"Dvuhyurtochnoe Lake is a freshwater lake in the Ust-Kamchatka region of the Kamchatka Territory, Russia. Its area is 11.9 square kilometres, its length is 6.3 kilometres, and its maximum width is 2 kilometres. The lake has a glacial-barren origin. It resulted from the lowering of a small section of the river valley.\\nThe lake is in the eastern spurs of the Median ridge, east of the Gora Alney volcano, at an altitude of 266 metres above sea level. The lake is a widening of the Dvukhyurtochnaya River, which flows through it from west to east. To the north of the confluence of the Dvukhyurtochnaya River, two thermal springs flow into it. This lake is one of the spawning reservoirs of the peninsula. Above the northern shore of the lake stands the 1,081-metre Olney Volcano."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%BC%8A%E6%9D%B1%E8%B1%8A%E9%9B%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Sendai_Mediatheque_2009.jpg","page_title":"伊東豊雄","context_page_description":"伊東 豊雄は、日本の建築家。一級建築士。伊東豊雄建築設計事務所代表。\\n東京大学・東北大学・多摩美術大学・神戸芸術工科大学客員教授を歴任。高松宮殿下記念世界文化賞、RIBAゴールドメダル、UIAゴールドメダル、日本建築学会賞作品賞2度、グッドデザイン大賞、2013年度プリツカー賞など受賞歴多数。"},{"page_url":"https://tt.wikipedia.org/wiki/%D0%91%D3%A9%D0%B5%D0%BA_%D0%92%D0%B0%D1%82%D0%B0%D0%BD_%D1%81%D1%83%D0%B3%D1%8B%D1%88%D1%8B_%D1%85%D1%80%D0%BE%D0%BD%D0%B8%D0%BA%D0%B0%D1%81%D1%8B/1941_%D0%B5%D0%BB%D0%BD%D1%8B%D2%A3_%D0%BD%D0%BE%D1%8F%D0%B1%D1%80%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/RIAN_archive_884162_German_armor_unit_defeated_in_the_vicinity_of_Skirmanovo_village.jpg","page_title":"Бөек Ватан сугышы хроникасы/1941 елның ноябре","context_page_description":"Тихвин саклану операциясе. Ленинград фронтның 4-нче армиясы\\nМәскәү өчен сугыш."},{"page_url":"https://fi.wikipedia.org/wiki/Tuhkelot","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Single_lycoperdon_perlatum.jpg","page_title":"Tuhkelot","context_page_description":"Tuhkelot Lycoperdon on helttasienten suku, johon kuuluvat nykyisin myös kuukuset. Ne ovat valkoisia tai vaaleita nuijan tai pallon muotoisia lahottajasieniä, joiden itiöt kehittyvät sienen sisällä. Molekyylibiologiset tutkimukset ovat osoittaneet niiden kuuluvat helttasieniin.\\nTuhkelot ovat nuorena syötäviä, jolloin itiöemän malto on vielä vaaleaa, mutta itiöiden kypsyttyä malto tummuu eikä sieni enää sovellu ruuaksi. Tuhkelot voivat sisältää myös ureaa eivätkä siksi sovellu ruuaksi munuaisongelmaisille.\\nSuomenkielisen nimensä tuhkelot ovat saaneet kypsistä tummista itiöistä, jotka pöllähtävät kuin tuhka, kun vanhan sienen päälle astuu. Tieteellinen nimi Lycoperdon on käännetty ranskasta vesse-de-loup ja tarkoittaa sudenpierua.\\nTuhkeloiden näköisiä kupusieniä ovat esimerkiksi nuijakuukunen tai maamunien tai mukulakuukusten sienisukujen lajit."},{"page_url":"https://de.wikipedia.org/wiki/Dmitri_Babenko","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/89/Dmitri_Babenko_%282007-12-08%29_2.jpg","page_title":"Dmitri Babenko","context_page_description":"Dmitri Alexandrowitsch Babenko ist ein kasachischer Eisschnellläufer ethnisch russischer Herkunft.\\nDmitri Babenko nimmt seit 2003 an internationalen Wettbewerben teil. Zunächst startete er bei den Junioren-Weltmeisterschaften, ohne jedoch nennenswerte Platzierungen zu erreichen. Sein Weltcup-Debüt feierte Babenko im Februar 2004 in Heerenveen. Es dauerte jedoch bis zum Weltcup im Dezember 2007 in Kolomna, dass der Kasache als Siebter über 1500 Meter und als Achter über 10.000 Meter erstmals unter die besten zehn Starter in Weltcuprennen lief.\\nBei nationalen und internationalen Meisterschaften konnte Babenko schon mehrfach erfolgreich antreten. Fünfmal wurde er bislang in den Jahren von 2005 bis 2007 über Strecken von 1500 bis 10.000 Meter kasachischer Meister. Zudem hält er vier kasachische Landesrekorde. Bei den Asienmeisterschaften gewann er 2005 in Ikaho die Bronzemedaillen über 5000 und 10.000 Meter, zwei Jahre später in Changchun gewann er über die beiden Strecken Silber hinter Hiroki Hirako. 2007 in Kearns startete er erstmal bei diesem Ereignis auf der 10.000-Meter Strecke, auf der er den zwölften Platz belegte."},{"page_url":"https://cs.wikipedia.org/wiki/Lithprint","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Lith_print_Botanic.jpg","page_title":"Lithprint","context_page_description":"Lithprint je fotografický tiskový proces, který používá standardní černobílý fotografický papír s litografickou vývojkou, aby se dosáhlo tisku s tmavými stíny a měkkými a jasnými světly. Na rozdíl od klasického černobílého snímku je možné dosáhnout tónů, barev a jemných odstínů, čímž se oba procesy od sebe odlišují.\\nTuto technologii používá český fotograf Jiří Turek, například ve svém cyklu cityLAB, který vystavoval v Galerii Leica v Praze."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kategorie-A-Bauwerke_in_Glasgow","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/McPhater_Street_-_geograph.org.uk_-_995658.jpg","page_title":"Liste der Kategorie-A-Bauwerke in Glasgow","context_page_description":"Die Liste der Kategorie-A-Gebäude in Glasgow umfasst sämtliche in der Kategorie A eingetragenen Baudenkmäler in der schottischen Council Area Glasgow. Die Einstufung wird anhand der Kriterien von Historic Scotland vorgenommen, wobei in die höchste Kategorie A Bauwerke von nationaler oder internationaler Bedeutung einsortiert sind. In Glasgow sind derzeit 281 Bauwerke in der Kategorie A gelistet."},{"page_url":"https://ast.wikipedia.org/wiki/Templu_Espiatoriu_de_la_Sagrada_Familia","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Interior_SF_2017.jpg","page_title":"Templu Espiatoriu de la Sagrada Familia","context_page_description":"El Templu Espiatoriu de la Sagrada Familia, conocíu a cencielles como la Sagrada Familia, ye una basílica católica de Barcelona, diseñada pol arquiteutu Antoni Gaudí. Empecipiada en 1882, inda ta en construcción. Ye la obra maestra de Gaudí, y el máximu esponente de l'arquiteutura modernista catalana. Ye unu de los monumentos más visitaos d'España, xuntu al Muséu del Prado y l'Alhambra de Granada, y ye la ilesia más visitada d'Europa tres la basílica de San Pedro del Vaticanu.\\nLa Sagrada Familia ye un reflexu de la plenitú artística de Gaudí: trabayó nella mientres la mayor parte de la so carrera profesional, pero especialmente nos Antoni Gaudí#Etapa final: culminación del so estilu últimos años de la so carrera, onde llegó a la culminación del so estilu naturalista, faciendo una síntesis de toles soluciones y estilos probaos hasta aquel entós. Gaudí llogró una perfecta harmonía na interrellación ente los elementos estructurales y los ornamentales, ente plástica y estética, ente función y forma, ente conteníu y continente, llogrando la integración de toles artes nun tou estructurado y lóxicu."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D0%B0%D0%BD%D0%B4%D1%83%D1%80%D0%B0_%D0%9E%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_%D0%92%D1%96%D0%BA%D1%82%D0%BE%D1%80%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Oleksandr_Bandura.jpg","page_title":"Бандура Олександр Вікторович","context_page_description":"Олекса́ндр Ві́кторович Банду́ра — український футболіст, воротар клубу «Рух». Майстер спорту."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A7%D9%85%D9%BE%D8%B1%D8%A7%D8%AA%D9%88%D8%B1%DB%8C_%D8%A2%D8%B4%D9%88%D8%B1%DB%8C_%D9%86%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Map_of_Assyria_FA.png","page_title":"امپراتوری آشوری نو","context_page_description":"امپراتوری آشوری نو حکومتی سلطنتی بود که بین سال‌های ۹۱۱ تا ۶۱۲ پیش از میلاد در قسمت‌های زیادی از خاورمیانه کنونی حکومت می‌کرد."},{"page_url":"https://pt.wikipedia.org/wiki/Ole%C5%A1n%C3%A1_(Pelh%C5%99imov)","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bf/Ole%C5%A1n%C3%A1%2C_common_pond.jpg","page_title":"Olešná (Pelhřimov)","context_page_description":"Olešná é uma comuna checa localizada na região de Vysočina, distrito de Pelhřimov."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%87%D9%8A%D9%84%D9%8A%D9%86%D9%89_%D9%87%D9%8A%D8%AC%D9%8A%D9%85%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Helene_Hegemann_1.jpg","page_title":"هيلينى هيجيمان","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nهيلينى هيجيمان كاتبه من المانيا."},{"page_url":"https://es.wikipedia.org/wiki/Buhardilla_(ventana)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Lichtgaube.jpg","page_title":"Buhardilla (ventana)","context_page_description":"Una ventana de buhardilla o simplemente buhardilla​ es un hueco vertical que sobresale sobre la pendiente de un tejado inclinado para dar iluminación y ventilación a los espacios bajo cubierta y/o acceso a la misma o desde la misma. La buhardilla se compone de una fachada vertical, dos faldones laterales y una cubierta, generalmente a 2 o 3 aguadas, que forman limas con la cubierta principal. La buhardilla fue en origen una obra de carpintería que era soportada por la cubierta, a pesar de que su fachada podía ser de albañilería.\\nBuhardilla es un término polisémico que designa tanto al propio espacio bajo cubierta como ahora a las ventanas que los iluminan y ventilan. En otros idiomas se usan palabras diferentes, siendo esa la causa de problemas derivados de los préstamos y traducciones. La confusión se extiende al mismo uso de desván/buhardilla/ático, lumbrera/lucera/lucernario/claraboya/lucernario/tragaluz o incluso de las recientes ventanas de tejado o velux. De la importación del francés lucarne, se usaron antiguamente lucarnas o lumbreras, ahora con significados diferentes y en desuso."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%A9%AC%E5%9C%BA%E5%88%AB%E5%A2%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/%E9%A9%AC%E5%9C%BA%E9%81%93%E9%A9%AC%E5%9C%BA%E5%88%AB%E5%A2%851%E3%80%813%E3%80%815%E5%8F%B7.jpg","page_title":"马场别墅","context_page_description":"馬場別墅始建於1938年，為英國天主教會守善堂投資興建，位於當時的天津英租界的馬廠道，目前為一般保護等級歷史風貌建築。"},{"page_url":"https://nl.wikipedia.org/wiki/Sordariomycetidae","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Geweizwam.jpg","page_title":"Sordariomycetidae","context_page_description":"De Sordariomycetidae vormen een subklasse van de klasse der Sordariomycetes.\\nDe bekendste geslachten schimmels die behoren tot deze subklasse zijn Hypomyces en Xylaria. Ook het gewoon meniezwammetje behoort tot de Sordariomycetidae."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Catawba_County,_North_Carolina","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Moretz_House_Hickory_North_Carolina.jpg","page_title":"National Register of Historic Places listings in Catawba County, North Carolina","context_page_description":"This list includes properties and districts listed on the National Register of Historic Places in Catawba County, North Carolina. Click the \\"Map of all coordinates\\" link to the right to view an online map of all properties and districts with latitude and longitude coordinates in the table below."},{"page_url":"https://en.wikipedia.org/wiki/List_of_United_States_Air_Force_bomb_squadrons","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/911th_Air_Refueling_Squadron.jpg","page_title":"List of United States Air Force bomb squadrons","context_page_description":"This is a list of United States Air Force Bomb Squadrons. It covers all squadrons that were constituted or redesignated as bombardment squadron sometime during their active service. Today Bomb Squadrons are considered to be part of the Combat Air Force along with fighter squadrons. Units in this list are assigned to nearly every Major Command in the United States Air Force. All the active Bomb Squadrons are in Bold."},{"page_url":"https://es.wikipedia.org/wiki/Jacobo_Estuardo,_duque_de_Cambridge","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/James%2C_Duke_of_Cambridge_-_Wright_1666-7.jpg","page_title":"Jacobo Estuardo, duque de Cambridge","context_page_description":"Jacobo, duque de Cambridge fue el segundo de los hijos de Jacobo, duque de York y de Ana Hyde, su primera esposa. Durante su corta vida ostentó los títulos de duque de Cambridge, conde de Cambridge y barón de Dauntsey.\\nLa relación entre Jacobo y su tío, el rey Carlos II, era especialmente estrecha. Este lo creó duque de Cambridge y barón de Dauntsey, títulos de los que fue su primer portador. Asimismo el rey también lo nombró caballero de orden de la Jarretera aunque nunca fue investido como tal debido a su temprana muerte. Recibió una pensión anual de 3000 £ de parte del rey. Luego de su muerte, dicha pensión le fue emitida a su padre, con la finalidad de apoyar a los hermanos menores de Jacobo.\\nSu hermana María, futura reina María II, le tuvo especial estima y siendo princesa de Orange encargó a Willem Wissing dos retratos: uno de su madre y otro de Jacobo. Este último fue colocado sobre la puerta de la Sala de estar de la Reina, en el castillo de Windsor."},{"page_url":"https://it.wikipedia.org/wiki/Padiglione_d%27arte_contemporanea_di_Milano","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/PAC_%28padiglione_d%27arte_contemporanea%29_-_milano.JPG","page_title":"Padiglione d'arte contemporanea di Milano","context_page_description":"Il Padiglione di arte contemporanea è un edificio di Ignazio Gardella situato in via Palestro a Milano accanto alla Villa Reale e costruito tra il 1951 e il 1953 su un progetto del 1949.\\nSotto la guida di Mercedes Garberi il PAC viene chiuso nel 1973, per una profonda riqualificazione, ammodernamento e adeguamento alle normative per la conservazione, e riaperto nel 1979. L'ultimo restauro avviene nel 1996 dal figlio dell'architetto, Jacopo Gardella, dopo un attentato del 1993 che l'aveva danneggiato."},{"page_url":"https://no.wikipedia.org/wiki/Ambon_(%C3%B8y)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Ambon_and_Lease_Islands_%28Uliasers%29_en.png","page_title":"Ambon (øy)","context_page_description":"Ambon er en indonesisk øy i øygruppen Molukkene. Den har et areal på 775 km² og er fjellrik."},{"page_url":"https://nl.wikipedia.org/wiki/Teunismolen","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Molen_Teunismolen_maalkoppel_windas_steenspil.jpg","page_title":"Teunismolen","context_page_description":"De Teunismolen is een korenmolen in De Heurne in de Nederlandse provincie Gelderland.\\nDe molen werd in 1822 gebouwd, naar alle waarschijnlijkheid volgens het bestek van de drie jaar eerder gebouwde beltmolen Hermien in Harreveld. De molen heette aanvankelijk De Haan maar werd in de volksmond altijd vernoemd naar de nabijgelegen boerderij Het Teunishuis waarna de huidige naam ontstond. De molen is in 1942 gerestaureerd. Na aankoop door de toenmalige gemeente Dinxperlo in 1986 werd de molen wederom grondig gerestaureerd. Na de gemeentelijke herindeling is de molen eigendom van de gemeente Aalten.\\nDe gelaste roeden van de molen zijn in 1987 gemaakt door Groot-Wesseldijk te Lochem en hebben een lengte van 23,50 meter. De binnenroede heeft nummer 20 en de buitenroede nummer 19. Ze zijn voorzien van het Van Busselsysteem, op de binnenroede in combinatie met Ten Have-kleppen, op de buitenroede met zeilen. Voor de bediening van de zwichtstang, de stang die door de bovenas loopt, is er een rondgaande ketting met kettingwiel en een tandheugel.\\nDe inrichting bestaat uit één koppel maalstenen en diverse andere apparatuur, zoals graanreiniger, elevator, elektrisch luiwerk en mengketel."},{"page_url":"https://de.wikipedia.org/wiki/Joseph_Vivien","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Max_Emanuel_als_Feldherr-Vivien%2C_1706.jpg","page_title":"Joseph Vivien","context_page_description":"Joseph Vivien war ein französischer Porträtist, der vor allem durch Pastellmalerei hervortrat."},{"page_url":"https://en.wikipedia.org/wiki/Sosarme","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/London_Kings_Theatre_Haymarket.jpg","page_title":"Sosarme","context_page_description":"Sosarme, re di Media is an opera by George Frideric Handel written in 1732 for the King's Theatre in the Haymarket, London, where it ran for 12 performances. The text was based on an earlier libretto by Antonio Salvi, Dionisio, Re di Portogallo, and adapted by an unknown writer. The original setting of Portugal was changed to Sardis in Lydia."},{"page_url":"https://de.wikipedia.org/wiki/Arme_Dienstm%C3%A4gde_Jesu_Christi","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Kreuzweg_des_Klosters_Maria_Hilf_in_Dernbach.jpg","page_title":"Arme Dienstmägde Jesu Christi","context_page_description":"Die Armen Dienstmägde Jesu Christi sind eine katholische Ordensgemeinschaft bzw. Kongregation päpstlichen Rechts. Sie wurde durch die am 14. Oktober 2018 heiliggesprochene Maria Katharina Kasper in Dernbach im Bistum Limburg gegründet. Die Gemeinschaft erwuchs aus einer um das Jahr 1845 gegründeten Gruppe. Sie erhielt im Jahr 1851 durch den Bischof von Limburg das Ordenskleid und er nahm auch ihre Gelübde entgegen. Die Haupttätigkeitsbereiche der Schwestern sind Krankenpflege, Kinderfürsorge, Erziehung und Bildung sowie pastorale Dienste. Das Mutterhaus, Kloster Maria Hilf, befindet sich in Dernbach. Hier ist der Sitz des Generalates für die gesamte Gemeinschaft sowie des Provinzialates für Deutschland."},{"page_url":"https://en.wikipedia.org/wiki/Ch%C3%A2teau_du_Pin","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Blason_fr_famille_Chanaleilles_%28Vivarais%29.svg","page_title":"Château du Pin","context_page_description":"The Château du Pin is a château in Fabras in Ardèche, southwestern France. It was built in the 12th century by the Chanaleilles family, then was heavily remodelled in the 16th century. The spot then acquired a dual function: military, with the addition of defensive towers, but also with agricultural crops in the field. The Château du Pin is typical of the fortified houses of Ardèche and the Cévennes. Built on a hillside, the castle is now surrounded by contemporary gardens, chestnut trees and dry stone terraces. The set is now a website dedicated to contemporary creation, open to the public since 1994 as a museum."},{"page_url":"https://vi.wikipedia.org/wiki/Conus_estivali","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Conus_estivali_2.jpg","page_title":"Conus estivali","context_page_description":"Conus estivali là một loài ốc biển, là động vật thân mềm chân bụng sống ở biển trong họ Conidae, họ ốc cối.\\nGiống như tất cả các loài thuộc chi Conus, chúng là loài săn mồi và có nọc độc. Chúng có khả năng \\"đốt\\" con người, do vậy khi cầm chúng phải hết sức cẩn thận."},{"page_url":"https://en.wikipedia.org/wiki/International_Transtar","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/2008-07-24_International_truck_docked_at_Duke_Hospital_South_2.jpg","page_title":"International Transtar","context_page_description":"The International TranStar, is a range of Class 8 trucks produced by Navistar International for North America. Produced nearly exclusively as a semitractor, the product range is focused towards local delivery and regional shipping.\\nIntroduced in 2002, the 8000 Series replaced a product line of the same name derived from the long-running International Harvester S-Series. In 2007, Navistar rebranded the 8000 Series as the International TranStar. The name is derived from International Harvester Transtar, used for various Class 8 conventional and cabover highway tractors from the 1960s to the 1980s."},{"page_url":"https://en.wikipedia.org/wiki/Viktor_Svezhov","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Viktor_Svezhov_2012.jpg","page_title":"Viktor Svezhov","context_page_description":"Viktor Vladimirovich Svezhov is a Russian professional footballer for FC Istiklol."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%87%9C%E6%B7%B5%E3%81%AE%E6%BB%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Kamabuchi_Fall%2CHanamaki.jpg","page_title":"釜淵の滝","context_page_description":"釜淵の滝は岩手県花巻市にある滝。"},{"page_url":"https://pl.wikipedia.org/wiki/Zwiastowanie_(obraz_Jana_van_Eycka,_Waszyngton)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Jan_van_Eyck_081.jpg","page_title":"Zwiastowanie (obraz Jana van Eycka, Waszyngton)","context_page_description":"Zwiastowanie – olejny obraz niderlandzkiego malarza Jana van Eycka datowany na lata 1434-1436. Znajduje się obecnie w National Gallery of Art. Pierwotnie obraz został namalowany na desce, ale został przeniesiony na płótno. Uważa się, że stanowił jedno ze skrzydeł tryptyku.\\nZwiastowanie jest dziełem bardzo złożonym, pełnym metafor i przesłań, które są często dyskutowane przez historyków sztuki. Scena przedstawia archanioła Gabriela, który zwiastuje Maryi, że urodzi Syna Bożego. Na obrazie wypisane są słowa pozdrowienia anielskiego: \\"AVE GRÃ. PLENA\\" oraz odpowiedź Maryi: \\"ECCE ANCILLA DÑI.\\", która została odwrócona do góry nogami, ponieważ skierowana jest do góry, do Boga. Duch Święty w postaci gołębicy spływa na siedmiu promieniach światła, które prawdopodobnie symbolizują siedem darów Ducha.\\nPoprzez wcielenie Chrystusa czasy prawa, Starego Testamentu, przeminęły i nadszedł czas łaski Boga. Myśl tą wyraża architektura kościoła, która z romańskich łuków okien na górze przechodzi w ostre łuki gotyku w dolnych arkadach."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A2%D8%AF%DB%8C%D9%86%D9%88%D9%85%D9%88%D8%B3%D9%88%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Adynomosaurus_LM.png","page_title":"آدینوموسور","context_page_description":"آدینوموسور نام یک سرده از تیره اردک منقاران است. نام وی به معنی سوسمار سست بازو می‌باشد که به قطعات اضافه و بی استفاده ای در بازوی دایناسور اشاره دارد. سنگواره وی در کاتالونیا اسپانیا یافت شد. گونه خاص این جانور Adynomosaurus arcanus نام دارد."},{"page_url":"https://sq.wikipedia.org/wiki/Xhamia_e_Hysref_Pash%C3%ABs","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Khusruwiyah_Mosque%2C_Aleppo_%281%29.jpg","page_title":"Xhamia e Hysref Pashës","context_page_description":"Xhamia e Divane Hysref Pashës ose Kompleksi Hysrefia ishtë një monument i trashëgimisë kulturore qe ndodhet në Halep, Siri. Kjo xhami osmane ishtë ndërtua në shekullin e 16-të nga arkitekti shqiptar Mimar Sinani. Ishtë xhami me sherefeja me e bukur në minare."},{"page_url":"https://fr.wikipedia.org/wiki/Place_des_femmes_en_sciences","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Goddess_Sarasvati_appears_before_Yajnavalkya.jpg","page_title":"Place des femmes en sciences","context_page_description":"Les contributions des femmes à la science sont recensées depuis les débuts de l'histoire. L'étude historique, critique et sociologique de ces rapports est elle-même devenue une discipline en soi."},{"page_url":"https://ceb.wikipedia.org/wiki/Bj%C3%B8rnfjellet_(bukid_sa_Noruwega,_Nordland_Fylke,_Narvik)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Sunrise_over_Bj%C3%B8rnfjell.jpg","page_title":"Bjørnfjellet (bukid sa Noruwega, Nordland Fylke, Narvik)","context_page_description":"Bukid ang Bjørnfjellet sa Noruwega, sa ibabaw sa utlanan sa Suwesya. Nahimutang ni sa munisipyo sa Narvik ug lalawigan sa Nordland Fylke, sa amihanan-sidlakang bahin sa nasod, 1,000 km sa amihanan sa Oslo ang ulohan sa nasod. 633 metros ibabaw sa dagat kahaboga ang nahimutangan sa Bjørnfjellet.\\nAng yuta palibot sa Bjørnfjellet kay kabungtoran. Ang kinahabogang dapit sa palibot dunay gihabogon nga 1,365 ka metro ug 7.5 km sa habagatan-sidlakan sa Bjørnfjellet. Kunhod pa sa 2 ka tawo kada kilometro kwadrado sa palibot sa Bjørnfjellet. Walay lungsod sa palibot. Hapit nalukop sa kasagbotan ang palibot sa Bjørnfjellet. Sa rehiyon palibot sa Bjørnfjellet, mga kalapukan talagsaon komon.\\nAng klima tundra. Ang kasarangang giiniton -7 °C. Ang kinainitan nga bulan Hulyo, sa 9 °C, ug ang kinabugnawan Marso, sa -16 °C."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D1%80%D0%B5%D0%BA%D1%81%D0%B5%D0%BB%D1%8C,_%D0%AD%D0%BD%D1%82%D0%BE%D0%BD%D0%B8_%D0%94%D0%B6%D0%BE%D0%B7%D0%B5%D1%84","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/22/Anthony_Joseph_Drexel_I_626.jpg","page_title":"Дрексель, Энтони Джозеф","context_page_description":"Энтони Джозеф Дрексель — американский банкир, финансист и филантроп, который сыграл ключевую роль в становлении современной глобальной финансовой системы после американской гражданской войны. Как старший партнер компании «Drexel & Co.» из Филадельфии, в 1871 году в Нью-Йорке он основал компанию «Drexel, Morgan & Co», как младший партнер. Дрексель является основателем Дрексельского университета. Был первым президентом «Fairmount Park Art Association», первой частной американской организации, которая занималась внедрением искусства в городское планирование."},{"page_url":"https://uk.wikipedia.org/wiki/SNCG","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/PBB_GE_SNCG_209877_at_fs.png","page_title":"SNCG","context_page_description":"SNCG – білок, який кодується однойменним геном, розташованим у людей на короткому плечі 10-ї хромосоми. Довжина поліпептидного ланцюга білка становить 127 амінокислот, а молекулярна маса — 13 331.\\nКодований геном білок за функцією належить до фосфопротеїнів.\\nЛокалізований у цитоплазмі, цитоскелеті."},{"page_url":"https://es.wikipedia.org/wiki/Hermandad_Penitencial_de_Nuestro_Se%C3%B1or_Jes%C3%BAs_Luz_y_Vida_(Zamora)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Procesion_Luz_y_Vida_2012_706.jpg","page_title":"Hermandad Penitencial de Nuestro Señor Jesús Luz y Vida (Zamora)","context_page_description":"La Hermandad Penitencial de Nuestro Señor Jesús de Luz y Vida es una cofradía católica de la ciudad de Zamora que desfila en su Semana Santa, concretamente el Sábado de Pasión."},{"page_url":"https://it.wikipedia.org/wiki/Cumanotus","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/IMG0087_Cumanotus_beaumonti.jpg","page_title":"Cumanotus","context_page_description":"Cumanotus Odhner, 1907 è un genere di molluschi nudibranchi, unico genere noto della famiglia Cumanotidae."},{"page_url":"https://en.wikipedia.org/wiki/Lausanne_Opera","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Fa%C3%A7ade_Op%C3%A9ra_de_Lausanne.jpg","page_title":"Lausanne Opera","context_page_description":"The Lausanne Opera is an opera house based in Lausanne, Switzerland.\\nOnce known as a municipal theater, it has transformed into a world renowned opera house that produces and co-produces their own productions. With a stage renovation in 2012, the Lausanne Opera offers a wide variety of operas, from baroque to contemporary, along with concerts and ballets. Thanks to its bold programming and emphasis on quality vocals and stage production, the Lausanne Opera welcomes over 45'000 spectators a year and continues to make itself known internationally."},{"page_url":"https://hu.wikipedia.org/wiki/Pseudis_minuta","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Podonectes_minutus02.jpg","page_title":"Pseudis minuta","context_page_description":"A Pseudis minuta a kétéltűek osztályának a békák rendjéhez, ezen belül a levelibéka-félék családjához tartozó faj."},{"page_url":"https://hsb.wikipedia.org/wiki/Split","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b7/Split%2C_Croatia_from_Ferry.JPG","page_title":"Split","context_page_description":"Split je najwjetše a najwažniše město Dalmaciskeje z něhdźe 170.000 wobydlerjemi a administratiwny centrum Splitsko-dalmaciskeje županije w južnej Chorwatskej. Leži na małej połkupje při wuchodnym pobrjoze Jadranskeho morja.\\nPo Zagrebu druhe najwjetše město Chorwatskeje je wažny mórski přistaw. Nutřkowne město a powostanki romskeho palasta Diokletiana słušatej z lěta 1979 do swětoweho kulturneho herbstwa UNESCO."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D0%B0%D0%B2%D0%BB%D0%BE%D0%B2_%D0%9A%D0%B0%D0%BF%D1%96%D1%82%D0%BE%D0%BD_%D0%A1%D1%82%D0%B5%D0%BF%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/%D0%9F%D0%B0%D0%B2%D0%BB%D0%BE%D0%B2_%D0%9A%D0%B0%D0%BF%D1%96%D1%82%D0%BE%D0%BD._%D0%94%D1%96%D1%82%D0%B8_%D0%B1%D1%83%D0%B4%D1%83%D1%8E%D1%82%D1%8C_%D0%BA%D0%B0%D1%80%D1%82%D0%BA%D0%BE%D0%B2%D0%B8%D0%B9_%D0%B4%D1%96%D0%BC.jpg","page_title":"Павлов Капітон Степанович","context_page_description":"Капітон Степанович Па́влов — український живописець, педагог."},{"page_url":"https://en.wikipedia.org/wiki/Black_vulture","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Coragyps-atratus-002.jpg","page_title":"Black vulture","context_page_description":"The black vulture, also known as the American black vulture, is a bird in the New World vulture family whose range extends from the southeastern United States to Peru, Central Chile and Uruguay in South America. Although a common and widespread species, it has a somewhat more restricted distribution than its compatriot, the turkey vulture, which breeds well into Canada and south to Tierra del Fuego. It is the only extant member of the genus Coragyps, which is in the family Cathartidae. Despite the similar name and appearance, this species is unrelated to the Eurasian black vulture, an Old World vulture in the family Accipitridae. It inhabits relatively open areas which provide scattered forests or shrublands. With a wingspan of 1.5 m, the black vulture is a large bird though relatively small for a vulture. It has black plumage, a featherless, grayish-black head and neck, and a short, hooked beak.\\nThe black vulture is a scavenger and feeds on carrion, but will also eat eggs or kill newborn animals. In areas populated by humans, it also feeds at garbage dumps. It finds its meals either by using its keen eyesight or by following other vultures, which possess a keen sense of smell."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A7%D8%B1%D9%84%D8%A7","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cd/Erla_Zaragoza.jpg","page_title":"ارلا","context_page_description":"ارلا ایسپانیادا بیر یاشاییش منطقه‌سی‌دیر و ساراقوسا اوستانینده یئرلشیب. بۇ شهرین مساحتی ۱۹ کیلومتر موربّع دیر. سوْن نۆفوس تخمین‌لرینه گؤره ۴۳۸ نفر و اها‌لی سیخلیغی ۲۳٫۱ اینسان کیلومتر موربّع دیر."},{"page_url":"https://de.wikipedia.org/wiki/W%C3%A4hringer_Schubertpark","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Schubertgarage.JPG","page_title":"Währinger Schubertpark","context_page_description":"Der Schubertpark ist eine Parkanlage im 18. Wiener Gemeindebezirk, Währing, die 1925 auf dem Gelände des aufgelassenen Währinger Ortsfriedhofs eröffnet wurde. Ein Gräberhain zeigt Grabsteine einst hier bestatteter Prominenter."},{"page_url":"https://de.wikipedia.org/wiki/Petrikirche_(Rostock)","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/15/Petrikirche_mit_Stadtmauer-3.jpg","page_title":"Petrikirche (Rostock)","context_page_description":"Die Petrikirche ist die älteste und mit 117,0 m die höchste der ehemals vier Stadtkirchen der Hansestadt Rostock.\\nDie anderen sind bzw. waren die Marienkirche, die Nikolaikirche und die im Zweiten Weltkrieg zerstörte und 1960 endgültig abgetragene Jakobikirche. Wie die anderen genannten Kirchen gehört sie zur Evangelisch-Lutherischen Innenstadtgemeinde Rostock der Propstei Rostock im Kirchenkreis Mecklenburg der Evangelisch-Lutherischen Kirche in Norddeutschland. Von der Petrikirche ging in Rostock die Reformation aus, als 1523 Herzog Heinrich V. den dortigen Kaplan Joachim Slüter mit der evangelischen Predigt beauftragte. Bei einem Luftangriff 1942 brannte die Petrikirche mit ihrer gesamten Innenausstattung aus und verlor ihren charakteristischen Turmhelm."},{"page_url":"https://es.wikipedia.org/wiki/Regi%C3%B3n_de_Occitania","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/1771_Bonne_Map_of_Languedoc_and_Roussillon%2C_France_-_Geographicus_-_Languedoc-bonne-1771.jpg","page_title":"Región de Occitania","context_page_description":"Occitania es una de las trece regiones que, junto con los territorios de Ultramar, conforman la República Francesa. Su ciudad más grande es Toulouse, así como su prefectura regional, mientras que la segunda capital de la región, Montpellier, retiene varias administraciones.​\\nEstá ubicada al sur del país, limitando al norte con Auvernia-Ródano-Alpes, al noreste con Provenza-Alpes-Costa Azul, al este con el golfo de León, al sur con Andorra y los montes Pirineos que la separan de España, y al oeste con Nueva Aquitania. Con 72 724 km² es la segunda región más extensa, por detrás de Nueva Aquitania.\\nSe creó por la reforma territorial de 2014 fusionándose Languedoc-Rosellón y Mediodía-Pirineos, y entró en vigor el 1 de enero de 2016.​"},{"page_url":"https://de.wikipedia.org/wiki/Gasherbrum-Gruppe","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2e/Gasherbrum_I.jpg","page_title":"Gasherbrum-Gruppe","context_page_description":"Die Gasherbrum-Gruppe ist ein bis zu 8080 Meter hohes Bergmassiv im Baltoro Muztagh im inneren Karakorum.\\nMit drei Achttausendern ist sie Ziel vieler Alpinisten und Trekking-Touristen. Sie liegt im Grenzgebiet zwischen der pakistanischen autonomen Region Gilgit-Baltistan und China in der umstrittenen Region Kaschmir. Das von Indien kontrollierte Gebiet des Siachengletschers beginnt wenige Kilometer entfernt.\\nDer höchste Berg der Gruppe ist mit 8080 Metern der Hidden Peak, auch Gasherbrum I genannt. Nur wenig niedriger sind Broad Peak und Gasherbrum II. Der markanteste Berg ist beim Anmarsch von Westen der Gasherbrum IV, Namensgeber des Massivs."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%BA%AB%E5%BE%B9%E6%96%AF%E7%89%B9M1912%E6%B3%B5%E5%8B%95%E5%BC%8F%E9%9C%B0%E5%BD%88%E6%A7%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Vietnam-War-US-Military-Bayonets.jpg","page_title":"溫徹斯特M1912泵動式霰彈槍","context_page_description":"溫徹斯特M1912是一款由美國槍械製造商溫徹斯特連發武器公司所研製和生產的壓動式、內置擊錘式設計及由內置式管式彈倉供彈的散彈槍。該散彈槍在推出後不久被流普遍地命名為「完美的連發槍」，基本奠定了該散彈槍對於壓動式散彈槍超過51年的高效率生產的生涯的標準。從1912年開始生產直到在1963年第一次被溫徹斯特下令停止生產為止，總共生產了近200萬把各種各樣的版本、等級和槍管長度的M1912。最初該散彈槍只能發射20鉛徑散彈，後來1914年推出了12鉛徑和16鉛徑散彈的版本，後來1934年更推出了28鉛徑散彈的版本。其.410口徑版本卻是從未生產，而是把M1912按照比例縮小並且被稱為M42，直接以M1912規格圖紙按比率衍生而成，製成了其.410的版本。"},{"page_url":"https://no.wikipedia.org/wiki/Koptere","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Coptic.jpg","page_title":"Koptere","context_page_description":"Kopter er en etniskreligiøs gruppe innfødt i Nord-Afrika som hovedsakelig bor i dagens Egypt hvor de er den største kristne befolkningen i landet som ellers er dominert av muslimer. Koptere er også den største kristne gruppen i Sudan og i Libya. Historisk snakket de koptisk, som er en direkte etterkommer av demotisk egyptisk, som ble snakket i senantikken.\\nI den moderne betydning av ordet referer koptere til innfødte kristne i Egypt, hvor flertallet av dem er medlemmer av den koptiske ortodokse kirke, og i mindre grad i den koptiske katolske kirke, og den koptiske protestantiske kirke. Mens det nøyaktige antallet er omdiskutert, angir koptiske kilder antallet til mellom 7 og 15 millioner mennesker. En beregning fra 2005 oppgir antallet til nærmere 5 millioner, hvilket tilsvarer noe i underkant av 10 % av den totale egyptiske befolkningen, som teller i overkant av 70 millioner. En beregning har kommet fram til 10–15 % av den egyptiske befolkningen. Koptere i Sudan er det største kristne samfunnet i landet, men kun beregnet til 1 % av landets befolkning. Koptere i Libya utgjør det største kristne samfunnet i Libya, noe som er beregnet til utgjøre 1 % av den libyske befolkningen."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B0%D0%B3%D0%B0%D0%B2%D0%B0_%D0%9A%D0%B0%D0%B3%D1%8D%D0%BA%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Kagawa_Kageki.jpg","page_title":"Кагава Кагэки","context_page_description":"Кагава Кагэки — японский поэт периода Эдо.\\nРодился в Тоттори, в семье бедного самурая Араи. С детских лет изучал поэзию. В четырнадцать лет написал комментарий к антологии XIII века «Хякуниниссю».\\nНачиная с 1793 г., учился поэзии в Киото под предводительством поэта школы Нидзё Кагавы Кагэмото, который впоследствии даже усыновил своего ученика.\\nВ 1796 г. Кагэки познакомился с семидесятилетним мэтром поэзии Одзавой Роаном, на которого произвёл хорошее впечатление своим мастерством. Роан часто давал парню очень дельные профессиональные советы и одновременно был его самым жестоким критиком.\\nКагэки создал собственный стиль поэзии жанра танка, характерными чертами которого были изысканная литературная речь и отсутствие архаизмов, использование которых в современной поэзии он остро критиковал. Кроме того, Кагэки придерживался стиля поэтов антологии «Кокинсю», которые предпочитали намёки и суггестии в стихотворении, избегая открытого проявления чувств, присущего поэтам «Манъёсю». Основанная Кагэки школа поэзии Кайен насчитывала более десяти тысяч учащихся и занимала ведущее место в поэзии вака позднего периода Токутава."},{"page_url":"https://et.wikipedia.org/wiki/M%C5%ABrmui%C5%BEa_vasallilinnus","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/M%C5%ABrmui%C5%BEa_vasallilinnus_03.jpg","page_title":"Mūrmuiža vasallilinnus","context_page_description":"Mūrmuiža vasallilinnus oli Liivimaa ordu lätlaste asualadel paiknenud väikelinnus, mis asub Lätis Vidzeme kultuuriajaloolises piirkonnas, 5 km kaugusel Volmarist lõunakagus ja 13 km kaugusel Trikatast lääneedelas, Mūrmuiža asulas Miegupite oja ja paisjärve lõunakaldal Mīļuma ojasuudmest idas. Tornlinnus jääb administratiivjaotuse järgi Beverīna piirkonnas Kauguri valda.\\nVenemaa keisririigi lõpuni kehtinud ajaloolise haldusjaotuse järgi asus linnus Liivimaa kubermangu Volmari maakonna Volmari kihelkonnas."},{"page_url":"https://fi.wikipedia.org/wiki/Baishan","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Baishan_mcp.png","page_title":"Baishan","context_page_description":"Baishan on prefektuuritason kaupunki Kiinan Jilinin maakunnan eteläosassa. Kaupungin keskusta sijaitsee linnuntietä noin 230 kilometriä maakunnan pääkaupunki Changchunista kaakkoon. Prefektuurin pinta-ala on 17 474 neliökilometriä ja väkiluku 1,3 miljoonaa.\\nKaupunki rajoittuu lännessä Tonghuan, pohjoisessa Jilinin prefektuuritason kaupunkeihin, sekä idässä Yanbianin autonomiseen prefektuuriin. Etelässä kaupunki rajoittuu Korean demokraattiseen kansantasavaltaan."},{"page_url":"https://fr.wikipedia.org/wiki/Rasteau_(AOC)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Domaine_Beauregard.jpg","page_title":"Rasteau (AOC)","context_page_description":"Le rasteau est un vin d'appellation d'origine contrôlée produit sur les communes de Cairanne, Rasteau et Sablet, dans le Vaucluse. Pour les vins rouges, seule la commune de Rasteau a le droit d'en produire. La reconnaissance d’AOC date de 1944 pour les vins doux naturels et de 2010 pour les vins rouges secs."},{"page_url":"https://arz.wikipedia.org/wiki/%DA%A4%D9%84%D8%A7%D8%AF%D9%8A%D9%85%D9%8A%D8%B1_%D9%BE%D9%88%D9%BE%D9%88%DA%A4%D9%83%D9%8A%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Vladimir_Popovkin.jpg","page_title":"ڤلاديمير پوپوڤكين","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nڤلاديمير پوپوڤكين كان عسكرى برتبه General of the army من روسيا."},{"page_url":"https://fi.wikipedia.org/wiki/Luettelo_Euroopan_Unionin_urbaanialueista_v%C3%A4kiluvun_mukaan","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Central_business_district_of_Barcelona_%282%29.JPG","page_title":"Luettelo Euroopan Unionin urbaanialueista väkiluvun mukaan","context_page_description":"Tämä artikkeli on luettelo Euroopan unionin suurimmista urbaanialueista väkiluvun mukaan"},{"page_url":"https://nl.wikipedia.org/wiki/Slag_bij_Balaklava","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Robert_Gibb_-_The_Thin_Red_Line.jpg","page_title":"Slag bij Balaklava","context_page_description":"De Slag bij Balaklava was een veldslag op 25 oktober 1854 in de Krimoorlog.\\nDe geallieerden onder de Britse FitzRoy Somerset, 1st Baron Raglan en de Franse François Certain Canrobert hadden hun troepen opgesteld ten zuiden van Sebastopol om die Russische marinehaven te belegeren. De Fransen bezetten Kamysj op de westelijke kust en de Britten zaten in de zuidelijke haven van Balaklava. Raglan had te weinig om de flank af te dekken en de Russische generaal Pavel Liprandi bereidde met 25.000 man een aanval op Balaklava voor om de belegerende troepen af te snijden van de Britse basis.\\nDe slag begon met een aanval van Russische artillerie en infanterie op de Ottomaanse redoutes rond Balaklava. Daarop viel de Russische cavalerie aan, maar de Thin Red Line van het Schotse 93e Highland Regiment hield stand en sloeg de aanval terug. De zware brigade van generaal James Yorke Scarlett voerde een tegenaanval uit. Een verkeerd begrepen bevel van Raglan leidde tot de Charge van de Lichte Brigade waarbij de lichte brigade verloren ging."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D1%80%D1%8B%D0%B1_%D0%B8_%D0%BA%D1%80%D1%83%D0%B3%D0%BB%D0%BE%D1%80%D0%BE%D1%82%D1%8B%D1%85_%D0%A3%D0%BA%D1%80%D0%B0%D0%B8%D0%BD%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Perca_fluviatilis-female_Siverskiy_Donets_River_Ukraine.jpg","page_title":"Список рыб и круглоротых Украины","context_page_description":"Рыбы и круглоротые Украины — список из видов лучепёрых рыб и миног, которые были зарегистрированы на территории Украины."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%92%D0%BE%D0%BB%D0%B4%D0%B5%D0%BC%D0%B0%D1%80_(%D0%9B%D0%B8%D0%BF%D0%B5-%D0%94%D0%B5%D1%82%D0%BC%D0%BE%D0%BB%D0%B4)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Leopold_II_zur_Lippe.jpg","page_title":"Волдемар (Липе-Детмолд)","context_page_description":"Гюнтер Фридрих Волдемар фон Липе е четвъртият княз на Липе, генерал на Кралство Прусия.\\nТой е вторият син на княз Леополд II фон Липе и съпругата му принцеса Емилия Фридерика Каролина фон Шварцбург-Зондерсхаузен, дъщеря на княз Гюнтер Фридрих Карл I фон Шварцбург-Зондерсхаузен и принцеса Вилхелмина Фридерика Каролина фон Шварцбург-Рудолщат.\\nБрат е на Леополд III, княз на Липе, Фридрих, Емил Херман, Карл Александер, княз на Липе.\\nВолдемар фон Липе започва управлението си на 51 години на 8 декември 1875 г. Преди това той е офицер в пруската войска, напуска като генерал на кавалерията. Той е рицар на Ордена на Черния орел.\\nПонеже е бездетен и заради взетите права на брат му Карл Александер, той определя в завещанието си за свой наследник принц Адолф фон Шаумбург-Липе, женен за Виктория Пруска, дъщеря на кайзер Фридрих III. Това завещание довежда до сериозни конфликти между потенциалните наследници, превлекли през следващите десетилетия вниманието на световната общественост.\\nВолдемар фон Липе умира на 20 март 1895 г. на 70 години в Детмолд."},{"page_url":"https://de.wikipedia.org/wiki/Sportjahr_1874","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/QueensParkFC1874.jpg","page_title":"Sportjahr 1874","context_page_description":"2. April: Der Club Alpin Français wird gegründet.\\n26. Juli: Moritz von Déchy, Victor Hecht, sowie den Bergführern Johann Pinggera und Josef Spechtenhauser gelingt die Erstbesteigung der Petersenspitze.\\n6. August: E.R. Whitwell und C. und J. Lauener gelingt in der Mont-Blanc-Gruppe die Erstbesteigung des Aiguille de Blaitière.\\nTheodor Petersen, M. Déchy, Victor Hecht mit den Führern Alois Ennemoser, Johann Pinggera und J. Spechtenhauser besteigen als erste die Innere Schwarze Schneid und den Mutkogel."},{"page_url":"https://cs.wikipedia.org/wiki/Ivan_St%C4%9Bpanovi%C4%8D_Kon%C4%9Bv","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Konev_Monument_in_Bubene%C4%8D_%286181%29.jpg","page_title":"Ivan Stěpanovič Koněv","context_page_description":"Ivan Stěpanovič Koněv byl sovětský vojevůdce, maršál Sovětského svazu, hrdina SSSR a hrdina ČSSR. V průběhu druhé světové války velel vojskům Rudé armády na východní frontě, která osvobodila od okupace německými nacisty velkou část východní Evropy. Také se podílel na karpatsko-dukelské operaci v roce 1944, na osvobození německého koncentračního tábora Osvětim. Měl významný podíl na obchvatné viselsko-oderské operaci, kde padlo na 295 000 německých vojáků a dalších 175 000 jich bylo zajato za proporčně mnohem menších sovětských ztrát.\\nVojska maršála Koněva se v dubnu 1945 účastnila dobytí Berlína. V pražské ofenzívě pak osvobodila severní, střední a východní Čechy a jako první spojenecká armáda se dostala v květnu 1945 do Prahy, ve které už den před tím kapitulovala německá armáda do rukou Karla Kutlvašra. V průběhu maďarského povstání na podzim 1956, během něhož podle údajů Vlada Šurigina ozbrojenci zabili okolo 350 sovětských vojáků a 50 rodinných příslušníků, byl pověřen velením a povstání potlačil."},{"page_url":"https://fr.wikipedia.org/wiki/Cecidomyiidae","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Cecidomyiidae_laying_eggs.jpg","page_title":"Cecidomyiidae","context_page_description":"Les cécidomyies constituent une famille de diptères nématocères. Il s'agit de petits moucherons délicats qui sont caractérisés par de longues antennes et des ailes poilues. À travers le monde, on retrouve plus de 6 000 espèces regroupées en plus de 780 genres. Certaines espèces parasitent des plantes ou des champignons. Les larves se nourrissent des tissus des végétaux, créant des excroissances anormales appelées galles.\\nLes cécidomyies représentent une importante source de nourriture pour les hirondelles et autres oiseaux insectivores, les chauves-souris chassant près des cours d'eau et les araignées vivant sur les berges, sous les ponts et dans les ripisylves, comme Larinioides sclopetarius."},{"page_url":"https://de.wikipedia.org/wiki/Geschichte_von_H%C3%B6chst_am_Main","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/H%C3%B6chst_Stadterweiterungen_1396_1475.jpg","page_title":"Geschichte von Höchst am Main","context_page_description":"Die Stadt Höchst am Main, heute der Frankfurter Stadtteil Höchst, hat eine über zwölfhundertjährige Geschichte. Lange Zeit war Höchst eine eigenständige Stadt und Vorposten des Kurmainzer Gebiets vor den Toren Frankfurts. Erst 1928 erfolgte die Eingemeindung nach Frankfurt."},{"page_url":"https://ro.wikipedia.org/wiki/Peziza_badia","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Peziza_saniosa_BW33_%283%29.jpg","page_title":"Peziza badia","context_page_description":"Peziza badia, sin. Aleuria badia, din încrengătura Ascomycota, în familia Pezizaceae și de genul Peziza este o ciupercă comestibilă saprofită, denumită în popor urechiușă bârligată. urechiușă bârligată. Se găsește în România, Basarabia și Bucovina de Nord, crescând preponderent în grupuri mici, în mod predominant pe soluri nisipoase și argiloase, de-a lungul marginea drumurilor și a spațiilor deschise similare din păduri de conifere sau de stejar în cele mixte precum, nu rar chiar și pe câmpii. Timpul apariției este din mai până la sfârșitul lui noiembrie."},{"page_url":"https://cs.wikipedia.org/wiki/Diabetes_mellitus_2._typu","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/28/Main_symptoms_of_diabetes.png","page_title":"Diabetes mellitus 2. typu","context_page_description":"Diabetes melitus 2. typu, označovaná také jako cukrovka 2. typu, non-inzulin-dependentní diabetes mellitus či cukrovka vznikající v dospělosti, je metabolickou poruchou charakterizovanou zvýšenou hladinou glukózy v krvi při současné rezistenci na inzulin a relativním nedostatku inzulinu. Tím se liší od cukrovky 1. typu, u které v důsledku zániku buněk Langerhansových ostrůvků ve slinivce břišní dochází k absolutnímu nedostatku inzulinu. Klasickými symptomy jsou nadměrná žíznivost, časté močení a chorobný hlad. Cukrovka 2. typu tvoří přibližně 90 % případů diabetu; zbývajících 10 % spadá zejména do kategorií cukrovky 1. typu a těhotenského diabetu. Obezita je považována za primární příčinu diabetu 2. typu u osob, které mají k této chorobě dědičné dispozice.\\nDiabetes 2. typu se zpočátku léčí zvýšenou měrou cvičení a úpravou jídelníčku. Pokud následkem těchto opatření nedojde k adekvátnímu snížení hladiny glukózy v krvi, může lékař předepsat léky jako metformin nebo inzulin. U osob užívajících inzulin je obvykle nutné průběžně sledovat hladinu cukru v krvi.\\nVýskyt diabetu v posledních 50 letech značně vzrostl, a to paralelně s výskytem obezity."},{"page_url":"https://en.wikipedia.org/wiki/Over,_Cheshire","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/St_Chad%27s_Church%2C_Over_2.jpg","page_title":"Over, Cheshire","context_page_description":"Over is a former borough and market town that forms the western part of the town of Winsford in the English county of Cheshire. Wharton forms the eastern part, the boundary being the River Weaver."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9E%D1%80%D0%BB%D0%B0%D0%BD-%D0%B1%D1%96%D0%BB%D0%BE%D1%85%D0%B2%D1%96%D1%81%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/White-tailed_Eagle_Head_detail.jpg","page_title":"Орлан-білохвіст","context_page_description":"Орла́н-білохві́ст — птах ряду Соколоподібних родини Яструбових. Називають його також орел-сіруватень, або сіруватень. Один із найбільших представників хижих птахів Євразії — розмах крил досягає 2,5 м.\\nХарактерною рисою виду є білий хвіст у дорослих особин. Оселяється в прибережних лісах поблизу водойм, багатих рибою. Гнізда влаштовує на високих деревах, подалі від людей. У більшості районів поширення є рідкісним. У середині XX ст. його чисельність драматично скоротилася внаслідок переслідування з боку людини та отруєння птахів отрутохімікатами. Протягом останніх декількох десятиліть чисельність в багатьох країнах частково відновилася. В Україні осілий, кочовий, перелітний птах."},{"page_url":"https://de.wikipedia.org/wiki/Kevin_Hart_(Schauspieler)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Kevin_Hart_2014.jpg","page_title":"Kevin Hart (Schauspieler)","context_page_description":"Kevin Hart ist ein US-amerikanischer Schauspieler und Comedian. Er begann seine Karriere im Jahr 2000, als er mehrere Comedywettbewerbe gewann."},{"page_url":"https://en.wikipedia.org/wiki/SS_Slamat","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3c/HMS_Diamond_%28H22%29.jpg","page_title":"SS Slamat","context_page_description":"SS Slamat was a Dutch ocean liner of the Rotterdam-based Koninklijke Rotterdamsche Lloyd line. Although she was a turbine steamship, she tended not to be referred to as \\"TSS\\". She was built in Vlissingen in the Netherlands in 1924 for liner service between Rotterdam and the Dutch East Indies. In 1940 she was converted into a troop ship. In 1941 she was sunk with great loss of life in the Battle of Greece."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Frankfurt-Nieder-Erlenbach","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Nieder-Erlenbach%2C_Untere_Burggasse_6.JPG","page_title":"Liste der Kulturdenkmäler in Frankfurt-Nieder-Erlenbach","context_page_description":"In der Liste der Kulturdenkmäler in Frankfurt-Nieder-Erlenbach sind alle Kulturdenkmäler im Sinne des Hessischen Denkmalschutzgesetzes in Frankfurt-Nieder-Erlenbach, einem Stadtteil von Frankfurt am Main aufgelistet.\\nGrundlage ist die Denkmaltopographie aus dem Jahre 1994, die zuletzt 2000 durch einen Nachtragsband ergänzt wurde."},{"page_url":"https://es.wikipedia.org/wiki/Fokker_C.V","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Weiss_Manfr%C3%A9d_WM-16_-_%28Fokker_C.VD%29_t%C3%ADpus%C3%BA_rep%C3%BCl%C5%91g%C3%A9p._Fortepan_8607.jpg","page_title":"Fokker C.V","context_page_description":"El Fokker C.V era un biplano de reconocimiento y bombardero ligero diseñado por la compañía Fokker y construido en su fábrica en los Países Bajos y con licencia en Dinamarca, Hungría, Noruega, Suecia y Suiza, además de ser exportado a otros como China, Estados Unidos, Bolivia, Finlandia, Japón y la URSS, siendo algunos utilizado por la Luftwaffe durante la II Guerra Mundial. El C.V fue uno de los aviones militares más conseguidos de los años treinta y se convirtió en un éxito de exportación."},{"page_url":"https://he.wikipedia.org/wiki/%D7%93%D7%99%D7%A0%D7%95%D7%96%D7%90%D7%95%D7%A8%D7%99%D7%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Daspletosaurus_torDB.jpg","page_title":"דינוזאורים","context_page_description":"דינוזאורים הוא השם שניתן לקבוצת מאובנים של יצורים דמויי-זוחלים שנמצאו משלהי המאה ה-18 ועל פי המחקר היו על-סדרה של זוחלים או דמויי-זוחלים שהתקיימו בעידן המזוזואיקון. הדינוזאורים שאינם עופות נכחדו על פי הערכת המדענים כ-66 מיליון שנים לפני זמננו, בסוף תור הקרטיקון, בהכחדת קרטיקון-פלאוגן. קבוצה אחת של דינוזאורים לא נכחדה - העופות - ואלה עדיין חיים כיום במגוון רב של מינים."},{"page_url":"https://en.wikipedia.org/wiki/General_Taboada_Department","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/General_Taboada_%28Provincia_de_Santiago_de_Estero_-_Argentina%29.svg","page_title":"General Taboada Department","context_page_description":"General Taboada Department is a department of Argentina in Santiago del Estero Province. The capital city of the department is situated in Añatuya."},{"page_url":"https://it.wikipedia.org/wiki/Il_Trono_di_Spade_(serie_televisiva)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Ramparts_of_Essaouira.JPG","page_title":"Il Trono di Spade (serie televisiva)","context_page_description":"Il Trono di Spade è una serie televisiva statunitense di genere fantastico creata da David Benioff e D. B. Weiss, trasmessa dal 17 aprile 2011 al 19 maggio 2019 sul canale via cavo HBO per 73 episodi in otto stagioni. È nata come adattamento televisivo del ciclo di romanzi Cronache del ghiaccio e del fuoco di George R. R. Martin.\\nLa serie racconta le avventure di molti personaggi ed è ambientata in un grande mondo immaginario costituito principalmente dal continente Occidentale e da quello Orientale. Il centro più grande e civilizzato del continente Occidentale è la città capitale Approdo del Re, dove si trova il Trono di Spade dei Sette Regni. La lotta per la conquista del trono porta le più potenti e nobili famiglie del continente a scontrarsi o allearsi tra loro in un contorto gioco di potere, che coinvolge anche l'ultima discendente della dinastia regnante deposta. Gli intrighi politici, economici e religiosi dei nobili lasciano la popolazione nella povertà e nel degrado, mentre il mondo viene minacciato dall'arrivo di un inverno diverso dai precedenti, che risveglia creature leggendarie dimenticate e fa emergere forze oscure e magiche."},{"page_url":"https://he.wikipedia.org/wiki/%D7%93%D7%95%D7%93%D7%92%27_%D7%93%D7%90%D7%A8%D7%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/1963_Dodge_Dart_Convertible_%2814565302910%29.jpg","page_title":"דודג' דארט","context_page_description":"דודג' דארט היא מכונית סלון אשר יוצרה על ידי חטיבת דודג' בקונצרן הרכב קרייזלר האמריקאי בין השנים 1959–1976.\\nבין השנים 1982–1989 יוצר דגם ה\\"דודג' דארט\\" במקסיקו.\\nיוצרו 4,322,615 יחידות."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B5%D0%B5%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%BB%D0%BE%D1%81%D1%82%D1%8C_(%D0%9F%D1%81%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/%D0%9B%D0%BE%D0%BA%D0%BD%D1%8F%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD.jpg","page_title":"Алексеевская волость (Псковская область)","context_page_description":"Алексеевская волость — упразднённая административно-территориальная единица 3-го уровня и муниципальное образование со статусом сельского поселения в Локнянском районе Псковской области России.\\nАдминистративный центр — деревня Крестилово."},{"page_url":"https://de.wikipedia.org/wiki/Pedro_Henriquez_de_Acevedo","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Pedro_Henriquez_de_Acevedo.jpg","page_title":"Pedro Henriquez de Acevedo","context_page_description":"Pedro Henriquez de Acevedo y Toledo, Graf von Fuentes war ein spanischer Feldherr und Staatsmann."},{"page_url":"https://de.wikipedia.org/wiki/Pedro_Henriquez_de_Acevedo","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Pedro_Henriquez_de_Acevedo.jpg","page_title":"Pedro Henriquez de Acevedo","context_page_description":"Pedro Henriquez de Acevedo y Toledo, Graf von Fuentes war ein spanischer Feldherr und Staatsmann."},{"page_url":"https://en.wikipedia.org/wiki/List_of_public_art_in_the_Royal_Borough_of_Kensington_and_Chelsea","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Chelsea%2C_Ropers_Garden._Awakening_by_Gilbert_Ledward.jpg","page_title":"List of public art in the Royal Borough of Kensington and Chelsea","context_page_description":"This is a list of public art in the Royal Borough of Kensington and Chelsea."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%9C%E1%83%90%E1%83%9C%E1%83%A1%E1%83%94%E1%83%9C%E1%83%98%E1%83%A1_%E1%83%A1%E1%83%90%E1%83%94%E1%83%A0%E1%83%97%E1%83%90%E1%83%A8%E1%83%9D%E1%83%A0%E1%83%98%E1%83%A1%E1%83%9D_%E1%83%9D%E1%83%A0%E1%83%92%E1%83%90%E1%83%9C%E1%83%98%E1%83%96%E1%83%90%E1%83%AA%E1%83%98%E1%83%90_%E1%83%9A%E1%83%A2%E1%83%9D%E1%83%9A%E1%83%95%E1%83%98%E1%83%9A%E1%83%97%E1%83%90_%E1%83%A1%E1%83%90%E1%83%A5%E1%83%9B%E1%83%94%E1%83%94%E1%83%91%E1%83%A8%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Dupuis-Nansen-Carle-Savio-Quisling.jpg","page_title":"ნანსენის საერთაშორისო ორგანიზაცია ლტოლვილთა საქმეებში","context_page_description":"ნანსენის ლტოლვილთა საერთაშორისო ოფისი — ორგანიზაცია, რომელსაც სახელი ეწოდა ფრიტიოფ ნანსენის პატივსაცემად და დაარსდა 1930 წელს ერთა ლიგის მიერ, მისი გარდაცვალებიდან მალევე. ორგანიზაცია საერთაშორისო დონეზე იყო პასუხისმგებელი, 1930-1939 წლებში საომარი ტერიტორიებიდან ლტოლვილებზე. მათ ენიჭებოდათ ე.წ. ნანსენის პასპორტი, რომელიც მოქალაქეობის არმქონე ადამიანებს საშუალებას აძლევდა ემოგზაურათ ქვეყნებს შორის. ორგანიზაციამ მიიღო ნობელის პრემია 1938 წელს."},{"page_url":"https://en.wikipedia.org/wiki/Joseph_Halfpenny","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Fragmenta_Vetusta_or_The_Remains_of_Ancient_Buildings_in_York%2C_frontispiece_illustration.jpg","page_title":"Joseph Halfpenny","context_page_description":"Joseph Halfpenny was an English draughtsman and engraver."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%93%D1%80%D0%B0%D0%BD%D1%81%D0%B4%D0%BE%D1%80%D1%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Gransdorf_in_BIT.svg","page_title":"Грансдорф","context_page_description":"Грансдорф општина је у њемачкој савезној држави Рајна-Палатинат. Једно је од 235 општинских средишта округа Ајфелкрајс Битбург-Прим. Према процјени из 2010. у општини је живјело 308 становника. Посједује регионалну шифру 7232228."},{"page_url":"https://it.wikipedia.org/wiki/FED_(azienda)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Coll._Marc%C3%A8_CL_-_FED_5_1977-1990.jpg","page_title":"FED (azienda)","context_page_description":"La FED o Dzerzhinsky commune FED o Виробничому Машинобудівному Об'єднанні «ФЕД» fu creata da un originario orfanotrofio intitolato a Feliks Ėdmundovič Dzeržinskij nel comune di Char'kov, allora capitale dell'Ucraina, nel 1932.\\nFu la prima fabbrica di macchine fotografiche 35 mm della URSS, la cui produzione su larga scala iniziò nel 1934 con la copia della Leica II a telemetro. La produzione continuò fino al 1941, quando le forze tedesche distrussero la fabbrica; successivamente la produzione fu ripresa nel 1946. La produzione è continuata fino al 1997 con una produzione complessiva di 8.647.000, oggi la fabbrica produce attrezzature ottiche militari.\\nLa sua produzione delle copie delle Leica, superò per numero quelle originali, talvolta le FED 1 erano marcate Leica contraffacendo le originali."},{"page_url":"https://pt.wikipedia.org/wiki/Bruce_Johnston","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Bruce_Johnston_2006_Birmingham.jpg","page_title":"Bruce Johnston","context_page_description":"Bruce Arthur Johnston é um membro da banda de rock americana The Beach Boys e compositor premiado com um Grammy pela música \\"I Write the Songs\\".\\nBruce não era um dos membros originais do The Beach Boys. Ele se juntou à banda em 9 de abril de 1965 depois da saída Glen Campbell."},{"page_url":"https://fr.wikipedia.org/wiki/Nam_chim","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Nam_Chim_Paesa_-_Thai_dip.jpg","page_title":"Nam chim","context_page_description":"Nam chim ou nam jim est le mot thaï désignant une sauce de type dip. Il désigne un grand nombre de sauces dans la cuisine thaïlandaise, parmi lesquelles nombreuses sont celles qui sont une combinaison de goûts salés, sucrés, épicés et aigres.\\nNam chim est souvent utilisé pour des sauces plus liquides que les nam phrik. Si la sauce sriracha est souvent appelée sot sriracha en Thaïlande, elle est parfois appelée nam chim siracha ou nam phrik siracha.\\nUne des sauces les plus communes et basiques du genre nam chim est celle utilisée lors de la dégustation de fruits de mer grillés ou cuits à la vapeur. Les ingrédients principaux de cette sauce sont l'ail, le fumet de poisson, le sucre, le jus de citron vert et le piment thaï. Des variantes de cette sauce sont utilisées comme sauce dip, mais aussi comme ingrédients pour beaucoup de plats. La plupart des ingrédients d'une sauce nam chim sont émincés finement ou broyés au pilon ou, de façon moins traditionnelle, passés au mixeur.\\nParmi les type de sauce nam chim les plus connues, on peut citer :"},{"page_url":"https://fi.wikipedia.org/wiki/Wiesin_pyhiinvaelluskirkko","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Wieskirche_boenisch_okt_2003.jpg","page_title":"Wiesin pyhiinvaelluskirkko","context_page_description":"Wiesin pyhiinvaelluskirkko Saksassa on soikeanmuotoinen rokokookirkko, jonka on suunnitellut 1740-luvulla arkkitehti Dominikus Zimmermann. Kirkko sijaitsee Steingadenin kunnassa, Baijerissa, aivan Alppien juurella. Kirkon suunnittelija Zimmermann vietti viimeiset 11 vuotta elämästään läheisessä asumuksessa.\\nVuonna 1738 puisen vapahtajapatsaan tulkittiin kyynelehtivän. Tätä pidettiin ihmeenä, minkä seurauksena patsaasta tuli pyhiinvaelluskohde. Vuonna 1740 rakennettiin pieni kappeli patsasta suojaamaan. Pian kuitenkin huomattiin, että rakennus oli aivan liian pieni pyhiinvaeltajille, joten Steingadenin luostari päätti määrätä rakennettavaksi erillisen pyhäkön.\\nKirkko rakennettiin vuosien 1745 ja 1754 välisenä aikana. Kirkko siirrettiin maalliseen omistukseen 1800-luvun alussa. Paikallisten maanviljelijöiden protestit pelastivat rakennuksen myymiseltä ja purkamiselta.\\nVuonna 1983 Wiesin pyhiinvaelluskirkko otettiin Unescon maailmanperintöluetteloon."},{"page_url":"https://te.wikipedia.org/wiki/%E0%B0%85%E0%B0%A8%E0%B1%81%E0%B0%B0%E0%B0%BE%E0%B0%A7_%E0%B0%B6%E0%B1%8D%E0%B0%B0%E0%B1%80%E0%B0%B0%E0%B0%BE%E0%B0%AE%E0%B1%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Anuradha_Sriram.jpg","page_title":"అనురాధ శ్రీరామ్","context_page_description":"అనురాధ శ్రీరామ్ సినీ నేపథ్యగాయని. కర్నాటక, హిందుస్థానీ శాస్త్రీయ సంగీతంలో ప్రవేశం ఉన్న అనురాధ తెలుగు, తమిళం, కన్నడ, హిందీ వంటి అనేక దేశీయ భాషల్లో అనేక పాటలకు స్వరం అందించింది. ఈమె తల్లి రేణుక దేవి కూడా నేపథ్యగాయని."},{"page_url":"https://fr.wikipedia.org/wiki/Alfie_Biggs","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Alfie_Biggs.jpg","page_title":"Alfie Biggs","context_page_description":"Alfred George Biggs, plus connu sous le nom d'Alfie Biggs, est un joueur de football anglais qui évoluait au poste d'attaquant."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Fairfield_County,_South_Carolina","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Fire_Station_%26_Municipal_Offices%2C_Congress_%26_Washington_Streets%2C_Winnsboro%2C_Fairfield_County_%28South_Carolina%29.jpg","page_title":"National Register of Historic Places listings in Fairfield County, South Carolina","context_page_description":"This is a list of the National Register of Historic Places listings in Fairfield County, South Carolina.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in Fairfield County, South Carolina, United States. The locations of National Register properties and districts for which the latitude and longitude coordinates are included below, may be seen in a map.\\nThere are 43 properties and districts listed on the National Register in the county. Another 2 properties were once listed but have been removed.\\nThis National Park Service list is complete through NPS recent listings posted September 27, 2019."},{"page_url":"https://ro.wikipedia.org/wiki/List%C4%83_de_localit%C4%83%C8%9Bi_din_jude%C8%9Bul_Cluj","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Petre%C8%99tii_de_Mijloc%2C_Cluj-%284%29.jpg","page_title":"Listă de localități din județul Cluj","context_page_description":"Lista de mai jos cuprinde toate localitățile din județ în ordine alfabetică.\\nAceastă listă este generată cu date din Wikidata și este actualizată periodic de un robot.\\nEditările făcute în listă vor fi șterse la următoarea actualizare!\\nSfârșitul listei autogenerate."},{"page_url":"https://simple.wikipedia.org/wiki/Mai-Ndombe_Province","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Maindombe1.JPG","page_title":"Mai-Ndombe Province","context_page_description":"Mai-Ndombe Province is one of 26 provinces of the Democratic Republic of the Congo. Its capital is Inongo."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Heiligenstedten","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Heiligenstedten_Klappbr%C3%BCcke_August-2010_SL275167.JPG","page_title":"Liste der Kulturdenkmale in Heiligenstedten","context_page_description":"In der Liste der Kulturdenkmale in Heiligenstedten sind alle Kulturdenkmale der schleswig-holsteinischen Gemeinde Heiligenstedten aufgelistet."},{"page_url":"https://sr.wikipedia.org/wiki/Venter_caret_auribus","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Plutarch.gif","page_title":"Venter caret auribus","context_page_description":"Venter caret auribus лат. Трбух нема ушију."},{"page_url":"https://it.wikipedia.org/wiki/Chrysolophus_amherstiae","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Chrysolophus_amherstiae_3.jpg","page_title":"Chrysolophus amherstiae","context_page_description":"Il fagiano di Lady Amherst è un uccello della famiglia dei Fasianidi. Il suo nome è un omaggio alla contessa Sarah Amherst, moglie di William Pitt Amherst, governatore generale delle Indie, che ne inviò i primi esemplari a Londra nel 1828.\\nLa specie è originaria della Cina sud-occidentale e della Birmania, ma è stata introdotta in altri paesi. Ne esiste in particolare una piccola popolazione in Inghilterra, nel Bedfordshire."},{"page_url":"https://it.wikipedia.org/wiki/Ispica","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Chiesa_madonna_del_carmelo.jpg","page_title":"Ispica","context_page_description":"Ispica è un comune italiano di 16 323 abitanti del libero consorzio comunale di Ragusa in Sicilia.\\nÈ il settimo comune più popoloso del libero consorzio comunale ed è situato sulla costa sud-orientale dell'isola e confina a nord-ovest con il territorio del comune di Modica, a ovest con Pozzallo, a sud-est con il territorio di Pachino e ad est con il territorio di Rosolini e Noto."},{"page_url":"https://fr.wikipedia.org/wiki/Hanami","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/UenoParkHanami.jpg","page_title":"Hanami","context_page_description":"Le hanami, ou o-hanami avec préfixe honorifique, est la coutume traditionnelle japonaise d'apprécier la beauté des fleurs, principalement les fleurs de cerisier, lorsque, à partir de fin mars ou début avril, elles entrent en pleine floraison.\\nDe nos jours, le hanami peut quelquefois aussi se résumer à profiter de cette saison pour pique-niquer, discuter, chanter sous les cerisiers en fleur. Cette coutume est au printemps ce que momijigari, l'observation de kōyō, est à l'automne.\\nIl existe aussi une forme de hanami concernant l'abricotier du Japon, précédant celui des cerisiers du Japon, ainsi que du pêcher, succédant aux cerisiers. Si les cerisiers du Japon sont plus populaires pour les hanami, particulièrement chez les jeunes, les personnes plus âgées préfèrent l'atmosphère des hanami de l'ume."},{"page_url":"https://en.wikipedia.org/wiki/Centuria,_Wisconsin","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Polk_County_Wisconsin_Incorporated_and_Unincorporated_areas_Centuria_Highlighted.svg","page_title":"Centuria, Wisconsin","context_page_description":"Centuria is a village in Polk County, Wisconsin, United States. The population was 948 at the 2010 census."},{"page_url":"https://en.wikipedia.org/wiki/List_of_songs_recorded_by_Nickelback","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Flo_Rida2012.jpg","page_title":"List of songs recorded by Nickelback","context_page_description":"Nickelback is a Canadian hard rock band from Hanna, Alberta. The band was founded in 1995 by vocalist and guitarist Chad Kroeger, guitarist and vocalist Ryan Peake, bassist Mike Kroeger and drummer Brandon Kroeger. After the release of their debut extended play Hesher, the group released its debut full-length album Curb in 1996, which featured songwriting credits for all four band members as well as producer Jeff Boyd. The State followed in 1998, once again written by all four members of the band. After Brandon Kroeger left the band and was replaced by Ryan Vikedal, Nickelback signed with Roadrunner Records and released their third album Silver Side Up in 2001, supported by lead single \\"How You Remind Me\\". The Long Road followed in 2003, again credited to all four band members equally.\\nVikedal left the band in early 2005 to be replaced by 3 Doors Down drummer Daniel Adair. All the Right Reasons, the band's first album with Adair, was released in 2005."},{"page_url":"https://de.wikipedia.org/wiki/Walzzeichen","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Rail_TSTG_08_30E1.jpg","page_title":"Walzzeichen","context_page_description":"Mit Walzzeichen bezeichnet man die Kennzeichnung eines aus Metall gewalzten Trägers oder einer Schiene. Die Kennzeichnung wird als Negativform in das Fertigkaliber der Walze graviert und ergibt auf dem Produkt eine erhabene Schrift oder erhabene Zeichen, deren Art und Größe zum Beispiel für Vignolschienen in der europäischen Norm EN 13674-1 festgelegt ist. Aus dem üblichen Umfang der Walzen ergibt sich ein Abstand der Walzzeichen bei Trägern und Schienen von rd. 2–3 m zueinander.\\nEin Walzzeichen kann enthalten:\\ndas Logo des Herstellers\\nden Namen des Herstellers\\nden Herstellungsort\\ndas Produktionsjahr\\nein Kennzeichen für die Produktqualität\\nein Kennzeichen für das Herstellungsverfahren"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%94%D0%B6%D1%96%D0%B3%D0%BC%D0%B5_%D0%A2%D1%96%D0%BD%D0%BB%D0%B5%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/SR_wang_with_PM.jpg","page_title":"Джігме Тінлей","context_page_description":"Джігме Йозер Тінлей — політик, прем'єр-міністр Бутану з 20 липня 1998 року до 9 липня 1999 року, з 30 серпня 2003 року до 20 серпня 2004 року і з 9 квітня 2008 року."},{"page_url":"https://ms.wikipedia.org/wiki/Senarai_pasta","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Corzetti.jpg","page_title":"Senarai pasta","context_page_description":"Terdapat pelbagai jenis pasta, hidangan ruji masakan Itali.\\nSesetengah jenis pasta adalah unik serantau dan tidak meluas diketahui; beberapa jenis mungkin mempunyai nama yang berbeza dalam pelbagai bahasa, atau kadang-kadang dalam bahasa yang sama. Sebagai contoh, potongan rotelle juga dikenali sebagai ruote di Itali dan \\"roda wagon\\" di Amerika Syarikat. Pengeluar dan tukang masak sering mengada-adakan bentuk baru pasta; atau mungkin mencipta nama baru bagi bentuk lama atas sebab-sebab pemasaran.\\nNama bahasa Itali bagi pasta sering berakhir dengan akhiran jamak maskulin -ini, -elli, -illi, -etti atau jamak feminin -ine, -elle dan lain-lain, semua menyampaikan maksud \\"kecil\\"; atau dengan -oni, -one, yang bermaksud \\"besar\\". Banyak akhiran lain seperti -otti dan -acci boleh wujud. Di Itali, semua nama-nama jenis pasta adalah majmuk."},{"page_url":"https://az.wikipedia.org/wiki/%C4%B0stanbul_m%C3%BCqavil%C9%99si_(1547)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Hans_Bocksberger_%28I%29_-_Emperor_Ferdinand_I_-_WGA02326.jpg","page_title":"İstanbul müqaviləsi (1547)","context_page_description":"İstanbul müqaviləsi və ya Ədirnə müqaviləsi — Avstriya hersoqluğu ilə Osmanlı İmperiyası arasında 19 iyun 1547-ci ildə İstanbulda imzalanan və Müqəddəs Roma imperiyasının da daxil edildiyi müqavilə.\\nTərəflər arasında yaşanan müxtəlif toqquşmalar sonrası, 1545-ci ilin noyabrında, 18 aylıq müddəti olan bir sülh müqaviləsi imzalandı. Bu müqavilənin zamanı tamam olduqdan sonra, Osmanlı İmperiyasının paytaxtı İstanbula göndərilən Müqəddəs Roma imperiyası elçisinin də araya girməsi və Avstriya hersoqluğu ilə, Müqəddəs Roma imperiyasınında daxil edildiyi daha beş illik keçərli olacağı bildirilən bir müqavilə daha imzalandı.\\nİki dövlət arasında ilk yazılı müqavilə sayılan bu sənəd ilə birlikdə Avstriya hersoqu I Ferdinand ilə Müqəddəs Roma imperatoru V Karl, Osmanlı İmperiyasının Macarıstan üzərindəki hakimiyyətini tanıdı ve Habsburqların əlində olan Macarıstan torpaqları üçün Osmanlı İmperiyasına illik 30.000 dukat vergi verməyi qəbul etdi. Bundan başqa müqaviləyə görə iki tərəf də bir-birinə hücum etməyəcəkdi. Ancaq 1551-ci ildə Avstriya hersoqluğunun, Osmanlı İmperiyasına bağlı Transilvaniyaya hücum etməsi nəticəsində müqavilə pozuldu."},{"page_url":"https://eu.wikipedia.org/wiki/Newquay","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Newquayhill.jpg","page_title":"Newquay","context_page_description":"Newquay Ingalaterrako Kornualles eskualde edo konderrian dagoen kostaldeko udalerri bat da. Turismogune garrantzitsua eta arrantza portua ere bada."},{"page_url":"https://en.wikipedia.org/wiki/Las_Mar%C3%ADas_(Santurce)","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cc/Las_Mar%C3%ADas_%28sub-barrio%29.png","page_title":"Las Marías (Santurce)","context_page_description":"Las Marías also known as Puntas las Marías is one of the forty subbarrios of Santurce, San Juan, Puerto Rico."},{"page_url":"https://en.wikipedia.org/wiki/Women_in_the_House_of_Commons_of_the_United_Kingdom","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Official_portrait_of_Dr_Th%C3%A9r%C3%A8se_Coffey_crop_2.jpg","page_title":"Women in the House of Commons of the United Kingdom","context_page_description":"The representation of Women in the House of Commons of the United Kingdom has been an issue in the politics of the United Kingdom at numerous points in the 20th and 21st centuries. Originally debate centred on whether women should be allowed to vote and stand for election as Members of Parliament. The Parliament Act 1918 gave women over 21 the right to stand for election as a Member of Parliament. The United Kingdom has had two female Prime Ministers: Margaret Thatcher and Theresa May. The publication of the book Women in the House by Elizabeth Vallance in 1979 highlighted the under-representation of women in Parliament. In more modern times concerns about the under-representation of women led the Labour Party to introduce all-women short lists, something which was later held to breach discrimination laws.\\nBetween 1918 and 2019, a total of 552 women have been elected as Members of the House of Commons. As of June 2020 there are 220 women in the House of Commons, the highest ever. This is a new all-time high at 34% and is the first time that female representation in the House of Commons is at more than a third."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D0%B8%D0%BD%D0%B8%D1%8F_%D0%A4%D1%83%D0%BB%D1%82%D0%BE%D0%BD-%D1%81%D1%82%D1%80%D0%B8%D1%82,_%D0%91%D0%B8-%D1%8D%D0%BC-%D1%82%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Lefferts_Blvd_vc.jpg","page_title":"Линия Фултон-стрит, Би-эм-ти","context_page_description":"Линия Фултон-стрит, Би-эм-ти — бывшая линия Нью-Йоркского метро, эксплуатировавшаяся «Транспортной компанией Бруклина и Манхэттена» и с 1940 по 1956 год входившая в состав Дивизиона B. Обслуживала районы Куинс и Бруклин. Линия шла над Фултон-стрит, от станции Фултон-Ферри в одноимённом округе Центрального Бруклина на восток, в округ Ист Нью-Йорк, затем поворачивала на юг и шла над Ван Синдерен-авеню и Снедикер-авеню, затем линия опять поворачивала на восток и шла над Питкин-авеню, поворачивала на север и шла над Юклид-авеню и, наконец, в последний раз поворачивала на восток и шла над Либерти-авеню до своей восточной конечной станции Леффертс-авеню — 111-я улица в округе Озон-парк в Куинсе.\\nВся линия, проходившая через Бруклин, была закрыта и снесена, но часть линии в Куинсе была переподключена к Нью-Йоркскому метро, и сейчас она является частью подземной линии Фултон-стрит, которая заменила старую эстакадную линию в Бруклине. Эстакадная линия Фултон-стрит была главной линией Эстакадной железной дороги Кингс-Каунти, первая часть которой открылась в 1888 году."},{"page_url":"https://fr.wikipedia.org/wiki/Ruiselede","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Onze-Lieve-Vlouv-ten-Hemelopnemingskerk%2C_Ruiselede_%28DSCF0084%29.jpg","page_title":"Ruiselede","context_page_description":"Ruiselede, en français désuet Ruysselède est commune néerlandophone de Belgique située en Région flamande dans la province de Flandre-Occidentale."},{"page_url":"https://de.wikipedia.org/wiki/Emder_Hafen","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fd/FreighterSeaLocksEmden.JPG","page_title":"Emder Hafen","context_page_description":"Der Hafen der Stadt Emden ist ein Seehafen an der Mündung der Ems in die Nordsee. Es handelt sich dabei um den westlichsten Seehafen an der Küste Deutschlands; er erreichte im Jahr 2011 einen Jahresumschlag von rund 6,29 Millionen Tonnen. Hauptumschlagprodukte sind Kraftfahrzeuge, Forstprodukte und Windenergieanlagen. Bei Kraftfahrzeugen ist der Emder Hafen nach Umschlagzahlen der drittgrößte Europas nach Zeebrugge und Bremerhaven und vor Antwerpen.\\nIm Jahr 2019 betrug der Seegüterumschlag 4,4 Mio. Tonnen. Betreiber des Emder Hafens ist Niedersachsen Ports.\\nZudem ist Emden wichtiger Fährhafen zur Nordseeinsel Borkum. Der Hafen ist an das Eisenbahnnetz mit dem Bahnhof Emden Außenhafen indirekt über den Hauptbahnhof Emden angebunden."},{"page_url":"https://fr.wikipedia.org/wiki/Toxic_(chanson)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Britney_Spears_%27Piece_of_Me%27_-_Las_Vegas_IMG_6729_%2827479811076%29.jpg","page_title":"Toxic (chanson)","context_page_description":"Toxic est une chanson de l'artiste chanteuse américaine pop Britney Spears, coécrite et produite par Bloodshy & Avant et extraite du quatrième album de la chanteuse, In the Zone. La chanson est sortie le 12 janvier 2004, sous Jive Records en tant que deuxième single de l'album. Alors que les titres Boom Boom et Outrageous étaient pressentis l'un ou l'autre pour devenir le deuxième single de In the Zone, Britney Spears choisit finalement Toxic. Une chanson dance-pop aux influences electropop, bénéficiant d'une instrumentation variée. Les paroles du titre se réfèrent au fait d'être accro à un amant.\\nToxic rencontre le succès dans le monde entier, atteignant le top 5 de quinze pays dont la France en se hissant jusqu’à la 3ᵉ place. Il se classe au sommet des charts en Australie, au Canada, en Hongrie, Norvège et au Royaume-Uni. Aux États-Unis, le titre devient le quatrième top 10 de Spears. Le vidéoclip de la chanson met en scène Spears en agent secret à la recherche d'un flacon de liquide vert. Après l'avoir dérobé, elle pénètre dans un appartement et empoisonne son petit ami infidèle. La vidéo comprend également des scènes entrecoupées de Spears nue, le corps recouvert de diamants."},{"page_url":"https://en.wikipedia.org/wiki/Elise_Ippolito","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Still_life_-_Holding_and_Beholding.png","page_title":"Elise Ippolito","context_page_description":"Elise Ippolito is an American artist based in Tampa, Florida. She has been featured in numerous media outlets for her works, including portrait and oil paintings.\\nIppolito attended Duke University and went on to attend Fredric G. Levin College of Law at the University of Florida where she obtained her Juris Doctor. She practiced law in the Tampa area for approximately 2 years prior to pursuing her career in art, a passion that she took classes for in both high school and college. Ippolito began her art career through word of mouth, creating portrait paintings modeled after photographs that she took of clients. Her work grabbed the attention of the art community in 2005 when she was commissioned to paint a portrait for the Glazer Children’s Museum. After the portrait was created, Ippolito saw an increase in commissions for her paintings.\\nIppolito was commissioned by South Tampa Magazine to create a portrait of JoAnna Garcia, best known as the daughter of Reba McEntire on the show Reba. The portrait was featured for the magazine's lead article in February 2006."},{"page_url":"https://sv.wikipedia.org/wiki/Coelosphaeridae","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/12/Bright_orange_forcepia.jpg","page_title":"Coelosphaeridae","context_page_description":"Coelosphaeridae är en familj av svampdjur. Coelosphaeridae ingår i ordningen Poecilosclerida, klassen horn- och kiselsvampar, fylumet svampdjur och riket djur. Enligt Catalogue of Life omfattar familjen Coelosphaeridae 194 arter.\\nKladogram enligt Catalogue of Life och Dyntaxa:"},{"page_url":"https://hu.wikipedia.org/wiki/G%C3%B6ttingeni_hetek","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/20/Denkmal_Goettinger_Sieben.jpg","page_title":"Göttingeni hetek","context_page_description":"A göttingeni hetek néven ismert a göttingeni professzorok egy csoportja, akik 1837-ben protestáltak a Hannoveri Királyság alkotmányának érvénytelenítése ellen, ezért elbocsátották őket; többüket az országból is kiutasították."},{"page_url":"https://nl.wikipedia.org/wiki/Tototlmimus","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Saltillomimus_rapidus.jpg","page_title":"Tototlmimus","context_page_description":"Tototlmimus packardensis is een theropode dinosauriër, behorend tot de Maniraptoriformes, die tijdens het late Krijt leefde in het gebied van het huidige Mexico."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Dessau-Ro%C3%9Flau","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Dessau-Ro%C3%9Flau%2CAskanische_Stra%C3%9Fe_107%2CDruckerei_Volksblatt.JPG","page_title":"Liste der Kulturdenkmale in Dessau-Roßlau","context_page_description":"In der Liste der Kulturdenkmale in Dessau-Roßlau sind alle Kulturdenkmale der kreisfreien Stadt Dessau-Roßlau und ihrer Ortsteile aufgelistet. Grundlage ist das Denkmalverzeichnis des Landes Sachsen-Anhalt, das auf Basis des Denkmalschutzgesetzes vom 21. Oktober 1991 durch das Landesamt für Denkmalpflege und Archäologie Sachsen-Anhalt erstellt und seither laufend ergänzt wurde."},{"page_url":"https://en.wikipedia.org/wiki/6th_Battalion,_Royal_Warwickshire_Regiment","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Guarding_against_possible_enemy_air_attacks%2C_British_troops_are_training_African_natives_in_anti-aircraft_units._The..._-_NARA_-_196192.jpg","page_title":"6th Battalion, Royal Warwickshire Regiment","context_page_description":"The 6th Battalion, Royal Warwickshire Regiment was a unit of Britain's Territorial Army from 1908 until 1961. Recruited from Birmingham, it served as infantry in some of the bloodiest fighting on the Western Front and in Italy during World War I. Converted to an Anti-Aircraft role, it defended the West Midlands during The Blitz in the early part of World War II, and then joined Eighth Army in North Africa, including service in the famous Siege of Tobruk and in the Italian Campaign. It served on in the air defence role in the postwar TA until 1961."},{"page_url":"https://it.wikipedia.org/wiki/Invasioni_barbariche_del_III_secolo","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/ELAGABALUS-RIC_IV_122-816774_MARS_219.jpg","page_title":"Invasioni barbariche del III secolo","context_page_description":"Le invasioni barbariche del III secolo costituirono un periodo ininterrotto di scorrerie all'interno dei confini dell'impero romano, condotte per fini di saccheggio e bottino da genti armate appartenenti alle popolazioni che gravitavano lungo le frontiere settentrionali: Pitti, Caledoni e Sassoni in Britannia; le tribù germaniche di Frisi, Sassoni, Franchi, Alemanni, Burgundi, Marcomanni, Quadi, Lugi, Vandali, Iutungi, Gepidi e Goti, le tribù daciche dei Carpi e quelle sarmatiche di Iazigi, Roxolani ed Alani, oltre a Bastarni, Sciti, Borani ed Eruli lungo i fiumi Reno-Danubio ed il Mar Nero.\\nEra dai tempi di Marco Aurelio durante le Guerre marcomanniche che le tribù germanico-sarmatiche non esercitavano una pressione così forte lungo i confini settentrionali dell'Impero romano.\\nLa crescente pericolosità per l'Impero romano di Germani e Sarmati era dovuta principalmente ad un cambiamento rispetto ai secoli precedenti nella struttura tribale della loro società: la popolazione, in costante crescita e sospinta dai popoli orientali, necessitava di nuovi territori per espandersi, pena l'estinzione delle tribù più deboli."},{"page_url":"https://tt.wikipedia.org/wiki/%D0%A1%D0%BA%D0%B5%D0%BB%D0%B5%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Meyer1_Skelet.jpg","page_title":"Скелет","context_page_description":"Скелет, сөлтәр — тере организмнарның терәк системасын үтәүче биологик система; кеше һәм җәнлекләр тәненең тотынып торуын тәэмин иткән сөякләр берекмәсе; организмда терәк һәм механик зарарланулардан саклау функциясен үти торган каты тукымалар.\\nCoronacollina acula дип йөртелгән болыт сыман сөлтәре булган иң тәүге организмнар 550-560 миллион еллар элек Австралиянең көньяк ярларында яшәгән. Борынгы сөлтәр әзерләү ысулы — кояшта яки эссе комда киптерү."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Ministers_of_Foreign_Affairs_of_Venezuela","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b1/Santos_Michelena_1.jpg","page_title":"List of Ministers of Foreign Affairs of Venezuela","context_page_description":"The following is a list of Ministers of Foreign Affairs of Venezuela since 1830, when Venezuela achieved independence after the dissolution of Gran Colombia. The founding minister was Diego Bautista Urbaneja, who held multiple terms. The current minister is Jorge Arreaza, who assumed office on August 2, 2017."},{"page_url":"https://es.wikipedia.org/wiki/Elecciones_parlamentarias_de_Grecia_de_noviembre_de_1989","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/NDsign_1.png","page_title":"Elecciones parlamentarias de Grecia de noviembre de 1989","context_page_description":"Elecciones parlamentarias anticipadas se celebraron en Grecia el 5 de noviembre de 1989.​ El partido conservador Nueva Democracia de Konstantinos Mitsotakis continuó como el partido más grande en el Consejo de los Helenos, derrotando al Movimiento Socialista Panhelénico de Andreas Papandréu. Sin embargo, al igual que tras las elecciones anteriores, Mitsotakis no pudo formar gobierno al no contar con mayoría absoluta y en consecuencia unas nuevas elecciones parlamentarias debieron convocarse para abril de 1990."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A8%D8%AE%D8%B4_%D8%AE%D9%88%D8%B1%D8%AF%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/OrissaKhordha.png","page_title":"بخش خوردا","context_page_description":"بخش خوردا یک بخش در هند است که در اودیسا واقع شده‌است. بخش خوردا ۲٬۸۸۷٫۵ کیلومتر مربع مساحت و ۲٬۲۵۱٬۶۷۳ نفر جمعیت دارد."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%95%E0%A5%89%E0%A4%AB%E0%A4%BC%E0%A4%AE%E0%A5%88%E0%A4%A8_%E0%A4%B8%E0%A5%8D%E0%A4%9F%E0%A5%87%E0%A4%A1%E0%A4%BF%E0%A4%AF%E0%A4%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/NewKauffman.jpg","page_title":"कॉफ़मैन स्टेडियम","context_page_description":"कॉफ़मैन स्टेडियम, कैनसस सिटी शहर, संयुक्त राज्य अमेरिका में स्थित एक बेसबॉल स्टेडियम है। यह कैनसस सिटी रॉयल्स का घरेलू मैदान है।"},{"page_url":"https://sv.wikipedia.org/wiki/Dierama_reynoldsii","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Dierama_reynoldsii_%289389382729%29.jpg","page_title":"Dierama reynoldsii","context_page_description":"Dierama reynoldsii är en irisväxtart som beskrevs av Frans Verdoorn. Dierama reynoldsii ingår i släktet Dierama och familjen irisväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://fr.wikipedia.org/wiki/Urotheca_fulviceps","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Urotheca_fulviceps.jpg","page_title":"Urotheca fulviceps","context_page_description":"Urotheca fulviceps est une espèce de serpents de la famille des Dipsadidae."},{"page_url":"https://ca.wikipedia.org/wiki/Estadi_Balear","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Estadi.balear.JPG","page_title":"Estadi Balear","context_page_description":"L'Estadi Balear és un camp de futbol de la ciutat de Mallorca. És el terreny de joc on disputa els partits oficials del Club Esportiu Atlètic Balears d'ençà que fou reinaugurat el setembre de 2019. Fou inaugurat el 1960 però el 2013 fou clausurat per motius de seguretat atesos els problemes estructurals."},{"page_url":"https://ast.wikipedia.org/wiki/Cage_the_Elephant","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Cage_the_elephant.jpg","page_title":"Cage the Elephant","context_page_description":"Cage the Elephant ye un grupu estauxunidense d'indie rock y rock alternativu, formáu a mediaos del 2006 en Bowling Green, Kentucky. El quintetu caracterízase por cuenta de la so gran enerxía al tocar en vivu, sobremanera per parte del cantante Matt Shultz."},{"page_url":"https://lt.wikipedia.org/wiki/Eurovizijos_dain%C5%B3_konkursas_2013","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/ESC2013_-_Hungary_02.jpg","page_title":"Eurovizijos dainų konkursas 2013","context_page_description":"Eurovizijos dainų konkursas 2013 – 58-tasis Eurovizijos dainų konkursas, kuris vyko Malmės miesto arenoje, Švedijoje. Tai buvo penktas kartas kai šalis rengė konkursą, paskutinį kartą konkursas Švedijoje vyko 2000 m. Švedija teisę rengti Eurovizijos dainų konkursą iškovojo po Loreen pergalės su daina „Euphoria“ 2012 m. Eurovizijoje.\\nPusfinaliai vyko 2013 m. gegužės 14 d. ir gegužės 16 d., o finalas – gegužės 18 d. Konkursą vedė Petra Mede. Eurovizijos dainų konkurse viso dalyvavo 39 šalys. Nugalėtoja tapo Danijos atstovė Emmelie de Forest su daina „Only Teardrops“, surinkusia 281 tašką.\\nPirmąkart po 20-ties metų nei viena iš buvusių Jugoslavijos Federacijos šalių nepateko į finalą."},{"page_url":"https://en.wikipedia.org/wiki/Nivia_Sports","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Nivia_Ashtang_Football.jpg","page_title":"Nivia Sports","context_page_description":"Nivia Sports is an Indian sports equipment manufacturing company based in Jalandhar, Punjab, India, under the banner of FreeWill Sports Pvt Ltd. The firm mainly produces balls, but also provides other equipment such as team uniforms, footwear and accessories for football, basketball, and volleyball. It has partnered with many national sports events in India.\\nThe name \\"Nivia\\" was derived from the combination of the initials of the name of Nihal Chand Kharbanda, founder of Nivia Sports, and Vijay Kharbanda: \\"NI\\" from \\"Nihal\\" and \\"VI\\" from \\"Vijay\\"."},{"page_url":"https://en.wikipedia.org/wiki/Barystethus","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Curculionidae_-_Barystethus_tropicus.JPG","page_title":"Barystethus","context_page_description":"Barystethus is a genus of the true weevil family."},{"page_url":"https://de.wikipedia.org/wiki/Stephaniebraten","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Stefaniebraten_01.jpg","page_title":"Stephaniebraten","context_page_description":"Der Stephaniebraten, auch Stefaniebraten, ist ein Klassiker der Wiener Küche. Es handelt sich um einen verfeinerten Faschierten Braten mit Eiern und kleinen Essiggurken, fakultativ auch mit Frankfurtern."},{"page_url":"https://de.wikipedia.org/wiki/Julius_D%C3%B6rfel","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Haus-Mahlerstra%C3%9Fe_14-01.jpg","page_title":"Julius Dörfel","context_page_description":"Julius Dörfel war ein österreichischer Architekt."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A0%D0%B8%D0%BC%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D1%82%D0%B5%D0%B0%D1%82%D1%80_(%D0%9C%D0%B5%D1%80%D0%B8%D0%B4%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/M%C3%A9rida_-_Teatro_-_01.jpg","page_title":"Римський театр (Мерида)","context_page_description":"Римський театр (Мерида) або Давньоримський театр в місті Мерида — залишки давньоримського театра в місті Мерида, у великому за площею археологічному пам'ятнику пізньої античності в сучасній Іспанії."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9E%D0%BB%D1%81%D1%83%D1%84%D1%8C%D0%B5%D0%B2,_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_%D0%94%D0%BC%D0%B8%D1%82%D1%80%D0%B8%D0%B5%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Pavel_Olsufjev.jpg","page_title":"Олсуфьев, Александр Дмитриевич","context_page_description":"Александр Дмитриевич Олсуфьев — участник войны 1812 года, камергер, почётный опекун. Старший брат В. Д. Олсуфьева, родоначальника графской ветви Олсуфьевых."},{"page_url":"https://hu.wikipedia.org/wiki/%C4%8Cernv%C3%ADr","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/%C4%8Cernv%C3%ADr_vlajka.jpg","page_title":"Černvír","context_page_description":"Černvír település Csehországban, a Brno-vidéki járásban. Černvír Nedvědice, Skorotice, Sejřek és Doubravník településekkel határos. Lakosainak száma 149 fő."},{"page_url":"https://vi.wikipedia.org/wiki/Cyclospermum","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Starr_080602-5532_Ciclospermum_leptophyllum.jpg","page_title":"Cyclospermum","context_page_description":"Ciclospermum là chi thực vật có hoa trong họ Apiaceae."},{"page_url":"https://sv.wikipedia.org/wiki/Bocchoris","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Bocchoris_inspersalis_at_Kadavoor.jpg","page_title":"Bocchoris","context_page_description":"Bocchoris är ett släkte av fjärilar. Bocchoris ingår i familjen Crambidae."},{"page_url":"https://en.wikipedia.org/wiki/Public_Works_Department_(Western_Australia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/C_Y_O%27Connor.jpg","page_title":"Public Works Department (Western Australia)","context_page_description":"The Public Works Department was the State Government Agency of Western Australia, which was charged with providing and maintaining public infrastructure such as dams, water supplies, schools, hospitals, harbours and other public buildings. The Department is no longer operational, having its responsibilities reassigned to other State Government Departments and corporate entities since 1985."},{"page_url":"https://uk.wikipedia.org/wiki/XVII_%D1%81%D1%82%D0%BE%D0%BB%D1%96%D1%82%D1%82%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Chateau_de_Belleroy_Boudan_1715.jpg","page_title":"XVII століття","context_page_description":"XVII століття припадає на епоху Нової історії. Тільки наприкінці XVII століття західна цивілізація почала випереджати східну. На це століття припадають:"},{"page_url":"https://fi.wikipedia.org/wiki/Askim","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Langnes_Skanse_1.jpg","page_title":"Askim","context_page_description":"Askim on kunta ja sen keskustaajamakaupunki Norjassa Østfoldin läänissä noin 50 kilometriä Oslosta etelään. Kunnan läpi virtaa Norjan pisin joki Glomma. Nimi Askim on yhdistelmä sanoista saarni ja koti."},{"page_url":"https://pt.wikipedia.org/wiki/Desfontainia","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Desfontainia_spinosa.jpg","page_title":"Desfontainia","context_page_description":"Desfontainia é uma género de plantas da família Loganiaceae, ou da família Desfontainiaceae segundo a classificação filogenética.\\né composta por pelo menos uma espécie, Desfontainia spinosa Ruiz & Pav.\\nSegundo alguns autores, uma segunda espécie é igualmente considerada: Desfontainia splendens Bonpl.\\nDesfontainia spinosa é um arbusto de folhas persistentes, opostas, espinhosas, de flor terminal de longa corola tubular de cor laranja. É originária das regiões andinas tropicais da América do Sul até à Costa Rica."},{"page_url":"https://en.wikipedia.org/wiki/Squares_of_Savannah,_Georgia","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Monument_-_panoramio_%2848%29.jpg","page_title":"Squares of Savannah, Georgia","context_page_description":"The U.S. city of Savannah, Georgia was laid out in 1733 around four open squares, each surrounded by four residential blocks and four civic blocks. Once the four wards were developed in the mid-1730s, two additional wards were laid out. The layout of a square and eight surrounding blocks was known as a \\"ward.\\" The original plan was part of a larger regional plan that included gardens, farms, and \\"out-lying villages.\\" While some authorities believe that the original plan allowed for growth of the city and thus expansion of the grid, the regional plan suggests otherwise: the ratio of town lots to country lots was in balance and growth of the urban grid would have destroyed that balance.\\nOglethorpe's agrarian balance was abandoned after the Georgia Trustee period. Additional squares were added during the late 18th and 19th centuries, and by 1851 there were 24 squares in the city. In the 20th century, three of the squares were demolished or altered beyond recognition, leaving 21. In 2010, one of the three \\"lost\\" squares, Ellis, was reclaimed."},{"page_url":"https://de.wikipedia.org/wiki/Mark_Atkins_(Musiker)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Mark_Atkins_Didgeridoo_Player.jpg","page_title":"Mark Atkins (Musiker)","context_page_description":"Mark Atkins ist ein australischer Musiker und Künstler. Er ist Nachkomme des Yamaji-Stammes aus West-Australien. Atkins ist mit seiner Tradition als Aborigine eng verbunden, was sich nicht zuletzt dadurch bemerkbar macht, dass jeder seiner Songs eine Geschichte erzählt."},{"page_url":"https://hu.wikipedia.org/wiki/Gr%C3%BAzia_uralkod%C3%B3inak_list%C3%A1ja","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/1708._%E1%83%93%E1%83%90%E1%83%95%E1%83%98%E1%83%97_II-%E1%83%A1_%E1%83%AC%E1%83%A7%E1%83%90%E1%83%9A%E1%83%9D%E1%83%91%E1%83%98%E1%83%A1_%E1%83%92%E1%83%90%E1%83%9C%E1%83%90%E1%83%AE%E1%83%9A%E1%83%94%E1%83%91%E1%83%98%E1%83%A1_%E1%83%A1%E1%83%98%E1%83%92%E1%83%94%E1%83%9A%E1%83%98.jpg","page_title":"Grúzia uralkodóinak listája","context_page_description":"Az alábbi lista Grúzia uralkodóit tartalmazza Kr. e. 3. századtól a 19. századig."},{"page_url":"https://pl.wikipedia.org/wiki/Karpaty","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Romanian_Folk_Group_Transilvania_Cluj_Napoca.jpg","page_title":"Karpaty","context_page_description":"Karpaty – łańcuch górski w środkowej Europie, ciągnący się łukiem przez terytoria ośmiu krajów: Austrii, Czech, Polski, Słowacji, Węgier, Ukrainy, Rumunii i Serbii. Najwyższy szczyt Gerlach ma wysokość 2655 m n.p.m. W regionalizacji partykularnej Słowacji Karpaty są podsystemem oznaczonym numerem"},{"page_url":"https://sk.wikipedia.org/wiki/Elektroin%C5%A1tala%C4%8Dn%C3%BD_materi%C3%A1l","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Sicherungskasten.jpg","page_title":"Elektroinštalačný materiál","context_page_description":"Elektroinštalačný materiál je termín, ktorým označujeme elektrotechnické súčiastky, prístroje či spotrebiče využívané pri zavádzaní domovej, bytovej ale aj vonkajšej elektroinštalácie. Často sa tento termín vzťahuje len na materiál s ktorým dokáže pracovať aj človek bez nejakej väčšej odbornej znalosti. Elektroinštalačný materiál je vymedzený normou alebo predpisom tej danej krajiny pre ktorú bol materiál vyrobený. Ide o označenie používané predovšetkým v obchodnom styku, hlavne k odlíšeniu od iného druhu tovaru."},{"page_url":"https://ms.wikipedia.org/wiki/Dahuk","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ac/Dohuk.jpg","page_title":"Dahuk","context_page_description":"Dahuk merupakan sebuah bandar yang terletak di Iraq utara dan ibukota Pentadbiran Dahuk.\\nBandar ini berpenduduk sekitar 500,000 orang, penduduknya terutama dari suku Kurdi dan bangsa Assyrian.\\nDalam salah satu sumber disebutkan bahwa kata Dahuk berasal dari perkataan Kurmanji, yang artinya \\"desa kecil\\"."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%9C%8C%EB%A6%AC%EC%97%84_%ED%81%AC%EB%9E%A8%ED%94%84_%EC%95%A4_%EC%84%A0%EC%A6%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/William_Cramp_and_Sons_Werft.jpg","page_title":"윌리엄 크램프 앤 선즈","context_page_description":"윌리엄 크램프 앤 선즈는 미국의 조선 회사이다. 1825년에 윌리엄 크램프에 의해 설립되었으며, 19세기 미국의 주요 조선소였다. 아메리칸 쉽 앤 커머스 사가 1919년에 조선소를 인수했지만, 1923년 해군력 제한 조약에 따라 미국 해군에서의 수주가 감소하면서 1927년에 폐쇄되었다. 1940년에 해군 순양함과 잠수함을 건조하기 위해 2,200만 달러를 지출하여 조선소를 재개했다. 주요 함정에 바라오급 잠수함 등이 있다. 그러나 크램프 사의 바라오급 잠수함은 회사의 기술력 부족 때문인지 공사 기간을 연장시킨 경우가 많았으며, 일부 함은 불량도 발생했다. 크램프 조선소는 1947년에 폐쇄되었고, 델라웨어 강에 위치해 있는 이 조선소 부지는 공업 단지가 되었다."},{"page_url":"https://en.wikipedia.org/wiki/Governor-General_of_Malta","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Sir_Anthony_Mamo.jpg","page_title":"Governor-General of Malta","context_page_description":"The Governor-General of Malta was the official representative of Her Majesty Elizabeth II, Queen of Malta, in the State of Malta from 1964 to 1974. This office replaced that of the Governor, and it was replaced by that of President upon the proclamation of the Republic of Malta."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%87%D5%A1%D5%A3%D5%A1%D5%B6%D5%A1%D5%AF%D5%A1%D5%A3%D5%B8%D6%82%D5%B5%D5%B6_%D5%A9%D6%87%D5%A5%D6%80%D5%B8%D5%BE_%D6%84%D5%A1%D6%80%D5%A1%D5%A4%D6%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Pluvialis_fulva_flight_-_Christopher_Watson.jpg","page_title":"Շագանակագույն թևերով քարադր","context_page_description":"Շագանակագույն կամ ասիական շագանակագույն թևերով քարադր քարադրների ընտանիքին պատկանող թռչուն:"},{"page_url":"https://ceb.wikipedia.org/wiki/Overhalla","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Ranem_Church.jpg","page_title":"Overhalla","context_page_description":"Munisipyo ang Overhalla sa Noruwega. Nahimutang ni sa lalawigan sa Nord-Trøndelag Fylke, sa habagatan-kasadpang bahin sa nasod, 500 km sa amihanan sa Oslo ang ulohan sa nasod. Adunay 3,562 ka molupyo. Naglangkob kin og 730 ka kilometro kwadrado. Overhalla mopakigbahin sa usa ka utlanan sa Fosnes, Høylandet, Grong, Snåsa, Steinkjer, ug Namsos.\\nAng yuta sa Overhalla kay kasagaran kabungtoran.\\nMga lungsod sa Overhalla:\\nSkage\\nRanemsletta\\nSvalia\\nSa mosunod nga mga natural nga mga bahin makita sa Overhalla:\\nMga kalapukan:\\nAmdalsmyra\\nBallimyrån\\nBeinholet\\nBergmyra\\nBerrimomyra\\nBertilmyra\\nBjørnengmyra\\nBjørngjøtin\\nBlakkmyra\\nBlakkmyra\\nBlautholmen\\nBrannmyra\\nBrennbergmyra\\nBrennmyra\\nBåsmomyra\\nDjupdalsmyra\\nDragbakkmyra\\nDynnstøet\\nDølan\\nErekenget\\nFallmyra\\nFamyra\\nFarbakkmyra\\nFinnhusmyra\\nFjøsmyra\\nFlyin\\nFlåttastøa\\nFøribotnet\\nGammelsetermyra\\nGarlmyra\\nGeitskardmyra\\nGjersinghalla\\nGlennmyrån\\nGårdsmyra\\nGåsmyra\\nHannabekkmyra\\nHanskleivmyra\\nHeiamyra\\nHestmyra\\nHestmyra\\nHorkmyra\\nHundenget\\nIsakhaugmyra\\nJamtenget\\nJonslettet\\nJørnmyrån\\nKavelbrumyra\\nKjerkmomyra\\nKlabbdalsmyra\\nKlæsvikmyra\\nKleppdalsmyra\\nKlyttjmyra\\nKløyvrønningsmyra\\nKorsmyra\\nKovamyra\\nKoven\\nKringla\\nKringlåtmyra\\nKringlåtmyra\\nKvernmyra\\nKåvamyra\\nLangenget"},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_overleden_in_2010/Voorstel","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Jan_Pen_%281976%29.jpg","page_title":"Lijst van personen overleden in 2010/Voorstel","context_page_description":"Dit is een lijst van personen die overleden zijn in 2010.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://es.wikipedia.org/wiki/Dompierre-en-Morvan","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6d/Map_commune_FR_insee_code_21232.png","page_title":"Dompierre-en-Morvan","context_page_description":"Dompierre-en-Morvan es una población y comuna francesa, en la región de Borgoña, departamento de Côte-d'Or, en el distrito de Montbard y cantón de Précy-sous-Thil."},{"page_url":"https://sl.wikipedia.org/wiki/Srbska_despotija","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Despot_of_Serbia_Prussian_edition.jpg","page_title":"Srbska despotija","context_page_description":"Srbska despotija je bila srednjeveška srbska država v prvi polovici 15. stoletja. Čeprav se za konec srednjeveške Srbije na splošno šteje bitka na Kosovskem polju leta 1389, se je Despotija kot naslednik Srbskega cesarstva in Moravske Srbije obdržal še šestdeset let in pomenil kulturno in politično renesanso preden ga je leta 1359 osvojilo Osmansko cesarstvo. Pred osvojitvijo je imela despotija nominalno suveren položaj do Osmanskega cesarstva, Bizantinskega cesarstva in Ogrskega kraljestva. Po osmanski zasedbi despotije leta 1359 je še naprej živel v izgnanstvu v sredjeveškem Ogrskem kraljestvu do sredine 16. stoletja. Zadnji despot Srbije je bil Pavle Bakić, ki sta ga priznavala tako Osmansko kot Habsburško cesarstvo."},{"page_url":"https://da.wikipedia.org/wiki/Jack_Kerouac","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Kerouac_by_Palumbo.jpg","page_title":"Jack Kerouac","context_page_description":"Jack Kerouac var amerikansk forfatter, digter, kunstner og en del af beatgenerationen. Selvom han havde stor publikumssucces men kun liden succes hos kritikere og anmeldere mens han levede, anses Kerouac nu som en af de vigtigste amerikanske forfattere. Han spontane bekendelsesprosa har inspireret andre forfattere, bl.a. Tom Robbins, Lester Bangs, Richard Brautigan, Hunter S. Thompson, Ken Kesey, Tom Waits og Bob Dylan. Kerouacs kendteste værker omfatter On the Road, The Dharma Bums, Big Sur og Visions of Cody.\\nI det meste af sit voksne liv rejste han enten rundt i USA eller boede hos sin mor. I et samfund under forandring ledte Kerouac efter sin egen plads, hvilket til sidst fik ham til at forkaste 1950'ernes værdier. Hans tekster afspejler ofte et ønske om at bryde ud af samfundets lænker og finde en mening med livet. Denne søgen har sikkert været medvirkende til hans eksperimenter med stoffer og hans rejser rundt i verden. Hans bøger får ofte æren for at have været medvirkende til 1960'ernes modkultur. Kerouac døde i en alder af 47 år af indre blødninger, som menes at være forårsaget af hans kroniske alkoholisme."},{"page_url":"https://en.wikipedia.org/wiki/Hammam_Nbail","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Hammam_N%27bails%2C_24220.jpg","page_title":"Hammam Nbail","context_page_description":"Hammam Nbail is a town and commune in Guelma Province, Algeria. According to the 1998 census it has a population of 15,854."},{"page_url":"https://en.wikipedia.org/wiki/List_of_equestrian_statues_in_the_United_States","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/SheridanGutzonBorglum.jpg","page_title":"List of equestrian statues in the United States","context_page_description":"This is a list of equestrian statues in the United States."},{"page_url":"https://sh.wikipedia.org/wiki/Fraureuth","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/21/Fraureuth_in_Z.svg","page_title":"Fraureuth","context_page_description":"Fraurojt je opština u njemačkoj saveznoj državi Saksonija. Jedno je od 33 opštinska središta okruga Cvikau. Prema procjeni iz 2010. u opštini je živjelo 5.600 stanovnika. Posjeduje regionalnu šifru 14524060."},{"page_url":"https://es.wikipedia.org/wiki/Lay_Lady_Lay","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Bob_Dylan_%22Lay%2C_Lady%2C_Lay%22_verse.png","page_title":"Lay Lady Lay","context_page_description":"«Lay Lady Lay» es una canción escrita por el cantante estadounidense Bob Dylan y publicada en su álbum de 1969 Nashville Skyline."},{"page_url":"https://es.wikipedia.org/wiki/Lay_Lady_Lay","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Bob_Dylan_%22Lay%2C_Lady%2C_Lay%22_verse.png","page_title":"Lay Lady Lay","context_page_description":"«Lay Lady Lay» es una canción escrita por el cantante estadounidense Bob Dylan y publicada en su álbum de 1969 Nashville Skyline."},{"page_url":"https://sv.wikipedia.org/wiki/Somerfield","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/East_Cowes_Somerfield.JPG","page_title":"Somerfield","context_page_description":"Somerfield är en livsmedelskedja i Storbritannien. Företaget köptes upp av The Co-operative Group den 2 mars 2009 och skapade därmed Storbritanniens femte största livsmedelskedja. Somerfield-namnet kommer ersättas med The Co-Operative Food under 2010."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_in_Middelburg_(plaats)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Middelburg%2C_Schuddebeursstraat_8.jpg","page_title":"Lijst van rijksmonumenten in Middelburg (plaats)","context_page_description":"De stad Middelburg telt 1144 inschrijvingen in het rijksmonumentregister.\\nStraten met veel monumenten zijn:\\nLijst van rijksmonumenten in Middelburg/Dam\\nLijst van rijksmonumenten in Middelburg/Spanjaardstraat\\nLijst van rijksmonumenten in Middelburg/Langeviele\\nLijst van rijksmonumenten in Middelburg/Singelstraat\\nLijst van rijksmonumenten in Middelburg/Lange Noordstraat\\nLijst van rijksmonumenten in Middelburg/Damplein\\nLijst van rijksmonumenten in Middelburg/Kinderdijk\\nLijst van rijksmonumenten in Middelburg/Vlissingsestraat\\nLijst van rijksmonumenten in Middelburg/Vestingwerken\\nLijst van rijksmonumenten in Middelburg/Vlasmarkt\\nLijst van rijksmonumenten in Middelburg/Gortstraat\\nLijst van rijksmonumenten in Middelburg/Herenstraat\\nLijst van rijksmonumenten in Middelburg/Rouaansekaai\\nLijst van rijksmonumenten in Middelburg/Wagenaarstraat\\nHieronder een overzicht van de rijksmonumenten gelegen aan de andere straten."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%AA%E0%AF%86%E0%AE%A4%E0%AF%8D%E0%AE%B0%E0%AE%BE_%E0%AE%95%E0%AE%BF%E0%AE%B5%E0%AE%BF%E0%AE%A4%E0%AF%8B%E0%AE%B5%E0%AE%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Petra_Kvitov%C3%A1_Roland_Garros_2011.jpg","page_title":"பெத்ரா கிவிதோவா","context_page_description":"பெத்ரா கிவிதோவா செக் குடியரசைச் சேர்ந்த ஒரு தொழில்முறை டென்னிசு விளையாட்டுக்காரர். தற்போது தனது தரவரிசையிலேயே உயர்ந்த எட்டாமிடத்தில் உள்ளார். இதுவரை மகளிர் டென்னிசு சங்க போட்டிகளில் ஐந்து முறை வென்றுள்ளார்.\\nதனது முதல் பெருவெற்றித் தொடர் ஒற்றையர் பட்டத்தை விம்பிள்டனில் 2011ஆம் ஆண்டு வென்றுள்ளார்."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%90%E3%83%BC%E3%82%B8%E3%83%BC%E3%83%BB%E3%83%A9%E3%83%BC%E3%82%AA2%E4%B8%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Baji_Rao_II.jpg","page_title":"バージー・ラーオ2世","context_page_description":"バージー・ラーオ2世は、インドのデカン地方、マラーター王国の世襲における第8 代宰相。マラーター同盟の盟主でもある。ラーオ・パンディト・パンダームとも呼ばれる。"},{"page_url":"https://arz.wikipedia.org/wiki/%D9%85%D8%A7%D8%AB%D9%8A%D9%88_%D8%A7%D9%85%D8%B1%D9%88%D9%84%D9%8A%D9%88%D8%A7%D9%84%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Matthew_Amroliwala_2014.jpg","page_title":"ماثيو امروليوالا","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nماثيو امروليوالا صحفى من المملكه المتحده."},{"page_url":"https://zh.wikipedia.org/zh-my/%E6%B0%B4%E9%99%86%E6%B3%95%E4%BC%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/%E6%B0%B4%E9%99%B8%E5%84%80%E8%BB%8C.jpg","page_title":"水陆法会","context_page_description":"水陆法会，汉传佛教的超度仪式，又称水陆道场、水陆大会、水陆大斋或水陆供斋，全称“法界圣凡水陆普度大斋胜会”；“水陆”一说指“水陆无主孤魂”。水陆法会是中国佛教仪式最隆重，规模最大，功德最高的法事，源自唐代或宋初，目的是超度亡魂，救赎众生，追荐祖先幽灵，并延寿增福。水陆法会往往以明代祩宏所编《水陆仪轨》为范本，为期七天至四十九天，分外坛和内坛两部分，外坛法师日间唱诵经忏真言，晚间施食饿鬼；内坛设置佛像及多个神牌席位，法师观想及念唱仪文疏表，邀请冥界诸鬼神出席，供奉以食物、鲜花、香油、衣服等供品。水陆法会并陈列诸多神像与水陆画，以助召请神灵与超度亡者。"},{"page_url":"https://ceb.wikipedia.org/wiki/Sakhalinskiy_Zaliv","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Estremo_Oriente_russo_-_parte_sud.png","page_title":"Sakhalinskiy Zaliv","context_page_description":"Gulpo ang Sakhalinskiy Zaliv sa Rusya. Nahimutang ni sa sidlakang bahin sa nasod, 6,000 km sa sidlakan sa Moscow ang ulohan sa nasod."},{"page_url":"https://en.wikipedia.org/wiki/Queen_Elizabeth_2","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/QE2_and_Ferry_Too_%283556981118%29.jpg","page_title":"Queen Elizabeth 2","context_page_description":"RMS Queen Elizabeth 2, often referred to simply as QE2, is a retired British ocean liner converted into a floating hotel. Originally built for the Cunard Line, QE2 was operated by Cunard as both a transatlantic liner and a cruise ship from 1969 to 2008. It was then laid up until converted and since 18 April 2018, she has been operating as a floating hotel in Dubai.\\nQE2 was designed for the transatlantic service from her home port of Southampton, UK to New York, United States and was named after the earlier Cunard liner RMS Queen Elizabeth. She served as the flagship of the line from 1969 until succeeded by the Queen Mary 2 in 2004. QE2 was designed in Cunard's offices in Liverpool and Southampton and built in Clydebank, Scotland. She was considered the last of the transatlantic ocean liners until Queen Mary 2 entered service.\\nQE2 was also the last oil-fired passenger steamship to cross the Atlantic in scheduled liner service until she was refitted with a modern diesel powerplant in 1986–87. She undertook regular world cruises during almost 40 years of service, and later operated predominantly as a cruise ship, sailing out of Southampton, England."},{"page_url":"https://pa.wikipedia.org/wiki/%E0%A8%AA%E0%A8%BE%E0%A8%95%E0%A8%BF%E0%A8%B8%E0%A8%A4%E0%A8%BE%E0%A8%A8_%E0%A8%B5%E0%A8%BF%E0%A9%B1%E0%A8%9A_%E0%A8%B8%E0%A8%BF%E0%A9%B1%E0%A8%96%E0%A9%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Sikh_Articles_of_Faith.JPG","page_title":"ਪਾਕਿਸਤਾਨ ਵਿੱਚ ਸਿੱਖੀ","context_page_description":"ਇਸ ਵੇਲੇ ਪਾਕਿਸਤਾਨ ਵਿੱਚ ਸਿੱਖ ਬਹੁਤ ਘੱਟ ਗਿਣਤੀ ਵਿੱਚ ਵਸਦੇ ਹਨ। ਬਹੁਤੇ ਸਿੱਖ ਪੰਜਾਬ ਸੂਬੇ ਵਿੱਚ ਵਸਦੇ ਹਨ ਜਿਹੜਾ ਕਿ ਪੁਰਾਣੇ ਪੰਜਾਬ ਦਾ ਇੱਕ ਹਿੱਸਾ ਹੈ ਜਿੱਥੇ ਸਿੱਖ ਮੱਤ ਦੀ ਸ਼ੁਰੂਆਤ ਹੋਈ। ਸੂਬਾ ਖ਼ੈਬਰ, ਪਖ਼ਤੋਨਖ਼ਵਾਹ ਦੇ ਰਾਜਗੜ੍ਹ ਪਿਸ਼ਾਵਰ ਵਿੱਚ ਵੀ ਸਿੱਖਾਂ ਦੀ ਕਾਫ਼ੀ ਵਸੋਂ ਹੈ। ਨਨਕਾਣਾ ਸਾਹਿਬ, ਜਿਹੜਾ ਕਿ ਸਿੱਖ ਮੱਤ ਦੇ ਬਾਣੀ ਬਾਬਾ ਗੁਰੂ ਨਾਨਕ ਦੀ ਜਨਮ ਭੋਈਂ ਹੈ, ਵੀ ਪਾਕਿਸਤਾਨੀ ਪੰਜਾਬ ਵਿੱਚ ਹੈ।\\n18ਵੀਂ ਤੇ 19ਵੀਂ ਸਦੀ ਵਿੱਚ ਸਿੱਖ ਤਬਕਾ ਇੱਕ ਤਾਕਤਵਰ ਸਿਆਸੀ ਸ਼ਕਤੀ ਬਣ ਗਿਆ ਤੇ ਮਹਾਰਾਜਾ ਰਣਜੀਤ ਸਿੰਘ ਨੇ ਸਿੱਖ ਸਲਤਨਤ ਦੀ ਨੀਂਹ ਰੱਖੀ ਜਿਸਦਾ ਰਾਜਗੜ੍ਹ ਲਹੌਰ ਸ਼ਹਿਰ ਸੀ ਜਿਹੜਾ ਅੱਜ ਦੇ ਪਾਕਿਸਤਾਨ ਦਾ ਦੂਜਾ ਵੱਡਾ ਸ਼ਹਿਰ ਹੈ। ਪੰਜਾਬ ਵਿੱਚ ਸਿੱਖਾਂ ਦੀ ਬਹੁਤੀ ਗਿਣਤੀ ਲਹੌਰ, ਰਾਵਲਪਿੰਡੀ, ਮੁਲਤਾਨ, ਫ਼ੈਸਲਾਬਾਦ ਤੇ ਨਨਕਾਣਾ ਸਾਹਿਬ ਵਿੱਚ ਹੈ।\\n1947ਈ. ਵਿੱਚ ਹਿੰਦੁਸਤਾਨ ਦੀ ਵੰਡ ਮਗਰੋਂ ਪਾਕਿਸਤਾਨ ਦੇ ਇਲਾਕਿਆਂ ਦੇ ਸਿੱਖ ਤੇ ਹਿੰਦੂ ਭਾਰਤ ਚਲੇ ਗਏ ਤੇ ਭਾਰਤ ਦੇ ਮੁਸਲਮਾਨ ਪਾਕਿਸਤਾਨ ਵਿੱਚ ਵੱਸ ਗਏ।\\n1947ਈ. ਵਿੱਚ ਪਾਕਿਸਤਾਨ ਦੀ ਆਜ਼ਾਦੀ ਦੇ ਮਗਰੋਂ ਸਿੱਖ ਕੌਮ ਨੇ ਸੰਗਠਿਤ ਹੋਣਾ ਸ਼ੁਰੂ ਕੀਤਾ ਤੇ ਪਾਕਿਸਤਾਨ ਸਿੱਖ ਗੁਰਦੁਆਰਾ ਪ੍ਰਬੰਧਕ ਕਮੇਟੀ ਬਣਾਈ ਤਾਂ ਜੋ ਪਾਕਿਸਤਾਨ ਵਿੱਚ ਸਿਖਾਂ ਦੀਆਂ ਪਵਿੱਤਰ ਥਾਂਵਾਂ ਤੇ ਵਿਰਸੇ ਨੂੰ ਮਹਿਫੂਜ਼ ਰੱਖਿਆ ਜਾ ਸਕੇ। ਪਾਕਿਸਤਾਨ ਸਰਕਾਰ ਨੇ ਭਾਰਤੀ ਸਿੱਖਾਂ ਨੂੰ ਪਾਕਿਸਤਾਨ ਵਿੱਚ ਆਉਣ ਤੇ ਆਪਣੀਆਂ ਪਵਿੱਤਰ ਥਾਂਵਾਂ ਦੀ ਯਾਤਰਾ ਕਰਨ ਦੀ ਇਜ਼ਾਜ਼ਤ ਦਿੱਤੀ ਹੋਈ ਹੈ ਅਤੇ ਪਾਕਿਸਤਾਨ ਦੇ ਸਿੱਖਾਂ ਨੂੰ ਭਾਰਤ ਜਾਣ ਦੀ ਵੀ ਇਜ਼ਾਜ਼ਤ ਹੈ।"},{"page_url":"https://en.wikipedia.org/wiki/Bridges_Street_Market","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/HK_Sheung_Wan_%E5%BF%85%E7%83%88%E8%80%85%E5%A3%AB%E8%A1%97%E8%A1%97%E5%B8%82_Bridges_Street_Market_interior_02.JPG","page_title":"Bridges Street Market","context_page_description":"Bridges Street Market is located at No. 2 Bridges Street, at the corner of Shing Wong Street, in Sheung Wan, Hong Kong. It is a Bauhaus style market building, originally opened in 1953, and scheduled to be renovated and open in 2018 as a news museum."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_im_Bonner_Ortsteil_Alt-Godesberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Bad_Godesberg%2C_Kurf%C3%BCrstenallee_5.jpg","page_title":"Liste der Baudenkmäler im Bonner Ortsteil Alt-Godesberg","context_page_description":"Die folgende Liste enthält in der Denkmalliste ausgewiesene Baudenkmäler auf dem Gebiet des Bonner Ortsteils Alt-Godesberg im Stadtbezirk Bad Godesberg.\\nHinweis: Die Reihenfolge der Denkmäler in dieser Liste orientiert sich an den Straßennamen und ist alternativ nach Hausnummern, Denkmallistennummer oder Bezeichnung sortierbar.\\nBasis ist die offizielle Denkmalliste der Stadt Bonn, die von der Unteren Denkmalbehörde geführt wird. Grundlage für die Aufnahme in die Denkmalliste ist das Denkmalschutzgesetz Nordrhein Westfalens.\\nKarte mit allen Koordinaten des Ortsteils Alt-Godesberg: OSM"},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B2%D9%87%D8%B1%D8%A7_%D9%86%D8%B9%D9%85%D8%AA%DB%8C_(%DA%A9%D9%88%D9%87%D9%86%D9%88%D8%B1%D8%AF)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Zahra_nemati_2.jpg","page_title":"زهرا نعمتی (کوهنورد)","context_page_description":"زهرا نعمتی متولد ۶ اردیبهشت ۱۳۵۸ تبریز است.\\nاو از سن نوجوانی علاقه خود را به ورزش نشان داد و ابتدا در رشته بدمینتون و بعدها در رشته‌های رزمی و بدن‌سازی هم فعالیت کرد، تا اینکه از اوایل سال ۱۳۹۰ شروع به ورزش کوهنوردی به صورت جدی کرد و از همان ابتدا استعداد و توانایی خود را درکوهنوردی ثابت و به موفقیت‌های چشمگیری دست یافت."},{"page_url":"https://fi.wikipedia.org/wiki/Katolinen_kirkko_Skotlannissa","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Roman_Catholic_Diocese_of_Diocese_of_Dunkeld.jpg","page_title":"Katolinen kirkko Skotlannissa","context_page_description":"Katolinen kirkko Skotlannissa toimii osana maailmanlaajuista katolista kirkkoa paavin ja hänen kuuriansa hengellisessä ohjauksessa."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Mitglieder_des_%C3%96sterreichischen_Bundesrates_(XXVI._Gesetzgebungsperiode)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/17-03-16-marianne-hackl-RR7_8242.jpg","page_title":"Liste der Mitglieder des Österreichischen Bundesrates (XXVI. Gesetzgebungsperiode)","context_page_description":"Dies ist eine Liste der Mitglieder des Österreichischen Bundesrates während der XXVI. Gesetzgebungsperiode des Nationalrates. Die XXVI. Gesetzgebungsperiode des Nationalrats begann am 9. November 2017. Da sich die Zusammensetzung des Bundesrates nach Landtagswahlen laufend ändert, orientiert sich die Unterteilung an den jeweiligen Gesetzgebungsperioden des Nationalrates."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B9%E3%83%A2%E3%83%BC%E3%83%AB%E3%83%BB%E3%82%B9%E3%82%A4%E3%82%B9%E3%83%BB%E3%83%8F%E3%82%A6%E3%83%B3%E3%83%89","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c6/08115491_Schwyzer_Niederlaufhund.jpg","page_title":"スモール・スイス・ハウンド","context_page_description":"スモール・スイス・ハウンドは、スイス原産の短足のセントハウンド犬種である。ドイツ語ではシュヴァイツェリシャー・ニーダーラウフフントという。ニーダーラウフフントとは、「小さい嗅覚ハウンド」という意味である。毛色や被毛のタイプによって、4つのバラエティに分けられている。"},{"page_url":"https://it.wikipedia.org/wiki/Ascari_(cacciatorpediniere)","image_url":"https://upload.wikimedia.org/wikipedia/it/f/f8/Ascari_Lanciere_1940_Ando-1976.jpg","page_title":"Ascari (cacciatorpediniere)","context_page_description":"L’Ascari è stato un cacciatorpediniere della Regia Marina."},{"page_url":"https://en.wikipedia.org/wiki/CHIJMES","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/CHIJMES_10.JPG","page_title":"CHIJMES","context_page_description":"CHIJMES is a historic building complex in Singapore, which began life as a Catholic convent known as the Convent of the Holy Infant Jesus. The complex is located at Victoria Street in the Downtown Core, within the Central Area, Singapore's central business district.\\nThe complex was used as a Catholic convent since 1852, with an acquired Caldwell House which was constructed in 1840–1841, an acquired Convent Orphanage house in 1855, the Convent of the Holy Infant Jesus Chapel in 1904 and an acquired hotel complex for the girls' school in 1933. The Caldwell House, currently a wedding venue, and the Gothic-style chapel, renamed as CHIJMES Hall, currently a function hall and also a wedding venue, have both been gazetted as national monuments. The complex has been restored in 1996 for commercial purposes as a dining, shopping and entertainment centre with ethnic restaurants, shops and a function hall, providing a backdrop for musicals, recitals, theatrical performances and weddings."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B8%D1%81%D1%81_%D0%91%D1%80%D0%B0%D0%B7%D0%B8%D0%BB%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Larissa_Costa.jpg","page_title":"Мисс Бразилия","context_page_description":"Мисс Бразилия — это конкурс красоты, который проводится почти каждый год, начиная с 1954 года между победительницами региональных конкурсов государства. В 2009 конкурс состоялся в субботу, 9 мая в Сан-Паулу. Победительница конкурса Мисс Бразилия выступает в конкурсе Мисс Вселенная а вице-мисс конкурса выступает на конкурсе Мисс Мира."},{"page_url":"https://es.wikipedia.org/wiki/Palacio_Fortuny","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Paolo_Monti_-_Serie_fotografica_%28Venezia%2C_1969%29_-_BEIC_6357463.jpg","page_title":"Palacio Fortuny","context_page_description":"El Palazzo Fortuny​ es un palacio histórico veneciano situado en el sestiere de San Marco. Fue construido por la familia Pesaro en el siglo XV en estilo gótico veneciano.​ Desde 1902 fue la residencia de Mariano Fortuny y su esposa Henriette Negrin, ​ y actualmente alberga el Museo Fortuny. El museo forma parte de la Fondazione Musei Civici di Venezia. Anteriormente, el edificio era conocido como Palazzo Pesaro degli Orfei."},{"page_url":"https://en.wikipedia.org/wiki/William_Owen_(painter)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/William_Owen_-_Portrait_of_a_man_-_Google_Art_Project.jpg","page_title":"William Owen (painter)","context_page_description":"William Owen RA was an English portrait painter known for his portraits of society figures such as Pitt the Younger and George, Prince of Wales."},{"page_url":"https://en.wikipedia.org/wiki/Panitan,_Capiz","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0f/Ph_locator_capiz_panitan.png","page_title":"Panitan, Capiz","context_page_description":"Panitan, officially the Municipality of Panitan, is a 3rd class municipality in the province of Capiz, Philippines. According to the 2015 census, it has a population of 40,289 people.\\nPronounced as Panit-an, it is 16 kilometres from Roxas City."},{"page_url":"https://en.wikipedia.org/wiki/Antony,_Hauts-de-Seine","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/HPA_-_entr%C3%A9e_principale.JPG","page_title":"Antony, Hauts-de-Seine","context_page_description":"Antony is a French commune in the southern suburbs of Paris, France. It is located 11.3 km from the centre of Paris. Antony is a subprefecture of the Hauts-de-Seine department and the seat of the arrondissement of Antony.\\nWatered by the Bièvre, a tributary of the Seine, Antony is located at the crossroads of very important transport routes, especially the main north–south axis which has existed for 2,000 years. Little urbanized until the early 20th century, the city grew considerably between the two wars, under Senator-Mayor Auguste Mounié, from 4,000 to 20,000 inhabitants. In the early 1960s the population quickly increased from 25,000 to 50,000 to accommodate the repatriated people from Algeria. Now incorporated in the Paris Metropolitan Area, it is particularly strong in education with one of the largest private institutions in France and in the health field with the largest private establishment in Île-de-France.\\nThe inhabitants of the commune are known as Antoniens or Antoniennes.\\nThe commune has been awarded two flowers by the National Council of Towns and Villages in Bloom in the Competition of cities and villages in Bloom."},{"page_url":"https://eo.wikipedia.org/wiki/Al%C4%9Derio","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Berb%C3%A8res_en_Alg%C3%A9rie_occidentale.svg","page_title":"Alĝerio","context_page_description":"Alĝerio estas lando nome suverena ŝtato en norda Afriko, sude de la suda Mediteranea marbordo.\\nTies ĉefurbo kaj plej loĝata urbo estas Alĝero, situanta en la plej nordo de la lando. Kun areo de 2 381 741 kvadrataj kilometroj, Alĝerio estas la deka plej granda lando en la mondo, kaj la plej granda en Afriko. Alĝerio limas nordoriente kun Tunizio, oriente kun Libio, okcidente kun Maroko, sudokcidente kun Okcidenta Saharo, Maŭritanio, kaj Malio, sudoriente kun Niĝero, kaj norde kun la Mediteranea Maro. La lando estas duon-prezidenta respubliko konsistanta el 48 provincoj kaj 1 541 komunumoj. Abdelaziz Bouteflika estis Prezidanto ekde 1999.\\nAntikva Alĝerio konis multajn imperiojn kaj dinastiojn, kiaj la antikvaj Numidianoj, Fenicianoj, Kartaganoj, Romianoj, Vandaloj, Bizancanoj, Umajidoj, Abasidoj, Idrisidoj, Aglabidoj, Rustamidoj, Fatimidoj, Ziridoj, Hammadidoj, Almoravidoj, Almohadoj, Otomanoj kaj la Franca kolonia imperio. Berberoj estas ĝenerale konsiderataj la indiĝenaj loĝantoj Alĝerio. Post la Araba konkero de Nordafriko, plej indiĝenaj loĝantoj estis arabigitaj; tiele, kvnkam plej alĝerianoj estas Berberoj origine, plej identigas sin kun araba identeco."},{"page_url":"https://es.wikipedia.org/wiki/Juntos_por_C%C3%B3rdoba","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Leonor_Mar%C3%ADa_Mart%C3%ADnez_Villada.png","page_title":"Juntos por Córdoba","context_page_description":"Juntos por Córdoba fue una alianza en la provincia de Córdoba, Argentina, conformada por la Unión Cívica Radical, el Frente Cívico de Córdoba, Propuesta Republicana y la Coalición Cívica ARI."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%A3%E0%B8%B2%E0%B8%A2%E0%B8%9E%E0%B8%A3%E0%B8%B0%E0%B8%99%E0%B8%B2%E0%B8%A1%E0%B8%9E%E0%B8%A3%E0%B8%B0%E0%B8%A1%E0%B8%AB%E0%B8%B2%E0%B8%81%E0%B8%A9%E0%B8%B1%E0%B8%95%E0%B8%A3%E0%B8%B4%E0%B8%A2%E0%B9%8C%E0%B8%9E%E0%B8%A3%E0%B8%B0%E0%B8%AD%E0%B8%87%E0%B8%84%E0%B9%8C%E0%B8%AA%E0%B8%B8%E0%B8%94%E0%B8%97%E0%B9%89%E0%B8%B2%E0%B8%A2%E0%B9%81%E0%B8%AB%E0%B9%88%E0%B8%87%E0%B8%97%E0%B8%A7%E0%B8%B5%E0%B8%9B%E0%B9%80%E0%B8%AD%E0%B9%80%E0%B8%8A%E0%B8%B5%E0%B8%A2%E0%B9%81%E0%B8%A5%E0%B8%B0%E0%B9%82%E0%B8%AD%E0%B9%80%E0%B8%8A%E0%B8%B5%E0%B8%A2%E0%B9%80%E0%B8%99%E0%B8%B5%E0%B8%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/B%E1%BA%A3o_%C4%90%E1%BA%A1i_au_pouvoir.jpg","page_title":"รายพระนามพระมหากษัตริย์พระองค์สุดท้ายแห่งทวีปเอเชียและโอเชียเนีย","context_page_description":"นี่คือ รายพระนามพระมหากษัตริย์พระองค์สุดท้ายแห่งทวีปเอเชียและโอเชียเนีย"},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A2%D9%BE%D9%85%DB%8C%D9%86%D8%B3%D8%AA%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Upminster_021.jpg","page_title":"آپمینستر","context_page_description":"آپمینستر بریتانیادا بیر یاشاییش منطقه‌سی‌دیر بۇ شهر اینگیلیس اؤلکه‌سینده یئرلشیب."},{"page_url":"https://en.wikipedia.org/wiki/East_Cape_Lighthouse","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/87/East_Cape_Lighthouse.JPG","page_title":"East Cape Lighthouse","context_page_description":"East Cape Lighthouse is a lighthouse sited on Otiki Hill above East Cape, the easternmost point on the North Island of New Zealand. It is owned and operated by Maritime New Zealand. The lighthouse was originally constructed on nearby East Island. However the island was difficult to access and proved to be susceptible to earthquakes and subsequent landslips. In 1920 a decision was made to relocate the light to the mainland and in April 1922, the light was extinguished and then relit at its current location in December of that year. Originally manned by three lighthouse keepers, the light's staffing was progressively reduced until it was fully automated in 1985. It is now controlled from the Maritime New Zealand headquarters in Wellington. While the area around the light is accessible by foot, the lighthouse itself is not open to the public."},{"page_url":"https://en.wikipedia.org/wiki/Connecticut_State_Capitol","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Connecticut_State_Capitol%2C_Hartford.jpg","page_title":"Connecticut State Capitol","context_page_description":"The Connecticut State Capitol is located north of Capitol Avenue and south of Bushnell Park in Hartford, the capital of Connecticut. The building houses the Connecticut General Assembly; the upper house, the State Senate, and lower house, the House of Representatives, as well as the office of the Governor of the State of Connecticut. The Connecticut Supreme Court occupies a building across Capitol Avenue."},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_bens_tombados_pelo_Condephaat","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Marquise.JPG","page_title":"Lista de bens tombados pelo Condephaat","context_page_description":"Esta é uma lista de bens tombados pelo Conselho de Defesa do Patrimônio Histórico, Arqueológico, Artístico e Turístico. Fundado em outubro de 1968, o Condephaat é o órgão público responsável pela proteção, valorização e divulgação do patrimônio cultural do estado de São Paulo, bem como o órgão imbuído da capacidade legal de tombar bens culturais em território paulista. Subordinado à Secretaria de Cultura do Governo de São Paulo, o Condephaat é responsável pelo tombamento de mais de 500 bens em diversos municípios do estado, abrangendo desde móveis e imóveis até núcleos urbanos e áreas naturais. Na presente lista, os bens estão distribuídos por município, por sua vez agrupados por letra, em sequência alfabética."},{"page_url":"https://pl.wikipedia.org/wiki/Pancerniki_typu_Virginia","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/USS_Georgia_-_NH_53722.jpg","page_title":"Pancerniki typu Virginia","context_page_description":"Pancerniki typu Virginia – seria pięciu amerykańskich pancerników generacji przeddrednotów, wcielonych do służby w latach 1906–1907. Zostały zaprojektowane jako pierwsze prawdziwie pełnomorskie pancerniki amerykańskie. Okręty brały udział w podróży dookoła świata, która została nazwana rejsem Wielkiej Białej Floty. Drugi i ostatni raz US Navy eksperymentowała z użyciem wież dział artylerii pomocniczej o kalibrze 203 mm ustawionych na wieżach dział artylerii głównej kalibru 305 mm. Tak jak poprzedni eksperyment i tym razem zakładane efekty nie zostały osiągnięte i te działa okazały się niezbyt użyteczne.\\nOkręty w czasie I wojny światowej były już przestarzałe i były używane w większości jako okręty szkolne.\\nW 1923 roku pojawiła się propozycja pozyskania przez Polskę pancerników. Na mocy Traktatu Waszyngtońskiego, Amerykanie musieli pozbyć się m.in. 13 pancerników, głównie starszych typów. Amerykański senator ze stanu Maryland, Joseph Irwin France stworzył projekt ustawy, na mocy której Amerykanie przekazaliby Polsce wszystkie pięć okrętów. Okręty miały być przekazane za darmo, natomiast polskie władze miały pokryć koszty ich podróży do Europy."},{"page_url":"https://fr.wikipedia.org/wiki/Phare_du_Portzic","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Phare_du_Portzic_%28goulet_de_la_rade_de_Brest%29.jpg","page_title":"Phare du Portzic","context_page_description":"Le phare du Portzic est situé à l'extrémité nord-est du goulet de Brest. C'est le phare le plus proche de la ville de Brest."},{"page_url":"https://en.wikipedia.org/wiki/Wuyi_County,_Zhejiang","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Fabao_Xianglong_Ta_20120218-09.jpg","page_title":"Wuyi County, Zhejiang","context_page_description":"Wuyi County is a county of southwest-central Zhejiang province, China. It is under the administration of the Jinhua city. It is rich in Fluorite and hot spring resorts.\\nThe local government is sited in Lushan avenue."},{"page_url":"https://fi.wikipedia.org/wiki/Karvashikkori","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Bitternut-fruit.jpg","page_title":"Karvashikkori","context_page_description":"Karvashikkori on jalopähkinäkasveihin kuuluva kesävihanta puu, joka kasvaa alkuperäisenä Pohjois-Amerikan keski- ja itäosissa. Tämä keskikokoinen puu on hikkorilajeista yleisin ja pohjoisimmaksi levinnyt mutta toisaalta myös lyhytikäisin. Sen puuaines on erittäin iskunkestävää, minkä ansiosta se soveltuu erinomaisesti huonekalujen, työkalujen ja tikkaiden valmistukseen. Tämän lisäksi sitä käytetään lihan savustuksessa, polttopuuna sekä koristekasvina. Nimensä mukaisesti sen pähkinät maistuvat karvailta eivätkä kelpaa syötäviksi."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturg%C3%BCter_in_Z%C3%BCrich/Kreis_6","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Unterstrass_Scheuchzer_146-154.JPG","page_title":"Liste der Kulturgüter in Zürich/Kreis 6","context_page_description":"Die Liste der Kulturgüter in Zürich/Kreis 6 enthält alle Objekte im Kreis 6 der Stadt Zürich, die gemäss der Haager Konvention zum Schutz von Kulturgut bei bewaffneten Konflikten, dem Bundesgesetz vom 20. Juni 2014 über den Schutz der Kulturgüter bei bewaffneten Konflikten sowie der Verordnung vom 29. Oktober 2014 über den Schutz der Kulturgüter bei bewaffneten Konflikten unter Schutz stehen.\\nObjekte der Kategorien A und B sind vollständig in der Liste enthalten, Objekte der Kategorie C fehlen zurzeit. Unter übrige Baudenkmäler sind weitere geschützte Objekte zu finden, die im Verzeichnis der Objekte von überkommunaler Bedeutung der kantonalen Denkmalpflege zu finden und nicht bereits in der Liste der Kulturgüter enthalten sind."},{"page_url":"https://en.wikipedia.org/wiki/Constitution_of_Massachusetts","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/First_Articles_of_the_1780_Massachusetts_Constitution.jpg","page_title":"Constitution of Massachusetts","context_page_description":"The Constitution of the Commonwealth of Massachusetts is the fundamental governing document of the Commonwealth of Massachusetts, one of the 50 individual state governments that make up the United States of America. As a member of the Massachusetts Constitutional Convention of 1779, John Adams was the document's principal author. Voters approved the document on June 15, 1780. It became effective on October 25, 1780, and remains the oldest functioning written constitution in continuous effect in the world. It was also the first constitution anywhere to be created by a convention called for that purpose rather than by a legislative body. Only the Constitution of San Marino has sections still in force that are older.\\nThe Massachusetts Constitution was written last of the original states' first constitutions. Rather than taking the form of a list of provisions, it was organized into a structure of chapters, sections and articles. It served as a model for the Constitution of the United States of America, drafted seven years later, which used a similar structure. It also influenced later revisions of many other state constitutions."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%A4%AA%E5%8E%9F%E6%88%B0%E5%BD%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/1949_Taiyuan_Battle_Map.png","page_title":"太原戰役","context_page_description":"太原戰役，是第二次國共內戰後期的一場大型戰役，戰役發生於中華民國山西省太原。1948年10月，中國人民解放軍華北野戰軍等部在徐向前指揮下發起戰役。整個戰役經過六個月激烈戰鬥、雙方共陸續投入42萬餘部隊參戰。最終中國人民解放軍於1949年4月25日攻克晉系軍閥閻錫山控制的山西省會太原，基本占領了山西乃至華北全境。"},{"page_url":"https://my.wikipedia.org/wiki/%E1%80%9A%E1%80%B0%E1%80%9B%E1%80%AD%E1%80%AF%E1%80%95%E1%80%AE%E1%80%9A%E1%80%99%E1%80%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Eu-sulfate-luminescence.jpg","page_title":"ယူရိုပီယမ်","context_page_description":"ယူရိုပီယမ် သည် ငွေရောင် ဖျော့ဖျော့ရှိပြီး တန်ဖိုးမြင့်မားပါသည်။ ဓာတုဗေဒသင်္ကေတမှာ Eu ဖြစ်သည်။ ၎င်း သတ္တုသည် Lanthanide အုပ်စုထဲတွင် ဓာတ်ပြုမှု အကောင်းဆုံး သတ္တု တစ်မျိုးဖြစ်သည်။ ၎င်း သတ္တုသည် လေထဲ၌ အခန်းအပူချိန်မှာပင် အောက်ဆီဂျင်နှင့် ဓာတ်ပြုနိုင်ပါသည်။ အပူချိန် ၁၅၀ မှ ၁၈၀ စင်တီဂရိတ် အတွင်း လောင်ကျွမ်းနိုင်ပါသည်။ ရေနှင့် အလွယ်တကူ ဓာတ်ပြုနိုင်သည်။"},{"page_url":"https://en.wikipedia.org/wiki/Astropy","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Logo_of_the_Astropy_Project.png","page_title":"Astropy","context_page_description":"Astropy is a collection of software packages written in the Python programming language and designed for use in astronomy. The software is a single, free, core package for astronomical utilities due to the increasingly widespread usage of Python by astronomers, and to foster interoperability between various extant Python astronomy packages. Astropy is included in several large Python distributions; it is part of package managers for Linux and macOS, the Anaconda Python Distribution, Enthought Canopy and Ureka."},{"page_url":"https://en.wikipedia.org/wiki/Pontiac_GTO","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/74_Pontiac_Ventura_Custom_GTO_%288748492763%29.jpg","page_title":"Pontiac GTO","context_page_description":"The Pontiac GTO is an automobile that was manufactured by American automaker Pontiac from the 1964 to 1974 model years, and by GM's subsidiary Holden in Australia from the 2004 to 2006 model years.\\nThe first generation of the GTO was the first muscle car produced in the 1960s and the 1970s. The Pontiac GTO is considered by some to have started the trend with all four domestic automakers offering a variety of competing models.\\nFor the 1964 and 1965 model years, the GTO was an optional package on the intermediate-sized Pontiac LeMans. The 1964 GTO vehicle identification number started with 82, while the 1965 GTO VIN started with 237. The GTO became a separate model from 1966 to 1971. It became an optional package again for the 1972 and 1973 intermediate LeMans. For 1974, the GTO optional package was offered on the compact-sized Ventura.\\nThe GTO was selected as the Motor Trend Car of the Year in 1968.\\nThe GTO model was revived from 2004 to 2006 model years as a captive import for Pontiac, a left-hand drive version of the Holden Monaro, itself a coupé variant of the Holden Commodore."},{"page_url":"https://is.wikipedia.org/wiki/Princeton-h%C3%A1sk%C3%B3li","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Princeton_University_halls3.jpg","page_title":"Princeton-háskóli","context_page_description":"Princeton-háskóli er staðsettur í bænum Princeton í New Jersey og er fjórði elsti háskólinn í Bandaríkjunum. Princeton-háskóli, sem er oft talinn einn besti háskóli Bandaríkjanna, hefur auk þess að bjóða upp á grunnnám og framhaldsnám í hugvísindum, raunvísindum og félagsvísindum, arkítektaskóla, verkfræðiskóla og skóla fyrir stjórnsýslu- og alþjóðafræði. Við skólann eru stundaðar rannsóknir á mörgum sviðum, meðal annars í rafgaseðlisfræði, veðurfræði, og á þotuhreyflum.\\nHáskólinn er á tveimur háskólasvæðum. Aðalháskólasvæðið er í miðbæ Princeton en auk þess er háskólasvæði í lundi skammt frá bænum og nefnist „The Forestal Campus“. Þar eru rannsóknarstofur fyrir rafgaseðlisfræðiverkefni og veðurfræðirannsóknir. Samvinna er með háskólanum og Brookhaven National Laboratories. Aðalbókasafn háskólans er Firestone-bókasafnið en auk þess er veglegt bókasafn í listasafni háskólans.\\nSkólinn var stofnaður undir heitinu College of New Jersey árið 1746 en nú er annar skóli rekinn undir heitinu College of New Jersey. Upphaflega var skólinn í bænum Elizabeth í New Jersey. Árið 1756 var skólinn fluttur til Princeton og nafni skólans var formlega breytt í „Princeton University“ árið 1896."},{"page_url":"https://en.wikipedia.org/wiki/Lumley_v_Wagner","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Opera_House_Haymarket_edited.jpg","page_title":"Lumley v Wagner","context_page_description":"Lumley v Wagner [1852] EWHC J96 is an English contract law case, concerning the right to terminate performance of a contract."},{"page_url":"https://hu.wikipedia.org/wiki/Joss_Stone","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Joss_Stone_10_%288132128347%29.jpg","page_title":"Joss Stone","context_page_description":"Joscelyn Eve Stoker, közismertebb nevén Joss Stone brit énekesnő, dalszerző és színésznő, műfajai: R&B, soul, blue-eyed soul és reggae. Amy Winehouse és Duffy mellett a 21. század egyik legnépszerűbb soulénekese, és velük együtt tette népszerűvé a popzenében ismét a klasszikus soul és jazz műfaját."},{"page_url":"https://es.wikipedia.org/wiki/Aberdeen_Proving_Ground","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Aberdeen_Proving_Ground_Plaque.JPG","page_title":"Aberdeen Proving Ground","context_page_description":"Aberdeen Proving Ground es la instalación más antigua del ejército de los Estados Unidos localizada cerca de Aberdeen, Maryland. Parte de la instalación es un lugar designado por el censo, el cual tenía una población de 3116 en el censo de 2000. Fue\\ninaugurado el 20 de octubre de 1917, seis meses después de la primera intervención de Estados Unidos en la Primera Guerra Mundial y abarca una superficie de aproximadamente 29.300 hectáreas."},{"page_url":"https://en.wikipedia.org/wiki/Stewarts_Lane","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Clapham_Stewarts_Lane_Locomotive_Depot_ex-SE%26C_0-4-4T_geograph-2688016-by-Ben-Brooksbank.jpg","page_title":"Stewarts Lane","context_page_description":"Stewarts Lane is a large railway-servicing facility in Battersea in London, England, founded by the London Chatham and Dover Railway in 1862, to serve London Victoria railway station. It is sited in the midst of a maze of railway lines between 'Factory Junction' and 'Stewarts Lane Junction', adjacent to the site of the former Longhedge Railway Works. Prior to 1962 it was one of the largest motive power depots in the UK. Following the end of steam traction in the early 1960s it was converted into a Traction Maintenance Depot which is currently operated by Govia Thameslink Railway."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%B0%D0%BA_%D1%81%D0%BF%D0%BE%D0%BC%D0%B5%D0%BD%D0%B8%D0%BA%D0%B0_%D0%BA%D1%83%D0%BB%D1%82%D1%83%D1%80%D0%B5_%D1%83_%D0%97%D0%B0%D1%98%D0%B5%D1%87%D0%B0%D1%80%D1%81%D0%BA%D0%BE%D0%BC_%D0%BE%D0%BA%D1%80%D1%83%D0%B3%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Zajecar_Narodni_muzej.JPG","page_title":"Списак споменика културе у Зајечарском округу","context_page_description":"Следи списак споменика културе у Зајечарском округ."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%84%D8%A7%D9%85%D8%A8%D9%88%D8%B1%DA%AF%DB%8C%D9%86%DB%8C_%DA%AF%D8%A7%D9%84%D8%A7%D8%B1%D8%AF%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Lamborghini_Gallardo_silver.jpg","page_title":"لامبورگینی گالاردو","context_page_description":"لامبورگینی گالاردو یا گایاردو یک خودروی اسپرت و محصول شرکت لامبورگینی است.\\nگالاردو تا به امروز بیشترین محصول تولید شده توسط لامبورگینی می‌باشد که فقط در سه ساله اول تولید آن، بیش از ۵۰۰۰ دستگاه از این مدل تولید شده‌است و قیمت هر دستگاه ۲۴۲ هزار دلار می‌باشد. این نام روی این خودرو بعد از مشهور شدن آن به «گاو وحشی»، گذاشته شد. واژه گالاردو در زبان اسپانیایی به معنای دلاور و دلیر و در زبان ایتالیایی به معنای ضربه زننده است."},{"page_url":"https://jv.wikipedia.org/wiki/Brodnica","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/38/Brodnica_pa%C5%82ac_Anny_Waz%C3%B3wny.JPG","page_title":"Brodnica","context_page_description":"Brodnica iku siji kutha ing Polen sisih lor. Kutha iki sing ndunungi 28 837 jiwa. Wiwit taun 1975 nganti taun 1998 kutha iki kalebu sajeroning wewengkon provinsi Toruń Voivodeship. Wiwit taun 1999 kalebu wewengkon Kuyavian-Pomeranian Voivodeship."},{"page_url":"https://ia.wikipedia.org/wiki/Ripa_Teatina","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/RipaTeatina.jpg","page_title":"Ripa Teatina","context_page_description":"Ripa Teatina es un municipalitate que se trova in le provincia de Chieti, in le region del Abruzzo, in Italia.\\nPecietta de geographia\\nIste articulo es ancora in stato embryonic: illo es un pecietta. Nos te invita cordialmente a completar lo pro meliorar Wikipedia in interlingua."},{"page_url":"https://en.wikipedia.org/wiki/Phanariots","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Fanarion.jpg","page_title":"Phanariots","context_page_description":"Phanariots, Phanariotes, or Fanariots were members of prominent Greek families in Phanar, the chief Greek quarter of Constantinople where the Ecumenical Patriarchate is located, who traditionally occupied four important positions in the Ottoman Empire: Voivode of Moldavia, Voivode of Wallachia, Grand Dragoman, and Grand Dragoman of the Fleet. Despite their cosmopolitanism and often-Western education, the Phanariots were aware of their Hellenism; according to Nicholas Mavrocordatos' Philotheou Parerga, \\"We are a race completely Hellenic\\".\\nThey emerged as a class of moneyed Greek merchants during the second half of the 16th century, and were influential in the administration of the Ottoman Empire's Balkan domains in the 18th century. The Phanariots usually built their houses in the Phanar quarter to be near the court of the Patriarch, who was recognized as the spiritual and secular head of the Orthodox subjects—the Rum Millet, or \\"Roman nation\\" of the empire, except those under the spiritual care of the patriarchs of Antioch, Jerusalem, Alexandria, Ohrid and Peć—often acting as archontes of the Ecumenical See."},{"page_url":"https://de.wikipedia.org/wiki/Otto_Graf_Lambsdorff","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/JoKreuz.jpg","page_title":"Otto Graf Lambsdorff","context_page_description":"Otto Friedrich Wilhelm Freiherr von der Wenge Graf Lambsdorff war ein deutscher Politiker. Er amtierte von 1977 bis 1982 und von 1982 bis 1984 als Bundesminister für Wirtschaft sowie von 1988 bis 1993 als Bundesvorsitzender der FDP. 1987 wurde Lambsdorff im Zusammenhang mit der Flick-Affäre wegen Steuerhinterziehung zu einer Geldstrafe verurteilt."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/K%C3%A1ny","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/HUN_K%C3%A1ny_COA.jpg","page_title":"Kány","context_page_description":"Kány sī Magyar Borsod-Abaúj-Zemplén kūn ê chi̍t ê chng-thâu."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%A7%AC%E9%B9%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Lymnocryptes_minimus_MHNT.jpg","page_title":"姬鹬","context_page_description":"小鷸又名姬鷸，為鷸科姬鷸屬的鳥類。在中國大陸，分布於新疆、內蒙古、河北、江蘇、福建、廣東等地。該物種的模式產地在丹麥。"},{"page_url":"https://pl.wikipedia.org/wiki/Grass_Lake_(Michigan)","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7b/Grass_Lake_downtown_Michigan_Ave._facing_west.JPG","page_title":"Grass Lake (Michigan)","context_page_description":"Grass Lake – wieś w Stanach Zjednoczonych, w stanie Michigan, w hrabstwie Jackson."},{"page_url":"https://en.wikipedia.org/wiki/Dinarak","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Exchange_houses_act_as_banking_agents_for_Dinarak.jpg","page_title":"Dinarak","context_page_description":"Dinarak is a mobile wallet, money transfer, electronic bill payment, funds disbursement service, licensed by the Central Bank of Jordan under the jomopay national switch and launched in late 2015 as Dinarak wallet as part of the Jordanian central bank's efforts to advocate financial inclusion for the un-banked segment of the Jordanian population. Dinarak allows users to deposit, withdraw, transfer money and pay for goods and services via their mobile phone. The service can be accessed by Dinarak mobile applictaion.\\nJoMoPay, the Jordanian national mobile payments switch, is a unique payments system that has created cross-platform and platform level interoperability for multiple digital payments instruments in Jordan. This includes interoperability between the licensed mobile payments services providers, as well as interoperability between mobile wallets, bank accounts, and prepaid cards."},{"page_url":"https://en.wikipedia.org/wiki/Flag_Acts","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Flag_of_the_United_States_%281777-1795%29.svg","page_title":"Flag Acts","context_page_description":"The Flag Acts are three laws that sought to define the design of the flag of the United States. All the submitted suggestions were remarkably short, the shortest being a sentence of 31 words, and the longest being a title and two sentences of 117 words."},{"page_url":"https://ca.wikipedia.org/wiki/Escapolita","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Meionite-Quartz-53866.jpg","page_title":"Escapolita","context_page_description":"L'escapolita, o grup de l'escapolita, és un grup de silicats complexos de calci i sodi, que pertanyen al subgrup dels tectosilicats, de fórmula química entre Na₄Al₃Si₉O₂₄ i Ca₄Al₆Si₆O₂₄CO₃. Va ser anomenada així l'any 1800 per José Bonifácio de Andrada e Silva. El terme català escapolita prové del grec skapos i lithos, perquè en alguns casos es presenta en forma de llargs cristalls estriats.\\nL'escapolita és considerada producte de la sèrie de solució sòlida que es produeix entre la marialita i la meionita. El terme es refereix generalment només a aquesta sèrie, no el grup escapolita sencer, per la qual s'exclou la silvialita. S'utilitza com un terme genèric quan la composició química exacta de la sèrie de solució sòlida no ha estat determinada. Es pot alterar en pinita."},{"page_url":"https://en.wikipedia.org/wiki/Inadazutsumi_Station","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Inadazutsumi_Station_entrance_20170630.jpg","page_title":"Inadazutsumi Station","context_page_description":"Inadazutsumi Station is a railway station on the Nambu Line in Tama-ku, Kawasaki, Japan, operated by the East Japan Railway Company."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Notre-Dame-de-la-Salette_de_Saint-Privat-de-Vallongue","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Saint-Privat-de-Vallongue%2C_%C3%89glise_Notre-Dame-de-la-Salette%2C_chevet.JPG","page_title":"Église Notre-Dame-de-la-Salette de Saint-Privat-de-Vallongue","context_page_description":"L'église Notre-Dame-de-la-Salette est une église catholique romaine située à Saint-Privat-de-Vallongue, en France."},{"page_url":"https://de.wikipedia.org/wiki/Schrunser_M%C3%BCnster","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/29/St.Georg-K.Honold.jpg","page_title":"Schrunser Münster","context_page_description":"Die Pfarrkirche Schruns bzw. das Schrunser Münster steht im Zentrum der Marktgemeinde Schruns im Bezirk Bludenz in Vorarlberg. Die dem Patrozinium hl. Jodok unterstellte römisch-katholische Pfarrkirche gehört zum Dekanat Montafon der Diözese Feldkirch. Das Münster steht unter Denkmalschutz."},{"page_url":"https://sl.wikipedia.org/wiki/Zgodovina_tehnologije_in_znanosti_v_%C5%A0paniji","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Esfera_Armilar_1765_MUNCYT.jpg","page_title":"Zgodovina tehnologije in znanosti v Španiji","context_page_description":"V zadnjem stoletju so se razvile različne panoramske vizije zgodovinskega procesa, ki je oblikoval aktualno špansko družbo. Znanstvene in tehnične dejavnosti so stare toliko, kot je star človek. Vzpostavitev prave tehnologije, ki je razumljena kot integracija sistematičnega znanja, materialnih virov, spretnosti in tehničnih postopkov, ki se uporabljajo za preoblikovanje produktivnega procesa z zavestno metodologijo, ki presega raven obrtnika, je morala počakati na sodobno dobo.\\nLe malo španskih znanstvenikov je bilo protagonistov paradigmatskih sprememb, ki so zaznamovale zaporedne znanstvene revolucije. Velik del študij v zgodovini znanosti obsega spremljanje njihovega sprejema v Španiji, enako velja tudi pri tehnoloških prenosih. Znanost in tehnologija sta bili v Španiji do prve polovice dvajsetega stoletja \\"mejna realnost v svoji organizaciji in družbenem kontekstu\\", tako je takšna marginalizacija desetletja ostajala nekakšen nacionalni stereotip španščine, ki so jih razširjali in slavili nekateri tuji mediji, včasih zavrnjeni kot neprimerni ali žaljivi."},{"page_url":"https://en.wikipedia.org/wiki/Battle_of_Thanesar","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Basawan._Battle_of_rival_ascetics._Akbarnama%2C_ca._1590%2C_V%26A_Museum.jpg","page_title":"Battle of Thanesar","context_page_description":"Battle of Thanesar, was fought on the eve of Solar eclipse holy bath fair on 9 April 1567, near Thanesar on the banks of the Sarsawati Ghaggar River in the state of Haryana. While the Mughal Emperor Akbar was on his campaign to subdue the Rajputs, he set up camp at a water Qanat and established camp around that fresh water reservoir in order to properly manage his forces in the nearby regions."},{"page_url":"https://pt.wikipedia.org/wiki/Esta%C3%A7%C3%A3o_San_Jos%C3%A9_(SITVA)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Estaci%C3%B3n_San_Jos%C3%A9_%28Metro_de_Medell%C3%ADn%29.jpg","page_title":"Estação San José (SITVA)","context_page_description":"A Estação San José é uma das estações da Tranvía de Ayacucho, situada em Medellín, entre a Estação San Antonio e a Estação Pabellón del Agua EPM. Administrada pela Empresa de Transporte Masivo del Valle de Aburrá Limitada, faz parte da Linha T-A.\\nFoi inaugurada em 20 de outubro de 2015. Localiza-se no cruzamento da Avenida Oriental com a Avenida Ayacucho. Atende o bairro La Candelaria, situado na comuna de La Candelaria."},{"page_url":"https://tt.wikipedia.org/wiki/%D0%9A%D0%B0%D1%80%D0%B0%D0%BC%D0%B0_(%D0%90%D0%BD%D1%83%D0%B9_%D0%BA%D1%83%D1%88%D1%8B%D0%BB%D0%B4%D1%8B%D0%B3%D1%8B)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/%D0%9C%D0%B0%D0%B9_700.jpg","page_title":"Карама (Ануй кушылдыгы)","context_page_description":"Карама — Русия территориясеннән ага торган елга. Алтай крае, Алтай Республикасы биләмәләрендә ага. Елга Ануй елгасының уң ярына тамагыннан 277 км өстәрәк кушыла. Елга озынлыгы 28 км."},{"page_url":"https://pt.wikipedia.org/wiki/Ford_Fiesta","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/2010_Ford_Fiesta_Edge_1.2_Front.jpg","page_title":"Ford Fiesta","context_page_description":"O Fiesta é um carro hatchback produzido pela Ford desde 1976. Atualmente, se encontra em sua sétima geração. O Fiesta é um projeto global, sendo fabricado e comercializado em vários lugares do mundo. É comercializado em vários lugares da Europa, América, Ásia, Oceania e África.\\nMais de 16 milhões de unidades já foram vendidas desde o lançamento, o que torna o Fiesta o terceiro veículo mais vendido da Ford atrás apenas do Escort e da F-Series.\\nFoi retirado de linha na América do Sul em 2019, por causa das baixas vendas."},{"page_url":"https://it.wikipedia.org/wiki/Stefano_Torelli","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/LuebeckRathausAudienzsaalTorelli.jpg","page_title":"Stefano Torelli","context_page_description":"Stefano Torelli è stato un pittore italiano."},{"page_url":"https://tr.wikipedia.org/wiki/Medininkai_Kalesi","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Medinink%C5%B3_pilis_i%C5%A1_dangaus_-_www.aerialmedia.tv_02.jpg","page_title":"Medininkai Kalesi","context_page_description":"Medininkai Kalesi, Litvanya'nın Vilnius bölgesinde yer alan bir ortaçağ kalesi, 14. yüzyılın ilk yarısında inşa edilmiştir. Kalenin savunma çevresi 6.5 hektardı; bu ölçüleri ile Litvanya'daki en büyük muhafaza tipi kaledir. Düz zemine inşa edilmiş ve kanat savunması için tasarlanmıştır. Dikdörtgen kalenin avlusu yaklaşık 1.8 hektarlık bir alan kaplıyordu ve 15 metre yüksekliğinde ve 2 metre kalınlığında duvarlarla korunuyordu. Kalenin 4 kapısı ve kuleleri vardı. Yaklaşık 30 metre yüksekliğindeki ana kule konutlar için kullanıldı. Medininkai'den ilk olarak 1392'de bahsedilir. Kale, 15. yüzyılın sonlarında büyük bir yangın nedeniyle ağır hasar gördü. Ateşli silah kullanımının artması nedeniyle, bu tür kale artık savunma amaçlarına uygun değildi ve bu nedenle konut olarak kullanılmaya başlandı. 17. ve 18. yüzyıllarda bir çiftlik ve fırın olarak yeniden düzenlendi. Kalenin restorasyonundan sonra kurulan müzesi Litvanya Büyük Dükalığı'nın zanaatkârları tarafından gümüşten yapılmış geniş bir ürün koleksiyonu ve Cumhurbaşkanı Algirdas Brazauskas'ın avcılık kupaları ve av bıçakları koleksiyonuna ev sahipliği yapmaktadır."},{"page_url":"https://it.wikipedia.org/wiki/Dar-ui_yeon-in_-_Bobogyeongsim_ryeo","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Naju_Image_Theme_Park_07.jpg","page_title":"Dar-ui yeon-in - Bobogyeongsim ryeo","context_page_description":"Dar-ui yeon-in - Bobogyeongsim ryeo è un drama coreano trasmesso su SBS dal 29 agosto al 1º novembre 2016, e in contemporanea in Cina, Hong Kong, Malesia, Singapore e Indonesia, basato sul romanzo cinese Bubujingxin di Tong Hua."},{"page_url":"https://ca.wikipedia.org/wiki/P%C3%ADrcing_genital","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Labiaplasty_with_clitoral_hood_reduction_and_Princess_Albertina_piercing_1.jpg","page_title":"Pírcing genital","context_page_description":"El pírcing genital és una forma de pírcing que implica perforar una part dels genitals, creant així un lloc adequat per a l'ús de diferents tipus de joieria. No obstant això, el terme també es pot utilitzar pars pro toto per a mostrar tots els pírcings a l'àrea de l'anus, el perineu, els genitals i el mont de Venus, que incluen els pírcings anal, guiches i pírcings púbic que no impliquen perforació de genitals.\\nEls pírcings genital es poden fer en homes o dones, amb diverses formes de pírcings disponibles. El motiu principal per als dos sexes és l'embelliment i la individualització. A més, alguns pírcings augmenten el plaer sexual augmentant l'estimulació.\\nEls pírcings genital es poden trobar a moltes societats tribals, especialment a l'Àsia meridional i oriental, on ha estat part de la pràctica tradicional des de l'antiguitat.\\nEls primers registres de pírcing genital es troben en el Kama Sutra, que es va escriure fa més de 2000 anys."},{"page_url":"https://ca.wikipedia.org/wiki/Barbara_Uthmann","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Annaberg_Buchholz_Barbara_Uthman_Denkmal_04.JPG","page_title":"Barbara Uthmann","context_page_description":"Barbara Uthmann es considera una de les més grans defensores de la punta al coixí probablement de forma incorrecta, tal com explica Reinhart Unger, alhora que va ser una dona de negocis molt important a la regió de les Muntanyes Metal·líferes. El seu cognom també es pot trobar escrit com Uttmann, però Uthmann es considera correcte generalment.\\nEra la filla de Heinrich von Elterlein i va continuar els negocis del seu difunt marit amb èxit, Christoph Uthmann, però va fer fallida a causa d'una conspiració de la competència. Per tant, va ser obligada a buscar un nou camp on treballar. Encara que sigui coneguda per la punta al coixí, no es pot provar històricament que en manufacturés, encara que si que se sap que va produir trenes activament. De vegades, va arribar a contractar 900 persones perquè les fabriquessin. En morir, va deixar una feina molt considerable i encara es considera una de les persones més extraordinàries dels Monts Metàl·lics."},{"page_url":"https://de.wikipedia.org/wiki/Dumalneg","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/99/Ph_locator_ilocos_norte_dumalneg.png","page_title":"Dumalneg","context_page_description":"Dumalneg ist eine Stadtgemeinde in der philippinischen Provinz Ilocos Norte. Im Jahre 2010 lebten in dem 88,48 km² großen Gebiet 1814 Einwohner, wodurch sich eine Bevölkerungsdichte von 21 Einwohnern pro km² ergibt. Dumalneg ist nur in ein Baranggay aufgeteilt. Das Gebiet ist sehr bergig und schwer zu bewirtschaften. Mehrere Flüsse und Bäche fließen durch das Gebiet und bilden viele kleine Täler."},{"page_url":"https://de.wikipedia.org/wiki/Geschichte_der_Stadt_Dortmund","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/35/Ludorff1894-Goldene-Madonna-IMG_2817.jpg","page_title":"Geschichte der Stadt Dortmund","context_page_description":"Die Geschichte der Stadt Dortmund reicht über 1100 Jahre zurück. Die Stadt erlebte zwei Blütezeiten, während deren sie von europaweiter Bedeutung war: einmal im 14. Jahrhundert als Vorort der westfälischen Hansestädte in der Hochphase der Städtehanse und zum zweiten Mal im 19. und 20. Jahrhundert als Zentrum der Industrialisierung im Ruhrgebiet während der Gründerzeit und danach bis zur Stahlkrise als bedeutender Standort der Montanindustrie."},{"page_url":"https://fr.wikipedia.org/wiki/Rapid_Vienne","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/FW_Happelstadion3.jpg","page_title":"Rapid Vienne","context_page_description":"Le Rapid Vienne est un club autrichien de football, basé à Hütteldorf dans le quatorzième arrondissement de Vienne. Ses couleurs sont le vert et blanc.\\nDepuis la saison 1911-1912, le club a toujours évolué en Bundesliga. Fondé en 1899, il détient le record de titres nationaux. Au niveau européen, le club a également pu célébrer de prestigieuses victoires, remportant la Coupe Mitropa en 1930 et 1951 et atteignant la finale de la Coupe d'Europe des vainqueurs de coupe en 1985 et 1996. En 1941, lorsque l'Autriche était annexée par l'Allemagne nazie, le Rapid fut sacré champion d'Allemagne.\\nLe Rapid, de très loin l'équipe la plus populaire d'Autriche et fortement enraciné dans les milieux prolétaires, est considéré comme le club de la classe ouvrière autrichienne."},{"page_url":"https://fi.wikipedia.org/wiki/Elias_Lindholm","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Elias_Lindholm_2013-2.jpg","page_title":"Elias Lindholm","context_page_description":"Elias Viktor Zebulon Lindholm on ruotsalainen jääkiekkoilija, joka pelaa NHL-joukkue Calgary Flamesin organisaatiossa. Carolina Hurricanes varasi hänet koko NHL:n varaustilaisuuden viidentenä pelaajana kesällä 2013. Lindholm on pelipaikaltaan keskushyökkääjä, mutta hän osaa pelata myös laidassa. Lindholmin vahvuuksiin kuuluu luistelu, kiekolliset taidot ja kahden suunnan pelaaminen. Hänen heikkouksiinsa kuuluu voiman puute."},{"page_url":"https://lt.wikipedia.org/wiki/Salo%C4%8Di%C5%B3_tiltas","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Salo%C4%8Di%C5%B3_Dariaus_ir_Gir%C4%97no_tiltas.JPG","page_title":"Saločių tiltas","context_page_description":"Saločių S. Dariaus ir S. Girėno tiltas – automobilių tiltas, kertantis Mūšos upę Saločių miestelyje, Pasvalio rajone, kelio 1303 Biržai–Pasvaliečiai–Saločiai 21,6 km. Miestelis išsistatęs kairiajame Mūšos krante, 22 km į vakarus nuo Biržų ir 23 km į šiaurę nuo Pasvalio, netoli Latvijos sienos. Tiltas stūkso miestelio Vytauto gatvės ašyje, 1 km į vakarus nuo kelio A10 Panevėžys–Pasvalys–Bauskė.\\nInžinieriaus Viktoro Rėklaičio suprojektuotas ir 1929 m. pastatytas tiltas per Mūšą tebenaudojamas iki šių dienų. Jis yra reikšmingas istorijai ir kultūrai, todėl 1995 m. įrašytas į LR nekilnojamųjų kultūros vertybių registrą. Nuo 1933 m. tiltas vadinamas transatlantinių lakūnų Stepono Dariaus ir Stasio Girėno vardu jų tragiškam žygdarbiui įamžinti."},{"page_url":"https://it.wikipedia.org/wiki/Lobelia_giberroa","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Lobelia_gibberoa_1.jpg","page_title":"Lobelia giberroa","context_page_description":"Lobelia giberroa Hemsl., 1877 è una pianta appartenente alla famiglia delle Campanulacee, diffusa in Africa."},{"page_url":"https://sv.wikipedia.org/wiki/Chariaspilates","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c3/Chariaspilates_formosaria_male.jpg","page_title":"Chariaspilates","context_page_description":"Chariaspilates är ett släkte av fjärilar. Chariaspilates ingår i familjen mätare.\\nKladogram enligt Catalogue of Life:"},{"page_url":"https://hu.wikipedia.org/wiki/Sz%C3%A9chenyi_t%C3%A9r_(Szeged)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/De%C3%A1k_Ferenc_szobra_Szegeden.jpg","page_title":"Széchenyi tér (Szeged)","context_page_description":"A Széchenyi tér a szegedi belváros egyik központi elhelyezkedésű, parkosított, forgalom elől részlegesen elzárt, négyszög alakú tere. Területe 50 087 négyzetméter Korzója közvetlen folytatása a sétálóutcának, gyalogosforgalma így jelentős; kedvelt sétahely, rendszeresen szolgál ünnepségek, fesztiválok, vásárok színhelyeként. Helyi tömegközlekedési átszállóhely lévén, illetve középületei és pusztán elhelyezkedése folytán is igen frekventált terület. Korábban – egészen 1950-ig – vásártér."},{"page_url":"https://zh.wikipedia.org/zh-hk/%E9%99%95%E8%A5%BF%E5%85%A8%E5%9B%BD%E9%87%8D%E7%82%B9%E6%96%87%E7%89%A9%E4%BF%9D%E6%8A%A4%E5%8D%95%E4%BD%8D%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/%E6%B1%89%E9%95%BF%E9%99%B5_-_%E4%B8%98.JPG","page_title":"陕西全国重点文物保护单位列表","context_page_description":"本列表是中國全國重點文物保護單位的子列表，列舉在陝西省境內的全國重點文物保護單位。"},{"page_url":"https://de.wikipedia.org/wiki/Gef%C3%A4ngnis_Comarca","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/2018_Pris%C3%A3o_de_Comarca_2.JPG","page_title":"Gefängnis Comarca","context_page_description":"Das Gefängnis Comarca oder auch Gefängnis Comarca Balide war ein Gefängnis in Dili, der heutigen Landeshauptstadt Osttimors. In der indonesischen Besatzungszeit war Lembaga Pemasyarakatan Dili der offizielle Name des Gefängnisses. Heute ist der Komplex ein Museum und Sitz des Centro Nacional Chega!. Es liegt im Stadtteil Balide."},{"page_url":"https://ca.wikipedia.org/wiki/Txokh","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/%D0%A7%D0%BE%D1%85_3.JPG","page_title":"Txokh","context_page_description":"Txokh és un poble del Daguestan, a Rússia, el 2010 tenia 3.223 habitants. Pertany al districte rural de Gunib."},{"page_url":"https://et.wikipedia.org/wiki/Kopli_laht","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Kopli_laht_2006-04-28.jpg","page_title":"Kopli laht","context_page_description":"Kopli laht on laht Harjumaal, halduslikult Tallinna linna osa. Kopli laht on üks Tallinna lahe osaveekogudest.\\nKopli laht asub Kopli poolsaare ja Kakumäe poolsaare vahel. Lahe edelarannal on pankrannik.\\nLahte suubub Mustjõgi."},{"page_url":"https://nn.wikipedia.org/wiki/Sector-motorsaga","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Sector-motorsaege.jpg","page_title":"Sector-motorsaga","context_page_description":"Sector var ei motorsag utvikla av Alex Ulrik Westfelt i Mariendal i Sverige. Omgrepet «motorsag» fannst ikkje på denne tida, så Westfelt kalla saga «Trädfällningsmakinen Sector».\\nSaga hadde eit U-forma bogesverd, med trinser i dei fire hjørna, som kjeda gjekk over. Kjeda hadde tenner av skrapetypen, som på stokksager og tømmersvansar. Motoren var ein Arkimedes totaktsmotor, med ein effekt på 2,5 eller 5 hk. Bogesverdet hadde ein masse på 15 kg og motoren hadde ein masse på 40 kg. Motoren var difor plassert på marka, og drivkrafta vart overført til nogesverdet via ein fleksibel aksling.\\nSaga vart produsert av AB J.A. Andersons Veksstad i Stockholm. Sector vart demonstrert i 1916 og i 1917 vart saga testa på Skoghögskolan, i samarbeid med Statens Maskin- & Redskapsprovingsanstalt. Desse testane synte at saga i gjennomsnitt ikkje fungerte meir en 45 min mellom kvar gong ho trong ettersyn. Etter dette vart det utført omfattande endringar. Mellom anna vart den fleksible kraftoverføringsakselen bytta ut med ein kardanaksel.\\nEtter desse endringane var saga sett i produksjon. Det tyske militæret var mellom kundane, og i 1919 - 1920 vart saga demonstrert fleire stader i Tyskland."},{"page_url":"https://et.wikipedia.org/wiki/Veeriku_tee","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Veeriku_street_in_Tallinn.JPG","page_title":"Veeriku tee","context_page_description":"Veeriku tee on tänav Tallinnas Pirita linnaosas Kose asumis. Tänava pikkus on umbes 500 m.\\nVeeriku tee sai nime 11. novembril 1955. Tänava nimi on Jääraku tee paarisnimi."},{"page_url":"https://en.wikipedia.org/wiki/Paravane_(weapon)","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/48/Paravane_mine-sweeping_%28Seaman%27s_Pocket-Book%2C_1943%29.jpg","page_title":"Paravane (weapon)","context_page_description":"The paravane, a form of towed underwater \\"glider\\" with a warhead that was used in anti-submarine warfare, was developed from 1914–16 by Commander Usborne and Lieutenant C. Dennistoun Burney, funded by Sir George White, founder of the Bristol Aeroplane Company. It was used against naval mines and submarines."},{"page_url":"https://de.wikipedia.org/wiki/Sal%C3%A8ve","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Sal%C3%A8ve-Annecy.jpg","page_title":"Salève","context_page_description":"Der Mont Salève ist ein im Département Haute-Savoie in Frankreich gelegener Berg der Savoyer Voralpen, nur sechs Kilometer von der Schweizer Stadt Genf entfernt, als deren Hausberg er gilt.\\nDer Salève ist ein 18 km langer von Südwest nach Nordost gestreckter Bergrücken, bestehend aus den Pitons im Südwesten, dem Grand Salève und dem Petit Salève im Nordosten. Er misst am Gipfel des le Grand Piton 1379 m. Zwischen dem Grand und dem Petit Salève verläuft ein tiefer Sattel, in dem das Dorf Monnetier liegt. Von 1892 bis 1935 führte eine elektrische Zahnradbahn vom Pas de l’Échelle bei Veyrier auf zwei Strecken, sowohl um den Petit Salève als auch direkt nach Monnetier und von dort auf den Grand Salève. 1932 wurde das Nordende des Grand Salève mit einer Seilbahn bis auf 1120 m vom Pas de l’Échelle aus zugänglich gemacht.\\nDie Ostseite des Salève senkt sich zur Molasse des Bornes-Plateaus relativ sanft ab, während die von der Erosion abgetragene Genfer Seite abrupt abfällt. Der Bergzug wird von mehreren engen und tiefen Schluchten eingeschnitten. Eine davon, die „Grande Varappe“, lieh zum Ende des 19."},{"page_url":"https://la.wikipedia.org/wiki/Ahmadou_Ahidjo","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Ahmadou_Ahidjo.jpg","page_title":"Ahmadou Ahidjo","context_page_description":"Ahmadou Ahidjo, e populo Fulani ortus, fuit ab anno 1960 usque ad annum 1982 primus Cameroniae praeses."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B7%E3%83%BC%E3%83%80%E3%83%BC%E9%83%A1_(%E3%83%8D%E3%83%96%E3%83%A9%E3%82%B9%E3%82%AB%E5%B7%9E)","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1d/USA_Cedar_County%2C_Nebraska_age_pyramid.svg","page_title":"シーダー郡 (ネブラスカ州)","context_page_description":"シーダー郡は、アメリカ合衆国のネブラスカ州にある郡。2000年時点の人口は9,615人で、郡庁所在地はハーティントン 。\\nネブラスカ州のナンバープレートで、シーダー郡の車両は最初の数字が13になっている。これは1922年にナンバープレートの制度を確立した際、シーダー郡の車両登録台数が州内の郡のなかで13番目に多かったからである。"},{"page_url":"https://en.wikipedia.org/wiki/Daniel_Barenboim","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Barenboim_Vienna.jpg","page_title":"Daniel Barenboim","context_page_description":"Daniel Barenboim, KBE is a pianist and conductor who is a citizen of Argentina, Israel, Palestine, and Spain.\\nThe current general music director of the Berlin State Opera and the Staatskapelle Berlin, Barenboim previously served as Music Director of the Chicago Symphony Orchestra, the Orchestre de Paris and La Scala in Milan. Barenboim is known for his work with the West–Eastern Divan Orchestra, a Seville-based orchestra of young Arab and Israeli musicians, and as a resolute critic of the Israeli occupation of Palestinian territories.\\nBarenboim has received many awards and prizes, including seven Grammy awards, an honorary Knight Commander of the Order of the British Empire, France's Légion d'honneur both as a Commander and Grand Officier, and the German Großes Bundesverdienstkreuz mit Stern und Schulterband. Together with the Palestinian-American scholar Edward Said, he was given Spain's Prince of Asturias Concord Award. Barenboim is a polyglot, fluent in Spanish, Hebrew, English, French, Italian, and German. A self-described Spinozist, he is significantly influenced by Spinoza's life and thought."},{"page_url":"https://br.wikipedia.org/wiki/Feur-emglev_Rastatt","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Western_Europe_Utrecht_Treaty.jpg","page_title":"Feur-emglev Rastatt","context_page_description":"Feur-emglev Rastatt, sinet d'ar 6 a viz Meurzh 1714, en doa lakaet fin da Vrezel Hêrezh Spagn. Sinet e oa bet etre Rouantelezh Bro-C'hall hag Arc'hidugelezh Aostria war-lerc'h kendivizoù etre Eugène de Savoie-Carignan ha Claude-Louis-Hector de Villars, adalek miz Du 1713.\\nGant Aostria e chome an douaroù aloubet gant Bro-C'hall war lez dehoù ar Roen, evel Freiburg im Breisgau ha Kehl, an Izelvroioù Spagnol, Sardigna hag an douaroù eus Italia a oa stag ouzh Kurunenn Spagn diagent, evel dugelezh Milano, dugelezh Mantova ha rouantelezh Naplez.\\nBro-C'hall a ranke kuitaat an douaroù aloubet ganti war lez dehoù ar Roen, met derc'hel a rae kêr Landau, gant he c'hreñvlec'h. Bez' e oa Landau unan eus ar c'hêrioù eus Elzas a oa bet aloubet gant Loeiz XIV, ha staget ouzh Bro-C'hall gant Feur-emglev Westfalen e 1648.\\nSkrivet e oa bet Feur-emglev Rastatt e galleg, d'ur mare ma oa ar yezh-se en he barr evel yezh an darempredoù etrebroadel en Europa, tra ma veze implijet al latin a-raok."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9D%D0%B0%D1%85%D0%B8%D1%87%D0%B5%D0%B2%D0%B0%D0%BD%D1%8C-%D0%BD%D0%B0-%D0%94%D0%BE%D0%BD%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/%D0%9D%D0%B0%D1%85%D0%B8%D1%87%D0%B5%D0%B2%D0%B0%D0%BD%D1%8C_%D0%BD%D0%B0_%D0%94%D0%BE%D0%BD%D1%83_%D0%A6%D0%B5%D1%80%D0%BA%D0%BE%D0%B2%D1%8C_%D0%93%D1%80%D0%B8%D0%B3%D0%BE%D1%80%D0%B8%D1%8F_%D0%9F%D1%80%D0%BE%D1%81%D0%B2%D0%B5%D1%82%D0%B8%D1%82%D0%B5%D0%BB%D1%8F2.jpg","page_title":"Нахичевань-на-Дону","context_page_description":"Нахичева́нь-на-Дону́ — в прошлом город на правом берегу реки Дон, с 1929 года — часть Пролетарского района города Ростова-на-Дону. Был основан армянами, переселёнными из Крыма по указу Екатерины II от 14 ноября 1779 года."},{"page_url":"https://fi.wikipedia.org/wiki/Orangen_roomalainen_teatteri","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Orange_theatre_mur.JPG","page_title":"Orangen roomalainen teatteri","context_page_description":"Orangen roomalainen teatteri on eteläisen Ranskan Orangessa sijaitseva, ensimmäisen vuosisadan alussa rakennettu antiikkinen teatteri. Se kuuluu nykyään Orangen kunnalle, ja siellä järjestetään kesäisin oopperafestivaalit, Chorégies d'Orange. Orangen teatteri on yksi parhaiten säilyneitä roomalaisia teattereita."},{"page_url":"https://de.wikipedia.org/wiki/Voregg-Moosegg","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Salzachtal_Kuchl.JPG","page_title":"Voregg-Moosegg","context_page_description":"Voregg-Moosegg ist eine Streulage im Salzachtal im Land Salzburg wie auch Ortschaft und Katastralgemeinde Voregg der Gemeinde Scheffau am Tennengebirge im Bezirk Hallein."},{"page_url":"https://en.wikipedia.org/wiki/Walkaround","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Bryant%27s_Minstrels_walkaround_2.jpg","page_title":"Walkaround","context_page_description":"A walkaround was a dance from the blackface minstrel shows of the 19th century. The walkaround began in the 1840s as a dance for one performer, but by the 1850s, many dancers or the entire troupe participated. The walkaround often served as the finale to the first half of the minstrel show, the opening semicircle. Minstrels also wrote songs called \\"walkarounds\\", which were specifically intended for this dance; \\"Dixie\\" is probably the most famous example."},{"page_url":"https://et.wikipedia.org/wiki/L%C3%A4%C3%A4ne-Frangi_riik","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Vasconia_wide_740_3_-_80.jpg","page_title":"Lääne-Frangi riik","context_page_description":"Lääne-Frangi riik oli lühiealine kuningriik, mis hõlmas Karolingide impeeriumi lääneosa maad, mis läksid 843. aasta Verduni lepingu tulemusel Karl Suure pojapoja Charles II Paljaspea vaieldamatu kontrolli alla.\\nFrangi riik, Karl Suure poolt ühendatud riik, mis koosnes suurest osast Lääne-Euroopast, jagati pärast kolmeaastast kodusõda tema pojapoegade vahel. Nende vanaisa poolt asutatud frangi Karolingide impeerium kestis nende isa Ludwig Vaga kaudu ainult ühe põlvkonna. Tema riik, suur pärusvaldus, mis kattis enamuse Põhja-Itaaliast, Prantsusmaa, Madalmaad, Šveitsi ja enamuse tänapäeva Austriast ja Saksamaast, jagati pärast mõningaid vähese mõjuga kokkupõrkeid Ida-Frangi riigiks, Lääne-Frangi riigiks ja Kesk-Frangi riigiks.\\n\\"Lääne-Frangi riigi\\" muutumist \\"Prantsusmaaks\\" ei saa kinnitada ühegi kindla kuupäevaga, vaid esitatakse järkjärgulise arenguga varakeskaegsest feodaalmaast moodsaks rahvusriigiks."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%BA%94%EC%9E%90%EC%8A%A4_(%EB%B0%B4%EB%93%9C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Kansas_band_members_2016.jpg","page_title":"캔자스 (밴드)","context_page_description":"캔자스는 1970년대 음반 위주의 록 차트에서 인기를 끌었던 미국의 록 밴드다. 이후 〈Carry On Wayward Son〉, 〈Dust in the Wind〉와 같은 히트 싱글로 인기를 끌었다."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%B0%96%E8%9B%BA%E8%9D%B6%E5%B1%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Memphis_pithyusa.jpg","page_title":"尖蛺蝶屬","context_page_description":"尖蛺蝶屬是蛺蝶科螯蛺蝶亞科安蛺蝶族中的一個屬。共有61個物種，分布於新熱帶界。成蟲翅膀外型酷似枯葉。"},{"page_url":"https://fr.wikipedia.org/wiki/Aeroporto_(m%C3%A9tro_de_Lisbonne)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Agostinho_da_Silva_at_Aeroporto_metro_station%2C_Lisbon.jpg","page_title":"Aeroporto (métro de Lisbonne)","context_page_description":"Aeroporto est une station du métro de Lisbonne située sur la ligne rouge. Elle dessert l'aéroport international de Lisbonne.\\nLa station est décorée d'une cinquantaine de caricatures d'António Moreira Antunes représentant des personnalités portugaises, principalement du XXᵉ siècle."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%96%D0%B8%D1%80%D0%B8%D0%B2%D0%B8%D0%BB%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Giriviller%2C_Mairie.jpg","page_title":"Жиривиле","context_page_description":"Жиривиле насеље је и општина у североисточној Француској у региону Лорена, у департману Мерт и Мозел која припада префектури Линевил.\\nПо подацима из 2011. године у општини је живело 79 становника, а густина насељености је износила 10,25 становника/km². Општина се простире на површини од 7,71 km². Налази се на средњој надморској висини од 310 метара."},{"page_url":"https://eu.wikipedia.org/wiki/Aubign%C3%A9-sur-Layon","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/EgliseStDenis5.JPG","page_title":"Aubigné-sur-Layon","context_page_description":"Aubigné-sur-Layon Frantziako udalerria da, Maine-et-Loire departamenduan dagoena, Pays de la Loire eskualdean. 2013an 357 biztanle zituen."},{"page_url":"https://kn.wikipedia.org/wiki/%E0%B2%9C%E0%B2%BF%E0%B2%82%E0%B2%95%E0%B3%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Huemul.jpg","page_title":"ಜಿಂಕೆ","context_page_description":"ಜಿಂಕೆ ಸಸ್ತನಿ ವರ್ಗಕ್ಕೆ ಸೇರಿದ ಪ್ರಾಣಿ. ಹೆಣ್ಣು ಜಿಂಕೆಯನ್ನು ಹರಿಣಿ ಎಂದು, ಗಂಡು ಜಿಂಕೆಯನ್ನು ಸಾರಂಗ ಎಂದು ಕರೆಯುತ್ತಾರೆ. ಗಂಡು ಜಿಂಕೆಗಳು ಪ್ರತಿ ವರ್ಷವೂ ತನ್ನ ಕೋಡುಗಳನ್ನು ಬಿಳಿಸಿ ಅದೇ ಜಾಗದಲ್ಲಿ ಹೊಸ ಕೋಡು ಒಡಮೂಡಲು ಅನುವು ಮಾಡಿಕೊಡುತ್ತದೆ."},{"page_url":"https://eu.wikipedia.org/wiki/Crotalus_stephensi","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Crotalus-mitchelli-stephensi.jpg","page_title":"Crotalus stephensi","context_page_description":"Crotalus stephensi Crotalus generoko animalia da. Narrastien barruko Viperidae familian sailkatuta dago."},{"page_url":"https://en.wikipedia.org/wiki/Wat_Bowonniwet_Vihara","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b9/Phratamnakphetwbowon05.jpg","page_title":"Wat Bowonniwet Vihara","context_page_description":"Wat Pavaranivesh Vihara Ratchawarawihan is a major Buddhist temple in Phra Nakhon district, Bangkok, Thailand. Being the residence of Nyanasamvara Suvaddhana; the late Supreme Patriarch of Thailand, it is the final resting place of two former kings of Chakri Dynasty; King Vajiravudh Rama VI and King Bhumibol Adulyadej Rama IX.\\nThe temple is a center of the Thammayut Nikaya order of Thai Theravada Buddhism, it is the shrine-hall of Phra Phuttha Chinnasi, a statue of the Buddha which dates to around 1357. Bowonniwet has been a major temple of patronage for the ruling Chakri dynasty. It is where many royal princes and kings studied and served their monkhood, including King Bhumibol and his son, the present king Vajiralongkorn."},{"page_url":"https://sh.wikipedia.org/wiki/Z%C3%B6llnitz","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Wappen_Zoellnitz.png","page_title":"Zöllnitz","context_page_description":"Celnic je opština u njemačkoj saveznoj državi Tiringija. Jedno je od 93 opštinska središta okruga Zale-Holcland. Prema procjeni iz 2010. u opštini je živjelo 728 stanovnika. Posjeduje regionalnu šifru 16074114."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A1%D0%BF%D1%96%D1%81_%D1%84%D1%96%D0%BD%D0%B0%D0%BB%D0%B0%D1%9E_%D1%87%D1%8D%D0%BC%D0%BF%D1%96%D1%8F%D0%BD%D0%B0%D1%82%D0%B0%D1%9E_%D1%81%D0%B2%D0%B5%D1%82%D1%83_%D0%BF%D0%B0_%D1%81%D0%BD%D1%83%D0%BA%D0%B5%D1%80%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Stuart_Bingham_at_Snooker_German_Masters_%28DerHexer%29_2015-02-05_02.jpg","page_title":"Спіс фіналаў чэмпіянатаў свету па снукеры","context_page_description":"Чэмпіянат свету па снукеры — найбуйнейшы і найстарэйшы прафесійны рэйтынгавы турнір па снукеры, які быў заснаваны ў 1927 годзе. Турнір праходзіць на працягу 17 дзён у канцы красавіка і пачатку мая і ў храналагічным сэнсе з'яўляецца трэцім турнірам трайной снукернай кароны з сезона 1977/1978, калі ў календары з'явіўся чэмпіянат Вялікабрытаніі. Чэмпіянат свету не праводзіўся з 1941 па 1945 гады ў сувязі з Другой сусветнай вайной і з 1958 па 1963 гады ў сувязі з зніжэннем цікавасці да гэтага віда спорту. Спаборніцтва праходзіла ў розных гарадах Англіі, а таксама на востраве Джэрсі, у Паўднёва-Афрыканскай Рэспубліцы і ў Аўстраліі да таго як у 1977 годзе не пераехала ў тэатр Крусібл у Шэфілдзе, дзе з таго часу праводзіцца штогод. Кіруючым органам, які ў цяперашні час арганізуе гэтае мерапрыемства з'яўляецца сусветная асацыяцыя прафесійнага більярда і снукера. Да таго, як WPBSA узяла кантроль над прафесійным снукерам у 1968 годзе, чэмпіянат свету арганізоўвала асацыяцыя і кіруючы савет більярда, за выключэннем шасці гадоў, калі пасля спрэчкі з арганізацыяй гульцы арганізавалі сваю замену чэмпіянату — Professional Matchplay Championship."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B6%D9%87%D9%88%D8%B1_%D8%A7%D9%84%D8%B4%D9%88%D9%8A%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Dhour_El_Choueir_road_-_1947.png","page_title":"ضهور الشوير","context_page_description":"مصيف الشوير وضهورها في قضاء المتن على متوسّط ارتفاع 1250م عن سطح البحر، وعلى مسافة 27 كم عن بيروت عبر بكفيّا-الدوّار؛ أو بكفيّا-الزغرين-عين القسّيس أو المطلّ المعروف أيضاً بمنطقة دير مار الياس؛ أو الزغرين-عين التفاحة-عين الحانوت. ويتّصل بزحلة عبر غابة بولونيا-عينطورة؛ وبصوفر عبر غابة بولونيا-المتين –حمّانا. يشرف على جبل صنين وكسروان شمالاً وجبل الكْنَيْسِة شرقاً ووادي المتن وجبال صوفر جنوباً ويطلّ على البحر غرباً. ويتشكّل التجمع السكني في منطقتين: الشوير، وهي البلدة القديمة، وضهور الشوير وهي المصيف الحديث القائم على إحدى روابي الشوير. تحيط بمنازل البلدة غابات الصنوبر المثمر وسائر الأحراج البريّة. وُجدت في راضي الشوير بقايا أعمدة لمعابد وثنيّة. كما وُجدت بقايا أثريّة في منطقة \\"سبرطة\\" القريبة من الشوير عند تخوم بتغرين. وفي منطقة المطلّ وكنيسة السيّدة في الشوير أبنية أثريّة حيث منطقة تُعرف باسم البرج نسبة إلى برج بيزنطي. وثمّة آثار لمعبد يونانيّ في محلّة عين الحانوت، حيث وجد الزارعون قطعاً فخاريّة في التراب، ويرجّح أن يكون المعبد تحت البيدر. فيها: كنيسة السيدة-الشوير: كنيسة قديمة صنّفتها مديريّة الآثار من الأبنية الأثرية كنيسة المخلّص-الظهور؛ كنيسة مار بطرس للروم الكاثوليك-الشوير؛ كنيسة مار جرجس للروم الأرثوذكس؛ كنيسة مار الياس؛ كنيسة مار عبدا للموارنة."},{"page_url":"https://en.wikipedia.org/wiki/Gohonzon","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Amida_Nyorai.jpg","page_title":"Gohonzon","context_page_description":"Gohonzon is a generic term for a venerated religious object in Japanese Buddhism. It may take the form of a scroll or statuary. In Nichiren Buddhism, it refers to the hanging calligraphic paper mandala inscribed by Nichiren to which devotional chanting is directed.\\nLinguistically, the root \\"honzon\\" signifies a main object of devotion or worship and \\"go\\" is an honorific prefix. Nichiren groups translate \\"Gohonzon\\" different ways: \\"object of devotion\\", \\"object of worship\\", or \\"Supreme Venerable\\". It has also been translated as \\"the Great Mandala\\".\\nPaper scroll Gohonzon are sometimes known as Kakejiku Gohonzon or moji-mandara. Butsuzo Gohonzon are statuary. The Gohonzon is often enshrined within a butsudan."},{"page_url":"https://pl.wikipedia.org/wiki/Pedro_Moren%C3%A9s","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Pedro_Morenes_September_2012_crop.jpg","page_title":"Pedro Morenés","context_page_description":"Pedro de Morenés y Álvarez de Eulate – hiszpański prawnik, menedżer i polityk, sekretarz stanu w różnych resortach, od 2011 do 2016 minister obrony."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9D%CF%8C%CE%B2%CE%B9_%CE%A0%CE%AC%CE%B6%CE%B1%CF%81_(%CE%A3%CE%B5%CF%81%CE%B2%CE%AF%CE%B1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Municipalities_of_Serbia_Novi_Pazar.png","page_title":"Νόβι Πάζαρ (Σερβία)","context_page_description":"Το Νόβι Πάζαρ είναι ένας δήμος που βρίσκεται στην περιοχή Raška της Σερβίας, στη γεωγραφική περιοχή Sandžak. Σύμφωνα με την επίσημη απογραφή του 1991, ο δήμος Νόβι Πάζαρ είχε 85.249 κατοίκους, ενώ στην απογραφή του 2002 ο αριθμός κατοίκων του δήμου ήταν 85.996. Η ίδια η πόλη είχε πληθυσμό 54.604 κατοίκων το 2002."},{"page_url":"https://de.wikipedia.org/wiki/R%C3%BCstringer_Stadtpark","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0c/Jade-Hochschule%2C_Wilhelmshaven.jpg","page_title":"Rüstringer Stadtpark","context_page_description":"Der Rüstringer Stadtpark ist ein Stadtteil von Wilhelmshaven. Er besteht nicht nur aus dem namensgebenden Park, sondern auch aus dessen Umgebung, insbesondere der Jade Hochschule, Sportanlagen, Schulen und Kleingärten. Wohnbevölkerung gibt es in diesem Stadtteil kaum."},{"page_url":"https://fr.wikipedia.org/wiki/Cocktail_officiel_de_l%27IBA","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Mary_Pickford_Cocktail.jpg","page_title":"Cocktail officiel de l'IBA","context_page_description":"Un cocktail officiel de l'IBA est un cocktail sélectionné par l'International Bartenders Association pour le concours mondial de cocktail. Ces mélanges sont ainsi parmi les plus notables et les plus fréquents des cocktails qu'on peut trouver à travers le monde.\\nLes cocktails de l'IBA sont mesurés en centilitres au lieu des millilitres habituellement utilisés."},{"page_url":"https://cs.wikipedia.org/wiki/Anne_Bront%C3%ABov%C3%A1","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8e/Anne_Bronte.jpg","page_title":"Anne Brontëová","context_page_description":"Anne Brontëová byla anglická spisovatelka, nejmladší z pěti sester Brontëových. Ve svých dílech se zaměřila především na zobrazování strastiplných osudů žen."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%86%D9%88%D8%AD_%D9%88%D8%A8%D8%B3%D8%AA%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Portrait_of_Noah_Webster.jpg","page_title":"نوح وبستر","context_page_description":"نوح وبستر ‏ هو عالم لغوي أمريكي.\\nأثارته الرغبة في وضع معيار للنحو والتهجي الأمريكيين، فألف كتاب «معهد اللغة الإنجليزية لقواعد النحو والصرف»، وأصبح الجزء الأول منه ـ الذي نقح مراراً ـ كتاباً مدرسياً في التعليم الأمريكي. كتابه الأخير «القاموس الموجز» 1806 سبق كتابه «قاموس اللغة الإنجليزية الأمريكي» 1828، ويعرف حاليا باسم مريام وبستر وهو الذي في طبعاته الكثيرة ـ المنقحة حتى الوقت الحاضر ـ قد جعل من اسم وبستر كلمة شائعة تعني القاموس المعياري، وكان وبستر يأمل أن يؤدي عمله إلى ترقية المعاني الأخلاقية والوطنية، فضلاً على ترقية اللغة. وقد دافع عن أمور كثيرة، مثل حملته العنيفة من أجل قانون حق التأليف.\\nناضل من أجل إقامة حكومة مركزية في وقت صياغة مواد الاتحاد، وبخاصة في كتابه «تخطيط للسياسة الأمريكية» 1785. أيد سياسة واشنطن فيما بعد، بوصفه محرراً صحفياً. أما تأثير عمله خلال حياته الطويلة فأمر يصعب حسبانه."},{"page_url":"https://de.wikipedia.org/wiki/Helmut_Qualtinger","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Qualtinger_Gedenktafel_Wien_1010.JPG","page_title":"Helmut Qualtinger","context_page_description":"Helmut Gustav Friedrich Qualtinger war ein österreichischer Schauspieler, Schriftsteller, Kabarettist und Rezitator."},{"page_url":"https://pt.wikipedia.org/wiki/Guru_Har_Krishan","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/History_of_Gurudwara_Panjokhra_Sahib%2C_Haryana_01.jpg","page_title":"Guru Har Krishan","context_page_description":"Guru Har Krishan foi o oitavo dos dez Gurus siques humanos. Aos cinco anos de idade tornou-se o guru mais jovem do siquismo em 7 de outubro de 1661, sucedendo seu pai, Guru Har Rai, o sétimo guru sique.\\nEle também é conhecido como Bal Guru. Ele morreu aos sete anos de idade durante uma epidemia de varíola em Délhi e seu tio-avô, Guru Tegh Bahadur, tornou-se seu sucessor como guru sique. O Guru Har Krishan foi quem deteve a função de guru por menos tempo: somente dois anos, cinco meses e 24 dias."},{"page_url":"https://en.wikipedia.org/wiki/List_of_shipwrecks_in_the_1720s","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Public_House_Sign%2C_Walmer%2C_UK%2C_The_Stag.png","page_title":"List of shipwrecks in the 1720s","context_page_description":"The List of shipwrecks in the 1720s includes some ships sunk, wrecked or otherwise lost during the 1720s."},{"page_url":"https://vec.wikipedia.org/wiki/A%C5%82esandria","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Alessandria_piazzaduomo.jpg","page_title":"Ałesandria","context_page_description":"Ałesandria el xe on comun n'te la provincia de Ałesandria chel fa parte de la rejon Piemonte"},{"page_url":"https://sk.wikipedia.org/wiki/Ikarus_415","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cd/Ikarus_415_ba.jpg","page_title":"Ikarus 415","context_page_description":"Ikarus 415 je vysokopodlažný autobus radu 400. Ten mal nahradiť zastaraný rad 200. Už v 70. rokoch sa začal vyvíjať nový rad mestských a prímestských autobusov. V roku 1978 bol skonštruovaný prvý prototyp tohto radu - Ikarus 410 NE. Konštrukčne bol podobný Ikarusu 415, odlišoval dizajnom a rozmermi. Po tomto prototype bolo vyrobených ešte niekoľko skúšobných autobusov rôznych označení. Až v roku 1984 bol vyrobený prototyp označený ako Ikarus 415. Po zahájení sériovej výroby došlo pri verzii 415.10 v roku 1992 k zmene predného čela a zadných dverí. Smerové svetlá boli oddelené od stretávacích a zaoblené, predné sklo bolo delené. Zadné dvere sa zmenšili na jednoprúdové."},{"page_url":"https://sl.wikipedia.org/wiki/Miran_Krmelj","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Miran_Krmelj.jpg","page_title":"Miran Krmelj","context_page_description":"Miran Krmelj, slovenski hokejist, * 23. februar 1941, Jesenice, † 2. marec 2009, Zagreb.\\nKrmelj je bil dolgoletni igralec hrvaškega kluba KHL Medveščak. Za reprezentanco Jugoslavije je igral na zimskih olimpijskih igrah v Innsbrucku leta 1964."},{"page_url":"https://fr.wikipedia.org/wiki/Cristovao_de_Figueiredo","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Crist%C3%B3v%C3%A3o_de_Figueiredo_-_Ecce_Homo.jpg","page_title":"Cristovao de Figueiredo","context_page_description":"Cristóvão de Figueiredo est un peintre portugais de la Renaissance.\\nComme de nombreux autres peintres importants de son époque, il fut l'élève du maître Jorge Afonso à Lisbonne au XVIᵉ siècle. Il travailla ensuite avec Francisco Henriques, Garcia Fernandes et Gregório Lopes à la réalisation de plusieurs retables de la ville.\\nEntre 1522 et 1533, il travailla au Monastère de la Sainte-Croix de Coïmbre et en 1533, il rejoignit à nouveau Garcia Fernandes et Gregório Lopes pour travailler à des retables pour le monastère de Ferreirim, près de Lamego.\\nBeaucoup de ses œuvres sont maintenant conservées au musée national d’Art ancien de Lisbonne et au musée Machado de Castro à Coimbra."},{"page_url":"https://pt.wikipedia.org/wiki/N%C3%B3_de_forca","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/11/Hangmans_Noose_Final.jpg","page_title":"Nó de forca","context_page_description":"Nó utilizado muitas vezes na história para enforcamentos. Ao contrário do que muitas pessoas pensam, o enforcamento com o uso deste nó tem como objetivo o destroncamento da coluna cervical e, por conseguinte, a ruptura de seu sistema nervoso e não o simples estrangulamento. A parte rígida deste nó, composto normalmente por 7 espiras apertadas em torno da própria corda, serve como alavanca, promovendo uma morte indolor e evitando que esta ocorra pelo sufocamento do condenado. No momento da execução, esta \\"haste\\" deve estar posicionada no pescoço do condenado, próximo a glote de forma que sua outra extremidade seja apontada em direção ao solo. Desta forma, no momento da queda, o nó tende a girar para cima, em direção a nuca do condenado, promovendo a torção necessária para que a execução ocorra com sucesso."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Burgen,_Befestigungen_und_Schl%C3%B6sser_in_der_Eifel","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Schloss_Thor%2C_Astenet_-_Torhaus.JPG","page_title":"Liste der Burgen, Befestigungen und Schlösser in der Eifel","context_page_description":"Aufgelistet sind Burgen, Befestigungen und Schlösser in der Eifel, zeitlich angefangen bei den Kelten bis in die Frühe Neuzeit. Die Liste führt Anlagen im Gebiet des Städtevierecks Aachen, Bonn, Koblenz und Trier – etwas ins Luxemburgische und Belgische hineinreichend – auf. Nicht aufgeführt sind Zier- und Nachbauten, die nie als Wohngebäude oder zur Verteidigung genutzt wurden."},{"page_url":"https://de.wikipedia.org/wiki/Roland_(Waffensystem)","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/04/Roland_%C3%9CKR.JPG","page_title":"Roland (Waffensystem)","context_page_description":"Das Waffensystem Roland ist ein in den 1970er-Jahren in deutsch-französischer Kooperation entwickeltes, allwetterfähiges, autonomes und ECM-resistentes Flugabwehrraketensystem zur Bekämpfung tief- und tiefstfliegender Luftfahrzeuge."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%B0%D0%BD%D0%BB%D1%83%D0%BA%D0%B0%D1%80-%D0%B4%D0%B5-%D0%91%D0%B0%D1%80%D1%80%D0%B0%D0%BC%D0%B5%D0%B4%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Sanlucar_barrameda_castillo_santiago2.jpg","page_title":"Санлукар-де-Баррамеда","context_page_description":"Санлукар-де-Баррамеда — муніципалітет в Іспанії, у складі автономної спільноти Андалусія, у провінції Кадіс. Населення — 66 541 особа.\\nМуніципалітет розташований на відстані близько 470 км на південний захід від Мадрида, 27 км на північ від Кадіса.\\nНа території муніципалітету розташовані такі населені пункти:\\nЛа-Альгайда: 3121 особа\\nБонанса: 10260 осіб\\nЛа-Хара: 4329 осіб\\nМірафлорес: 341 особа\\nПастрана: 2316 осіб\\nСанлукар-де-Баррамеда: 46174 особи"},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B6%D5%A1%D6%80%D5%A4%D5%A5%D5%B6%D5%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Cosmos_bipinnatus-2.jpg","page_title":"Զարդենի","context_page_description":"Զարդենի պատկանում է բարդածաղկավորների ընտանիքին։ Հայրենիքը Մեքսիկան է։"},{"page_url":"https://eu.wikipedia.org/wiki/Nuevo_(Kalifornia)","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2d/Nuevohills.jpg","page_title":"Nuevo (Kalifornia)","context_page_description":"Nuevo Ameriketako Estatu Batuetako erroldak esleitutako leku bat da. Riverside konderrian kokatuta dago, Kalifornia estatuan. 6.447 biztanle ditu, 17,538031 kilometro koadroko azaleran banatuta."},{"page_url":"https://en.wikipedia.org/wiki/Locality_(linguistics)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Which_students_did_a_picture_of_appear_in_the_newspapers%3F.png","page_title":"Locality (linguistics)","context_page_description":"In linguistics, locality refers to the proximity of elements in a linguistic structure. Constraints on locality limit the span over which rules can apply to a particular structure. Theories of transformational grammar use syntactic locality constraints to explain restrictions on argument selection, syntactic binding, and syntactic movement."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AA%D8%A7%D8%BA%D9%8A%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/%D8%A7%D9%84%D8%B9%D9%84%D8%A7%D8%AC_%D8%A8%D8%A7%D9%84%D8%B1%D9%85%D9%84.jpg","page_title":"تاغيت","context_page_description":"تاغيت أو تاغيلت مدينة وبلدية تابعة إقليميا إلى دائرة تاغيت ولاية بشار الجزائرية."},{"page_url":"https://eu.wikipedia.org/wiki/Ignazio_Orbegozo","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Agi%C3%B1eta-arriya1942.jpg","page_title":"Ignazio Orbegozo","context_page_description":"Ignazio Orbegozo Juaristi, ezizenez Arriya eta Arria I.a aizkolaria izan zen.\\nAzpeitiko Arria baserrian sortu zen. Gorputz gaitasun ezin hobea zuen, baino askotan ez zen egoki prestatzen. Dena dela, ongi entrenatzen zelarik, aurkari gogorra izaten zen edonorentzat. 1935eko maiatzaren 12an Jeronimo Iturbe Agiñeta hiru segundoz garaitu zuen Tolosan, 72 ontzako seina enbor moztera jokatutako apustuan.\\nEspainiako Gerraren ostean ere apustu sonatuak jokatu zituen. 1948ko ekainaren 6an Azpeitiko zezen plaza mukuru bete zen Antonio Soraluze Kortaren aurkako apustua ikusteko. Bakoitzak 60 ontzako zortzi enbor eta 36 ontzako 30 enbor ebaki behar zituen. Arriak ordu bat, 40 minutu eta 44 segundotan bukatu zuen lana eta Korta erretiratu zen. 1949ko abenduaren 18an, berriz, Martin Garziarena gaztearen aurkako apustua galdu zuen. Leitzarrak ordu bat, 17 minutu eta 57 segundotan egin zuen lana eta Arriak ez zuen amaitu. 1950eko txapelketa nagusian parte hartu zuen. 1952an utzi zuen aizkora."},{"page_url":"https://pl.wikipedia.org/wiki/Azrieli_Center_Circular_Tower","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Azriely_Center_17.JPG","page_title":"Azrieli Center Circular Tower","context_page_description":"Azrieli Center Circular Tower – biurowiec w osiedlu Ha-Kirja we wschodniej części miasta Tel Awiw, w Izraelu. Przez trzy lata był to najwyższy budynek w Izraelu."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1903","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Fernandel_14-03-1970_-_53Fi2541_crop_1.jpg","page_title":"Lijst van personen geboren in 1903","context_page_description":"Dit is een lijst van personen die geboren zijn in 1903.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://fr.wikipedia.org/wiki/Rue_de_Longchamp","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/P1030801_Paris_XVI_rue_de_Longchamp_rwk.JPG","page_title":"Rue de Longchamp","context_page_description":"La rue de Longchamp est une voie du 16ᵉ arrondissement de Paris, en France,"},{"page_url":"https://be.wikipedia.org/wiki/%D0%90%D0%BD%D1%80%D1%8B_%D0%9B%D1%83%D1%96_%D0%9B%D0%B5_%D0%A8%D0%B0%D1%82%D1%8D%D0%BB%D1%8C%D0%B5","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a6/Lechatelier.jpg","page_title":"Анры Луі Ле Шатэлье","context_page_description":"Анры́ Луі́ Ле Шатэлье́ — французскі фізікахімік і металазнавец, адзін з заснавальнікаў металазнаўства.\\nЧлен Парыжскай АН. Ганаровы член АН СССР. Прафесар Парыжскай вышэйшай горнай школы, Калеж дэ Франс і Парыжскага ўніверсітэта. Прэзідэнт Французскага хімічнага таварыства."},{"page_url":"https://tt.wikipedia.org/wiki/%D0%92%D0%B0%D1%8F%D0%BD%D0%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Wayang_Pandawa.jpg","page_title":"Ваянг","context_page_description":"Ваянг, шулай ук ваджанг буларак мәгълүм, бу Индонезиядә, Яваның оригиналь мәдәниятләрендә булган традицион курчак театры формасы. Бу Индонезиядә һәм Көньяк-Көнчыгыш Азиянең башка\\nтөбәкләрендә булган традицион курчак тамашасы, биредә\\nдраматик кыйсса курчакларга ташланган күләгәләр аша сөйләнелә һәм кайвакыт кеше\\nперсонажлары да кулланыла. Сәнгать формасы Индонезия мәдәниятен һәм\\nсәнгать сәләтен тәбрикли; аның килеп чыгышы урта гасырларда Һинд диненең\\nтаралуына һәм көньяк Һиндстаннан килгән тһалубомалата сәнгатеннән килеп\\nчыккан.\\nВаянг тулаем драма манзарасына карый. Кайвакыт күн курчакларын үзен Ваянг дип атыйлар .Күләгә курчаклары театрына аккомпанемент булып Явадагамелан оркестры һәм Балида Гендер ваянг булып тора. Драматик\\nкыйссалар риваятьләрне сурәтлиләр, мәсьәлән, Рамаяна һәм Маһабһаратамнан\\nэпизодлар, һәм шулай ук мәдәни риваятьләрдән асаба адаптацияләр. Традицион рәвештә, Ваянг сәнгать әһеле һәм рухи\\nҗитәкче “даланг” тарафыннан ритуаль төннән-таң атуга кадәр тамашасында\\nбашкарыла; тамашачылар пьесаны экранның ике ягыннан да карыйлар.\\nЮНЕСКО киңрәк “Ваянг” буларак мәгълүм булган Ваянг кулит күләгә курчак театрын 2003 елның 7\\nноябрендә [[Кешелекнең Сөйләм һәм Матди булмаган"},{"page_url":"https://it.wikipedia.org/wiki/Santuario_della_Madonna_del_Pilastrello_(Crema)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Madonna-pilastrello-1.jpg","page_title":"Santuario della Madonna del Pilastrello (Crema)","context_page_description":"Il santuario della Madonna del Pilastrello, detto anche Santuario della Carità, è un piccolo luogo di culto che sorge nel quartiere Sabbioni a Crema."},{"page_url":"https://lmo.wikipedia.org/wiki/Red_di_tram_de_Palermo","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Il_tram_di_Palermo_in_servizio_in_via_Leonardo_da_Vinci_3.jpg","page_title":"Red di tram de Palermo","context_page_description":"La red di tram de Palermo a l'è on servizzi de straport publich su rodaia faa de 4 lign e de 44 fermaa che quatten Palermo. A l'è verta dal 2015.\\nA l'è gestii de AMAT e l'è in progett la creazion de alter 3 lign."},{"page_url":"https://en.wikipedia.org/wiki/Bakklandet","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Old_town_trondheim.jpg","page_title":"Bakklandet","context_page_description":"Bakklandet is a neighborhood in the city of Trondheim in Trøndelag county, Norway. It lies in the borough of Østbyen on the east side of the Nidelva river between the Bakke Bridge and the Old Town Bridge.\\nThe neighborhood is dominated by small, wooden houses and narrow streets. It is among the major tourist attractions in the city.\\nIn 1965, the road plan for Trondheim proposed that a large area in Bakklandet be demolished to make way for a four-lane motorway which would connect the road \\"Elgeseter gate\\" with the road \\"Innherredsveien\\". The plans were met by opposition from locals, and by the early 1980s the plan was shelved, even thought the city's environmental council had approved depopulating the neighborhood in 1974."},{"page_url":"https://hu.wikipedia.org/wiki/P%C3%A9csi_zsinag%C3%B3ga","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/P%C3%A9cs_Gro%C3%9Fe_Synagoge_Innen_Bogen_2.JPG","page_title":"Pécsi zsinagóga","context_page_description":"A pécsi zsinagóga Pécs egyetlen izraelita vallású zsinagógája, ami 1868–69-ben épült Feszl Frigyes, Gerster Károly és Kauser Lipót tervei alapján romantikus stílusban. A Kossuth téren álló épület felújítása 1980 óta is tart."},{"page_url":"https://hu.wikipedia.org/wiki/Barcelona%E2%80%93Ripoll-vas%C3%BAtvonal","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/165_Estaci%C3%B3_de_ferrocarril_de_la_Garriga.JPG","page_title":"Barcelona–Ripoll-vasútvonal","context_page_description":"A Barcelona–Ripoll-vasútvonal ismert még mint Sant Martí de Provençals - Sant Joan de les Abadesses-vasútvonal egy 1668 mm-es nyomtávolságú, 3000 V egyenárammal villamosított vasútvonal Spanyolországban Barcelona és Ripoll között, áthaladva Granollers és Vich városokon. A vonatok engedélyezett legnagyobb sebessége 140 km/h.\\nEzt a vonalat a szénszállításhoz építették, hogy San Juan de las Abadesas bányáiból a barcelonai tengerparti iparterületig vezessen. Három évtizedes sikertelen tervek után végül 1880-ban San Juan de las Abadesas vasúttársaság és bányavállalat építette meg a vasutat a város és Granollers között, ahol kapcsolódott a Barcelona–Girona–Portbou-vasútvonalhoz, amely lehetővé tette a vonatok számára Barcelona elérését."},{"page_url":"https://en.wikipedia.org/wiki/Timeline_of_Tabriz","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d2/Housing_a_Khan_by_Eug%C3%A8ne_Flandin.jpg","page_title":"Timeline of Tabriz","context_page_description":"The following is a timeline of the history of the city of Tabriz, capital of East Azerbaijan Province in Iran."},{"page_url":"https://hu.wikipedia.org/wiki/Fischbachtal","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Schloss_Lichtenberg_Blick_vom_Bollwerk.jpg","page_title":"Fischbachtal","context_page_description":"Fischbachtal település Németországban, Hessen tartományban. Lakosainak száma 2664 fő. +/-"},{"page_url":"https://hy.wikipedia.org/wiki/%D5%96%D6%80%D5%A5%D5%B6%D5%BD%D5%AB%D5%BD_%D5%88%D6%82%D5%AB%D5%AC%D5%B5%D5%A1%D5%B4_%D4%B1%D5%BD%D5%BF%D5%B8%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Francis_William_Aston.jpg","page_title":"Ֆրենսիս Ուիլյամ Աստոն","context_page_description":"Ֆրենսիս Ուիլյամ Աստոն, անգլիացի ֆիզիկոս։ Լոնդոնի թագավորական ընկերության անդամ, ԽՍՀՄ ԳԱ թղթակից անդամ ։"},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A7%D9%88%D9%84%D8%AA%D9%86%DB%8C%D8%AA%D8%B3%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Oltenita_centru.JPG","page_title":"اولتنیتسا","context_page_description":"اولتنیتسا - رومانیانین شهرلریندن بیریدیر. بۇ شهرین نۆفوسو، 2011-جی ایلين نۆفوس ساییمی اساسيندا 24822 نفر ایمیش بۇ شهر کالاراشی بؤلگه سینده یئرلشیب. و 15 متر دنیز سئویه سیندن اۇجالیقی وار."},{"page_url":"https://ca.wikipedia.org/wiki/Premi_Sant_Jordi_a_la_millor_pel%C2%B7l%C3%ADcula_espanyola","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Pedro_Almod%C3%B3var_1988.jpg","page_title":"Premi Sant Jordi a la millor pel·lícula espanyola","context_page_description":"En 1957, Ràdio Nacional d'Espanya va començar a concedir anualment els Premis Sant Jordi de Cinematografia —anys més tard rebatejats com «Sant Jordi»— per a reconèixer la qualitat del cinema espanyol i internacional i dels professionals que el fan possible. Des de la seva primera edició ve lliurant el que potser és el més important d'aquests guardons, el Premi San Jorge a la millor pel·lícula espanyola, més tard denominat Premi Sant Jordi a la millor pel·lícula espanyola. El premi és atorgat per un jurat compost per crítics de cinema pertanyents als mitjans de comunicació presents a Barcelona, per la qual cosa és considerat com un premi de la crítica d'aquesta ciutat. Va ser impulsat pels crítics de RNE Jordi Torras i Esteve Bassols. Consisteix en una simple estatueta i no comporta dotació econòmica.\\nA continuació es llisten les pel·lícules que han rebut aquest trofeu. A l'esquerra s'indica l'any de concessió del premi i a la dreta el nom del director de la pel·lícula."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%BB%D0%B0%D0%B4%D0%B5%D0%BD%D0%B5%D1%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Baby_playing_-_by_Patrick_Jayne_and_Thomas.jpg","page_title":"Младенец","context_page_description":"Младе́нец, грудной ребёнок — ребёнок в возрасте от рождения до года. Различают период новорожденности и грудной возраст. Развитие грудного ребёнка оказывает решающее влияние на его дальнейшее умственное и физическое развитие. Его организм неустойчив ко внешним воздействиям, восприимчив к заболеваниям, поэтому ему необходим наиболее тщательный уход.\\nГрудной возраст характеризуется особенно интенсивным ростом и развитием. В возрасте от одного до трёх месяцев рост ребёнка увеличивается ежемесячно на 3 см; в 4—6 месяцев — на 2,5 см, в 7—9 месяцев — на 1,5—2 см, в 10—12 месяцев — на 1 см. За первый год жизни рост ребёнка увеличивается в среднем в 1,5 раза, достигая 75 см, масса тела увеличивается в среднем в 3 раза, достигая 10 кг."},{"page_url":"https://gl.wikipedia.org/wiki/Xestosa,_To%C3%A9n","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Igrexa_Xestosa%2C_To%C3%A9n.jpg","page_title":"Xestosa, Toén","context_page_description":"Santa María de Xestosa é unha parroquia do concello ourensán de Toén na comarca de Ourense. No ano 2007 tiña 143 habitantes nunha soa entidade de poboación, o que supón unha diminución de 13 habitantes en relación ao ano 2000."},{"page_url":"https://en.wikipedia.org/wiki/Li_Xiangning","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Photos_%E2%80%93_Junior_World_Championships_2017_%E2%80%93_Ladies_Xiangning_LI_CHN_%E2%80%93_11th_Place_%283%29.jpg","page_title":"Li Xiangning","context_page_description":"Li Xiangning is a Chinese figure skater. She is the 2018 Cup of Nice silver medalist. the 2018 Chinese national champion, and a two-time Chinese national silver medalist.\\nOn the junior level, she is the 2016 Youth Olympic champion in the team event.\\nShe placed 22nd at the 2018 Winter Olympics and 12th at the 2016 Youth Olympics.\\nLi switched to pair skating during the 2018–19 figure skating season, partnering with Xie Zhong, but has since returned to singles before ever debuting competitively in pairs."},{"page_url":"https://it.wikipedia.org/wiki/Strada_principale_5","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/CH-Hauptstrasse5-OSM.png","page_title":"Strada principale 5","context_page_description":"La strada principale 5 è una delle strade principali della Svizzera."},{"page_url":"https://de.wikipedia.org/wiki/Point_Loma","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Point_Loma_Lighthouse.jpg","page_title":"Point Loma","context_page_description":"Point Loma ist eine Halbinsel am Eingang der Bucht von San Diego in Kalifornien. Die in die See ragende Sandsteinfeste steigt 128 Meter hoch empor und, bildet einen natürlichen Schutzwall und bietet strategisch wichtige Aussichtspunkte über den Hafen und die Stadt San Diego.\\nAufgrund seiner landschaftlichen Schönheit und zahlreicher Sehenswürdigkeiten stellt der Ort eine Touristenattraktion dar. Hervorzuheben ist das Cabrillo National Monument, das an den portugiesischen Entdecker Juan Rodríguez Cabrillo erinnert, der als erster Europäer hier am 28. September 1542 die Westküste der Vereinigten Staaten erreichte.\\nAuf der höchsten Erhebung steht die Leuchtturmanlage Old Point Loma Light Station. 1851 wählte das US Coastal Survey diese Landzunge als Standort für einen Leuchtturm. Das Gebäude wurde 1854 fertiggestellt und ein Jahr später mit einer aus Frankreich stammenden Fresnel-Linse ausgestattet. Bei klarem Wetter war das Licht aus einer Entfernung von 70 Kilometer zu sehen. 1875 wurde südlich der bereits erbauten Häuser eine Baracke errichtet, die heute jedoch nicht mehr vorhanden ist. Am 23."},{"page_url":"https://de.wikipedia.org/wiki/Damo_Suzuki","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Damo_Suzuki_live_in_2012.jpg","page_title":"Damo Suzuki","context_page_description":"Damo Suzuki ist ein Kölner Sänger japanischer Abstammung. Er war Sänger der Gruppe Can von 1970 bis 1973 und ist seit 1983 mit seiner Solo-Karriere beschäftigt, hauptsächlich mit eigenen Projekten, zurzeit dem Damo Suzuki's Network. Sein Markenzeichen ist improvisierter Gesang zu psychedelischer Musik."},{"page_url":"https://ceb.wikipedia.org/wiki/Laetiporus_sulphureus","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7c/2007-06-27_Laetiporus_sulphureus_crop.jpg","page_title":"Laetiporus sulphureus","context_page_description":"Espesye sa uhong sakop sa division nga Basidiomycota ang Laetiporus sulphureus. Una ning gihulagway ni Jean Baptiste François \`Pierre' Bulliard, ug nga gihatagan sa eksakto nga ngalan ni William Alphonso Murrill ni adtong 1920. Ang Laetiporus sulphureus sakop sa kahenera nga Laetiporus sa kabanay nga Fomitopsidaceae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://en.wikipedia.org/wiki/List_of_descriptive_plant_epithets_(A%E2%80%93H)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Carex_capillacea_-_Palmengarten_Frankfurt_-_DSC01923.JPG","page_title":"List of descriptive plant epithets (A–H)","context_page_description":"Since the first printing of Carl Linnaeus's Species Plantarum in 1753, plant species have been assigned one epithet for the species and one for their genus. These scientific names have been catalogued in a variety of works, including Stearn's Dictionary of Plant Names for Gardeners. William Stearn was one of the pre-eminent British botanists of the 20th century: a Librarian of the Royal Horticultural Society, a president of the Linnean Society and the original drafter of the International Code of Nomenclature for Cultivated Plants.\\nThe first column below lists species epithets from Stearn's Dictionary, excluding proper nouns and proper adjectives. Also excluded are some repetitive suffixes for plant parts and colours, and epithets used only in species names that, for a variety of reasons, are no longer widely accepted.\\nThe third column frequently cites Charlton T. Lewis's An Elementary Latin Dictionary. The last three columns indicate citations to Latin for Gardeners by Lorraine Harrison, Botanical Latin by Stearn, and The A to Z of Plant Names by Allen Coombes."},{"page_url":"https://simple.wikipedia.org/wiki/Astronomical_unit","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Astronomical_unit.png","page_title":"Astronomical unit","context_page_description":"The astronomical unit is a unit of length derived from the Earth's orbit. It is the average distance the Earth gets from the Sun on the long axis of the ellipse. Its definition is: the length of the semi-major axis of the Earth's elliptical orbit around the Sun. \\"Semi-major\\" means half the long axis.\\nThe AU is about 150 million kilometers or 93 million miles. Astronomers usually measure distances within the Solar System in astronomical units. Mars is about 1.4 AU from the Sun, Jupiter lies at roughly 5.2 AU, and Neptune is roughly 30 AU from the Sun. Light travels an AU in about 8.317 minutes."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%95%D7%A0%D7%99%D7%95%D7%AA_%D7%94%D7%9E%D7%A2%D7%A8%D7%9B%D7%94_%D7%9E%D7%A1%D7%93%D7%A8%D7%AA_%D7%90%D7%99%D7%95%D7%95%D7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Iowa_crest.jpg","page_title":"אוניות המערכה מסדרת איווה","context_page_description":"איווה היא סדרת אוניות מערכה, האחרונות שנבנו עבור צי ארצות הברית. ארבע האוניות, שהיו הגדולות ביותר והחזקות ביותר בצי, נבנו בתחילת שנות ה-40 ונטלו חלק במלחמת העולם השנייה. כולן הוצאו משירות פעיל לאחר מלחמת קוריאה, אך אונייה אחת הוחזרה לשירות והשתתפה במלחמת וייטנאם. כל האוניות חודשו והופעלו שוב במהלך שנות ה-80, הודות לתוכנית צי 600 הספינות של ממשל רייגן, והן הוצאו סופית מהשרות לאחר מלחמת המפרץ. בנייתן של שתי אוניות נוספות מהסדרה נפסקה לפני השלמתן, והן נגררו ופורקו לחלקי חילוף לארבע האוניות הפעילות.\\nהאוניות נבנו בתקציב נדיב, ונחשבות על ידי מומחים לפסגת ההתפתחות של אוניית המערכה. אוניות הקרב היחידות בעלות יכולות דומות היו אה\\"מ ואנגארד מהצי הבריטי, וסדרת אוניות המערכה יאמטו מהצי הקיסרי היפני. ברם, יריבתן האמיתית הייתה נושאת המטוסים, אשר הוכיחה את עליונותה בקרבות הימיים באוקיינוס השקט.\\nאוניות המערכה מסדרת איווה היו שיפור ניכר לעומת קודמותיהן מסדרת דקוטה הדרומית, בכך שהיו בהן תוספת של 60 מטר באורך, מנועים חזקים יותר, וכן תותחים ימיים בעלי קליבר מוגדל המסוגלים לירות למרחקים גדולים יותר. עיצוב האוניות מסדרת איווה נחשב לאחד היפים ביותר של אוניית קרב שנבנו אי פעם, ומתאפיין בחרטום צר וארוך ובשלושה צריחי תותחים רבי עוצמה."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A4%D7%95%D7%9C_%D7%9E%D7%A7%D7%A8%D7%98%D7%A0%D7%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Paul_McCartney_black_and_white_2010.jpg","page_title":"פול מקרטני","context_page_description":"סר ג'יימס פול מקרטני הוא מוזיקאי וזמר-יוצר בריטי. מקרטני ידוע בעיקר בזכות היותו חבר בלהקת הרוק הביטלס, הנחשבת בעיני רבים להרכב המוזיקלי החשוב והמשפיע ביותר במאה ה-20, ופעל בלהקה ככותב, כמלחין, כמבצע וכנגן גיטרה בס. פעילותו של מקרטני בלהקת הביטלס, ושיתוף הפעולה עם חבריו ללהקה ג'ורג' האריסון, רינגו סטאר וג'ון לנון, הובילה לכמה מהשירים הפופולריים ביותר בהיסטוריה של מוזיקת הרוק ובתוך כך הייתה לו תרומה חשובה לשינוי שעברה מוזיקה זו מפורמט של בידור לאומנות של ממש. מקרטני נחשב לזמר-יוצר משפיע מאוד בתולדות המוזיקה הפופולרית. זכה 21 פעמים בפרס הגראמי, נכנס להיכל התהילה של הרוק אנד רול ב-1988 כחבר להקת הביטלס וב-1999 כזמר-יוצר עצמאי, וב-1979 הופיע לראשונה בספר השיאים של גינס כיוצר המצליח ביותר אשר עשרות משיריו התברגו למקומות הראשונים במצעד הפזמונים הבריטי.\\nלאחר התפרקות להקת הביטלס, מקרטני פנה לקריירת סולו ושיתופי פעולה עם מוזיקאים שונים, והיה ממקימי להקת Wings ‏עמה זכה להצלחה רבה. לצד פעילותו המתמשכת בתחום מוזיקת הפופ עסק מקרטני בהלחנת יצירות קלאסיות ומוזיקה אלקטרונית.\\nמעבר לפעילותו בתחום המוזיקה וההפקה המוזיקלית, לאורך השנים עסק מקרטני גם בציור, הפקת סרטים ופעילות למען זכויות אדם ולמען זכויות בעלי חיים."},{"page_url":"https://cs.wikipedia.org/wiki/Dimethylsulf%C3%A1t","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Dimethyl_sulfate_-Molecule-3D-balls-by-AHRLS-2012.png","page_title":"Dimethylsulfát","context_page_description":"Dimethylsulfát je organická sloučenina se vzorcem (CH₃O)₂SO₂. Jedná se o dimethylester kyseliny sírové, proto se vzorec často píše jako (CH₃)₂SO₄ nebo i Me₂SO₄, kde Me znamená methyl. Me₂SO₄ se používá hlavně jako methylační činidlo v organické syntéze."},{"page_url":"https://cs.wikipedia.org/wiki/Numerologie","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Bongo%2C_Pietro_%E2%80%93_Numerorum_mysteria%2C_1591_%E2%80%93_BEIC_58079.jpg","page_title":"Numerologie","context_page_description":"Numerologie je moderní označení pro různé iracionální a pseudovědecké výklady významu čísel. Některá čísla se jako počty vyskytují v běžné zkušenosti a v souvislosti s pozorováním oblohy, jiná mohou dostávat významy, když se písmena abecedy užívají jako číslovky a konečně vznikly v různých kulturách i složitější soustavy výkladu čísel."},{"page_url":"https://en.wikipedia.org/wiki/Mount_Sharp","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/PIA19142-MarsCuriosityRover-Self-Mojave-20150131.jpg","page_title":"Mount Sharp","context_page_description":"Mount Sharp, officially Aeolis Mons, is a mountain on Mars. It forms the central peak within Gale crater and is located around 5.08°S 137.85°E, rising 5.5 km high from the valley floor. Its ID in the United States Geological Survey's Gazetteer of Planetary Nomenclature is 15000.\\nOn August 6, 2012, Curiosity landed in \\"Yellowknife\\" Quad 51 of Aeolis Palus, next to the mountain. NASA named the landing site Bradbury Landing on August 22, 2012. Aeolis Mons is a primary goal for scientific study. On June 5, 2013, NASA announced that Curiosity would begin an 8 km journey from the Glenelg area to the base of Aeolis Mons. On November 13, 2013, NASA announced that an entryway the rover would traverse on its way to Aeolis Mons was to be named \\"Murray Buttes\\", in honor of planetary scientist Bruce C. Murray. The trip was expected to take about a year and would include stops along the way to study the local terrain.\\nOn September 11, 2014, NASA announced that Curiosity had reached Aeolis Mons, the rover mission's long-term prime destination.\\nOn October 5, 2015, possible recurrent slope lineae, wet brine flows, were reported on Mount Sharp near Curiosity."},{"page_url":"https://fr.wikipedia.org/wiki/Vice_Chief_of_Staff_of_the_United_States_Air_Force","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/James_A_Hill.jpg","page_title":"Vice Chief of Staff of the United States Air Force","context_page_description":"Le Vice Chief of Staff of the United States Air Force est le deuxième officier le plus gradé de l'armée de l'air américaine. En cas d'absence ou d'empêchement du chef d'état-major de l'armée de l'air, le VCSAF assume les tâches et responsabilités du CSAF. Le VCSAF peut également exercer d'autres fonctions que lui confient le Secrétaire à la défense, le Secrétaire à l'US Air Force ou le CSAF. Le VCSAF est nommé par le président des États-Unis et doit être confirmé par un vote à la majorité du Sénat. En vertu de la loi, le VCSAF est nommé général quatre étoiles.\\nL’actuel vice-chef d’état-major de l'US Air Force est le général Stephen W. Wilson."},{"page_url":"https://it.wikipedia.org/wiki/Anna_Maria_Pertl","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Anna_Maria_Mozart.jpg","page_title":"Anna Maria Pertl","context_page_description":"Anna Maria Walburga Mozart, nata Pertl, era la madre di Wolfgang Amadeus Mozart e Maria Anna Mozart.\\nSposò Leopold Mozart il 21 novembre 1747 a Salisburgo. Ebbe con lui sette figli, cinque dei quali morirono nei primi mesi di vita, conformemente all'alto tasso di mortalità infantile dell'epoca. Sopravvissero solo Wolfgang Amadeus, nato nel 1756, e la sorella maggiore Maria Anna detta “Nannerl”, nata nel 1751.\\nSecondo alcuni biografi mozartiani, il genio del Maestro è riconducibile anche alle qualità molto diverse e molto accentuate che ereditò dai suoi genitori. Dal padre prese la musicalità, la serietà, la dedizione al lavoro; dalla madre la gioia di vivere, la fantasia, il senso dell'umorismo. Anna Maria Pertl era in effetti una donna molto diversa da suo marito; sicuramente meno colta, ma anche più equilibrata e capace di smussare l'autoritarismo e le rigidezze del capofamiglia. Nelle sue lettere è possibile ravvisare lo stesso gusto dello scherzo osceno che ha reso tanto celebri le lettere di Mozart. Una volta così scrisse al marito:\\nAnna Maria non coltivava la musica, pur essendo la moglie di un eccellente violinista e compositore, e la madre di due bambini prodigio."},{"page_url":"https://es.wikipedia.org/wiki/Bettborn","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Bettborn_%28Moselle%29_mairie_-_salle_des_f%C3%AAtes.jpg","page_title":"Bettborn","context_page_description":"Bettborn es una comuna y población de Francia, en la región de Lorena, departamento de Mosela, en el distrito de Sarrebourg y cantón de Fénétrange.\\nSu población en el censo de 1999 era de 353 habitantes.\\nEstá integrada en la Communauté de communes du Pays de Fénétrange."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%85%D9%8A%D9%86%D8%A7_%D8%A8%D8%A7%D8%B1%D9%8A%D8%AA%D9%88","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7f/Mena_Barreto.jpg","page_title":"مينا باريتو","context_page_description":"مينا باريتو كان عسكرى برتبه جينيرال اوف ذا ارمى من البرازيل."},{"page_url":"https://de.wikipedia.org/wiki/Liste_historischer_Weltkarten","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/World_map_pietro_vesconte.jpg","page_title":"Liste historischer Weltkarten","context_page_description":"Diese Liste historischer Weltkarten umfasst Karten aus der Zeit bis 1800, die den zum Zeitpunkt und am Ort ihres Entstehens bekannten Teil der Erdoberfläche abbilden und den Anspruch einer Weltkarte besitzen."},{"page_url":"https://no.wikipedia.org/wiki/Oktogonale_kirker_i_Norge","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/B%C3%B8rselv_kirke.jpg","page_title":"Oktogonale kirker i Norge","context_page_description":"Oktogonale kirker i Norge ble vanlige fra omkring 1700. Hospitalskirken i Trondheim er den eldste eksisterende i landet. En oktogonal kirke, eller «åttekantkirke», er en kirkebygning der skipets grunnplan inkluderer en oktogon. Det finnes varianter av planformen ved at åttekanten er påsatt armer i lengderetning eller på tvers. De fleste åttekantkirkene ble oppført av lafta tømmer.\\nDet var innenfor det daværende Nidaros bispedømme den oktogonale formen først ble vanlig i Norge, og det største antallet er i Møre og Romsdal, Trøndelag og Nordland fylker. Det har blitt oppført over 80 kirker med denne formen, de fleste står fortsatt. I perioden 1800–1850 ble omkring en firedel av nye kirker oppført med oktogonal form. Blant åttekantkirkene finnes også noen av landets største kirkebygg, for eksempel Røros kirke med 1640 sitteplasser og Vang kirke i Ridabu med 1000 plasser. Planformen har blant bakgrunn i den protestantiske gudstjenestes vekt på prekenen og ønsket om et åpent kirkerom med gode tilhørerforhold. Åttekantformen gir også mye gulvareal i forhold til medgått material. Tømmerstokkenes lengde kan ha begrenset muligheten til å sette opp store rektangulære bygg."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_onroerend_erfgoed_in_Overijse","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6f/Eizer_B.jpg","page_title":"Lijst van onroerend erfgoed in Overijse","context_page_description":"Een overzicht van het onroerend erfgoed in de gemeente Overijse. Het onroerend erfgoed maakt deel uit van het cultureel erfgoed in België."},{"page_url":"https://sv.wikipedia.org/wiki/Hibiscus_grewiifolius","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Atlas_der_baumarten_von_Java_%28Figur_436%29_BHL47163236.jpg","page_title":"Hibiscus grewiifolius","context_page_description":"Hibiscus grewiifolius är en malvaväxtart som beskrevs av Justus Carl Hasskarl. Hibiscus grewiifolius ingår i Hibiskussläktet som ingår i familjen malvaväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://ca.wikipedia.org/wiki/Ancistrus","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Ancistrus_sp_head.jpg","page_title":"Ancistrus","context_page_description":"Ancistrus és un gènere de peixos de la família dels loricàrids i de l'ordre dels siluriformes. Es troba a la conca del riu Amazones."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%B2%B3%E5%8C%97%E5%85%A8%E5%9B%BD%E9%87%8D%E7%82%B9%E6%96%87%E7%89%A9%E4%BF%9D%E6%8A%A4%E5%8D%95%E4%BD%8D%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/%E5%B8%B8%E5%B1%B1%E9%83%A1%E6%95%85%E5%9F%8E%E9%81%97%E5%9D%80%E4%BD%8D%E4%BA%8E%E7%9F%B3%E9%82%A2%E5%85%AC%E8%B7%AF%E7%9A%84%E5%85%A5%E5%8F%A3.jpg","page_title":"河北全国重点文物保护单位列表","context_page_description":"本列表是中国全国重点文物保护单位的子列表，列举在河北省境内的全国重点文物保护单位。"},{"page_url":"https://fr.wikipedia.org/wiki/Poil","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Gray945.png","page_title":"Poil","context_page_description":"Le poil est à la fois une production filiforme de l'épiderme et l'un des plus petits organes, couvrant partiellement ou intégralement la surface de nombreux êtres vivants végétaux et animaux. Parmi les vertébrés, les poils sont caractéristiques des mammifères, tout en étant présents aussi bien chez les arthropodes que chez les annélides.\\nIl existe divers appellations des formations pileuses. Chez les animaux et en particulier les vertébrés, lorsque la couverture pileuse de la peau est complète, on parle de pelage. Chez l'humain, la pilosité couvrant le crâne en dehors du visage est appelée chevelure, celle couvrant la mâchoire et le cou est appelée barbe, les gros poils couvrant les arcades sourcilières sont appelées sourcils, ceux bordant la lèvre des paupières sont appelés cils, les poils les plus fins sont qualifiés de duvet. Il existe beaucoup d'autres désignations telle la crinière chez l'animal à propos des hyperpilosités situées dans la région du cou, les crins concernant des poils durs et longs au niveau de la queue et du cou de certains taxons, les soies concernant de petites brosses chez certains insectes, et cætera."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%9C%B4%E5%BB%A3%E8%B3%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Park_Kwang-Hyun_from_acrofan.jpg","page_title":"朴廣賢","context_page_description":"朴珖賢，韓國男演員、歌手。"},{"page_url":"https://it.wikipedia.org/wiki/Arrondissement_del_Belgio","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Arrondissement_Arlon_Belgium_Map.png","page_title":"Arrondissement del Belgio","context_page_description":"In Belgio l'arrondissement è un tipo di articolazione territoriale cui non corrisponde un ente amministrativo, ma solo l'ufficio del commissario responsabile per l'ordine pubblico.\\nEsistono arrondissement amministrativi, arrondissement giudiziari e arrondissement elettorali, non necessariamente coincidenti tra loro."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%AA%D8%B4%D9%8A%D9%87%D9%8A%D8%B1%D9%88_%D8%AF%D9%89_%DA%86%D9%88%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Biserica_de_lemn_din_Chiheriu_de_Jos01.JPG","page_title":"تشيهيرو دى چوس","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nتشيهيرو دى چوس, قريه فى رومانيا."},{"page_url":"https://fr.wikipedia.org/wiki/David_Boreanaz","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Angel_intertitle.jpg","page_title":"David Boreanaz","context_page_description":"David Boreanaz est un acteur et réalisateur américain, né le 16 mai 1969 à Buffalo dans l'État de New York aux États-Unis.\\nPrincipalement connu à la télévision, il est révélé au grand public, grâce à son rôle du vampire ténébreux Angel qu'il incarne dans les séries télévisées fantastiques : Buffy contre les vampires et Angel.\\nIl confirme ensuite en jouant l'un des héros de la série d'anthropologie judiciaire Bones, un long et important succès d'audiences. Et choisit ensuite de produire et jouer le rôle titre dans la série militaire SEAL Team."},{"page_url":"https://sv.wikipedia.org/wiki/Eld%C3%B6gd_monjita","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Fire-eyed_Diucon_%28Xolmis_pyrope%29_%2815934860046%29.jpg","page_title":"Eldögd monjita","context_page_description":"Eldögd monjita är en fågel i familjen tyranner inom ordningen tättingar. IUCN kategoriserar arten som livskraftig.\\nEldögd monjita delas in i två underarter:\\nXolmis pyrope pyrope – förekommer i Anderna från centrala Chile och näraliggande Argentina till Tierra del Fuego\\nXolmis pyrope fortis – förekommer på ön Chiloé i Chile"},{"page_url":"https://eu.wikipedia.org/wiki/John_Ingleby","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Llansanfraid_Glyndwrdwy%2C_1794.jpg","page_title":"John Ingleby","context_page_description":"John Ingleby margolaria eta miniaturista izan zen."},{"page_url":"https://en.wikipedia.org/wiki/2002_Mnet_Music_Video_Festival","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Sung_Si-kyung_in_March_2011_from_acrofan.jpg","page_title":"2002 Mnet Music Video Festival","context_page_description":"The 2002 Mnet Music Video Festival was the fourth of the annual music awards in Seoul, South Korea that took place on November 29, 2002 at the Little Angels Arts Center.\\nLeading the nominees was BoA with three nominations. By the end of the ceremony, BoA was the only one to receive multiple awards, which is 2 out of her three nominations."},{"page_url":"https://fr.wikipedia.org/wiki/Pic_Maiden","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Maiden_Peak_%28Oregon%29.jpg","page_title":"Pic Maiden","context_page_description":"Le pic Maiden, en anglais : Maiden Peak, est un volcan bouclier culminant à 2 384 mètres d'altitude dans le centre de l'Oregon, au Nord-Ouest des États-Unis. Il fait partie de la chaîne des Cascades et se trouve à la limite de la forêt nationale de Willamette et de la forêt nationale de Deschutes. Fréquenté depuis des siècles par les Amérindiens, son sommet a constitué au début du XXᵉ siècle un point de vue destiné à l'observation des feux de forêt."},{"page_url":"https://it.wikipedia.org/wiki/Mignanego","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Mignanego-municipio.jpg","page_title":"Mignanego","context_page_description":"Mignànego è un comune italiano sparso di 3 557 abitanti della città metropolitana di Genova in Liguria. La sede comunale è situata nel centro abitato di Ponteacqua."},{"page_url":"https://cs.wikipedia.org/wiki/Anton_Mat%C3%BA%C5%A1ek","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Pam%C3%A4tn%C3%BD_odznak_Za_%C5%A5a%C5%BEenie_proti_ZSSR.jpg","page_title":"Anton Matúšek","context_page_description":"Anton Matúšek byl pilot Slovenských vzdušných zbraní, později 1. čs. samostatného leteckého pluku během druhé světové války, a letecké eso."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_plus_grands_porte-conteneurs","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Container_ship_MSC_Maya_with_L_%26_R_rear_tractor_prompt_on_the_river_Elbe_with_the_port_of_destination_Hamburg_%28cropped%29.jpg","page_title":"Liste des plus grands porte-conteneurs","context_page_description":"Cet article recense les plus grands porte-conteneurs au monde."},{"page_url":"https://pl.wikipedia.org/wiki/Angelica_Bengtsson","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Angelica_Bengtsson_in_2015-3.jpg","page_title":"Angelica Bengtsson","context_page_description":"Angelica Therese Bengtsson – szwedzka lekkoatletka specjalizująca się w skoku o tyczce.\\nZwyciężczyni plebiscytu na wschodzącą gwiazdę światowej lekkoatletyki. W 2011 zajęła czwarte miejsce w plebiscycie na wschodzącą gwiazdą europejskiej lekkoatletyki organizowanym przez European Athletics. Rok później, w tym samym plebiscycie, uplasowała się na pierwszym miejscu."},{"page_url":"https://fr.wikipedia.org/wiki/Art_Gupta","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Standing_Buddha%2C_Gupta_dynasty%2C_320-485%2C_Mathura%2C_Uttar_Pradesh%2C_India%2C_sandstone_-_Freer_Gallery_of_Art_-_DSC05111.JPG","page_title":"Art Gupta","context_page_description":"L'art Gupta est l'art de l'Empire Gupta, qui régnait sur la majeure partie du Nord de l'Inde, avec son apogée entre environ 300 et 480, survivant sous une forme très réduite jusqu'à 550. La période Gupta est généralement considérée comme la période classique et un âge d'or de l'art en Inde du Nord pour tous les principaux groupes religieux. Bien que la peinture soit évidemment répandue, les œuvres qui subsistent sont principalement des sculptures religieuses. La période a vu l'émergence des icônes divines de pierre sculptée dans l'art hindou, tandis que la production des figures de Bouddha et de Jain tirthankara a continué de croître, ces dernières souvent à très grande échelle. Le centre principal traditionnel de la sculpture était Mathura, qui a continué à prospérer, tandisque l'art du Gandhara, le centre de l'art gréco-bouddhiste juste au-delà de la frontière nord du territoire de Gupta, continuait d'exercer une influence. D'autres centres ont vu le jour au cours de la période, notamment à Sarnath. Mathura et Sarnath ont exporté la sculpture vers d'autres parties du nord de l'Inde."},{"page_url":"https://en.wikipedia.org/wiki/Tawny_eagle","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Aquila_rapax_MHNT.ZOO.2010.11.91.1.jpg","page_title":"Tawny eagle","context_page_description":"The tawny eagle is a large, long-lived bird of prey. Like all eagles, it belongs to the family Accipitridae. Its heavily feathered legs illustrate it to be a member of the subfamily Aquilinae, also known as “booted eagles”. Tawny eagles have an extensive but discontinuous breeding range that constitutes much of the African continent as well as the Indian subcontinent, with rare residency occurring in the southern Middle East. Throughout its range, it favours open dry habitats such as semideserts, deserts steppes, or savanna plains. Despite its preference for areas of aridity, the species seldom occurs in areas where trees are entirely absent. It is a resident breeder which lays one to three eggs in a stick nest mostly commonly in the crown of a tree. The tawny eagle is perhaps the most high opportunistic of all of its taxonomic clan, and often scavenges on carrion or engages in kleptoparasitism towards other carnivorous animals but is also a bold and active predator, often of relatively large and diverse prey. It is estimated that tawny eagles can reach the age of 16 years old. Nonetheless, precipitous declines have been detected throughout the tawny eagle’s range."},{"page_url":"https://es.wikipedia.org/wiki/Carrosserie_Pourtout","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/20/Panhard_-_1%C3%A8re_Eclipse%2C_nov._1934_Pourtout.jpg","page_title":"Carrosserie Pourtout","context_page_description":"Carrosserie Pourtout fue una compañía carrocera francesa. Fundada por Marcel Pourtout en 1925, la empresa es conocida por sus trabajos en las décadas anteriores a la Segunda Guerra Mundial, cuando diseñó las carrocerías de los automóviles de numerosos fabricantes europeos de prestigio. La mayoría de sus realizaciones eran encargos a medida, típicamente aerodinámicos y de carácter deportivo. Entre los clientes de la compañía figuró Georges Clemenceau, el médico y periodista que fue primer ministro de Francia de 1906 a 1909 y de 1917 a 1920.​\\nDespués de la Segunda Guerra Mundial, la firma se dedicó al diseño industrial y a la publicidad.\\nCarrosserie Pourtout cesó su actividad creativa en 1994, pero perduró como un negocio dedicado a la reparación de carrocerías de todo tipo de vehículos.​"},{"page_url":"https://nl.wikipedia.org/wiki/Mullus_auratus","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Fish4331_-_Flickr_-_NOAA_Photo_Library.jpg","page_title":"Mullus auratus","context_page_description":"Mullus auratus is een straalvinnige vissensoort uit de familie van zeebarbelen. De wetenschappelijke naam van de soort is voor het eerst gepubliceerd in 1882 door Jordan & Gilbert. Volgens de \\"Multilingual dictionary of fish and fish products\\", Fishing News Books, Oxford, van de \\"Organisation for Economic Co-operation and Development\\" is voor deze soort de Nederlandstalige naam \\"gestreepte zeebarbeel\\" in omloop. De soort komt voor in het westen van de Atlantische Oceaan, van Frans-Guyana tot Halifax."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A7%D9%86%D8%AC%DB%8C%D8%B1%D8%AE%D9%88%D8%B1%DA%A9%E2%80%8C%D9%87%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Ficedula_mugimaki_-_Khao_Yai.jpg","page_title":"انجیرخورک‌ها","context_page_description":"انجیرخورک‌ها نام یک سرده از تیره مگس‌گیران است."},{"page_url":"https://pl.wikipedia.org/wiki/Budynek_IV_Liceum_Og%C3%B3lnokszta%C5%82c%C4%85cego_w_Bytomiu","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Bytom_school_Sikorskiego_doors.jpg","page_title":"Budynek IV Liceum Ogólnokształcącego w Bytomiu","context_page_description":"Budynek IV Liceum Ogólnokształcącego w Bytomiu – gmach szkolny z 1902 roku, w Bytomiu, wpisany do rejestru zabytków nieruchomych województwa śląskiego, jeden z architektonicznych symboli Bytomia."},{"page_url":"https://pl.wikipedia.org/wiki/Anna_Wyszkoni","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/JRKRUK_20130425_ANNA_WYSZKONI_BUSKO_IMG_1085.jpg","page_title":"Anna Wyszkoni","context_page_description":"Anna Maria Wyszkoni, występująca głównie jako Ania Wyszkoni – polska piosenkarka wykonująca muzykę z pogranicza popu i rocka, kompozytorka i autorka tekstów.\\nW latach 1996–2010 występowała w zespole Łzy. Solowo wydała cztery albumy: Pan i Pani, Życie jest w porządku, Kolędy wielkie oraz Jestem tu nowa.\\nW 2010 czasopismo „Machina” umieściło ją na liście „50 najlepszych polskich wokalistek”."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A4%D1%96%D0%B1%D1%80%D0%BE%D0%B0%D0%B4%D0%B5%D0%BD%D0%BE%D0%BC%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Fibroadenoma_of_breast.jpg","page_title":"Фіброаденома","context_page_description":"Фіброаденома — переважно безболісна, однобічна, доброякісна пухлина молочної залози, яка є твердою грудкою, не заповненою рідиною. Найчастіше вона зустрічається у жінок віком від 14 до 35 років, але її можна зустріти в будь-якому віці. Фіброаденоми скорочуються після менопаузи, і тому рідше зустрічаються у жінок після неї. Фіброаденома — це мармуроподібна маса, що містить як епітеліальні, так і стромальні тканини, розташовані під шкірою грудей. Ці тверді, гумоподібні маси з чіткими краями варіюються в своїх розмірах.\\nТипи пухлин:\\nПроста фіброаденома — найпоширеніший тип фіброаденоми.\\nГігантська ювенільна фіброаденома — рідкісний варіант фіброаденоми. Визначається як будь-яка інкапсульована фіброаденома діаметром більше 5 см, вагою понад 500 г. Вона швидко розростається і пов'язана з виразками шкіри та венозним застоєм. Захворюваність гігантськими фіброаденоми становить приблизно 0,5 %–2 % від усіх фіброаденом. Популяції, сприйнятливі до гігантських фіброаденоми — жінки віком 10–18 років та жінки Афро-Американської Америки. Гігантська фіброаденома — найчастіша причина односторонньої макромастії у жінок-підлітків."},{"page_url":"https://fr.wikipedia.org/wiki/Maschito","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Scorciopaese.jpg","page_title":"Maschito","context_page_description":"Maschito est une commune italienne d'environ 1 570 habitants, située dans la province de Potenza, dans la région Basilicate, en Italie méridionale."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B3%D8%A7%D9%84%D9%88%D8%A7%D8%AA_%DB%8C%D9%88%D9%84%D8%A7%DB%8C%D9%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/%D0%A1%D0%B0%D0%BB%D0%B0%D0%B2%D0%B0%D1%82_%D0%AE%D0%BB%D0%B0%D0%B5%D0%B2_-_panoramio.jpg","page_title":"سالوات یولایف","context_page_description":"سالوات یولایف یک قهرمان ملی باشقیر است که در شورش پوگاچف مشارکت داشته است."},{"page_url":"https://eo.wikipedia.org/wiki/Vjazniki","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Vyazniki_asv2019-05_img02_SovStreet.jpg","page_title":"Vjazniki","context_page_description":"Vjazniki estas urbo en Vladimira provinco en Rusio.\\nKodo de OKATO de la urbo estas 17415.\\nLa urbo estis fondita en jaro 1608.\\nĜi havas statuson de urbo ekde jaro 1778.\\nLa interurba telefona kodo estas 09233, la enurbaj telefonnumeroj estas kvinciferaj.\\nLa loka tempo estas la sama kiel moskva tempo.\\nGeografiaj koordinatoj de la urbo estas: latitudo 56°14' norde, longitudo 42°10' oriente.\\nLa urbo estas sur dekstra bordo de rivero Klazjma, en 6 km de fervoja stacio Vjazniki.\\nEn jaro 1959 la urbo havis 39.7 mil loĝantojn.\\nEn jaro 2002 la urbo havis 40.4 mil loĝantojn."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stra%C3%9Fen_in_Hamburg-Neuenfelde","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Koggenweg.jpg","page_title":"Liste der Straßen in Hamburg-Neuenfelde","context_page_description":"Die Liste der Straßen in Hamburg-Neuenfelde ist eine Übersicht der gegenwärtig im Hamburger Stadtteil Neuenfelde vorhandenen Straßen. Sie ist Teil der Liste der Verkehrsflächen in Hamburg."},{"page_url":"https://sco.wikipedia.org/wiki/Alassane_Ouattara","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Alassane_Ouattara_UNESCO_09-2011.jpg","page_title":"Alassane Ouattara","context_page_description":"Alassane Dramane Ouattara is an Ivoirian politeecian who haes been Preses o Côte d'Ivoire syne 2011."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%8A%A0%E6%8B%BF%E5%A4%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Barack_Obama_meets_Stephen_Harper.jpg","page_title":"加拿大","context_page_description":"加拿大為北美洲國家，西抵太平洋，東至大西洋，北濱北冰洋，東北方與丹麥領地格陵蘭相望，東部與聖皮耶與密克隆群島相望，南方及西北方與美國接壤。加拿大的領土面積達998萬4670平方公里，為全球面積第二大國家。亦是已開發國家之中的領土面積最大者。加拿大素有「楓葉之國」的美譽，渥太華為該國首都。加拿大被《富比士》列於2020年退休宜居國的名單中。\\n加拿大在1400年前即有原住民在此生活。15世紀末，英國和法國殖民者開始探索北美洲的東岸，並在此建立殖民地。1763年，當七年戰爭結束後，法國被迫將其幾乎所有的北美殖民地割讓予英國。在隨後的幾十年中，英國殖民者向西探索至太平洋地區，並建立了數個新的殖民地。1867年7月1日，1867年憲法法案通過，加拿大省分裂為安大略和魁北克兩省，與新布藍茲維、新斯科細亞三個英屬北美殖民地組成加拿大聯邦。在隨後100多年裡，其它幾塊英屬北美殖民地陸續加入聯邦，組成現代加拿大。1931年12月11日，英國通過西敏法令，令加拿大成為獨立國家，但國家元首依舊是當時的英國國王喬治五世，且英國國會依舊掌握有加拿大的修憲權。1933年和1949年，加拿大民事案件和刑事案件的終審權分別從英國樞密院司法委員會移交至加拿大最高法院。1982年4月17日，英國女王兼加拿大女王伊莉莎白二世簽署命令，將加拿大憲法修憲權移交加拿大國會，至此加拿大與英國的特殊關係終結。\\n加拿大是實行聯邦制、君主立憲制及議會制的國家，由十個省和三個地區組成，女王伊莉莎白二世為國家元首及加拿大君主，而加拿大總督為其及政府的代表。加拿大是雙語國家，英語和法語為官方語言，原住民的語言被認定為第一語言。由於地處高緯度及地廣人稀，該國一直奉行積極吸納外來移民的政策，以至人口亦以移民為主，有近五分之一的國民於國外出生，是世界上擁有種族及文化最為多元的國家之一。近年來移民大部分來自亞洲。\\n得益於豐富的天然資源和高度已開發的科技，加拿大是富裕、經濟已開發的國家。以國際匯率計算，加拿大的人均國內生產毛額在全世界排名第十六，人類發展指數排名第十。它在教育、政府的透明度、自由度、生活品質及經濟自由的國際排名都名列前茅。積極參與國際事務，是聯合國、北大西洋公約組織、北美空防司令部、七大工業國組織、二十國集團、亞太經濟合作組織、經濟合作暨發展組織、大英國協和法語圈的成員國及太平洋島國論壇的對話夥伴。"},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B1%D5%84%D5%86-%D5%AB_%D5%BA%D5%A1%D5%B7%D5%BF%D5%BA%D5%A1%D5%B6%D5%B8%D6%82%D5%A9%D5%B5%D5%A1%D5%B6_%D5%B6%D5%A1%D5%AD%D5%A1%D6%80%D5%A1%D6%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/National_Military_Establishment_seal_1947-1949.png","page_title":"ԱՄՆ-ի պաշտպանության նախարար","context_page_description":"ԱՄՆ-ի պաշտպանության նախարար — ԱՄՆ-ի նախագահի վարչակազմում նախարարական պաշտոններից այն մեկի պաշտոնական անվանումը, որը պատասխանատու է ԱՄՆ-ի զինված ուժերի ղեկավարման ոլորտի բոլոր հարցերի համար՝ խաղաղ և պատերազմական ժամանակներում։ Հանդիսանում է ԱՄՆ-ի պաշտպանության նախարարության ղեկավարը։ ԱՄՆ-ի պաշտպանության նախարարին նշանակում է ԱՄՆ-ի նախագահը՝ ԱՄՆ-ի սենատի հավանությամբ։\\nԸստ օրենքի՝ ԱՄՆ-ի պաշտպանության նախարար չի կարող նշանակվել այն քաղաքացին, ԱՄՆ-ի զինված ուժերի կանոնավոր զորամասերի սպայի կարգավիճակով իսկական ծառայությունից ազատվելուց հետո 7 տարվա ընթացքում ։ Պաշտպանության նախարարը՝ ԱՄՆ-ի նախագահի լիազորությունների ժառանգման գծում՝ ըստ հիերարխիայի պետության մեջ 6-րդ մարդն է։\\nԱՄՆ զինված ուժերի ներսում պաշտպանության նախարարին կարճ անվանում են ՍեքԴեֆ ։"},{"page_url":"https://en.wikipedia.org/wiki/List_of_churches_in_Nidaros","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Bartnes_kapell.jpg","page_title":"List of churches in Nidaros","context_page_description":"This list of churches in Nidaros is a list of the Church of Norway churches in the Diocese of Nidaros which covers all of Trøndelag county in Norway. The list is divided into several sections, one for each deanery in the diocese.\\nAdministratively within each deanery, the churches are divided by municipalities which have their own church council and then into parishes which have their own councils. Each parish may have one or more congregations in it. The municipality of Trondheim includes several deaneries within the municipality due to its large population.\\nHistorically, the diocese has had many deaneries, but the number of deaneries has been reduced in recent years. In 1995, the old Sør-Fosen prosti was merged with Orkdal prosti and on the same date the old Nord-Fosen prosti was renamed simply Fosen prosti. On 1 July 2015, the Nærøy prosti, which included the municipalities of Leka, Vikna, and Nærøy, was merged with the Namdal prosti. On 1 January 2020, the old Nord-Innherad prosti and Sør-Innherad prosti were merged to form the new Stiklestad prosti."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%9D%B1%E6%80%A5%E3%83%97%E3%83%A9%E3%82%B6%E9%8A%80%E5%BA%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Tokyu_Plaza_Ginza_KIRIKO_TERRACE_Greenside_night_view_201806.jpg","page_title":"東急プラザ銀座","context_page_description":"東急プラザ銀座は、東京都中央区銀座五丁目の銀座・数寄屋橋交差点に面する、物販店舗、飲食店舗、駐車場からなる再開発の複合商業施設。"},{"page_url":"https://he.wikipedia.org/wiki/%D7%A7%D7%A4%D7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Cafe_Guadalajarense.jpg","page_title":"קפה","context_page_description":"קפה הוא שם כולל למספר משקאות חמים וקרים המבוססים על תמציות שמנים ארומטיים, המופקים מפולי צמח הקפה. התמציות מופקות מן הפולים על ידי קלייתם וטחינתם של הפולים, וחליטה או בישול של האבקה המתקבלת במים. משקאות הקפה ידועים כמעוררים, בעיקר בגלל הקפאין המצוי בפולים.\\nמקור צמח הקפה השחור הוא במחוז קפה שבמערב אתיופיה, והוא הופץ בשאר העולם במהלך המאה החמש עשרה והלאה על ידי בני העדה הערבית שהמשקה אצלם הוא מסורת תרבותית וחברתית."},{"page_url":"https://pt.wikipedia.org/wiki/H%C3%B4tel_de_Soissons","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Bachaumont.jpg","page_title":"Hôtel de Soissons","context_page_description":"O Hôtel de Soissons foi um palácio de Paris, sempre ligado à Família Real Francesa, que existiu aproximadamente no local onde, actualmente, se encontra a Bolsa de Comércio de Paris"},{"page_url":"https://arz.wikipedia.org/wiki/%D9%84%D9%89_%D8%AC%D9%88%D9%86%D8%B3%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Lee_Johnson_27-08-2016_1.jpg","page_title":"لى جونسون","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nلى جونسون لاعب كورة قدم من المملكه المتحده."},{"page_url":"https://es.wikipedia.org/wiki/Universidad_Estatal_de_Nueva_York","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/UB-Reactor.jpg","page_title":"Universidad Estatal de Nueva York","context_page_description":"La Universidad Estatal de Nueva York es una red de instituciones públicas de enseñanza superior en el Estado de Nueva York, Estados Unidos. Es el mayor consorcio de universidades del mundo, ​ con 438.361 estudiantes matriculados y más de 1,1 millones de estudiantes de educación continua repartidos en 64 instituciones a lo largo del estado. SUNY está compuesto por 83.547 profesores y unos 6.650 programas de pregrado. Las oficinas administrativas de SUNY se encuentran en Albany.\\nNo debe confundirse con la Universidad del Estado de Nueva York, que no es una universidad, sino el nombre del ente público que regula toda la educación superior del estado de Nueva York.\\nSUNY incluye todas las instituciones de educación superior del estado de Nueva York que son financiadas por el estado, con la excepción de las instituciones que son parte de la Universidad de la Ciudad de Nueva York."},{"page_url":"https://de.wikipedia.org/wiki/Reinhard_Clemens","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Reinhard_Clemens.jpg","page_title":"Reinhard Clemens","context_page_description":"Reinhard Clemens ist ein deutscher Manager.\\nEr war ab Dezember 2007 im Vorstand der Deutschen Telekom AG und Chief Executive Officer der T-Systems. Zum 1. Januar 2018 verließ er die Deutsche Telekom und T-Systems."},{"page_url":"https://cy.wikipedia.org/wiki/Pedrog","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/St_Petrock%27s_church%2C_Inwardleigh_-_geograph.org.uk_-_328154.jpg","page_title":"Pedrog","context_page_description":"Roedd Pedrog yn sant o Gymro sy'n nawddsant Cernyw ar y cyd â Piran. Ar 4 Mehefin mae ei ŵyl. Defnyddir baner Petroc fel baner Dyfnaint. Mae 5 eglwys i Petroc yng Nghernyw, 8 yn Llydaw a 17 yn Nyfnaint.\\nCedwir ei enw yn Llanbedrog, Y Ferwig Ceredigion a Llanbedrog, Sir Benfro.\\nRoedd Petrocus neu Petroc neu Pedrog yn sant o'r 6g a aeth o Gymru i Iwerddon i astudio. Wedi ymweld â Rhufain aeth ymlaen i sefydlu mynachdy yng Nghernyw yn Padstow. Tua diwedd ei oes aeth i gell unig ar Bodmin Moor. Yn ôl William of Worcester bu farw ar 4ydd Mehefin 564. Hen enw Bodmin oedd Bosvenegh. Cadwodd ei greiriau yn eglwys Bodmin tan 1177, cymerwyd nhw i Abaty St Mevennus yn Llydaw tan i'r brenin Henry II mynnu eu dychwelyd."},{"page_url":"https://en.wikipedia.org/wiki/Ben_Barter","image_url":"https://upload.wikimedia.org/wikipedia/en/2/25/Ben_Barter_in_Chicago.jpg","page_title":"Ben Barter","context_page_description":"Ben Barter is a New Zealand drummer based in Los Angeles, CA. He is the touring drummer for Lorde and has also performed with such acts as Broods, Jarryd James, and Passion Pit. He has worked on recordings as a session drummer most notably with Grammy Award winning producer, Joel Little."},{"page_url":"https://de.wikipedia.org/wiki/Operation_Frequent_Wind","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Vietnamese_UH-1_pushed_over_board%2C_Operation_Frequent_Wind.jpg","page_title":"Operation Frequent Wind","context_page_description":"Operation Frequent Wind war die amerikanische Evakuierung der südvietnamesischen Hauptstadt Saigon am 29. und 30. April 1975 während der Endphase des Vietnamkriegs."},{"page_url":"https://sl.wikipedia.org/wiki/Gradac,_Gradac","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/93/NightGradac.JPG","page_title":"Gradac, Gradac","context_page_description":"Gradac je naselje z manjšim pristaniščem v Splitsko-dalmatinski županiji."},{"page_url":"https://no.wikipedia.org/wiki/Liste_over_Frankrikes_fugler","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Sitta_europaea_wildlife_2_1.jpg","page_title":"Liste over Frankrikes fugler","context_page_description":"Denne listen over Frankrikes fugler inkluderer 592 arter. Inkludert er 11 introduserte arter.\\nRekkefølge er etter Clements-lista versjon v2017.\\nDe norske navnene følger Norske navn på verdens fugler.\\nStatus på lista:\\nFA - Fremmed art. En art som forekommer utenfor sitt naturlige utbredelsesområde. Arten har blitt fraktet dit av mennesker.\\nS - Fransk sjeldenhet eller tilfeldig\\nX - Lokalt utryddet\\nEX - Utryddet etter IUCNs rødliste\\nNT - Nær truet etter IUCNs rødliste\\nVU - Sårbar etter IUCNs rødliste\\nEN - Sterkt truet etter IUCNs rødliste\\nCR - Kritisk truet etter IUCNs rødliste"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BE%D1%8E%D0%B7_%D0%9C%D0%A1_(%D0%9B%D1%83%D0%BD%D0%BD%D0%B0%D1%8F_%D0%B2%D0%B5%D1%80%D1%81%D0%B8%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/11%D0%9458%D0%9C.jpg","page_title":"Союз МС (Лунная версия)","context_page_description":"«Союз МС (Лунная версия)» — российский транспортный пилотируемый космический корабль, предназначенный для полётов к Луне, создаваемый РКК Энергия.\\nПервоначально план производства был отвергнут в пользу корабля нового поколения Орел, однако позднее было принято решение построить оба корабля. После 3 заседаний в январе 2019 года проект, разрабатываемый много лет, перешел в активную фазу.\\nЦелью разработки является, с одной стороны, доставка американских и российских космонавтов к Луне, с другой - развитие космического туризма, создание второй резервной системы сообщения с орбитальной станцией Lunar Orbital Platform-Gateway.\\nПо мнению главы Роскосмоса Дмитрия Рогозина, модернизированный Союз МС может отправиться к Луне раньше Федерации. Специалисты планируют произвести модернизацию до конца 2022 года."},{"page_url":"https://es.wikipedia.org/wiki/Humberto_Piaguaje","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Humberto_Piaguaje%2C_Dirigente_ind%C3%ADgena_Secoya.jpg","page_title":"Humberto Piaguaje","context_page_description":"Humberto Javier Piaguaje Lucitante es un dirigente indígena secoya, nacido en Limoncocha el 30 de septiembre de 1964.\\nHa desempeñado importantes cargos de representación de la nacionalidad Secoya y, desde marzo del 2012, es el Coordinador Ejecutivo de la Unión de Afectados por las Operaciones petroleras de Texaco, ​ fue designado así por los afectados de la compañía, pues Piaguaje ha acompañado la lucha desde sus inicios, es decir, desde 1993.\\nLa Udatp es la organización que representa a más de 30 indígenas y colonos de las provincias de Orellana y Sucumbíos, que fueron afectados por la contaminación dejada por la petrolera Texaco, hoy Chevron.\\nHumberto Piaguaje también ha sido Presidente de su nacionalidad Secoya ​, Dirigente de Educación Regional de la CONFENIAE y Director Provincial de Educación Intercultural Bilingüe de Sucumbios desde 2001 a 2003; y Director de Educación de las Nacionalidades Siona, Secoya y Cofan del Ecuador en Sucumbíos.\\nPor delegación de la OISE es el vocero oficial de la nacionalidad Secoya en el juicio contra la petrolera Texaco, por el desastre social y ambiental causado en la Amazonía ecuatoriana."},{"page_url":"https://pl.wikipedia.org/wiki/Powiat_augustowski","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Main_roads_in_powiat_augustowski_pl.svg","page_title":"Powiat augustowski","context_page_description":"Powiat augustowski – powiat w Polsce, utworzony w 1999 roku w ramach reformy administracyjnej. Jego siedzibą jest miasto Augustów.\\nW skład powiatu wchodzą:\\ngminy miejskie: Augustów\\ngminy miejsko-wiejskie: Lipsk\\ngminy wiejskie: Augustów, Bargłów Kościelny, Nowinka, Płaska, Sztabin\\nmiasta: Augustów, Lipsk"},{"page_url":"https://fr.wikipedia.org/wiki/Drassodes_lapidosus","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Drassodes_7640.jpg","page_title":"Drassodes lapidosus","context_page_description":"Drassodes lapidosus est une espèce d'araignées aranéomorphes de la famille des Gnaphosidae."},{"page_url":"https://fr.wikipedia.org/wiki/Golf_Abbaye_de_Sept_Fontaines","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Golf_abbaye_7-Fontaines_Ardennes_France_vue02.JPG","page_title":"Golf Abbaye de Sept Fontaines","context_page_description":"Le Golf de l'Abbaye de Sept Fontaines est à Fagnon, commune française située dans le département des Ardennes et la région Champagne-Ardenne."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%A5%BF%E8%8B%91%E7%AB%99_(%E5%8C%97%E4%BA%AC%E5%B8%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Exit_B%2C_Xiyuan_Station_02.JPG","page_title":"西苑站 (北京市)","context_page_description":"西苑站位于北京市海淀区青龙桥街道，是北京地铁4号线和16号线，以及远景规划的15号线二期三条线路间的一座换乘车站。在最初确定4号线的站名时，此站由“颐和园站”重命名为“西苑站”。4号线车站于2009年9月28日随北京地铁4号线正式开通投入使用，16号线车站则于2016年12月31日启用。\\n该站是西苑交通枢纽的一部分。"},{"page_url":"https://en.wikipedia.org/wiki/3200th_Proof_Test_Group","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/ba/Republic_XR-12_Rainbow_-_Eglin_AFB_Florida.jpg","page_title":"3200th Proof Test Group","context_page_description":"The 3200th Proof Test Group is an inactive United States Air Force unit. It was last active with the Air Armament Center, based at Eglin AFB, Florida. It was inactivated on 1 July 1953."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%81%D8%B1%D9%8A%D9%82_%D8%A7%D9%84%D8%AA%D8%AE%D8%B7%D9%8A%D8%B7_%D8%B4%D8%AA%D9%8A%D9%84%D8%AF%D9%88%D8%B1%D9%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Hochhaus_Deutsche_Welle_K%C3%B6ln-3588.jpg","page_title":"فريق التخطيط شتيلدورف","context_page_description":"فريق التخطيط شتيلدورف كانت مجموعة من المهندسين المعماريين الألمان في سنوات السبعينات والثمانينات من القرن الماضي."},{"page_url":"https://he.wikipedia.org/wiki/%D7%93%D7%A8%D7%A7%D7%95%D7%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/The_dragon_who_kept_watch._Illustration_by_Cecile_Walton%2C_1920..jpg","page_title":"דרקון","context_page_description":"דרקון הוא יצור מיתי בעל מאפיינים של זוחל ענק.\\nהדרקון הוא אחד מהיצורים הנפוצים ביותר במיתולוגיות של עמים שונים. תכונותיו הפיזיות ויכולותיו העל-טבעיות תוארו באופנים שונים ומגוונים, ובתרבויות שונות התפתחו מיתוסים נפרדים לגביו.\\nהיצורים מהם נלקחו הדרקונים הם רבים ושונים, אם כי אפשר לכלול בהם נחשים שונים, תנינים, עטלפים, לטאות ענק ובעידן המודרני גם דינוזאורים ופטרוזאורים נכחדים. נראה שמאובניהם הענקים בעלי מאפייני זוחלים של דינוזאורים ופטרוזאורים הם מקור ההשראה לדרקונים ענקיים בעלי שיניים חדות וכנפי עור.\\nדרקונים אינם קיימים, אך יש כמה לטאות ויצורים נוספים המכונים \\"דרקונים\\", בהם: לטאת הענק דרקון קומודו, משפחת החרדוניים המכונה \\"לטאות דרקון\\", סוסון האצה וסוסון עשב המכונים \\"דרקון ים עלי/עשבי\\", \\"דגי הדרקון\\", הדג פגסוס דרקוני.\\nהשפיריות מכונות גם \\"זבובי דרקון\\", בנוסף לעצי הדרקון."},{"page_url":"https://fr.wikipedia.org/wiki/Fiesso_d%27Artico","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Fiesso_d_artico_45.424401%2C12.0749.jpg","page_title":"Fiesso d'Artico","context_page_description":"Fiesso d'Artico est une commune italienne de la ville métropolitaine de Venise dans la région Vénétie en Italie. La ville est jumelée avec la commune de St Marcellin."},{"page_url":"https://nl.wikipedia.org/wiki/Jean-Pierre_Cassel","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Jean-Pierre_Cassel_2006.jpg","page_title":"Jean-Pierre Cassel","context_page_description":"Jean-Pierre Cassel was een Franse acteur.\\nCassel werd tapdansend ontdekt op het toneel door Gene Kelly. Hij vroeg hem voor een filmopname die in Parijs zou plaatsvinden. Cassel verwierf vervolgens veel faam in de jaren 50 als held in een aantal komediefilms van Philippe de Broca.\\nIn de jaren 60 en 70 werkte Cassel onder meer Claude Chabrol, Luis Buñuel, Ken Annakin, Gérard Brach, Richard Lester, Sidney Lumet en Joseph Losey. Hij speelde onder andere in de films Les Jeux de l'Amour en Le Farceur.\\nTwee van Cassels grootste rollen had hij in de jaren 90. In 1990 speelde hij in Vincent & Theo, en in 1994 in Prêt-à-Porter van Robert Altman. In totaal speelde hij in zijn carrière in 110 films. Zo stond hij in 2007 nog in Le scaphandre et le papillon en in 2008 in zijn laatste filmrol in Astérix aux jeux olympiques.\\nIn 2006 keerde Cassel terug naar het toneel. Hij speelde in het stuk Jean-Pierre Cassel chante et danse Gainsbourg Suite als hommage aan de bekende regisseur en zanger Serge Gainsbourg. Cassel kende Gainsbourg vanaf de jaren 50. In het stuk werd een aantal oude nummers van Gainsbourg gezongen, en ook drie eerder gepubliceerde nummers van hem."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%AD%D0%BA%D1%81%D1%86%D0%B5%D0%BD%D1%82%D1%80%D0%B8%D0%BA_(%D1%82%D0%B5%D1%85%D0%BD%D0%B8%D0%BA%D0%B0)","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/30/Quick_release_scewer.JPG","page_title":"Эксцентрик (техника)","context_page_description":"Эксцентрик — диск или сектор диска, насаженный на вращающийся вал так, что ось вращения диска параллельна, но не совпадает с осью вращения вала, для преобразования вращательного движения в поступательное. Расстояние между осями называется эксцентриситетом.\\nЭксцентриком принято называть только сам диск со смещённой осью вращения, а созданные на его основе механизмы и приспособления, как правило, носят самостоятельные названия.\\nОсновное достоинство эксцентрика — простота конструкции и изготовления, недостаток при использовании в регулировании — нелинейность перемещения."},{"page_url":"https://de.wikipedia.org/wiki/Narsinghgarh_(Staat)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Rajgarhflag.png","page_title":"Narsinghgarh (Staat)","context_page_description":"Narsinghgarh war einer der Fürstenstaaten der Central India Agency von Britisch-Indien im heutigen Bundesstaat Madhya Pradesh. Seine Hauptstadt war der Ort Narsinghgarh. Aus dem Vorgängerstaat Umatwara, dessen Rajputen-Fürst seit 1448 den Titel Rawat trug, entstanden 1681 durch Erbteilung die Fürstentümer Rajgarh und Narsinghgarh. Im Verlauf der Marathenkriege kam Narsingharh unter die Oberhoheit des Holkar von Indore. Narsingharh war 1818–1947 britisches Protektorat und hatte 1948 eine Fläche von 1920 km² und 140.000 Einwohner. Rawat Hanwant Singhji wurde 1872 zum Raja erhoben.\\nNarsinghgarh vollzog am 15. Juni 1948 den Anschluss an Indien und trat am 16. Juni der Fürstenunion Madhya Bharat bei. Am 1. November 1956 wurden alle Fürstenstaaten der Union aufgelöst und dem Bundesstaat Madhya Pradesh einverleibt."},{"page_url":"https://kn.wikipedia.org/wiki/%E0%B2%B8%E0%B2%B0%E0%B3%8D%E0%B2%95%E0%B3%8B%E0%B2%9C%E0%B2%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Anti_Sarko_480342767_8b13c8532f_o_d.jpg","page_title":"ಸರ್ಕೋಜಿ","context_page_description":"ನಿಕೋಲಸ್ ಸರ್ಕೋಜಿ ಯವರು 23 ನೇ ಹಾಗೂ ಪ್ರಸ್ತುತ ಫ್ರೆಂಚ್ ರಿಪಬ್ಲಿಕ್‌ನ ಅಧ್ಯಕ್ಷರೂ ಮತ್ತು ನಿವೃತ್ತ ರಾಜನೀತಿ ತಜ್ಞ ಹಾಗೂ ಆಂಡೋರ್ರಾದ ನಿಷ್ಠಾ ಬದ್ಧ ರಾಜಕುಮಾರರಾಗಿದ್ದಾರೆ.\\nಅವರು 10ದಿನಗಳ ಮುಂಚೆ ಸಮಾಜವಾದಿ ಪಕ್ಷದ ಅಭ್ಯರ್ಥಿಯೆನಿಸಿದ್ದ ಸೆಗೊಲಿನ್ ರಾಯಲ್ರನ್ನು ಸೋಲಿಸಿದ ನಂತರ 2007 ಮೇ 16 ರಂದು ಅಧಿಕಾರ ವಹಿಸಿಕೊಂಡರು.\\nಅವರ ಅಧ್ಯಕ್ಷತೆಗಿಂತ ಮೊದಲು, ಅವರು ಯೂನಿಯನ್ ಫಾರ್ ಪಾಪ್ಯುಲರ್ ಮೂವ್ಮೆಂಟ್ ನ ನಾಯಕನಾಗಿದ್ದರು.\\nಅವರು ಜೀನ್‌ಪೀಯರ್ರೆ ರಾಫಾರಿನ್ರ ಮೊದಲ ಎರಡು ಸರ್ಕಾರಗಳಲ್ಲಿ ಜಾಕ್ವೆಸ್ ಚಿರಾಕ್ನ ಅಧ್ಯಕ್ಷತೆಯ ಕೆಳಗೆ ಆಂತರಿಕ ವ್ಯವಹಾರದ ಗೃಹ ಖಾತೆಯ ಮಂತ್ರಿಯಾಗಿ ಸೇವೆಸಲ್ಲಿಸಿದರು. ಅವರು ವಿದೇಶಾಂಗ ಮಂತ್ರಿಯಾಗಿ ರಾಫಾರಿನ್‌ರ ಸರ್ಕಾರದಡಿಯಲ್ಲಿ ನೇಮಕವಾದರು. ಹಾಗೂ ಡೋಮಿನಿಕ್ ಡೆ ವಿಲ್ಲೆಪಿನ್ ರ ಸರ್ಕಾರದಲ್ಲಿ ಮತ್ತೊಮ್ಮೆ ಗೃಹ ಖಾತೆಯ ಮಂತ್ರಿಯಾದರು.\\n2004 ರಿಂದ 2007 ರವರೆಗೆ ಸರ್ಕೋಜಿ ಹೌಟ್ಸ್-ಡೆ-ಸೈನ್ ವಿಭಾಗದ ಜನರಲ್ ಕೌನ್ಸಿಲ್ನ ಅಧ್ಯಕ್ಷರು ಕೂಡ ಆಗಿದ್ದರು. ಹಾಗೂ 1983 ರಿಂದ 2002 ರವರೆಗೆ ಫ್ರಾನ್ಸ್‌ನ ಪ್ರಾಂತೀಯ ಭಾಗದ, ಒಬ್ಬ ಅತ್ಯಂತ ಸಂಪದ್ಭರಿತ ನಿಯೈಲ್ಲಿ-ಸರ್-ಸೈನೆಯ ಮೇಯರ್ ಆಗಿದ್ದರು.\\nಯಾಗಿದ್ದ ಇಡೌರ್ಡ್ ಬಲ್ಲದುರ್ನ ಸರ್ಕಾರದಲ್ಲಿ, ಅಂದರೆ ಫ್ರಾನ್‌ಕೋಯಿಸ್ ಮಿಟ್ಟೆರ್ರಾನ್ಡ್ರ ಅಂತಿಮ ಅವಧಿಯಲ್ಲಿನ ಆಯವ್ಯಯ ಮಂತ್ರಿಕೂಡ ಸರ್ಕೋಜಿ ಆಗಿದ್ದರು.\\nಫ್ರೆಂಚ್ ಆರ್ಥಿಕತೆಯನ್ನು ಪುನರುಜ್ಜೀವನಗೊಳಿಸಿದ್ದಕ್ಕಾಗಿ ಸರ್ಕೋಜಿಯು ಜನಪ್ರಿಯಗೊಂಡಿದ್ದಾರೆ."},{"page_url":"https://cy.wikipedia.org/wiki/Dover,_Ohio","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/65/OHMap-doton-Dover.png","page_title":"Dover, Ohio","context_page_description":"Dinas yn Tuscarawas County, yn nhalaith Ohio, Unol Daleithiau America yw Dover, Ohio. ac fe'i sefydlwyd ym 1806."},{"page_url":"https://tt.wikipedia.org/wiki/%D0%A0%D0%B0%D0%BD%D1%81%D0%BF%D0%B0%D0%BA-%D0%BB%D0%B5-%D0%9E","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/67/Map_commune_FR_insee_code_68264.png","page_title":"Ранспак-ле-О","context_page_description":"Ранспак-ле-О — Франциянең Югары Рейн департаментына караган коммуна, Сен-Луи кантонына карый."},{"page_url":"https://en.wikipedia.org/wiki/Santa_Isabel_College_Manila","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/18/Santa_Isabel_College_Main_Facade.jpg","page_title":"Santa Isabel College Manila","context_page_description":"The Santa Isabel College, is a Private, Roman Catholic College located in Ermita, Manila, in the Philippines. Founded on 24 October 1632. Santa Isabel College is one of the oldest colleges in the Philippines and in Asia. It is owned and operated by the nuns of the Daughters of Charity."},{"page_url":"https://de.wikipedia.org/wiki/St._Bartholom%C3%A4us_(Ortenberg)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/St._Bartholom%C3%A4us_%28Ortenberg%29_jm53871.jpg","page_title":"St. Bartholomäus (Ortenberg)","context_page_description":"St. Bartholomäus ist die römisch-katholische Pfarrkirche von Ortenberg im Ortenaukreis. Sie wurde in den 1820er Jahren in klassizistischem Stil erbaut und gehört zur Seelsorgeeinheit Vorderes Kinzigtal des Erzbistums Freiburg. Nach vier drastischen Umgestaltungen zeigt sich das Innere heute als ein Miteinander von nazarenischer und zeitgenössischer Kunst.\\nIhre Geschichte – und die Geschichte des Ortes – hat besonders der aus Ortenberg stammende Heimatforscher Franz X. Vollmer erforscht"},{"page_url":"https://it.wikipedia.org/wiki/Luisa_Francesca_di_Borbone","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/The_sisters_Mademoiselle_de_Blois_and_Mademoiselle_de_Nantes_by_Philippe_Vignon.jpg","page_title":"Luisa Francesca di Borbone","context_page_description":"Luisa Francesca di Borbone, Légitimée de France, era la maggiore tra le figlie di re Luigi XIV di Francia e la sua amante, Madame de Montespan. Si dice che il suo nome le provenisse da Louise de La Vallière, la donna che sua madre aveva rimpiazzato nel cuore del Re Sole, che fu tra l'altro sua madrina di battesimo. Come pure la sorella ed il fratello più giovani è tra gli antenati dell'attuale Casa d'Orléans."},{"page_url":"https://it.wikipedia.org/wiki/Lichtenegg","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6a/Lichtenegg.JPG","page_title":"Lichtenegg","context_page_description":"Lichtenegg è un comune austriaco di 1 041 abitanti nel distretto di Wiener Neustadt-Land, in Bassa Austria."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B9%E3%83%BC%E3%83%91%E3%83%BC%E3%82%B7%E3%83%BC%E3%83%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/744-10993_Tokai_Super_Seat_Reclining_on.jpg","page_title":"スーパーシート","context_page_description":"スーパーシートとは、公共交通機関の座席に設けられる特別席の名称の一つである。"},{"page_url":"https://ro.wikipedia.org/wiki/Cristos_M%C3%A2ntuitorul","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Cristo_Redentor_Rio_de_Janeiro_4.jpg","page_title":"Cristos Mântuitorul","context_page_description":"Cristo Redentor este un monument în Rio de Janeiro, amplasat la sud de oraș, pe muntele Corcovado, în pădurea Tijuca. Monumentul a fost planificat cu ocazia aniversării a 100 de ani de la declararea independenței Braziliei. Schițele proiectului au fost întocmite de inginerul Heitor Silva Costa. Din motive financiare, numai după zece ani a început construcția lui.\\nCu sprijinul Franței și Vaticanului s-a reușit realizarea proiectului și sfințirea statuii la data de 12 octombrie 1931. Edificiul, reprezentativ pentru Art Deco, are o înălțime de 30 metri, împreună cu soclul 38 de metri. Soclul ocupă o suprafață de 100 m². Lățimea statuii, la nivelul brațelor, este de 28 metri, iar masa sa este de 1.145 de tone, masa aproximativă a capului este de 30 de tone, iar cea a fiecărei mâini de 8 tone. Capul măsoară 3,75 m, fiecare mână 3,20 m, lărgimea tunicii este de 8,50 m. Anvergura între mâini este de 28 de metri. În soclu se află o capelă cu hramul Nossa Senhora Aparecida, unde pot intra 150 de persoane și unde sunt celebrate căsătorii și botezuri. Mulajul din ghips, precum și sculptura a fost efectuată de sculptorul francez Paul Landowski."},{"page_url":"https://de.wikipedia.org/wiki/Oberharzer_Wasserregal","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c7/UHasenbAL.JPG","page_title":"Oberharzer Wasserregal","context_page_description":"Das Oberharzer Wasserregal oder die Oberharzer Wasserwirtschaft ist ein hauptsächlich im 16. bis 19. Jahrhundert geschaffenes System zur Umleitung und Speicherung von Wasser, das Wasserräder in den Bergwerken des Oberharzer Bergbaus antrieb. Es gilt als das weltweit bedeutendste vorindustrielle Wasserwirtschaftssystem des Bergbaus.\\nDie zur Erzeugung von Wasserkraft entstandenen Anlagen stehen seit 1978 als Kulturdenkmal unter Denkmalschutz. Am 31. Juli 2010 wurden die Bauwerke wegen ihrer Einzigartigkeit und ihres großen Umfanges als Erweiterung der bereits existierenden Welterbestätte „Bergwerk Rammelsberg und Altstadt von Goslar“ vom UNESCO-Welterbekomitee unter Bezeichnung Bergwerk Rammelsberg, Altstadt von Goslar und Oberharzer Wasserwirtschaft zum UNESCO-Weltkulturerbe erklärt.\\nDie Anlagen werden zu einem großen Teil weiterhin betrieben, wobei der Zweck überwiegend in der Pflege einer historischen Kulturlandschaft, im Naturschutz, Tourismus und im Badebetrieb besteht. Wasserwirtschaftlich gesehen haben einige Stauteiche noch einen Zweck im Hochwasserschutz und in der Trinkwassergewinnung."},{"page_url":"https://ro.wikipedia.org/wiki/%C8%98erban_%C8%9Ai%C8%9Beica","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/%C8%98erban_%C8%9Ai%C8%9Beica_1980%2C_600x800.jpg","page_title":"Șerban Țițeica","context_page_description":"Șerban Țițeica a fost un fizician și profesor universitar român, membru titular al Academiei Române și vicepreședinte al acesteia. Este unanim considerat drept fondatorul școlii române de fizică cuantică.\\nA făcut cercetări în domeniul termodinamicii, a fizicii statistice, mecanicii cuantice, fizicii atomice și în fizica particulelor elementare."},{"page_url":"https://de.wikipedia.org/wiki/Joel_Brandenstein","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Joel_Brandenstein_-_Pressefoto_2017_-_2.jpg","page_title":"Joel Brandenstein","context_page_description":"Joel Brandenstein ist ein deutscher Popsänger aus Ratingen, der über das Internet bekannt wurde."},{"page_url":"https://en.wikipedia.org/wiki/Dagsn%C3%A4s_Castle","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Dagsn%C3%A4s_slott.jpg","page_title":"Dagsnäs Castle","context_page_description":"Dagsnäs Castle is a castle in Sweden, located 9 km south of Skara at Lake Hornborga.\\nOver the years several runestones from the region have been moved to the castle grounds, including Vg 59 from Norra Härene, Vg 67 from Saleby, Vg 122 from Abrahamstorp, Vg 184 from Smula, and Vg 186 from Timmele."},{"page_url":"https://gl.wikipedia.org/wiki/Liv_Tyler","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/LivTylerJune08.jpg","page_title":"Liv Tyler","context_page_description":"Liv Rundgren, máis coñecida como Liv Tyler, nada o 1 de xullo de 1977 en Nova York, é unha actriz de cinema e modelo estadounidense. É filla de Steven Tyler, vocalista de Aerosmith. Deveu coñecida principalmente polo seu papel como Arwen na triloxía cinematográfica de O Señor dos Aneis, realizada polo neozelandés Peter Jackson."},{"page_url":"https://hu.wikipedia.org/wiki/STS%E2%80%93125","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Hubble_docked_in_the_cargo_bay.jpg","page_title":"STS–125","context_page_description":"Az STS–125 az amerikai űrrepülőgép-program 124., az Atlantis űrrepülőgép 30. repülése."},{"page_url":"https://sv.wikipedia.org/wiki/Puerto_Varas_(ort)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Puerto_Varas_Osorno.jpg","page_title":"Puerto Varas (ort)","context_page_description":"Puerto Varas är en ort i Chile. Den ligger i provinsen Provincia de Llanquihue och regionen Región de Los Lagos, i den södra delen av landet, 900 km söder om huvudstaden Santiago de Chile. Puerto Varas ligger 60 meter över havet och antalet invånare är 24 958. Den ligger vid sjön Lago de Llanquihue.\\nTerrängen runt Puerto Varas är huvudsakligen platt. Puerto Varas ligger nere i en dal. Den högsta punkten i närheten är 160 meter över havet, 1,3 km nordväst om Puerto Varas. Runt Puerto Varas är det ganska tätbefolkat, med 96 invånare per kvadratkilometer. Närmaste större samhälle är Puerto Montt, 16,6 km söder om Puerto Varas.\\nTrakten runt Puerto Varas består i huvudsak av gräsmarker. Kustklimat råder i trakten. Årsmedeltemperaturen i trakten är 8 °C. Den varmaste månaden är januari, då medeltemperaturen är 14 °C, och den kallaste är juli, med 2 °C. Genomsnittlig årsnederbörd är 2 332 millimeter. Den regnigaste månaden är juni, med i genomsnitt 351 mm nederbörd, och den torraste är november, med 93 mm nederbörd."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A1%D7%9E%D7%95%D7%90%D7%94_%D7%94%D7%90%D7%9E%D7%A8%D7%99%D7%A7%D7%A0%D7%99%D7%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/American_Samoa_license_plate_2006.jpg","page_title":"סמואה האמריקנית","context_page_description":"סמואה האמריקנית היא אזור מבודד של ארצות הברית, הממוקם בדרום האוקיינוס השקט, מזרחית לסמואה."},{"page_url":"https://eu.wikipedia.org/wiki/Tilburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/NL_-_locator_map_municipality_code_GM0855_%282016%29.png","page_title":"Tilburg","context_page_description":"Tilburg Holandako hegoaldean, zehazki Ipar Brabante probintzian, kokatuta dagoen hiri bat da. Udalerri berean, Tilburg-ez gain, Berkel-Enschot y Udenhout herriak daude. Holanda osoko seigarren herririk populatuena da 201.259 biztanlerekin eta bigarrena, Eindhoven-en atzetik, Brabant probintzian."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%9E%E3%83%BC%E3%83%81%E3%82%BD%E3%83%B3%E3%83%BB%E3%83%95%E3%82%A9%E3%83%BC%E3%83%AB%E3%82%BA%E5%9B%BD%E7%AB%8B%E5%85%AC%E5%9C%92","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Leopard_%28Panthera_pardus%29_%286934532302%29.jpg","page_title":"マーチソン・フォールズ国立公園","context_page_description":"マーチソン・フォールズ国立公園は、ウガンダ野生生物局によって管理されているウガンダの国立公園である。ウガンダ北西部に位置し、アルバート湖岸から内陸方面のヴィクトリア・ナイル周辺およびカルマ滝に至る範囲まで広がっている。\\n公園は隣接する748平方キロメートルのブグング野生生物保護区と720平方キロメートルのカルマ野生生物保護区とともに、マーチソン・フォールズ保護区を形成している。"},{"page_url":"https://hu.wikipedia.org/wiki/A_2008-as_Tour_de_France_szakaszai_(12%E2%80%9321.)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/2008-etappe18.svg","page_title":"A 2008-as Tour de France szakaszai (12–21.)","context_page_description":"Ez a szócikk a 2008-as Tour de France utolsó 10 szakaszát mutatja be. Az első 11 szakasz leírása A 2008-as Tour de France szakaszai című lapon található.\\nA háromhetes verseny második felében 4 sík, 1 közepesen magas és 3 magas hegyvidéki szakasz és egy újabb egyéni időfutam várt a versenyzőkre. A Pireneusok után az Alpok hegyei közé ment a mezőny, ahol áttértek Olaszországba is.\\nA párizsi befutó július 27-én volt a Champs-Élysées-n."},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_munic%C3%ADpios_da_Bahia","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a5/Bandeira_de_Brotas.png","page_title":"Lista de municípios da Bahia","context_page_description":"Esta lista de municípios da Bahia está organizada alfabeticamente. Ao todo, estão listados os 417 municípios da Bahia, o estado brasileiro com o quarto maior número deles. Os municípios baianos representam quase 7,5% dos 5 570 municípios em todo território nacional. Diversos em muitos termos, os municípios são a unidade político-administrativa do país por estarem mais próximos ao cotidiano das pessoas. Dentre eles, o município de Salvador é capital estadual da Bahia, entretanto, a sede do governo estadual é temporariamente transferida todo 25 de junho para o município de Cachoeira, desde 2007. E para além dos símbolos nacionais e estaduais, todos os municípios podem também ter símbolos próprios, o que inclui as bandeiras e brasões de armas.\\nNo Brasil, desde a constituição de 1988, os municípios são um dos entes autônomos da federação brasileira. A Constituição do Estado da Bahia de 1989 os definiu como \\"unidades político-administrativas autônomas\\" em que o estado está dividido e \\"unidades integrantes da República Federativa do Brasil, dotadas de autonomia política, administrativa e financeira\\"."},{"page_url":"https://en.wikipedia.org/wiki/Rados%C5%82aw_Kaw%C4%99cki","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Rados%C5%82aw_Kaw%C4%99cki.jpg","page_title":"Radosław Kawęcki","context_page_description":"Radosław Kawęcki is a Polish competitive swimmer who specializes in backstroke events. He currently represents the Cali Condors which is part of the International Swimming League. Kawęcki won the silver medal in the 200 m backstroke at the 2013 and 2015 World Aquatics Championships, and was twice the 200 m backstroke short course world champion. He is an 8-time European champion in the backstroke events. Kawęcki finished fourth at the 2012 Summer Olympics in London in the 200-meter backstroke."},{"page_url":"https://fr.wikipedia.org/wiki/Sussargues","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Vue_a%C3%A9rienne_de_Sussargues.jpg","page_title":"Sussargues","context_page_description":"Sussargues est une commune française située dans le département de l'Hérault en région Occitanie.\\nSes habitants sont appelés les Sussarguois."},{"page_url":"https://nl.wikipedia.org/wiki/Havelberg","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b3/Havelberg_in_SDL.png","page_title":"Havelberg","context_page_description":"Havelberg is een stad in de Duitse deelstaat Saksen-Anhalt, gelegen in de Landkreis Stendal. De plaats telt 6.537 inwoners."},{"page_url":"https://eu.wikipedia.org/wiki/Down_House","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/44/ONBDOWNhouse.jpg","page_title":"Down House","context_page_description":"Down House Londrestik 23 kilometro hegoaldera dagoen etxea da. Downe herrian dago, aintzina Kent konderriaren parte zen eta 1965etik aurrera Bromley udalerrian dago.\\nCharles Darwin naturalista ospetsua bizi izan zen bertan eta lorategian egindako lanek hautespen naturalaren inguruko teoria eratzeko balio izan zioten. Gaur egun Home of Charles Darwin - Down House izeneko museoa dago bertan."},{"page_url":"https://eo.wikipedia.org/wiki/Aliseksemismo","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Anti_gay_San_Francisco.jpg","page_title":"Aliseksemismo","context_page_description":"Aliseksemismo estas socia sistemo de konduto, kutimoj, biaso kaj diskriminacio favoraj de aliseksemo kaj aliseksemaj rilatoj. La termino povas pritemi la senscian antaŭjuĝon ke aliaj personoj estas aliseksemaj, aŭ la vidpunkton, ke aliseksema rilatado estas la nura normo kaj do supera.\\nAliseksemismo inkluzivas tiajn vidpunktojn, kiuj pli estimas aliseksemulojn ol gejojn, lesbaninojn, ambaŭseksemulojn kaj anojn de aliaj seksaj minoritatoj. Oni do povas diri ke ĝi traktas seksajn minoritatojn kiel \\"duagradajn civitanojn\\". Aliseksemismaj personoj ne ĉiam estas aliseksemaj, ĉar oni povas internigi sistemajn biasojn kaj kutimajn opiniojn en sian menson."},{"page_url":"https://it.wikipedia.org/wiki/Giusformalismo","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Friedrich_Carl_von_Savigny_-_Imagines_philologorum.jpg","page_title":"Giusformalismo","context_page_description":"Per giusformalismo s'intende la corrente di pensiero filosofico-giuridica idealistica che studia la forma piuttosto che il contenuto del diritto.\\nL'espressione giusformalismo è controversa perché la tendenza formalistica, essendo propria del pensiero filosofico generale, solo in tempi recenti ha trovato una prima delimitazione teorica. Ciò comporta che la tendenza formalistica riflessa nel pensiero giuridico manca, non solo della lunga tradizione delle correnti giusnaturalistiche, ma di una definizione precisa. Parimenti, l'espressione formalismo giuridico, ancorché sia la più diffusa, evidenzia fenomeni vari e non coordinati fra loro. Raramente si rinviene un autore che si riferisca alla sua teoria qualificandola come formale. È più comune, al contrario, ritrovare una tale qualificazione nei detrattori di queste teorie. Per esempio, Hans Kelsen è stato tacciato di formalismo, ma, invero, egli scrisse solo un articolo riguardo a tale questione e preferì definire la sua teoria pura anziché formale."},{"page_url":"https://id.wikipedia.org/wiki/Sabuk_pengaman","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Seat_belt_BX.jpg","page_title":"Sabuk pengaman","context_page_description":"Sabuk pengaman adalah sebuah alat yang dirancang untuk menahan seorang penumpang mobil atau kendaraan lainnya agar tetap di tempat apabila terjadi tabrakan, atau, yang lebih lazim terjadi, bila kendaraan itu berhenti mendadak. Sabuk pengaman dirancang untuk mengurangi luka dengan menahan si pemakai dari benturan dengan bagian-bagian dalam kendaraan itu atau terlempar dari dalam kendaraannya. Di dalam mobil, sabuk pengaman juga mencegah penumpang yang duduk di kursi belakang membentur penumpang yang duduk di barisan depan."},{"page_url":"https://nl.wikipedia.org/wiki/Dracula_(1931)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Dracula_%281931_film_poster_-_Style_A%29.jpg","page_title":"Dracula (1931)","context_page_description":"Dracula is een Amerikaanse horrorfilm uit 1931, geproduceerd door Universal Pictures Co. Inc. De film is gebaseerd op de roman Dracula van Bram Stoker. De film geldt tegenwoordig als een klassieker."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AA%D9%8A_%D9%81%D9%8A_%D8%A2%D8%B1_%D8%AC%D8%B1%D9%8A%D9%81%D8%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/TVR_Griffith_400_-_007.jpg","page_title":"تي في آر جريفث","context_page_description":"تي في آر جريفث ‏ هي سيارة من تصنيع شركة تي في آر أنتجت بين سنوات 1991-2002.\\nبدأ إنتاج الجيل الثاني من السيارة في 2019."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%B2%D1%96%D0%B9%D1%81%D1%8C%D0%BA%D0%BE%D0%B2%D0%B8%D1%85_%D0%BB%D1%96%D1%82%D0%B0%D0%BA%D1%96%D0%B2_%D0%A1%D0%A8%D0%90","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8e/Curtiss_A-12_Shrike%28USAF%29.jpg","page_title":"Список військових літаків США","context_page_description":"Список військових літаків США — перелік військових літальних апаратів, у тому числі прототипів, передсерійних екземплярів та таких, що перебували на озброєнні у Повітряних силах Сполучених Штатів Америки."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%BE%D0%BD%D0%B0%D1%88%D0%B5%D0%BD%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Lymantria_monacha_MHNT.CUT.2012.0.357_col_de_Crocheto_Corse-du-Sud_Female.jpg","page_title":"Монашенка","context_page_description":"Монашенка, или шелкопряд-монашенка — ночная бабочка семейства волнянок, лесной вредитель. Бабочки летают по вечерам, гусеницы кормятся ночью."},{"page_url":"https://cy.wikipedia.org/wiki/Colomen_gynffonresog_y_Philipinau","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Pink_Bellied_Imperial_Pigeon.jpg","page_title":"Colomen gynffonresog y Philipinau","context_page_description":"Aderyn a rhywogaeth o adar yw Colomen gynffonresog y Philipinau a adnabyddir hefyd gyda'i enw gwyddonol Ducula poliocephala; yr enw Saesneg arno yw Philippine zone-tailed pigeon. Mae'n perthyn i deulu'r Colomennod sydd yn urdd y Columbiformes.\\nTalfyrir yr enw Lladin yn aml yn D. poliocephala, sef enw'r rhywogaeth."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AF%E3%83%AA%E3%82%B9%E3%83%86%E3%82%A3%E3%83%8A%E3%83%BB%E3%82%A2%E3%83%83%E3%83%97%E3%83%AB%E3%82%B2%E3%82%A4%E3%83%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Christina_Applegate_2014_Comic_Con_%28cropped%29.jpg","page_title":"クリスティナ・アップルゲイト","context_page_description":"クリスティナ・アップルゲイトはアメリカ合衆国カリフォルニア州ハリウッド出身の女優。テレビシリーズへの出演が多いコメディエンヌ。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%97%E3%83%A9%E3%82%A4%E3%83%89%E3%83%BB%E3%83%91%E3%83%AC%E3%83%BC%E3%83%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Gay_parade.jpg","page_title":"プライド・パレード","context_page_description":"プライド・パレードは、レズビアン・ゲイ・バイセクシュアル・トランスジェンダー文化を讃えるイベントをさす言葉。各時代における法的権利を求めるLGBTの社会運動の場ともなってきた。イベントは世界中の様々な都市で、ストーンウォールの反乱を記念した毎年6月を中心に行われている。"},{"page_url":"https://tr.wikipedia.org/wiki/Dahyun","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/180717_%EC%97%B4%EB%A6%B0%EC%9D%8C%EC%95%85%ED%9A%8C_%ED%8A%B8%EC%99%80%EC%9D%B4%EC%8A%A4_%2814%29.jpg","page_title":"Dahyun","context_page_description":"Kim Dahyun Güney Koreli şarkıcı.Ayrıca JYP Entertainment'e bağlı kız grubu Twice adlı grubun bir üyesidir. Sixteen adlı yarışma programında yaptığı Eagle Dance ile büyük bir popülerlik kazanmıştır."},{"page_url":"https://en.wikipedia.org/wiki/Clan_Ogilvy","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Earl_of_Findlater_arms.svg","page_title":"Clan Ogilvy","context_page_description":"Clan Ogilvy/Ogilvie is a Scottish clan. The Ogilvy family originate in Angus, Scotland. Gillebride, Earl of Angus, received a Barony from King William the Lion in 1163 and bestowed the lands of Ogilvy upon his son Gilbert. Of this extraction, Patrick de Ogilvy later swore fealty to the Hammer of the Scots and appears on the Ragman Rolls of 1296. His son Sir Patrick Ogilvie in turn received a charter from Robert the Bruce for the lands of Kettins. In 1491, King James IV elevated Sir James Ogilvy to the ranks of the peerage as Lord Ogilvy of Airlie.\\nIn 1639, the 7th Lord Ogilvy of Airlie was made the 1st Earl of Airlie by King Charles I for his support of the Crown in the Wars of the Three Kingdoms. David Ogilvy, 13th Earl of Airlie is the present chief of the Ogilvie clan. He served as Lord Chamberlain to Queen Elizabeth II and his brother Angus Ogilvy married Queen Elizabeth II's first cousin Princess Alexandra of Kent, granddaughter of King George V and Queen Mary."},{"page_url":"https://sv.wikipedia.org/wiki/Agriocnemis_pygmaea","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Agriocnemis_pygmaea_02539.jpg","page_title":"Agriocnemis pygmaea","context_page_description":"Agriocnemis pygmaea är en trollsländeart. Agriocnemis pygmaea ingår i släktet Agriocnemis och familjen dammflicksländor. IUCN kategoriserar arten globalt som livskraftig."},{"page_url":"https://en.wikipedia.org/wiki/Arbor_Day","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/EPN._D%C3%ADa_del_%C3%81rbol.jpg","page_title":"Arbor Day","context_page_description":"Arbor Day is a holiday in which individuals and groups are encouraged to plant trees. Today, many countries observe such a holiday. Though usually observed in the spring, the date varies, depending on climate and suitable planting season."},{"page_url":"https://no.wikipedia.org/wiki/Norsk_Hydro","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Silos_Karm%C3%B8y.jpg","page_title":"Norsk Hydro","context_page_description":"Norsk Hydro ASA er en norsk kraftprodusent, produsent av aluminium og aluminiumprodukter. Selskapet har 35 000 ansatte involvert i aktiviteter i mer enn 50 land på alle kontinenter.\\nDen norske stat ved Nærings- og fiskeridepartementet eide per 2018 34,26 prosent av aksjene i selskapet, mens Folketrygdfondet eide 4,2 %.\\nHovedkontoret ligger på Vækerø i Oslo, med Hilde Merete Aasheim som konsernsjef.\\nI Norge har Hydro fabrikker på Karmøy, Høyanger, Årdal, Sunndalsøra, Holmestrand, Magnor og Husnes.\\nKunstgjødselproduksjonen ble skilt ut i selskapet Yara International i 2004, og olje- og gassdivisjonen ble innfusjonert i Statoil som i den forbindelse skiftet navn til StatoilHydro 1. oktober 2007. Sjømatproduksjonen ble solgt i 2000 og er videreført i Marine Harvest.\\nNorsk Hydro inngikk i april 2010 en intensjonsavtale om å overta Vales aluminiumvirksomhet for 30 milliarder kroner. Transaksjonen gav Hydro full kontroll over og eierskap til buksittgruven Paragominas, 91 prosent i verdens største aluminaraffineri Alunorte og 51 prosent i aluminiumverket Albras."},{"page_url":"https://nl.wikipedia.org/wiki/Vijf_namen_van_de_farao","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/44/Serekh.png","page_title":"Vijf namen van de farao","context_page_description":"Er waren in totaal vijf namen van de farao. Deze namen hadden teksten in zich die bestonden uit heilwensen. Dit werd vastgesteld in het Middenrijk. Het bestaat uit een aantal vaste elementen en losse elementen. Dit waren titels die de vorst zelf aannam.\\nMen geloofde dat iemands naam voorspelde wat hij of zij in leven ging betekenen. In Afrika is dat tot op de dag van vandaag een veel voorkomende gedachte. In Egypte ging het geloof in naam-magie erg ver. Een goed voorbeeld daarvan is de mythe van Ra en Isis waarin Isis Ra volledig in haar macht krijgt door hem zijn ware naam te ontfutselen."},{"page_url":"https://vi.wikipedia.org/wiki/Chim_Saqqara","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Photo_2-plane_side_view1.jpg","page_title":"Chim Saqqara","context_page_description":"Chim Saqqara là một cổ vật hình con chim làm bằng gỗsycamore, được phát hiện trong cuộc khai quật lăng mộ Pa-di-Imen năm 1898 ở Saqqara, Ai Cập. Nó đã có niên đại khoảng 200 TCN, và hiện được lưu giữ trong Bảo tàng Cổ vật Ai Cập ở Cairo. Chim Saqqara có sải cánh 180 mm và nặng 39,12 g. Không ai hiểu rõ mục đích của nó vì thiếu tài liệu ghi chép về thời kỳ này."},{"page_url":"https://sv.wikipedia.org/wiki/Gonipterus","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Gonipterus_scutellatus_from_Coira%2C_Portos%C3%ADn%2C_Porto_do_Son%2C_Galicia%2C_Spain_-_20100830-3.jpg","page_title":"Gonipterus","context_page_description":"Gonipterus är ett släkte av skalbaggar. Gonipterus ingår i familjen vivlar."},{"page_url":"https://en.wikipedia.org/wiki/Rallye_rim","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Rallye_rim.jpg","page_title":"Rallye rim","context_page_description":"A Rallye rim is a term used in automotive design for optional race car inspired wheels. These wheels would have the appearance of the strong and lightweight wheels of a race car. Although less commonly used today the rallye rim was a popular option available in the muscle car era."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%88%D6%82%D5%AB%D5%AC%D5%B5%D5%A1%D5%B4_%D4%B4%D5%A5%D5%AC%D6%80%D5%AB%D5%B4%D6%83%D5%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/William_Dalrymple_2014.jpg","page_title":"Ուիլյամ Դելրիմփլ","context_page_description":"Ուիլյամ Դելրիմփլ, շոտլանդացի պատմաբան և գրող, արվեստի պատմաբան և վարչության անդամ, հայտնի է նաև որպես նշանավոր հաղորդավար և քննադատ։\\nՆրա գրքերը արժանացել են բազմաթիվ պարգևների և մրցանակների՝ «Դաֆֆ Կուպերի Հիշատակ»-ի, «Թոմաս Կուկ Շրջագայող Գրքեր»-ի, «Տարվա Երիտասարդ Բրիտանացի Գրող»-ի, «Հեմինգուեյ»-ի և «Ուոլֆսոն»-ի մրցանակներին։"},{"page_url":"https://en.wikipedia.org/wiki/Nykredit","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Krystallen_from_across_Kalvebod_Brygge.jpg","page_title":"Nykredit","context_page_description":"Dating back to 1851, Nykredit is one of Denmark's leading financial services companies with activities ranging from mortgage, retail and investment banking to insurance, leasing and fixed income trading and asset management.\\nThe Nykredit Group is the largest lender in Denmark and one of the major private bond issuers in Europe.\\nGroup profit before tax: DKK 3,205m\\nMarket share of mortgage banking: 43%\\nMarket share of commercial banking: 5.7%\\nIn 2003 Nykredit bought Totalkredit, a mortgage lending institution whose products are distributed by 103 regional and local banks.\\nIn 2008 Nykredit bought Forstædernes Bank and merged it with Nykredit Bank.\\nIn 2014 Nykredit lost a principal case at the Danish Supreme Court regarding service fees.\\nIn February 2016 Nykredit faced public outrage among their customers due to significantly increased service fees.\\nOn 9 September 2016 The Danish Consumer-ombudsman filed a police report regarding misleading marketing of service fees conducted by the subsidiary company Totalkredit."},{"page_url":"https://cs.wikipedia.org/wiki/P%C5%99%C3%ADd%C4%9Blek","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Savvino_storozhevsky_rozhdestva_bogoroditsy.jpg","page_title":"Přídělek","context_page_description":"Přídělek je přístavba pravoslavných chrámů nebo zvláštní vydělená část základní chrámové stavby určené k umístění vedlejšího oltáře s prestolem. Přídělky se staví proto, aby bylo možné v jeden den v témže chrámu sloužit vícero liturgií souběžně, jelikož v pravoslaví je dovoleno sloužit pouze jednu liturgii v jeden den na jednom prestolu."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%92%D0%B0%D1%81%D0%B8%D0%BB%D0%B5%D0%B2%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Assembly_of_Municipality_Vasilevo_%282%29.jpg","page_title":"Василево","context_page_description":"Василево — село во Општина Василево, во околината на градот Струмица и седиште на општината."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%BB%D0%BE%D0%B4%D1%82_%D1%84%D0%BE%D0%BD_%D0%AE%D1%80%D0%B3%D0%B5%D0%BD%D1%81%D0%B1%D1%83%D1%80%D0%B3,_%D0%9F%D0%B0%D0%B2%D0%B5%D0%BB_%D0%90%D0%B4%D0%BE%D0%BB%D1%8C%D1%84%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/J%C3%BCrgensburg.jpg","page_title":"Клодт фон Юргенсбург, Павел Адольфович","context_page_description":"Барон Павел Адольфович Клодт фон Юргенсбург — русский генерал, участник Первой мировой и Гражданской войн."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%8A%A4%EA%B8%B0%ED%83%80_%EC%97%AD_(%EA%B0%80%EB%82%98%EA%B0%80%EC%99%80%ED%98%84)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Keikyu_Sugita_Station_Sign.jpg","page_title":"스기타 역 (가나가와현)","context_page_description":"스기타역\\n은 일본 가나가와현 요코하마시 이소고구에 있는 게이힌 급행전철 본선의 철도역이다. 역 번호는 KK46이다."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9F%D0%B0%D0%BF%D1%8E%D1%81","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b3/Bio-papus-image-1.jpg","page_title":"Папюс","context_page_description":"Папюс е псевдоним на Жерар Анкос, френски окултист, кабалист и лекар."},{"page_url":"https://en.wikipedia.org/wiki/Koide,_Niigata","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/%E5%B0%8F%E5%87%BA%E3%82%B9%E3%82%AD%E3%83%BC%E5%A0%B4_%E4%B8%8A%E7%A9%BA%E5%86%99%E7%9C%9F.jpg","page_title":"Koide, Niigata","context_page_description":"Koide was a town located in Kitauonuma District, Niigata Prefecture, Japan. It is famous for its snowy ski resort.\\nAs of 2003, the town had an estimated population of 12,735 and a density of 423.93 persons per km². The total area was 30.04 km².\\nOn November 1, 2004, Koide, along with the town of Horinouchi, and the villages of Hirokami, Irihirose, Sumon and Yunotani, was merged to create the city of Uonuma."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E8%87%BA%E5%8C%97%E5%B8%82%E6%96%87%E5%8C%96%E8%B3%87%E7%94%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/%E9%99%B3%E6%82%85%E8%A8%98%E7%A5%96%E5%AE%85%E5%85%AC%E9%A4%A8%E5%BB%B3.jpg","page_title":"臺北市文化資產","context_page_description":"台北市文化资产是台北市各级古迹与其他文化资产。本表表列原则如下：\\n章节分类依中华民国《文化资产保存法》条文。\\n名称依照中华民国行政院文化部文化资产局所登录的名称。"},{"page_url":"https://bar.wikipedia.org/wiki/Mita-Linie","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Tokyo_subway_map_black_fixed_grey_mita.PNG","page_title":"Mita-Linie","context_page_description":"De Mita-Linie is a Metroline in Tokio, Japan, de om 27. Dezemba 1968 eaeffnd worn is und vo da Toei-U-Boh vawoitd wead. Af Koartn eascheind se in blau; de Bohhef drong'n Buachstom I gfoigd vo ana Zoih. In Planunga bsitzd de Linie de Numma 6.\\nDe Zuig vo da Mita-Linie vakeahn zamm mid da Tōkyū Meguro-Linie ob Meguro."},{"page_url":"https://fi.wikipedia.org/wiki/Saint-Quentin","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Monument_de_la_Bataille_de_Saint-Quentin_en_1557.jpg","page_title":"Saint-Quentin","context_page_description":"Saint-Quentin [sɛ̃ kɑ̃t̪ɛ̃] on Ranskan kunta ja noin 56 000 asukkaan kaupunki Somme-joen varrella Ranskan pohjoisosassa, noin 130 kilometriä Pariisista koilliseen. Se kuuluu Hauts-de-Francen hallintoalueen Aisnen departementtiin ja on sen ylivoimaisesti suurin kaupunki.\\nSaint-Quentinin kaupungintalo on vuonna 1509 valmistunut koristeellinen goottilaistyylinen rakennus, jossa on 173 veistosta.\\nSaint-Quentinin rautatieasemalta on yhteydet muun muassa Pariisiin, Reimsiin, Amiensiin ja Lilleen. Moottoritie A26 motorway kulkee kaupungista Reimsiin ja Calais’hen, tie A29 Amiensiin."},{"page_url":"https://pt.wikipedia.org/wiki/Coscinodiscophyceae","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/PSM_V41_D214_Stictodiscus_californicus.jpg","page_title":"Coscinodiscophyceae","context_page_description":"Coscinodiscophyceae sensu stricto é um grupo de algas do grupo das diatomáceas, também designadas por \\"radiadas centrais\\", caracterizadas por apresentarem forma cilíndrica e simetria radiada, onde a estrutura circular da valva está disposta num ponto central. O grupo aparentemente constitui um grupo basal, embora parafilético, das diatomáceas. Quando considerado em sensu lato equivale às diatomáceas Centrales."},{"page_url":"https://eo.wikipedia.org/wiki/Asahi_(batal%C5%9Dipo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Japanese_battleship_Asahi.jpg","page_title":"Asahi (batalŝipo)","context_page_description":"Asahi estis batalŝipo planita kaj konstruita en Britujo, ĉe la ŝipfabriko en Clydebank, Skotio, laŭ mendo de la Imperia Japana Mararmeo fine de la 19-a jarcento. Ĝi estis unu el pluraj ŝipegoj konstruitaj por Japanio en Britio, pro la manko de sufiĉe pezaj ŝipfabrikaj instalaĵoj en Japanio. Nelonge post ĝia alveno en Japanion, ĝi fariĝis la flagŝipo de la Konstanta Floto, la ĉefa militŝiparo de la IJM. Ĝi partoprenis ĉiun gravan marbatalon de la Rus-Japana Milito kaj suferis negravajn difektojn en la bataloj de la Flava Maro kaj de Cuŝima. Asahi ne partoprenis la unuan mondmiliton, sed aktivis en la siberia interveno.\\nReklasita kiel marborda defendoŝipo en 1921, du jarojn poste oni forigis la armilojn de Asahi akorde kun la postuloj de la Mararmea Traktato de Vaŝingtono; post tio ĝi servis kiel trejna ŝipo kaj provizoŝipo por submarŝipoj. Oni modifis ĝin por servi kiel submarŝipa savŝipo antaŭ ol meti ĝin en la rezervan floton en 1928. Malfrue en 1937, post la komenco de la dua ĉin-japana milito, oni reaktivigis la ŝipon kaj uzis ĝin por transporti soldatojn."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/La_Trinit%C3%A9-Porho%C3%ABt","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/91/Map_commune_FR_insee_code_56257.png","page_title":"La Trinité-Porhoët","context_page_description":"La Trinité-Porhoët sī ūi-tī Hoat-kok Bretagne toā-khu Morbihan koān ê chi̍t ê commune."},{"page_url":"https://fr.wikipedia.org/wiki/Eden_62","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Logo_eden_62_wikip%C3%A9dia.jpg","page_title":"Eden 62","context_page_description":"Eden 62 est un syndicat mixte dépendant du Conseil départemental du Pas-de-Calais qui a pour mission la gestion et la protection des sites naturels du Pas de Calais."},{"page_url":"https://it.wikipedia.org/wiki/Storia_di_Pescara","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Cappella_sant%27anna.jpg","page_title":"Storia di Pescara","context_page_description":"La storia di Pescara è poco conosciuta e alcuni momenti del passato sono ancora avvolti nell'oscurità. Non di meno, le origini della città sono antiche e legate alla posizione geograficamente favorevole come raccordo delle vie di comunicazione tra l'antica Roma e l'area dell'Adriatico.\\nEsisteva infatti un villaggio marino lungo la foce del fiume Pescara già dal I secolo a.C, chiamato Aternum od Ostia Aterni.\\nNei secoli successivi l'importanza della posizione strategica di Pescara, porta della grande valle che divide l'Abruzzo, connoterà costantemente lo sviluppo della sua vita economica e sociale, in un primo momento limitata alla funzione di baluardo di difesa militare dei regni meridionali e poi, dalla seconda metà del XIX secolo, caratterizzata da una fruttuosa attitudine ai traffici commerciali e al turismo balneare."},{"page_url":"https://ga.wikipedia.org/wiki/Stockton_Theas_(Toghcheantar_na_R%C3%ADochta_Aontaithe)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/StocktonSouth2007Constituency.svg","page_title":"Stockton Theas (Toghcheantar na Ríochta Aontaithe)","context_page_description":"Is toghcheantar i dTeach Theachtaí na Ríochta Aontaithe é Stockton Theas. Cruthaíodh sa bhliain 1983 é. Is é Paul Williams an sealbhóir reatha den suíochán."},{"page_url":"https://it.wikipedia.org/wiki/Specie_di_Stiphidiidae","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Nanocambridgea_gracilipes_male.jpg","page_title":"Specie di Stiphidiidae","context_page_description":"Di seguito sono descritte tutte le 135 specie della famiglia di ragni Stiphidiidae note al dicembre 2012."},{"page_url":"https://it.wikipedia.org/wiki/Gordiene","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Pinaca_Castle_Corduene_1.jpg","page_title":"Gordiene","context_page_description":"La Gordiene o Corduene o Conduene era un'antica regione situata nella Mesopotamia settentrionale, attualmente nella Turchia sud-orientale.\\nSecondo quanto viene riportato nell'Enciclopedia Britannica del 1911, la Gordiene è l'antico nome della regione di Bohtan. Essa viene menzionata come Beth Qardu nelle fonti siriache e descritta come un piccolo Stato vassallo tra Armenia e Persia, nella zona montagnosa a sud del lago di Van, nell'attuale Turchia, posta sulla sponda sinistra del Tigri.\\nEssa è stata citata come la regione dei Carduchi, un fertile distretto montano, ricco di pascoli. I tre principati di Corduene, Moxoene e Zabdicene vengono correlati da Toumanoff alle dinastie carduche. Il Regno di Gordiene emerse con il declino dell'Impero seleucida e per la maggior parte della sua storia, fu una provincia dell'Impero romano\\nriconoscendo la sovranità di Roma. Dal 189 al 90 a.C. godette di un periodo di indipendenza.\\nIl popolo della Gorduene era noto per avere adorato il dio del cielo hurrita Teshub. Essa venne identificata come stato curdo o proto-curdo."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%81%E0%B8%B2%E0%B8%A3%E0%B8%AA%E0%B8%A3%E0%B9%89%E0%B8%B2%E0%B8%87%E0%B8%A0%E0%B8%B2%E0%B8%9E%E0%B8%9B%E0%B8%A3%E0%B8%B0%E0%B8%AA%E0%B8%B2%E0%B8%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/User-FastFission-brain.gif","page_title":"การสร้างภาพประสาท","context_page_description":"การสร้างภาพประสาท หรือ การสร้างภาพสมอง เป็นการใช้เทคนิคต่าง ๆ เพื่อสร้างภาพทั้งโดยตรงหรือโดยอ้อมของโครงสร้าง หน้าที่ หรือการทำงานทางเภสัชวิทยา ของระบบประสาท\\nเป็นศาสตร์ใหม่ที่ใช้ในการแพทย์ ประสาทวิทยา และจิตวิทยา\\nแพทย์ที่ชำนาญเฉพาะในการสร้างและตีความภาพสมองในสถานพยาบาลเรียกตามภาษาอังกฤษว่า neuroradiologist\\nการสร้างภาพวิธีต่าง ๆ ตกอยู่ในหมวดกว้าง ๆ 2 หมวดคือ\\nการสร้างภาพโครงสร้างของระบบประสาทและการวินิจฉัยโรคแบบคร่าว ๆ เช่น เนื้องอก และความบาดเจ็บในกะโหลกศีรษะ\\nการสร้างภาพสมองโดยกิจ เช่น fMRI ซึ่งใช้วินิจฉัยโรคทางเมแทบอลิซึมและรอยโรคในสมองที่ละเอียดยิ่งขึ้น ใช้เพื่องานวิจัยทางประสาทวิทยาและทางจิตวิทยาประชาน และใช้สร้างส่วนต่อประสานระหว่างสมอง-คอมพิวเตอร์ ยกตัวอย่างเช่น ใช้เพื่อแสดงภาพกระบวนการประมวลข้อมูลในสมองได้โดยตรง การประมวลเช่นนี้จะเพิ่มเมแทบอลิซึมในบริเวณต่าง ๆ ของสมอง ซึ่งเน้นเป็นสีต่าง ๆ ในภาพขึ้นอยู่กับระดับเมแทบอลิซึม\\nส่วนการใช้ศาสตร์นี้โดยสร้างความขัดแย้งมากที่สุดก็คืองานวิจัยในการกำหนดความคิดหรืออ่านใจคน"},{"page_url":"https://id.wikipedia.org/wiki/Tombak_api","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Spurting_tube.jpg","page_title":"Tombak api","context_page_description":"Tombak api adalah sebuah senjata bubuk meriam paling awal yang muncul di Tiongkok pada abad ke-10 saat Perang Jin-Song. Senjata tersebut dimulai sebagai alat piroteknik kecil yang ditujukan sebagai senjata mirip tombak, yang dipakai untuk memberikan rasa kejut yang besar. Ketika bubuk mesiu membaik, kekuatan peledak meningkat, dan puing-puing atau pelet ditambahkan, memberikannya beberapa efek dari kombinasi penyembur api dan senapan modern, tetapi dengan jangkauan yang sangat pendek, dan hanya satu tembakan. Dalam tombak api yang lebih besar dan lebih kuat kemudian, mata tombaknya dibuang, karena versi ini terlalu sulit untuk digunakan dalam jarak dekat. Ini dianggap sebagai proto-meriam, pendahulu meriam tangan, dan leluhur semua senjata api. Beberapa tombak api terlalu besar untuk digunakan oleh seorang pria. Mereka ditempatkan di tanah dalam kerangka pendukung, dan dapat dianggap proto-meriam."},{"page_url":"https://cs.wikipedia.org/wiki/T%C5%99%C3%ADda_Fubuki","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Ayanami_II.jpg","page_title":"Třída Fubuki","context_page_description":"Třída Fubuki sestávala z dvaceti čtyř „torpédoborců první třídy“ japonského císařského námořnictva, postavených v letech 1926 až 1933. Jednotky třídy Fubuki byly prvními „speciálními torpédoborci“ císařského námořnictva. Velikostí i výzbrojí překonávaly všechny dosavadní japonské i zahraniční torpédoborce. Své konkurenty překonávaly jak silnou torpédovou vyzbrojí, tak i silnou dělostřeleckou výzbrojí složenou ze šesti 127mm kanónů ve třech zakrytých dělových věžích. Novinkou byl rovněž uzavřený můstek.\\nZ 24 postavených jednotek byla jedna ztracena při kolizi v roce 1934. Dalších 21 jednotek bylo ztraceno během bojů v Pacifiku. Osm z nich měly na svědomí letadla a stejný počet padl za oběť ponorkám. Čtyři jednotky byly ztraceny při střetech s americkými hladinovými plavidly a jedna jednotka najela na minu. Pouze dvě jednotky válku přežily a jedna z nich byla následně předána sovětskému námořnictvu."},{"page_url":"https://en.wikipedia.org/wiki/Studio_54","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Studio_54_%2848269674087%29.jpg","page_title":"Studio 54","context_page_description":"Studio 54 is a former disco nightclub, currently a Broadway theatre, located at 254 West 54th Street, between Eighth Avenue and Broadway in Midtown Manhattan, New York City. The building opened in 1927 as the Gallo Opera House. It operated as an entertainment venue under various names until 1942, when CBS began using it as a radio and television studio dubbed Studio 52.\\nIn 1977, Steve Rubell and Ian Schrager opened a nightclub in the building, retaining many of former TV and theatrical sets and naming it for its street. Launched at the peak of the disco dancing and music trend, the club became world-famous, noted for its celebrity guest lists, restrictive entry policies, and open club drug use. In 1980, the club shut down after its founders were convicted for evading taxes. They sold the club to Mark Fleischman, who reopened it, then sold it in 1984 to new owners, who closed it in 1986.\\nSince November 1998, the site has served as a venue for productions of the Roundabout Theatre Company and retains the name Studio 54. A separate restaurant and nightclub, Feinstein's/54 Below, operates in the basement of the building."},{"page_url":"https://br.wikipedia.org/wiki/Mindrailherez","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Francesco_Baracca.jpg","page_title":"Mindrailherez","context_page_description":"Mindrailherez a vez graet eus un arm emgefreek gant ur gambr o tegemer bolodoù treutoc'h evit an 20 milimetrad. An armoù dammheñvel met, o implij bolodoù tevoc'h a vez anvet kanolioù emgefreek.\\nPal kentañ ar mindrailherezioù a zo da reiñ un tan galloudusoc'h ha pelloc'h evit an armoù hiniennel gant un niver a dennoù kalz uheloc'h hag hiroc'h.\\nDonedigezh ar vindrailherez war an tachennoù-emgann a vez gwelet evel ur sin eus ar Reveulzi greantel o tont etrezek bed ar brezel.\\nBezañ e voe ar Gatling ar c'hentañ mindrailherez. Hervez hec'h ijiner e c'helled ober labour hanter-kant fuzuilh ganti. Dav e oa d'ar servijer mindrailherez treiñ un dornigell evit tennañ gant ur Gatling.\\nPeurliesañ e vez graet un diforc'h etre ur vindrailherez pounner hag ar mindrailherezioù enep-troadegiezh. Evit ar re bounnerañ ez eo dav kaout daou pe dri den evit o implijout: unan evit tennañ; un eil evit cheñch ar c'hanol goude ur mare, hag a-wechoù, un trede den evit dougen ar bolodoù."},{"page_url":"https://de.wikipedia.org/wiki/1903","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Wrightflyer.jpg","page_title":"1903","context_page_description":"1. Januar: Adolf Deucher wird zum dritten Mal Bundespräsident der Schweiz.\\n3. Januar: In Wien beginnt eine deutsch-tschechische Ausgleichskonferenz für Böhmen. Die Verwaltungsbezirke sollen in deutsche, tschechische und zweisprachige Bezirke neu gegliedert werden. Die Konferenz wird am 20. Januar 1903 ergebnislos abgebrochen, nachdem die Tschechen die Gleichberechtigung beider Sprachen forderten.\\n2. April: Die französische Regierung verpflichtet alle Gemeinden zum Bau öffentlicher Schulgebäude. 1600 konfessionelle Schulen müssen ihre Tätigkeit bis zum 31. Juli 1903 einstellen.\\n9. April: Der russische Zar setzt die finnische Verfassung außer Kraft. Ein Ausnahmegesetz gibt dem Generalgouverneur Nikolaj Bobrikow diktatorische Vollmachten.\\n19. April: In Kischinew/Russland kommt es zu dreitägigen Massenpogromen von russischen Christen gegen Juden, bei denen die Polizeikräfte nicht eingreifen. Nach internationalen Protesten erklärt das russische Innenministerium die Judenverfolgung mit deren sozialistischen Aufruhr gegen Zar Nikolaus II. Journalisten vermuten eher eine Sündenbock-Politik angesichts der Wirtschaftsmisere, der weitverbreiteten Armut und wachsenden Arbeiterunruhen.\\n1."},{"page_url":"https://da.wikipedia.org/wiki/Michael_Jackson","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d0/Michael_Jackson_statue_23444.JPG","page_title":"Michael Jackson","context_page_description":"Michael Joseph Jackson, med tilnavnet \\"Kongen af Pop\\", var en amerikansk musiker og en af de mest kommercielt succesrige entertainere. Hans unikke bidrag til musik og dans og hans privatliv, gjorde ham til en fremtrædende figur inden for populærkulturen i fire årtier.\\nHan er to gange optaget i Rock and Roll Hall of Fame, har flere rekorder i Guinness Rekordbog — deriblandt \\"Mest succesrige entertainer nogensinde\\" — 13 Grammy Awards, 13 singler som har ligget nr. 1 på hitlisten i USA, og et anslået samlet salgstal på over 750 millioner plader. Han var en betydelig filantropisk og humanitær sponsor af mange millioner dollars til 39 velgørenhedsorganisationer og skaffede også bidrag via sin egen Heal the World Foundation.\\nJackson begyndte sin solokarriere i 1971, efter debut i 1964 som medlem af The Jackson 5. Hans album Thriller fra 1982 er det til dags dato bedst-sælgende album nogensinde, ligesom fire andre — Off the Wall, Bad, Dangerous og HIStory — ligger blandt de bedst-sælgende. Han gjorde en række avancerede dansetrin som robotten og moonwalk meget populære."},{"page_url":"https://pt.wikipedia.org/wiki/Revolu%C3%A7%C3%A3o","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Isabella_II_of_Spain_in_exile.jpg","page_title":"Revolução","context_page_description":"Revolução é uma mudança abrupta no poder político ou na organização estrutural de uma sociedade que ocorre em um período relativamente curto de tempo. O termo é igualmente apropriado para descrever mudanças rápidas e profundas nos campos científico-tecnológico, econômico e comportamental humano."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%B1%9F%E8%8B%8F%E5%85%A8%E5%9B%BD%E9%87%8D%E7%82%B9%E6%96%87%E7%89%A9%E4%BF%9D%E6%8A%A4%E5%8D%95%E4%BD%8D%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Gate_of_Liu_brothers%27_former_home.jpg","page_title":"江苏全国重点文物保护单位列表","context_page_description":"本列表是中华人民共和国全国重点文物保护单位列表的子列表，列举在江苏省境内的全国重点文物保护单位。"},{"page_url":"https://hu.wikipedia.org/wiki/Hreblay_Emil","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Hreblay_Pulykateny%C3%A9szt%C3%A9s_1902.jpg","page_title":"Hreblay Emil","context_page_description":"Polonkai Hreblay Emil, teljes nevén: Hreblay Emil József Viktor mezőgazdász, szakíró. Főként az állattenyésztés, ezen belül a kisállattartás, különösen a baromfitenyésztés és -nemesítés területén alkotott maradandót, mind gyakorlati szervező munkájával, mind oktató műveivel. Irodalmi munkásságában a kerti növénytermesztés, a talajművelés- és kezelés ágazatával is foglalkozott."},{"page_url":"https://gl.wikipedia.org/wiki/Xestaci%C3%B3n_por_substituci%C3%B3n","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/33/Gefriersperma.JPG","page_title":"Xestación por substitución","context_page_description":"A xestación por substitución, xestación subrogada, maternidade subrogada, nai subrogada ou, máis popularmente, alugueiro de ventres, de úteros, é o proceso polo que unha muller xesta e dá a luz un fillo proveniente da implantación no seu útero dun óvulo doutra muller fecundado in vitro.\\nHabitualmente a muller que quere ser nai e non pode selo por problemas de infertilidade ten a posibilidade de someterse a un tratamento de fecundación artificial. Estes tratamentos de procreación medicamente asistida non só asisten a matrimonios, senón tamén a mulleres solteiras e parellas heterosexuais e homosexuais.\\nEn varios países existe unha regulación xurídica detallada dos procesos de xestación por substitución. Na actualidade en España a lei vixente nesta materia é a 14/2006, de 26 de maio, sobre técnicas de reprodución humana asistida, que non permite a xestación por substitución e están investigadas as axencias que operan."},{"page_url":"https://de.wikipedia.org/wiki/Greifswalder_Oie","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/View_onto_Greifswalder_Oie_02.jpg","page_title":"Greifswalder Oie","context_page_description":"Die Greifswalder Oie ist eine Insel in der südlichen Ostsee, die zum Bundesland Mecklenburg-Vorpommern gehört. Die etwa 54 Hektar große Insel liegt an der Schwelle des Greifswalder Boddens zur offenen Ostsee. Der darauf befindliche Leuchtturm trägt den gleichen Namen.\\nAdministrativ gehört die Greifswalder Oie zur Gemeinde Kröslin. Die Insel wird oft auch als das „Helgoland der Ostsee“ bezeichnet, da sie weiter vom Festland entfernt ist als andere deutsche Ostseeinseln. Die Insel selbst und die umliegenden Gewässer bis zur zwei Meter Wassertiefenlinie sind Naturschutzgebiet."},{"page_url":"https://fr.wikipedia.org/wiki/Navigation_dans_les_glaces","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Iceberg.jpg","page_title":"Navigation dans les glaces","context_page_description":"Le réchauffement climatique amènera de plus en plus les navires à emprunter les voies du Nord par les passages dits « passage du Nord-Est » et « passage du Nord-Ouest ».\\nLa navigation dans les glaces demeure une particularité dans le domaine maritime."},{"page_url":"https://id.wikipedia.org/wiki/Sibagot_Ni_Pohan","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Tugu_Raja_Sibagot_Nipohan_01.jpg","page_title":"Sibagot Ni Pohan","context_page_description":"Raja Sibagot Ni Pohan adalah seorang tokoh dalam marga Batak dari sub-suku Toba. Keturunan Sibagot Ni Pohan tersebar kedalam 15 marga, sedang marga Pohan adalah merupakan marga persatuan bagi seluruh keturunan Sibagot Ni Pohan. Keturunan Sibagot Ni Pohan berasal dari daerah Balige, Kabupaten Toba Samosir."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A3%D1%81%D0%BC%D0%BE%D0%BD%D0%BE%D0%B2,_%D0%98%D0%B1%D1%80%D0%BE%D0%B3%D0%B8%D0%BC_%D0%9A%D0%B5%D0%BD%D0%B4%D0%B6%D0%B0%D0%B5%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/%D0%A3%D1%81%D0%BC%D0%BE%D0%BD%D0%BE%D0%B2_%D0%98%D0%B1%D1%80%D0%BE%D0%B3%D0%B8%D0%BC_%D0%9A%D0%B5%D0%BD%D0%B4%D0%B6%D0%B0%D0%B5%D0%B2%D0%B8%D1%87.jpg","page_title":"Усмонов, Иброгим Кенджаевич","context_page_description":"Усмонов Иброгим Кенджаевич — доктор исторических наук, профессор."},{"page_url":"https://nl.wikipedia.org/wiki/Consulaire_diptiek","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Consular_diptych_Boethius_487.jpg","page_title":"Consulaire diptiek","context_page_description":"In de late oudheid was een consulair diptiek een bijzondere vorm van diptiek, die kon functioneren als een schrijftablet, maar die ook was bedoeld als een luxe gedenkobject. Zij werden na diens benoeming in opdracht van een Romeinse consul gemaakt en vervolgens als beloning en aandenken verdeeld onder degenen die de kandidatuur van deze consul hadden gesteund."},{"page_url":"https://de.wikipedia.org/wiki/Google_Street_View","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Google_Street_View_Car_in_Honolulu.jpg","page_title":"Google Street View","context_page_description":"Google Street View ist ein Online-Dienst des US-amerikanischen Unternehmens Google LLC, der 360-Grad-Ansichten aus der Straßenperspektive darstellt. Er erweitert den unternehmenseigenen Kartendienst Google Maps und das Programm Google Earth.\\nDer Dienst wurde im Mai 2007 mit ausgesuchten, lediglich in den Vereinigten Staaten verfügbaren Ansichten erstmals vorgestellt. In der Folgezeit wurde das Angebot international ausgeweitet."},{"page_url":"https://hr.wikipedia.org/wiki/NGC_5315","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/NGC_5315HSTfull.jpg","page_title":"NGC 5315","context_page_description":"NGC 5315 je planetna maglica u zviježđu Šestaru."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%B2%A9%E9%A0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Shiprock.snodgrass3.jpg","page_title":"岩頸","context_page_description":"岩頸あるいは岩栓、突岩とは、火道内のマグマが硬化してできた形成物である。火山が侵食によって削られて、火道内の岩栓が地表に現れた地形を岩頸または突岩と呼ぶ。活火山においてはこれらの下にマグマ溜まりが存在することがあり、その圧力によって火山爆発が起こることがある。"},{"page_url":"https://ar.wikipedia.org/wiki/%D9%87%D9%8A%D8%AA%D9%88%D8%B4%D9%8A_%D8%B3%D8%A7%D9%83%D9%8A%D9%85%D9%88%D8%AA%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Hitoshi_Sakimoto.jpg","page_title":"هيتوشي ساكيموتو","context_page_description":"هيتوشي ساكيموتو هو ملحن ياباني ولد في 26 فبراير 1969 في طوكيو."},{"page_url":"https://he.wikipedia.org/wiki/%D7%94%D7%AA%D7%A0%D7%95%D7%A2%D7%94_%D7%94%D7%9C%D7%90%D7%95%D7%9E%D7%99%D7%AA_%D7%94%D7%A4%D7%9C%D7%A1%D7%98%D7%99%D7%A0%D7%99%D7%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Palestinian_refugees.jpg","page_title":"התנועה הלאומית הפלסטינית","context_page_description":"התנועה הלאומית הפלסטינית היא שם כולל לזרמים וארגונים הפועלים למען הגדרה עצמית לערבים הפלסטינים על-בסיס רעיון הלאומיות והשאיפה למדינה פלסטינית ריבונית."},{"page_url":"https://fr.wikipedia.org/wiki/Auguste_Baud-Bovy","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c3/Graveur_Laval_Salle_Furet_Castle_of_Gruy%C3%A8res.jpg","page_title":"Auguste Baud-Bovy","context_page_description":"Auguste Baud-Bovy, né à Genève le 13 février 1848, et mort à Davos le 3 juin 1899, est un artiste-peintre suisse.\\nLe chalet a été un de ses thèmes principaux. Il a peint et posé son chevalet sur le motif en montagne et dans la neige."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D1%80%D0%BE%D1%82%D0%B8%D1%82%D0%B0%D0%BD%D0%BA%D0%BE%D0%B2%D0%B0_%D0%B3%D1%80%D0%B0%D0%BD%D0%B0%D1%82%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/73/Hand_Percussion_Grenade_%28anti-tank_No_73_Mark_I%29_diagram.jpg","page_title":"Протитанкова граната","context_page_description":"Протитанкова граната — вибуховий або запальний пристрій, який застосовується піхотою для боротьби з бронетехнікою з використання мускульної сили або пристроїв, які не належать до категорії артилерійських. Протитанкові міни формально не відносяться до цієї категорії зброї, проте існували універсальні міни-гранати і протибортові міни, аналогічні за будовою до гранат. Протитанкові ракети можуть відноситься до категорії «гранат», в залежності від національної класифікації такої зброї."},{"page_url":"https://nl.wikipedia.org/wiki/Scholtambt_van_Liemers","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Liemers_Ambt.png","page_title":"Scholtambt van Liemers","context_page_description":"Het scholtambt van Liemers of ambt Liemers was een bestuurlijk gebied in het hertogdom Kleef. Uit een oorkonde van het jaar 1348 omschreef graaf Johan I van Kleef dat het gebied bestond uit: Zevenaar, Wehl, Duiven, Groessen, Didam en Beek. Ook Westervoort hoorde er oorspronkelijk bij, dat ging samen met Didam aan de heer van Bergh. Deze verkreeg ook Beek in 1447 als pand in zijn bezit."},{"page_url":"https://en.wikipedia.org/wiki/Fan_Qin","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/%E8%8C%83%E6%AC%BD.jpg","page_title":"Fan Qin","context_page_description":"Fan Qin was a politician and bibliophile of the Ming Dynasty.\\nBorn in Ningbo in 1506, Fan Qin succeeded in the highest level of the Imperial examination in 1532 and obtained jinshi degree. In 1560, he was appointed right vice-minister of war under the Jiajing Emperor. Later, he resigned because of the dissatisfaction to Yan Song, the corrupt chancellor.\\nIn 1561, Fan Qin founded Tianyi Chamber in Ningbo city, which is now the oldest existing library in China."},{"page_url":"https://it.wikipedia.org/wiki/Aulo_Persio_Flacco","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/aa/Aulus_Persius_Flaccus.jpeg","page_title":"Aulo Persio Flacco","context_page_description":"Aulo Persio Flacco è stato un poeta satirico romano di età imperiale aderente allo stoicismo."},{"page_url":"https://en.wikipedia.org/wiki/Guyana_at_the_2015_World_Aquatics_Championships","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Flag_of_Guyana.svg","page_title":"Guyana at the 2015 World Aquatics Championships","context_page_description":"Guyana competed at the 2015 World Aquatics Championships in Kazan, Russia from 24 July to 9 August 2015."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Orgeln_im_Landkreis_Aurich","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/4722725_Woquard_Orgel.jpg","page_title":"Liste der Orgeln im Landkreis Aurich","context_page_description":"Die Liste der Orgeln im Landkreis Aurich umfasst alle erhaltenen Pfeifenorgeln im Landkreis Aurich. Sie ist eine Ergänzung zum Hauptartikel Orgellandschaft Ostfriesland, in dem sich weitere Literatur findet.\\nIm Landkreis stehen 112 Orgeln, von denen 42 vor dem Ersten Weltkrieg erbaut worden sind. Die Rysumer Orgel ist nicht nur die älteste des Landkreises, sondern eine der wenigen erhaltenen gotischen Orgelwerke weltweit. In Osteel, Westerhusen und Uttum sind drei Instrumente aus der ausgehenden Renaissance nahezu vollständig erhalten geblieben. Die Schnitger-Orgel in Norden ist mit 46 Registern die zweitgrößte Orgel in Ostfriesland und das zweitgrößte erhaltene Werk von Arp Schnitger. Nach dem Zweiten Weltkrieg hat Alfred Führer mit 23 modernen Orgeln, teils hinter altem Prospekt, die Orgelregion geprägt."},{"page_url":"https://sh.wikipedia.org/wiki/Patax%C3%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/%C3%8Dndio_patax%C3%B3.jpg","page_title":"Pataxó","context_page_description":"Pataxó, pleme, jezik i jezična porodica američkih Indijanaca sa područja brazilske države Bahía, na rezervatima Águas Belas, Barra Velha, Coroa Vermelha Litoral, Fazenda Bahiana ili Nova Vida [sa 216 Hãhãhãi, 1990], Imbiriba, Mata Medonha, Paraguassu/Caramuru i u Trevo do Parque u općini Itamaraju; Minas Gerais i Espírito Santo.\\nTradicionalni teritorij Hãhãhãi ili Pataxo del Sur Indijanaca je río Cachoeira u Bahiji."},{"page_url":"https://fr.wikipedia.org/wiki/Histoire_de_la_Lettonie","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e6/MirLatBern.jpg","page_title":"Histoire de la Lettonie","context_page_description":"L'histoire de la Lettonie commence officiellement en 1920 avec la création de la première république de Lettonie. Cependant, la région accueille ses premiers occupants dès la fin de la dernière ère glaciaire. Les peuples baltes qui arrivent vers 3000 av. J.-C., et vers 800 av. J.-C., se structurent en plusieurs tribus : Coures, Latgaliens, Séloniens, Sémigaliens.\\nAu début du XIIIᵉ siècle, les territoires qui bordent le sud de la mer Baltique constituent une des dernières contrées païennes d'Europe. Les croisades baltes menées par les chevaliers porte-glaives réalisent la conquête et la christianisation de la région. La ville de Riga est fondée en 1201 sur le fleuve Daugava, principale voie commerciale entre la Russie et l'Europe occidentale, consolidant ainsi le monopole des marchands de la Ligue hanséatique."},{"page_url":"https://en.wikipedia.org/wiki/List_of_poisonous_fungus_species","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Am.echin.jpg","page_title":"List of poisonous fungus species","context_page_description":"This is a compendium of poisonous fungi. See also mushroom poisoning."},{"page_url":"https://nn.wikipedia.org/wiki/Kvintakkord","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/G5_power_chord_for_guitar_%283rd_fret%29.png","page_title":"Kvintakkord","context_page_description":"Kvintakkord eller powerakkord er ein akkord som i grunnform består av to tonar, grunntone og kvint. Ofte vert grunntonen spelt i oktav, og stundom òg kvinttonen.\\nEin kvintakkord er ikkje i røynda ein akkord, men ein toklang, alternativt ein terslaus treklang utan dur/moll-karakter. Slike akkordar høyrest kraftig ut, og fordi tersen manglar, kling dei ikke dissonant når instrumentsignalet vert forvrengd, og vert derfor gjerne nytta i rockemusikk med mykje forvrenging, t.d. i heavy metal.\\nSpel med kvintakkordar har enkelte likskapar med kvartharmonikken frå mellomalderen, og enkelte musikkstykke frå mellomalderen kan fungere i rockeversjonar.\\nI besifringsnotasjon vert kvintakkordar vist som grunntonen og eit femtal, til dømes som C⁵ eller C5. Sjeldnare nytta variantar syner til at tersen skal utelatast: Cⁿᵒ³, Cᵒᵐⁱᵗ³ eller C³.\\nFor standardstemt gitar kan E⁵ og G⁵ visast grafisk slik:"},{"page_url":"https://es.wikipedia.org/wiki/Microrregi%C3%B3n_de_la_Sierra_de_San_Miguel","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d1/RioGrandedoNorte_Micro_SerradeSaoMiguel.svg","page_title":"Microrregión de la Sierra de San Miguel","context_page_description":"La microrregión de la Sierra de San Miguel es una de las microrregiones del estado brasileño del Río Grande del Norte perteneciente a la mesorregión Oeste Potiguar. Su población fue estimada en 2006 por el IBGE en 61.370 habitantes y está dividida en nueve municipios. Posee un área total de 971,871 km²."},{"page_url":"https://es.wikipedia.org/wiki/Sch%C3%B6nwies","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/AUT_Sch%C3%B6nwies_COA.png","page_title":"Schönwies","context_page_description":"Schönwies es una localidad del distrito de Landeck, en el estado de Tirol, Austria, con una población estimada a principio del año 2018 de 1697 habitantes.\\nSe encuentra ubicada al suroeste del estado, al oeste de la ciudad de Innsbruck —la capital del estado—, en el valle del río Eno y cerca de la frontera con Suiza, Italia y con el estado de Vorarlberg.​"},{"page_url":"https://ur.wikipedia.org/wiki/%D8%B5%D8%AD%D8%AA_%DA%A9%DB%8C_%D8%AF%DB%8C%DA%A9%DA%BE_%D8%B1%DB%8C%DA%A9%DA%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Louisville_Methodist_Evangelical_Hospital_1960s_Postcard.png","page_title":"صحت کی دیکھ ریکھ","context_page_description":"صحت کی دیکھ ریکھ صحت کی برقراری اور اس میں بہتری سے متعلق امور پر مشتمل ہے جس میں احتیاط، تشخیص، علاج، صحت یابی، بیماری اور زخم سے شفا اور دیگر جسمانی اور دماغی بد نظمیاں شامل ہیں جو لوگوں میں پائے جاتے ہیں۔ صحت کی دیکھ ریکھ کی ذمے داری صحت کے پیشہ ور ملحقہ صحت کے شعبوں میں انجام دیتے ہیں۔\\nجدید دور میں بڑھی ہوئی آبادی اور نئی اور پرانی بیماریوں کے بیچ ڈاکٹروں اور نرسوں کے ذریعہ صحت سے متعلق چیلنجوں کا سامنا کرنے اور شخصی خاندانوں کی اور آبادیوں کی صحت ضروریات کو پورا کیا جاتا ہے۔ حقیقت میں طبی پیشہ اور نرسوں کے ذریعے کی جانے والی تیمار داری درحقیقت ایک انسانی خدمت کی علامت ہے کیوں کہ لوگ صحت یاب ہو کر دوبارہ کام پر لگ سکتے ہیں۔ مختلف دنوں اور سالوں کو طبی افادیت سے موسوم کرنے کی طرز پر عالمی ادارہ صحت نے سال 2020ء کو نرسوں اور دائیوں کا سال قراردیا ہے۔ سماج میں بڑی عمر کے ایسے لوگوںکی تعداد بڑھتی جارہی ہے جنہیں مناسب دیکھ ریکھ کی ضرورت ہوتی ہے۔ ان میں سے کچھ لوگ دائمی طور پر بیمار ہوتے ہیں اور چوبیسوں گھنٹے طبی نگرانی ضروری ہوتی ہے۔دیکھ بھال کی خدمات فراہم کرانے والوں کے لیے صرف یہ ضروری نہیں کہ وہ تربیت یافتہ نرسیں یا ڈاکٹر ہوں بلکہ ضعیفوں اور معذوروں کی دیکھ بھال کی بنیادی تربیت ان کے لیے ضروری ہوتی ہے جو کئی ملکوں میں فراہم کی جاتی ہے۔"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A4%D0%BE%D1%80%D1%82_%D0%BE%D1%81%D1%82%D1%80%D1%96%D0%B2%D1%86%D1%8F_%D0%9A%D0%B5%D1%80%D0%BC%D0%BE%D1%80%D0%B2%D0%B0%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Kermorvan3.JPG","page_title":"Форт острівця Керморван","context_page_description":"Форт острівця Керморва́н — форт, розташований на півострові Керморван, що належить до муніципалітету Ле-Конке у департаменті Фіністер.\\nФорт із двома артилерійськими батареями обабіч був споруджений 1847 року для оборони півострова Керморван, де була ще одна батарея. Фортифікаційна споруда складається з двох різновисоких платформ. 1889 року форт став називатися південною батареєю Корморван. Споруда перебуває у цілком задовільному стані. Доступна під час відпливу з боку півострова."},{"page_url":"https://es.wikipedia.org/wiki/Palacio_de_Cristal_de_la_Arganzuela","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Entrada_Invernadero_ElMatadero_Aganzuela_2012-9-01.jpg","page_title":"Palacio de Cristal de la Arganzuela","context_page_description":"El Palacio de Cristal de la Arganzuela se encuentra situado en la ciudad española de Madrid, en las instalaciones de lo que fue antiguamente parte del Matadero Municipal de Arganzuela. Cuenta con una extensión de 7100 m².​\\nSe le conocía popularmente con el nombre de Nave de Patatas, y se conserva su gran estructura rectangular de perfiles de acero, que es utilizada como museo botánico con plantas de diversos lugares del mundo."},{"page_url":"https://en.wikipedia.org/wiki/Epiphany_(holiday)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Nova_stalna_postavka_Narodnog_muzeja_u_Leskovcu_01.jpg","page_title":"Epiphany (holiday)","context_page_description":"Epiphany is a Christian feast day that celebrates the revelation of God incarnate as Jesus Christ.\\nIn Western Christianity, the feast commemorates principally the visit of the Magi to the Christ Child, and thus Jesus' physical manifestation to the Gentiles. It is sometimes called Three Kings' Day, and in some traditions celebrated as Little Christmas. Moreover, the feast of the Epiphany, in some denominations, also initiates the liturgical season of Epiphanytide.\\nEastern Christians, on the other hand, commemorate the baptism of Jesus in the Jordan River, seen as his manifestation to the world as the Son of God. The spot marked by Qasr el Yahud in the West Bank, and Al-Maghtas in Jordan on the east bank, is considered to be the original site of the baptism of Jesus and the ministry of John the Baptist.\\nThe traditional date for the feast is January 6. However, since 1970, the celebration is held in some countries on the Sunday after January 1."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%B5%D0%B2%D0%B5%D1%80_%D0%90%D0%BD%D1%82%D1%96%D0%BE%D1%85%D1%96%D0%B9%D1%81%D1%8C%D0%BA%D0%B8%D0%B9","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e5/Severus.jpg","page_title":"Север Антіохійський","context_page_description":"Север Антіохійський відомий також як Север Газський, патріарх Антіохійський. Шанується як святий Орієнтальними православними церквами, крім Вірменської та Ефіопської. День його пам'яті — 8 лютого.\\nСевер народився в м. Созополісі Пісідійському, у 459 або 465 р., у заможній християнській родині. Більш пізні монофізитські джерела стверджують, що батьки його були язичниками. Батько його був сенатором у місті Созополь, дідусь по батьківській лінії мав таке ж ім'я Север був єпископом, брав участь у ІІІ Вселенському соборі в м. Ефесі 431 р. Після смерті батька у 485 р. вирушив до Александрії Єгипетської для навчання граматиці, риториці і філософії, грецькій і латині. В Александрії він знайомиться з Захарією Мітіленським церковним істориком і ритором. Останній переконав його у необхідності читати твори Григорія Богослова і Василія Великого особливо його листування з відомим ритором, представником пізньої софістики Лібанієм."},{"page_url":"https://pl.wikipedia.org/wiki/Dymowscy_herbu_T%C4%99pa_Podkowa","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/POL_COA_T%C4%99pa_Podkowa.svg","page_title":"Dymowscy herbu Tępa Podkowa","context_page_description":"Dymowscy – polski ród szlachecki pieczętujący się herbem Tępa Podkowa, którego pochodzenie dotychczas nie zostało gruntownie zbadane. Jego przedstawiciele pojawiali się począwszy od XVII wieku na Mazowszu i Podlasiu.\\nNajwcześniejsza znana wzmianka pochodzi z 1681 roku, kiedy to niejaki Wojciech Dymowski otrzymał przywilej od biskupa Wierzbowskiego na pewne grunta w Górze. Mikołaj Dymowski został odnotowany pod rokiem 1692 jako dziekan garwoliński i proboszcz radwankowski. Z kolei inny Wojciech Dymowski został odnotowany w 1749 roku jako pisarz komory solnej w Górze.\\nW Królestwie Polskim wylegitymował się ze staropolskiego szlachectwa właściciel dóbr Łaszczówka Jakub Ignacy Dymowski wraz z synami Marcelim i Mikołajem, jako syn Wojciecha i Anny Pisarzewskiej a wnuk Jana Dymowskiego.\\nZ kolei inny Jan Dymowski był księdzem, sędzią pokoju powiatu chełmskiego w 1856 roku a kanonikiem lubelskim w 1862 roku."},{"page_url":"https://sv.wikipedia.org/wiki/Lasse_Eriksson","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Uppsala20.JPG","page_title":"Lasse Eriksson","context_page_description":"Lars Gunnar \\"Lasse\\" Eriksson, född 1 april 1949 i Piteå i Norrbottens län, död 3 mars 2011 i Uppsala, var en svensk artist och författare."},{"page_url":"https://de.wikipedia.org/wiki/Flaggen_der_United_States_Minor_Outlying_Islands","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e5/Flag_of_Johnston_Atoll_%28local%29.svg","page_title":"Flaggen der United States Minor Outlying Islands","context_page_description":"Als Flagge der United States Minor Outlying Islands wird offiziell die Flagge der Vereinigten Staaten verwendet. Allerdings gibt es für mehrere der unbewohnten Inseln verschiedene Flaggenvorschläge, die bei Privatleuten Verwendung finden.\\nDie Flaggen vom Johnston-Atoll, Navassa und Palmyra wurden erstmals am 7. Dezember 2001 am USS Arizona Memorial, zum 60. Jahrestag des japanischen Angriffs auf Pearl Harbor, als Symbol für die Inseln gesetzt, zum Gedenken an jene Amerikaner, die im Zweiten Weltkrieg dort gedient und ihr Leben verloren hatten."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%9C%A3%E5%AE%89%E5%A6%AE%E5%A4%A7%E6%95%99%E5%A0%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/St_Anne%27s_Cathedral%2C_Belfast_20180427-3.jpg","page_title":"圣安妮大教堂","context_page_description":"圣安妮大教堂，又称贝尔法斯特大教堂，位于座堂区的焦点，是爱尔兰教会的驻地。位于北爱尔兰贝尔法斯特的多尼戈尔街。它的特殊之处在于，虽然同时服侍两个不同的教区，却不在这两个教区的所在地。于是，它实际上并不被认为是真正的大教堂，而是如此命名罢了。"},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Onalaska_(Wisconsin)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/WIS157WestTerminusWIS35Onalaska.jpg","page_title":"Onalaska (Wisconsin)","context_page_description":"Onalaska sī Bí-kok Wisconsin chiu La Crosse kūn ê chi̍t ê chng-thâu."},{"page_url":"https://pa.wikipedia.org/wiki/9_%E0%A8%A6%E0%A8%B8%E0%A9%B0%E0%A8%AC%E0%A8%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Sonia_Gandhi.jpg","page_title":"9 ਦਸੰਬਰ","context_page_description":"9 ਦਸੰਬਰ ਗ੍ਰੈਗਰੀ ਕਲੰਡਰ ਦੇ ਮੁਤਾਬਕ ਇਹ ਸਾਲ ਦਾ 343ਵਾਂ ਦਿਨ ਹੁੰਦਾ ਹੈ। ਇਸ ਦਿਨ ਤੋਂ ਸਾਲ ਦੇ 22 ਦਿਨ ਬਾਕੀ ਹਨ। ਦੇਸੀ ਕਲੰਡਰ ਮੁਤਾਬਕ ਇਹ ਦਿਨ 25 ਮੱਘਰ ਬਣਦਾ ਹੈ।"},{"page_url":"https://ceb.wikipedia.org/wiki/Epidendrum_eburneum","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Epidendrum_eburneum_-_Curtis%27_93_%28Ser._3_no._23%29_pl._5643_%281867%29.jpg","page_title":"Epidendrum eburneum","context_page_description":"Espesye sa orkidya ang Epidendrum eburneum. Una ning gihulagway ni Heinrich Gustav Reichenbach. Ang Epidendrum eburneum sakop sa kahenera nga Epidendrum sa kabanay nga Orchidaceae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://id.wikipedia.org/wiki/Daftar_keuskupan_di_Amerika_Serikat","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Ecclesiastical_Province_of_Washington_map.png","page_title":"Daftar keuskupan di Amerika Serikat","context_page_description":"Daftar keuskupan di Amerika Serikat adalah sebuah daftar yang memuat dan menjabarkan pembagian terhadap wilayah administratif Gereja Katolik Roma yang dipimpin oleh seorang uskup ataupun ordinaris di Amerika Serikat.\\nKonferensi para uskup Amerika Serikat bergabung dalam Konferensi Waligereja Amerika Serikat.\\nPer Mei 2020, terdapat 33 buah keuskupan agung Ritus Roma, 1 buah metropolitan Ritus Rutenia, dan 159 keuskupan sufragan, 1 ordinariat militer, dan 1 ordinariat personal."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9C%D1%83%D1%80%D1%83%D0%B7%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Alexandru_Moruzi_at_Curtea_Nou%C4%83.jpg","page_title":"Мурузи","context_page_description":"Мурузи или Морузи е гръцки фанариотски род, представители на който са князе на Молдова и Влашко.\\nРодът води началото си от областта Понт, като негови представители се установяват в Цариград в средата на XVII век. Техни потомци служат като драгомани на османското правителство, като няколко от тях са назначавани за князе както в Молдова, така и във Влашко. В началото на XIX век повечето представители на рода се установяват в Румъния, а някои заминават за Русия. След установяването на комунистическите режими в тези страни мнозина емигрират, главно във Франция."},{"page_url":"https://ga.wikipedia.org/wiki/An_Tamhnach_Mh%C3%B3r_(T%C3%ADr_Eoghain)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Tamnamore_Junction_14_M1_-_geograph.org.uk_-_304279.jpg","page_title":"An Tamhnach Mhór (Tír Eoghain)","context_page_description":"Is baile suite i gContae Thír Eoghain í An Tamhnach Mhór."},{"page_url":"https://en.wikipedia.org/wiki/Gyueshevo","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Gyueshevo_Customs.jpg","page_title":"Gyueshevo","context_page_description":"Gyueshevo is a village in Kyustendil Municipality, Kyustendil Province, in western Bulgaria. As of 2006 the population is 275 and the mayor is Stoyne Maksimov. The village is located on the border with North Macedonia and is the most important of the three border checkpoints between the two countries. It is the last stop of the railway from Sofia. This railway is intended to link the capital to Skopje, but the Macedonian section of the line has not been built. Gyueshevo lies at 42°14′13″N 22°28′35″E, 1,016 metres above sea level, in the Osogovo mountains. The local railway station was built in 1910, while the first school dates to 1888. The Prosveta community centre was opened in 1921. There is also a church mausoleum dedicated to the perished Bulgarian soldiers in the Balkan Wars and the First World War. Gyueshevo was first mentioned in 1570 as Gyuveshevo. The name is thought to originate from the personal name Gyuesh, probably a derivative of George; –esh is a rare personal name suffix used in names such as Dobresh, Malesh or Radesh."},{"page_url":"https://sv.wikipedia.org/wiki/Kvarteret_Pegasus","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Bollhusgr%C3%A4nd_3A_mars_2007.JPG","page_title":"Kvarteret Pegasus","context_page_description":"Kvarteret Pegasus är ett kvarter i Gamla stan i Stockholm. Kvarteret omges av Slottsbacken i norr, Österlånggatan i öster, Köpmantorget i söder och Bollhusgränd i väster. Kvarteret består idag av sex fastigheter: Pegasus 3, 4, 6, 8, 10 och 11. Största byggnaden i kvarteret är Kungliga Myntkabinettet, beläget i Pegasus 6."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B0%D0%BA%D0%BD%D0%B0%D0%BC%D0%B0%D1%80%D0%B0,_%D0%93%D0%B0%D1%80%D1%80%D0%B5%D1%82%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Web_Summit_2017_-_SportsTrade_CG1_7032_%2837533617704%29.jpg","page_title":"Макнамара, Гарретт","context_page_description":"Гарретт Макнамара — американский профессиональный сёрфер. Обладатель рекорда занесённого в Книгу рекордов Гиннесса, как сёрфер одолевший 78-ми футовую волну в Назаре, Португалия.\\n29 января 2013 года Гарретт Макнамара установил новый мировой рекорд там же, на Северном пляже в Назаре, Португалия. На этот раз он покорил волну высотой более 23\\nметров. Достижение пока не внесено в Книгу рекордов Гиннесса.\\nМакнамара родился 10 августа 1967 года в Питсфилде, штат Массачусетс и переехал в Норт-Шор на Гавайях в 1978 году. В одиннадцать лет, он по примеру старшего брата Лиама начал заниматься сёрфингом. Он вошёл в престижную гавайскую серию Triple Crown of Surfing в семнадцать лет и нашёл основных спонсоров из крупнейших японских брендов.\\nМакнамара был в числе первых спортсменов, которые в начале 1990-х годов стали ловить большие волны используя лодки и другие плавсредства для доставки серферов в море."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%88%D9%86%DB%8C%D9%88%D8%A7%D8%B1_%D8%A8%D9%88%D8%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Vannevar_Bush_portrait.jpg","page_title":"ونیوار بوش","context_page_description":"ونیوار بوش آمریکالی بیلیم اینسانی. ۱۱ مارس ۱۸۹۰ تاریخینده دۆنیایا گؤز آچیب. ۸۴ ایل عومر ائله‌ییب و ۲۸ ژوئن ۱۹۷۴ میلادی تاریخینده وفات ائدیب. ونیوار بوش تافتس بیلیم‌یوردودا درس اوْخویوب."},{"page_url":"https://nv.wikipedia.org/wiki/Ah%C3%A9%C3%A9h%C3%A1sh%C4%AF%CC%81%C4%AF%CC%81hd%C4%99%CC%81%C4%99%CC%81%CA%BC_%C5%82eeyi%CA%BC_ch%CA%BCosh_bigaan_h%C3%B3l%C3%B3n%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Bipes_biporus.jpg","page_title":"Ahééháshį́į́hdę́ę́ʼ łeeyiʼ chʼosh bigaan hólóní","context_page_description":"Ahééháshį́į́hdę́ę́ʼ łeeyiʼ chʼosh bigaan hól éí naʼashǫ́ʼii dah yikahjí atah yisdzoh, áádóó éí Ahééháshį́įhdi hólǫ́. Ndaʼałkaahí dóó ééʼdeetįįhii éí \\"Bipes biporus\\" deiłníigo dayózhí."},{"page_url":"https://en.wikipedia.org/wiki/Mahyar_Alizadeh","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Mahyar_Alizadeh_2019.jpg","page_title":"Mahyar Alizadeh","context_page_description":"Mahyar Alizadeh is a musician, composer, singer and Taar player from Iran.\\nAfter graduating from Alborz High School, he continued his career in music university and after that, decided to study in foreign universities. First he entered Komitass Conservatory in Armenia. As it influenced his passion on music as he always quotes that his career as a musician is divided in two, before Armenia and after that.\\nAfter two years studying music composition at Armenia Conservatory, he chose Vienna University as the next stop in mastering musicology.\\nThen in 2009 he resumed recording his debut album in collaboration with Alireza Ghorbani, an album that was begun when he was in Armenia. This album, named Autumn on Fire and labelled under Avay-e Barbad production, became the best selling Persian music album in 2011–2012.\\nThese successes make Mahyar Alizadeh and Alireza Ghorbani's cooperation last till today in various albums and concerts."},{"page_url":"https://ro.wikipedia.org/wiki/Alcolea","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/LocationAlcolea%2C_Almer%C3%ADa.png","page_title":"Alcolea","context_page_description":"Alcolea este municipalitate din provincia Almería, Andaluzia, Spania cu o populație de 923 locuitori."},{"page_url":"https://en.wikipedia.org/wiki/Pierre_Bayen","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a5/Pierre_Bayen.jpg","page_title":"Pierre Bayen","context_page_description":"Pierre Bayen was a French chemist. He analyzed water drunk by the Kingdom of France, and he wrongly suggested that using pewter glasses rendered the water toxic. He became a member of the French Academy of Sciences in 1785 and the Institut de France in 1795. He burned all his papers during the Reign of Terror of 1793-1794. The Lycée Pierre Bayen in Chalons was named in his memory."},{"page_url":"https://es.wikipedia.org/wiki/Ej%C3%A9rcito_imperial_austriaco_(1806-1867)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Albrecht_Adam_Radetzky_in_der_Schlacht_bei_Novara_1849.jpg","page_title":"Ejército imperial austriaco (1806-1867)","context_page_description":"El ejército imperial era la rama de las fuerzas armadas de la monarquía de los Habsburgo en los territorios de la corona de Austria, surgido como consecuencia de las guerras napoleónicas.\\nEste organismo militar se vio reformado en el 1867 con la constitución de la duplice monarquía que llevó a una formal independencia del Reino de Hungría bajo el gobierno del emperador Francisco José de Austria y para la formación de un ejército nacional."},{"page_url":"https://es.wikipedia.org/wiki/McDonnell_Douglas_F/A-18_Hornet","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bf/Canadian_CF-18.jpg","page_title":"McDonnell Douglas F/A-18 Hornet","context_page_description":"El F/A-18 Hornet es un caza polivalente bimotor de cuarta generación de origen estadounidense con capacidad todo tiempo, para ser embarcado en portaaviones. Fue desarrollado en los años 1970 por la compañía McDonnell Douglas a partir del prototipo Northrop YF-17 para la Armada de los Estados Unidos y el Cuerpo de Marines de los Estados Unidos. El Hornet también ha sido exportado a siete países para servir en sus fuerzas aéreas. Desde 1986 es usado para acrobacia aérea por el grupo de demostración aérea Blue Angels de la Armada estadounidense.\\nEste avión de combate combina capacidades de caza y ataque para atacar objetivos tanto aéreos como terrestres; de ahí su designación F/A, «F» de Fighter y «A» de Attack. Las principales misiones que puede desempeñar son: caza de escolta, defensa aérea, supresión de defensas aéreas enemigas, interdicción, apoyo aéreo cercano y reconocimiento."},{"page_url":"https://es.wikipedia.org/wiki/Tehuelches","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Cacique_Mulato.JPG","page_title":"Tehuelches","context_page_description":"Los tehuelches, aonikenk o patagones son un pueblo indígena de la Patagonia en América del Sur, cuyos exponentes actuales viven en Argentina y se han extinguido en Chile.\\nEl nombre complejo tehuelche ha sido usado por investigadores en sentido amplio para agrupar a un conjunto de pueblos amerindios de la Patagonia y la región pampeana. Diversos especialistas, misioneros y viajeros han realizado propuestas para agruparlos teniendo en cuenta la similitud de sus rasgos culturales, su vecindad geográfica y sus idiomas, aunque entre ellos se hablaban idiomas que no estaban emparentados entre sí, y su distribución geográfica era extensa.​"},{"page_url":"https://en.wikipedia.org/wiki/List_of_listed_buildings_in_Evie_And_Rendall,_Orkney","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0b/Orkney_Mainland_-_Rendall_Doocot_20110523.jpg","page_title":"List of listed buildings in Evie And Rendall, Orkney","context_page_description":"This is a list of listed buildings in the parish of Evie And Rendall in Orkney, Scotland."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A4%E3%83%AA%E3%83%8E%E3%82%A4%E5%B7%9E%E4%BC%9A%E8%AD%B0%E4%BA%8B%E5%A0%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Illinois_State_Senate.jpg","page_title":"イリノイ州会議事堂","context_page_description":"イリノイ州会議事堂は、アメリカ合衆国イリノイ州の州都スプリングフィールドに立地する同州議会の議事堂。イリノイ州議会の上下両院の議場のほか、州知事室が置かれている。現在建っているフレンチ・ルネサンス様式の庁舎は、1868年にシカゴの建築事務所が設計し、450万ドルを投じて20年後の1888年に完成したもので、1818年にイリノイが州に昇格してから6代目のものである。1985年には、イリノイ州会議事堂は国家歴史登録財に登録された。"},{"page_url":"https://la.wikipedia.org/wiki/Barbara_Bas","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Bas%2C_B%C3%A4rbel-1670.jpg","page_title":"Barbara Bas","context_page_description":"Barbara Bas est rerum politicarum perita Germanica factionis SPD."},{"page_url":"https://ca.wikipedia.org/wiki/291_(revista)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/291_No56p234-Spread.jpg","page_title":"291 (revista)","context_page_description":"291 fou una revista d'art i literatura que va ser publicada del 1915 al 1916 a Nova York. Va ser creada i publicada per un grup de quatre individus: el fotògraf/promotor d'art modern Alfred Stieglitz, l'artista Marius de Zayas, la poetessa/periodista/col·leccionista d'art Agnes E. Meyer i el fotògraf/crític/mecenes d'art Paul Haviland. Inicialment amb la intenció d'atraure l'atenció sobre la galeria del mateix nom, aviat esdevingué una obra d'art per si mateixa. La revista va publicar obres d'art originals, assajos, poemes i comentaris de Francis Picabia, John Marin, Max Jacob, Georges Ribemont-Dessaignes, de Zayas, Stieglitz i altres artistes d'avantguarda i escriptors de l'època, i se li reconeix el mèrit de ser la publicació que va introduir la poesia visual als Estats Units."},{"page_url":"https://nn.wikipedia.org/wiki/Styrs%C3%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Styrs%C3%B6-G%C3%B6teborg.jpg","page_title":"Styrsö","context_page_description":"Styrsö er ei lita øy og ein tettstad i Göteborg kommun i Västra Götalands län i Sverige. Han hadde 1304 innbyggjarar i 2010.\\nØya ligg i Göteborgs skjergard i Sverige med kring 1400 innbyggjarar. Det går ferjesamband til øya frå Göteborg og ei bru går frå Styrsö til Donsö."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AA%D8%B6%D8%B1%D9%8A%D8%B3_%D8%AD%D8%B1%D8%A7%D8%B1%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Permafrost_in_Herschel_Island_010.jpg","page_title":"تضريس حراري","context_page_description":"التضريس الحراري، هي عملية تكون تضاريس مميزة، تنتج عن ذوبان جليد تربة دائمة التجمد وغنية بالجليد أو ذوبان جليد بري واسع النطاق. تتكون كثيراً في مناطق القطب الشمالي ومناطق الجبال الباردة مثل الهيمالايا وجبال الألب. تبدأ القباب الصغيرة الجليدية تتشكل على السطح بسبب الصقيع مع بداية فصل الشتاء. تبقى هذه مؤقتةً حتى تتلاشى وتذوب مع الصيف اللتالي وتترك جوفاً سطحيا صغيرا. تنمو بعض التجاويف الجليدية وتشكل قعراً سطحياً أكبر، والتي تستمر لسنوات عديدة وتصبح أحيانا مغطاة بالأعشاب، حتى تبدأ في ذوبان الجليد. هذه الأسطح القبة تقبع في نهاية المطاف إما سنوياً أو بعد فترات أطول وتشكل المنخفضات أسطح غير المستوية."},{"page_url":"https://en.wikipedia.org/wiki/Verville_Air_Coach","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Verville-air-coach.PNG","page_title":"Verville Air Coach","context_page_description":"The Verville Air Coach was a four-passenger, high-wing monoplane designed in 1927 by Alfred V. Verville and produced by his company, Verville Aircraft Company. It was a comfortable, good-looking cabin monoplane which sold for $10,500. The plane made its debut at the Detroit Air Show in 1929.\\nSources vary, but only 10-16 were built before Verville declared bankruptcy in 1931 at the beginning of the great depression."},{"page_url":"https://de.wikipedia.org/wiki/Canton_Bulldogs","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Bulldogs.png","page_title":"Canton Bulldogs","context_page_description":"Die Canton Bulldogs waren ein Footballteam aus Canton, Ohio. Sie existierten ab 1904, lösten sich jedoch 1906 schon wieder auf. 1911 wurde eine weitere Mannschaft in Canton angesiedelt, die Canton Professionals. 1915 änderten diese in Erinnerung an das alte Team ihren Namen in Canton Bulldogs. Die „neuen“ Bulldogs wurden 1916, 1917 und 1919 inoffizieller Meister im American Football. 1920 traten sie der gerade neu gegründeten National Football League mit dem Bulldogsspieler Jim Thorpe als ersten offiziellen Präsidenten bei. Die Bulldogs setzten vor allem auf das Laufspiel und konnten unter anderem mit Joe Guyon als Runningback 1922 und 1923 Meister der Liga werden. Von 1921 bis 1923 spielte Canton 25 Spiele ohne ein einziges Mal besiegt zu werden, was noch heute Rekord in der National Football League ist.\\nNach ihrem zweiten Titel kaufte der Eigentümer der Cleveland Indians, Samuel H. Deutsch, die Bulldogs auf, benannte die Indians in Bulldogs um und transferierte die Spieler zum Team aus Cleveland, dieses verstärkte Team gewann 1924 den Titel der NFL."},{"page_url":"https://en.wikipedia.org/wiki/Biskupiec","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Biskupiec%2C_ul._Pionier%C3%B3w_6_%28ratusz%29.jpg","page_title":"Biskupiec","context_page_description":"Biskupiec is a town in northeastern Poland, in Warmia, in the Warmian-Masurian Voivodeship. It is located in Olsztyn County and has a predominantly Catholic population of approximately 11,400. The countryside surrounding Biskupiec is a popular tourist destination, part of the Masurian Lake District."},{"page_url":"https://en.wikipedia.org/wiki/Bader_area","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Amman_district_07.png","page_title":"Bader area","context_page_description":"Bader is one of the areas of the Greater Amman Municipality, Jordan."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%91%D1%80%D0%B5%D0%B6%D0%B0%D0%BD%D0%B8_(%D0%9F%D1%80%D0%B5%D1%88%D0%BE%D0%B2)","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/98/Slovakia_Sariska_highlands_23PB171102.JPG","page_title":"Брежани (Прешов)","context_page_description":"Брежани насељено је мјесто са административним статусом сеоске општине у округу Прешов, у Прешовском крају, Словачка Република."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9B%D0%B0%D1%80%D0%B6%D0%B0%D0%BD%D1%82%D1%8C%D1%94%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Largentieres07.jpg","page_title":"Ларжантьєр","context_page_description":"Ларжантьє́р — муніципалітет у Франції, у регіоні Рона-Альпи, департамент Ардеш. Населення — 1822 осіб.\\nМуніципалітет розташований на відстані близько 510 км на південь від Парижа, 145 км на південь від Ліона, 33 км на південний захід від Прива."},{"page_url":"https://cs.wikipedia.org/wiki/Kr%C3%A1sno","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Kr%C3%A1sno%2C_radnice.jpg","page_title":"Krásno","context_page_description":"Město Krásno se nachází v okrese Sokolov v Karlovarském kraji. Žije zde 709 obyvatel."},{"page_url":"https://no.wikipedia.org/wiki/Wen_Xiu","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Wen_Xiu.jpg","page_title":"Wen Xiu","context_page_description":"Wen Xiu, var en av konkubinene til den siste kinesiske keiser, Xuantong-keiseren Puyi.\\nSammen med keiseren og keiserinne Wan Rong forlot Wen Xiu Den forbudte by i 1924 og flyttet til Zhanghaven i Tianjin. Hun bad om og fikk innvilget skilsmisse i 1931, og giftet seg ikke på nytt.\\nEtter skilsmissen fratok keiseren henne etter påtrykk fra sine hoffmenn alle keiserlige titler.\\nI 2004 gav etterkommerne av det keiserlige hus posthume navn til keiseren, hans to hustruer og to av hans tre konkubiner. Den tredje var nettopp Wen Xiu. Hun var etter deres mening blitt tilbakeført til den borgerlige stand i om med sin skilsmisse."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D1%83%D0%BC%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Jaguarondi_2.jpg","page_title":"Пумы","context_page_description":"Пу́мы — род хищников из семейства кошачьих. В нём объединены два современных вида и несколько вымерших:\\nPuma concolor — пума;\\nPuma yagouaroundi — ягуарунди.\\n† Puma pardoides\\n† Puma pumoides\\n† Puma inexpectatus?\\n† Puma trumani?\\nРанее ягуарунди выделялся в самостоятельный род Herpailurus Severtzov, 1858, но молекулярно-генетические исследования выявили близкое родство между обоими этими видами, из-за чего современные систематики относят их в один род.\\nШерсть пум короткая и густая и окрашена обычно в жёлто-серые или красноватые тона. Взрослые особи в отличие от представителей многих других видов кошачьих не пятнисты. Оба вида живут в Америке.\\nЕщё одним результатом исследований ДНК пум стало то, что самым близким из живущих родственников пум был признан гепард. Из-за его необычного телосложения его ранее выделяли в собственное подсемейство Acinonychinae, но родство с пумами заставило причислить гепарда к подсемейству малых кошек."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%97%D0%B0%D0%BB%D1%96%D0%B7%D0%BD%D0%B8%D1%87%D0%BD%D0%B0_%D0%BB%D1%96%D0%BD%D1%96%D1%8F_%D0%A1%D1%82%D1%80%D0%B8%D0%B9_%E2%80%94_%D0%A2%D0%B5%D1%80%D0%BD%D0%BE%D0%BF%D1%96%D0%BB%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Vokzal_hodoriv.jpg","page_title":"Залізнична лінія Стрий — Тернопіль","context_page_description":"Стрий – Тернопіль — залізнична лінія місцевого значення на заході України. Пролягає від районного центру Стрия через залізничний вузол Ходорів, що на південь від Львова, до обласного центру Тернополя. Входить до складу Львівської залізниці — підрозділу «Укрзалізниці». Весь маршрут одноколійний, дільниця від Стрия до Ходорова електрифікована."},{"page_url":"https://pt.wikipedia.org/wiki/Muro_das_Lamenta%C3%A7%C3%B5es","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Westernwall2.jpg","page_title":"Muro das Lamentações","context_page_description":"O Muro das Lamentações ou Muro Ocidental é o segundo local mais sagrado do judaísmo, atrás somente do Santo dos Santos, no monte do Templo.\\nTrata-se do único vestígio do antigo Templo de Herodes, erguido por Herodes, o Grande no lugar do Templo de Jerusalém inicial. É a parte que restou de um muro de arrimo que servia de sustentação para uma das paredes do edifício principal e que em sí mesmo, não integrava o Templo que foi destruído pelo general Tito, que depois se tornaria imperador romano, no ano de 70.\\nMuitos fieis judeus visitam o Muro das Lamentações para orar e depositar seus desejos por escrito. Antes da Guerra dos Seis Dias, em 1967, o local era chamado de Mughrabi Quarter ou o Quarteirão Marroquino, de onde, por ordem do prefeito de Jerusalém, 135 famílias árabes foram removidas para a abertura da esplanada do Muro das Lamentações.\\nOs restos que hoje existem datam da época de Herodes, o Grande, que mandou construir grandes muros de contenção em redor do monte Moriá, ampliando a pequena esplanada sobre a qual foram edificados o Primeiro e o Segundo Templo de Jerusalém, formando o que hoje se designa como a Esplanada das Mesquitas."},{"page_url":"https://en.wikipedia.org/wiki/John_C._McKinley","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/John_C._McKinley.jpg","page_title":"John C. McKinley","context_page_description":"John C. McKinley was a lawyer and Republican politician from the state of Missouri. He was the state's 26th Lieutenant Governor as well as a member of the Missouri Senate."},{"page_url":"https://sq.wikipedia.org/wiki/Long_Island","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Longisland1.png","page_title":"Long Island","context_page_description":"Long Island është një ishull, që te Shteti Federal New York takon. Ajo gjendet në Ameriken Veriore, është afërsisht 190 km i madh dhe matë një gjersi midis 20 dhe 32 kilometër. Sipërfaqja përbej 3.566 km², që gati sipërfaqjen e Mallorkës përkon."},{"page_url":"https://fy.wikipedia.org/wiki/Wynmotor_Wurdum","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Windmotorwirdum.jpg","page_title":"Wynmotor Wurdum","context_page_description":"De Wynmotor Wurdum is in poldermole en ryksmonumint by it doarp Wurdum, dat yn de gemeente Ljouwert leit. De mole is in lytse Amerikaanske wynmotor mei in flecht fan 4,5 meter, fan it type Record 18. It boujier is ûnbekend. Foarhinne stie de wynmotor sa'n 300 meter besúdeasten Swichum tichtby de Ayttadyk, mar nei in yngeande restauraasje dy't yn 2005 begûn, krige er op 18 septimber 2009 in nij plak by de iisbaan fan Wurdum. De wynmotor is mealree yn sirkwy en kin de iisbaan fan wetter foarsjen."},{"page_url":"https://ceb.wikipedia.org/wiki/Hakea_verrucosa","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Hakea_verrucosa.JPG","page_title":"Hakea verrucosa","context_page_description":"Espesye sa tanom nga bulak ang Hakea verrucosa. Una ning gihulagway ni F. Müll.. Ang Hakea verrucosa sakop sa kahenera nga Hakea sa kabanay nga Proteaceae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BA%D0%BE%D1%80%D0%B0%D0%B1%D0%BB%D0%B5%D0%B9_%D0%92%D0%BE%D0%B5%D0%BD%D0%BD%D0%BE-%D0%BC%D0%BE%D1%80%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D1%84%D0%BB%D0%BE%D1%82%D0%B0_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%BE%D0%B9_%D0%A4%D0%B5%D0%B4%D0%B5%D1%80%D0%B0%D1%86%D0%B8%D0%B8","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ab/%D0%9C%D0%B0%D0%BB%D1%8B%D0%B9_%D0%BF%D1%80%D0%BE%D1%82%D0%B8%D0%B2%D0%BE%D0%BB%D0%BE%D0%B4%D0%BE%D1%87%D0%BD%D1%8B%D0%B9_%D0%BA%D0%BE%D1%80%D0%B0%D0%B1%D0%BB%D1%8C-243.jpg","page_title":"Список кораблей Военно-морского флота Российской Федерации","context_page_description":"В приведённых ниже таблицах приведен актуальный корабельный и судовой состав ВМФ России суммарно и раздельно по флотам, и сводные таблицы по строительству, ремонту и модернизации кораблей и судов флота по состоянию на 2020 год."},{"page_url":"https://it.wikipedia.org/wiki/Triumph_Stag","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/1974_Triumph_Stag_-_Flickr_-_The_Car_Spy_%2812%29.jpg","page_title":"Triumph Stag","context_page_description":"La Triumph Stag è una coupé-convertibile 2+2 britannica prodotta dalla Triumph Motor Company tra il 1970 e il 1977. Disegnata da Giovanni Michelotti, venne pensata soprattutto per il mercato statunitense, per competere con Mercedes Benz SL. Poiché di dimensioni e motorizzazione generosi, è adatta più all'uso turistico che a quello sportivo."},{"page_url":"https://hu.wikipedia.org/wiki/Barokk_%C3%A9p%C3%ADt%C3%A9szet_Magyarorsz%C3%A1gon","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Saint_Stephen%27s_Basilica_-_panoramio_-_fabiolah_%281%29.jpg","page_title":"Barokk építészet Magyarországon","context_page_description":"A barokk építészet Magyarországon a barokk művészet részeként a 17. század elejétől a 18. század végéig számos meghatározó építészeti emléket hagyott hátra, elsősorban templomok, kastélyok és lakóépületek formájában. Legfontosabb barokk városaink Győr és Székesfehérvár, de hasonlóan értékes barokk műemlékegyüttest találhatunk Budán, Veszprémben, Egerben, a határon túl pedig Kassán.\\nA barokk épületek többnyire könnyen felismerhetőek sajátos stílusjegyeikről. A magyar barokk templomokat egy-két hagyma- vagy gúlasisakos torony díszíti. A barokk épületek gyakran megtört vonalú homlokzatát vakolatsávozás, erőteljes párkányok, óriáspilaszterek és oszlopok tagolják. Gyakran feltűnő elem a különleges formájú, kör, ovális vagy lant alakú ablak. A kapukat gazdagon faragott kődíszek és oszlopok vagy szoboralakok veszik közre, amelyek általában kő- vagy vasrácsos erkélyt tartanak. Az épületek homlokzatát határozott főpárkány zárja le, felette tört vonalú, címerrel, órával vagy szobrokkal díszített oromzat emelkedik. A fedés jellemzően manzárdtető, gyakori elem a kupola vagy az óratorony. A barokkra jellemzőek a színes homlokzatok, a mélyvöröstől a sárgán át a szürkéig és a kékig."},{"page_url":"https://en.wikipedia.org/wiki/O%27Higgins_F.C.","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Capo_de_Provincia_%283943190200%29.jpg","page_title":"O'Higgins F.C.","context_page_description":"O'Higgins Fútbol Club also known as O'Higgins de Rancagua, is a Chilean football club based in Rancagua, that is a current member of the Campeonato Nacional. The club's home stadium is the Estadio El Teniente, opened in 1945 and renovated for the 2015 Copa América, which was hosted by Chile.\\nFounded in 1955, the club was named in honour of the country's founding father and supreme director Bernardo O'Higgins, after the merger of the clubs O'Higgins Braden and América de Rancagua. O'Higgins has won two Primera B titles, and in 2013 they won their first top-flight championship against Universidad Católica, coached by Eduardo Berizzo; they later won the 2014 Supercopa de Chile on penalty kicks against Deportes Iquique. The team has competed four times in the Copa Libertadores, once in the Copa Sudamericana in 2012, and once in the Copa CONMEBOL in 1992.\\nThe club emblem is a phoenix standing upon the club's colours. The club has a long-standing rivalry with regional neighbours Rangers de Talca and Curicó Unido, as well as with clubs from Santiago."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%B3%D0%BB%D0%B0%D0%B2_%D0%B3%D0%BE%D1%81%D1%83%D0%B4%D0%B0%D1%80%D1%81%D1%82%D0%B2_%D0%B2_2015_%D0%B3%D0%BE%D0%B4%D1%83","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/83/Nicolae_Timofti_June_2014_%28cropped%29.jpg","page_title":"Список глав государств в 2015 году","context_page_description":"Rulers.org"},{"page_url":"https://cs.wikipedia.org/wiki/RMS_Britannia","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7b/RMS_Britannia_1840_paddlewheel.jpg","page_title":"RMS Britannia","context_page_description":"po\\nRMS Britannia byl kolesový parník třídy Britannia společnosti British and North American Royal Mail Steam Packet Company. Na vodu byl spuštěn 5. února 1840 v loděnicích Robert Duncan & Company ve skotském Greenocku. On a jeho sesterské lodě byly vůbec první parníky vybudované touto společností.\\nBritannia byla na svou dobu se svou délkou 63 metrů, šířkou 10,3 metrů a třemi stěžni velká loď. Měla dvě kolesa poháněné pístovými parními stroji od Roberta Napiera. Její obvyklá rychlost se pohybovala kolem 8,5 uzlů, ale mohla plout i rychleji, pokud byl příznivý vítr. Podle starých výpočtů byla její hrubá prostornost 1 154 BRT, kapacita 115 cestujících a 82 členů posádky."},{"page_url":"https://en.wikipedia.org/wiki/Brian_Reid_(entrepreneur)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Brian_Reid.jpg","page_title":"Brian Reid (entrepreneur)","context_page_description":"Brian Peter Reid is an entrepreneur who is credited with developing the first digital advertising mirror that is controlled remotely and has the ability to record and report the exact number and duration of consumer engagements in real time. Reid also founded technology firm Mirrus."},{"page_url":"https://sv.wikipedia.org/wiki/Petsamo_kloster","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Petsamo_Church.jpg","page_title":"Petsamo kloster","context_page_description":"Petsamo kloster är ett ryskt-ortodoxt kloster i orten Petjenga i Petsamoområdet i Ryssland. Det grundades 1533 av Trifon den helige vid vad som numera är orten Luostari vid Petsamoälven strax nedströms dagens ort Petjenga.\\nTrifon den helige, som var en munk från Novgorod, önskade, efter inspiration från Solovetskijklostrets kristningsarbete, att omvända de lokala skoltsamerna till kristendom, och att visa hur tron kunde blomstra också i denna ödsliga geografiska miljö. Hans exempel följdes av många andra ryska munkar, och 1572 fanns omkring 50 munkar och 200 lekmannabröder i Petsamo kloster.\\nSex år efter Trifon den heliges död 1583 blev klostret, som var byggt i trä, plundrat och nedbränt av svenskarna. Angreppet den 25 december 1589 krävde 51 munkars och 65 lekmannabröders liv, och innebar slutet för Trifon den heliges kloster i Petsamo. Den svenska aktionen kan ha letts av den finske bondehövdingen Pekka Vesainen, som tidigare samma år lett en annan plundringsexpedition till Kolahalvön. Dessa plundringar var en del av det nordiska tjugofemårskriget 1570–1595."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%96%D0%B0%D2%A3%D0%B0_%D0%98%D1%80%D0%BB%D0%B0%D0%BD%D0%B4%D0%B8%D1%8F","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/98/New_Ireland_Province_Papua_Niugini_locator.png","page_title":"Жаңа Ирландия","context_page_description":"Жаңа Ирландия — Тынық мұхиттың Бисмарк топаралындағы жанартаулық арал. Ауданы 8,6 мың км². Папуа — Жаңа Гвинея — Жаңа Гвинея мемлекетінің құрамында. Халқы төңірегіндегі аралдармен қоса есептегенде 87 мың адам. Аралдың ең биік жері 2150 м. Басты қаласы — Кавиенг; қ. Папуа — Жаңа Гвинея."},{"page_url":"https://ca.wikipedia.org/wiki/Stara_Gradi%C5%A1ka_(camp)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Children_in_Stara_Gradiska.jpg","page_title":"Stara Gradiška (camp)","context_page_description":"El camp de Stara Gradiška va ser un camp de concentració i extermini a Croàcia, durant la Segona Guerra Mundial, construït especialment per a dones i nens dels serbis, jueus, gitanos i antifeixistes croats. Va ser establert el 1941 pels ústaixes durant l'Estat independent de Croàcia, prop de la localitat de Stara Gradiška. Era el cinquè subcamp del complex del camp de concentració de Jasenovac."},{"page_url":"https://sv.wikipedia.org/wiki/Smilax_glauca","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/43/Smilax_glauca_7.JPG","page_title":"Smilax glauca","context_page_description":"Smilax glauca är en enhjärtbladig växtart som beskrevs av Thomas Walter. Smilax glauca ingår i släktet Smilax och familjen Smilacaceae. Inga underarter finns listade."},{"page_url":"https://en.wikipedia.org/wiki/Vijay_Sardeshmukh","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/07/F1020015.jpg","page_title":"Vijay Sardeshmukh","context_page_description":"Pandit Vijay Sardeshmukh was a noted Indian classical vocalist and disciple of Kumar Gandharva He was an honored guru for post graduation studies in Pune University. He has been a recipient of many awards."},{"page_url":"https://fr.wikipedia.org/wiki/Vol%C3%A9e_mixte_d%27alimentation","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Jungle_Babbler_I_IMG_9056.jpg","page_title":"Volée mixte d'alimentation","context_page_description":"La volée mixte d'alimentation, appelée aussi ronde d'oiseaux, est un comportement social où plusieurs individus de deux espèces ou plus parcourent un territoire à la recherche de nourriture en groupe. Ces rassemblements plurispécifiques d'oiseaux se distinguent des rassemblements causés par un facteur de l’environnement, comme la présence de nourriture en un lieu tels les mangeoires d'oiseaux. La volée mixte d’alimentation résulte de l’interaction entre les membres du groupe et implique des rôles bien définis entre les individus. Les oiseaux se réunissent en bandes, qui comptent de quelques membres à plusieurs dizaines d'oiseaux et sont appelées « rondes », probablement parce qu'il leur arrive d'emprunter plusieurs jours de suite le même itinéraire, ce qui suggère l'idée d'un circuit.\\nLa formation des rondes plurispécifiques se superpose généralement à une organisation territoriale par espèce, les groupes monospécifiques se joignant aux rondes d'autres espèces lors du passage de celles-ci dans leurs territoires. Les bandes obéissent à une hiérarchie reposant sur le degré d'agressivité de chaque individu au sein de son espèce ou d'une espèce envers l'autre."},{"page_url":"https://tt.wikipedia.org/wiki/%D0%9C%D0%B5%D0%B4%D0%B2%D0%B5%D0%B4%D0%B5%D0%B2%D0%BD%D1%8B%D2%A3_%D0%B8%D0%BA%D0%B5%D0%BD%D1%87%D0%B5_%D0%A5%D3%A9%D0%BA%D2%AF%D0%BC%D3%99%D1%82%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Emblem_of_Ministry_of_Justice.png","page_title":"Медведевның икенче Хөкүмәте","context_page_description":"Мәкаләдә 2018 елның 8-18 маенда төзелгән Медведев Дмитрий Анатольевич рәислегендә Русия Хөкүмәте составы турында мәгълүматлар бирелә. Беренче утырыш 22 майда узды.\\nХөкүмәт структурасы Россия Федерациясе Президентының 2018 елның 15 маендагы 215 номерлы Указы белән расланды.\\n2018 елдан гамәлдә булган министрлыклар исемлеген Россия башкарма хакимиятенең федераль органнары структурасы мәкаләсендә карагыз.\\nРусия Федерациясе хөкүмәте Аппараты"},{"page_url":"https://zh.wikipedia.org/wiki/%E6%B3%A2%E7%88%BE%E6%B9%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Pohlsee_bei_Langwedel.jpg","page_title":"波爾湖","context_page_description":"波尔湖，是德国的湖泊，位于该国北部石勒苏益格-荷尔斯泰因州，由伦茨堡-埃肯弗德县负责管辖，面积0.49平方公里，海拔高度20米，平均水深7.7米，最大水深20.5米，水体容量374万立方米，湖岸线长度3.4公里。"},{"page_url":"https://it.wikipedia.org/wiki/Palazzo_G%C3%BCell","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Palau_G%C3%BCell_%28Barcelona%29_-_3.jpg","page_title":"Palazzo Güell","context_page_description":"Il Palazzo Güell è un palazzo di Barcellona ed è una delle opere dell'architetto Antoni Gaudí che sono state nominate patrimonio dell'umanità dall'UNESCO. Questa nomina ha ufficialmente riconosciuto il suo valore universale e la sua unicità come capolavoro della creatività umana.\\nÈ stato costruito come residenza di città, tra il 1885 e il 1889, per il ricco industriale Eusebi Güell, che anche in seguito fu uno dei committenti principali dell'architetto catalano. Una tra le difficoltà maggiori che Gaudí ha dovuto affrontare è stata la carenza di spazio, in pieno centro della città, vicino alle Ramblas. Alcune stanze sono quindi organizzate su più livelli, come il salone principale per ricevere gli ospiti dell'alta società: l'alto soffitto riccamente decorato presenta dei fori nei quali, di notte, venivano poste delle lanterne, così da farlo sembrare un cielo stellato.\\nTra le caratteristiche dell'edificio vanno menzionati gli archi di catenaria che qui Gaudí usa per la prima volta e che saranno un elemento costante del suo linguaggio architettonico.\\nLe decorazioni interne sono del pittore Aleix Clapés."},{"page_url":"https://pl.wikipedia.org/wiki/Ruda_nad_Moravou","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Ruda_nad_Moravou_CoA.jpg","page_title":"Ruda nad Moravou","context_page_description":"Ruda nad Moravou – gmina w Czechach, w powiecie Šumperk, w kraju ołomunieckim. Według danych z dnia 1 stycznia 2012 liczyła 2584 mieszkańców.\\nPołożona jest nad rzeką Morawą. Na terenie gminy znajduje się m.in. renesansowy pałac z XVII wieku.\\nDzieli się na sześć części:\\nRuda nad Moravou\\nBartoňov\\nHostice\\nHrabenov\\nRadomilov\\nŠtědrákova Lhota"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%86%D0%BD%D1%81%D1%82%D0%B8%D1%82%D1%83%D1%82_%D0%BF%D0%BE%D0%BB%D1%96%D1%82%D0%B8%D1%87%D0%BD%D0%B8%D1%85_%D1%96_%D0%B5%D1%82%D0%BD%D0%BE%D0%BD%D0%B0%D1%86%D1%96%D0%BE%D0%BD%D0%B0%D0%BB%D1%8C%D0%BD%D0%B8%D1%85_%D0%B4%D0%BE%D1%81%D0%BB%D1%96%D0%B4%D0%B6%D0%B5%D0%BD%D1%8C_%D1%96%D0%BC%D0%B5%D0%BD%D1%96_%D0%86._%D0%A4._%D0%9A%D1%83%D1%80%D0%B0%D1%81%D0%B0_%D0%9D%D0%90%D0%9D_%D0%A3%D0%BA%D1%80%D0%B0%D1%97%D0%BD%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/uk/0/03/%D0%9C%D0%94_%D0%AE%D1%80%D1%96%D0%B9_%D0%9B%D0%B5%D0%B2%D0%B5%D0%BD%D0%B5%D1%86%D1%8C_2016.JPG","page_title":"Інститут політичних і етнонаціональних досліджень імені І. Ф. Кураса НАН України","context_page_description":"Інститу́т політи́чних і етнонаціона́льних дослі́джень і́мені І. Ф. Ку́раса НАН України — науково-дослідний інститут відділення історії, філософії та права НАН України."},{"page_url":"https://en.wikipedia.org/wiki/Acenaphthylene","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Acenaphthylene-3D-spacefill.png","page_title":"Acenaphthylene","context_page_description":"Acenaphthylene, a polycyclic aromatic hydrocarbon is an ortho- and peri-fused tricyclic hydrocarbon. The molecule resembles naphthalene with positions 1 and 8 connected by a -CH=CH- unit. It is a yellow solid. Unlike many polycyclic aromatic hydrocarbons, it has no fluorescence."},{"page_url":"https://tr.wikipedia.org/wiki/Henry_Moore","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/MooreJerusalem1.jpg","page_title":"Henry Moore","context_page_description":"Henry Spencer Moore, İngiliz heykeltıraş. Taş ve tunçtan yaptığı soyut ama organik biçimli yapıtlarıyla, 20. yüzyılın önde gelen sanatçılarından biri olmuştur. Dünya üzerinde çeşitli yerlerde kamuya açık olarak sergilenen soyut anıtsal bronz heykelleri bulunmaktadır.\\nKullandığı şekiller genellikle insan figürünün soyutlamasıdır ve çalışmalarında özellikle anne ile çocuk ve yaslanmış figürler kullanmıştır. Moore'un eserleri -1950'lerde aileleri resmeden heykeller yaptığı dönem hariç- sıklıkla kadın vücudunu işler. Şekilleri deliklidir ya da boş hacimler içerir. Birçok yorumcu yaslanmış figürlerinin dalgalı şekillerini doğum yeri olan Yorkshire'ın tepelerine benzetir.\\nBüyük ölçekli soyut dökme bronz ve mermer heykelleri ile tanınmış ve bir ölçüde modernizmin belli bir biçiminin Birleşik Krallık'a girmesinde öncülük etmiştir. Yaşamının sonlarına doğru büyük ölçekli siparişleri tamamlaması sayesinde oldukça zengin olmuştur. Yine de sade bir yaşam sürmüş ve kazandığı paranın çoğu eğitimi ve sanatı destekleyen ve günümüzde de faaliyet gösteren Henry Moore Vakfı'na gitmiştir."},{"page_url":"https://it.wikipedia.org/wiki/S%C3%BCderhackstedt","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Suederhackstedt_Wappen.png","page_title":"Süderhackstedt","context_page_description":"Süderhackstedt è un comune di 353 abitanti dello Schleswig-Holstein, in Germania.\\nAppartiene al circondario di Schleswig-Flensburgo ed è parte della comunità amministrativa di Eggebek."},{"page_url":"https://ca.wikipedia.org/wiki/Colla_Castellera_de_Figueres","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Colla_Castellera_de_Figueres_4d7a_2007.jpg","page_title":"Colla Castellera de Figueres","context_page_description":"La Colla Castellera de Figueres és una colla castellera de Figueres, a l'Alt Empordà, fundada el 1996. El color de les seves camises és el lila.\\nLa Colla Castellera de Figueres es va constituir oficialment l'11 de setembre de 1996, en una reunió a la qual van assistir dinou persones unides per l'afició de fer castells i amb ganes de crear una nova colla castellera.\\nEl bateig va tenir lloc el diumenge 4 de maig de 1997 a la Plaça de l'Ajuntament de Figueres, en el marc de les Fires i Festes de la Santa Creu. Els padrins varen ser els Castellers de Barcelona i la Colla Castellera de Sant Pere i Sant Pau, del barri de Sant Pere i Sant Pau de Tarragona.\\nEl fet que la colla aplegués gent de tot l'Empordà va fer que el color triat per a la camisa castellera fos representatiu d'aquesta comarca: el color lila fort, color del vi empordanès. Era el petit homenatge de la colla a totes aquelles persones que, al llarg dels segles i amb el seu esforç, han tret de la terra aquest preuat fruit.\\nL'escut de la Colla és creació de la dissenyadora empordanesa Cati Palou, i simbolitza l'esforç i el treball conjunt de tots els castellers per aconseguir coronar un castell."},{"page_url":"https://he.wikipedia.org/wiki/%D7%AA%D7%97%D7%A0%D7%AA_%D7%94%D7%A8%D7%9B%D7%91%D7%AA_%D7%91%D7%90%D7%A8_%D7%A9%D7%91%D7%A2_%E2%80%93_%D7%9E%D7%A8%D7%9B%D7%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/B7centeral_train_station.jpg","page_title":"תחנת הרכבת באר שבע – מרכז","context_page_description":"תחנת הרכבת באר שבע – מרכז היא תחנת הקצה הדרומי של שירות הרכבות הבין-עירוניות של רכבת ישראל. התחנה ממוקמת בסמוך לתחנת האוטובוסים המרכזית בבאר שבע ומרוחקת מרחק הליכה מקניון הנגב ומקניון קריית הממשלה."},{"page_url":"https://en.wikipedia.org/wiki/Cyclaxyra","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/COLE_Cyclaxyridae_Cyclaxyra_politula.png","page_title":"Cyclaxyra","context_page_description":"Cyclaxyra is a genus of cucujoid beetles in the family Cyclaxyridae, and the sole extant genus in the family, others being known only from fossils. There are two described species in Cyclaxyra, found on the North Island, South Island, and Stewart Island of New Zealand.\\nCyclaxyra has been treated as part of the family Phalacridae in the past, but is now considered the only genus of the family Cyclaxyridae."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%95%E0%B5%8C%E0%B4%B9%E0%B4%9C%E0%B5%8B%E0%B4%95%E0%B5%8D%E0%B4%95%E0%B4%BF_%E0%B4%B8%E0%B5%8D%E0%B4%95%E0%B5%82%E0%B5%BE_%E0%B4%B7%E0%B5%82%E0%B4%9F%E0%B5%8D%E0%B4%9F%E0%B4%BF%E0%B4%82%E0%B4%97%E0%B5%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Kauhajoen_koulusurma_11.jpg","page_title":"കൌഹജോക്കി സ്കൂൾ ഷൂട്ടിംഗ്","context_page_description":"കൌഹജോക്കി സ്കൂൾ ഷൂട്ടിംഗ് 2008 സെപ്തംബർ 23 ന് പടിഞ്ഞാറൻ ഫിൻലാൻഡിന്റെ മുൻ പ്രവിശ്യയിൽ സീനജോക്കി യൂണിവേഴ്സിറ്റി ഓഫ് അപ്ലൈഡ് സയൻസസിൽ നടന്നു. 22 വയസുകാരനായ മട്ടി ജുഹാനി സാരി എന്നയാൾ വാൽത്തർ പി 22 സെമി ഓട്ടോമാറ്റിക് പിസ്റ്റൾ ഉപയോഗിച്ച് പത്തുപേരെ വെടിവെച്ച് കൊല്ലുകയായിരുന്നു. ഏതാനും മണിക്കൂറുകൾ കഴിഞ്ഞ് താമ്പയർ യൂണിവേഴ്സിറ്റി ഹോസ്പിറ്റലിൽ അദ്ദേഹം മരിച്ചു.ഒരു സ്ത്രീക്ക് പരുക്കേറ്റെങ്കിലും സ്ഥിരതയുള്ള അവസ്ഥയിലായിരുന്നു."},{"page_url":"https://lt.wikipedia.org/wiki/Jonas_Staugaitis","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c7/Jonas_Staugaitis_plaque.JPG","page_title":"Jonas Staugaitis","context_page_description":"Jonas Staugaitis – Lietuvos gydytojas, varpininkas, politinis bei visuomenės veikėjas."},{"page_url":"https://be.wikipedia.org/wiki/%D0%90%D1%80%D0%B3%D0%B0%D0%BD%D0%BE%D1%96%D0%B4%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Biological_cell.svg","page_title":"Арганоіды","context_page_description":"Арганоіды, ці арганелы — у цыталогіі пастаянныя спецыялізаваныя структуры ў клетках жывых арганізмаў. Кожны арганоід выконвае пэўныя функцыі, жыццёва неабходныя для клеткі. Тэрмін «Арганоіды» тлумачыцца супастаўленнем гэтых кампанентаў клеткі з органамі шматклетачнага арганізма. Арганоіды супрацьпастаўляюць часавым уключэнням клеткі, якія з'яўляюцца і знікаюць падчас абмену рэчываў.\\nЧасам арганоідамі лічаць толькі пастаянныя структуры клеткі, размешчаныя ў яе цытаплазме. Часцяком ядро і ўнутрыядзерныя структуры не завуць арганоідамі. Клетачную мембрану, вейчыкі і жгуцікі таксама звычайна не прылічваюць да арганоідаў.\\nНе завуць арганоідамі таксама рэцэптары і іншыя дробныя, малекулярнага ўзроўню, структуры. Мяжа паміж малекуламі і арганоідамі не вельмі выразная. Так, рыбасомы, якія звычайна адназначна адносяць да арганоідаў, можна лічыць і складаным малекулярным комплексам. Усё часцей да арганоідаў прылічваюць і іншыя падобныя комплексы параўнальных памераў і ўзроўню складанасці — пратэасомы, сплайсасомы і інш. У той жа час параўнальныя па памерах элементы цыташкілета звычайна да арганоідаў не адносяць."},{"page_url":"https://vo.wikipedia.org/wiki/Mayetta","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a5/Jackson_County_Kansas_Incorporated_and_Unincorporated_areas_Mayetta_Highlighted.svg","page_title":"Mayetta","context_page_description":"Mayetta binon zif in komot: Jackson, in tat: Kansas, in Lamerikän."},{"page_url":"https://da.wikipedia.org/wiki/Flughafen_D%C3%BCsseldorf_International","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/DUS_Tower_Skytrain.jpg","page_title":"Flughafen Düsseldorf International","context_page_description":"Flughafen Düsseldorf International er en international lufthavn beliggende ca. 9 km. nord for Düsseldorf i delstaten Nordrhein-Westfalen i Tyskland. Den fungerer som primær lufthavn for hele Rhin-Ruhr-området. Düsseldorf International er med sine 17,8 mio. passagerer landets tredjestørste lufthavn, kun overgået af Flughafen Frankfurt am Main og Flughafen München Franz Josef Strauß.\\nFlyselskabet LTU anvender lufthavnen som sin primære hub, og den er en vigtig hub for Lufthansa. Lufthansa har omkring 300 afgange om dagen til 53 destinationer, og har siden maj 2008 også haft langdistanceflyvninger fra lufthavnen. I alt flyver 70 selskaber fra Düsseldorf International til 186 destinationer overalt i verden.\\nLufthavnen har to landingsbaner. Der er planer om at udvide den på 3.000 m til 3.600 m, men byen Ratingen, der ligger tæt på landingsbanen, har blokeret for planerne. Lufthavnens terminal kan håndtere op til 22 mio. passagerer årligt. Lufthavnen drives af Flughafen Düsseldorf GmbH, der ejes 50% af byen Düsseldorf og 50% af Airport Partners GmbH, der igen ejes af en række andre selskaber."},{"page_url":"https://ur.wikipedia.org/wiki/%D9%86%D9%BE%D9%88%D9%84%DB%8C%D9%86%D8%8C_%D8%A7%D9%88%DB%81%D8%A7%D8%A6%DB%8C%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Henry_County_Courthouse%2C_Napoleon.jpg","page_title":"نپولین، اوہائیو","context_page_description":"نپولین، اوہائیو ریاستہائے متحدہ امریکا کا ایک شہر جو ہینری کاؤنٹی، اوہائیو میں واقع ہے۔"},{"page_url":"https://fr.wikipedia.org/wiki/Estemmenosuchus","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Estemmenosuchus_uralensis_%282%29.jpg","page_title":"Estemmenosuchus","context_page_description":"Estemmenosuchus, dont le nom signifie « crocodile à couronne », est un genre éteint de synapsides herbivores de l'ordre des thérapsides et du sous-ordre des dinocéphales. Il appartient à la famille des Estemmenosuchidae. Il vécut au milieu du Permien, il y a environ 267 millions d'années, et ses restes furent retrouvés en 1960 à côté d'Otchior, en Russie."},{"page_url":"https://en.wikipedia.org/wiki/Tourism_in_Romania","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Rodnei_Mountains%2C_Maramures%2C_Romania._%2841659834262%29.jpg","page_title":"Tourism in Romania","context_page_description":"According to National Tourism Statistics 15.7 million domestic and foreign tourists stayed in overnight accommodations in 2018. Of these 2.2 million are recorded as foreign tourists.\\nRomania's tourism sector had a direct contribution of EUR 5.21 billion to the Gross Domestic Product in 2018, slightly higher than in 2017, placing Romania on the 32nd place in the world, ahead of Slovakia and Bulgaria, but behind Greece and the Czech Republic. The total tourism sector's total contribution to Romania's economy, which also takes into account the investments and spending determined by this sector, was some EUR 15.3 billion in 2018, up by 8.4% compared to 2017.\\nIn the first three months of the year 2018, there were 3.12 millions of foreign tourists. Compared to the same 3 months of the previous year, arrivals increased by 10.9% and overnight stays in accommodation establishments increased by 7.1%.\\nIn the first nine months of the year 2019, there were 10 millions of foreign tourists. Compared to the same 9 months of the previous year, arrivals increased by 10.2%.\\nThe most visited cities are Bucharest, Constanța, Brașov, Timișoara, Sibiu, Alba-Iulia, Cluj-Napoca, Sighișoara and Iași."},{"page_url":"https://nl.wikipedia.org/wiki/Placospongiidae","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Placospongia_sp..jpg","page_title":"Placospongiidae","context_page_description":"Placospongiidae is een familie van sponsdieren uit de klasse van de Demospongiae."},{"page_url":"https://eo.wikipedia.org/wiki/Amano","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Amman.jpg","page_title":"Amano","context_page_description":"Amano estas milionurbo, la ĉefurbo de Jordanio ekde 1921 kaj kun preskaŭ 1 500 mil da loĝantoj ĝi estas la plej granda kaj grava urbo de Jordanio."},{"page_url":"https://it.wikipedia.org/wiki/Castello_di_Urach","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Schlo%C3%9F-Urach-2010-2.JPG","page_title":"Castello di Urach","context_page_description":"Il castello di Urach, si trova nella città di Bad Urach, nel circondario di Reutlingen, in Germania.\\nLa zona del castello è formata dalla torre d'ingresso e da un edificio di guardia; il castello vero e proprio, a pianta rettangolare, è un edificio coperto dal timpano principale con estensione lato ovest, da un'altra torre rettangolare e dalla grande torre sud.\\nIl castello ospita la cosiddetta Golden Hall, una delle sale da ballo più belle del Rinascimento in Germania. La sala è divisa da colonne corinzie con capitelli. Pareti e pilastri sono riccamente dorati e questo spiega il nome della sala."},{"page_url":"https://nl.wikipedia.org/wiki/Drie_Tommen_(Montenaken)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Gingelom-Drie_Tommen_%282%29.JPG","page_title":"Drie Tommen (Montenaken)","context_page_description":"De Drie Tommen zijn Gallo-Romeinse tumuli, tommen of grafheuvels ten noordoosten van Kortijs en ten zuidoosten van Montenaken, in de Belgisch-Limburgse gemeente Gingelom. De drie grafheuvels maken deel uit van een groep van 6 tommen binnen een straal van 1,5 kilometer rond Montenaken en dateren uit de tweede helft van de tweede eeuw na Christus. Ze zijn gelegen aan de Drie Tombenstraat, waarbij deze weg de noordelijke twee scheidt van de zuidelijke grafheuvel.\\nIn 1862 werden de tommes opgegraven door Henri Schuermans en August Kempeneers. In de noordelijke heuvel lag op de plaats van de brandstapel, hier vonden ze crematieresten. In de middelste heuvel vonden ze een grafkelder met niet minder dan 42 voorwerpen, waaronder een paarsgekleurd glazen flesje in de vorm van een druiventros. De zuidelijke heuvel was leeg.\\nIn 1979 werden de Drie Tommen beschermd als monument."},{"page_url":"https://de.wikipedia.org/wiki/Ranomi_Kromowidjojo","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Ranomi_Kromowidjojo_2010_closeup.jpg","page_title":"Ranomi Kromowidjojo","context_page_description":"Ranomi Kromowidjojo ist eine niederländische Schmetterlings- und Freistilschwimmerin. Sie ist Olympiasiegerin 2012 über 50 und 100 Meter Freistil und Weltmeisterin 2013 über 50 Meter Freistil. Bei Olympischen Spielen, Welt- und Europameisterschaften gewann sie bis 2019 79 Medaillen, davon 35 in Einzeldisziplinen."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Jefferson_County,_New_York","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/First_Baptist_Church_and_Cook_Memorial_Building_Jul_10.jpg","page_title":"National Register of Historic Places listings in Jefferson County, New York","context_page_description":"List of the National Register of Historic Places listings in Jefferson County, New York\\nThis is intended to be a complete list of properties and districts listed on the National Register of Historic Places in Jefferson County, New York. The locations of National Register properties and districts may be seen in a map by clicking on \\"Map of all coordinates\\".\\nThis National Park Service list is complete through NPS recent listings posted July 31, 2020."},{"page_url":"https://es.wikipedia.org/wiki/Iglesia_de_San_Mart%C3%ADn_(Cu%C3%A9llar)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/ISanMartinCuellar2.jpg","page_title":"Iglesia de San Martín (Cuéllar)","context_page_description":"La iglesia de San Martín es un templo católico localizado en la villa de Cuéllar, provincia de Segovia. Fue construida en el siglo XII y está situada frente al Castillo de Cuéllar, en la explanada que constituyó la ciudadela en la Edad Media y dentro de la primera muralla del recinto murado de la villa. En 1931 fue declarada monumento artístico nacional, y está catalogada en la actualidad como Bien de Interés Cultural. En el mes de abril de 1354 fue escenario del matrimonio celebrado entre Pedro I de Castilla con Juana de Castro.\\nConstruida en mampostería y ladrillo, su planta se asienta sobre una nave central y dos laterales más pequeñas, con cinco tramos, que terminan en la cabecera con triple ábside de tramo recto y remate semicircular. La nave de la Epístola es ligeramente más larga, y los tramos y las naves se separan por pilares sobre los que se apoyan arcos doblados de ladrillo rodeados de un alfiz.\\nLa cabecera consta de tres ábsides poligonales al exterior y semicirculares al interior, cubiertos con bóvedas de medio cañón."},{"page_url":"https://de.wikipedia.org/wiki/Versorgungsschiff","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/USNS_Regulus.jpg","page_title":"Versorgungsschiff","context_page_description":"Militärische Versorgungsschiffe sind Hilfsschiffe, die der Versorgung von Kriegsschiffen mit Brennstoffen, Proviant, Munition und anderen Gütern auf See, vor Anker oder im Hafen dienen. Ihre Aufgabe ist es, die Einsatzzeiten der Kriegsschiffe auf See und außerhalb ihrer Heimatbasis zu vergrößern. Ebenfalls zu den Versorgungsschiffen gehören Trossschiffe, die Kampfeinheiten nicht unmittelbar im Einsatz unterstützen, sondern für die Folgeversorgung und -unterstützung eingesetzt werden. Dazu gehören unter anderem Materialtransporter, Betriebsstofftransporter und Werkstattschiffe. Sie liefern Versorgungsgüter an die Flottenversorger und Tender oder leisten größere Reparaturen außerhalb der eigentlichen Konfliktzone."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%A6%96%E5%B0%94%E4%BA%A4%E9%80%9A%E5%85%AC%E7%A4%BE1000%E7%B3%BB%E7%94%B5%E9%98%BB%E6%8E%A7%E5%88%B6%E7%94%B5%E5%8A%9B%E5%8A%A8%E8%BD%A6%E7%BB%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Seoul_Metropolitan_Subway_Corp_old_EMU_1000.jpg","page_title":"首尔交通公社1000系电阻控制电力动车组","context_page_description":"首爾交通公社1000系電阻控制電聯車是首爾地鐵的一款通勤型電聯車，在首都圈電鐵1號線營運。"},{"page_url":"https://ja.wikipedia.org/wiki/%E5%8C%97%E4%B9%9D%E5%B7%9E%E5%B8%82%E7%AB%8B%E6%96%87%E5%AD%A6%E9%A4%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Kitakyusyu_Central_Library.jpg","page_title":"北九州市立文学館","context_page_description":"北九州市立文学館は、福岡県北九州市小倉北区城内にある文学資料館。初代館長は門司区在住のノンフィクション作家、佐木隆三。"},{"page_url":"https://fa.wikipedia.org/wiki/%D9%84%DB%8C%E2%80%8C%D9%84%DB%8C_%D8%A8%D8%B1%DA%A9%DB%8C","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/30/Berky_Lili.jpg","page_title":"لی‌لی برکی","context_page_description":"لی‌لی برکی هنرپیشه اهل مجارستان بود. از فیلم‌هایی که وی در آن نقش داشته‌است، می‌توان به تبعید، دختران امروزی، خودروی رؤیایی و شب‌های روشن اشاره کرد."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%9C%D0%B5%D1%82%D0%B8%D0%BE%D0%BD%D0%B8%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/L-methionine-B-3D-balls.png","page_title":"Метионин","context_page_description":"Метионин е органско соединение. Претставува есенцијална аминокиселина."},{"page_url":"https://pt.wikipedia.org/wiki/Lista_dos_condes_de_Kladsko","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/92/Henryk_VI_Dobry_tomb_effigy.PNG","page_title":"Lista dos condes de Kladsko","context_page_description":"Em 1280, tendo Rodolfo I de Habsburgo derrotado Otacar II da Boémia, deu o Condado à Dinastia Piast."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E7%B6%AD%E6%8B%89%E8%92%82%E7%B1%B3%E7%88%BE%C2%B7%E9%87%91%E8%BB%8A%E5%8A%A0%E4%BB%80%E7%B6%AD%E5%88%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Vladimer_Khinchegashvili_Rio2016.jpg","page_title":"維拉蒂米爾·金車加什維利","context_page_description":"维拉蒂米尔·金车加什维利是乔治亚自由式角力运动员，参赛量级60公斤以下级。他夺得2012年奥运银牌和2016年奥运金牌。他也夺得2015年世界冠军和2014与2016年欧洲冠军。2015年被乔治亚青年事务与体育部选为年度最佳男运动员。"},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%A4%D8%AA%D9%85%D8%B1_%D9%83%D8%A7%D9%8A%D9%88%D8%B3_%D9%84%D9%84%D8%A7%D8%AA%D8%B5%D8%A7%D9%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/2017-12-28_Leipzig%2C_34c3%2C_Fairy_Dust_%28freddy2001%29_-_denoised_and_pixelized.jpg","page_title":"مؤتمر كايوس للاتصال","context_page_description":"مؤتمر كايوس للاتصال هو مؤتمر سنوي ينظمه نادي كايوس للحاسوب. يقدم المؤتمر مجموعة متنوعة من المحاضرات وورش العمل حول القضايا التقنية والسياسية المتعلقة بالأمن، والتشفير، والخصوصية، وحرية التعبير على الإنترنت. ويتم تنظيم الحدث بانتظام في نهاية كل عام منذ عام 1984.\\nيعتبر الحدث من أكبر الأحداث من هذا النوع، إلى جانب ديف كون في لاس فيغاس."},{"page_url":"https://en.wikipedia.org/wiki/Simtokha_Dzong","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Simtokha_Dzong%2C_Bhutan_03.jpg","page_title":"Simtokha Dzong","context_page_description":"Simtokha Dzong also known as Sangak Zabdhon Phodrang is a small dzong. It was built in 1629 by Zhabdrung Ngawang Namgyal, who unified Bhutan. It is the first of its kind built in Bhutan. An important historical monument and former Buddhist monastery, today it houses one of the premier Dzongkha language learning institutes. It recently underwent renovation."},{"page_url":"https://en.wikipedia.org/wiki/Swallow_TP","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/dc/Swallow_TP_at_Yanks_Chino_05.01.jpg","page_title":"Swallow TP","context_page_description":"The Swallow TP was a trainer aircraft produced by the Swallow Airplane Company in the United States from 1928."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%BD%D1%80%D1%96_%D0%9F%D1%83%D0%B0%D0%BD%D0%BA%D0%B0%D1%80%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Henri_Poincar%C3%A9-2.jpg","page_title":"Анрі Пуанкаре","context_page_description":"Жуль Анрі́ Пуанкаре́ — французький математик, фізик, філософ і теоретик науки. Голова Паризької академії наук і Французької академії. Пуанкаре називають одним з найбільших математиків всіх часів, останнім математиком-універсалом, людиною, здатною охопити всі математичні результати свого часу.\\nЧлен Лондонського королівського товариства, іноземний член-кореспондент Петербурзької АН, член Геттінгенської академії наук, президент Французького астрономічного товариства, член Бюро довгот в Парижі."},{"page_url":"https://es.wikipedia.org/wiki/Castillo_de_Ahrensburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Schlossbr%C3%BCcke_Ahrensburg.1.ajb.jpg","page_title":"Castillo de Ahrensburg","context_page_description":"El castillo de Ahrensburg es un antiguo castillo de Alemania del siglo XVI erigido en ubicado en Ahrensburg, en el sur del estado de Schleswig-Holstein, a treinta kilómetros al noreste del centro de Hamburgo. Antiguo Herrenhaus, ahora conocido como schloss, es una de las maravillas del Renacimiento del norte de Alemania. El castillo está rodeado por un parque inglés."},{"page_url":"https://en.wikipedia.org/wiki/United_States_representatives_at_Miss_World","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Miss_United_States_08_Lane_Lindell.jpg","page_title":"United States representatives at Miss World","context_page_description":"The United States has continuously sent a representative to Miss World since its inception in 1951. The United States has won the Miss World crown three times in 1973, 1990 and 2010. Currently, Miss World America is the official national pageant that selects the contestant from the United States to Miss World.\\nThe current Miss World America is Emmy Cuvelier of South Dakota who was crowned on October 12, 2019 in Las Vegas, Nevada."},{"page_url":"https://ca.wikipedia.org/wiki/Friville-Escarbotin","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/49/Map_commune_FR_insee_code_80368.png","page_title":"Friville-Escarbotin","context_page_description":"Friville-Escarbotin és un municipi francès, situat al departament del Somme i a la regió dels Alts de França. L'any 2007 tenia 4.518 habitants."},{"page_url":"https://pl.wikipedia.org/wiki/Biologia","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Tree_Fern.jpg","page_title":"Biologia","context_page_description":"Biologia – nauka przyrodnicza zajmująca się badaniem życia i organizmów żywych."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%81%D8%B6%D9%84_%D8%A7%D9%84%D9%81%D8%B6%D9%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Bahij_alfadel.JPG","page_title":"فضل الفضل","context_page_description":"فضل حسن الفضل، سياسي ونائب لبناني سابق، من عائلة التي لعبت دورا مهما في تاريخ جبل عامل، ومن أحفاد الزعيم حيدر الفارس الصعبي الذي تزعّم بلاد الشقيف في القرن الثامن عشر. توفي في العام 1935 ميلادي. وهو والد النائب بهيج فضل الفضل."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Saint-Martin_de_Haux","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Haux_%C3%A9glise_St_Martin_Pi%C3%A9ta.JPG","page_title":"Église Saint-Martin de Haux","context_page_description":"L'église Saint-Martin est une église catholique située dans la commune de Haux, dans le département de la Gironde, en France."},{"page_url":"https://ca.wikipedia.org/wiki/Mar%C3%ADa_Rey","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/%28Mar%C3%ADa_Rey%29_Debate_electoral_de_Telemadrid_%282019%29.jpg","page_title":"María Rey","context_page_description":"María Rey és una periodista espanyola. Llicenciada en ciències de la informació per la Universitat Complutense de Madrid, va començar la seva carrera professional en l'emissora local de la Cadena SER a la seva ciutat natal. Està casada, des del 24 de juliol de 1998, amb el periodista Manuel Campo Vidal."},{"page_url":"https://is.wikipedia.org/wiki/1981","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Iran_hostages_return.jpg","page_title":"1981","context_page_description":"Árið 1981 var 81. ár 20. aldar og hófst á fimmtudegi."},{"page_url":"https://es.wikipedia.org/wiki/Alexander_Dereviagin","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Aleksandr_Derevyagin_at_Josef_Odlozil_Memorial_in_Prague_14June2010_116.jpg","page_title":"Alexander Dereviagin","context_page_description":"Alexander Dereviagin es un atleta ruso especializado en la prueba de 4x400 m, en la que consiguió ser medallista de bronce mundial en pista cubierta en 2006.​"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BE%D0%BC%D0%B5%D1%80%D1%81%D0%B5%D1%82_(%D0%9A%D0%B2%D1%96%D0%BD%D1%81%D0%BB%D0%B5%D0%BD%D0%B4)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Government_House_at_Somerset%2C_Cape_York%2C_Queensland.jpeg","page_title":"Сомерсет (Квінсленд)","context_page_description":"Со́мерсет — історична місцевість, резиденція для адміністрування області Торресової протоки, а тепер — руїни колишньої садиби Сомерсет, розташованої приблизно за 35 км на північ від міста Бамага на півострові Кейп-Йорк у Квінсленді, Австралія. За переписом 2011 року місцевість не має постійного населення."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A6%CF%84%CE%B5%CF%81%CE%B9%CE%BA%CE%BF%CF%8D%CE%B4%CE%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/NicosiaDistrictFterikoudi.png","page_title":"Φτερικούδι","context_page_description":"Το Φτερικούδι είναι κοινότητα της επαρχίας Λευκωσίας στην Κύπρο."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%A4%E0%A6%BE%E0%A6%B0%E0%A6%BE_(%E0%A6%AC%E0%A7%8C%E0%A6%A6%E0%A7%8D%E0%A6%A7%E0%A6%A7%E0%A6%B0%E0%A7%8D%E0%A6%AE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/GreenTara150.jpg","page_title":"তারা (বৌদ্ধধর্ম)","context_page_description":"তারা বা আর্যতারা হলেন মহাযান বৌদ্ধধর্মের একজন নারী বোধিসত্ত্ব, যিনি বজ্রযান বৌদ্ধধর্মে একজন নারী বুদ্ধের মর্যাদা পান। তিব্বতি বৌদ্ধধর্মে তাকে জেতসুন দোলমা বলা হয়। তিনি \\"নির্বাণ-জননী\\" হিসেবে পরিচিত। তারা কাজ ও কীর্তির গুণাবলির সাফল্যের প্রতিনিধি। জাপানে তিনি \\"তারা বোসাতসু\\" নামে পরিচিত। চীনা বৌদ্ধধর্মে তিনি দৌলাও পূসা নামে স্বল্প-পরিচিত।\\nতারা একজন তান্ত্রিক ধ্যান দেবী। বজ্রযান বৌদ্ধধর্মের তিব্বতি শাখাটি তার ধ্যান অনুশীলন করে আন্তরিক গুণাবলির বিকাশ এবং দয়া ও শূন্যতার বাইরের, অন্তরের এবং গোপন শিক্ষা অনুধাবনের জন্য। একই শ্রেণীর বুদ্ধ বা বোধিসত্ত্বগণের গোষ্ঠীনাম হিসেবেও তারা শব্দটি ব্যবহৃত হয়। বোধিসত্ত্বেরা প্রায়শই বৌদ্ধ গুণাবলির উপমা হিসেবে ব্যবহৃত হন। সেই দিক থেকে এই ধারণাটি আরও স্পষ্টভাবে ব্যাখ্যা করা যায়।\\nতারার সুপরিচিত রূপগুলির মধ্যে উল্লেখযোগ্য:\\nহরিত তারা, বোধিপ্রাপ্ত ক্রিয়াকর্মের বুদ্ধ হিসেবে পরিচিত।\\nশুক্লতারা, দয়া, দীর্ঘজীবন, আরোগ্যদান ও শান্তি হিসেবে পরিচিত; এছাড়াও চিন্তাচক্র বা কল্পতরু চক্র হিসেবেও পরিচিত।\\nরক্ততারা, সকল ভাল জিনিস চুম্বকীকরণের সঙ্গে যুক্ত ভয়াবহ রূপ।\\nকৃষ্ণতারা, শক্তির সঙ্গে যুক্ত।\\nপীততারা, সম্পদ ও বিকাশের সঙ্গে যুক্ত।\\nনীলতারা, ক্রোধের পরিবর্তনের সঙ্গে যুক্ত।"},{"page_url":"https://ro.wikipedia.org/wiki/Re%C8%9Beaua_Expres_Regional%C4%83_(Bruxelles)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/CityRail_Brussel-Noord.jpg","page_title":"Rețeaua Expres Regională (Bruxelles)","context_page_description":"Rețeaua Expres Regională, prescurtat RER, este un proiect care prevede construcția unei rețele de trenuri preorășenești în și în jurul Regiunii Bruxelles din Belgia. Scopul proiectului este de a realiza legături mai rapide și cu o frecvență mai ridicată pe o rază de aproximativ 30 km în jurul Bruxelles-ului, într-o regiune locuită de peste 2 milioane de persoane.\\nNumele provine de la rețeaua RER din Paris, iar denumirea neerlandeză este o traducere fidelă a denumirii franceze. Serviciul RER din Paris este asigurat în exclusivitate cu ajutorul trenurilor. În Bruxelles, Rețeaua Expres Regională integrează diverse mijloace de transport în comun, precum tren, metrou, tramvaie și autobuze. Acest lucru este realizat prin corelarea orarelor acestor mijloace de transport și prin posibilitatea de a plăti călătoria cu oricare din ele prin intermediul cartelei electronice contactless MOBIB.\\nÎn principiu, rețeaua RER bruxelleză ar fi trebuit să intre în serviciu încă din anul 2012, dar din cauza unor întârzieri în executarea unor lucrări de infrastructură feroviară, anumite secțiuni ale rețelei nu vor deveni operaționale decât în 2025."},{"page_url":"https://en.wikipedia.org/wiki/Bound_(Star_Trek:_Enterprise)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Cyia_Batten_by_David_Shankbone.jpg","page_title":"Bound (Star Trek: Enterprise)","context_page_description":"\\"Bound\\" is the seventeenth episode of the fourth season of the American science fiction television series Star Trek: Enterprise, originally broadcast on April 15, 2005. It was written by showrunner Manny Coto, and directed by Allan Kroeker. The episode featured the return of the Orion slave girls, which had been originally seen in the original pilot of Star Trek: The Original Series, \\"The Cage\\".\\nSet in the 22nd century, the series follows the adventures of the first Starfleet starship Enterprise, registration NX-01. In this episode, three Orion slave girls come on board the ship, and the crew, with the exception of Commander \\"Trip\\" Tucker and Commander T'Pol who seem to have a resistant psychic bond, begin acting strangely.\\nThe episode featured the return of Cyia Batten and William Lucking who had both previously appeared in multi-episode parts in Star Trek: Deep Space Nine. Four time MTV Music Video Award for Choreography winner Travis Payne was brought on board to oversee the extensive choreography for the three actresses playing the Orion women. Each actress went through a four to five-hour make-up process for each day of filming, which required them to be sprayed green."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A4%D7%95%D7%A8%D7%93_%D7%90%D7%99%D7%99%D7%A4%D7%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/193X_Ford_Eifel_LA22.jpg","page_title":"פורד אייפל","context_page_description":"פורד אייפל היא מכונית משפחתית קטנה תוצרת יצרנית הרכב \\"Ford Germany\\", חברת בת של קונצרן הרכב פורד, אשר יוצרה בין השנים 1935–1940.\\nדגם ה\\"פורד אייפל\\" הורכב בהונגריה בין השנים 1937–1939.\\nסך הכול יוצרו 62,495 יחידות."},{"page_url":"https://de.wikipedia.org/wiki/Hospice_g%C3%A9n%C3%A9ral","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/La_Nouvelle_Roseraie.jpg","page_title":"Hospice général","context_page_description":"Das „Hospice général“ ist eine Genfer Einrichtung. Sie wurde 1535 gegründet und hat den Zweck, bedürftigen Menschen zu helfen. In ihrer heutigen Funktion als Sozialamt des Kantons Genf engagiert sich die Institution verantwortungsbewusst für die Würde der schwächsten Gesellschaftsmitglieder und unterstützt Hilfebeziehende mit aktiven Massnahmen, damit sie möglichst schnell und dauerhaft in eine unabhängige Existenz zurückkehren können."},{"page_url":"https://de.wikipedia.org/wiki/J%C3%BCdischer_Friedhof_Remscheid-Bliedinghausen","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/J%C3%BCdischer_Friedhof_Remscheid-Bliedinghausen_Reihengr%C3%A4ber.jpg","page_title":"Jüdischer Friedhof Remscheid-Bliedinghausen","context_page_description":"Der Jüdische Friedhof Remscheid ist Teil des kommunalen Friedhofes und liegt im Remscheider Stadtteil Bliedinghausen; dieser befindet sich unmittelbar neben dem evangelischen Südfriedhof. Der jüdische Friedhof steht seit dem 14. Februar 2006 mit der Nummer 658 unter Denkmalschutz."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E9%9C%8D%E6%99%AE%E5%A8%81%E7%88%BE%E9%8E%AE%E5%8D%80_(%E4%BC%8A%E5%88%A9%E8%AB%BE%E4%BC%8A%E5%B7%9E%E9%A6%AC%E6%AD%87%E7%88%BE%E7%B8%A3)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Lake_Wildwood%2C_Hopewell_Township%2C_Marshall_County%2C_IL_61375%2C_USA_-_panoramio_%285%29.jpg","page_title":"霍普威爾鎮區 (伊利諾伊州馬歇爾縣)","context_page_description":"霍普威尔镇区是位于美国伊利诺伊州马歇尔县的一个行政镇区。"},{"page_url":"https://ar.wikipedia.org/wiki/%D9%83%D8%A7%D8%B2%D8%A7%D8%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Kazakhs_people.jpg","page_title":"كازاخ","context_page_description":"شعب الكازاخ أو القازاق هو أحد الشعوب التركية الموجودة بالجزء الشمالي من آسيا الوسطى، ويتركزون في كازاخستان، ولكن يوجد منهم في أوزبكستان، الصين وروسيا ومنغوليا. يرجع الكازاخ إلى أصول تركية ممثلة بقبائل القبجاق والكومان والنوغاي وقارلوق والخانكليز التركية. ومجموعات منغولية كالكيات والمنغود والجلاير والدغلات وغيرهم. ومن قبائل هندو-إيرانية كالووسون والسرمت والسكيثيين وغيرهم، وسكنوا بالمناطق الممتدة ما بين سيبيريا والبحر الأسود وقد بقوا في آسيا الوسطى عندما بدأ المغول والترك بحملاتهم العسكرية ما بين القرنين الخامس وحتى الثالث عشر."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_in_St._Egyden_am_Steinfeld","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/St._Egyden_hl._Florian.JPG","page_title":"Liste der denkmalgeschützten Objekte in St. Egyden am Steinfeld","context_page_description":"Die Liste der denkmalgeschützten Objekte in St. Egyden am Steinfeld enthält die 16 denkmalgeschützten, unbeweglichen Objekte der Gemeinde St. Egyden am Steinfeld im niederösterreichischen Bezirk Neunkirchen."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B4%D5%A5%D5%AC%D5%B8%D5%BD","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/58/House_of_the_Trident_03.jpg","page_title":"Դելոս","context_page_description":"Դելոս, Դիլոս, հունական կղզի Եգեյան ծովում, Կիկլադներ արշիպելագում: Ներկա դրությամբ կղզին կամ անմարդաբնակ է, կամ քիչ բնակեցված: 2001 թվականին անցկացված մարդահամարի ժամանակ կղզում բնակվում էր 14 բնակիչ:\\nՀին հունական դիցաբանության համաձայն, Դելոս կղզու վրա են լույս աշխարհ եկել Ապոլլոն և Արտեմիս աստվածները: Հին ժամանակներից Դելոս կղզին սրբավայր էր հանդիսանում հույների համար: Կղզու վրա կան բազմաթիվ տեսարժան վայրեր, այդ թվում նաև Ապոլլոնի և Դիոնիսոսի տաճարները:\\nԿղզին պահպանել է Եգեյան աշխարհի տարբեր քաղաքակրթությունների բազմաթիվ հետքեր սկսած նախաքրիստոնեական ժամանակաշրջանի մ.թ.ա. 3-րդ հազարամյակից: Դելոսի ճարտարապետական հուշարձանները բազմազան են և շատ խիտ կենտրոնացած, ձևավորում են խոշոր բազմազգ միջերկրածովյան նավահանգստի կերպար:"},{"page_url":"https://en.wikipedia.org/wiki/Vehicle_registration_plates_of_Missouri","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/1973_Missouri_license_plate_PM3-127.jpg","page_title":"Vehicle registration plates of Missouri","context_page_description":"The U.S. state of Missouri first required its residents to register their motor vehicles in 1907. Registrants provided their own license plates for display until 1911, when the state began to issue plates.\\nPlates are currently manufactured at the Jefferson City Correctional Center and are issued by the Missouri Department of Revenue. Front and rear plates are required on all vehicles except for motorcycles and trailers."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E8%B5%A4%E5%9D%82%E5%AE%BF_(%E6%9D%B1%E6%B5%B7%E9%81%93)","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c0/Tokaido36_Akasaka.jpg","page_title":"赤坂宿 (東海道)","context_page_description":"赤坂宿是日本江户时代驿道东海道沿线的宿场之一，是东海道五十三次中的第36个宿场，其位置相当于今日的爱知县丰川市赤坂町。"},{"page_url":"https://es.wikipedia.org/wiki/Scania","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Scania_LBS140S46235_Truck_1975.jpg","page_title":"Scania","context_page_description":"Scania AB es un fabricante sueco de camiones pesados, autobuses y motores diésel, propiedad del Grupo Volkswagen, establecido en Södertälje, Suecia."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%AD%E0%B8%B2%E0%B8%A3%E0%B8%A1%E0%B8%B2%E0%B9%80%E0%B8%81%E0%B8%94%E0%B9%82%E0%B8%94%E0%B8%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Johannes_op_Patmos_Saint_John_on_Patmos_Berlin%2C_Staatlichen_Museen_zu_Berlin%2C_Gemaldegalerie_HR.jpg","page_title":"อารมาเกดโดน","context_page_description":"อารมาเกดโดน เป็นสมรภูมิการยุทธ์อันเกี่ยวข้องกับคำพยากรณ์วันสิ้นโลกตามความเชื่อของศาสนาอับราฮัม\\nตามความเชื่อของฝ่ายบุพสหัสวรรษนิยม พระเมสสิยาห์จะเสด็จมาอีกครั้ง เพื่อขจัดศัตรูของพระคริสต์ ซึ่งคัมภีร์ไบเบิลขนานเขาเหล่านั้นว่า \\"สัตว์\\" โดยพระเมสสิยาห์จะกระทำสงคราม ณ สมรภูมิอารมาเกดโดน เพื่อยังให้ \\"สัตว์\\" ทั้งปวงปลาสนาการไป และบัดนั้น ซาตานจักถูกผลักไสลงสู่ \\"ช่องบาดาล\\" หรือ \\"นรกขุมลึก\\" เป็นเวลาหนึ่งพันปี ซึ่งเรียกว่า \\"ยุคพันปี\\" ทว่า เมื่อซาตานได้รับการปลดปล่อยจากนรกแล้ว มันจักประชุมฝูงชนแห่ง \\"ยะยูจและมะยูจ\\" จาก \\"มุมทั้งสี่ของแผ่นดินโลก\\" และประดาพลมากลุ้มรุมล้อม \\"องค์บริสุทธิ์\\" และ \\"นครอันเป็นที่รัก\\" เอาไว้ ฝ่ายพระเจ้าจะบันดาลเพลิงกาฬร่วงลงจากชั้นฟ้า และผลาญไหม้เหล่ายะยูจและมะยูจ เมื่อนั้น ปีศาจที่ล่อลวงชนแห่งยะยูจและมะยูจมา ก็จะถูกทิ้งลง \\"บึงไฟนรก\\" ที่ซึ่งฝูง \\"สัตว์\\" และ \\"ผู้เผยพระวจนะเท็จ\\" ถูกส่งลงมาเมื่อพันปีก่อนหน้านี้\\nคำภาษาอังกฤษว่า \\"Armageddon\\" มาจากภาษาฮีบรูว่า \\"har məgiddô\\" หมายถึง \\"เขาเมกิดโด\\" สถานที่ทำสงครามหลายครั้งในสมัยโบราณ"},{"page_url":"https://cs.wikipedia.org/wiki/Obsah_st%C3%A1tn%C3%ADch_map_velk%C3%A9ho_m%C4%9B%C5%99%C3%ADtka","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/%C4%8CSN_01_3411_%281980%29_%28str_44%29.png","page_title":"Obsah státních map velkého měřítka","context_page_description":"Obsah státních map velkého měřítka byl v průběhu času určen různými normami a proto se postupně vyvíjel.\\nStátní norma ČSN 73 0401, účinná od roku 1990, definuje státní mapové dílo jako „mapové dílo vyhotovené ve státním zájmu“, a dále uvádí, že „jeho vytváření, vydávání, udržování či obnovování a dokumentace je v působnosti státního orgánu“.\\nSamotné mapové dílo je pak vymezeno v normě ČSN 73 0402 jako „souhrn mapových listů, které pokrývají souvisle území, jehož zobrazení v daném měřítku není možné na jedné mapě“."},{"page_url":"https://tg.wikipedia.org/wiki/%D2%B2%D0%B0%D1%84%D1%82%D0%BA%D3%AF%D0%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Lakes_of_Tajikistan_21.JPG","page_title":"Ҳафткӯл","context_page_description":"Ҳафткӯл – яке аз силсилакӯлҳои мавзеъҳои табии Тоҷикистон мебошад. Ҳафткӯл дар кӯҳистони Фон қаторкӯҳҳои Зарафшон воқеъ аст."},{"page_url":"https://en.wikipedia.org/wiki/Nakajima_Utako","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/NakajimaUtako.jpg","page_title":"Nakajima Utako","context_page_description":"Nakajima Utako was a Japanese waka and tanka poet and conservatory founder. Associated with Keien court poetry, she founded the Haginoya poetry school, the most notable of the poetry conservatories during the Meiji period.\\nNakajima Utako was born in 1844, the second daughter of Nakajima Matazaemon. Her childhood name was Tose. As descendants of the statesman, Ōta Dōkan, the builder of Edo Castle, the Nakajimas were known for generations as village leaders. The house of Fukushima, the mother's family, was also a powerful trading house and court supplier of the shōgun. The mother was active in the inner service of Kawagoe Castle and was able to establish close relations with the house of Nabeshima. When Nakajima was 10 years old, she became a maid of honor in the estate of the highest administrative officer of Matsudaira in Harima Province. At the age of 18, she married a vassal of Mito-han, Hayashi Chūzaemon, and moved with him to Mito. But he was seriously injured in 1864, just before the Meiji restoration, and committed suicide. After the Meiji restoration, Nakajima returned to Edo, where she received an education in waka and calligraphy under Katō Chinami."},{"page_url":"https://de.wikipedia.org/wiki/Kadettenhaus_Neubau_(Berlin)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Kadettenhaus_Neubau_1828_%28W_Br%C3%BCcke%29.jpg","page_title":"Kadettenhaus Neubau (Berlin)","context_page_description":"Der repräsentative Neubau des Berliner Kadettenhauses beherbergte das preußische Kadettenkorps von 1777 bis 1878, bevor dieses nach Groß-Lichterfelde in die neue „Königlich Preußische Hauptkadettenanstalt“ umzog."},{"page_url":"https://sr.wikipedia.org/wiki/Egzit_08","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/EXIT_08_bine.jpg","page_title":"Egzit 08","context_page_description":"Egzit 08 je trajao od 10. do 13. jula 2008. godine, a nastupilo je oko 600 izvođača na 25 festivalskih bina. Za četiri dana Petrovaradinsku tvrđavu je posetilo preko 160.000 ljudi među kojima su veliki procenat činili stranci. Kamp za posetioce je bio otvoren deset dana, a postavljena je i posebna bina na plaži pored Dunava. Drugu godinu za redom, kao sredstvo plaćanja su korišćeni Tokeni. Ove godine udruženje Egzit je organizovalo i Internacionalni festival filma i novih medija pod nazivom „SinemaSiti“ koji je održan u periodu od 14. do 21. juna. Britanski list Gardijan je Egzit svrstao u 12 najpoželjnijih destinacija za putovanje u 2008. godini.\\nPored muzike, velika pažnja je posvećena i drugim sadržajima. Na sceni Agora su održavane tribine čija je centralna tema bila priključenje Srbije Evropskoj uniji, dok je Studentska Unija Srbije na bini pod nazivom SUS organizovala predavanja o programima studentske razmene i stipendiranja, principima Bolonjske deklaracije, školu novinarstva itd. Na Sajmu nevladinih organizacija svoj program je predstavilo 86 domaćih i inostranih organizacija."},{"page_url":"https://de.wikipedia.org/wiki/Mario_Botta","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Maastricht2013%2C_Avenue_C%C3%A9ramique01.jpg","page_title":"Mario Botta","context_page_description":"Mario Botta ist ein Schweizer Architekt und Mitbegründer, Architekturprofessor und Leiter der der Università della Svizzera italiana in Mendrisio."},{"page_url":"https://cs.wikipedia.org/wiki/V%C3%BDtvarn%C3%A1_%C5%A1kola_V%C3%A1clava_Hollara","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Vy%C5%A1%C5%A1%C3%AD_odborn%C3%A1_%C5%A1kola_a_St%C5%99edn%C3%AD_um%C4%9Bleck%C3%A1_%C5%A1kola_V%C3%A1clava_Hollara_%282%29.jpg","page_title":"Výtvarná škola Václava Hollara","context_page_description":"Výtvarná škola Václava Hollara je vyšší odborná škola a střední umělecká škola v Praze."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%85%D9%8A%D9%83_%D9%85%D9%88%D9%84%D9%81%D8%A7%D9%86%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Mick_Mulvaney%2C_Official_Portrait%2C_112th_Congress.jpg","page_title":"ميك مولفانى","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nميك مولفانى سياسى من امريكا."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AA%D8%A7%D8%A8%D9%84%D9%88_%D8%A8%D8%B1%D9%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/BMA_Automation_Allen_Bradley_PLC_4.JPG","page_title":"تابلو برق","context_page_description":"تابلو برق یک محفظه برای نصب و سیم بندی تجهیزات الکتریکی یا الکترونیکی است که کلیدها و قطعات کنترلی و حفاظتی و لوازم نمایشگر روی آن نصب می‌شوند. همچنین تابلوهای برق جهت جلوگیری از وارد شدن شوک الکتریکی به کاربرانِ تجهیزات و حفاظت تجهیزات در برابر عوامل محیطی استفاده می‌شوند."},{"page_url":"https://nl.wikipedia.org/wiki/Isra%C3%ABl_Querido","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Theo_van_Doesburg_Qu%C3%A9rido.jpg","page_title":"Israël Querido","context_page_description":"Israël Querido was een Nederlands naturalistisch schrijver.\\nQuerido kwam uit een arm Joods gezin en moest al jong zijn eigen brood verdienen. Dat deed hij onder meer als horlogemaker, violist, diamantbewerker, juwelier en journalist. Als schrijver debuteerde hij in 1893 met een bundel gedichten onder de titel Verzen, spoedig gevolgd door Gedichten, geschreven onder de indruk van een bezoek aan Parijs. Beide boeken verschenen onder het pseudoniem Theo Reeder. Daarna schreef hij ook kritieken, die deels gebundeld werden.\\nBekend zijn vooral zijn boeken geworden waarin het Amsterdamse volk wordt getekend. Querido's eerste prozawerk was extreem naturalistisch. Émile Zola was zijn voorbeeld in Levensgang. Daarna volgde Menschenwee. Zijn eerste grote werk was de vierdelige romancyclus De Jordaan, bestaande uit: De Jordaan, Van Nes en Zeedijk, Manus Peet en Mooie Karel.\\nHij verwijderde zich geleidelijk van het naturalisme en schreef naar het voorbeeld van Louis Couperus een grote historische romancyclus, hoewel hij eerder diens historische werken zwaar gekritiseerd had."},{"page_url":"https://es.wikipedia.org/wiki/Anna_Gardell-Ericson","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/GEricson-Visby.jpg","page_title":"Anna Gardell-Ericson","context_page_description":"Anna Maria Gardell-Ericson ​ fue una pintora y acuarelista sueca. Se especializó en escenas costeras y paisajes con lagos o ríos."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%A7%94%E5%85%A7%E7%91%9E%E6%8B%89%E7%B8%BD%E7%B5%B1%E8%88%87%E8%AD%B0%E9%95%B7%E5%9C%B0%E4%BD%8D%E5%8D%B1%E6%A9%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Vice_President_Pence%27s_Trip_to_Colombia_%2832279598037%29.jpg","page_title":"委內瑞拉總統地位危機","context_page_description":"2019－2020年委內瑞拉總統與議長地位危機，是2019年1月起在委內瑞拉發生的政治危機。\\n2019年1月，委內瑞拉執政黨統一社會主義黨領導人尼可拉斯·馬杜洛在2018年委內瑞拉總統選舉中連任委內瑞拉總統一職，並得到中華人民共和國、俄羅斯、土耳其、南非以及美洲玻利瓦爾聯盟等國家和國際組織的支持和承認。時任委內瑞拉反對黨領袖、全國代表大會議長胡安·瓜伊多在2019年1月10日宣示為臨時總統。1月23日通過反對派掌握的國會單方面授權並宣布正式就任委內瑞拉臨時總統，並得到美國、利馬集團、美洲國家組織以及歐洲聯盟等國家和國際組織的支持和承認，雙方及支持其國家互相拒絕承認對方為委內瑞拉總統。馬杜洛則宣布與美國斷交，並限令美方外交官於24小時內離境。\\n2020年1月5日，作為委內瑞拉反對派中反瓜伊多勢力的代表，委內瑞拉無黨籍議員路易斯·帕拉在2020年委內瑞拉全國代表大會議長選舉中當選委內瑞拉全國代表大會議長一職，並得到了委內瑞拉馬杜洛政府的承認。同日，胡安·瓜伊多與委內瑞拉反對派親瓜伊多勢力議員在《國民報》社大樓內開會，會上瓜伊多宣布就任新一屆議長，並得到了美國的承認。"},{"page_url":"https://en.wikipedia.org/wiki/Ralph_John_Ramer_House","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Ralph_John_Ramer_Home.jpg","page_title":"Ralph John Ramer House","context_page_description":"The Ralph John Ramer House, is located near the downtown area of Anderson, South Carolina. The house was built in 1930 and is historically significant as an excellent example of an early-20th century Tudor Revival residence. Ramer was a leading Anderson businessman, government official, military officer and civic leader. Much of the noteworthy architectural detail of this house can be viewed from the public road that fronts the grounds. The house was listed in the National Register on February 10, 1992."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%96%91%E7%B2%89%E8%9D%B6%E5%B1%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Delias_zebuda_male.JPG","page_title":"斑粉蝶屬","context_page_description":"豔粉蝶屬在台灣以外漢語使用地區又名斑粉蝶屬，是粉蝶科裡的一個屬。共有215個物種，分布於印度至索羅門群島一帶，其中超過100種只分布於新畿內亞的山上。幼蟲的寄主為桑寄生科植物。"},{"page_url":"https://en.wikipedia.org/wiki/Yamato-class_battleship","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Yamato_during_Trial_Service.jpg","page_title":"Yamato-class battleship","context_page_description":"The Yamato-class battleships were two battleships of the Imperial Japanese Navy, Yamato and Musashi, laid down leading up to World War II and completed as designed. A third hull laid down in 1940 was converted to an aircraft carrier, Shinano, during construction.\\nDisplacing 72,000 long tons at full load, the completed battleships were the heaviest ever constructed. The class carried the largest naval artillery ever fitted to a warship, nine 460-millimetre naval guns, each capable of firing 1,460 kg shells over 42 km.\\nDue to the threat of American submarines and aircraft carriers, both Yamato and Musashi spent the majority of their careers in naval bases at Brunei, Truk, and Kure—deploying on several occasions in response to American raids on Japanese bases.\\nAll three ships were sunk by the U.S. Navy; Musashi while participating in the Battle of Leyte Gulf in October 1944, as part of Admiral Takeo Kurita's Center Force, lost to American carrier aircraft; the still incomplete Shinano was torpedoed ten days after her commissioning in November 1944 by the submarine USS Archerfish; and Yamato, also ravaged by carrier planes, in April 1945 during Operation Ten-Go."},{"page_url":"https://en.wikipedia.org/wiki/K%C5%8Dchi,_K%C5%8Dchi","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Kochi_montage.jpg","page_title":"Kōchi, Kōchi","context_page_description":"Kōchi is the capital city of Kōchi Prefecture located on the island of Shikoku in Japan.\\nKōchi is the main city of the prefecture with over 40% of its population. As of April 1, 2016, the city has an estimated population of 332,059 and a population density of 1,100 persons per km². The total area is 309.22 km². A symbol of the city is its most famous dish, katsuo tataki, made by lightly searing and seasoning bonito."},{"page_url":"https://en.wikipedia.org/wiki/List_of_hills_of_Cornwall","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Rock_Pile_-_geograph.org.uk_-_647831.jpg","page_title":"List of hills of Cornwall","context_page_description":"This is a list of hills in Cornwall based on data compiled in various sources, but particularly the Database of British and Irish Hills, Jackson's More Relative Hills of Britain and the Ordnance Survey 1:25,000 Explorer and 1:50,000 Landranger map series.\\nMany of these hills are important historic, archaeological and nature conservation sites, as well as popular hiking and tourist destinations in the county of Cornwall in southwest England."},{"page_url":"https://fr.wikipedia.org/wiki/Saint-Ismier","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Saint-Ismier_abc22.JPG","page_title":"Saint-Ismier","context_page_description":"Saint-Ismier est une commune française située dans le département de l'Isère en région Auvergne-Rhône-Alpes.\\nCette petite ville qui a vu sa population augmenter et son territoire s'urbaniser durant la seconde moitié du XXᵉ siècle, garde encore d'importantes zones rurales éparses, agricoles et forestières, est rattachée à l'arrondissement de Grenoble et au canton du Moyen Grésivaudan et à la communauté de communes du Pays du Grésivaudan dont le siège est fixé à Crolles.\\nLes habitants de la commune se dénomment Ismérusiens."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%AC%D9%88%D9%84%D9%8A%D9%88_%D8%B3%D9%8A%D8%B2%D8%A7%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/J%C3%BAlio_C%C3%A9sar_FC_Internazionale.jpg","page_title":"جوليو سيزار","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nجوليو سيزار لاعب كورة قدم من برازيل."},{"page_url":"https://zh.wikipedia.org/zh-hk/%E6%B3%A2%E5%85%B0%E5%9F%8E%E5%B8%82%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/BydgoszczAir.jpg","page_title":"波兰城市列表","context_page_description":"以下所列為人口超過100,000的波蘭城市："},{"page_url":"https://fr.wikipedia.org/wiki/Les_Goudes","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Les_Goudes_9.jpg","page_title":"Les Goudes","context_page_description":"Les Goudes est un quartier et un port de Marseille du 8ᵉ arrondissement de Marseille, à la porte sud de la ville et du parc national des Calanques, au bout de la route sans issue des Goudes, surnommé le bout du monde marseillais, avec son petit port de pêche traditionnel, institutionnel, et historique dans un décor spectaculaire, pittoresque et préservé de calanques au bord de la Méditerranée."},{"page_url":"https://zh.wikipedia.org/zh-mo/%E6%8B%89%E6%98%82%E5%9C%B0%E5%8C%BA%E6%AC%A7%E6%AF%94%E5%B0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Map_commune_FR_insee_code_02033.png","page_title":"拉昂地区欧比尼","context_page_description":"拉昂地區歐比尼是法國上法蘭西大區埃納省的一個市鎮，屬於拉昂區和吉尼庫爾縣。該市鎮2009年時的人口為105人。"},{"page_url":"https://zh.wikipedia.org/wiki/2016%E5%B9%B4%E5%A4%AA%E5%B9%B3%E6%B4%8B%E9%A2%B6%E9%A2%A8%E5%AD%A3","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Orlene_2016-09-12_2040Z.jpg","page_title":"2016年太平洋颶風季","context_page_description":"2016年太平洋颶風季是每年一度全球熱帶氣旋產生週期的一部分。東太平洋颶風季從2016年6月開始；而中太平洋颶風季從2016年1月開始。本條目的範圍僅侷限於赤道以北及國際換日線以東的太平洋，於赤道以北及國際換日線以西的太平洋水域產生的風暴則被稱為颱風，並被列入2016年太平洋颱風季。在東、中太平洋產生的熱帶風暴分別是由美國國家颶風中心及中太平洋颶風中心命名，國際編號分別為xxE或xxC。\\n2016年太平洋颶風季第一個氣旋生成於2016年1月7日的颶風帕利。以下各熱帶氣旋資訊以熱帶氣旋存在期間的最強形態為準。"},{"page_url":"https://nl.wikipedia.org/wiki/Harpa_harpa","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Harpa_harpa_01.jpg","page_title":"Harpa harpa","context_page_description":"Harpa harpa is een slakkensoort uit de familie van de Harpidae. De wetenschappelijke naam van de soort is voor het eerst geldig gepubliceerd in 1758 door Linnaeus."},{"page_url":"https://ceb.wikipedia.org/wiki/Abant_G%C3%B6l%C3%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Abant_Panorama.JPG","page_title":"Abant Gölü","context_page_description":"Lanaw ang Abant Gölü sa Turkeya. Nahimutang ni sa lalawigan sa Bolu, sa amihanan-kasadpang bahin sa nasod, 150 km sa amihanan-kasadpan sa Ankara ang ulohan sa nasod. 1,328 metros ibabaw sa dagat kahaboga ang nahimutangan sa Abant Gölü. Naglangkob kin og 1.1 ka kilometro kwadrado. Ang kinahabogang dapit sa palibot dunay gihabogon nga 1,787 ka metro ug 3.4 km sa sidlakan sa Abant Gölü. Hapit nalukop sa kaumahan ang palibot sa Abant Gölü. Naglukop ni og 1.5 km gikan sa amihanan ngadto sa habagatan ug 1.6 km gikan sa sidlakan ngadto sa kasadpan.\\nAng klima mediteranyo. Ang kasarangang giiniton 11 °C. Ang kinainitan nga bulan Agosto, sa 24 °C, ug ang kinabugnawan Enero, sa -2 °C. Ang kasarangang pag-ulan 934 milimetro matag tuig. Ang kinabasaan nga bulan Disyembre, sa 135 milimetro nga ulan, ug ang kinaugahan Hulyo, sa 33 milimetro."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9A%D1%83%D0%BA%D1%83%D0%B2%D0%B8%D1%98%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Tyto_alba_-British_Wildlife_Centre%2C_Surrey%2C_England-8a_%281%29.jpg","page_title":"Кукувија","context_page_description":"Кукувија врста је совe из породице кукувија. Најраспрострањенија је врста сове и једна је од најраспрострањенијих врста птица. Кукувија се може срести готово било где у свету изузев у поларним и пустињским областима, у Азији северно од Хималаја, већем делу Индонезије и неким пацифичким острвима.\\nФилогенетски докази показују да постоје најмање три главне линије кукувије — једна у Европи, западној Азији и Африци; једна у југоисточној Азији и Аустралији; и једна у Америци, а на острвима су и неки веома дивергентни таксони. Сходно томе, неки научници деле кукувије на западну кукувију за групу у Европи, западној Азији и Африци; америчку кукувију за групу у Америци; и источну кукувију за групу у југоисточној Азији и Аустралији. Неки таксономисти су додатно раздвојили групу кукувија, признајући до пет врста, па је због тога потребно обавити даља истраживања како би се разјаснила позиција кукувија. Постоји значајна варијација у величини и боји приближно 28 подврста, али кукувија припада средње великим совама и већина подврсти је дужине од 33 до 39 центиметара са распоном крила од 80 до 95 центиметара."},{"page_url":"https://nn.wikipedia.org/wiki/Den_ungarske_sletta","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/df/Tanya_alfold.jpg","page_title":"Den ungarske sletta","context_page_description":"Den store ungarske sletta, eller berre Den ungarske sletta, Store Alföld eller Alföld er ei slette eller eit bekken som ligg i sørlege og austlege delar av Ungarn. Ho strekkjer seg òg inn i austlege delar av Slovakia, sørvestlege delar av Ukraina, vestlege delar av Romania, nordlege område av Serbia, og austlege delar av Kroatia. Sletta utgjer den største delen av Den pannoniske sletta."},{"page_url":"https://id.wikipedia.org/wiki/Strasbourg","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Flag_of_Strasbourg.svg","page_title":"Strasbourg","context_page_description":"Strasbourg merupakan ibu kota région Alsace yang terletak di Prancis bagian timur. Penduduknya berjumlah 272.800 jiwa. Kota ini memiliki luas wilayah 78,26 km². Dengan memiliki angka kepadatan penduduk sebesar 3.486 jiwa/km². Kota ini terkenal dengan sebutan Grande Île* ditetapkan sebagai Situs Warisan Dunia UNESCO pada 1988.\\nKota ini terletak di tepi Sungai Rhein."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/B%C3%B3e-ch%C3%A1i%E2%81%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Little_finger.jpg","page_title":"Bóe-cháiⁿ","context_page_description":"Bóe-cháiⁿ sī tē-gō͘ ki chhiú-cháiⁿ."},{"page_url":"https://en.wikipedia.org/wiki/Ippari","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Sicily_Ippari.jpg","page_title":"Ippari","context_page_description":"The Ippari, anciently called the Hipparis is a 28-kilometre long river located in the province of Ragusa in south-eastern Sicily.\\nThe river rises in the Mount Serra Brugio area of the Hyblaean Mountains, just below Chiaramonte Gulfi at a height of about 800 metres above sea level and flows into the Mediterranean Sea south of the fishing town of Scoglitti. The river passes near the towns of Comiso and Vittoria. The ruins of the ancient Greek city of Kamarina, which used the river as a Canal-port, can be found on the southern bank."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%A3%E0%B8%B2%E0%B8%A2%E0%B8%81%E0%B8%B2%E0%B8%A3%E0%B8%95%E0%B8%A3%E0%B8%B2%E0%B9%81%E0%B8%9C%E0%B9%88%E0%B8%99%E0%B8%94%E0%B8%B4%E0%B8%99%E0%B9%83%E0%B8%99%E0%B8%9B%E0%B8%A3%E0%B8%B0%E0%B9%80%E0%B8%97%E0%B8%A8%E0%B8%AA%E0%B8%B4%E0%B8%87%E0%B8%84%E0%B9%82%E0%B8%9B%E0%B8%A3%E0%B9%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/ParliamentHouse-Singapore-sign-20060601.jpg","page_title":"รายการตราแผ่นดินในประเทศสิงคโปร์","context_page_description":"ตารางต่อไปนี้แสดงภาพชนิดตราแผ่นดินต่าง ๆ ที่ใช้ในประเทศสิงคโปร์."},{"page_url":"https://hu.wikipedia.org/wiki/Keleti_rabl%C3%B3pille","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Libelloides_macaronius_%28Scopoli%2C_1763%29.jpg","page_title":"Keleti rablópille","context_page_description":"A keleti rablópille a rovarok osztályába a recésszárnyúak rendjébe tartozó faj. Magyar neve egyike a legszebb és legtalálóbb rovarneveknek, mely ragadozó életmódjára utal.\\nSe nem lepke, se nem szitakötő, de mindkét csoportra hasonlít. Ez az egyetlen faja él Magyarországon.\\nKörülbelül 400 fajtársából 16 európai.\\nVédetté 1982-ben, fokozottan védetté 2012-ben nyilvánították, természetvédelmi értéke 100.000.-Ft."},{"page_url":"https://en.wikipedia.org/wiki/List_of_oldest_buildings_and_structures_in_Toronto","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Underwood_House.jpg","page_title":"List of oldest buildings and structures in Toronto","context_page_description":"This is a list of oldest buildings and structures in Toronto, that were constructed before 1920. The history of Toronto dates back to indigenous settlements in the region approximately 12,000 years ago. However, the oldest standing structures in Toronto were built by European settlers. Remains of a Seneca settlement may be found at the Bead Hill archaeological site, in eastern Toronto.\\nThe first European structure built in Toronto was Magasin Royal, a French trading post established in 1720. In the 1750s, the French built several structures in the area, although the French would later destroy them in 1759, following their defeat at the Battle of Fort Niagara. In 1793, the government of Upper Canada arranged for the purchase of Toronto from the Mississaugas; in order to settle newly landed loyalist. Many of Toronto's oldest structures dates back to this early British settlement, known as York. The town of York was formally incorporated as the City of Toronto in 1834, with the passage of the Incorporation of the City of Toronto Act."},{"page_url":"https://en.wikipedia.org/wiki/Raj_Mohan_Vohra","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/IA_Eastern_Command.jpg","page_title":"Raj Mohan Vohra","context_page_description":"Lieutenant General Raj Mohan Vohra, PVSM, MVC was a General Officer of the Indian Army. He was awarded the Maha Vir Chakra for his bravery and leadership in the Battle of Basantar during the Indo-Pakistani War of 1971. He died of Coronavirus disease 2019 during the COVID-19 pandemic in June 2020."},{"page_url":"https://es.wikipedia.org/wiki/Sphenopteris","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Sphenopteris_schumannii.jpg","page_title":"Sphenopteris","context_page_description":"Sphenopteris era un género de frondas, con varias especies de plantas extintas. Incluye los helechos, pero sobre todo con semillas para la reproducción de plantas, tales como Lyginopteris.​​ Plantas vasculares."},{"page_url":"https://no.wikipedia.org/wiki/Exeter_College","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Exeter_College_Chapel%2C_Oxford_-_Stained_Glass_-_Oct_2006.jpg","page_title":"Exeter College","context_page_description":"Exeter College er en av kollegiene ved University of Oxford i England og er det fjerde eldste kollegiet ved universitetet."},{"page_url":"https://vo.wikipedia.org/wiki/Naruhito","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Emperor_Naruhito_%28may_2019%29.jpg","page_title":"Naruhito","context_page_description":"Hiel Naruhito binom noban e bolitan Yapänik. De 2019 mayul 1 binom lampör Yapäna."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Del_Norte_County,_California","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Stgeorgereef.jpg","page_title":"National Register of Historic Places listings in Del Norte County, California","context_page_description":"This is a list of the National Register of Historic Places listings in Del Norte County, California.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in Del Norte County, California, United States. Latitude and longitude coordinates are provided for many National Register properties and districts; these locations may be seen together in a Google map.\\nThere are 14 properties and districts listed on the National Register in the county.\\nThis National Park Service list is complete through NPS recent listings posted July 17, 2020."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_onroerend_erfgoed_in_Roeselare/deel_1","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Burgerwoning_1904_naar_ontwerp_van_W._Denys_1937.jpg","page_title":"Lijst van onroerend erfgoed in Roeselare/deel 1","context_page_description":"Een overzicht van het onroerend erfgoed in de gemeente Roeselare. Het onroerend erfgoed maakt onderdeel uit van het cultureel erfgoed in België."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Jonsdorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Umgebinde_Gro%C3%9Fsch%C3%B6nauer_Stra%C3%9Fe_1_Jonsdorf.jpg","page_title":"Liste der Kulturdenkmale in Jonsdorf","context_page_description":"In der Liste der Kulturdenkmale in Jonsdorf sind die Kulturdenkmale der sächsischen Gemeinde Jonsdorf verzeichnet, die bis November 2018 vom Landesamt für Denkmalpflege Sachsen erfasst wurden. Die Anmerkungen sind zu beachten.\\nDiese Aufzählung ist eine Teilmenge der Liste der Kulturdenkmale im Landkreis Görlitz."},{"page_url":"https://cs.wikipedia.org/wiki/Mefisto_(rom%C3%A1n)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Klaus_Mann_Mephisto_verkauft.jpg","page_title":"Mefisto (román)","context_page_description":"Mefisto je klíčový román Klause Manna z roku 1936 s podtitulem román jedné kariéry či román velikého vzestupu. Vydán byl exilově v Nizozemí roku 1936 a v Československu o rok později. Vydání ve vlastním Německu bylo připravované na konec války, ale vzhledem k problémům s Gustafem Gründgensem, jehož kariéra inspirovala Manna k vytvoření románového hrdiny, muselo být vydání odloženo a román byl vydán až v roce 1956. Na základě románu natočil roce 1981 István Szabó stejnojmenný film.\\nDěj se odehrává v Německu mezi světovými válkami, především potom po vzniku Třetí říše v roce 1933. Mnoho postav má svoji předlohu v reálném světě. Hlavním hrdinou je herec Hendrik Höfgen, který prochází proměnou z bolševicky smýšlejícího rebela na miláčka nacistického režimu a následně velmi úspěšného umělce. Je zde použit motiv ze hry Faust, tedy podpis smlouvy s ďáblem kvůli úspěchu, a sám Höfgen se stal významný s rolí Mefista v Goetheově hře. Je zde také popisován vnitřní rozpor hrdiny, který si uvědomuje amorálnost svého jednání a snaží se o konání dobra - přinejmenším kvůli svému svědomí.\\nAutor spáchal sebevraždu, aniž by se dožil vydání díla v Německu."},{"page_url":"https://en.wikipedia.org/wiki/Free_festival","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Cambridge_Strawberry_Fair_2011_stage.jpg","page_title":"Free festival","context_page_description":"Free festivals are a combination of music, arts and cultural activities, for which often no admission is charged, but involvement is preferred. They are identifiable by being multi-day events connected by a camping community without centralised control. The pioneering free festival movement started in the UK in the 1970s."},{"page_url":"https://en.wikipedia.org/wiki/Banksia_praemorsa","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/50/Banksia_praemorsa_flower.jpg","page_title":"Banksia praemorsa","context_page_description":"Banksia praemorsa, commonly known as the cut-leaf banksia, is a species of shrub or tree in the plant genus Banksia. It occurs in a few isolated populations on the south coast of Western Australia between Albany and Cape Riche."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%B0%E1%83%90%E1%83%A0%E1%83%90%E1%83%9A%E1%83%93_I","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/1200_Harald_Bl%C3%A5tand_anagoria.jpg","page_title":"ჰარალდ I","context_page_description":"ჰარალდ I ჰორფაგერი — ნორვეგიის კონუნგი დაახლოებით 970-975. დაიმორჩილა და გაანადგურა ნორვეგიის ცალკეული ოლქების მმართველები და პირველად გააერთიანა ნორვეგია. მაგრამ გაერთიანება არამყარი აღმოჩნდა. თავისი მმართველობის ბოლო წლებში ჰარალდ I-მა ნორვეგია თავის ვაჟებს გაუნაწილა და ერთ-ერთი მათგანი მთავარ კონუნგად დანიშნა."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D0%B0%D0%B1%D0%BE%D1%83,_%D0%9A%D0%B5%D0%B9%D1%81%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Casey_Labow_%287585926508%29.jpg","page_title":"Лабоу, Кейси","context_page_description":"Саманта Кейси Лабоу, более известная как Кейси Лабоу, род. в Нью-Йорке — американская актриса. Наиболее известна ролью Кейт Денали в фильме «Сумерки. Сага: Рассвет — Часть 2»."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%84%D9%88%D8%B3%DB%8C%D9%88%D8%B3_%D9%88%D8%B1%D9%88%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Lucius_Verus_-_MET_-_L.2007.26_cropped.jpg","page_title":"لوسیوس وروس","context_page_description":"لوسیوس وروس روم ایمپیراتورو. ۸ مارس ۱۶۱– ۲۳ ژانویه ۱۶۹ ایل‌لر آراسیندا حؤکومت ائدیب. آنتونیوس پیوس اؤلوموندن سوْنرا حؤکومتی اله کئچدیب و اؤزونون وفاتیندان سوْنرا مارکوس آئورلیوس واریث کیمی تخت و تاجه صاحیب چیخیب."},{"page_url":"https://hu.wikipedia.org/wiki/Stielhandgranate_24","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/M24_1.JPG","page_title":"Stielhandgranate 24","context_page_description":"A Stielhandgranate 24 a német hadsereg szabványos kézigránátja volt az első világháború elejétől a második világháború végéig. Jellegzetes alakja miatt a szövetséges katonák körében krumplinyomóként volt ismert, manapság pedig a 20. század egyik legkönnyebben felismerhető fegyverének tekinthető."},{"page_url":"https://en.wikipedia.org/wiki/Listed_buildings_in_Copenhagen_Municipality","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Nyhavn_59.jpg","page_title":"Listed buildings in Copenhagen Municipality","context_page_description":"This is a list of listed buildings in Copenhagen Municipality, Denmark."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B3%E3%83%A0%E3%83%95%E3%82%A3%E3%83%AB%E3%82%BF","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/84/Comb_filter_pz_ff_neg.svg","page_title":"コムフィルタ","context_page_description":"コムフィルタは、信号にそれ自身を遅延させたものを追加することで干渉を生じさせるフィルタ回路の一種である。くし形フィルタまたはくし型フィルタとも。コムフィルタの周波数特性は一定間隔のスパイク状になり、図示すると櫛のように見える。"},{"page_url":"https://fr.wikipedia.org/wiki/Antoine_Fran%C3%A7ois_Hippolyte_Fabre","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Antoine_Fran%C3%A7ois_Hippolyte_Fabre.jpg","page_title":"Antoine François Hippolyte Fabre","context_page_description":"Antoine François Hippolyte Fabre est un médecin du XIXᵉ siècle, connu pour avoir coordonné et dirigé la rédaction et la publication d'une imposante encyclopédie médicale intitulée Dictionnaire des dictionnaires de médecine français et étrangers ou traité complet de médecine et de chirurgie pratiques ; publié au milieu du XIXᵉ siècle à Bruxelles."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%AA%E0%B4%BE%E0%B5%BC%E0%B4%95%E0%B5%8D_%E0%B4%97%E0%B5%8D%E0%B4%AF%E0%B5%81%E0%B5%BB_%E0%B4%B9%E0%B5%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Geun_Hye_Park.jpg","page_title":"പാർക് ഗ്യുൻ ഹൈ","context_page_description":"ദക്ഷിണ കൊറിയയിലെ തെരഞ്ഞെടുക്കപ്പെട്ട ആദ്യ വനിതാ പ്രസിഡന്റാണ് പാർക് ഗ്യുൻ ഹൈ. 2012 ൽ നടന്ന തെരഞ്ഞെടുപ്പിലാണ് അവർ അധികാരത്തിലെത്തിയത്. മുൻ പട്ടാളനേതാവ് പാർക് ചുങ്-ഹീയുടെ മകളാണ് അറുപതുവയസ്സുള്ള ഗ്യുൻ ഹൈ."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%BB%98%E5%9C%92","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Chen_Family%27s_Moh-yuan_20060418.jpg","page_title":"默園","context_page_description":"默园，全称彰化县和美镇陈家默园，是陈锡奎旧宅、台湾日治时期文学运动先驱陈虚谷的故居，坐落于彰化县和美镇涂厝里和厝路二段585号，兴建年代为1928~1929年，属于改良式巴洛克洋楼式建筑。现由其家族约30人共同持有其土地及地上建物。"},{"page_url":"https://en.wikipedia.org/wiki/LED_lamp","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Fluo-45W_LED-17W.jpg","page_title":"LED lamp","context_page_description":"An LED lamp or LED light bulb is an electric light for use in light fixtures that produces light using one or more light-emitting diodes. LED lamps have a lifespan many times longer than equivalent incandescent lamps, and are significantly more efficient than most fluorescent lamps, with some LED chips able to emit up to 303 lumens per watt. However, LED lamps require an electronic LED driver circuit when operated from mains power lines, and losses from this circuit means that the efficiency of the lamp is lower than the efficiency of the LED chips it uses. The most efficient commercially available LED lamps have efficiencies of 200 lumens per watt. The LED lamp market is projected to grow by more than twelve-fold over the next decade, from $2 billion in the beginning of 2014 to $25 billion in 2023, a compound annual growth rate of 25%. As of 2016, many LEDs use only about 10% of the energy an incandescent lamp requires.\\nSimilar to incandescent lamps, LEDs come to full brightness immediately with no warm-up delay. Frequent switching on and off does not reduce life expectancy as with fluorescent lighting. Light output decreases gradually over the lifetime of the LED."},{"page_url":"https://de.wikipedia.org/wiki/TORU","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/ISS-24_Alexander_Skvortsov_monitors_data_at_TORU.jpg","page_title":"TORU","context_page_description":"TORU ist ein System zur manuellen Navigation und Steuerung bei der Ankopplung russischer Sojus- und Progress-Raumschiffe an Raumstationen bei Abständen unter 6–8 km. Es diente und dient als Backup zum automatischen, radargestützten Annäherungssystem Kurs auf den Raumstationen Mir und ISS."},{"page_url":"https://en.wikipedia.org/wiki/Frank_Lasee","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Frank_headshot.jpg","page_title":"Frank Lasee","context_page_description":"Frank Lasee is a former Republican member of the Wisconsin State Senate. He represented the 1st Senate District from 2011 until 2017, succeeding his cousin, Alan Lasee. Lasee previously served in the Wisconsin State Assembly, representing the 2nd Assembly District from 1995 to 2009."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%A2%D1%8E%D0%B7%D0%B8_(%D0%9B%D0%B0%D0%BA%D1%85%D0%B0_%D0%A1%D0%B0%D0%B2%D0%BE%D0%B9%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/%C3%89glise_St_Jean_Baptiste_Thusy_3.jpg","page_title":"Тюзи (Лакха Савойя)","context_page_description":"Тюзи — Францин гӀала-коммуна, лаьтта Овернь — Рона — Альпаш регионехь. Коммунан департамент — Лакха Савойя. Кхузахь климат барамехь ю, аьхка йовха хуьлу, ткъа Ӏа барамехь-шийла хуьлу. ГӀалин бахархой французаш бу. Официалан Французийн мотт бу."},{"page_url":"https://an.wikipedia.org/wiki/Cul_de_Carriata","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Anvista_dende_punta_Acuta.jpg","page_title":"Cul de Carriata","context_page_description":"O cul de Carriata u cul de Salarons ye un chicot cul pirenenco situau en un lateral a val d'Ordesa, en o municipio de Torla-Ordesa y mugando con o municipio de Fanlo. Lo formó la chelera que cubriba a val en o periodo Quaternario.\\nSe troba adintro d'o Parque Nacional d'Ordesa y d'as Tres Serols y fa parti d'un recorriu clasico que leba enta o Tozal d'o Mallo y Susana Mondarruego a traviés d'as claviellas de Salarons u d'o paso alternativo de La Fajeta."},{"page_url":"https://lv.wikipedia.org/wiki/%C5%A0irme%C4%BCup%C4%ABte","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/D%C4%AB%C4%B7is_uz_%C5%A0irme%C4%BCup%C4%ABtes.jpg","page_title":"Širmeļupīte","context_page_description":"Širmeļupīte ir Ņegas labā krasta pieteka Ķeguma novada Birzgales pagastā.\\nIztece — pie meža masīva uz austrumiem no Širmeļiem. Tek rietumu virzienā. Ietek Ņegā. Vidustecē vairāki uzplūdinājumi, lielākais no tiem — Širmeļu dīķis.\\nUpi šķērso valsts autoceļš P88. Vidustecē, labajā krastā — ciems Širmeļi."},{"page_url":"https://it.wikipedia.org/wiki/SS_Sirius_(1837)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/SS_Sirius_%281837%29.jpg","page_title":"SS Sirius (1837)","context_page_description":"La SS Sirius era un battello a vapore con lo scafo in legno e con due ruote ai fianchi costruito nel 1837 per il viaggio Londra - Cork gestito dalla Saint George Steam Packet Company. L'anno successivo la rotta della nave venne cambiata; in questo modo essa si trasformò in un transatlantico. Raggiungendo New York un giorno prima della SS Great Western, la nave fu la prima vincitrice del Nastro Azzurro, anche questo termine venne utilizzato solo qualche decennio dopo."},{"page_url":"https://gl.wikipedia.org/wiki/-80","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Sulla_Glyptothek_Munich_309.jpg","page_title":"-80","context_page_description":"Roma - Segundo consulado de Sila.\\nSila devasta o país etrusco, mentres os seus partidarios toman a cidade de Volterra.\\nHispania - Batalla do río Betis: Quinto Sertorio, do partido democrático, e rebelde ao poder central romano derrota ao xeneral romano Lucio Fulfidas. O feito orixina o inicio da Guerra Sertoriana."},{"page_url":"https://no.wikipedia.org/wiki/Spania_i_Eurovision_Song_Contest","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/ESC2013_-_Spain_04_%28crop%29.jpg","page_title":"Spania i Eurovision Song Contest","context_page_description":"Spania debuterte i Eurovision Song Contest i 1961 og skal i 2020 delta i konkurransen for 60. gang. Spania er en av de fem store – en gruppe på fem land som er automatisk kvalifisert til finalen på grunn sine store økonomiske bidrag til konkurransen. Siden debuten i 1961 har Spania deltatt hvert eneste år. Bare Storbritannia har deltatt lenger sammenhengende, siden 1959.\\nSpania har vunnet konkurransen to ganger, i 1968 og 1969. Av alle deltakerlandene som har vunnet, er Spania det landet som har hatt den lengste seierstørken i konkurransens historie, med 51 år uten en seier per 2020."},{"page_url":"https://id.wikipedia.org/wiki/Pasukan_Bendera_Hitam","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Black_Flag_ambush.jpg","page_title":"Pasukan Bendera Hitam","context_page_description":"Pasukan Bendera Hitam atau Tentara Bendera Hitam adalah sisa sempalan dari kelompok bandit yang direkrut sebagian besar dari prajurit berlatar belakang etnis Zhuang, yang melintasi perbatasan pada tahun 1865 dari Guangxi, Tiongkok sampai Tonkin Atas, saat itu bagian dari Kekaisaran Annam. Meskipun merupakan perampok, mereka dikenal terutama karena pertempuran mereka melawan pasukan Prancis yang menyerang, yang kemudian pindah menuju Tonkin. Dengan persetujuan dari otoritas Vietnam dan Tiongkok, Pasukan Bendera Hitam bergabung dengan pasukan reguler Vietnam, membendung pelanggaran batas Prancis di luar Delta Sungai Merah. Pasukan Bendera Hitam dinamakan demikian karena preferensi komandannya, Liu Yongfu, yang menggunakan bendera komando berwarna hitam.\\nPasukan ini secara resmi dibubarkan pada tahun 1885 sebagai hasil dari Traktat Tientsin antara Prancis dan Qing, namun sisa-sisa pasukan terus mengobarkan perang gerilya melawan penguasa kolonial Prancis selama bertahun-tahun."},{"page_url":"https://fr.wikipedia.org/wiki/Mesterrieux","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/dc/Mesterrieux_Mam.jpg","page_title":"Mesterrieux","context_page_description":"Mesterrieux est une commune du Sud-Ouest de la France, située dans le département de la Gironde."},{"page_url":"https://en.wikipedia.org/wiki/New_York%27s_7th_congressional_district","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Martin_V._O%27Malley.jpg","page_title":"New York's 7th congressional district","context_page_description":"New York's 7th congressional district is a congressional district for the United States House of Representatives in New York City. It includes parts of Brooklyn, Queens, and Manhattan. Democrat Nydia Velázquez represents the district in Congress.\\nThe district includes the Queens neighborhoods of Maspeth, Ridgewood, and Woodhaven; the Brooklyn neighborhoods of Brooklyn Heights, Boerum Hill, Bushwick, Carroll Gardens, Cobble Hill, Dumbo, East New York, East Williamsburg, Greenpoint, Gowanus, Red Hook, Sunset Park, and Williamsburg; and parts of Manhattan’s Lower East Side and East Village.\\nUntil 2012, the 7th consisted of parts of Northern Queens and Eastern portions of the Bronx. The Queens portion included the neighborhoods of College Point, East Elmhurst, Jackson Heights and Woodside. The Bronx portion of the district included the neighborhoods of Co-op City, Morris Park, Parkchester, Pelham Bay, and Throgs Neck as well as City Island.\\nLike many Congressional districts around the country, the New York Seventh's boundaries were gerrymandered so as to link disparate and widely separated neighborhoods with a large percentage of minority voters."},{"page_url":"https://ja.wikipedia.org/wiki/%E8%96%AC%E7%8E%8B%E6%98%87%E6%B2%96%E8%A6%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Yaowang_Shengchong_Temple_04.jpg","page_title":"薬王昇沖観","context_page_description":"薬王昇冲観は、中華人民共和国湖南省瀏陽市にある道観である。道教の二大教派の一つである全真教竜門派の地元道場である。現存した薬王昇冲観は2001年に再建した建物で、建築面積が約3600平方メートルで、前、中、後三殿を分ける。"},{"page_url":"https://en.wikipedia.org/wiki/Francis_Aylmer_Maxwell","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Memorial_to_Francis_Aylmer_Maxwell.jpg","page_title":"Francis Aylmer Maxwell","context_page_description":"Brigadier General Francis Aylmer Maxwell, VC, CSI, DSO & Bar was a British Army officer in the Second Boer War and First World War. He was also a recipient of the Victoria Cross, the highest award for gallantry in the face of the enemy that can be awarded to British and Commonwealth forces."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9A%CE%B1%CF%81%CF%80%CE%B5%CE%BD%CE%AE%CF%83%CE%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Karpenisi_old_high_school.jpg","page_title":"Καρπενήσι","context_page_description":"Το Καρπενήσι είναι πρωτεύουσα του Νομού Ευρυτανίας και του Δήμου Καρπενησίου. Βρίσκεται στο κέντρο του Νομού, στη νοτιοδυτική πλευρά του Τυμφρηστού σε υψόμετρο 970 μέτρα. Απέχει 78 χλμ από τη Λαμία και 111 χλμ από το Αγρίνιο, μέσω της Γέφυρας Επισκοπής."},{"page_url":"https://vi.wikipedia.org/wiki/B%C3%A3o_Kyrill_(2007)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Storm_90700.JPG","page_title":"Bão Kyrill (2007)","context_page_description":"Cơn bão Kyrill là một khu vực áp suất thấp mà phát triển thành một bạo lực bất thường gió bão châu Âu, tạo thành một cơn lốc xoáy extratropical với bão -strength gió. Nó được hình thành trên Newfoundland vào ngày 15 tháng 1 năm 2007 và di chuyển qua Đại Tây Dương đến Ireland và Vương quốc Anh vào tối ngày 17 tháng 1. Cơn bão sau đó băng qua Biển Bắc vào ngày 17 và 18 tháng 1, đổ bộ vào bờ biển Đức và Hà Lan vào chiều ngày 18 tháng 1, trước khi di chuyển về phía đông về phía Ba Lan và Biển Baltic vào đêm từ 18 đến 19 tháng 1 và tiếp tục về phía bắc Nga.\\nKyrill gây thiệt hại trên diện rộng khắp Tây Âu, đặc biệt là ở Vương quốc Anh và Đức. 47 trường hợp tử vong đã được báo cáo, cũng như sự gián đoạn nghiêm trọng của giao thông công cộng, mất điện đến hơn một trăm ngàn ngôi nhà, thiệt hại nghiêm trọng cho các tòa nhà công cộng và tư nhân và thiệt hại lớn về rừng thông qua gió bão.\\nCơn bão được đặt tên là \\"Kyrill\\" vào ngày 17 tháng 1 năm 2007, bởi viện khí tượng học của Đại học Tự do Berlin. Cơn bão được đặt tên theo một Bulgarian người đàn ông sống gần Berlin, có gia đình tặng cho các trường đại học \\"Adopt-A-Vortex\\" chương trình."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%B3%A9%E5%B1%B1%E4%B8%80%E9%83%8E","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Hatoyama_and_LDP_leaders_in_Otowa_Mansion.jpg","page_title":"鳩山一郎","context_page_description":"鳩山 一郎は、日本の政治家、弁護士。第52・53・54代内閣総理大臣。位階勲等は、正二位大勲位。55年体制最初の内閣総理大臣。"},{"page_url":"https://de.wikipedia.org/wiki/Basketball_Arena","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Basketball_Arena%2C_London%2C_14_June_2011.jpg","page_title":"Basketball Arena","context_page_description":"Die Basketball Arena war eine temporäre Sporthalle in London, die 12.000 Zuschauern Platz bot. Sie befand sich im Stadtteil Stratford, im Norden des Olympiaparks, unmittelbar neben dem olympischen Dorf."},{"page_url":"https://fr.wikipedia.org/wiki/Clotaire_Ier","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Map_Gaul_divisions_511-fr.svg","page_title":"Clotaire Ier","context_page_description":"Clotaire Iᵉʳ dit le Vieux, né vers 498, mort le 29 novembre ou le 31 décembre 561, est un roi franc de la dynastie des Mérovingiens, fils de Clovis, roi des Francs, mort en 511.\\nClotaire devient roi de Soissons en 511, roi d'Orléans en 524, roi des Burgondes en 534, roi de Metz en 555, roi de Paris en 558 ; entre 558 et 561, il est seul à la tête du royaume des Francs réunifié comme sous le règne de Clovis."},{"page_url":"https://fr.wikipedia.org/wiki/Kaminarimon","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Kaminarimon_%28outer_gate%29%2C_Sensoji_Temple%2C_Akakusa%2C_Tokyo.jpg","page_title":"Kaminarimon","context_page_description":"Le Kaminarimon est la porte extérieure d'un ensemble de deux grandes portes d'entrée qui conduisent finalement au Sensō-ji à Asakusa, au Japon. La porte, avec sa lanterne et ses statues, est populaire auprès des touristes. Elle fait 11,7 m de haut, 11,4 m de large et couvre une superficie de 69,3 m²."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%BB%D0%B0%D0%BD_%D0%A1%D1%96%D0%BB%D0%BB%D1%96%D1%82%D0%BE%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Alan_Sillitoe_%282009%29.jpg","page_title":"Алан Сіллітоу","context_page_description":"Алан Сіллітоу — англійський поет і прозаїк."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%91%E3%83%BC%E3%83%B4%E3%82%A7%E3%83%AB%E3%83%BB%E3%83%9D%E3%83%9D%E3%83%BC%E3%83%B4%E3%82%A3%E3%83%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Popovich-Soyuz-14_1974.jpg","page_title":"パーヴェル・ポポーヴィチ","context_page_description":"パウロー・ポポーヴィチ、パーヴェル・ポポーヴィチはソ連の宇宙飛行士である。初めて宇宙に行ったウクライナ人。"},{"page_url":"https://es.wikipedia.org/wiki/Papaveraceae","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Flickr_-_brewbooks_-_Island_Tree_Poppy_%282%29.jpg","page_title":"Papaveraceae","context_page_description":"Las papaveráceas son una familia de angiospermas del orden Ranunculales. Consta de 42 géneros con alrededor de 775 especies, ​​ distribuidas principalmente por las zonas templadas del planeta, zona paleotropical y neotropical, pero prácticamente ausentes en áreas netamente tropicales.​\\nEl concepto que aquí se utiliza engloba como subfamilias dos taxones que frecuentemente se consideran familias separadas: Fumariaceae."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AE%D9%88%D8%B3%D8%AA%DB%8C%D9%86%DB%8C%D8%A7%D9%86%D9%88_%D8%A8%D9%88%D8%B1%DA%AF%D9%88%D9%86%DB%8C%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Justiniano_Borgo%C3%B1o.jpg","page_title":"خوستینیانو بورگونیو","context_page_description":"خوستینیانو بورگونیو یک سیاست‌مدار اهل پرو و از آوریل تا اوت ۱۸۹۴ رئیس‌جمهور این کشور بود."},{"page_url":"https://en.wikipedia.org/wiki/Rotorua","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/2001-01_Rotorua.jpg","page_title":"Rotorua","context_page_description":"Rotorua is a city on the southern shores of Lake Rotorua from which the city takes its name, located in the Bay of Plenty Region of New Zealand's North Island. It is the seat of the Rotorua Lakes District, a territorial authority encompassing Rotorua and several other nearby towns. The majority of the Rotorua District is in the Bay of Plenty Region, but a sizeable southern section and a small western section are in the Waikato region. Rotorua is in the heart of the North Island, 60 kilometres south of Tauranga, 80 km north of Taupō, 105 km east of Hamilton, and 230 km southeast of the nation's most populous city, Auckland.\\nRotorua has an estimated permanent population of 54,500, making it the country's 12th largest urban area, and the Bay of Plenty's second largest urban area behind Tauranga. The Rotorua District has a total estimated population of 75,100, of which 3,600 live in the Waikato section.\\nRotorua is a major destination for both domestic and international tourists; the tourism industry is by far the largest industry in the district. It is known for its geothermal activity, and features geysers – notably the Pohutu Geyser at Whakarewarewa – and hot mud pools."},{"page_url":"https://ca.wikipedia.org/wiki/Gardner_(cr%C3%A0ter)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/AS17-M-0443.jpg","page_title":"Gardner (cràter)","context_page_description":"Gardner és un petit cràter d'impacte situat en la part nord-est de la Lluna, a l'est del cràter Vitruvi, en una secció de terrè escarpado al nord de la Mare Tranquillitatis. Aquest cràter va ser designat prèviament Vitruvi A abans de rebre el seu nom actual de la IAU. Al nord-est de Gardner apareix el cràter de major grandària Maraldi.\\nEs tracta d'un cràter circular amb les parets interiors inclinades. La plataforma interior ocupa aproximadament la meitat del diàmetre total del cràter. La meitat sud de la planta presenta una lleugera elevació abans d'arribar a la paret interior. El cràter no mostra de manera significativa els efectes de l'erosió, amb la vora exterior és relativament nítida i ben definida."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%A4%9A%E5%B0%94%E5%88%87%E9%98%BF%E5%A4%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Dolceacqua38_-_Panorama_del_paese_vecchio.jpg","page_title":"多尔切阿夸","context_page_description":"多爾切阿夸是義大利因佩里亞省的一個市鎮。總面積20.23平方公里，人口2067人，人口密度102.2人/平方公里。ISTAT代碼為008029。"},{"page_url":"https://el.wikipedia.org/wiki/%CE%98%CE%B5%CF%81%CE%B9%CE%BD%CE%BF%CE%AF_%CE%9F%CE%BB%CF%85%CE%BC%CF%80%CE%B9%CE%B1%CE%BA%CE%BF%CE%AF_%CE%91%CE%B3%CF%8E%CE%BD%CE%B5%CF%82_1972","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Olympiastadion_Muenchen.jpg","page_title":"Θερινοί Ολυμπιακοί Αγώνες 1972","context_page_description":"Οι Θερινοί Ολυμπιακοί Αγώνες 1972, οι Αγώνες της 20ης Ολυμπιάδας της σύγχρονης εποχής, διοργανώθηκαν στο Μόναχο της Δυτικής Γερμανίας, από τις 25 Αυγούστου έως και τις 10 Σεπτεμβρίου.\\n121 χώρες πήραν μέρος, με 7.134 αθλητές και αθλήτριες, σε 195 αγωνίσματα των 21 αθλημάτων. Μορφή των αγώνων ήταν ο Αμερικανός κολυμβητής Μαρκ Σπιτς με επτά χρυσά μετάλλια.\\nΕκτός αγωνιστικών, οι Ολυμπιακοί Αγώνες του Μονάχου σημαδεύτηκαν από την ομηρία Ισραηλινών αθλητών από Παλαιστινίους τρομοκράτες και που οδήγησε σε σφαγή στο αεροδρόμιο της πόλης."},{"page_url":"https://fr.wikipedia.org/wiki/GE_s%C3%A9rie_Evolution","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/BNSF_5730_GE_ES44AC.jpg","page_title":"GE série Evolution","context_page_description":"Les locomotives GE Evolution, surnommées GEVO, sont un ensemble de locomotives diesel construites par GE Transportation à la suite des GE Dash 9 et GE AC4400CW qui n'étaient pas conformes aux nouvelles normes de l'Environmental Protection Agency.\\nCette agence fédérale a en effet mis en place le niveau 2 d'émissions de CO² et de polluants pour les locomotives neuves, qui a pris effet en 2005, puis le niveau 3 instauré fin 2011. Les locomotives de pré-série ont été construites à partir de 2003.\\nLes locomotives GE Evolution sont équipées de moteurs de traction fonctionnant au courant continu ou au courant alternatif, selon les préférences du client. Le tout est alimenté par le nouveau moteur GE GEVO à 12 cylindres.\\nLes locomotives GE Evolution ont été nommées comme l'une des \\"10 Locomotives qui ont révolutionné le transport ferroviaire aux USA\\" dans le numéro de janvier 2009 de Trains Magazine.\\nIl s'agit de la seule locomotive mise en service après 1972 figurant dans cette liste."},{"page_url":"https://ca.wikipedia.org/wiki/Districte_de_Bienne","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/68/Karte_Bezirk_Biel_2007.png","page_title":"Districte de Bienne","context_page_description":"El districte de Bienne és un dels 26 districtes del Cantó de Berna, té 51707 habitants i una superfície de 25 km². El cap del districte és Biel/Bienne i està format per 2 municipis. Es tracta de l'únic districte bilingüe del cantó. El 2010 va passar a formar part del nou Districte administratiu de Bienne, juntament amb parts dels antics districtes de Nidau i Büren."},{"page_url":"https://sv.wikipedia.org/wiki/Eupatorus_hardwickei","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b1/Eupatorus_hardwickei_cantori_1025.JPG","page_title":"Eupatorus hardwickei","context_page_description":"Eupatorus hardwickei är en skalbaggsart som beskrevs av Hope 1831. Eupatorus hardwickei ingår i släktet Eupatorus och familjen Dynastidae. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A5%D0%BE%D1%82%D0%BC%D1%8B%D0%B6%D1%81%D0%BA_(%D0%91%D0%BE%D1%80%D0%B8%D1%81%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/%D0%A5%D0%B0%D1%80_%D0%B3%D1%83%D0%B1_%D0%A5%D0%BE%D1%82%D0%BC%D1%8B%D0%B6%D1%81%D0%BA_1781_%D0%B8%D0%B7_%D0%92%D0%B8%D0%BD%D0%BA%D0%BB%D0%B5%D1%80%D0%B0.jpg","page_title":"Хотмыжск (Борисовский район)","context_page_description":"Хотмы́жск — село, административный центр Хотмыжского сельского поселения Борисовского района Белгородской области России. Расположено при слиянии рек Меловой Колодезь, Рогозная и Ворскла на озере Бездонном.\\nНаселение — 1138 жителей. До 1928 года — уездный город."},{"page_url":"https://da.wikipedia.org/wiki/Sagnlandet_Lejre","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Athra_stenalderbopladsen.jpg","page_title":"Sagnlandet Lejre","context_page_description":"Sagnlandet Lejre, der åbnede i 1964 under navnet Historisk-arkæologisk Forsøgscenter og var derfor i mange år kendt som Lejre Forsøgscenter, er et forsknings- og formidlingscenter og en populær turistattraktion med fortid og arkæologi som hovedtema. Sagnlandet ligger i Lejre Kommune 13 km vest for Roskilde. Det blev grundlagt af Hans Ole Hansen, som ville skabe og formidle viden og forundring om fortidens levevis gennem eksperimental arkæologisk forskning, levendegørelse og undervisning baseret på aktiv deltagelse.\\nSagnlandet Lejre formidler Danmarks fortid fra jægerstenalderen til landbotiden. Da stedet åbnede, var det verdens første center for forsøg med forhistorisk og historisk teknologi, og det har inspireret andre centre verden over. Det besøges årligt af ca. 60.000 besøgende.\\nI de arbejdende værksteder: væveværkstedet, pottemageriet og smedjen laves kopier af håndværk fra historisk og forhistorisk tid. Det er nemlig her, at redskaberne, dragterne og husgeråd til brug i de rekonstruerede miljøer bliver fremstillet.\\nI Sagnlandet findes en jernalderlandsby kaldet \\"Lethra\\", som består af fire rekonstruerede jernaldergårde fra perioden 200 f.Kr. – 200 e.Kr."},{"page_url":"https://it.wikipedia.org/wiki/S%C3%A3o_Jo%C3%A3o_da_Madeira","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Vista_a%C3%A9rea_parcial_do_centro.jpg","page_title":"São João da Madeira","context_page_description":"São João da Madeira è un comune portoghese di 21.102 abitanti situato nel distretto di Aveiro."},{"page_url":"https://nl.wikipedia.org/wiki/Musketonhaak","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Sleutelhanger_musketon.JPG","page_title":"Musketonhaak","context_page_description":"Een musketonhaak of musketon is een haak met een schuivend deel dat de opening geheel afsluit. Deze haken worden toegepast waar snel een verbinding gemaakt moet kunnen worden. De naam vindt zijn oorsprong in het gebruik van deze haken om een musket mee op te hangen.\\nKarabijnhaken worden ten onrechte ook wel musketons genoemd. Op de onderste foto is duidelijk het verschil hiertussen te zien."},{"page_url":"https://de.wikipedia.org/wiki/Burg_Kohren","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/36/Burg_Kohren_Bergfried.jpg","page_title":"Burg Kohren","context_page_description":"Die Burg Kohren, auch Chorun oder Sahlis genannt, ist eine imposante Ruine einer Höhenburg auf dem Burgberg in Kohren-Sahlis im Landkreis Leipzig in Sachsen."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B8%D1%82%D0%B2%D0%B0_%D0%BF%D1%80%D0%B8_%D0%9F%D0%B5%D1%80%D1%81%D0%B8%D0%B4%D1%81%D0%BA%D0%B8%D1%85_%D0%B2%D0%BE%D1%80%D0%BE%D1%82%D0%B0%D1%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/2persian_gate_wall.JPG","page_title":"Битва при Персидских воротах","context_page_description":"Битва при Персидских воротах — сражение между персидской армией, которой командовал сатрап Персиды Ариобарзан, и вторгшейся греко-македонской армией под командованием Александра Македонского. Зимой 330 г. до н. э. Ариобарзан вел последний бой в меньшинстве с персидскими войсками в Персидских воротах близ Персеполя, на месяц задержав македонскую армию. Александр в конце концов нашёл путь в тыл персов с помощью захваченных военнопленных или местного пастуха и, в конце концов, захватил Персеполь."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B3%D5%A5%D6%80%D5%B4%D5%A1%D5%B6%D5%A1%D5%AF%D5%A1%D5%B6_%D5%B4%D5%B7%D5%A1%D5%AF%D5%B8%D6%82%D5%B5%D5%A9","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1a/Kloster_Banz_2.jpg","page_title":"Գերմանական մշակույթ","context_page_description":"Գերմանական արվեստ, Գերմանիայի արվեստի ակունքները սկիզբ են առնում հնադարից, երբ գերմանական ցեղախմբերը եկան Հռոմեական կայսրություն:"},{"page_url":"https://it.wikipedia.org/wiki/Quarterback_titolari_dei_Los_Angeles_Chargers","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Dougflutie.JPG","page_title":"Quarterback titolari dei Los Angeles Chargers","context_page_description":"Questi quarterback sono partiti come titolari per i Los Angeles Chargers della National Football League. Sono inseriti in ordine di data a partire dalla prima partenza come titolari nei Chargers."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%BD%A6%E6%A0%B9%E5%9F%8E%E5%8D%9A%E7%89%A9%E9%A4%A8","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e8/Hikonehku5.jpg","page_title":"彦根城博物館","context_page_description":"彦根城博物館は滋賀県彦根市金亀町にある彦根市立の歴史博物館である。"},{"page_url":"https://ja.wikipedia.org/wiki/%E6%9D%B1%E6%AD%A6%E4%BD%90%E9%87%8E%E7%B7%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/SanoLineWataraseRiver.jpg","page_title":"東武佐野線","context_page_description":"佐野線は、群馬県館林市の館林駅と栃木県佐野市の葛生駅を結ぶ東武鉄道の鉄道路線である。駅ナンバリングの路線記号はTI。\\n2005年2月に佐野市・田沼町・葛生町が合併して佐野市となったため、群馬県内は館林市内、栃木県内は佐野市内と、それぞれ1県1市を走っている。"},{"page_url":"https://pt.wikipedia.org/wiki/Ferrari_Enzo_Ferrari","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Orange_enzo_ferrari_supercar_rear_%282903602037%29.jpg","page_title":"Ferrari Enzo Ferrari","context_page_description":"Enzo é um supercarro de tração traseira e motor central-traseiro produzido pela Ferrari, fabricante italiana de automóveis. Recebeu o nome do criador da companhia, Enzo Anselmo Ferrari. O automóvel é popularmente chamado apenas de \\"Ferrari Enzo\\", mesmo este não sendo o nome oficial do modelo. O carro foi desenvolvido em 2002 com tecnologias usadas na Fórmula 1, como a carroceria feita inteiramente em fibra de carbono, a transmissão eletro-hidráulica, freios a disco com carbeto de silício reforçados com fibra de carbono e um sistema de aerodinâmica ativo que levanta um pequeno spoiler em alta velocidade, criando downforce para maior aderência. Após o downforce de 7.600 N ser atingido a 300 km/h, a asa traseira é acionada pelo computador para manter esse downforce.\\nO motor 6.0 V12 com 48 válvulas foi o primeiro da nova geração da Ferrari. O seu desenho é baseado no V8 do Maserati Quattroporte, utilizando o mesmo projeto básico, só que com o diâmetro dos cilindros 104 mm maior. Este projeto substituiu as antigas arquiteturas dos V12 e V8 usados na maioria das outras Ferraris contemporâneas. A F430 2005 é a segunda Ferrari a ganhar uma versão deste novo projeto."},{"page_url":"https://ca.wikipedia.org/wiki/Vic_d%27Auribat","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/ce/Map_commune_FR_insee_code_40324.png","page_title":"Vic d'Auribat","context_page_description":"Vic d'Auribat és un municipi francès, situat al departament de les Landes i a la regió de la Nova Aquitània."},{"page_url":"https://fi.wikipedia.org/wiki/Dave_Wottle","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Andrzej_Kupczyk_and_Dave_Wottle_1972.jpg","page_title":"Dave Wottle","context_page_description":"David James ”Dave” Wottle on yhdysvaltalainen entinen 800 metrin juoksija ja olympiavoittaja Münchenin 1972 kisoista. Wottle tunnettiin myös siitä, että hän alituisesti piti lippalakkia päässään.\\nVuoden 1971 jälkeen vaikutti siltä, ettei neuvostoliittolaiselle Euroopan mestarille Jevgeni Aržanoville ole mahdollista löytää varteenotettavaa haastajaa olympiakisojen 800 metrille. Aržanov oli edellisen kerran sijoittunut kilpailussa muulle kuin ykkössijalle vain 19. syyskuuta 1969, sekä kaaduttuaan ja keskeytettyään samana keväänä Neuvostoliiton mestaruuskilpailuissa.\\nKuitenkin kesällä 1972 ennakkokaavailut menivät uusiksi, kun Yhdysvaltain olympiakarsinnoissa 21-vuotias ”Lätsä” Dave Wottle yllättäen juoksi silloista maailmanennätystä sivunneen ajan 1.44,3. Sitä ennen hän oli samana vuonna voittanut 1 500 metrillä Yhdysvaltain mestaruuden ja hallimestaruuden 880 jaardilla. Kuitenkin ennen olympiakarsintoja hänen 800 metrin ennätyksensä oli vuonna 1970 19-vuotiaana juoksemansa 1.47,1.\\nEnnen saapumistaan Euroopan mantereelle, oli hän olympialaisia edeltävän heinäkuun lopulla loukannut jalkansa, mikä oli tiennyt taukoa harjoittelussa."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A8%D9%8A%D9%84%D8%A7%D8%AA%D9%88%D8%B3_%D9%84%D9%84%D8%B7%D8%A7%D8%A6%D8%B1%D8%A7%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Pilatus_P-3_A-829.jpg","page_title":"بيلاتوس للطائرات","context_page_description":"بيلاتوس للطائرات ‏ هو صانع طائرات سويسري تقع مقراته بستانس ويشغل حوالي 1100 عامل وموظف. يعود اصل تسميته لوجود مصانع الشركة على سفح جبل بيلاتوس\\nبيلاتوس للطائرات تتميز بنماذج طائراتها ذات الدفع الاحادي المعدة للاستعمال التجاري وطيران الاعمال والترفيه."},{"page_url":"https://de.wikipedia.org/wiki/Chlorphenylid","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Polychloro-2-aminodiphenylether.svg","page_title":"Chlorphenylid","context_page_description":"Chlorphenylid oder Eulan WA NEU ist ein Stoffgemisch aus den beiden insektenvernichtenden Wirkstoffen PCSD und PCAD. Dabei steht PCSD für die Hauptkomponente Polychlor-2--diphenylether, auch Chlorphenylid genannt und PCAD für das ähnliche Polychlor-2-aminodiphenylether. Beim Herstellungsprozess ist PCAD eine technische Verunreinigung des gewünschten Produktes PCSD."},{"page_url":"https://es.wikipedia.org/wiki/David_Vr%C5%A1eck%C3%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/La_Gaceta_%28Mir%C3%A1_las_m%C3%A1quinas%29_-_Dakar_2017_-_Kolomy.jpg","page_title":"David Vršecký","context_page_description":"David Vršecký es un piloto checo de automovilismo. Ha participado en el Campeonato de Europa de Camiones, o ETRC por sus siglas en inglés, organizado por la FIA, donde fue campeón en 2008 y 2009. Es uno de los mejores pilotos de camiones del siglo. Actualmente, trabaja como ingeniero en el equipo de carreras de camiones checo Buggyra, del que además fue piloto."},{"page_url":"https://id.wikipedia.org/wiki/Sandung","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Sandung_101014-7588_mp.JPG","page_title":"Sandung","context_page_description":"Sandung adalah tempat menyimpan tulang orang yang sudah meninggal. Peletakan tulang di sandung dilakukan setelah Upacara Tiwah. Upacara ini biasanya dilakukan oleh Suku Dayak di Kalimantan yang beragama Hindu Kaharingan. Dengan semakin banyaknya penganut Hindu Kaharingan yang masuk ke agama Kristen dan Islam, maka semakin jarang kita temukan sandung pada saat ini. Bahkan pada beberapa lokasi, sandung sudah menjadi sesuatu yang langka, bahkan dijadikan sasaran pencurian benda-benda bersejarah. Pada desa-desa yang pernah menyelenggarakan upacara tiwah, maka kita akan melihat di tempat tersebut ada sandung. Ada sandung yang di bawahnya diletakkan belanga yang dalam istilah Basel Mission disebut The Holy Pot. Di Desa Bukit Rawi, Kabupaten Pulang Pisau, ada sandung yang dijadikan sebagai objek wisata."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Willich","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/11_Gastst%C3%A4tte%2C_Hauptstra%C3%9Fe_81_%28Neersen%29.jpg","page_title":"Liste der Baudenkmäler in Willich","context_page_description":"Die Liste der Baudenkmäler in Willich enthält die denkmalgeschützten Bauwerke auf dem Gebiet der Stadt Willich im Kreis Viersen in Nordrhein-Westfalen. Diese Baudenkmäler sind in der Denkmalliste der Stadt Willich eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen."},{"page_url":"https://fr.wikipedia.org/wiki/Henri_Martin_(peintre)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Beaux-Arts_de_Carcassonne_-_Portrait_d%27Albert_Sarraut_%281897_-_1898%29_-_Henri_Martin_71.3x57.3.jpg","page_title":"Henri Martin (peintre)","context_page_description":"Henri Jean Guillaume Martin, dit Henri Martin, né à Toulouse le 5 août 1860 et mort à Labastide-du-Vert le 12 novembre 1943, est un peintre post-impressionniste français."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Naturschutzgebiete_im_Landkreis_Nordhausen","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Gipskarst_am_Weg_zur_Osterkippe.jpg","page_title":"Liste der Naturschutzgebiete im Landkreis Nordhausen","context_page_description":"Im Thüringer Landkreis Nordhausen gibt es 16 Naturschutzgebiete."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A8%D9%88%D9%84%D9%8A%D9%86_%D9%84%D9%88%D8%B1%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Pauline_Leroux.jpg","page_title":"بولين لورو","context_page_description":"بولين لورو ‏ هي مصممة رقص فرنسية، ولدت في 20 أغسطس 1809 في باريس في فرنسا، وتوفيت في 5 فبراير 1891 في الدائرة التاسعة في باريس في فرنسا."},{"page_url":"https://vi.wikipedia.org/wiki/B%C3%A3o_Faxai_(2007)","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/53/Faxai_27_oct_2007_0324Z.jpg","page_title":"Bão Faxai (2007)","context_page_description":"Bão nhiệt đới dữ dội Faxai là một cơn bão nhiệt đới tồn tại trong một thời gian ngắn và có một vài ảnh hưởng nhỏ đến đất liền. Đây là cơn bão nhiệt đới thứ 20 trong mùa bão Tây Bắc Thái Bình Dương 2007. Faxai hình thành từ một áp thấp nhiệt đới trên vùng biển gần đảo Guam vào cuối tháng 10 năm 2007. Nó nhanh chóng mạnh lên thành cơn bão nhiệt đới dữ dội vào ngày 26 và đi về phía đông bắc. Cơn bão đạt cường độ mạnh nhất vào ngày 27 tháng 10 và nó suy yếu, tan dần vào ngày 28.\\nMặc dù Faxai không đổ bộ nhưng hoàn lưu của nó đã gây mưa lớn đến 458mm tại Miyakejima. Một chuyến bay của hãng hàng không Nhật Bản đến sân bay Narita gặp tai nạn nghiêm trọng trong chiều 27 tháng 10. Một người bị thương nặng, và năm người khác bị thương nhẹ; máy bay bị hư hại trong vụ tai nạn trên. Một người đã chết gần Tokyo khi cơn bão đi qua, và ba người khác bị thương. Thiệt hại từ cơn bão lên tới 150 triệu ¥."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%95%D1%81%D0%B5%D0%BA%D1%81_(%D0%9E%D0%BD%D1%82%D0%B0%D1%80%D0%B8%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Essex_ON.JPG","page_title":"Есекс (Онтарио)","context_page_description":"Есекс је градић у Канади у покрајини Онтарио. Према резултатима пописа 2011. у граду је живело 19.600 становника."},{"page_url":"https://es.wikipedia.org/wiki/Cuesta_del_Rato","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/CuestadelRato-ermitaPur%C3%ADsima_%282018%298280_03.jpg","page_title":"Cuesta del Rato","context_page_description":"La Cuesta del Rato, es una pedanía de Castielfabib, en la comarca del Rincón de Ademuz, provincia de Valencia."},{"page_url":"https://es.wikipedia.org/wiki/Misiones_diplom%C3%A1ticas_de_Birmania","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9b/B_Nikitskaya_41%2C43_dusk_May_2009_02.JPG","page_title":"Misiones diplomáticas de Birmania","context_page_description":"Abajo se encuentra las embajadas y consulados de Birmania:"},{"page_url":"https://en.wikipedia.org/wiki/Penny_toy","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Antique_tin_toys_%2824433039180%29.jpg","page_title":"Penny toy","context_page_description":"Penny toys is a name used for inexpensive tin toys mostly manufactured in Germany between the 1880s and 1914 that were sold in the UK, Europe and America in the late 19th century and early 20th century."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_onroerend_erfgoed_in_Tienen","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Tienen_Dr._J._Geensstraat_14_-_35411_-_onroerenderfgoed.jpg","page_title":"Lijst van onroerend erfgoed in Tienen","context_page_description":"Een overzicht van het onroerend erfgoed in de gemeente Tienen. Het onroerend erfgoed maakt deel uit van het cultureel erfgoed in België."},{"page_url":"https://uk.wikipedia.org/wiki/Sphaerias_blanfordi","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Sphaerias_blanfordi.jpg","page_title":"Sphaerias blanfordi","context_page_description":"Sphaerias blanfordi — вид рукокрилих, родини Криланових, що мешкає в Південній та Південно-Східній Азії."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%B7%D1%80%D1%8B%D0%B2%D0%B0%D1%82%D0%B5%D0%BB%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/M107_Shells.JPEG","page_title":"Взрыватель","context_page_description":"Взрыватель — устройство, предназначенное для подрыва основного заряда боеприпаса.\\nПо принципу срабатывания взрыватели подразделяются на контактные, дистанционные, неконтактные, командные, а также комбинированного действия.\\nПервый, простейший взрыватель был разработан А.Нобелем для обеспечения надёжного взрыва изобретённого им динамита, и состоит из капсюля и детонатора. Инициирующим импульсом в нём являлся огонь. Впоследствии в армиях различных стран получили широкое распространение ударные взрыватели, которые доминируют на протяжении последних 100 лет."},{"page_url":"https://tr.wikipedia.org/wiki/Metropoliten_kontluk","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/English_metropolitan_counties_2009.svg","page_title":"Metropoliten kontluk","context_page_description":"Metropoliten kontluk, İngiltere'de bir kontluk tipidir. 1972 yılında kurulmuş olup her biri birkaç adet metropoliten ilçeye ayrılmaktadır.\\nMetropoliten kontlukların her biri 1.2 ile 2.8 milyon nüfusu olan geniş kentsel alanları kapsamaktadır. Metropoliten kontluklar, İngiltere nüfusunun %22'sini veya Birleşik Krallık nüfusunun %18'ini oluşturmaktadır.\\nGünümüzde İngiltere'de altı metropoliten kontluk olup bunlar Greater Manchester, Merseyside, Güney Yorkshire, Tyne ve Wear, Batı Midlands ve Batı Yorkshire'dır."},{"page_url":"https://pl.wikipedia.org/wiki/Ministerstwo_Gospodarki,_Pracy_i_Polityki_Spo%C5%82ecznej","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Jerzy_Hausner.JPG","page_title":"Ministerstwo Gospodarki, Pracy i Polityki Społecznej","context_page_description":"Ministerstwo Gospodarki, Pracy i Polityki Społecznej – polski zniesiony urząd administracji rządowej obsługujący ministra właściwego do spraw działu administracji rządowej: gospodarka, praca, rozwój regionalny, turystyka, zabezpieczenie społeczne.\\nMinisterstwo zostało utworzone rozporządzeniem Rady Ministrów z 7 stycznia 2003 r. Zniesione zostało rozporządzeniem Rady Ministrów z 2 maja 2004 r., komórki organizacyjne włączono w nowe Ministerstwo Gospodarki i Pracy."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B3%E3%82%A4%E7%9B%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Six_koi.jpg","page_title":"コイ目","context_page_description":"コイ目は、硬骨魚類の分類群の一つ。6科で構成され、コイ・フナ・タナゴ・ドジョウなどの淡水魚を中心に、およそ4,000種が所属する大きなグループである。中でもコイ科は世界で約3,000種が知られ、魚類で最大の科を構成する。食用あるいは観賞魚として利用される種類も数多く、人間にとっても馴染み深い分類群となっている。\\n本稿では分類群としてのコイ目の構成、およびコイ類全般の特徴について記述する。日本を含む世界各地に分布するコイ科魚類の1種、コイおよび関連する文化については、コイの項目を参照のこと。"},{"page_url":"https://he.wikipedia.org/wiki/%D7%97%D7%99%D7%A7%D7%95%D7%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Beaux%2C_Cecilia_-_Dorothea_and_Francesca_-1898.jpg","page_title":"חיקוי","context_page_description":"חיקוי היא התנהגות בה פרט אחד צופה בפרט אחר וחוזר על התנהגותו של האחר. יכולת החיקוי משותפת לאדם ולבעלי חיים."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%9B%8A%E7%B2%89%E8%8A%B1%E7%A7%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Lactoris_fernandeziana_Engler_1888.png","page_title":"囊粉花科","context_page_description":"囊粉花科又名短蕊花科，只有1屬1種—囊粉花，僅生長在智利東海岸的胡安-費爾南德斯群島，是當地的特有種。\\n囊粉花是一種含芳香油的灌木，單葉互生，葉片有腺點，有托葉；花小，花瓣3裂；核果3裂。\\n1981年的克朗奎斯特分類法將其放在木蘭目中，1998年根據基因親緣關係分類的APG 分類法認為應該分到胡椒目中，而APG II 分類法將本科併入馬兜鈴科。"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%94%A1%E9%81%8B%E5%8D%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Cai_Yunsheng.jpg","page_title":"蔡運升","context_page_description":"蔡運升，字品山，薩麻喇氏，滿洲鑲藍旗，吉林將軍轄區阿勒楚喀副都統轄區雙城堡人。"},{"page_url":"https://gl.wikipedia.org/wiki/Piloto_de_embarcaci%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Veliki_Viharnik.jpg","page_title":"Piloto de embarcación","context_page_description":"Un piloto de embarcación é a persoa encargada da navegación dun barco."},{"page_url":"https://nl.wikipedia.org/wiki/Godescalc-evangelistarium","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Vangeli_di_godescalco_%28evangelista_luca%29%2C_Ms._Lat_1203_f._1r._21x31_cm%2C_parigi_bibliotheque_nationale%2C_783_circa.jpg","page_title":"Godescalc-evangelistarium","context_page_description":"Het Godescalc-evangelistarium is een verlucht handschrift gemaakt tussen 781 en 783 vermoedelijk in Aken in opdracht van Karel de Grote en zijn vrouw Hildegard. Het boek bevatte de evangelieteksten die gelezen worden tijdens de misvieringen doorheen het liturgische jaar en is dus een evangelistarium. Volgens het dedicatie gedicht van 48 verzen achteraan in het handschrift, werd het geschreven door Godescalc een Frankische scribent. Het gedicht noemt ook Karel en Hildegard als opdrachtgevers. Het zou gemaakt zijn om de reis van Karel de Grote naar Rome te gedenken. Tijdens die reis die begon in 781 werd zijn zoon Karloman door paus Hadrianus gedoopt in het baptisterium van Sint-Jan in Lateranen. De miniatuur van de “fontein des levens” op folium 3 verso zou zo goed als zeker verwijzen naar dit doopsel. Het werk is het oudste manuscript van de zogenoemde Ada-groep of Hofschool van Karel de Grote."},{"page_url":"https://pt.wikipedia.org/wiki/Schweighouse-sur-Moder","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/GX_127_L_Haguenau_RITMO_n111.JPG","page_title":"Schweighouse-sur-Moder","context_page_description":"Schweighouse-sur-Moder é uma comuna francesa na região administrativa de Grande Leste, no departamento Baixo Reno. Estende-se por uma área de 9,92 km². Em 2010 a comuna tinha 4 932 habitantes."},{"page_url":"https://it.wikipedia.org/wiki/Strade_francesi_per_Santiago_di_Compostela","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Cloitre_avec_arbre_moissac.jpg","page_title":"Strade francesi per Santiago di Compostela","context_page_description":"Le strade francesi per Santiago di Compostela sono un insieme di percorsi e luoghi che costituiscono le testimonianze del Cammino di Santiago di Compostela in territorio francese. Si tratta tra l'altro di 7 tratti di percorsi e 71 monumenti che sono stati dichiarati patrimonio dell'umanità dall'UNESCO nel 1998."},{"page_url":"https://ur.wikipedia.org/wiki/%D8%B9%D8%AB%D9%85%D8%A7%D9%86%DB%8C_%D8%B7%D8%B1%D8%B2_%D8%AA%D8%B9%D9%85%DB%8C%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Emperors_mosque_yard.jpg","page_title":"عثمانی طرز تعمیر","context_page_description":"عثمانی معماری یا عثمانی طرز تعمیر سلطنت عثمانیہ کا فن تعمیر ہے جو چودہویں صدی اور پندرہویں صدی میں بورصہ اور ادرنہ میں سامنے آیا۔ سلطنت کے فن تعمیر کی بنیاد سلجوقی فن تعمیر ہے جس پر بعد ازاں بازنطینی اور ایرانی اثرات بھی نمایاں ہیں۔"},{"page_url":"https://nl.wikipedia.org/wiki/Wollestraat","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Achterkant_hallen_Brugge.jpg","page_title":"Wollestraat","context_page_description":"De Wollestraat is een straat in Brugge."},{"page_url":"https://lv.wikipedia.org/wiki/Alentiske","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Alentisque%2C_Soria%2C_Espa%C3%B1a%2C_2015-12-29%2C_DD_90.JPG","page_title":"Alentiske","context_page_description":"Alentiske ir municipalitāte Spānijā, Sorijas provincē, Kastīlijas un Leonas autonomajā reģionā. 2011. gadā municipalitātē dzīvoja 35 cilvēki, bet pirms Otrā pasaules kara iedzīvotāju skaits pārsniedza 370 cilvēkus. Aletiskes municipalitāti veido Alentiskes un Kavaniljasas ciemi, un tās platība ir 34,97 km². Līdz tuvākajai pilsētai Sorijai ir 55 km."},{"page_url":"https://is.wikipedia.org/wiki/%C3%9Alfur_Karlsson","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/By_Proxy_%282016%29.jpg","page_title":"Úlfur Karlsson","context_page_description":"Úlfur Karlsson er íslenskur listamaður og kvikmyndaleikstjóri.\\nÚlfur hóf feril sinn með gerð stuttmynda og heimildarmynda. Árið 2003 komst Úlfur á New York Independent Film and Video Festival með stuttmyndina Pirovat. Árið 2008 lauk hann námi við Kvikmyndaskóla Íslands. Hann hefur gert tvær stuttmyndir síðan þá, Tvísögu, árið 2006, og Einskonar Alaska, árið 2008, sem byggð var á útvarpsleikriti eftir Harold Pinter. Eftir það sneri hann sér að mestu að myndlistinni. Árið 2009 lauk hann fornámi í Myndlistarskólanum á Akureyri. Þá hóf hann nám við Valand School of Fine Arts og lauk BA gráðu þaðan. Þar hefur hann haldið margar sýningar á abstrakt expressíónistískum málverkum sínum. Úlfur hefur einnig haldið fjölmargar sýningar á Íslandi, meðal annars í Listasafni ASÍ, Slunkaríki og Sláturhúsinu á Egilsstöðum. Hann hefur einnig sýnt verk sín í Svíþjóð, Þýskalandi, Danmörku og Grikklandi. Árið 2015 tók Úlfur þátt í sýningunni Nýmálað í Listasafni Reykjavíkur. Hann hélt einnig sýningu sem bar titilinn Við erum ekki hrædd, í Listasafni Reykjavíkur og sýningu sem hét Inngræðsla í Gallerý Veður og Vindur."},{"page_url":"https://de.wikipedia.org/wiki/Haus_Wittmann","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Haus_Wittmann.JPG","page_title":"Haus Wittmann","context_page_description":"Das Haus Wittmann ist ein Gebäude der Moderne in der Marktgemeinde Grafenegg im Bezirk Krems-Land. Es wurde in den Jahren 1970–1975 vom Architekten Johannes Spalt für die Möbelfabrikanten Wittmann errichtet."},{"page_url":"https://pl.wikipedia.org/wiki/AquaDom","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/AquaDom_von_Oben.jpg","page_title":"AquaDom","context_page_description":"AquaDom – największe na świecie cylindryczne akwarium z wodą morską, z siedzibą w hotelu Radisson Blu w berlińskiej dzielnicy Mitte. AquaDom jest częścią kompleksu hotelowo-konferencyjnego DomAquarée."},{"page_url":"https://pt.wikipedia.org/wiki/Lagouira","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Western_Sahara_relief_location_map.jpg","page_title":"Lagouira","context_page_description":"Lagouira é um vilarejo e município fronteiriço do extremo sudoeste do Saara Ocidental, um território administrado de facto por Marrocos, que o considera parte do seu território. Faz parte da província de Aousserd e da região de Oued Ed-Dahab-Lagouira. Em 2004 tinha 3 726 habitantes.\\nSitua-se na extremidade sudoeste do Cabo Branco, cuja parte oriental pertence à Mauritânia e onde se situam as cidades mauritanas de Cansado e Nouadhibou. Lagouira dista encontra-se 8 km a oeste de Cansado e 15 km a sul de Nouadhibou.\\nLa Güera é também o nome de uma das dairas que formam o vilaiete do campo de refugiados de Aousserd da República Árabe Saaraui Democrática, em Tindouf, Argélia."},{"page_url":"https://pl.wikipedia.org/wiki/Nikolsk_(obw%C3%B3d_wo%C5%82ogodzki)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Coat_of_Arms_of_Nikolsk_%28Vologda_oblast%29.png","page_title":"Nikolsk (obwód wołogodzki)","context_page_description":"Nikolsk – miasto w Rosji, w obwodzie wołogodzkim, 440 km na wschód od Wołogdy. W 2009 liczyło 8 425 mieszkańców."},{"page_url":"https://fr.wikipedia.org/wiki/Extraction_de_l%27uranium","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Kamotoite-%28Y%29-Astrocyanite-%28Ce%29-Uranophane-180995.jpg","page_title":"Extraction de l'uranium","context_page_description":"L’extraction de l'uranium est une industrie minière qui va de la prospection initiale jusqu'au produit transportable, le « yellowcake ». Elle est la première étape du cycle du combustible nucléaire visant à fournir le combustible des réacteurs nucléaires. Elle comprend les opérations successives suivantes :\\nla prospection de nouveaux gisements ;\\nla préparation d'un site pour l'exploitation d'un gisement ;\\nl'extraction du minerai, seul ou en coextraction avec de l'or, du cuivre, du phosphate... ;\\nle traitement du minerai pour concentrer l'uranium sous forme de « yellowcake »,\\nle transport sécurisé du yellow cake,\\nle démantèlement des équipements industriels et la gestion de l'après-mine.\\nEn 2014, les trois premiers pays producteurs d'uranium dans le monde — le Kazakhstan, le Canada et l'Australie — totalisent les deux tiers de la production mondiale. La production d'uranium, qui atteint 56,2 milliers de tonnes la même année, est en baisse de 5,7 % par rapport à 2013."},{"page_url":"https://eo.wikipedia.org/wiki/Burgo_Rheineck","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Burg_Rheineck_1.JPG","page_title":"Burgo Rheineck","context_page_description":"La burgo Rheineck estas altaĵburgo apud Bad Breisig en la germana federacia lando Rejnlando-Palatinato, distrikto Ahrweiler. Ĝia origino estis mezepoka burginstalaĵo el la 11a jarcento. La burgo estis la centro de la samnoma graflando Rheineck."},{"page_url":"https://pl.wikipedia.org/wiki/Aleksander_Holas","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/MOs810%2C_WG_2014_20%2C_OChK_Glisnica_%28Biadki_church%29_%282%29.JPG","page_title":"Aleksander Holas","context_page_description":"Aleksander Holas – polski architekt i konserwator zabytków."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B3%D5%A5%D5%B6%D5%A4%D5%A5%D6%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Combotrans.svg","page_title":"Գենդեր","context_page_description":"Գենդեր, գենդերային, իգականությանը և արականությանը վերաբերող և դրանք տարբերակող բնութագրիչների ամբողջություն:\\nԿախված համատեքստից՝ այս բնութագրիչները կարող են ներառել կենսաբանական սեռը առանձնահատկությունները, սեռի հիման վրա առանձացած սոցիալական կառուցվածքներն ու գենդերային ինքնությունը: Շատ մշակույթներում կիրառվում է գենդերի երկբևեռ համակարգը, ինչը ենթադրում է, որ մարդիկ կարող են ունենալ 2 գենդեր: Այն մարդիկ, որոնք իրենց կյանքը պատկերացնում և ապրում են երկբևեռ գենդերային համակարգից դուրս, համարվում են «ոչ բինար» կամ «քուիր/քվիր»։ Ավելին, որոշ հասարակություններ ունեն նաև այլ առանձնահատուկ գենդերներ, ինչպես օրինակ՝ Հարավային Ասիայում հաջիրաները:\\nԳենդերը կարող է արտահայտվել հասարակական կյանքի բոլոր ոլորտներում, ներառյալ քաղաքականությունը, տնտեսությունը, իրավունքը, գաղափարախոսությունը, մշակույթը, կրթությունը, գիտությունն ու առողջապահությունը։"},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B4%D8%B1%D9%88%D8%A7%D9%86%D8%A7%D8%A8%D9%84%D8%A7%DA%AF%D9%88%D9%84%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Tyagada_Brahmadeva_Pillar_at_Shravanabelagola.jpg","page_title":"شروانابلاگولا","context_page_description":"شروانابلاگولا یک منطقهٔ مسکونی در هند است که در بخش حسن واقع شده‌است. شروانابلاگولا ۸۷۱ متر بالاتر از سطح دریا واقع شده‌است."},{"page_url":"https://en.wikipedia.org/wiki/Taksaorn_Paksukcharern","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Taksaorn_Paksukcharern.jpg","page_title":"Taksaorn Paksukcharern","context_page_description":"Taksaorn Paksukcharern is a Thai actress and model who has starred in several lakorns. She is known for her roles in the 2008 version of Jam Loey Rak as well as the title character in Wanida, which won Best Foreign Series at the International Drama Festival in Tokyo. She graduated with BA from Chulalongkorn University."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%81%B5%E5%AF%9F%E9%BE%8D%E5%B1%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Nuthetes.jpg","page_title":"偵察龍屬","context_page_description":"偵察龍屬是獸腳亞目恐龍的一屬，目前被認為是疑名，是種小型掠食恐龍，可能屬於馳龍科，身長約兩公尺，體高約一公尺。生存於白堊紀早期的歐洲。"},{"page_url":"https://pt.wikipedia.org/wiki/Lages_Station","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/2014-05-21_13_48_36_Buildings_in_Lages_Junction%2C_Nevada.JPG","page_title":"Lages Station","context_page_description":"Lages Station é uma comunidade não incorporada e cidade fantasma no condado de White Pine no estado estadunidense. Em 2007, havia apenas uma família residindo na localidade e um único negócio, uma estação de gasolina."},{"page_url":"https://pl.wikipedia.org/wiki/Cato_Guldberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Guldberg_und_Waage_01.jpg","page_title":"Cato Guldberg","context_page_description":"Cato Maximilian Guldberg – norweski chemik i matematyk. Guldberg studiował na Uniwersytecie w Christianii i tam później został profesorem matematyki stosowanej.\\nWspólnie ze swoim szwagrem Peterem Waage odkrył i opublikował w 1864 prawo działania mas określające stan równowagi chemicznej w zależności od stężeń lub ciśnień substratów i produktów reakcji. Ich wkład początkowo nie został zauważony, prawdopodobnie dlatego, że ich praca została opublikowana w języku norweskim. Również po publikacji w 1867 w języku francuskim znaczenie odkrytej przez nich zależności nie było docenione. Kluczowe znaczenie prawa działania mas zostało zauważone i nagłośnione przez naukowców z uniwersytetu w Oksfordzie, W. Essona i V. Harcourta. Prace Guldberga i Waagego nad prawem działania mas trwały do 1879 roku.\\nW roku 1870 Guldberg badał w jaki sposób obniżenie temperatury krzepnięcia oraz prężności pary czystej cieczy zależy od zawartości substancji rozpuszczonej.\\nW 1880 sformułował prawo Guldberga określające związek pomiędzy parametrami wrzenia a temperaturą krytyczną danej cieczy."},{"page_url":"https://nl.wikipedia.org/wiki/De_Kaplote","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Koer_achterzijde.jpg","page_title":"De Kaplote","context_page_description":"De Kaplote is het oudste burgerhuis van de gemeente Wingene in de provincie West-Vlaanderen. De vakwerkhoeve ligt in de gelijknamige Kaplotestraat nabij het centrum, ten oosten van de Sint-Amanduskerk."},{"page_url":"https://af.wikipedia.org/wiki/Politieke_party","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Henry_St._John%2C_late_Ld._Viscount_Bolingbroke_%28NYPL_Hades-280069-EM3376%29.jpg","page_title":"Politieke party","context_page_description":"'n Politieke party is 'n politieke organisasie wat poog om die regering se beleid te beïnvloed, gewoonlik deur hul eie kandidate daar te stel en te wedywer vir stemme en regeringsposte. Politieke partye neem gewoonlik deel aan verkiesingsveldtogte, opvoedkundige uitreik- en protesaksies en gee sodoende uitdrukking aan die ideologie of visie van die party. Partye vorm ook soms koalisies waartydens hulle saamwerk om 'n gemeenskaplike doelwit te bereik. 'n Politieke party word gevorm deur mense wat ooreenstem met 'n aantal politieke beginsels, hoewel daar min partye is waar alle lede saamstem oor al die beginsels.\\nHoewel dit teenswoordig dikwels die geval is, is politieke partye nie 'n voorwaarde vir die funksionering van 'n parlementêre stelsel nie. Waar die parlementariërs voorheen onafhanklik gewerk en verenig het in informele alliansies en verkiesingsverenigings, het daar verskeie groot politieke partye daarna ontstaan. In baie demokratiese lande, waaronder Suid-Afrika, is dit gebruiklik vir persone wat politieke funksies uitvoer om lede te wees van 'n politieke party. Maar dit is nie altyd die geval nie."},{"page_url":"https://en.wikipedia.org/wiki/Pac_family","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Pac_Palace.JPG","page_title":"Pac family","context_page_description":"Pacowie was one of the most influential noble families in the Grand Duchy of Lithuania during the era of the Polish-Lithuanian Commonwealth. Numerous high-ranking officials of the Commonwealth came from their ranks. Their coat of arms was Gozdawa.\\nThe family reached the height of its influence during the second half of the 17th century. Their lands were located mainly in Hrodna and Lida.\\nThe family's ancestor Kimantas was mentioned in the privilege of 1388 issued by Grand Duke of Lithuania Vytautas the Great as Kymunt. The estate of the family in proximity of Grodno was mentioned in the road description, charted by the Teutonic Knights, as Kymundsdorf. Kimantas and his son Daukša were among the signatories of the Union of Vilnius and Radom of 1401. Daukša's son Pac is considered the first member of the family; his ancestors took his first name as their family name, beginning with his son Jerzy Pac.\\nTheir lands were concentrated in the southern Lithuania propria, around the county of Jieznas."},{"page_url":"https://en.wikipedia.org/wiki/Perivascular_space","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/VirchowRobin.png","page_title":"Perivascular space","context_page_description":"A perivascular space, also known as a Virchow–Robin space, is a fluid-filled space surrounding certain blood vessels in several organs, including the brain, potentially having an immunological function, but more broadly a dispersive role for neural and blood-derived messengers. The brain pia mater is reflected from the surface of the brain onto the surface of blood vessels in the subarachnoid space. In the brain, perivascular cuffs are regions of leukocyte aggregation in the perivascular spaces, usually found in patients with viral encephalitis.\\nPerivascular spaces vary in dimension according to the type of blood vessel. In the brain where most capillaries have an imperceptible perivascular space, select structures of the brain, such as the circumventricular organs, are notable for having large perivascular spaces surrounding highly permeable capillaries, as observed by microscopy. The median eminence, a brain structure at the base of the hypothalamus, contains capillaries with wide perivascular spaces.\\nIn humans, perivascular spaces surround arteries and veins can usually be seen as areas of dilatation on MRI images."},{"page_url":"https://fy.wikipedia.org/wiki/Beek_(gemeente)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Sint_Martinuskerk.JPG","page_title":"Beek (gemeente)","context_page_description":"Beek is in plak en gemeente yn de Nederlânske provinsje Limburch mei 16.268 ynwenners op slach fan 2014. De ynwenners fan de gemeente Beek binne ferdield oer de doarpen Beek, Spaubeek, Neerbeek, Genhout, Geverik en Kelmond. Beek hat in oerflakte fan 21,03 km². De hjoeddeistige gemeente ûntstie yn 1982, doe't de eardere gemeente Beek fúzjearre mei de doetiidske gemeente Spaubeek."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B2%D5%B8%D5%B6_%D5%8C%D5%A5%D5%BF%D5%AB%D6%80%D5%B8%D6%82_%D5%A4%D5%B8%D6%82_%D5%8D%D5%B8%D6%82%D5%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Bras%C3%A3o_Bom_Retiro_do_Sul.png","page_title":"Բոն Ռետիրու դու Սուլ","context_page_description":"Արոյու դու Մեյու, համայնք Բրազիլիայում, մտնում է Ռիու Գրանդի դու Սուլ նահանգի մեջ։ Մի մաս է կազմում Ռիու Գրանդի դու Սուլ նահանգի արևելակենտրոնական մաս ը։ Մտնում է տնտեսական կարգավիճակ ունեցող Լաժեդաու Էստրելայի գավառի մեջ։ Բնակչությունը կազմում է 11 130 մարդ, ըստ 2007 թվականի տվյալների։ Տարածքը կազմում է 102,327 կմ²։ Բնակչության խտությունը՝ 117,2 մարդ/կմ²։"},{"page_url":"https://pl.wikipedia.org/wiki/No%C5%BCyce_(wiertnictwo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/8_inch_drilling_jar_532.jpg","page_title":"Nożyce (wiertnictwo)","context_page_description":"Nożyce wiertnicze – element przewodu wiertniczego, mający za zadanie wywołanie w przewodzie udarów w górę lub w dół. Stosuje się w pracach ratowniczych w wypadku przechwycenia przewodu lub dla uderzenia narzędzia tego wymagającego.\\nNożyce mają postać współśrodkowych rur, mogących poruszać się względem siebie o kilkanaście centymetrów. Rozciąganie ich lub ściskanie powoduje nagromadzenie w nich energii. Po przekroczeniu naprężenia otwierającego mechanizm wyzwalający, część ruchoma nożyc zaczyna się poruszać z dużym przyspieszeniem, aby po kilkunastu centymetrach uderzyć w część nieruchomą, która przenosi siłę uderzenia na unieruchomioną część przewodu.\\nElement wyzwalający może być mechaniczny lub hydrauliczny.\\nChociaż nożyce mają zastosowanie w pracach ratunkowych, są prewencyjnie włączane w skład przewodu, zwłaszcza w wierceniach głębokich lub kierunkowych albo w warunkach, gdzie występuje duże ryzyko jego unieruchomienia."},{"page_url":"https://it.wikipedia.org/wiki/Antoine_Guillemet","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/JBA_Guillemet_Le_port_de_Barfleur_b.jpg","page_title":"Antoine Guillemet","context_page_description":"Antoine Guillemet è stato un pittore francese.\\nPaesaggista, le sue opere risentono in parte del modo impressionista, in parte della Scuola di Barbizon. È considerato un artista di transizione fra il realismo e l'impressionismo."},{"page_url":"https://pl.wikipedia.org/wiki/Skorpiony","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/1911_Britannica-Arachnida-Palamnaeus_indus2.png","page_title":"Skorpiony","context_page_description":"Skorpiony – rząd pajęczaków, obejmujący ponad 2000 opisanych gatunków. Występują od tropików i subtropików po część cieplejszej strefy umiarkowanej, od stref pływów po wysokie góry. Zdolne do hibernacji lub estywacji. Drapieżne. Mają prosomę nakrytą karapaksem, nogogłaszczki zakończone szczypcami, 4 pary odnóży krocznych oraz segmentowany odwłok, podzielony na szerszy przedodwłok i węższy zaodwłok. Przedodwłok wyposażony jest w wieczko płciowe, grzebienie i płuca blaszkowate, a zaodwłok zakończony jest telsonem z kolcem jadowym. Samice są żyworodne i opiekują się potomstwem, przynajmniej do pierwszej wylinki. Znane są gatunki zdolne do partenogenezy. Niektóre gatunki tworzą grupy rodzinne. W zapisie kopalnym znane od syluru i uznawane za pierwsze pajęczaki, które skolonizowały ląd."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D1%96%D0%BB%D0%B0%D0%B1%D1%83%D1%80%D1%96","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8d/Savannakhet_Province_districts.png","page_title":"Вілабурі","context_page_description":"Вілабурі — один з районів провінції Саваннакхет, Лаос."},{"page_url":"https://en.wikipedia.org/wiki/Karasuma_Street","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Karasuma.jpg","page_title":"Karasuma Street","context_page_description":"Karasuma Street is a major south-north street in central Kyoto, Japan. It is part of National Route 24 and National Route 367. The Karasuma Line subway runs under the street."},{"page_url":"https://de.wikipedia.org/wiki/Lars_Anton_Anjou","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Lars_Anton_Anjou_in_the_1860s_photographed_by_Malmberg.jpg","page_title":"Lars Anton Anjou","context_page_description":"Lars Anton Anjou war ein schwedischer lutherischer Kirchenhistoriker, Politiker und Geistlicher."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%98%8E%E5%8D%81%E4%B8%89%E9%99%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Mingxianling_minglou.jpg","page_title":"明十三陵","context_page_description":"明十三陵，坐落於北京市昌平區十三陵鎮天壽山下40平方公里的小盆地，距離北京市區約50公里，是中國明朝皇帝的墓葬建築群。自永樂七年五月起用，直到安葬崇禎帝後結束，歷時230多年，共葬有13位明朝皇帝，23位明朝皇后、2位明朝太子、30餘名妃嬪、1位太監，是全球保存完整皇陵墓葬群之一。2003年7月3日，與清東陵、清西陵等明清皇家陵墓一道，被聯合國教科文組織列為世界文化遺產。"},{"page_url":"https://de.wikipedia.org/wiki/Lechwerke","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/08/Maria_Steinbach_2008_31.08.2008_16-29-29_3072x2304.JPG","page_title":"Lechwerke","context_page_description":"Die Lechwerke AG ist ein regionales Energieversorgungsunternehmen, das sich im mehrheitlichen Besitz der E.ON-Tochtergesellschaft Innogy befindet.\\nDas Netzgebiet umfasst den größten Teil des bayerischen Regierungsbezirkes Schwaben und wird im Westen von der Iller, im Norden von der Donau, im Osten vom Lech und im Süden vom Landkreis Oberallgäu annähernd begrenzt, wobei einige Stadtwerke ausgenommen sind. Damit wird eine Fläche von 6.895 km² mit rund 972.000 Einwohnern abgedeckt.\\nZum Jahresende 2017 beschäftigte das Unternehmen mit Auszubildenden insgesamt 1.779 Vollzeitkräfte und erzielte einen Umsatz in Höhe von 2,337 Milliarden Euro."},{"page_url":"https://fr.wikipedia.org/wiki/Tholos","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Tholos_esquema.gif","page_title":"Tholos","context_page_description":"Une tholos est, dans l'architecture de la Grèce antique, un édifice de plan circulaire à destination religieuse ou funéraire.\\nL'expression tombe à tholos est employée pour désigner une tombe à chambre mycénienne à coupole ou, plus couramment pour désigner un édifice rond d'époque archaïque, classique ou hellénistique.\\nLes préhistoriens ont parfois repris le mot pour désigner des édifices circulaires plus anciens."},{"page_url":"https://nl.wikipedia.org/wiki/Jaguar_Mk10","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Jaguar_Mark_X_arriving_Schaffen-Diest.jpg","page_title":"Jaguar Mk10","context_page_description":"De Jaguar Mk10 of Mark X is een auto van Jaguar Cars die in 1962 op de markt kwam.\\nAmerika is een belangrijk afzetgebied voor Jaguar en met die markt in gedachten werd de grote MK 10 - 5,13 m lang en 1,94 m breed - ontwikkeld. De MK 10 kwam in oktober 1961 op de markt met een 245 pk sterke 3,8 liter-zescilinder. In 1964 vergrootte Jaguar de cilinderinhoud tot 4,2-liter. Het vermogen steeg tot 265 pk. In 1967 werd de MK 10 omgedoopt tot 420G. Onder die naam ging het model in 1970 uit productie."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%83%D8%A7%D8%B1%D9%88%D9%84_%D9%81%D8%B1%D9%8A%D8%B4%D9%8A%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Carole_Fr%C3%A9chette.JPG","page_title":"كارول فريشيت","context_page_description":"كارول فريشيت هي كاتبة مسرحية وكاتِبة كندية، ولدت في 1949 في مونتريال في كندا."},{"page_url":"https://da.wikipedia.org/wiki/Kirovsk_(Murmansk_oblast)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Kirovsk%2B.jpg","page_title":"Kirovsk (Murmansk oblast)","context_page_description":"Kirovsk, tidligere kendt som Khibinogorsk indtil 1934, er en by på 31.000 indbyggere.\\nKirovsk blev grundlagt i 1929, som opfølgning på en ekspedition af den sovjetiske mineralog der i 1920erne havde fundet store mængder af apatit og nephelin i området. Den fik officiel status af by i 1931 og senere omdøbt Kirovsk efter bolsjevikken Sergej Kirov, som havde været ledende i planlægningen i udvindingen af mineralerne.\\nKirovsk har den mest nordligt beliggende botanisk have og er et yndet skisportssted."},{"page_url":"https://ceb.wikipedia.org/wiki/Hrastovec_v_Slov._Goricah","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/DomacijaHrastovec3.jpg","page_title":"Hrastovec v Slov. Goricah","context_page_description":"Lungsod ang Hrastovec v Slov. Goricah sa Esklobeniya. Nahimutang ni sa munisipyo sa Lenart, sa amihanan-sidlakang bahin sa nasod, 110 km sa amihanan-sidlakan sa Ljubljana ang ulohan sa nasod. 250 metros ibabaw sa dagat kahaboga ang nahimutangan sa Hrastovec v Slov. Goricah, ug adunay 518 ka molupyo.\\nAng yuta palibot sa Hrastovec v Slov. Goricah kay kasagaran patag, apan sa habagatan nga kini mao ang kabungtoran. Ang kinahabogang dapit sa palibot dunay gihabogon nga 424 ka metro ug 3.4 km sa habagatan-kasadpan sa Hrastovec v Slov. Goricah. Dunay mga 104 ka tawo kada kilometro kwadrado sa palibot sa Hrastovec v Slov. Goricah medyo hilabihan populasyon. Ang kinadul-ang mas dakong lungsod mao ang Maribor, 10.9 km sa kasadpan sa Hrastovec v Slov. Goricah. Hapit nalukop sa kaumahan ang palibot sa Hrastovec v Slov. Goricah.\\nAng klima klima sa kontinente. Ang kasarangang giiniton 11 °C. Ang kinainitan nga bulan Hulyo, sa 22 °C, ug ang kinabugnawan Disyembre, sa -3 °C. Ang kasarangang pag-ulan 1,369 milimetro matag tuig. Ang kinabasaan nga bulan Septiyembre, sa 177 milimetro nga ulan, ug ang kinaugahan Marso, sa 53 milimetro."},{"page_url":"https://te.wikipedia.org/wiki/%E0%B0%B8%E0%B1%8D%E0%B0%B5%E0%B0%B2%E0%B0%BF%E0%B0%82%E0%B0%97_%E0%B0%B8%E0%B0%82%E0%B0%AA%E0%B0%B0%E0%B1%8D%E0%B0%95%E0%B0%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/World_marriage-equality_laws_%28up_to_date%29.svg","page_title":"స్వలింగ సంపర్కం","context_page_description":"స్వలింగ సంపర్కము అనగా ఇద్దరు పురుషుల మధ్య లేదా ఇద్దరు స్త్రీల మధ్య ఉండే లైంగిక సంబంధము. ఈ లైంగిక సంబంధము సృష్టి విరుద్ధమని అందరూ భావిస్తారు. కానీ, ఇది సృష్టికి విరుద్ధమేమీ కాదని, ప్రాకృతికమేనని ప్రపంచ ఆరోగ్య సంస్థ తేల్చి చెప్పింది. వైద్య శాస్తం ప్రకారం కూడా స్వలింగ సంపర్కము ఒక మానసిక వ్యాధియో, లేక జన్యుపరమైన లోపమో కాదని, లైంగికతలో ఒక భిన్నమైన కోణంగా దీనిని పరిగణించాలని American Psychological Association, American Psychiatric Association, American Academy of Pediatrics మొదలగు ప్రపంచ ప్రఖ్యాత సంస్థలు నిర్ధారించాయి. ఇటీవల దీనిని Indian Psychiatric Society కూడా ఆమోదించింది. భారతీయ శిక్షాస్మృతి ప్రకారం స్వలింగ సంభోగం' నేరంగా పరిగణింపబడుతుంది. అయితే, ఢిల్లీ హైకోర్టు 2.7.2009న ఇద్దరు వయస్కుల మధ్య పరస్పర అంగీకారంతో జరిగే స్వలింగ సంభోగం నేరం కాదని, సెక్షన్ 377 భారత రాజ్యాంగంలోని అధికరణాలు 14, 15, 21ల ప్రకారం తప్పని తీర్పు ఇచ్చింది. స్వలింగ సంపర్కాన్ని చట్టబద్ధం చేయాలంటూ ఢిల్లీ హైకోర్టు ఇచ్చిన తీర్పుపై స్పందనను తెలియజేయాలని ఆదేశిస్తూ 9.7.2009న కేంద్ర ప్రభుత్వానికి సుప్రీంకోర్టు నోటీసులు జారీచేసింది. కానీ, సుప్రీంకోర్టు 11.12.2013న ఢిల్లీ హైకోర్టు తీర్పును కొట్టివేస్తూ 377 సెక్షన్ రాజ్యాంగ విరుద్ధమేమీ కాదని, ఒకవేళ దానిలో ఏమైనా మార్పులు చేయాలనుకుంటే పార్లమెంటు చేయవచ్చని తీర్పు చెప్పింది."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D0%BB%D0%B5%D0%B9%D0%BD%D0%BE%D0%B4%D0%B8_%D0%A1%D0%B2%D1%8F%D1%89%D0%B5%D0%BD%D0%BD%D0%BE%D1%97_%D0%A0%D0%B8%D0%BC%D1%81%D1%8C%D0%BA%D0%BE%D1%97_%D1%96%D0%BC%D0%BF%D0%B5%D1%80%D1%96%D1%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Weltliche_Schatzkammer_Wien_%28164%29.JPG","page_title":"Клейноди Священної Римської імперії","context_page_description":"Клейноди Священної Римської імперії — коронаційні інсигнії королів та імператорів Священної Римської імперії. До них належать Імперська корона, Святий імператорський спис, Імперський хрест, Імперський меч, Імперське яблоко, що зараз зберігаються у Імператорській скарбниці віденського Гофбургу."},{"page_url":"https://es.wikipedia.org/wiki/Cerro_Chenque","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Puerto_A._Mor%C3%A1n_y_Ferrocarril.jpg","page_title":"Cerro Chenque","context_page_description":"El Cerro Chenque es un accidente geográfico de tipo meseta, ubicado en la ciudad de Comodoro Rivadavia, Patagonia Argentina. Es posible divisarlo desde la playa de Rada Tilly y el límite con la Provincia de Santa Cruz. Juntos con otras formaciones mesetarias, como el Cerro Hermitte y el Viteau, dividen y atraviesan la ciudad formando distintas zonas y barrios."},{"page_url":"https://cs.wikipedia.org/wiki/Leedsichthys","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Leedsichtys092.jpg","page_title":"Leedsichthys","context_page_description":"Leedsichthys byla obří pravěká ryba z čeledi Pachycormidae. Žila v období střední jury ve všech světových oceánech. První zkameněliny byly objeveny u britského Peterborough v roce 1886 sběratelem zkamenělin Alfredem N. Leedsem."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%B4%84%E7%91%9F%E5%A4%AB%C2%B7%E6%BA%AB%E5%85%8B%E5%8B%92","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Josef_Winkler_cropped.jpg","page_title":"約瑟夫·溫克勒","context_page_description":"约瑟夫‧温克勒是一名奥地利作家，他出生于克恩顿州的帕特尼翁，他于1979年出道时已经获奖，其后在奥地利及德语文坛中享负盛名，当中包括在2007年获得大奥地利国家奖，及在2008年获得格奥尔格·毕希纳奖，独享四万欧元的奖金。"},{"page_url":"https://en.wikipedia.org/wiki/Mississippian_culture_pottery","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Moundville_Archaeological_Park_25.JPG","page_title":"Mississippian culture pottery","context_page_description":"Mississippian culture pottery is the ceramic tradition of the Mississippian culture found as artifacts in archaeological sites in the American Midwest and Southeast. It is often characterized by the adoption and use of riverine shell-tempering agents in the clay paste. Shell tempering is one of the hallmarks of Mississippian cultural practices. Analysis of local differences in materials, techniques, forms, and designs is a primary means for archaeologists to learn about the lifeways, religious practices, trade, and interaction among Mississippian peoples. The value of this pottery on the illegal antiquities market has led to extensive looting of sites."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D0%BE%D1%80%D0%B1%D0%B5%D1%80,_%D0%AF%D0%BA%D0%BE%D0%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Jakob_Lorber_%281800-1864%29.jpg","page_title":"Лорбер, Якоб","context_page_description":"Якоб Лорбер — австрийский музыкант, христианский мистик и духовидец, провозглашавший идеи универсализма."},{"page_url":"https://sw.wikipedia.org/wiki/Devanagari","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Rigveda_MS2097.jpg","page_title":"Devanagari","context_page_description":"Devanāgarī ni mwandiko unaotumiwa kwa kuandika lugha za Uhindi Kaskazini kama vile Sanskrit, Kibangla, Kihindi, Kimarathi, Kisindhi, Kibihari, Bhili au Kinepali cha Nepal. Wakati mwingine hata Kikashmiri huandikwa nayo.\\nDevanagari huhesabiwa kati ya miandiko ya Abugida inayounganisha alama kwa herufi na alama kwa silabi. Mwandiko mtangulizi wake ulikuwa mwandiko wa Brahmi."},{"page_url":"https://it.wikipedia.org/wiki/Saint-Barth%C3%A9lemy-le-Plain","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Saint_Barth%C3%A9l%C3%A9my_le_Plain.jpg","page_title":"Saint-Barthélemy-le-Plain","context_page_description":"Saint-Barthélemy-le-Plain è un comune francese di 792 abitanti situato nel dipartimento dell'Ardèche della regione dell'Alvernia-Rodano-Alpi."},{"page_url":"https://es.wikipedia.org/wiki/C%C3%A1mara_Santa_de_Oviedo","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Frontal_exterior_de_la_c%C3%A1mara_santa.JPG","page_title":"Cámara Santa de Oviedo","context_page_description":"La Cámara Santa es un edificio situado dentro del conjunto de la catedral de Oviedo, Principado de Asturias, España. Es de estilo prerrománico asturiano, construida en el siglo IX, siendo, junto con la Torre vieja, los edificios más antiguos de dicho conjunto catedralicio. Su función, prácticamente desde su construcción y que conserva en la actualidad, ha sido la de guarda de las reliquias y tesoro catedralicios, para cuya defensa fue construida la torre anteriormente citada.\\nSe articula en dos capillas superpuestas y sin comunicación entre ellas. La capilla inferior, llamada Cripta de Santa Leocadia, y la superior o Capilla de San Miguel, están ambas adosadas a una estructura cronológicamente anterior denominada Torre de San Miguel, hoy tan embebida en construcciones posteriores, que no es reconocible desde el exterior. En el siglo XII la Capilla de San Miguel sufrió una reforma consistente en la sustitución de la bóveda original de madera por una de cañón. En el interior las columnas añadidas para soportar la bóveda se decoraron con un apostolado románico, siendo éste desde entonces unos de los rasgos más característicos del edificio."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%98%BF%E5%B0%94%E6%89%98%E5%A4%A7%E5%AD%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Mathematics_lecture_at_the_Helsinki_University_of_Technology.jpg","page_title":"阿尔托大学","context_page_description":"阿尔托大学，是一所主要位于芬兰大赫尔辛基地区的大学，其由在各自领域内顶级的三所大学——赫尔辛基理工大学、赫尔辛基经济学院和赫尔辛基艺术设计大学合并而成。阿尔托大学于2010年1月1日开始运行。阿尔托大学首任创校校长为世界知名分子遗传学家，前瑞典皇家工学院副校长，图拉·泰里。"},{"page_url":"https://hy.wikipedia.org/wiki/%D4%BD%D5%B8%D6%80%D5%BE%D5%A1%D5%A9%D5%AB%D5%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Peristyle%2C_Split_1.jpg","page_title":"Խորվաթիա","context_page_description":"Խորվաթիա, պետություն Հարավարևելյան Եվրոպայում՝ Ադրիատիկ ծովի ափին։ Հյուսիս-արևելքում սահմանակցում է Հունգարիային, արևելքում՝ Սերբիային, հարավ-արևելքում՝ Բոսնիա Հերցեգովինային և Չեռնոգորիային, իսկ հյուսիս-արևմուտքում՝ Սլովենիային։ Մայրաքաղաքը Զագրեբն է, որը նաև երկրի քսան վարչատարածքային միավորներից՝ ժուպանություններից մեկն է։ Խորվաթիայի տարածքը կազմում է 56 594 կմ² է, իսկ բնակչությունը՝ ավելի քան 4 միլիոն մարդ։ Բնակչության ճնշող մեծամասնությունը խորվաթներն են, որոնք դավանում են կաթոլիկ քրիստոնեություն։\\nՀարավային սլավոնները Խորվաթիայի մերօրյա տարածքում հաստատվել են 6-րդ դարում և 9-րդ դարում այստեղ ստեղծել երկու անկախ իշխանություններ։ 925 թվականին Տոմիսլավ I-ի գահակալմամբ սկսվում է երկրի պատմության թագավորական շրջափուլը, որը շարունակվում է շուրջ երկու հազարամյակ։ Խորվաթիան իր հզորության գագաթնակետին հասնում է Պետար Կրեշիմիր IV-ի և Դմիտար Զվոնիմիրի կառավարման տարիներին, երբ խորվաթները տարածում են իրենց իշխանությունը Բալկանյան թերակղզու ամբողջ հյուսիսային շրջաններում։ 1102 թվականին Խորվաթիան դաշնային պետության ստեղծման մասին պայմանագիր է կնքում դաշնակից Հունգարիայի թագավորության հետ։"},{"page_url":"https://en.wikipedia.org/wiki/Macedonia_(theme)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/LocationMacedonia-BYZ-1-z.png","page_title":"Macedonia (theme)","context_page_description":"The Theme of Macedonia was a military-civilian province (theme) of the Byzantine Empire established between the late 8th century and the early 9th century. Byzantine Macedonia had no relation to the Ancient Macedonia but lay to the east in the modern region of Thrace. Its capital was Adrianople."},{"page_url":"https://cy.wikipedia.org/wiki/Lake_County,_Indiana","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Lake_County_Indiana_Courthouse.jpg","page_title":"Lake County, Indiana","context_page_description":"Sir yn nhalaith Indiana, Unol Daleithiau America yw Lake County. Cafodd ei henwi ar ôl Llyn Michigan. Sefydlwyd Lake County, Indiana ym 1837 a sedd weinyddol y sir yw Crown Point, Indiana.\\nMae ganddi arwynebedd o 1,622 cilometr sgwâr. Ar ei huchaf, mae'n 663 Troedfedd yn uwch na lefel y môr. Yn ôl cyfrifiad y wlad, poblogaeth y sir yw: 491,456. Mewn cymhariaeth, yn 2016 roedd poblogaeth Caerdydd yn 361,462 a Rhyl tua 26,000.\\nMae'n ffinio gyda Llyn Michigan, Newton County, Porter County, Jasper County, Cook County, Kankakee County, Will County. Ceir 9 cylchfa amser yn UDA, ac mae'r sir hon yn perthyn i'r cylchfa amser a elwir yn America/Chicago.\\nCeir sawl sir o’r un enw gan gynnwys:\\nLake County, Califfornia\\nLake County, Colorado\\nLake County, De Dakota\\nLake County, Florida\\nLake County, Illinois\\nLake County, Indiana\\nLake County, Michigan\\nLake County, Minnesota\\nLake County, Montana\\nLake County, Ohio\\nLake County, Oregon\\nLake County, Tennessee"},{"page_url":"https://es.wikipedia.org/wiki/Carlos_Garc%C3%ADa-Alix","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Carlos_Garcia-Alix_02_by-dpc.jpg","page_title":"Carlos García-Alix","context_page_description":"Carlos García-Alix es un escritor, pintor y cineasta español afincado en Madrid. En 2004 creó junto a su hermano Alberto García-Alix y el también fotógrafo Nicolás Combarro la productora “No hay penas”.​\\nHa desarrollado una paralela tarea de recopilación documental centrándose en la década de 1930 en España, que se refleja tanto en su pintura y obra gráfica como en la literaria y cinematográfica, y que ha denominado “novela pintada”, un proyecto que ha puesto en escena en obras como el libro Madrid-Moscú, o el lienzo Regreso a casa.​ Destaca su novela y luego largometraje-documental titulado El honor de las injurias, dedicados al tristemente titulado “Doctor Muñiz”, pistolero de CNT durante la guerra civil española, ​ obra premiada en la Semana Internacional de Cine de Valladolid en 2007.\\nTiene obra en el Museo Patio Herreriano de Arte Contemporáneo Español de Valladolid, la Colección Testimonio de La Caixa, el Museo Municipal de Arte Contemporáneo de Madrid, la Colección Laboratorios Salvat de Barcelona, el Museo Centro de Arte Faro de Cabo Mayor de Santander etc."},{"page_url":"https://it.wikipedia.org/wiki/Carlo_Egon_II_di_F%C3%BCrstenberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Amalie_von_Baden_%281795-1869%29.jpg","page_title":"Carlo Egon II di Fürstenberg","context_page_description":"Carlo Egon II di Fürstenberg fu nel 1804 principe sovrano di Fürstenberg e dal 1804 al 1854 principe titolare di Fürstenberg, nonché primo vicepresidente degli stati generali del Baden per 33 anni, dal 1819 al 1852."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%B5%A6%E9%A0%85%E6%88%B0%E5%BD%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/South_Koreans_at_Pusan.jpg","page_title":"浦項戰役","context_page_description":"浦项战役是1950年8月5日一场在大韩民国庆尚北道浦项市爆发的战役，为朝鲜战争的早期战役之一；战役中，以美军与大韩民国国军为主的联合国军试图阻止朝鲜人民军三个师经由朝鲜半岛东南部的山区入侵韩国。这场战役是釜山环形防御圈战役的一部分，也是当时少数的大规模交战。最终，战役在联合国军成功阻止人民军的企图后，以前者胜利告终。\\n作为釜山环形防御圈的一部分，大韩民国陆军在美国海军与美国空军的火力支援下戍守该国东部海岸。1950年8月，朝鲜人民军的数个师取道山区南下，试图驱离守卫该地的联合国军队，攻守双方随后就在浦项展开激烈的战斗；而浦项则是驻扎在大邱的联合国军主力的重要补给据点。\\n在为期两周的战斗中，人民军与国军的地面部队在浦项周遭爆发了数场血腥的拉锯战，据点与领土数度易手，但却无任何一方占有优势。最终，人民军因补给线崩溃与急遽增加的伤亡人数，无力再战，因而被迫撤退。\\n对朝鲜人民军而言，该战役是战争中的重要转捩点。此役之前，其凭借着装备与数量上的优势，屡战屡胜；但却也因部队推进过于迅速，补给线越拉越长，并在浦项战役爆发时超出补给能力负荷，最终导致战线崩溃。"},{"page_url":"https://es.wikipedia.org/wiki/M%C3%B6rel","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/31/Moerel_in_RD.png","page_title":"Mörel","context_page_description":"Mörel es un municipio situado en el distrito de Rendsburg-Eckernförde, en el estado federado de Schleswig-Holstein, con una población a finales de 2016 de unos 235 habitantes.​\\nSe encuentra ubicado en el área centro-este del estado, cerca de las ciudades independientes de Schleswig y Kiel, de la costa del mar Báltico y del canal de Kiel."},{"page_url":"https://sv.wikipedia.org/wiki/Alatanadata_latipennis","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/07-Alatanadata_latipennis_Strand%2C_1912.JPG","page_title":"Alatanadata latipennis","context_page_description":"Alatanadata latipennis är en fjärilsart som beskrevs av Embrik Strand 1912. Alatanadata latipennis ingår i släktet Alatanadata och familjen tandspinnare. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://nl.wikipedia.org/wiki/Waterkrachtcentrale_Maurik","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Centralemaurik.jpg","page_title":"Waterkrachtcentrale Maurik","context_page_description":"De Waterkrachtcentrale Maurik werd in 1988 gebouwd door de PGEM direct ten zuiden van het Stuw- en sluizencomplex Amerongen. De stuw in de Nederrijn bij Amerongen zorgt voor een hoogteverschil van maximaal 4 meter en daar maakt de Waterkrachtcentrale Maurik gebruik van. Deze centrale heeft een vermogen van 10 MW opgewekt door 4 Kaplan waterturbines, ieder gekoppeld aan een generator van 2530 kW. Jaarlijks produceert de centrale gemiddeld 20-24 GWh elektriciteit. Dat is genoeg voor ongeveer 7.000 huishoudens."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_onroerend_erfgoed_in_Bredene","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Zeelaan_6_Bredene.jpg","page_title":"Lijst van onroerend erfgoed in Bredene","context_page_description":"Een overzicht van het onroerend erfgoed in de gemeente Bredene. Het onroerend erfgoed maakt deel uit van het cultureel erfgoed in België."},{"page_url":"https://tl.wikipedia.org/wiki/Paliparang_Pandaigdig_ng_Francisco_Bangoy","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Davao_Air_Traffic.jpg","page_title":"Paliparang Pandaigdig ng Francisco Bangoy","context_page_description":"Ang Paliparang Pandaigdig ng Francisco Bangoy IATA: DVO, ICAO: RPMD, at kilala bilang Paliparang Pandaigdig ng Dabaw, at tinagurian ring Davao Airport ay isang paliparang pandaigdig na naglilingkod sa pangkalahatang kalakhan ng Lungsod ng Dabaw sa Pilipinas. Ito ang pinakamalaking paliparan sa Mindanao ayon sa trapiko. Unang binuksan ang paliparan noong dekada 1940, at binuksan ang kasalukuyang gusaling terminal nito noong 2003."},{"page_url":"https://da.wikipedia.org/wiki/Ed_Begley,_Jr.","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/EdBegleyJrAAFeb09.jpg","page_title":"Ed Begley, Jr.","context_page_description":"Edward James Begley, Jr. er en amerikansk skuespiller og miljøforkæmper, der bl.a. har spillet med i film som Hun-djævelen, Batman Forever og Pineapple Express. Han er dog nok mest kendt for sin rolle i tv-serien St. Elsewhere fra 1982 til 1988, for hvilken han blev nomineret til en Emmy Award hele seks gange i træk."},{"page_url":"https://pl.wikipedia.org/wiki/%C3%89milie_du_Ch%C3%A2telet","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Emilie_du_Chatelet.jpg","page_title":"Émilie du Châtelet","context_page_description":"Émilie du Châtelet //, jedna z najwybitniejszych kobiet XVIII wieku, matematyczka, fizyczka i pisarka francuska, przyjaciółka Voltaire’a.\\nByła jedną z nielicznych znanych do XIX wieku kobiet-uczonych, zajmujących się naukami ścisłymi."},{"page_url":"https://de.wikipedia.org/wiki/Castillo_de_San_Felipe_de_Menorca","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Castell_de_Sant_Felip.jpg","page_title":"Castillo de San Felipe de Menorca","context_page_description":"Castillo de San Felipe ist eine spanische Festung aus dem 16. Jahrhundert am Südufer der Mündung des Hafens von Mahón, im Gemeindegebiet von Es Castell auf der Baleareninsel Menorca.\\nDie Burg wurde im Stil einer Bastion gebaut, um den periodischen Angriffen des türkischen Geschwaders im westlichen Mittelmeer entgegenzuwirken, das Menorca zweimal in etwas mehr als zwanzig Jahren angriff. Während der britischen Besetzung von Menorca, diente es als Marinearsenal zur Unterstützung der anderen britischen Kolonie auf spanischem Territorium."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%9B%8D%E7%9B%9B%E8%8B%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Yung_Shing_Shopping_Centre_%28clear_view_and_without_cloud%29.jpg","page_title":"雍盛苑","context_page_description":"雍盛苑是香港兼作公共屋邨及居者有其屋的屋苑，由房屋署總建築師設計，有利集團施工，位於新界北區粉嶺暉明路8號，鄰近昌盛苑、暉明邨及華明邨，屋苑於1997年7月開始興建，1999年12月尾完工，2000年3月29日正式入伙。\\n雍薈閣為透過可租可買計劃下所出售之居者有其屋屋苑，於2000年落成，首次推出時售價為258,300-1,015,800港元。"},{"page_url":"https://la.wikipedia.org/wiki/Suscitabulum","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/2010-07-20_Black_windup_alarm_clock_face.jpg","page_title":"Suscitabulum","context_page_description":"Suscitabulum seu horologium excitatorium seu horologium suscitatorium est horologium cui est usor ex somno tempore praedestinato excitandus. Plerumque ad hoc sono adhibentur, aliquae autem radiophonium incitat ad usorem expergefaciendum. Hodie etiam telephonula ex somno excitandi capacia sunt."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9A%CE%B1%CF%84%CE%AC%CE%BB%CE%BF%CE%B3%CE%BF%CF%82_%CE%AD%CF%81%CE%B3%CF%89%CE%BD_%CF%84%CE%BF%CF%85_%CE%A1%CE%AD%CE%BC%CF%80%CF%81%CE%B1%CE%BD%CF%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Rembrandt%2C_Self_Portrait_at_the_Age_of_34.jpg","page_title":"Κατάλογος έργων του Ρέμπραντ","context_page_description":"Ο κατάλογος αυτός περιλαμβάνει πίνακες ζωγραφικής του Ρέμπραντ των οποίων η αυθεντικότητα είναι αποδεκτή από το ερευνητικό πρόγραμμα Rembrandt Research Project. Ειδικότερα, περιέχονται αυθεντικά έργα με βάση την έκτη αναθεωρημένη έκδοση του προγράμματος."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%B0%87%E8%BB%8D%E6%BE%B3%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Tseung_Kwan_O_Station_2018_05_part1.jpg","page_title":"將軍澳站","context_page_description":"將軍澳站是香港港鐵將軍澳綫的一個地下車站，位於新界西貢區將軍澳市中心寶邑路一帶，於2002年8月18日正式啟用。"},{"page_url":"https://en.wikipedia.org/wiki/Thomas_S._James_Jr.","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/LTG_Thomas_James%2C_Jr..jpg","page_title":"Thomas S. James Jr.","context_page_description":"Lieutenant General Thomas S. James Jr. is a United States Army Officer who currently serves as Commanding General of First United States Army headquartered at Rock Island Arsenal, Illinois; he assumed his present position on October 29, 2018 after having served as Deputy Chief of Staff for United Nations Command/Combined Forces Command/United States Forces Korea."},{"page_url":"https://en.wikipedia.org/wiki/Makaa_people","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Maka-Njem_ethnic_groups.png","page_title":"Makaa people","context_page_description":"The Maka or Makaa are a Bantu ethnic group inhabiting the southern rain forest zone of Cameroon. They live primarily in the northern portions of the Upper Nyong division of Cameroon's East Province. Major Maka settlements include Abong-Mbang, Doumé, and Nguélémendouka. Some Maka villages lie over the border into the Centre Province, as well.\\nMost Maka speak a language known as Maka or South Maka, which had an estimated 80,000 speakers in 1987. In the north of Maka territory, speakers use a related language known as Byep, or North Maka. Byep had an estimated 9,500 speakers in 1988. Though they consider themselves a single people, Maka dialects serve as a form of identity as well. The main dialects are Maka are Bebent, Mbwaanz, and Sekunda. Byep has two dialects, Byep and Besep."},{"page_url":"https://it.wikipedia.org/wiki/Cameron_Donald","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Supersport_TT_race1_IMG_0639.JPG","page_title":"Cameron Donald","context_page_description":"Cameron Donald è un pilota motociclistico australiano.\\nLa sua carriera nel mondo del motociclismo è iniziata con le gare di dirt track per passare in seguito alle competizioni in circuito destinate alle derivate di serie delle Supersport. Per i primi anni la sua carriera si è svolta soprattutto in Australia con alcune partecipazioni in competizioni nel sud-est asiatico.\\nNel 2004 si verificano le sue prime apparizioni anche nel campionato britannico delle Supersport e, negli anni seguenti, si presenta al via di alcune classiche competizioni che si svolgono sul suolo britannico come la North West 200, il Tourist Trophy e il GP dell'Ulster.\\nNel 2006 e nel 2007 ha gareggiato con motociclette Honda del team Uel Duncan, per passare nel 2008 alla guida di Suzuki del team Relentless\\nIn questa annata riesce ad ottenere i suoi primi successi al Tourist Trophy, sia nella categoria Superbike che nella Superstock. Il suo rapporto con lo stesso team è continuato anche nel 2009 e 2010."},{"page_url":"https://pt.wikipedia.org/wiki/Kashima_Antlers","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Trofeo_Alusivo_a_la_Suruga_Bank.png","page_title":"Kashima Antlers","context_page_description":"O Kashima Antlers F.C. é um clube de futebol japonês. A equipe participa da primeira divisão japonesa, e é o clube mais vezes campeão da J-League, tendo conquistado oito títulos."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Wappen_in_der_St%C3%A4dteregion_Aachen","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/AachenerWappen_1721a.jpg","page_title":"Liste der Wappen in der Städteregion Aachen","context_page_description":"Die Liste der Wappen in der Städteregion Aachen zeigt alle Wappen in der Städteregion Aachen in Nordrhein-Westfalen, einschließlich historischer Wappen."},{"page_url":"https://de.wikipedia.org/wiki/St._Marcellinus_und_Petrus_(Seligenstadt)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Seligenstadt_St_Marcellinus_und_Petrus_W.jpg","page_title":"St. Marcellinus und Petrus (Seligenstadt)","context_page_description":"Die Kirche St. Marcellinus und Petrus liegt in Seligenstadt in Hessen. Sie war ursprünglich die Kirche des Klosters Seligenstadt und wurde nach dessen Säkularisation zur Pfarrkirche."},{"page_url":"https://sk.wikipedia.org/wiki/Honda_Accord","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/89_SE-i_-_Dash.jpg","page_title":"Honda Accord","context_page_description":"Honda Accord je automobil strednej triedy, ktorý od roku 1976 vyrába japonská automobilka Honda. Najznámejší je variant 4-dverový sedan, ktorý je v USA jedným z najpredávanejších automobilov od roku 1989. Názov Accord bol používaný aj na vozidlá karosérií kupé, kombi, liftback či crossover.\\nV roku 1982 sa stal model Accord prvým japonským automobilom, ktorý sa začal vyrábať v USA, konkrétne v Marysville v štáte Ohio. Model Accord mal najväčší úspech v USA, kde medzi rokmi 1991 až 2001 bolo predaných okolo 10 miliónov kusov tohto automobilu. Množstvo vykonaných cestných testov, či už v minulosti alebo v súčasnosti urobili z modelu Accord jeden z najspoľahlivejších automobilov na svete. V zozname 10Best časopisu Car and Driver sa model Accord objavil rekordne 30-krát.\\nOd uvedenia modelu Accord do výroby, automobilka Honda ponúkala veľa jeho karosárskych variantov. V roku 1976 debutoval ako kompaktný hatchback, ale v roku 1989 sa rozšírila ponuka o varianty sedan, kupé a kombi."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkmale_in_Brandenburg_an_der_Havel","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d7/Brandenburg_Kurstra%C3%9Fe_64.jpg","page_title":"Liste der Baudenkmale in Brandenburg an der Havel","context_page_description":"Die Liste der Baudenkmale in Brandenburg an der Havel führt alle Baudenkmale im inneren Teil des Stadtgebiets von Brandenburg an der Havel auf. Grundlage ist die Veröffentlichung der Landesdenkmalliste mit dem Stand vom 31. Dezember 2019.\\nDie Baudenkmale in den Außenbereichen der Stadt sind in der Liste der Baudenkmale in Brandenburg an der Havel enthalten. Die Baudenkmale in den eingemeindeten Orten befinden sich in der Liste der Baudenkmale in Brandenburg an der Havel. Die Bodendenkmale sind in der Liste der Bodendenkmale in Brandenburg an der Havel aufgeführt."},{"page_url":"https://sk.wikipedia.org/wiki/Rebr%C3%AD%C4%8Dek_IIHF","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/IIHF_Women%27s_World_Ice_Hockey_Ranking.png","page_title":"Rebríček IIHF","context_page_description":"Rebríček IIHF je poradie národných hokejových mužstiev členských krajín IIHF. Určuje sa podľa neho nasadenie krajín do základných skupín majstrovstiev sveta a do olympijského turnaja, resp. olympijskej kvalifikácie. Bol schválený na kongrese IIHF v septembri 2003 a podľa prezidenta IIHF Reného Fasela bol navrhnutý tak, aby bol jednoduchý na pochopenie a aby odrážal dlhodobú kvalitu jednotlivých tímov."},{"page_url":"https://fi.wikipedia.org/wiki/Meleuzin_piiri","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fe/Coat_of_Arms_of_Meleuz_rayon_%28Bashkortostan%29.png","page_title":"Meleuzin piiri","context_page_description":"Meleuzin piiri on kunnallinen itsehallintoalue Baškortostanin tasavallan eteläosassa Venäjällä. Piirin hallinnollinen keskus on Meleuzin kaupunki, jonka lisäksi piiriin kuuluu 16 maalaiskuntaa. Piiri on perustettu vuonna 1930.\\nMäläüezin piirin pinta-ala on 3 254 km². Piirin asukasluku on noin 27 000 ja asukastiheys 8,3 asukasta/km². Suurimmat etniset ryhmät ovat baškiirit, venäläiset ja tataarit."},{"page_url":"https://af.wikipedia.org/wiki/10_Hygiea","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Iau_dozen.jpg","page_title":"10 Hygiea","context_page_description":"Hygiea is ’n groot asteroïde in die asteroïdegordel. Met ’n deursnee van 434 km en ’n massa wat geraam word op 2,9% van die totale massa van die gordel, is dit die vierde grootste asteroïde in die Sonnestelsel wat volume én massa betref. In sommige spektrale klassifikasies is dit die grootste van die donker C-tipe asteroïdes met ’n koolstofryke oppervlak; in ander is dit die tweede grootste, naas 1 Ceres.\\nHygiea is die hooflid van die Hygiea-familie en bevat meer as 90% van die massa van die familie. Volgens data van die Baie Groot Teleskoop se SPHERE-kamera in 2017 en 2018 wat laat in 2019 aangekondig is, het Hygiea ’n byna ronde vorm, wat daarop dui dit is in hidrostatiese ewewig en dus ’n kandidaat vir ’n dwergplaneet."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A7%D7%A8%D7%92%D7%95%D7%99%D7%99%D7%91%D7%A5","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Kragujevac-_Muzej_21_oktobar.jpg","page_title":"קרגוייבץ","context_page_description":"קרגוייבץ היא עיר במרכז סרביה. העיר משמשת כמרכז המנהלי של מחוז שומדייה. העיר הרביעית בגודלה אחרי בלגרד, נובי סאד ו-ניש. ממוקמת בנהר לפיצה.\\nהוקמה בשנת 1476. העיר ידועה בשל התחמושת, הנשק ותעשיית המכוניות של מפעל זסטבה אשר ייצר את מכוניות היוגו, פלורידה, זסטבה 10, וסקאלה מכוניות.\\nאוניברסיטת קרגווייבץ ממוקמת גם בעיר. האוניברסיטה הראשונה לאחר עצמאות סרביה נוסדה בעיר הזו ב-1838 וכן בה\\"ס הראשון התיכון גימנסיה, מכונת הדפוס, התיאטרון הובית הספר הצבאי ב-1837.\\nבין התקופות 1818 -1839 הייתה קרגוייבץ עיר הירה של סרביה תחת שלטונו של מילוש אוברנוביץ'."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%8D%97%E3%82%A2%E3%83%95%E3%83%AA%E3%82%AB%E8%AD%A6%E5%AF%9F_(1913%E5%B9%B4-1994%E5%B9%B4)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Badge_of_the_South_African_Police.gif","page_title":"南アフリカ警察 (1913年-1994年)","context_page_description":"南アフリカ警察は、1913年から1994年にかけての南アフリカ連邦の国家警察および法執行機関。1939年から1981年まで南西アフリカにおいても事実上の警察として機能した。"},{"page_url":"https://zh.wikipedia.org/wiki/%E6%B2%BB%E5%AE%B6%E5%85%A8%E6%9B%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/%E5%AD%9D%E5%A5%B3%E8%8F%AF%E5%90%9F%E6%A2%85%E5%A5%B3%E5%A3%AB%E8%82%96%E5%83%8F.jpg","page_title":"治家全書","context_page_description":"治家全書，高劍華編，張謇題寫書名，民國8年6月於上海交通圖書館出版。此書內容有貞烈女傳記、詩文、婚姻、交際、家政及醫藥等。"},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_kulturn%C3%ADch_pam%C3%A1tek_v_%C4%8Cesk%C3%A9m_Krumlov%C4%9B_-_Vnit%C5%99n%C3%AD_M%C4%9Bsto","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/%C4%8Cesk%C3%BD_Krumlov%2C_m%C4%9B%C5%A1%C5%A5ansk%C3%BD_d%C5%AFm%2C_K%C3%A1jovsk%C3%A1_%C4%8Dp.55.JPG","page_title":"Seznam kulturních památek v Českém Krumlově - Vnitřní Město","context_page_description":"Tento seznam nemovitých kulturních památek v části Vnitřní Město ve městě Český Krumlov v okrese Český Krumlov vychází z Ústředního seznamu kulturních památek ČR, který na základě zákona č. 20/1987 Sb., o státní památkové péči, vede Národní památkový ústav jako ústřední organizace státní památkové péče. Údaje jsou průběžně upřesňovány, přesto mohou obsahovat i řadu věcných a formálních chyb a nepřesností či být neaktuální.\\nPokud byly některé části dotčeného území vyčleněny do samostatných seznamů, měly by být odkazy na tyto dílčí seznamy uvedeny v úvodu tohoto seznamu nebo v úvodu příslušné sekce seznamu."},{"page_url":"https://de.wikipedia.org/wiki/Asseburg_(Burg)","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/73/Asseburg_Merian.png","page_title":"Asseburg (Burg)","context_page_description":"Die Asseburg ist die Ruine einer Höhenburg auf einem schmalen Bergkamm des Höhenzuges Asse unweit Wolfenbüttel. Die Burg entstand zwischen 1218 und 1223 unter Gunzelin von Wolfenbüttel als Ganerbenburg. Von den Ausmaßen war sie die größte Höhenburg Norddeutschlands und galt als uneinnehmbar. Seit 1492 ist die Asseburg eine Ruine, da sie im Zuge einer Fehde von der eigenen Burgbesatzung aufgegeben und in Brand gesteckt wurde."},{"page_url":"https://de.wikipedia.org/wiki/Aarre_Simonen","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Emil-Skog-1957.jpg","page_title":"Aarre Simonen","context_page_description":"Aarre Edvard Simonen war ein finnischer Politiker der Sozialdemokratischen Partei Finnlands SDP sowie später des Sozialdemokratischen Bundes der Arbeiter- und Kleinbauernschaft TPSL, der unter anderem mehrmals Minister verschiedener Ressorts sowie zwischen 1964 und 1970 Vorsitzender des TPSL war."},{"page_url":"https://fr.wikipedia.org/wiki/F%C3%AAte_de_la_Gastronomie","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Sylvia_Pinel_et_Thierry_Marx.png","page_title":"Fête de la Gastronomie","context_page_description":"La Fête de la Gastronomie - Goût de France est une initiative du Ministère de l'Économie lancée en 2011, proposée comme une mesure de sauvegarde majeure au repas gastronomique français inscrit sur la Liste représentative du patrimoine culturel immatériel de l’humanité en 2010 par l’UNESCO. Elle a lieu partout en France et dans le monde le quatrième weekend de septembre. Durant trois jours, des manifestations ont lieu dans un esprit de convivialité, de partage et de pédagogie : en effet, le repas gastronomique met l’accent sur le plaisir du goût et du partage du repas, soulignant l’harmonie entre l’homme et les productions de la nature. La Fête de la Gastronomie se déroule dans un esprit de célébration de la tradition culinaire et de préservation du patrimoine gastronomique français.\\nCette année représente une nouvelle étape pour la Fête de la Gastronomie. Comme annoncé par le Président de la République le 4 décembre dernier, un plan d’actions « Goût de France/Good France » est soutenu par le gouvernement afin de faire rayonner à l’étranger l’excellence de notre gastronomie."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%86%DA%A9%D8%A7%D9%88%DA%A9_%DB%8C%DA%A9%D9%86%D9%88%D8%A7%D8%AE%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Mirafra_passerina.jpg","page_title":"چکاوک یکنواخت","context_page_description":"چکاوک یکنواخت نام یک گونه از سرده جل‌ها است."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B3%D9%88%D8%B1%D8%A9_%D8%A7%D9%84%D9%83%D9%87%D9%81_(%D8%B1%D9%85%D8%B2%D9%8A%D8%A9)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Seven-sleepers_efesus_turkey.jpg","page_title":"سورة الكهف (رمزية)","context_page_description":"رَمزيَّة التحوُّل في سورَة الكهف، العنوان الفرعي هي مقالة كتبها عالم النفس السويسري كارل غوستاف يونغ يحلل فيها رمزية سورة الكهف النفسية/الروحية من حيثية أنها ترمز إلى موضوع نفسي/روحي مهم ألَا وهو التحول السيكولوجي للإنسان، وبأنَّ موضوع سر هو الذي تركز عليه السورة، وأنَّ هو مكان هذه الولادة، حيث قال كارل يونغ في هذا الخصوص: \\"يستأثر بالسورة كلِّها سر الولادة الثانية أو الجديدة، و\\"الكهف\\" هو مكان هذه الولادة: ذلك التجويف السرِّي الذي يُغلَقُ فيه على المرء حيث تتم حضانتُه وتجديدُه\\"."},{"page_url":"https://vi.wikipedia.org/wiki/Th%E1%BB%8Bt_tr%C3%A2u","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Qurban_in_Pekanbaru_%284%29.JPG","page_title":"Thịt trâu","context_page_description":"Thịt trâu là thịt của các loài trâu nhà. Thịt trâu là nguồn thực phẩm quan trọng đối với các cư dân vùng Nam Á và Đông Nam Á nơi người ta nuôi trâu phổ biến. Về giá trị dinh dưỡng, thịt trâu không hề thua kém những loại thịt khác như thịt bò hay thịt heo, thậm chí còn có phần ưu thế hơn như thịt trâu có ưu điểm ít mỡ, hàm lượng sắt cao, có tính hàn nhưng không độc, thích hợp để chế biến món ăn trong mùa nóng. Thịt trâu cùng sừng trâu, sữa trâu, răng trâu, nhiều bộ phận khác như da trâu, nội tạng gan, lá lách, dạ dày trâu đều được dùng. So với thịt bò thì thực tế thịt trâu và thịt bò có giá trị dinh dưỡng và độ ngon cũng ngang nhau."},{"page_url":"https://en.wikipedia.org/wiki/Forest_elaenia","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Forest_Elaenia.jpg","page_title":"Forest elaenia","context_page_description":"The forest elaenia is a small passerine bird in the tyrant flycatcher family. It breeds from Panama through Colombia, Venezuela and the Guianas to Bolivia and Brazil. It also occurs on Trinidad.\\nThis species is found in forests and the edges of mangrove swamps. The nest is a shallow cup of roots, bark and grass built in a tree. The typical clutch is two cream-coloured eggs marked with rufous and lavender.\\nThe adult forest elaenia is 12.7 cm long and weighs 12.2g. The head has a blackish crown with a partly concealed white or pale yellow central stripe, a weak whitish supercilium and white eyering. The upperparts are olive-green, and the brown wings have yellow feather edging and two yellow wing bars. The throat is whitish and the breast is greenish-yellow shading to yellow on the belly. The long narrow bill is black above and pink-based below. Sexes are similar.\\nM. g. trinitatis, the subspecies endemic to Trinidad, is larger and has duller upper parts than mainland forms.\\nForest elaenias are seen alone or in pairs, perched inconspicuously or catching insects and spiders in higher levels of the foliage. They also frequently eat berries. They have a sharp pitch-weep call."},{"page_url":"https://bg.wikipedia.org/wiki/Libellago_lineata","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Damselfly_fem_amarpur_Tripura_2009_11_20_9_71_1_%284456412601%29_%28cropped%29.jpg","page_title":"Libellago lineata","context_page_description":"Libellago lineata е вид водно конче от семейство Chlorocyphidae. Видът не е застрашен от изчезване."},{"page_url":"https://fr.wikipedia.org/wiki/Technorama","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Technorama_the_Atomar_Zoo.JPG","page_title":"Technorama","context_page_description":"Le Technorama, est un musée consacré à la science et à la technique situé, à Winterthour, en Suisse."},{"page_url":"https://de.wikipedia.org/wiki/St._Rasso_(Schweinegg)","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/df/Kapelle-Schweinegg_Hl-Rasso.jpg","page_title":"St. Rasso (Schweinegg)","context_page_description":"St. Rasso steht am Ortseingang des Weilers Schweinegg, einem Ortsteil der Gemeinde Eisenberg. Die Kapelle gehört zur Pfarrgemeinde St. Moritz in Zell."},{"page_url":"https://es.wikipedia.org/wiki/Ch%C3%A2tas","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Ch%C3%A2tas_88210.jpg","page_title":"Châtas","context_page_description":"Châtas es una población y comuna francesa, en la región de Lorena, departamento de Vosgos, en el distrito de Saint-Dié-des-Vosges y cantón de Senones."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B0%D0%BC%D1%8F%D1%82%D0%BD%D0%B8%D0%BA_%D0%A1%D1%82%D0%B0%D0%BB%D0%B8%D0%BD%D1%83_(%D0%93%D0%BE%D1%80%D0%B8)","image_url":"https://upload.wikimedia.org/wikipedia/ru/d/da/Stalin_monument_gori.JPG","page_title":"Памятник Сталину (Гори)","context_page_description":"Памятник Сталину в Гори — скульптурное произведение, посвящённое генералиссимусу Советского Союза И. В. Сталину.\\nБыл расположен на родине Сталина перед мэрией города."},{"page_url":"https://ca.wikipedia.org/wiki/Benzo(a)pir%C3%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Benzo%28a%29pyrene_numbered.png","page_title":"Benzo(a)pirè","context_page_description":"El Benzo(a)pirè, en anglès: Benzo[a]pyrene és un hidrocarbur aromàtic policíclic que es troba en el quitrà d'hulla i té la fórmula C₂₀H₁₂. Els seus metabolits són mutagènics i altament carcinògens. Aquest compost és un dels benzopirens, formats per una anell de benzè fusionat amb el pirè, i és el resultat d'una combustió incompleta a temperatures entre 300 i 600 °C.\\nAl segle XVIII els jovenets escuracxemeneies patien d'un carcinoma escrotal peculiar de la seva professió el qual va ser connectat amb aquest tipus de càncer, pels efectes del sutge, l'any 1775. El benzo[a]pirè s'ha identificat com el carcinogen principal de les cigarretes de tabac."},{"page_url":"https://fr.wikipedia.org/wiki/101e_r%C3%A9giment_d%27infanterie","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/101_e_RI_1812_av.png","page_title":"101e régiment d'infanterie","context_page_description":"Le 101ᵉ régiment d'infanterie est un régiment d'infanterie de l'Armée de terre française créé sous la Révolution à partir du régiment Royal-Liégeois, un régiment français d'Ancien Régime."},{"page_url":"https://it.wikipedia.org/wiki/Heroes_Reborn","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Sendhil_Ramamurthy_%281%29.jpg","page_title":"Heroes Reborn","context_page_description":"Heroes Reborn è una miniserie televisiva statunitense trasmessa sulla NBC dal 24 settembre 2015 al 21 gennaio 2016.\\nSi tratta di un sequel, presentato anche come reboot, della serie di fantascienza Heroes, trasmessa tra il 2006 e il 2010 dalla stessa emittente, con nuovi protagonisti e una nuova storia che si rifà alla prima stagione della serie madre, pur essendo ambientata dopo gli eventi della sua quarta e ultima stagione. La trama vede infatti protagonisti varie persone, apparentemente non legate tra di loro, che vedono la propria vita quotidiana sconvolta dall'essere in possesso di capacità paranormali. Tali \\"umani evoluti\\", si ritrovano quindi coinvolti in un'epica lotta tra bene e male, tra chi cerca di usare i loro poteri sovrumani a fin di bene e chi fa l'opposto, mentre altri danno loro la caccia allo scopo di neutralizzarli, ucciderli o sfruttare a proprio piacimento le loro abilità.\\nIl cast principale include Zachary Levi, Judith Shekoni, Kiki Sukezane, Robbie Kay, Danika Yarosh, Rya Kihlstedt, Henry Zebrowski e Jack Coleman, già protagonista di Heroes, mentre altri personaggi della serie originale figurano tra le guest star."},{"page_url":"https://en.wikipedia.org/wiki/Civil_parishes_in_Bedfordshire","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/St._Giles%2C_Totternhoe_-_geograph.org.uk_-_193383.jpg","page_title":"Civil parishes in Bedfordshire","context_page_description":"A civil parish is a country subdivision, forming the lowest unit of local government in England. There are 125 civil parishes in the ceremonial county of Bedfordshire, most of the county being parished: Luton is completely unparished; Central Bedfordshire is entirely parished. At the 2001 census, there were 312,301 people living in the 125 parishes, which accounted for 55.2 per cent of the county's population."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%B0%B8%E7%8F%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Pha_That_Luang%2C_Vientiane%2C_Laos.jpg","page_title":"永珍","context_page_description":"万象，香港、澳门、新加坡、台湾：永珍，是老挝的首都和最大城市，位于湄公河畔，隔湄公河与泰国的廊开府相望。\\n1563年，澜沧王国的塞塔提腊王将其确定为首都，澜沧分裂后，成为万象王国的首都。1827年被暹罗军队掠夺，长期处于荒芜状态，直至1899年才获得重建。"},{"page_url":"https://de.wikipedia.org/wiki/Bahnhof_Igersheim","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Igersheim2.JPG","page_title":"Bahnhof Igersheim","context_page_description":"Der Bahnhof Igersheim und heutige Haltepunkt Igersheim ist eine Betriebsstelle der Bahnstrecke Crailsheim–Königshofen. Er liegt in Igersheim im Main-Tauber-Kreis in Baden-Württemberg."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%81%AA%E3%81%94%E3%81%BF%E3%81%AE%E5%A1%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Nagomi_no_Tou_01.jpg","page_title":"なごみの塔","context_page_description":"なごみの塔は、沖縄県八重山郡竹富町字竹富にある展望塔である。2006年3月27日に国の登録有形文化財に登録されている。老朽化のために閉鎖されており、登り降りはできない。"},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_kulturn%C3%ADch_pam%C3%A1tek_v_okrese_Klatovy","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Slavo%C5%A1ovice%2C_kapli%C4%8Dka_v_ohradn%C3%AD_zdi_%C4%8Dp.10.jpg","page_title":"Seznam kulturních památek v okrese Klatovy","context_page_description":"Tento seznam nemovitých kulturních památek v okrese Klatovy vychází z Ústředního seznamu kulturních památek ČR, který na základě zákona č. 20/1987 Sb., o státní památkové péči, vede Národní památkový ústav jako ústřední organizace státní památkové péče. Údaje jsou průběžně upřesňovány, přesto mohou obsahovat i řadu věcných a formálních chyb a nepřesností či být neaktuální.\\nPokud byly některé části dotčeného území vyčleněny do samostatných seznamů, měly by být odkazy na tyto dílčí seznamy uvedeny v úvodu tohoto seznamu nebo v úvodu příslušné sekce seznamu.\\nSeznam kulturních památek v Běšinách včetně částí Hořákov, Rajské a Úloh\\nSeznam kulturních památek v Bezděkově včetně části Tetětice\\nSeznam kulturních památek v Břežanech\\nSeznam kulturních památek v Čachrově včetně částí Březí, Chvalšovice, Javorná, Jesení, Kunkovice, Svinná a Zahrádka\\nSeznam kulturních památek v Dlouhé Vsi včetně částí Annín, Bohdašice, Janovice a Platoř\\nSeznam kulturních památek v Dobršíně\\nSeznam kulturních památek v Dolanech včetně částí Balkovy, Komošín, Malechov, Řakom a Svrčovec"},{"page_url":"https://en.wikipedia.org/wiki/Roti","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Roti_Style_Paratha.jpg","page_title":"Roti","context_page_description":"Roti is a round flatbread native to the Indian subcontinent made from stoneground wholemeal flour, traditionally known as atta, and water that is combined into a dough. Roti is consumed in many countries worldwide. Its defining characteristic is that it is unleavened. Naan from the Indian subcontinent, by contrast, is a yeast-leavened bread, as is kulcha. Like breads around the world, roti is a staple accompaniment to other foods."},{"page_url":"https://fi.wikipedia.org/wiki/2010","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Royal_Wedding_Stockholm_2010-Slottsbacken-03.jpg","page_title":"2010","context_page_description":"2010 oli normaalivuosi, joka alkoi perjantaista.\\nYhdistyneet kansakunnat nimesi vuoden 2010 kansainväliseksi luonnon monimuotoisuuden vuodeksi."},{"page_url":"https://en.wikipedia.org/wiki/Hi%C3%A8res-sur-Amby","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2f/Hi%C3%A8res-sur-Amby.jpg","page_title":"Hières-sur-Amby","context_page_description":"Hières-sur-Amby is a commune in the Isère department in southeastern France."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9A%D0%B0%D1%82%D0%B0%D1%80%D0%B8%D0%BD%D0%B0_%D1%84%D0%BE%D0%BD_%D0%9C%D0%B0%D0%BD%D1%81%D1%84%D0%B5%D0%BB%D0%B4-%D0%A5%D0%B8%D0%BD%D1%82%D0%B5%D1%80%D0%BE%D1%80%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/V6_pg123_Schloss_Mannsfeld.jpg","page_title":"Катарина фон Мансфелд-Хинтерорт","context_page_description":"Катарина фон Мансфелд-Хинтерорт е графиня от Мансфелд-Хинтерорт и чрез женитба графиня на Мансфелд-Айзлебен.\\nТя е дъщеря на граф Албрехт VII фон Мансфелд-Хинтерорт и съпругата му графиня Анна фон Хонщайн-Клетенберг, дъщеря на Ернст IV фон Хонщайн-Клетенберг и Фелицитас фон Байхлинген.\\nКатарина фон Мансфелд-Хинтерорт умира на 26 май 1582 г. и е погребана в Св. Андреас, Айзлебен."},{"page_url":"https://oc.wikipedia.org/wiki/Paul_Greengard","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Paul_Greengard.jpg","page_title":"Paul Greengard","context_page_description":"Paul Greengard es un mètge american. Recebèt lo Prèmi Nobel de Fisiologia o Medecina en 2000."},{"page_url":"https://fr.wikipedia.org/wiki/Marie_de_Hongrie_(1505-1558)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Pavillon_de_chasse_marie_de_hongrie_Mariemont.JPG","page_title":"Marie de Hongrie (1505-1558)","context_page_description":"Marie d'Autriche, plus généralement appelée Marie de Hongrie, archiduchesse d'Autriche, infante d'Espagne et, par son mariage, reine consort de Hongrie et de Bohême, est née le 15 septembre 1505 au palais du Coudenberg, à Bruxelles, et morte le 18 octobre 1558 à Cigales, en Castille. Elle est l’avant-dernière des six enfants de Philippe le Beau, héritier des Habsbourg, et de Jeanne de Castille, dite « Jeanne la Folle ».\\nElle devient reine consort de Hongrie et de Bohême de 1522 à 1526, puis gouvernante des Pays-Bas espagnols de 1531 à 1555.\\nElle grandit aux Pays-Bas auprès de sa tante Marguerite d’Autriche. Très jeune, elle est promise en mariage à Louis II de Hongrie mais leur union ne dure que quatre ans en raison de la mort de ce dernier en 1526 sur le champ de bataille contre les Turcs. Comme il n'a pas d’enfant, la couronne revient à son frère Ferdinand qu’elle fait élire roi lors de la régence qu’elle exerce avec difficulté en Hongrie. Après son refus de se remarier, son frère, l'empereur Charles Quint, lui demande de le seconder en tant que gouverneure des Pays-Bas, ce qu'elle fait pendant près de 25 ans."},{"page_url":"https://de.wikipedia.org/wiki/John_de_Beauchamp,_1._Baron_Beauchamp_de_Warwick","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Coat_of_Arms_of_Sir_John_de_Beauchamp%2C_KG.png","page_title":"John de Beauchamp, 1. Baron Beauchamp de Warwick","context_page_description":"John de Beauchamp, 1. Baron Beauchamp de Warwick war ein englischer Adliger und Admiral."},{"page_url":"https://en.wikipedia.org/wiki/List_of_companies_of_South_Sudan","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/White_Bull_Lager_SABMiller.jpg","page_title":"List of companies of South Sudan","context_page_description":"South Sudan, officially the Republic of South Sudan, and previously known as Southern Sudan, is a landlocked country in Middle Africa, in the area of northeast Central Africa that is part of the United Nations subregion of Eastern Africa. The economy of South Sudan is one of the world's most underdeveloped with South Sudan having little existing infrastructure and the highest maternal mortality and female illiteracy rates in the world as of 2011. South Sudan exports timber to the international market. The region also contains many natural resources such as petroleum, iron ore, copper, chromium ore, zinc, tungsten, mica, silver, gold, diamonds, hardwoods, limestone and hydropower. The country's economy, as in many other developing countries, is heavily dependent on agriculture."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A0%D0%B5%D0%B3%D0%B8%D1%81%D1%82%D1%80%D0%B0%D1%86%D0%B8%D0%BE%D0%BD%D0%B5%D0%BD_%D0%BD%D0%BE%D0%BC%D0%B5%D1%80_%D0%BD%D0%B0_%D0%9C%D0%9F%D0%A1_(%D0%95%D0%A1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Luxembourg_licenseplate_EU.JPG","page_title":"Регистрационен номер на МПС (ЕС)","context_page_description":"Регистрационните номера на МПС за страните, членки на Европейския съюз имат общи характеристики, установени с Регламент № 2411/98. Документът регламентира признаването във вътрешния трафик на Общността на отличителния знак на държавата-членка, в която са регистрирани моторни превозни средства и техните ремаркета.\\nОтличителна за европейските регистрационни номера е светлоотражателната синя лента в левия край на табелата, върху която са изобразени 12-те жълти звезди от флага на Европейския съюз, а под него – комбинация от една до три главни букви на латиница, които са отличителният знак на държавата-членка, в която е регистрирано превозното средство.\\nПовечето европейски страни, за разлика от регистрационните номера в САЩ, Канада и други страни в Америка, Азия и Австралия, имат характерна продълговата форма. В европейските страни за изработка на табелите се използват метал или пластмаса, различни шрифтове и различни системи за кодиране на номерата."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%83%D8%B1%D8%A7%D9%88%D9%81%D9%88%D8%B1%D8%AF%D8%B3%D9%81%D9%8A%D9%84_(%D8%A3%D8%B1%D9%83%D9%86%D8%B3%D8%A7%D8%B3)","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/31/Crawfordsville_AR_002.jpg","page_title":"كراوفوردسفيل (أركنساس)","context_page_description":"كراوفوردسفيل ‏ هي بلدة أمريكية تقع في الولايات المتحدة في مقاطعة كريتيندين، أركنسو. يقدر عدد سكانها بـ 479 نسمة ومساحتها 1.5 كم² وترتفع عن سطح البحر 67 متر."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Br%C3%BChl_(Rheinland)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Br%C3%BChl_Burgstr._20.jpg","page_title":"Liste der Baudenkmäler in Brühl (Rheinland)","context_page_description":"Die Liste der Baudenkmäler in Brühl (Rheinland) enthält die denkmalgeschützten Bauwerke auf dem Gebiet der Stadt Brühl im Rhein-Erft-Kreis in Nordrhein-Westfalen. Diese Baudenkmäler sind in der Denkmalliste der Stadt Brühl eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen."},{"page_url":"https://de.wikipedia.org/wiki/Chr%C3%A9tien-Guillaume_de_Lamoignon_de_Malesherbes","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Malherbes-Denkmal_in_Rheinsberg.jpg","page_title":"Chrétien-Guillaume de Lamoignon de Malesherbes","context_page_description":"Chrétien-Guillaume de Lamoignon de Malesherbes war ein französischer Staatsmann, Minister und später Verteidiger Ludwigs XVI."},{"page_url":"https://cs.wikipedia.org/wiki/M%C4%9Bstys_Rudoltice","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Slezsk%C3%A9_Rudoltice.jpg","page_title":"Městys Rudoltice","context_page_description":"Městys Rudoltice je katastrální území a základní sídelní jednotka obce Slezské Rudoltice, v letech 1675–1947 samostatný městys. Dnes je jednou ze čtyř základních sídelních jednotek, které spolu tvoří část Slezské Rudoltice obce Slezské Rudoltice.\\nPrvní zmínka o Rudolticích pochází z roku 1255. V roce 1675 byla ves na žádost majitele léna Julia Leopolda z Hodic a po schválení biskupem Lichtenštejnem byla rozdělena na dvě části, Městys Rudoltice a Ves Rudoltice. Roku 1945 získaly Rudoltice na základě rozhodnutí jazykové komise Slezské expozitury země Moravskoslezské přízvisko Slezské. Roku 1947 pak vznikla sloučením obcí Městys Rudoltice a Ves Rudoltice obec Slezské Rudoltice. Názvy původních obcí však zůstaly zachovány v názvech katastrálních území, název Městys Rudoltice též v názvu základní sídelní jednotky totožné se stejnojmenným katastrálním územím. Hlavní sídelní celky Městyse Rudoltice a Vsi Rudoltice jsou prakticky srostlé, Ves Rudoltice tvoří západní část sídelního celku, Městys Rudoltice východní část. Status městyse obci fakticky zanikl roku 1954, pro roce 1989 si obec nevyžádala jeho obnovení, na které by měla dle zákona automatický nárok."},{"page_url":"https://de.wikipedia.org/wiki/Friedrich_von_Rothenstein","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Essendorf-Scheibler178ps.jpg","page_title":"Friedrich von Rothenstein","context_page_description":"Friedrich von Rothenstein war der Sohn von Konrad von Rothenstein, aus dem Adelsgeschlecht der von Rothenstein. Er hatte seinen Sitz auf der Unteren Burg in Woringen. Friedrich von Rothenstein war der Begründer der Linie Rothenstein - Ittelsburg, welche bis zum Jahr 1562 mit dem Tod von Hans Heinrich von Rothenstein fortbestand."},{"page_url":"https://it.wikipedia.org/wiki/Calceranica_al_Lago","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Calceranica.jpg","page_title":"Calceranica al Lago","context_page_description":"Calceranica al Lago è un comune italiano di 1 357 abitanti in provincia di Trento. Calceranica al Lago è un paese dell'Alta Valsugana, nella regione autonoma Trentino-Alto Adige. Sorge sulle rive del Lago di Caldonazzo. Il Torrente Màndola, che nasce dal massiccio della Vigolana, divide il paese a metà: Màndola e Calceranica.\\nL'etimologia del nome è data da una leggenda, secondo la quale il nome deriverebbe da un incontro casuale tra un uomo che battezzava i paesi e un paesano che saliva dal lago con in mano una calza piena di rane: Calze-rane-ga."},{"page_url":"https://fr.wikipedia.org/wiki/Parcs_nationaux_de_Su%C3%A8de","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/89/Bl%C3%A5_Jungfrun.jpg","page_title":"Parcs nationaux de Suède","context_page_description":"Les parcs nationaux de Suède sont des aires protégées qui représentent le niveau de protection le plus strict que le gouvernement suédois peut garantir à une aire naturelle. En 2018, il existe 30 parcs nationaux qui couvrent au total environ 7 400 km² en excluant les zones marines, soit 1,5 % de la superficie du pays.\\nLa création des parcs nationaux est suggérée dès 1880 par l'explorateur Adolf Erik Nordenskiöld. Mais il faut attendre 1909 pour le vote des premières lois de conservation de la nature et la création des neuf premiers parcs nationaux du pays et d'Europe. Cependant, il n'existe pas alors de définition d'un parc national et peu de moyens sont alloués pour leur préservation, aucune agence gouvernementale gestionnaire n'étant créée. L'association suédoise de protection de la nature s'emploie à pallier ces insuffisances dans les décennies qui suivent. L'association est responsable de la création de plusieurs parcs, tentant en particulier d'améliorer la diversité et la représentativité des milieux protégés. De plus elle parvient lentement à faire évoluer le concept et le cadre légal de la conservation de la nature."},{"page_url":"https://es.wikipedia.org/wiki/Cubrial","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b6/Map_commune_FR_insee_code_25181.png","page_title":"Cubrial","context_page_description":"Cubrial es una población y comuna francesa, en la región de Franco Condado, departamento de Doubs, en el distrito de Besançon y cantón de Rougemont."},{"page_url":"https://es.wikipedia.org/wiki/Billetes_de_Zimbabue","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Zimbabwe_%2410m_2008_Reverse.jpg","page_title":"Billetes de Zimbabue","context_page_description":"Los billetes de Zimbabue fueron emitidos por el Banco de la Reserva de Zimbabue de 1980 a 2009. Se caracterizan por contar entre sus emisiones con el segundo billete con el mayor número de ceros en el mundo.​\\nLos billetes de Zimbabue se emitieron en cuatro representaciones de dólar zimbabuense. El primer dólar reemplazó al dólar rodesiano en 1980, a la par de la proclamación de la independencia.​ Se dejó de fabricar debido a la hiperinflación en Zimbabue, que convirtió a estos billetes en los más devaluados del mundo, después del Pengő húngaro.​​\\nLa imagen principal en el anverso de los billetes regulares fueron las Rocas equilibradas de Chiremba en Epworth, Harare. Por su inclusión en los cheques de emergencia al portador y en los «agrocheques», las rocas equilibradas se convirtieron en el emblema del Banco de la Reserva. El reverso de los billetes a menudo ilustra la cultura o los hitos del país.​\\nEl segundo dólar fue reemplazado el 1 de agosto de 2008 por el tercer dólar, ​​ que a su vez, sería sustituido el 2 de febrero de 2009 por el cuarto dólar al perder rápidamente su valor.​"},{"page_url":"https://no.wikipedia.org/wiki/Will_Stevens","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Will_Stevens_Moscow.jpg","page_title":"Will Stevens","context_page_description":"William Stevens, kjent som Will Stevens, er en britisk racerfører. Han har kjørt i Formel Renault 3,5-liter siden 2012. Han kjørte sitt første løp i Formel 1 i 2014, da han erstattet Marcus Ericsson for Caterham F1 i sesongavslutningen i Abu Dhabi. I februar 2015 kunngjorde Marussia at de hadde signert Stevens for 2015-sesongen."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%95%E0%A5%80-%E0%A4%95%E0%A5%88%E0%A4%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/KiCad_3DViewer.png","page_title":"की-कैड","context_page_description":"की-कैड एक इलेक्ट्रॉनिक डिजाइन का एक मुक्तस्रोत सॉफ्टवेयर है। इसकी सहायता से विद्युत परिपथ का आरेख तथा फिर प्रिन्टेड सर्किट बोर्ड डिजाइन की जा सकती है। मूलतः इसका विकास ज्यां पियरी चारास ने किया था।"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_in_Litauen","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Stolperstein_f%C3%BCr_Tirca_Basiene_%28Kaunas%29.jpg","page_title":"Liste der Stolpersteine in Litauen","context_page_description":"Die Liste der Stolpersteine in Litauen listet alle Stolpersteine, die in Litauen verlegt worden sind. Die Stolpersteine liegen in der Regel vor dem letzten selbstgewählten Wohnort des Opfers und erinnern an das Schicksal der Menschen, die von den Nationalsozialisten ermordet, deportiert, vertrieben oder in den Suizid getrieben wurden.\\nDie Stolpersteine wurden vom Kölner Künstler Gunter Demnig konzipiert und werden im Regelfall von ihm selbst verlegt. Die ersten Verlegungen in Litauen fanden im Jahr 2016 statt."},{"page_url":"https://eo.wikipedia.org/wiki/Wakendorf_II","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Wappen_Wakendorf_II.png","page_title":"Wakendorf II","context_page_description":"Wakendorf II estas komunumo en Germanio. Ĝi troviĝas en la distrikto Segeberg de la federacia lando Ŝlesvigo-Holstinio. Fine de decembro 2015 la komunumo havis 1 346 loĝantojn. La teritorio estas parto de la komunumaro Kisdorf, administra ligo de pluraj formale sendependaj politikaj komunumoj, kies administra centro estas la urbo Kattendorf."},{"page_url":"https://en.wikipedia.org/wiki/Timeline_of_Orthodoxy_in_Greece_(1453%E2%80%931821)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/LiturgieDamaskinos.jpg","page_title":"Timeline of Orthodoxy in Greece (1453–1821)","context_page_description":"This is a timeline of the presence of Orthodoxy in Greece. The history of Greece traditionally encompasses the study of the Greek people, the areas they ruled historically, as well as the territory now composing the modern state of Greece.\\nChristianity was first brought to the geographical area corresponding to modern Greece by the Apostle Paul, although the church's apostolicity also rests upon St. Andrew who preached the gospel in Greece and suffered martyrdom in Patras, Titus, Paul's companion who preached the gospel in Crete where he became bishop, Philip who, according to the tradition, visited and preached in Athens, Luke the Evangelist who was martyred in Thebes, Lazarus of Bethany, Bishop of Kition in Cyprus, and John the Theologian who was exiled on the island of Patmos where he received the Revelation recorded in the last book of the New Testament. In addition, the Theotokos is regarded as having visited the Holy Mountain in 49 AD according to tradition. Thus Greece became the first European area to accept the gospel of Christ. Towards the end of the 2nd century the early apostolic bishoprics had developed into metropolitan sees in the most important cities."},{"page_url":"https://zh.wikipedia.org/zh-cn/2011%E5%B9%B4%E6%96%B0%E5%8A%A0%E5%9D%A1%E7%B8%BD%E7%B5%B1%E9%81%B8%E8%88%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Dr-Tan-Cheng-Bock-at-Nomination-Centre-1.jpg","page_title":"2011年新加坡總統選舉","context_page_description":"2011年新加坡总统选举是新加坡第四次民选总统选举，投票日是8月27日，最终陈庆炎以微弱优势战胜陈清木，成功当选第七任新加坡总统。\\n这次选举是新加坡自1993年来第一次举行总统选举，亦将会是新加坡订立民选总统制度后，第一次出现多位候选人的总统选举。\\n由于本届选举中的候选人全都是华人，而且刚好都姓陈，这意味着新加坡第七任总统将会是华人且为“陈总统”。新加坡历史上有两位总统黄金辉和王鼎昌是华人。"},{"page_url":"https://he.wikipedia.org/wiki/%D7%91%D7%99%D7%AA_%D7%90%D7%91%D7%99_%D7%97%D7%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/PikiWiki_Israel_5501_library_in_avi-chai-house.jpg","page_title":"בית אבי חי","context_page_description":"בית אבי חי הוא מרכז רב-תחומי לתרבות בירושלים, העוסק בנושאים מרכזיים בתחומי התרבות, המחשבה והיצירה בחברה היהודית והישראלית. המרכז הוקם ביוזמתה של קרן אבי חי, בכספי הפילנתרופ היהודי-אמריקאי סנפורד ברנסטין. פרופ' אביגדור שנאן משמש כיועץ האקדמי של המרכז."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%97%A0%E9%94%A1%E5%B8%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/201608_Sanyang_Parkson%2C_Wuxi.jpg","page_title":"无锡市","context_page_description":"無錫市，簡稱錫，古有梁溪、金匱等稱，被譽為「太湖明珠」。無錫地處江南長江三角洲、太湖之濱，位於江蘇省南部，下轄江陰市與宜興市。無錫東鄰蘇州，距上海128.2公里；南瀕太湖，與浙江省交界；西接常州，距南京183公里；北依長江，與泰州市所轄的靖江市隔江相望，是長江三角洲及蘇錫常都市圈重要的區域性中心城市。\\n無錫歷史悠久，曾為吳國的首都。無錫是首批經國務院批准的13個較大的市之一，享有地方立法權；同時還是中華人民共和國歷史文化名城及1998年國家旅遊局評定的第一批優秀旅遊城市之一。\\n無錫不僅是江南地區傳統的魚米水鄉，更是近代中國民族工商業及現代鄉鎮民營企業的搖籃。早在1981年，無錫市便被列為全國十五個經濟中心城市之一。而在取得經濟發展成就的同時，無錫也不乏文化軟實力相伴，從無錫走出過諸如顧愷之、倪雲林、錢穆、錢鍾書等諸多名流，也有以寄暢園、蠡園、黿頭渚等為代表的古今著名園林傳世。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_in_der_Provinz_Girona","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Stolperstein_f%C3%BCr_Gaieta_Sanchez_Tocalon_%28Girona%29.jpg","page_title":"Liste der Stolpersteine in der Provinz Girona","context_page_description":"Die Liste der Stolpersteine in der Provinz Girona enthält die Stolpersteine in der Provinz Girona in Spanien, die vom Kölner Künstler Gunter Demnig verlegt wurden. Stolpersteine erinnern an das Schicksal der Menschen, die von den Nationalsozialisten ermordet, deportiert, vertrieben oder in den Suizid getrieben wurden. Sie liegen im Regelfall vor dem letzten selbstgewählten Wohnsitz des Opfers, in Girona jedoch gesammelt an einem zentralen Platz der Stadt.\\nDie ersten Verlegungen in Spanien erfolgten am 9. April 2015 in Navàs und El Palà de Torroella, in der Provinz Girona am 29. Januar 2018. Die katalanische Übersetzung des Begriffes Stolpersteine lautet: pedres que fan ensopegar. Auf Spanisch werden sie piedras de la memoria genannt."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%84%D5%A1%D6%80%D5%AB%D5%B8%D5%B6_%D4%B2%D5%A1%D6%80%D5%BF%D5%B8%D5%AC%D5%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Valais_Cup_2013_-_OM-FC_Porto_13-07-2013_-_Marion_Bartoli_1.jpg","page_title":"Մարիոն Բարտոլի","context_page_description":"Մարիոն Բարտոլի, ֆրանսիացի նախկին պրոֆեսիոնալ թենիսիստուհի։ 2013 թվականին հաղթանակ է տանում Ուիմբլդոնի մրցաշարի կանանց մենախաղում և եղել է 2011 թվականի Ֆրանսիայի բաց առաջնության կիսաեզրափակչի մասնակից։ Նա նաև հաղթել է WTA մենախաղի 8 և զուգախաղի 3 մրցաշարերում։ Պրոֆեսիոնալ թենիսին հրաժեշտ տալու մասին նա հայտարարել է 2013 թվականի օգոստոսի 14-ին։\\nԲարտլին իր կարիերայի ընթացքում հաղթել է աշխարհի թիվ մեկ ռակետ համարվող երեք թենիսիստուհիների՝ Ժյուստին Էնենին 2007 թվականի Ուիմբլդոնի մրցաշարի կիսաեզրափակիչում, Ելենա Յանկովիչին 2009 թվականի Ավստրալիայի բաց առաջնության չորրորդ շրջանում և Վիկտորիա Ազարենկաին 2012 թվականի Sony Ericsson Open մրցաշարի քառորդ եզրափակիչում։ Նա նաև իր հաշվին հաղթանակներ ունի գրանցած աշխարհի այլ թոփ-թենիսիստուհիների նկատմամբ՝ Վենուս Ուիլյամս, Սերենա Ուիլյամս, Անա Իվանովիչ, Լինդսեյ Դևենպորտ, Արանչա Սանչես-Վիկարիո, Դինարա Սաֆինա, Կարոլին Վոզնյացկի, Պետրա Կվիտովա, Սամանտա Ստոսուր և Կիմ Կլեյստերս։\\n2012 թվականի հունվարի 30-ին նա հասնում է կարիերայում իր բարձրագույն վարկանիշային արդյունքին՝ 7-րդ հորիզոնական։ Նա այդ ցուցանիշին վերադառնում է 2013 թվականի հուլիսի 8-ին, այն բանից հետո, երբ հաղթում է Ուիմբլդոնի մրցաշարում։"},{"page_url":"https://nl.wikipedia.org/wiki/Clubhuismodel_voor_psychosociale_rehabilitatie","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/De_Waterheuvel.jpg","page_title":"Clubhuismodel voor psychosociale rehabilitatie","context_page_description":"Het clubhuismodel voor psychosociale rehabilitatie is een methode om ex-psychiatrische en psychiatrische patiënten te rehabiliteren op werk-, sociaal en psychisch gebied. De blauwdruk ontstond in 1948 in de Verenigde Staten."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%9A%D0%B0%D1%85%D0%B8%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Statue_of_Dyhia_in_Khenchela_%28Algeria%29.jpg","page_title":"Кахина","context_page_description":"Кахина била берберска кралица, верски и воен лидер која го предводела домородниот отпор против арапската исламска експанзија во северозападниот дел на Африка, регионот тогаш познат како Нумидиа. Родена е во почетокот на 7 век и починала кон крајот на 7 век во денешен Алжир. Се смета дека е од мешано потекло: берберски Евреин и византиски христијанин.\\nНејзиното лично име е една од варијантите: Даја, Дехија, Дихја, Дахја или Дамја. Нејзината титулата според извори на арапски јазик е ал-Кахина. Ова беше прекарот користен од страна на нејзините муслимански противници поради нејзината наводна способност да ја предвиди иднината.\\nСпоред една легенда таа во својата младост го ослободила нејзиниот народ од тиранин, со тоа што се согласила да се омажи за него, а потоа го убила на првата брачна ноќ.\\nКахина изучувала орнитологија која ги преобликувала науката и учењето во Северна Африка. Денес, многу ја возвишуваат поради нејзините откритија и независност."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D1%80%D0%B5%D1%83%D0%B3%D0%BE%D0%BB%D1%8C%D0%BD%D0%B8%D0%BA_%D0%A0%D1%91%D0%BB%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Bavaria_Oud_Bruin.jpg","page_title":"Треугольник Рёло","context_page_description":"Треуго́льник Рёло́ представляет собой область пересечения трёх равных кругов с центрами в вершинах правильного треугольника и радиусами, равными его стороне. Негладкая замкнутая кривая, ограничивающая эту фигуру, также называется треугольником Рёло.\\nТреугольник Рёло является простейшей после круга фигурой постоянной ширины.\\nТо есть если к треугольнику Рёло провести пару параллельных опорных прямых, то расстояние между ними не будет зависеть от выбранного направления. Это расстояние называется шириной треугольника Рёло.\\nСреди прочих фигур постоянной ширины треугольник Рёло выделяется рядом экстремальных свойств: наименьшей площадью, наименьшим возможным углом при вершине, наименьшей симметричностью относительно центра. Треугольник получил распространение в технике — на его основе были созданы кулачковые и грейферные механизмы, роторно-поршневой двигатель Ванкеля и даже дрели, позволяющие сверлить квадратные отверстия.\\nНазвание фигуры происходит от фамилии немецкого механика Франца Рёло. Он, вероятно, был первым, кто исследовал свойства этого так называемого криволинейного треугольника; также он использовал его в своих механизмах."},{"page_url":"https://en.wikipedia.org/wiki/List_of_ant_genera","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Lordomyrma_furcifera_casent0172482_profile_1.jpg","page_title":"List of ant genera","context_page_description":"Ants are the most species-rich of all social insects, with more than 12,000 described species and many others awaiting description. Formicidae is divided into 21 subfamilies, of which 17 are extant and four subfamilies are extinct, described from fossils. In total more than 300 genera have been described. Ants have come to occupy virtually all major terrestrial habitats, with the exception of tundra and cold ever-wet forests. They display a wide range of social behaviors, foraging habits and associations with other organisms, which has generated scientific and public interest.\\nThe following is a list of worldwide ant genera organised by subfamily."},{"page_url":"https://en.wikipedia.org/wiki/Clan_MacThomas","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5c/MacThomastartan.jpg","page_title":"Clan MacThomas","context_page_description":"Clan MacThomas is a Highland Scottish clan and is a member of the Clan Chattan."},{"page_url":"https://lv.wikipedia.org/wiki/Uzvaras_iela_(Jelgava)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Uzvaras_iela_63-65_%28Jelgava%29.jpg","page_title":"Uzvaras iela (Jelgava)","context_page_description":"Uzvaras iela ir viena no Jelgavas ielām. Tā sākas pie krustojuma ar Lielo ielu, ved gar Hercoga Jēkaba laukumu un Jelgavas Kultūras namu, tālāk turpinās gar Jelgavas 3. sākumskolu un Jelgavas tirgu līdz Mēdemu villai. Beidzas aiz bijušās Jelgavas Linu fabrikas Lielupes palieņu pļavās.\\nPirmā pasaules kara Vācijas karaspēka Kurzemes ofensīvas laikā 1915. gadā tika sagrautas ēkas pie pilsētas ziemeļu robežas, bet Otrā pasaules kara laikā 1944. gada augustā visa ielas apbūve tika iznīcināta, mūsdienās to veido lielākoties Latvijas PSR laikā celtas ēkas. 2009. gadā Uzvaras un Ausekļa ielas krustojumā pie Jelgavas tirgus uzstādīja piemiņas zīmi \\"Ezera vārti\\"."},{"page_url":"https://en.wikipedia.org/wiki/Maicon_Pereira_de_Oliveira","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Maicon_Pereira_de_Oliveira.jpeg","page_title":"Maicon Pereira de Oliveira","context_page_description":"Maicon Pereira de Oliveira commonly known as Maicon, was a Brazilian footballer who played in the Ukrainian Premier League for most of his professional career. He performed as a striker."},{"page_url":"https://cs.wikipedia.org/wiki/Berhida","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Berhida-Peremarton1.jpg","page_title":"Berhida","context_page_description":"Berhida je město v Maďarsku na východě župy Veszprém, spadající pod okres Várpalota. Nachází se asi 15 km východně od Veszprému. V roce 2015 zde žilo 5 833 obyvatel. Podle údajů z roku 2011 zde žijí 85 % Maďaři, 9,9 % Romové, 2,3 % Němci a 0,2 % Rumuni.\\nV roce 1926 byla s Berhidou sloučena vesnice Kiskovácsi, v roce 1939 se stala součástí Berhidy vesnice Peremarton.\\nMěstem protéká říčka Séd, která se později pod názvem Sárvíz-malomcsatorna vlévá do říčky Sárvíz, popř. Nádor-csatorna. Ta se vlévá do řeky Sió.\\nNejbližšími městy jsou Balatonfűzfő, Balatonkenese, Várpalota a Veszprém, poblíže jsou též obce Küngös, Ősi, Papkeszi, Pétfürdő a Vilonya."},{"page_url":"https://gl.wikipedia.org/wiki/Valdeolmillos","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f9/VALDEOLMILLOS_-Resolucion_de_Escritorio-.jpg","page_title":"Valdeolmillos","context_page_description":"Valdeolmillos é un concello español da provincia de Palencia. A súa poboación é de 67 habitantes."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B2%D1%8F%D1%82%D0%BE-%D0%A2%D1%80%D0%BE%D0%B8%D1%86%D0%BA%D0%B8%D0%B9_%D1%85%D1%80%D0%B0%D0%BC_(%D0%93%D0%BE%D1%80%D1%8B%D0%BD%D1%8C%D0%B3%D1%80%D0%B0%D0%B4_%D0%9F%D0%B5%D1%80%D0%B2%D1%8B%D0%B9)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/%D0%A1%D0%B2%D1%8F%D1%82%D0%BE-%D0%A2%D1%80%D0%BE%D0%B8%D1%86%D0%BA%D0%B8%D0%B9_%D1%85%D1%80%D0%B0%D0%BC%2C_%D1%81._%D0%93%D0%BE%D1%80%D1%8B%D0%BD%D1%8C%D0%B3%D1%80%D0%B0%D0%B4_%D0%9F%D0%B5%D1%80%D0%B2%D1%8B%D0%B9_6.jpg","page_title":"Свято-Троицкий храм (Горыньград Первый)","context_page_description":"Свя́то-Тро́ицкий храм — православный храм с. Горыньград Первый Ровенского района Ровенской области.\\nСтроился в период с 1812 по 1816 гг. на средства князя Гавриила Александровича Святополк-Четвертинского. Капитально реконструирован и отреставрирован на средства Василия и Виталия Грицаков в 2009-2016 г. Относится к Ровенской и Острожской епархии Украинской православной церкви."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89lections_f%C3%A9d%C3%A9rales_australiennes_de_2019","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Scott_Morrison_2014_crop.jpg","page_title":"Élections fédérales australiennes de 2019","context_page_description":"Des élections législatives et sénatoriales fédérales ont lieu le 18 mai 2019 en Australie afin de renouveler l'intégralité des 151 sièges de la Chambre des représentants et 40 des 76 sièges du Sénat. La Chambre des représentants choisit ensuite le Premier ministre.\\nLe scrutin voit la victoire de la Coalition, une formation de partis libéraux-conservateurs dirigée par le Premier ministre sortant, Scott Morrison. Le résultat est une grande surprise, une alternance au profit du Parti travailliste étant jusqu'alors annoncée par les instituts de sondage."},{"page_url":"https://cs.wikipedia.org/wiki/Ost%C5%99ihom","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Esztergom.bazilika.lights.jpg","page_title":"Ostřihom","context_page_description":"Ostřihom je město v severním Maďarsku, u státní hranice se Slovenskem na hraniční řece Dunaji. Žije zde přibližně 28 tisíc obyvatel. Na druhé straně řeky, respektive na severním levém břehu Dunaje, leží slovenské město Štúrovo. Město je velice důležitým článkem maďarských dějin. V historii byla Ostřihom i hlavním městem Uherského království."},{"page_url":"https://ca.wikipedia.org/wiki/John_L._Phillips","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/STS-119_patch.png","page_title":"John L. Phillips","context_page_description":"John Lynch Phillips, PhD és un astronauta de la NASA. Phillips també és un capità retirat de la United States Navy Reserve. Phillips va rebre nombrosos guardons i honors especials. És un National Merit Scholar, graduat 2n en la seva classe de 906 persones a l'Acadèmia Naval dels Estats Units en el 1972. Phillips també ha sigut guardonat amb el NASA Space Flight Medal, NASA Distinguished Service Medal, la Medalla Gagarin i diverses més. Phillips ha registrat més de 4.400 hores de vol i 250 aterratges de portaavions, volant amb un A-7 durant el temps que va estar en la reserva de la Marina del 1982 al 2002. En l'època de la jubilació, en Phillips havia conservat el rang de capità."},{"page_url":"https://en.wikipedia.org/wiki/Emily_Carr","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Emily_Carr_House.JPG","page_title":"Emily Carr","context_page_description":"Emily Carr was a Canadian artist and writer who was inspired by the Indigenous peoples of the Pacific Northwest Coast. One of the first painters in Canada to adopt a Modernist and Post-Impressionist painting style, Carr did not receive widespread recognition for her work until the subject matter of her painting shifted from Aboriginal themes to landscapes—forest scenes in particular. As a writer, Carr was one of the earliest chroniclers of life in British Columbia. The Canadian Encyclopedia describes her as a \\"Canadian icon\\"."},{"page_url":"https://en.wikipedia.org/wiki/Bethlehem_Armory","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/1930_cornerstone_Bethlehem_Armory_PA.JPG","page_title":"Bethlehem Armory","context_page_description":"Bethlehem Armory also known as Floyd Simons Armory, is a historic National Guard armory located at Bethlehem, Lehigh County, Pennsylvania. It was built in 1930, and is an \\"I\\"-plan brick building in three sections. It consists of a two-story administration building, drill hall, and kitchen / locker room executed in the Art Deco style. It measures 82 by 102 feet, and has a hipped roof. Additions were built in 1938 and 1968.\\nIt was added to the National Register of Historic Places in 1991."},{"page_url":"https://es.wikipedia.org/wiki/Hermanitos_de_Jes%C3%BAs","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/%22_Charles_de_Foucauld_%22_.jpg","page_title":"Hermanitos de Jesús","context_page_description":"El Instituto Pequeños Hermanos de Jesús es una congregación laical católica masculina de derecho pontificio, fundada por René Voillaume, en El Abiodh Sidi Cheikh, en 1933, inspirado por el estilo de vida de Carlos de Foucauld en el desierto de Argelia. A los religiosos de este instituto instituto se les conoce como Hermanitos de Jesús o también como Hermanos de Jesús, ​ en algunas partes les llaman Hermanos de Carlos de Foucauld, y posponen a sus nombres las siglas P.F.I. o P.F.J.​"},{"page_url":"https://en.wikipedia.org/wiki/Alexander_Satschko","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Satschko_WMQ14_%281%29_%2814420470777%29.jpg","page_title":"Alexander Satschko","context_page_description":"Alexander Satschko is a German retired tennis player. He was a doubles specialist, who achieved his highest doubles ranking of world No. 80 in October 2014. He won his first ATP World Tour title with partner Gero Kretschmer as alternates in Quito on 7 February 2015."},{"page_url":"https://af.wikipedia.org/wiki/Nick_Heidfeld","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Nick_Heidfeld_Canadian_Grand_Prix_2005.jpg","page_title":"Nick Heidfeld","context_page_description":"Nick Lars Heidfeld is 'n Duitse professionele renjaer.\\nTen spyte van gereelde podiumplekke in 2005 by Williams, en in 2007 en 2008 by BMW Sauber, het Heidfeld nooit 'n wedren gewen sedert sy debuut in Formule Een in 2000 nie. Heidfeld hou tans drie rekords. Hy hou die rekord vir die meeste podiums sonder 'n Grand Prixwen, en behaal die meeste tweede plekke sonder 'n wen met 8. Hy hou ook die rekord vir die meeste agtereenvolgende renklassifikasies met 'n telling van 41.\\nIn 2011 het Heidfeld in Formule Een vir die Renault-span gejaag as 'n plaasvervanger vir die beseerde Robert Kubica, sy voormalige BMW Sauberspanmaat, voordat hy vervang is deur Bruno Senna. Hy jaag tans vir die Rebellion Racing-span in die FIA-wêrelduithoukampioenskap en vir Mahindra Racing in Formule E."},{"page_url":"https://de.wikipedia.org/wiki/Georg_Oeder","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/29/Georg_Oeder_Morgens_auf_dem_Lande.jpg","page_title":"Georg Oeder","context_page_description":"Georg Oeder war ein deutscher Landschaftsmaler der Düsseldorfer Schule."},{"page_url":"https://fr.wikipedia.org/wiki/Michel_Coignet","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Adolphe_Qu%C3%A9telet_by_Joseph-Arnold_Demannez.jpg","page_title":"Michel Coignet","context_page_description":"Michel Coignet, né à Anvers en 1549 et mort à Anvers le 24 décembre 1623, est un ingénieur brabançon, cosmographe, mathématicien et fabricant d'instruments scientifiques.\\nMathématicien, ingénieur et cartographe des archiduc et duchesse d'Autriche Albert et Isabelle, il occupait à leur cour une position analogue à celle de Simon Stevin auprès de Maurice d'Orange. Les géographes lui doivent un traité de la navigation et de nombreux ouvrages mathématiques ou militaires. Il fut un des premiers jalons dans la création du compas de proportion. Ayant pour élève Marino Ghetaldi, connu de François Viète, Coignet fut un mathématicien respecté par ceux de son époque, et notamment par Fabrizio Mordente, Ludolph van Ceulen, Godefroy Wendelin, Adrien Romain, Galilée, Johannes Kepler ou Mercator."},{"page_url":"https://vi.wikipedia.org/wiki/Cao_nguy%C3%AAn_Shan","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Shan_Hills-Southeast_asia.jpg","page_title":"Cao nguyên Shan","context_page_description":"Cao nguyên Shan, còn được gọi là Tây nguyên Shan, là tên gọi chung cho một vùng núi, đồi và cao nguyên ở chân dãy núi Himalaya, bao trùm vùng biên giới giữa tỉnh Vân Nam, bang Shan và Thái Lan."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%94%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/ActinideExplosionSynthesis.png","page_title":"锿","context_page_description":"鑀是一種人工合成元素，符號為Es，原子序為99。鑀是第7個超鈾元素，屬於錒系元素。\\n鑀是在1952年第一次氫彈爆炸的殘餘物中發現的，並以物理學家阿爾伯特·愛因斯坦命名。其最常見的同位素為鑀-253，是通過鉲-253的衰變而人工製造的，每年在高能核反應爐中的產量約為1毫克。合成之後，鑀-253要從其他錒系元素及其衰變產物中分離出來，這是個複雜的過程。其他的鑀同位素則在各個實驗室中以較輕元素的離子撞擊錒系元素而合成，但產量少得多。鑀除了用於合成新的元素，主要用於發射X射線。鑀曾在1955年用於首次合成鍆元素，並一共合成了17顆鍆原子。\\n鑀是一種柔軟的銀白色金屬，具順磁性。其化學屬性符合典型的重錒系元素，容易形成+3氧化態，並特別在固體中也可以形成+2態。鑀-253的高放射性會使它明顯地發光，並會迅速破壞其晶體金屬結構，每克釋放大約1000瓦的熱量。由於鑀-253每天都損失3%的質量，並依次衰變為鉳和鉲，因此對鑀的研究十分困難。鑀-252是存留時間最長的鑀同位素，可以用於研究鑀的物理特性，但生產鑀-252是極為困難的，每次的產量也極少。鑀是最後一種曾在宏觀尺度下以純元素形態被研究過的元素，所用的同位素是常見但半衰期短的鑀-253。和其他的人工合成超鈾元素一樣，鑀是極具放射性的，與其接觸會對健康造成損害。"},{"page_url":"https://fi.wikipedia.org/wiki/A1-talli_Indonesia","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/A1_Grand_Prix%2C_Kyalami_-_Indonesia.jpg","page_title":"A1-talli Indonesia","context_page_description":"A1-talli Indonesia on indonesialainen talli, joka kilpaili A1 Grand Prix -sarjassa kaudesta 2005–2006 kauteen 2008–2009."},{"page_url":"https://ceb.wikipedia.org/wiki/Trdkova_(lungsod_sa_Esklobeniya)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Trdkova-Goricko1.png","page_title":"Trdkova (lungsod sa Esklobeniya)","context_page_description":"Lungsod ang Trdkova sa Esklobeniya. Nahimutang ni sa munisipyo sa Kuzma, sa amihanan-sidlakang bahin sa nasod, 150 km sa amihanan-sidlakan sa Ljubljana ang ulohan sa nasod. 352 metros ibabaw sa dagat kahaboga ang nahimutangan sa Trdkova, ug adunay 178 ka molupyo.\\nAng yuta palibot sa Trdkova kay kasagaran patag. Trdkova nahimutang sa usa ka gitas-on. Dunay mga 30 ka tawo kada kilometro kwadrado sa palibot sa Trdkova medyo gamay nga populasyon. Ang kinadul-ang mas dakong lungsod mao ang Grad, 6.3 km sa habagatan sa Trdkova. Hapit nalukop sa lasang nga sagolsagol ang palibot sa Trdkova.\\nAng klima hemiboreal. Ang kasarangang giiniton 9 °C. Ang kinainitan nga bulan Hulyo, sa 21 °C, ug ang kinabugnawan Enero, sa -4 °C. Ang kasarangang pag-ulan 1,207 milimetro matag tuig. Ang kinabasaan nga bulan Septiyembre, sa 165 milimetro nga ulan, ug ang kinaugahan Disyembre, sa 54 milimetro."},{"page_url":"https://de.wikipedia.org/wiki/Schweres_Maschinengewehr","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/The_Invention_of_the_Machine_Gun%3B_Hiram_Maxim_Q81725.jpg","page_title":"Schweres Maschinengewehr","context_page_description":"Ein schweres Maschinengewehr ist ein Maschinengewehr mit einem Kaliber zwischen 12 mm und unter 20 mm oder ein Maschinengewehr mit geringerem Kaliber, das durch einen Untersatz wie einem Dreibein oder einer Lafette eine größere Zerstörungswirkung und bessere Trefferquote erhält.\\nIm deutschen Sprachgebrauch dient für schweres Maschinengewehr die Abkürzung sMG. Als sMG wird auch ein Universal-Maschinengewehr mit Mittelkaliber auf Feldlafette bezeichnet. Im Englischen wird der Begriff HMG verwendet. Maschinenwaffen ab 20 mm werden als Maschinenkanone klassifiziert.\\nSchwere Maschinengewehre verschießen Patronen mit einer Kadenz zwischen 400 und 1500 Schuss pro Minute. Die Munition wird entweder über Stangenmagazine zugeführt oder über Munitionsgurte. Der Rückstoß des Verschlusses lädt die Waffe für den nächsten Schuss. Schwere Maschinengewehre werden im Dauerfeuer geschossen. Der Schütze ist angehalten, kurze Feuerstöße abzugeben, um eine höhere Trefferquote zu erreichen und um den Lauf der Waffe nicht zu sehr zu erhitzen."},{"page_url":"https://nl.wikipedia.org/wiki/Altaj_(deelrepubliek)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Mummy_of_the_Ukok_Princess.jpg","page_title":"Altaj (deelrepubliek)","context_page_description":"Altaj is een autonome republiek in de Russische Federatie, vernoemd naar het gelijknamige gebergte.\\nDe republiek grenst in het noorden aan de oblast Kemerovo en aan Chakassië en in het oosten aan Tuva. Ten westen ervan ligt de kraj Altaj. De zuidelijke buren liggen alle buiten Rusland. De grenslijn met het buitenland bedraagt 880,4 kilometer, waarvan 288,7 met Mongolië, 54,1 kilometer met de Volksrepubliek China en 517,6 kilometer met Kazachstan.\\nAltaj bestaat uit hoogland. Het is een soort \\"Russisch Tibet\\" in het centrum van Azië op het kruispunt van verschillende staten en culturele werelden. De Siberische taiga, de steppen van Kazachstan en de halfwoestijnen van Mongolië ontmoeten elkaar hier. Bossen bedekken ongeveer 25% van het gebied van de republiek."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%A4%A7%E5%8E%9F%E9%87%8E%E7%A5%9E%E7%A4%BE","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f1/Oharano_jinja_Honden.JPG","page_title":"大原野神社","context_page_description":"大原野神社は、京都府京都市西京区大原野にある神社。二十二社の一社。旧社格は官幣中社で、現在は神社本庁の別表神社。\\n奈良の春日社から勧請を受けたもので、「京春日」の別称がある。その春日大社、京都の吉田神社と並んで、「藤原氏の氏神三社」のひとつに数えられる。"},{"page_url":"https://de.wikipedia.org/wiki/Rhododendronpark_Kleine_Bastei","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/2012-05-15_Rhododendronpark_Rathen_8.JPG","page_title":"Rhododendronpark Kleine Bastei","context_page_description":"Der Rhododendronpark Kleine Bastei ist eine Parkanlage in Rathen im Landkreis Sächsische Schweiz-Osterzgebirge. In dem während der 1920er Jahre gestalteten Park stehen rund 30 verschiedene Arten bzw. Sorten von Rhododendren sowie teils exotische Baumarten."},{"page_url":"https://sk.wikipedia.org/wiki/Yusef_Lateef","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Yusef_Lateef.jpg","page_title":"Yusef Lateef","context_page_description":"Yusef Lateef bol americký multiinštrumentalista a hudobný skladateľ. Svoju kariéru začal koncom tridsiatych rokov hraním v rôznych swingových orchestroch. Roku 1949 sa stal členom orchestra Dizzyho Gillespieho a následne sa vrátil k štúdiám a študoval kompozíciu a hru na flautu na Wayne State University. V roku 1950 konvertoval na Islam. Prvý album ako líder nazvaný Jazz for the Thinker vydal v roku 1957. Podieľali sa na ňom Curtis Fuller, Hugh Lawson, Ernie Farrow, Louis Hayes a Doug Watkins.\\nNeskôr vydal mnoho ďalších albumov a spolupracoval aj s ďalšími hudobníkmi, medzi ktorých patria Cannonball Adderley, Archie Shepp, Donald Byrd alebo Art Farmer. V rokoch 1987 až 2002 sa mimo svojej aktívnej kariéry venoval aj pedagogickej činnosti. Zomrel vo veku deväťdesiattri rokov v decembri 2013 na rakovinu prostaty. Svoje posledné turné odohral v lete toho roka. Za svoj album Yusef Lateef 's Little Symphony z roku 1987 získal cenu Grammy v kategórii najlepší new age album. V roku 2010 získal ocenenie NEA Jazz Masters."},{"page_url":"https://fr.wikipedia.org/wiki/Peyrehorade","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Office_de_tourisme_de_Peyrehorade.jpg","page_title":"Peyrehorade","context_page_description":"Peyrehorade est une commune française, située dans le département des Landes, en région Nouvelle-Aquitaine.\\nLe gentilé est Peyrehoradais."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%9A%D1%83%D1%81%D1%81%D0%B5_(%D0%92%D0%BE%D0%B3%D0%B5%D0%B7)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/%C3%89glise_Coussey.jpg","page_title":"Куссе (Вогез)","context_page_description":"Куссе — Францин гӀала-коммуна, лаьтта Гранд-Эст регионехь. Коммунан департамент — Вогез. Кхузахь климат барамехь ю, аьхка йовха хуьлу, ткъа Ӏа барамехь-шийла хуьлу. ГӀалин бахархой французаш бу. Официалан Французийн мотт бу."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%B2%88_B","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Bun_B%27s_Set_%40_The_Loft%2C_Atlanta.jpg","page_title":"번 B","context_page_description":"번 B 는 미국의 랩 가수이다. 예전 유지케이 멤버였으며, 중저음의 간결한 랩이 그의 특징이다."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%AA%E3%82%BE%E3%83%BC%E3%83%88%E3%81%97%E3%82%89%E3%81%8B%E3%81%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Resort-shirakami-Buna_in_Akita.jpg","page_title":"リゾートしらかみ","context_page_description":"リゾートしらかみは、東日本旅客鉄道が秋田駅 - 弘前駅・青森駅間を奥羽本線・五能線経由で運行している臨時快速列車。1997年4月1日運行開始。\\nなお、本項では、当列車の前身である「ノスタルジックビュートレイン」および冬季以外で車両検査時に運行される「海彦・山彦号」およびその後継列車である「五能線クルージングトレイン」についても併せて記述する。"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%98%BF%E6%96%B9%E7%B4%A2%C2%B7%E5%8A%A0%E8%A5%BF%E4%BA%9A%C2%B7%E7%BD%97%E5%A4%AB%E8%8E%B1%E6%96%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Alfonso_Garcia_Robles_1981.jpg","page_title":"阿方索·加西亚·罗夫莱斯","context_page_description":"阿方索·加西亞·羅夫萊斯是一名墨西哥外交官和政治家，在1982年，他與瑞典的阿爾瓦·米達爾共同獲得諾貝爾和平獎。\\n他出生於米卻肯州的薩莫拉，在加入國家的外交職務前，他曾於墨西哥國立自治大學接受法律培訓。1945年，他曾擔任代表出席聯合國成位的舊金山會議。從1962年到1964年，他是駐巴西大使。1964年至1970年，他出任外交部國務大臣。1971年至1975年，他為駐聯合國代表服務。其後兩年他又被任命為外長。在1975至197676，他被任命為墨西哥常駐聯合國代表。他積極推動特拉特洛爾科條約，在拉丁美洲和加勒比地區設立無核武器區，使他在1982年與阿爾瓦·米達爾共同獲得諾貝爾和平獎。"},{"page_url":"https://fa.wikipedia.org/wiki/%D9%85%DB%8C%D9%86%D9%88%D8%AF%D8%B4%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/%DA%86%D8%B1%D8%A7%D8%BA_%D8%AA%D9%BE%D9%87_-_%D9%85%DB%8C%D9%86%D9%88%D8%AF%D8%B4%D8%AA.jpg","page_title":"مینودشت","context_page_description":"مینودشت یکی از شهرهای استان گلستان در شمال شرقی ایران است. این شهر مرکز شهرستان مینودشت است."},{"page_url":"https://de.wikipedia.org/wiki/Buick_Serie_D-Six","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fe/Buick_Roadster_1922.jpg","page_title":"Buick Serie D-Six","context_page_description":"Der Buick Serie D-Six war eine Serie von Personenkraftwagen mit Sechszylindermotor, die in den Modelljahren 1916–1917 von Buick in den USA gefertigt wurde. Im Folgejahr ersetzte ihn die Serie E-Six, 1919 gab es die Serie H-Six und 1920 die Serie K-Six. In den Jahren 1921–1924 lauteten die Namen Serie 21-Six, Serie 22-Six, Serie 23-Six und Serie 24-Six."},{"page_url":"https://en.wikipedia.org/wiki/List_of_monuments_in_Metropolis_12,_Kathmandu","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Garud_Statue_at_Hyumat.JPG","page_title":"List of monuments in Metropolis 12, Kathmandu","context_page_description":"This is a list of Monuments in Kathmandu Metropolis -12, officially recognized by and available through the website of the Department of Archaeology, Nepal in the Kathmandu District. Kathmandu is a historically rich city and Hindu temples are the main attraction of this Metropolis. The monument list below is populated using the authentic information at Department of Archaeology."},{"page_url":"https://pl.wikipedia.org/wiki/Serwis_porcelanowy","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Serwis_flora_danica_ok_1790_roku.jpg","page_title":"Serwis porcelanowy","context_page_description":"Serwis porcelanowy – komplet naczyń zastawy stołowej dla większej liczby osób, wykonany z porcelany."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E4%B8%89%E8%8A%9D%E5%8D%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Sanzhi_District.PNG","page_title":"三芝區","context_page_description":"三芝区位于台湾新北市西北部，北邻石门区，西北滨台湾海峡，西南连淡水区，东南连金山区及台北市北投区。是第7、8、9届中华民国总统李登辉的故乡。本区除埔坪里、埔头里人口密度大于2,000人/平方公里之外，其余11里的人口密度均未满500人/平方公里，显示本区人口分布有过度集中之现象。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BF%D1%82%D0%B0%D1%85%D1%96%D0%B2_%D0%9A%D0%B5%D0%BD%D1%96%D1%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/White-faced_Owl.jpg","page_title":"Список птахів Кенії","context_page_description":"Це список видів птахів, зареєстрованих у Кенії. Орнітофауна Кенії станом на серпень 2019 року включає 1134 підтверджених види, з них 10 ендемічних видів, 70 бродячих і чотири — інтродукованих види."},{"page_url":"https://de.wikipedia.org/wiki/Brandenburgisches_Staatsorchester_Frankfurt_(Oder)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Theater_Frankfurt-Oder_%28Schinkel-Flaminius%29.jpg","page_title":"Brandenburgisches Staatsorchester Frankfurt (Oder)","context_page_description":"Das Brandenburgische Staatsorchester Frankfurt, kurz BSOF, ist ein international anerkanntes Sinfonieorchester mit Sitz in Frankfurt (Oder)."},{"page_url":"https://es.wikipedia.org/wiki/Estaci%C3%B3n_de_Arag%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Metro_arag%C3%B3_4.jpg","page_title":"Estación de Aragón","context_page_description":"La estación de Aragón es una estación de las líneas 5 y 7 de Metrovalencia. Fue inaugurada el 30 de abril de 2003 como parte del primer tramo de la línea 5. Se encuentra bajo la avenida de Aragón con la calle Amadeo de Saboya. Es la parada más cercana al Estadio de Mestalla."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%A4%D7%A8%D7%95%D7%93%D7%99%D7%98%D7%94_%D7%9E%D7%A7%D7%A0%D7%99%D7%93%D7%95%D7%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Knidiska_Afrodite%2C_Nordisk_familjebok.png","page_title":"אפרודיטה מקנידוס","context_page_description":"\\"אפרודיטה מקנידוס\\" הוא פסל שאותו יצר הפסל היווני פרקסיטלס במאה הרביעית לפנה\\"ס. בפסל זה, בו מופיעה האלה לראשונה כאישה ערומה, זכה לפרסום רב ברחבי העולם העתיק ונעשו בעקבותיו מאות עותקים וחיקויים.\\nהפסל נוצר בהזמנת אנשי האי קוס, אשר סירבו לקבלו בשל העירום הפרובוקטיבי. פסל זה נרכש על ידי בני האי קנידוס והוצג בו. פיליניוס טוען כי פרקסיטלס השתמש בדמותה של ההטאירה פרינה, כמודל לפסל. הפסל הפך לסמלה של קנידוס והוטבע אף על גבי מטבע מן האי. נאמר כי ניקמידוס הראשון, מלכה של ביתיניה, ביקש לרכוש פסל זה אך אנשי האי סירבו להצעתו הגבוהה.\\nהפסל הציג את האלה אפרודיטה עירומה ולידה כד גדול עליו מונחים בגדיה של האלה טרם הרחצה. הפסל הוצב במקדש פתוח ונצפה מכל עבריו.\\nב\\"אהבה\\", דיאלוג של הסופר הרומאי לוקיאנוס מסמוסאטה, דיאלוג אשר השווה בין אהבת נשים לאהבת נערים, הציג המחבר תיאור מילולי של הפסל וסביבתו.\\nהפסל, כנראה, נלקח לקונסטנטינופול ואבד שם בזמן \\"מהומות ניקה\\" בשנת 532 לספירה. מלבד המטבע עליו מופיע הדמות נעשו לפסל מספר גרסאות בתקופות מאוחרות יותר. ביניהן ידועות \\"ונוס קולונה\\" המוצגת כיום במוזאון הוותיקן, \\"ראש קאופמן\\" במוזיאון הלובר.\\nדגם זה של תיאור אפרודיטה העירומה היווה השראה לפסלים רבים של האלה אפרודיטה או גלגולה הרומי ונוס, כגון ונוס מדיצ'י, \\"ונוס ממילו\\", \\"ונוס הקפיטולינית\\" ועוד."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%98%D1%81%D1%82%D0%BE%D1%80%D0%B8%D1%8F_%D1%84%D1%83%D1%82%D0%B1%D0%BE%D0%BB%D1%8C%D0%BD%D0%BE%D0%B3%D0%BE_%D0%BA%D0%BB%D1%83%D0%B1%D0%B0_%C2%AB%D0%A7%D0%B5%D0%BB%D1%81%D0%B8%C2%BB","image_url":"https://upload.wikimedia.org/wikipedia/ru/e/eb/British_Football_Scandal._The_New_York_Times.png","page_title":"История футбольного клуба «Челси»","context_page_description":"В данной статье описывается история футбольного клуба «Челси», базирующегося в Фулеме, Западный Лондон. Для общего обзора клуба, см. статью «Челси»\\nКлуб основан в 1905 году, и быстро завоевал популярность среди болельщиков, но не смог выиграть ни одного трофея в первые 50 лет своего существования. «Челси» провёл 30 своих первых сезонов из 40 в Первом дивизионе, хотя зачастую клуб находился в середине турнирной таблицы или вообще сражался за сохранение места в Первом дивизионе. К самому первому успеху «Челси» пришёл в Кубке Англии, он занял второе место в 1915 году и потерпел поражение в полуфиналах в 1911, 1920, 1932, 1950 и 1952 годах. Череда неудач была окончательно разрушена тренером Тедом Дрейком, который внёс ряд изменений в структуру клуба и привёл «Челси» к первому чемпионству в сезоне 1954/55.\\nВ период с 1963 по 1972 год перед «Челси» ставились большие задачи, хотя они часто не исполнялись в реальности. В 1965 году был выигран Кубок Футбольной лиги, в 1970 году Кубок Англии, что дало право участвовать в Кубке обладателей кубков УЕФА, который был выигран в 1971 году, в это же время были проиграны два финала: Кубка Англии в 1967 и Кубка Футбольной лиги в 1972."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Br%C3%BCcken_%C3%BCber_den_Amsterdam-Rhein-Kanal","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Breukelerbrug.JPG","page_title":"Liste der Brücken über den Amsterdam-Rhein-Kanal","context_page_description":"Die Liste der Brücken über den Amsterdam-Rhein-Kanal umfasst alle bestehenden Brücken über den Amsterdam-Rhein-Kanal auf. Der 72 Kilometer lange Kanal führt von der niederländischen Hauptstadt Amsterdam in der Provinz Noord-Holland durch die Provinzen Noord-Holland, Utrecht und Gelderland nach Tiel in der Provinz Gelderland. Er verfügt über eine Breite zwischen 100 und 120 Metern und weist einen Kanalpegel zwischen −6 bis −5 Meter NAP auf."},{"page_url":"https://be.wikipedia.org/wiki/%D0%94%D0%BE%D0%BC-%D0%BC%D1%83%D0%B7%D0%B5%D0%B9_%D0%9A%D0%B0%D1%80%D0%BB%D0%B0_%D0%9C%D0%B0%D1%80%D0%BA%D1%81%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Trier_BW_2014-06-21_11-11-49.jpg","page_title":"Дом-музей Карла Маркса","context_page_description":"Дом-музей Карла Маркса — адзіны ў Германіі музей, прысвечаны жыццю і творчасці Карла Маркса. Музей размешчаны на вуліцы Брукенштрасэ бел. у гістарычным цэнтры горада, за 550 метраў на паўднёвы захад ад Галоўнай рыначнай плошчы."},{"page_url":"https://fr.wikipedia.org/wiki/Old_Crow_Medicine_Show","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Ketch_Secor_on_harmonica_at_Golden_Plains_Festival_in_Meredith_AUSTRALIA_March_2009.jpg","page_title":"Old Crow Medicine Show","context_page_description":"Old Crow Medicine Show est un groupe américain d'americana et de musique country originaire de Nashville, Tennessee."},{"page_url":"https://it.wikipedia.org/wiki/Il_Risorgimento_(Torino)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Il_Risorgimento_21_dicembre_1847.jpg","page_title":"Il Risorgimento (Torino)","context_page_description":"Il Risorgimento, è stato un quotidiano politico pubblicato a Torino nel XIX secolo."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%AF%DB%8C%D9%86%D8%A7_%D8%B1%D9%88%D8%B1%D8%A7%D8%A8%D8%A7%DA%A9%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/FRC_President_Tony_Perkins_presents_the_%22True_Blue%22_award_to_Congressman_Dana_Rohrabacher.jpg","page_title":"دینا روراباکر","context_page_description":"دینا روراباکر آمریکالی سیاستچی و جومهوری حزبینین عوضوو. کورونادو شهرینده دۆنیایا گؤز آچیب."},{"page_url":"https://en.wikipedia.org/wiki/Le_Labo","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Benjamin_D._Maxham_-_Henry_David_Thoreau_-_Restored_-_greyscale_-_straightened.jpg","page_title":"Le Labo","context_page_description":"Le Labo is an Estée Lauder perfume brand based in New York City. The Le Labo \\"Manifesto\\" states that \\"the future of luxury [...] lies in craftsmanship\\" and includes a line from Hafiz and mentions of Wabi-sabi and Thoreau."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D1%80%D0%B5%D0%B1%D0%B1%D0%B5%D1%81%D1%82%D0%B0%D0%B4","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/25/Malkolm%2C_Grebbestad.jpg","page_title":"Греббестад","context_page_description":"Греббестад — небольшой городок в коммуне Танум лена Вестра-Гёталанд, Швеция. Расположен в исторической провинции Бохуслен на берегу Скагеррака, у шоссе 163. Является туристическим центром."},{"page_url":"https://fr.wikipedia.org/wiki/Estoria_de_Espa%C3%B1a","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Estoria_de_espa%C3%B1a.jpg","page_title":"Estoria de España","context_page_description":"La Estoria de España est le nom d'une compilation historiographique entreprise par le roi Alphonse X le Sage de Castille à la fin du XIIIᵉ siècle, en même temps que la General estoria. L'œuvre se proposait de relater l'ensemble des évènements de l'histoire d'Espagne depuis les origines jusqu'au règne d'Alphonse X. Il s'agit d'une compilation d'une importance littéraire et politique capitale, vouée à connaître un succès d'une ampleur considérable durant tout le Moyen Âge ibérique."},{"page_url":"https://pl.wikipedia.org/wiki/Raymond_Rowe","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Raymond_Rowe_2017.jpg","page_title":"Raymond Rowe","context_page_description":"Raymond Rowe – amerykański profesjonalny wrestler, obecnie występujący w federacji WWE w rozwojowym brandzie NXT pod pseudonimem ringowym Rowe. Jest najbardziej znany z występów w drużynie War Machine/War Raiders wraz z Hansonem. Wspólnie z nim jest byłym posiadaczem IWGP Tag Team Championship i ROH World Tag Team Championship."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D0%B0%D1%82%D0%BE%D0%BA%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/aa/Catoca_ast_2001172.jpg","page_title":"Катока","context_page_description":"Катока — алмазний рудник в Анголі. За розмірами — четвертий у світі.\\nУ 2002 році тут видобуто алмазів на 180 млн доларів. Здійснюється друга фаза розвитку рудника, яка дозволить добувати на ньому щорічно алмазів на 350 млн дол."},{"page_url":"https://en.wikipedia.org/wiki/Gretchen_Wilson","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/GretchenWilsonApr10.jpg","page_title":"Gretchen Wilson","context_page_description":"Gretchen Frances Wilson is an American country artist. She made her debut in March 2004 with the Grammy Award-winning single \\"Redneck Woman,\\" a number-one hit on the Billboard country charts. The song served as the lead-off single of her debut album, Here for the Party. Wilson followed this album one year later with All Jacked Up, the title track of which became the highest-debuting single for a female country artist upon its 2005 release. A third album, One of the Boys, was released in 2007.\\nOverall, Wilson has charted 13 singles on the Billboard country charts, of which five have reached Top Ten: the Number One \\"Redneck Woman\\", as well as \\"Here for the Party\\", \\"When I Think About Cheatin'\\", \\"Homewrecker\\", and \\"All Jacked Up\\". The album Here for the Party was certified 5× Multi-Platinum by the RIAA for sales of five million copies, while All Jacked Up was certified platinum. She has sold over 8 million records worldwide."},{"page_url":"https://ro.wikipedia.org/wiki/M%C4%83n%C4%83stirea_Bucium_(jude%C8%9Bul_Bra%C8%99ov)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Man_Bucium_Bv_1.jpg","page_title":"Mănăstirea Bucium (județul Brașov)","context_page_description":"Mănăstirea Bucium este o mănăstire din România situată în satul Bucium, comuna Șinca din județul Brașov.\\nMănăstirea a fost reînființată în 1990, pe ruinele vechiului locaș, atestat documentar în 1737 și ars din ordinul generalului Bukow, trimis de împarăteasa Maria Tereza să înăbușe manifestările creștinilor ortodocși din Țara Făgărașului."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%BB%D0%B0%D0%B2%D0%BD%D1%8F%D1%87%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Glavnja%C4%8Da1.jpg","page_title":"Главняча","context_page_description":"Главняча — историческая тюрьма, находившаяся в старом здании Городского управления Белграда, стоявшем до 1953 года. Здание располагалось между улицами Братьев Юговичей, Симиной и Вишничевой и Студенческой площадью. В здании находились управление городской полиции и тюрьма, два отделения которой были наиболее печально известными — маленькое «Чорка» и большое «Главняча», по которому всё здание и получило название. Главнячу называли тюрьмой для политических заключённых, которые содержались здесь с момента строительства здания в 1864 году и до его сноса в 1953 году. В этой тюрьме также применяли пытки к заключённым, пытаясь выбить из них признание."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%A2%D1%83%D0%BB%D0%BE%D0%BD%D0%B6%D0%B0%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Entr%C3%A9e_et_fa%C3%A7ade_Sud.JPG","page_title":"Тулонжак","context_page_description":"Тулонжак — Францин гӀала-коммуна, лаьтта Окситани регионехь. Коммунан департамент — Аверон. Кхузахь климат барамехь ю, аьхка йовха хуьлу, ткъа Ӏа барамехь-шийла хуьлу. ГӀалин бахархой французаш бу. Официалан Французийн мотт бу."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%A5%D0%B8%D0%BC%D0%B8%D1%8F_%D1%81%D0%B0%D0%BB%D0%B0%D1%81%D1%8B%D0%BD%D0%B4%D0%B0_%D0%9D%D0%BE%D0%B1%D0%B5%D0%BB%D1%8C_%D1%81%D1%8B%D0%B9%D0%BB%D1%8B%D2%93%D1%8B%D0%BD%D1%8B%D2%A3_%D0%BB%D0%B0%D1%83%D1%80%D0%B5%D0%B0%D1%82%D1%82%D0%B0%D1%80%D1%8B%D0%BD%D1%8B%D2%A3_%D1%82%D1%96%D0%B7%D1%96%D0%BC%D1%96","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/13/Giulio_Natta_Nobel.jpg","page_title":"Химия саласында Нобель сыйлығының лауреаттарының тізімі","context_page_description":"Химия саласында Нобель сыйлығы — Бес Нобель сыйлығының бірі, әр жылы Нобель қорымен химия саласындағы жетістіктері үшін ұсынылады."},{"page_url":"https://de.wikipedia.org/wiki/Rotkehlchen","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Erithacus_rubecula_juvenile.JPG","page_title":"Rotkehlchen","context_page_description":"Das Rotkehlchen ist eine Vogelart aus der Familie der Fliegenschnäpper. Es besiedelt Nordafrika, Europa und Kleinasien sowie die Mittelmeerinseln. Seine Nahrung besteht vor allem aus Insekten, kleinen Spinnen, Würmern und Schnecken. Sein Gesang beginnt etwa eine Stunde vor Sonnenaufgang und ist bis in die Dämmerung fast das ganze Jahr über zu hören. Die Art gilt derzeit als ungefährdet.\\nWegen seiner oft geringen Fluchtdistanz, seines Erscheinungsbilds und seiner Häufigkeit ist das Rotkehlchen ein besonderer Sympathieträger. In Christuslegenden steht es Jesus in besonderen Momenten und im Sterben tröstend bei. Zudem wird es als inoffizieller Nationalvogel Großbritanniens mit Weihnachten in Verbindung gebracht. Es hat bei der Entdeckung und wissenschaftlichen Anerkennung des Magnetsinns eine wichtige Rolle gespielt."},{"page_url":"https://pl.wikipedia.org/wiki/Aeroklub_Zag%C5%82%C4%99bia_Miedziowego","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/AZM_005.jpg","page_title":"Aeroklub Zagłębia Miedziowego","context_page_description":"Aeroklub Zagłębia Miedziowego – lotniczy klub sportowy zrzeszony z Aeroklubem Polskim, stowarzyszenie, Certyfikowana Organizacja Szkolenia Lotniczego, Organizacja Pożytku Publicznego, właściciel oraz zarządzający lotniskiem Lubin, sygnatariusz oraz członek Dolnośląskiego Klastra Lotniczego."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%B0%E0%A4%82%E0%A4%97_%E0%A4%AA%E0%A4%9F%E0%A5%8D%E0%A4%9F%E0%A4%BF%E0%A4%95%E0%A4%BE%E0%A4%93%E0%A4%82_%E0%A4%95%E0%A5%80_%E0%A4%B8%E0%A5%82%E0%A4%9A%E0%A5%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/RGB_18bits_palette_sample_image.png","page_title":"रंग पट्टिकाओं की सूची","context_page_description":"यह रंग पट्टिकाओं की सूची एक लेख है, जो कम्प्यूटर ग्राफिक्स्, टर्मिनल एवं वीडियो गेम्स के प्रदर्शकों हेतु बना है।\\nरंग पट्टिका, जिसे रंग पैलेट भी कहते हैं, उसका केवल मात्र एक एक नमूना ही यहाँ दिया है।\\nनमूना परिक्षण सारणी, दी गई है।"},{"page_url":"https://be.wikipedia.org/wiki/%D0%90%D1%81%D0%BB%D1%96%D0%BD%D0%BD%D1%96%D0%BA_%D0%B4%D0%B2%D1%83%D1%85%D0%B3%D0%B0%D0%B4%D0%BE%D0%B2%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Oenothera_x_hoelscheri_-_blossom_%28aka%29.jpg","page_title":"Асліннік двухгадовы","context_page_description":"Аслі́ннік двухгадовы — двухгадовая расліна сямейства Скрыпнёвыя, родам з Паўночнай Амерыкі. У садаводстве разводзяць сарты гібрыднага паходжання."},{"page_url":"https://lt.wikipedia.org/wiki/Aragonas_(up%C4%97)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Watershed_of_the_Aragon-fr.png","page_title":"Aragonas (upė)","context_page_description":"Aragonas – upė Ispanijoje, kairysis Ebro intakas. Prasideda prie Astuno kurorto, Hueskos provincijoje. Teka pro Chakos, Sanguesos, Milagros miestus. Pagrindiniai intakai – Irati ir Arga. Aukščiausia baseino vieta – Pico Collarada 2 886 m.\\n1959 m. prie Jesos miesto pastatyta užtvanka, jos vanduo naudojamas irigacijai."},{"page_url":"https://en.wikipedia.org/wiki/1945_Atlantic_hurricane_season","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5d/1945_Atlantic_hurricane_11_track.png","page_title":"1945 Atlantic hurricane season","context_page_description":"The 1945 Atlantic hurricane season produced multiple landfalling tropical cyclones. It officially began on June 16 and lasted until October 31, dates delimiting the period when a majority of storms were perceived to form in the Atlantic Ocean. A total of 11 systems were documented, including a late-season cyclone retroactively added a decade later. Five of the eleven systems intensified into hurricanes, and two further attained their peaks as major hurricanes. Activity began with the formation of a tropical storm in the Caribbean on June 20, which then made landfalls in Florida and North Carolina at hurricane intensity, causing one death and at least $75,000 in damage. In late August, a Category 3 hurricane on the modern-day Saffir–Simpson hurricane wind scale struck the Texas coastline, with 3 deaths and $20.1 million in damage. The most powerful hurricane of the season, reaching Category 4 intensity, wrought severe damage throughout the Bahamas and East Coast of the United States, namely Florida, in mid-September; 26 people were killed and damage reached $60 million."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BE%D1%80%D1%82%D0%B0_%D1%85%D0%BE%D1%81%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Hosta_%27Iced_Lemon%27.JPG","page_title":"Сорта хост","context_page_description":"Ежегодно регистрируются десятки новых сортов хост. Существует множество сортов, различить которые можно лишь при ближайшем рассмотрении. Иронизируя над создавшейся ситуацией, Тони Эвент сказал: «Предлагаю новое правило для всех селекционеров: если нельзя определить название хосты с расстояния 10 футов, то такой сорт не нужно сохранять».\\nВ зависимости от высоты хосты делят на несколько групп. Международного стандарта относительно точных параметров каждой группы не существует. Размеры растений, относимых к одной и той же группе, в разных странах и у разных поставщиков могут существенно различаться."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B2%D5%A5%D6%80%D6%84%D5%A1%D5%A2%D5%A5%D6%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Noyemberyan_%D0%9D%D0%BE%D0%B5%D0%BC%D0%B1%D0%B5%D1%80%D1%8F%D0%BD.jpg","page_title":"Բերքաբեր","context_page_description":"Բերքաբեր, գյուղ Հայաստանի Տավուշի մարզում, մարզկենտրոնից 22 կմ հյուսիս, Աղստև գետի ձախակողմյան վտակ Ոսկեպար գետի ձորում, Ջողազ գետի հովտում, Սարիգյուղից 3 կմ հյուսիս։ Բարձրությունը ծովի մակերևույթից՝ 700 մ։"},{"page_url":"https://fr.wikipedia.org/wiki/Saison_5_de_How_I_Met_Your_Mother","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Chris_Elliott_1989.jpg","page_title":"Saison 5 de How I Met Your Mother","context_page_description":"Cet article présente les épisodes de la cinquième saison de la série télévisée How I Met Your Mother. La saison contient 24 épisodes, diffusés pour la première fois aux États-Unis entre septembre 2009 et mai 2010."},{"page_url":"https://ca.wikipedia.org/wiki/Pa_de_mort","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Miquiztlaxcalli.JPG","page_title":"Pa de mort","context_page_description":"El Pa de mort mexicà, Pan de muerto, pan de los muertos o dead bread als Estats Units, és una tipus de rotlle dolç que es fa tradicionalment a Mèxic durant les setmanes anteriors a la celebració del Día de Muertos. És una mena de pa tou endolcit que sovint està decorat amb troços allargats ensucrats amb la forma de falanges de dits. Els ossos representen els difunts i també representen les llàgrimes de la deessa Chimalma. Els ossos es disposen en un cercle que representa el cercle de la vida. A la part de dalt del pa de mort hi ha sucre. Sovint s’hi afegeix llavors d’anís. o aigua de taronja."},{"page_url":"https://nl.wikipedia.org/wiki/Chrissie_Wellington","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Chrissie_Wellington.jpg","page_title":"Chrissie Wellington","context_page_description":"Chrissie Wellington is een Britse triatlete. Ze won in 2007, 2008, 2009 en 2011 de Ironman Hawaï. In 2010 werd ze lid en in 2016 officier in de Orde van het Britse Rijk.\\nIn 2014 leidde een petitie van Wellington en de wielrensters Marianne Vos, Emma Pooley en Kathryn Bertine tot de oprichting van de vrouwenwedstrijd La Course by Le Tour de France op de laatste dag van de Ronde van Frankrijk op de Avenue des Champs-Élysées in Parijs."},{"page_url":"https://tr.wikipedia.org/wiki/Mihail_Lomonosov","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/58/Lomonosov%27s_city_gate.jpg","page_title":"Mihail Lomonosov","context_page_description":"Mihail Vasilyeviç Lomonosov, Dünya çapında ünlü Rus bilim adamı.\\nRusya'nın yetiştirdiği en büyük bilim adamlarından biri olan Lomonosov, ansiklopedist, doğa bilimci, fizikçi ve kimyacıdır. Bir disiplin olarak fiziksel kimyayı bugünküne çok yakın bir biçimde tanımlayan ilk kimyacı sıfatıyla tarihe geçmiş ve gelecekte bu alanda yapılması gereken çalışmaların geniş bir programını hazırlamıştır. Moskova Devlet Üniversitesi'nin kurulması projesi de Lomonosov'un eseridir ve 1755 yılında açılan okula yaklaşık 200 sene sonra Lomonosov'un adı verilmiştir. Venüs gezegeninin bir atmosferinin olduğunu ilk kez olarak iddia etmiştir."},{"page_url":"https://la.wikipedia.org/wiki/Sanctus_Paulus_in_Gastina","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/87/Map_commune_FR_insee_code_79286.png","page_title":"Sanctus Paulus in Gastina","context_page_description":"Sanctus Paulus in Gastina, vulgo Saint-Paul-en-Gâtine, est commune Francicum 461 incolarum praefecturae Utrarumque Separarum in provincia occidentali Pictaviensi et Carantonis."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D1%80%D1%8F%D0%BC%D0%BE%D0%B5_%D0%B8%D0%BC%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/%D0%A1%D0%B5%D0%BC%D0%B5%D0%B9%D0%BD%D0%B0%D1%8F_%D0%98%D0%BA%D0%BE%D0%BD%D0%B0_%D0%91%D0%BE%D1%80%D0%B8%D1%81%D0%B0_%D0%93%D0%BE%D0%B4%D1%83%D0%BD%D0%BE%D0%B2%D0%B0.jpg","page_title":"Прямое имя","context_page_description":"Прямое имя — на Руси в XIV—XVI веках христианское имя, которым младенец нарекался в честь того святого, память которого отмечалась в день его рождения.\\nЯвлялось дополнительным, «не публичным» именем; в подавляющем большинстве случаев человека называли другим, основным именем, которое было традиционным именем в его семье.\\nЛучше всего феномен такой двуименности изучен в роду Рюриковичей. Есть свидетельства о бытовании такой двуименности и вне княжеской семьи, и даже в простом народе.\\nНепубличное прямое имя как бы приходило «само собой», не зависело от воли родителей младенца и определялось Божественным промыслом. А публичное княжеское имя, наоборот, выбиралось обдуманно, и соответствовало не только святцам, но и династическим интересам."},{"page_url":"https://es.wikipedia.org/wiki/Ales_(Cerde%C3%B1a)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Ales_-_Panorama_%2801%29.jpg","page_title":"Ales (Cerdeña)","context_page_description":"Ales es una comuna italiana de la provincia de Oristán, Cerdeña, en la región histórica de Marmilla."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%98%D1%81%D1%82%D0%BE%D1%80%D0%B8%D1%8F_%D0%BD%D0%B0_%D0%A1%D0%90%D0%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Scene_at_the_Signing_of_the_Constitution_of_the_United_States.jpg","page_title":"История на САЩ","context_page_description":"Историята на Съединените американски щати, страна в Северна Америка, започва още със заселването на континента преди 15 000 години. Тук обитават различни коренни народи и развиват различни култури. След пътешествието на Христофор Колумб и откриването на Америка през 1492 г. започва колонизация от страна на европейците, които постепенно прогонват индианците от земите им. Докато испанците и португалците колонизират Южна и Централна Америка, териториите на Северна Америка се колонизират основно от англичани и французи, като днешната територия на САЩ е заселена от англичани.\\nКъм 1733 г. има тринадесет английски колонии, които се управляват от губернатори, назначавани от краля, а местни законодателни събрания решават вътрешнополитическите им проблеми. При опит на метрополията да засили властта си в колониите избухва Американската революция, продължила с Война за независимост и завършила на 4 юли 1776 г., когато колониите обявяват независимостта си от Англия с Декларацията за независимост."},{"page_url":"https://cs.wikipedia.org/wiki/Grupa","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Evariste_galois.jpg","page_title":"Grupa","context_page_description":"Grupa je v matematice algebraická struktura, která popisuje a formalizuje koncept symetrie. Formálně se zavádí jako množina spolu s binární operací splňující níže uvedené axiomy. Matematická disciplína zabývající se studiem grup se nazývá teorie grup. Příklady grup jsou celá čísla s operací sčítání, nenulová racionální čísla s operací násobení, symetrie pravidelných geometrických útvarů, množiny regulárních matic a automorfismy různých algebraických struktur.\\nTeorie grup vznikla počátkem 19. století. U jejího zrodu stál matematik Évariste Galois, který dokázal, že polynomiální rovnice nelze obecně řešit pomocí odmocnin. Grupy našly později uplatnění také v geometrii, teorii čísel, algebraické topologii a dalších matematických oborech. Klasifikace jednoduchých konečných grup byla dokončena koncem 20. století a patří k největším výsledkům matematiky vůbec.\\nPojem grupy abstraktně popisuje či zobecňuje mnoho matematických objektů a má významné uplatnění i v příbuzných oborech – ve fyzice, informatice a chemii. Reprezentace grup hrají důležitou úlohu v teoriích jako jsou částicová fyzika, kvantová teorie pole anebo teorie strun."},{"page_url":"https://it.wikipedia.org/wiki/Mica","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c3/Mica.jpg","page_title":"Mica","context_page_description":"Le miche sono un gruppo di minerali appartenente ai fillosilicati. Le miche sono caratterizzate da una struttura a strati e una perfetta sfaldatura. Questi minerali generalmente cristallizzano nel sistema cristallino monoclino, con una tendenza a formare cristalli con morfologia pseudo-esagonale."},{"page_url":"https://bs.wikipedia.org/wiki/Papaveraceae","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Flickr_-_brewbooks_-_Island_Tree_Poppy_%281%29.jpg","page_title":"Papaveraceae","context_page_description":"Papaveraceae je ekonomski značajna porodica makova, sa oko 42 roda i približno 775 poznatih vrsta cvjetnica u redu Ranunculales. Porodica je kosmopolitski raširena, a javlja se u umjerenom i suptropskom podneblju, ali gotovo je nepoznata u tropima. Većina je zeljastih biljaka, ali nekolicina je grmolika i malih stablašica. Porodica sada uključuje dvije grupe za koje se smatra da su zasebne porodice: Fumariaceae i Pteridophyllaceae.\\nPorodica je kosmopolitska, javlja se u umjerenom i suptropskom podneblju, ali gotovo je nepoznata u tropima. Većina je zeljastih, ali nekolicina je grmolika a ima malih stablašica. Porodica uključuje dvije grupe za koje se smatra da su zasebne porodice: Fumariaceae i Pteridophyllaceae."},{"page_url":"https://hu.wikipedia.org/wiki/Poilcourt-Sydney","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Poilcourt-Sydney_-_la_Mairie_-_Photo_Francis_Neuvens_lesardennesvuesdusol.fotoloft.fr.JPG","page_title":"Poilcourt-Sydney","context_page_description":"Poilcourt-Sydney település Franciaországban, Ardennes megyében. Lakosainak száma 182 fő. Poilcourt-Sydney Brienne-sur-Aisne, Houdilcourt, Vieux-lès-Asfeld, Auménancourt és Saint-Étienne-sur-Suippe községekkel határos."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%83%AC%E3%82%AD%E3%82%B5%E3%83%B3%E3%83%80%E3%83%BC%E3%83%BB%E3%82%A6%E3%82%A3%E3%83%BC%E3%83%8A%E3%83%BC%E3%83%99%E3%83%AB%E3%82%AC%E3%83%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Alexander_Wienerberger_Holodomor9.jpg","page_title":"アレキサンダー・ウィーナーベルガー","context_page_description":"アレキサンダー・ウィーナーベルガーは、オーストリア＝ハンガリー帝国出身の化学技術者で、ソ連の化学企業に19年間勤務した。ハリコフで働きながら撮った1932年-1933年のホロドモールに関する一連の写真は、当時のウクライナの人々の大量飢餓の証拠写真となっている。"},{"page_url":"https://de.wikipedia.org/wiki/Protagoras_(Platon)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Socrates_Louvre.jpg","page_title":"Protagoras (Platon)","context_page_description":"Der Protagoras ist ein in Dialogform verfasstes Werk des griechischen Philosophen Platon. Wiedergegeben wird ein fiktives Gespräch von Platons Lehrer Sokrates mit dem Sophisten Protagoras, der als Lehrmeister nach Athen gekommen ist. Protagoras behauptet, die Fähigkeit zu erfolgreichem Auftreten vermitteln zu können. Nebenfiguren des Dialogs sind der reiche Kallias als Gastgeber des Protagoras, der Sophist Hippias von Elis, der Rhetoriklehrer Prodikos von Keos, die vornehmen, später als Politiker einflussreichen Athener Alkibiades und Kritias sowie ein junger Bekannter des Sokrates namens Hippokrates. Die Diskussion dreht sich vor allem um Kernthemen der platonischen Ethik: die Handlungstheorie und die Frage, ob die aretḗ ein lehrbares Wissen ist.\\nDer Dialog ist in eine Rahmenhandlung eingebettet: Sokrates erzählt, wie er Protagoras aufgesucht und in ein Streitgespräch verwickelt hat. Den Anlass und Hintergrund bildete die Absicht des Hippokrates, ein zahlender Schüler des Sophisten zu werden. Davon hielt Sokrates nichts. Als scharfer Gegner der Sophistik versuchte er in der Debatte die Faszination, die vom Ruhm des Protagoras ausging, zu zerstören."},{"page_url":"https://nl.wikipedia.org/wiki/Rojava","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Northern_Syria_-_Rojava_october_2016.png","page_title":"Rojava","context_page_description":"De Democratische Federatie van Noord-Syrië, Syrisch-Koerdistan of West-Koerdistan, Koerdisch: Rojavayê Kurdistanê; Arabisch: کوردستان السورية Kurdistan Al-Suriyah, is een de facto autonome regio in het noorden en noordoosten van Syrië. Het gebied staat vooral bekend onder de naam Rojava. In dit gebied wonen ook veel Arameeërs.\\nDe Koerden beschouwen Syrisch-Koerdistan als onderdeel van een groter Koerdistan dat ook delen omvat van Zuidoost-Turkije, Noordoost-Irak en Noordwest-Iran. De plaatselijke macht de PYD en zijn militaire vleugel de YPG voorzien geen onafhankelijk of autonoom Koerdistan voor de Koerden in Rojava, maar een volkerenautonomie genaamd Noord-Syrië.\\nIn de loop van de Syrische Burgeroorlog trokken Syrische regeringstroepen zich terug uit drie Koerdische enclaves en gaven ze de controle aan de volksbeschermingseenheden.\\nDe strijdkrachten van Ro­ja­va bestaan uit: Volksbeschermingseenheden en Vrouwelijke Volksbeschermingseenheden."},{"page_url":"https://en.wikipedia.org/wiki/Strabena_zanjuka","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Strabena_zanjuka.JPG","page_title":"Strabena zanjuka","context_page_description":"Strabena zanjuka is a butterfly in the family Nymphalidae. It is found on Madagascar."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E7%8F%8D%E5%A6%AE%E4%BD%9B%C2%B7%E5%BA%B7%E7%B4%8D%E8%8E%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Jennifer_Connelly_2012.jpg","page_title":"珍妮佛·康納莉","context_page_description":"詹妮弗·琳恩·康纳利，美国女演员，奥斯卡奖得主。十几岁起即在电影产业工作，并且因为参加《魔幻迷宫》和《神采飞扬》等电影的演出而获得知名度，但一直到2000年演出《梦之安魂曲》和2001年的传记电影《美丽心灵》获得奥斯卡最佳女配角奖后演技才获得大众认同。"},{"page_url":"https://es.wikipedia.org/wiki/Fatah-RC","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Iraq%2C_Saddam_Hussein_%28222%29.jpg","page_title":"Fatah-RC","context_page_description":"Fatah-Consejo Revolucionario es el nombre oficial de una organización terrorista dirigida por Sabrí Jalil al-Banna, mejor conocido como Abu Nidal, hasta su asesinato en 2002. Después de su muerte Fatah-RC no ha vuelto a aparecer en los medios, y está considerado como disuelto. Los orígenes del grupo radican en el grupo militante más famoso Fatah desde Yasir Arafat."},{"page_url":"https://la.wikipedia.org/wiki/Forges_(Cenomannica_et_Liger)","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f1/Map_commune_FR_insee_code_49141.png","page_title":"Forges (Cenomannica et Liger)","context_page_description":"Forges est commune Francicum 262 incolarum praefecturae Cenomannicae et Ligeris in regione Pagis Ligeris."},{"page_url":"https://it.wikipedia.org/wiki/Nieste","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Wappen_Nieste_%28Gemeinde%29.png","page_title":"Nieste","context_page_description":"Nieste è un comune tedesco di 1.895 abitanti, situato nel land dell'Assia."},{"page_url":"https://nl.wikipedia.org/wiki/Skulpturenpark_Zollverein","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/80/Skulpturenpark_Zollverein_IMGP5219_wp.jpg","page_title":"Skulpturenpark Zollverein","context_page_description":"Skulpturenpark Zollverein is een beeldenpark met werken van de Duitse beeldhouwer Ulrich Rückriem.\\nHet beeldenpark is aangelegd op een afgeplatte Halde tussen schacht XII en de cokesfabriek van de in 1986 stilgelegde kolenmijn Zeche Zollverein in de Duitse stad Essen.\\nHet beeldenpark maakt deel uit van de ontwikkeling door de Stichting Zollverein van de gebouwen en het omliggende terrein van de voormalige kolenmijn tot cultureel centrum en natuurgebied. De aanwezigheid van Ulrich Rückriem op DOCUMENTA IX was de directe aanleiding tot het inrichten van een beeldenpark met 6 werken.\\nEnkele beelden bevinden zich niet op de steenberg, maar in het nabijgelegen Skulpturenwald.\\nHet Kolenmijn- en industriecomplex Zeche Zollverein is onderdeel van de Europese Industrieel Erfgoedroute en staat sinds 2001 op de Werelderfgoedlijst van de UNESCO. Zeche Zollverein is in 2010 het culturele centrum van Ruhr.2010 - Kulturhauptstadt Europas geweest."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%AD%D1%80%D0%BE%D0%BD%D0%B3%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Leuchtturm_Swakopmund.jpg","page_title":"Эронго","context_page_description":"Эронго — является одной из 14 административных областей Намибии. Находится в западной части страны, в центре атлантического побережья Намибии. Площадь области составляет 63 579 км². Численность населения 150 809 человек. Административный центр — город Свакопмунд."},{"page_url":"https://pl.wikipedia.org/wiki/Bie%C5%BCan%C3%B3w","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f1/Biezanow-kosciol2006.jpg","page_title":"Bieżanów","context_page_description":"Bieżanów – obszar Krakowa wchodzący w skład Dzielnicy XII Bieżanów-Prokocim.\\nDawna wieś w dolinie Serafy, przy trakcie do Wieliczki, Bochni i dalej na Ruś, 10 km na południowy wschód od centrum Krakowa. Północna granica wsi biegła przez łąki i tereny przemysłowe po południowej stronie obecnej ulicy Botewa oraz korytem Drwiny Długiej, zachodnia obecną ulicą Jerzmanowskiego, Podmiłłów i w rejonie ulicy Kosiarzy, z południowym i wschodnim krańcem Bieżanowa pokrywa się obecna granica administracyjna miasta Krakowa.\\nWieś sufraganii krakowskiej w powiecie szczyrzyckim województwa krakowskiego w końcu XVI wieku."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%A1%9C%EB%A7%88_%EC%A0%9C%EA%B5%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Statue-Augustus.jpg","page_title":"로마 제국","context_page_description":"로마 제국은 황제 지배 체제 혹은 원수정을 사실상 시작한 기원전 27년부터 몰락까지의 로마를 일컫는다. 로마 제정 시대의 종식은 395년 동서 로마의 분할, 476년 서로마 제국 멸망, 1453년 동로마 제국 멸망 등 관점에 따라 다르게 볼 수 있다.\\n로마 제국은 지중해 동부의 헬레니즘 문화권과 이집트, 유대, 서부의 옛 카르타고, 히스파니아, 갈리아 등의 기존 영토에 이어 브리타니아와 라인 강 서쪽의 게르마니아, 그리스 북쪽의 다키아까지 판도를 넓혔다. 이러한 패권주의는 로마 제국에 막대한 부를 안겨주었을 뿐만 아니라, 로마 제국의 문화를 고대 지중해 세계에 널리 퍼뜨려, 로마 제국의 건축, 법, 정치, 종교 등이 전해지게 되었다."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B0%D0%BD%D1%82%D0%B5,_%D0%9B%D0%BE%D1%80%D0%B0%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Laurent_Cantet.jpg","page_title":"Канте, Лоран","context_page_description":"Лора́н Канте́ — французский кинорежиссёр."},{"page_url":"https://sh.wikipedia.org/wiki/Splitsko_plemstvo","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Ti%C5%A1%C4%8Di%C4%87_1.JPG","page_title":"Splitsko plemstvo","context_page_description":"Splitsko plemstvo, povlašteni društveni stalež u srednjovjekovnom i novovjekovnom gradu Splitu, čiji su članovi i obitelji sudjelovali u političkom, kulturnom i društvenom životu gradske komune."},{"page_url":"https://fr.wikipedia.org/wiki/Perry%27s_Victory_and_International_Peace_Memorial","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Perry%27s_Victory_and_International_Peace_Memorial_Vistor%27s_Center.jpg","page_title":"Perry's Victory and International Peace Memorial","context_page_description":"Le Perry's Victory and International Peace Memorial est un monument national commémoratif géré par le National Park Service situé sur l'île South Bass, sur le lac Érié dans le comté d'Ottawa, aux États-Unis.\\nIl est inscrit au Registre national des lieux historiques depuis le 15 octobre 1966 sous le n° 66000118."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D1%82%D1%80%D1%96%D0%BB%D1%8F%D0%BD%D0%B8%D0%BD%D0%B0_%D0%B2_%D1%80%D0%B5%D0%B4%D0%B0%D0%BA%D1%86%D1%96%D1%97_%D0%B3%D0%B0%D0%B7%D0%B5%D1%82%D0%B8_%C2%AB%D0%A8%D0%B0%D1%80%D0%BB%D1%96_%D0%95%D0%B1%D0%B4%D0%BE%C2%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Philippe_Honor%C3%A9%2C_dessinateur_de_Charlie_Hebdo_%28crop%29.jpg","page_title":"Стрілянина в редакції газети «Шарлі Ебдо»","context_page_description":"Стрілянина в редакції газети «Charlie Hebdo» — напад двох або трьох невідомих осіб на офіс редакції французького сатиричного щотижневика «Charlie Hebdo» 7 січня 2015 року в Парижі. Напад спричинив як мінімум 12 смертей. Напад пов'язують з помстою радикальних ісламістів.\\nВвечері того ж дня поліція Франції встановила трьох підозрюваних у нападі — громадян Франції алжирського походження, уродженців Парижа братів Саїда і Шерифа Кауші у віці 34 і 32 років, які раніше підозрювалися в участі в джихадистських організаціях. Двома днями пізніше, вранці 9 січня, вони захопили друкарню в місті Даммартен-ан-Гоель, де їх ввечері і було вбито французькою поліцією. Їх спільник, який не брав участі в атаці, а, за його власним зізнанням, «відповідав за поліцейських», француз сенегальського походження Амеді Кулібалі, 8 січня вбив жінку-поліцейського в місті Монружі, а 9 січня захопив заручників у кошерній крамниці на сході Парижа, де його також було вбито ввечері французькою поліцією."},{"page_url":"https://zh.wikipedia.org/wiki/2010%E5%B9%B4%E8%81%AF%E5%90%88%E5%9C%8B%E6%B0%A3%E5%80%99%E8%AE%8A%E5%8C%96%E5%A4%A7%E6%9C%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/2010_UN_Climate_Talks.jpg","page_title":"2010年聯合國氣候變化大會","context_page_description":"2010年联合国气候变化大会是于2010年11月29日至12月10日在墨西哥坎昆举行的“《联合国气候变化纲要公约》缔约方第16次会议”，缩写为“COP16”。这次会议亦是《京都议定书》签字国第六次会议，缩写为“CMP6”。"},{"page_url":"https://tr.wikipedia.org/wiki/Erdal_Eren","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Zekeriya_%C3%96nge.jpg","page_title":"Erdal Eren","context_page_description":"Erdal Eren, 12 Eylül Darbesi öncesinde bir askeri inzibat erini öldürdüğü suçlamasıyla hüküm giyen ve darbeden sonra asılarak idam edilen Yurtsever Devrimci Gençlik Derneği üyesi ve Ankara Yapı Meslek Lisesi öğrencisi."},{"page_url":"https://es.wikipedia.org/wiki/Abad%C3%ADa_de_Forest","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Forest_060106_%2810%29.JPG","page_title":"Abadía de Forest","context_page_description":"La Abadía de Forest fue fundada en 1150 a orillas de un arroyo afluente del\\nrío Senne, al sur de la ciudad de Bruselas. Abadía benedictina de «damas nobles», fue desconsagrada en 1796 y vendida al año siguiente. Los edificios que sobrevivieron el desmantelamiento son hoy un centro cultural dedicado a la celebración de seminarios, banquetes y exposiciones, perteneciente a la comuna bruselense de Forest. La abadía está catalogada como monumento histórico desde 1994."},{"page_url":"https://fr.wikipedia.org/wiki/Passiflora_quadrangularis","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Badea.jpg","page_title":"Passiflora quadrangularis","context_page_description":"La barbadine, ou grenadille géante, fait partie de la famille des Passifloraceae et c'est le fruit de cette liane tropicale."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%A4%87%E5%90%88%E6%A7%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Combination_gun_examples.svg","page_title":"複合槍","context_page_description":"複合槍是一種具有至少一根刻有膛線的步槍槍管和一根散彈槍槍管，並以中折式裝填原理操作的狩獵用槍械。它們的槍管通常以上下並排的形式排列，而槍管左右並排的複合槍則被稱為「斗篷槍」。三管複合槍「Drilling」是一種具有三根槍管的複合槍，四管複合槍「Vierling」則具有四根槍管。複合槍通常發射凸緣式子彈，這是考慮到無緣式子彈的彈殼較難從中折式槍械中抽出。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A0%D0%BE%D0%B7%D0%B5%D0%BD%D0%B4%D0%B0%D0%BB%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Schloss_Darfeld_mit_Schlosskapelle_und_S%C3%BCdfl%C3%BCgel.jpg","page_title":"Розендаль","context_page_description":"Розендаль — сільська громада в Німеччині, знаходиться в землі Північний Рейн-Вестфалія. Підпорядковується адміністративному округу Мюнстер. Входить до складу району Кесфельд.\\nПлоща — 94 км². Населення становить 10 614 ос."},{"page_url":"https://pl.wikipedia.org/wiki/Stanley_Rocket","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7f/N041921.jpg","page_title":"Stanley Rocket","context_page_description":"Stanley Rocket – samochód parowy skonstruowany przez przedsiębiorstwo Stanley na początku XX wieku. Pierwszy pojazd drogowy, który przekroczył barierę prędkości 200 km/h. Choć ustanowiony przez niego w 1906 roku rekord prędkości na lądzie został pobity przez samochód o silniku spalinowym w 1924 roku, pozostał rekordzistą prędkości wśród samochodów parowych przez ponad sto lat – do 26 sierpnia 2009 roku. Jedyny egzemplarz Stanley Rocket uległ zniszczeniu podczas próby pobicia rekordu prędkości w 1907 roku."},{"page_url":"https://en.wikipedia.org/wiki/Michel_Aflaq","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Leaders_of_July_14_1958_Revolution.jpg","page_title":"Michel Aflaq","context_page_description":"Michel Aflaq was a Syrian philosopher, sociologist and Arab nationalist. His ideas played a significant role in the development of Ba'athism and its political movement; he is considered by several Ba'athists to be the principal founder of Ba'athist thought. He published various books during his lifetime, the most notable being The Battle for One Destiny and The Struggle Against Distorting the Movement of Arab Revolution.\\nBorn into a middle-class family in Damascus, Syria, Aflaq studied at the Sorbonne, where he met his future political companion Salah al-Din al-Bitar. He returned to Syria in 1932, and began his political career in communist politics. Aflaq became a communist activist, but broke his ties with the communist movement when the Syrian–Lebanese Communist Party supported France's colonial policies. Later in 1940 Aflaq and al-Bitar established the Arab Ihya Movement. The movement proved successful, and in 1947 the Arab Ba'ath Movement merged with al-Arsuzi's Arab Ba'ath organisation to establish the Arab Ba'ath Party. Aflaq was elected to the party's executive committee and was elected \\"'Amid\\"."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_de_Rabat","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Bab_Laalou_1.jpg","page_title":"Liste des monuments de Rabat","context_page_description":"Ceci est une liste des monuments classés par le ministère de culture marocain aux alentours de Rabat."},{"page_url":"https://gl.wikipedia.org/wiki/Praias_da_provincia_da_Coru%C3%B1a","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Praia_do_Raso_Ares_A_Coru%C3%B1a_Spain.jpg","page_title":"Praias da provincia da Coruña","context_page_description":"Esta é unha lista parcial das máis de 360 praias da provincia da Coruña dos concellos litorais de: Ares, Arteixo, Bergondo, Boiro, Cabana de Bergantiños, Cabanas, Camariñas, Carballo, Cariño, Carnota, Cedeira, Cee, Corcubión, A Coruña, Dumbría, Ferrol, Fisterra, A Laracha, Laxe, Malpica de Bergantiños, Mañón, Miño, Mugardos, Muros, Muxía, Noia, Oleiros, Ortigueira, Outes, Ponteceso, Pontedeume, Porto do Son, A Pobra do Caramiñal, Rianxo, Ribeira, Sada e Valdoviño."},{"page_url":"https://sv.wikipedia.org/wiki/Elektr%C4%97nai","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Flag_of_Elektr%C4%97nai.jpg","page_title":"Elektrėnai","context_page_description":"Elektrėnai är en stad i centrala Litauen belägen mellan huvudstaden Vilnius och Kaunas. Staden hade 12 012 invånare 2011 och grundades 1961. Främst känd är staden för att vara Litauens ishockeyhögborg, och de båda NHL-spelarna Dainius Zubrus och Darius Kasparaitis kommer Elektrėnai."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Chenay_(Marne)","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8e/Map_commune_FR_insee_code_51145.png","page_title":"Chenay (Marne)","context_page_description":"Chenay sī ūi-tī Hoat-kok Champagne-Ardenne toā-khu Marne koān ê chi̍t ê commune."},{"page_url":"https://sv.wikipedia.org/wiki/L%C3%A4nsv%C3%A4g_260","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/%C3%84ltav%C3%A4gen_2009.jpg","page_title":"Länsväg 260","context_page_description":"Länsväg 260 Är en nord-sydlig tvärlänk som går mellan Lugnets trafikplats på gränsen mellan Stockholm och Nacka till Handens trafikplats under riksväg 73, via Sickla, Saltsjö-Järla, Hästhagen, Älta, Trollbäcken och Vendelsö."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%95%D7%A4%D7%9C_%D7%90%D7%A1%D7%A7%D7%95%D7%A0%D7%94_A","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Opel_Ascona_%286670751341%29.jpg","page_title":"אופל אסקונה A","context_page_description":"אופל אסקונה A היא מכונית משפחתית, מתוצרת יצרן הרכב הגרמני אופל, חברת בת של קונצרן הרכב ג'נרל מוטורס, שיוצרה בין השנים 1970–1975 בגרמניה."},{"page_url":"https://en.wikipedia.org/wiki/South_Florida_Science_Center_and_Aquarium","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/South_Florida_Science_Center_and_Aquarium.jpg","page_title":"South Florida Science Center and Aquarium","context_page_description":"The South Florida Science Center and Aquarium is located at 4801 Dreher Trail North, West Palm Beach, Florida, USA. Founded in 1959, the goal of the organization is to open every mind to science through the strategic programming of interactive exhibits and engaging community-based camps and events. The SFSCA has expanded since its creation and now houses over 50 hands-on exhibits, a planetarium, a 3000 square foot aquarium, a miniature golf course, and a large exhibit space that displays a temporary travelling exhibit. The SFSCA is a member of the ASTC program, which offers a membership that is redeemable at other ASTC science and technology centers around the world. The SFSCA occupies Dreher Park alongside the Palm Beach Zoo and offers deals for entrance to both facilities. The phone number for the South Florida Science Center and Aquarium is 832-1988."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D1%96%D1%80%D0%BC%D0%B5%D0%BD%D1%81%D1%8C%D0%BA%D0%B0_%D1%86%D0%B5%D1%80%D0%BA%D0%B2%D0%B0_(%D0%A7%D0%B5%D1%80%D0%BD%D1%96%D0%B2%D1%86%D1%96)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/%D0%92%D1%96%D1%80%D0%BC%D0%B5%D0%BD%D1%81%D1%8C%D0%BA%D0%B0_%D0%BA%D0%B0%D1%82%D0%BE%D0%BB%D0%B8%D1%86%D1%8C%D0%BA%D0%B0_%D1%86%D0%B5%D1%80%D0%BA%D0%B2%D0%B0_%D0%A1%D0%B2%D1%8F%D1%82%D0%B8%D1%85_%D0%B0%D0%BF%D0%BE%D1%81%D1%82%D0%BE%D0%BB%D1%96%D0%B2_%D0%9F%D0%B5%D1%82%D1%80%D0%B0_%D1%82%D0%B0_%D0%9F%D0%B0%D0%B2%D0%BB%D0%B0.Jpg","page_title":"Вірменська церква (Чернівці)","context_page_description":"Вірменська церква Чернівців — діюча вірменська католицька церква східного обряду Святих апостолів Петра та Павла в місті Чернівці. Збудована і освячена 1875 року, функціонує з перервою на час перебування радянської влади на Буковині. Занесена до списку будівель, які охороняються державою.\\nЗавдяки прекрасній акустиці, наявності органу з самого початку і до сьогодні використовується для проведення концертів та інших культурних заходів."},{"page_url":"https://ca.wikipedia.org/wiki/Casa_Ravanals","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Casa_Ravanals.JPG","page_title":"Casa Ravanals","context_page_description":"La casa Ravanals és un edifici de Xerta ubicat al carrer Major nº 14 i protegit com a bé cultural d'interès local."},{"page_url":"https://id.wikipedia.org/wiki/Pemerintahan_Sementara_Republik_Korea","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Birthplace_of_the_Provisional_Government_of_the_Republic_of_Korea.jpg","page_title":"Pemerintahan Sementara Republik Korea","context_page_description":"Pemerintahan Sementara Korea, secara resmi Pemerintahan Sementara Republik Korea adalah pemerintahan Korea dalam pengasingan yang bermarkas di Shanghai, Tiongkok dan kemudian di Chongqing. Pemerintahan ini didirikan segera setelah meletusnya gerakan 1 Maret yang menentang pemerintahan kolonial Jepang.\\nPada tanggal 11 April 1919, konstitusi sementara diberlakukan, dan kedaulatan nasional disebut \\"Republik Korea\\" dan sistem politiknya disebut \\"Republik Demokratik\\". Dengan memperkenalkan sistem presidensial dan mendirikan tiga sistem pemisahan legislatif, administratif dan yudikatif yang terpisah, Pemerintahan Sementara mewarisi wilayah bekas Kekaisaran Korea dan menyatakan bahwa ia lebih menyukai bekas istana kekaisaran. KPG secara aktif mendukung dan mendukung gerakan kemerdekaan di bawah pemerintahan sementara, dan menerima dukungan ekonomi dan militer dari Kuomintang Tiongkok, Uni Soviet dan Republik Ketiga Prancis.\\nSetelah menyerahnya Jepang pada 15 Agustus 1945, tokoh seperti Kim Gu kembali. Pada 15 Agustus 1948, Pemerintahan Sementara Republik Korea dibubarkan."},{"page_url":"https://es.wikipedia.org/wiki/Hacienda_de_San_Miguel_Regla","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/EntranceSanMiguelRegla1.JPG","page_title":"Hacienda de San Miguel Regla","context_page_description":"La hacienda de San Miguel Regla; esta construcción del siglo XVIII que fuera una hacienda de beneficio perteneciente del conde de Regla, Pedro Romero de Terreros; se conserva parte del casco, donde funciona un hotel, los arcos que formaban parte de los patios y los hornos donde era extraída la plata.​ Se localiza en la localidad de San Miguel Regla, en el municipio de Huasca de Ocampo, dentro del estado de Hidalgo en México.​"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B8%E3%83%A5%E3%83%BC%E3%83%8A%E3%83%BB%E3%83%90%E3%83%BC%E3%83%B3%E3%82%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Saint-Sulpice_fountain_and_church.jpg","page_title":"ジューナ・バーンズ","context_page_description":"ジューナ・バーンズは、アメリカ合衆国の著作家。1910年代にグリニッジ・ヴィレッジで、さらに1920年代・1930年代にパリでボヘミアン的生活を送りながら執筆活動を続け、20世紀モダニズム英文学の発展に重要な役割を演じた。小説『夜の森』はT・S・エリオットの紹介にも助けられ、近代小説のカルト的作品となった。レズビアンをテーマとした描写や独特の文体で今日でも光彩を放っている。バーンズの死後、その作品に関する興味が上がり、作品の多くが再版された。"},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Windom_(Texas)","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/06/TXMap-doton-Windom.PNG","page_title":"Windom (Texas)","context_page_description":"Windom sī Bí-kok Texas chiu Fannin kūn ê chi̍t ê chng-thâu.\\nChe sī chi̍t phiⁿ koan-î Bí-kok Texas Chiu tē-lí ê phí-á-kiáⁿ. Chhiáⁿ tàu khok-chhiong."},{"page_url":"https://de.wikipedia.org/wiki/Burschenschaft_Alemannia_Leipzig","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Zirkel_Alemannia_Leipzig.jpg","page_title":"Burschenschaft Alemannia Leipzig","context_page_description":"Die Leipziger Burschenschaft Alemannia zu Bamberg und die Burschenschaft Alemannia Leipzig sind zwei eigenständige, farbentragende Studentenverbindungen mit christlich-burschenschaftlicher Ausrichtung an der Otto-Friedrich-Universität Bamberg sowie an der Universität Leipzig und den Leipziger Hochschulen. Beide Verbindungen haben ihren Ursprung in der 1861 in Leipzig gegründeten Burschenschaft Alemannia. Bedingt durch die politische und historische Entwicklung in Mitteldeutschland wurde die Tradition der Burschenschaft Alemannia nach 1945 zunächst an der Friedrich-Alexander-Universität Erlangen und später an der Otto-Friedrich-Universität Bamberg fortgeführt. Erst 2009 gelang der bis heute in Bamberg bestehenden Leipziger Burschenschaft Alemannia die Wiedergründung in Leipzig. Seitdem bestehen an den Hochschulorten Bamberg und Leipzig zwei eigenständige Burschenschaften auf Grundlage derselben Tradition und verbunden durch ein bundesbrüderliches Verhältnis."},{"page_url":"https://vi.wikipedia.org/wiki/Minh_V%C5%A9_T%C3%B4ng","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/%E5%B1%B1%E8%A5%BF%E5%BA%94%E5%8E%BF%E6%9C%A8%E5%A1%94%E6%98%8E%E4%B8%87%E5%8E%86%E5%8C%BE%E9%A2%9D.JPG","page_title":"Minh Vũ Tông","context_page_description":"Minh Vũ Tông là vị Hoàng đế thứ 11 của nhà Minh trong lịch sử Trung Quốc. Ông trị vì từ năm 1505 đến năm 1521, trong suốt thời gian 16 năm tại vị, ông chỉ dùng niên hiệu là Chính Đức, nên các sử gia trong sử sách còn gọi ông là Chính Đức Đế.\\nPhần đông sử gia mô tả Vũ Tông là một vị hoàng đế gian dâm, phóng đãng và có những sở thích quái lạ, song cũng có những ý kiến trái ngược. Như việc ông trừ khử hoạn quan Lưu Cẩn và bình định Ninh vương chi loạn, Ứng Châu đại tiệp; phần nào cho thấy Vũ Tông cũng là một vị hoàng đế có năng lực, quyết đoán."},{"page_url":"https://nl.wikipedia.org/wiki/Antonius-drieluik","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Flying_fish_with_two_people_-_detail_of_the_painting_Temptation_of_Saint_Anthony.jpg","page_title":"Antonius-drieluik","context_page_description":"Het Antonius-drieluik, ook De verzoeking of De temptatie van de heilige Antonius genoemd, is een drieluik van de Nederlandse schilder Jheronimus Bosch in het Museu Nacional de Arte Antiga in Lissabon."},{"page_url":"https://de.wikipedia.org/wiki/Sperrstelle_M%C3%BClenen","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Sperrstelle_M%C3%BClenen.png","page_title":"Sperrstelle Mülenen","context_page_description":"Die Sperrstelle Mülenen war eine Verteidigungsstellung der Schweizer Armee. Sie befindet sich in der Ortschaft Mülenen an der Lötschberglinie im Kandertal im Berner Oberland. Die Sperre wurde 1941/42 gebaut und gehörte zum Einsatzraum der 3. Division und ab 1947 der Reduitbrigade 21.\\nSie gilt als militärhistorisches Denkmal von regionaler Bedeutung."},{"page_url":"https://de.wikipedia.org/wiki/Projektron_BCS","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Projektron_BCS_-_Drei_schichten_Architektur.png","page_title":"Projektron BCS","context_page_description":"Projektron BCS ist eine kommerzielle webbasierte Projektmanagementsoftware für das Multiprojektmanagement."},{"page_url":"https://en.wikipedia.org/wiki/Demographic_history_of_the_Vilnius_region","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Podzial_wojewodztwa_wilenskiego_1937.png","page_title":"Demographic history of the Vilnius region","context_page_description":"The city of Vilnius, now the capital of Lithuania, and its surrounding region have at various times come under Lithuanian, Russian, Polish, German, and Soviet rule. The population has been categorised by linguistic and sometimes also religious indicators. At the end of the 19th century the main languages spoken were Polish, Lithuanian, Belarusian and Russian. Both Catholic and Orthodox Christianity were represented, while a large proportion of the city's inhabitants were Jews. The \\"Lithuanian\\" element was seen as declining, while the \\"Slavic\\" element was increasing.\\nCensus data are available from 1897 onward, although the territorial boundaries and ethnic categorisation have not been consistent. The Jewish population decreased greatly because of the Holocaust of 1941-44, and subsequently many Poles were removed from the city, but less so from the surrounding countryside. Consequently, recent Census figures show a predominance of Lithuanians in the city of Vilnius, but of Poles in the Vilnius district outside the city."},{"page_url":"https://tr.wikipedia.org/wiki/Q_klavye","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Sik_kullanilan_tuslar_f.svg","page_title":"Q klavye","context_page_description":"Q klavye ya da QWERTY, dünyada en çok kullanılan ve özellikle İngilizce konuşulan ülkelerde yaygın olan bilgisayar ve daktilo klavyesi.\\nQ klavyenin patentini, 1874'te Christopher Latham Sholes tarafından almış ve Sholes aynı yıllarda QWERTY'nin patentini daktilo işleriyle uğraşan E. Remington and Sons şirketine satmıştır. Günümüzde NASA, Sholes'un anısına, bir astroidi \\"6600 Qwerty\\" olarak adlandırmıştır.\\nAncak Q klavye standardı ne İngilizce ne de başka bir dile uygun olarak geliştirilmiştir. Christopher Latham Sholes, icat ettiği yazı makinesinin mekanik harf kollarından herhangi ikisi aynı anda kağıda doğru havalandığında sıkışmaya neden olduklarını fark eder. Sholes bu problemin çözümü için, kullanıcının yazım hızını yavaşlatmak üzere harflerin yerlerini alabildiğine karıştırarak en çok kullanılan harfleri elin en zor ulaşabileceği yerlere yerleştirmeyi uygun görür ve Q klavye adını verdiğimiz harf dizilimi ortaya çıkar.\\nBir söylentiye göre de ilk üretilen yazı makinesinin adı “Sholes & Glidden Type Writer” olarak geçer. Buradaki “Type Writer” kelimelerini oluşturan harflerin tamamı Q klavyenin en üst sırasında yer almaktadır."},{"page_url":"https://fr.wikipedia.org/wiki/Landivisiau","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Bagad_Landi_-_Gouel_Bro_Leon_05.JPG","page_title":"Landivisiau","context_page_description":"Landivisiau [lɑ̃divizjo] est une commune du département du Finistère, dans la région Bretagne, en France.\\nSituée dans le nord du département, la ville est la capitale historique du cheval breton."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1943","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Cannes_2014_Texas_Chain_Saw_Massacre_3.jpg","page_title":"Lijst van personen geboren in 1943","context_page_description":"Dit is een lijst van personen die geboren zijn in 1943.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://pt.wikipedia.org/wiki/Poecilia_sphenops","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Black_molly1.JPG","page_title":"Poecilia sphenops","context_page_description":"A Molinésia Negra é uma das diversas variedades de molinésias existentes, como indicado pelo seu nome possui o corpo predominantemente na cor preta. Peixe ornamental muito comum no aquarismo possui diferentes conformações corporais originando diversas subdiviões como a molinésia negra balão e a molinésia negra cauda de lyra. São animais vivíparos, sendo a reprodução relativamente fácil com uma gestação com duração de 28 a 40 dias, quando então os filhotes nascem completamente formados. Quando adultos os machos apresentam aproximadamente 6 cm e as fêmeas 9 cm de comprimento."},{"page_url":"https://de.wikipedia.org/wiki/Rothenburg_LU","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Rothenburg_Flecken_DSC04548.jpg","page_title":"Rothenburg LU","context_page_description":"Rothenburg ist eine politische Gemeinde im Wahlkreis Hochdorf des schweizerischen Kantons Luzern."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%88%D8%A7%D8%AA%D9%88%D9%86%D8%8C_%D9%86%D9%88%D8%B1%D9%81%DA%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Watton_Town_Sign.JPG","page_title":"واتون، نورفک","context_page_description":"واتون، نورفک بریتانیادا بیر یاشاییش منطقه‌سی‌دیر سوْن نۆفوس تخمین‌لرینه گؤره 7202 نفر دیر. بۇ شهر اینگیلیس اؤلکه‌سینده یئرلشیب."},{"page_url":"https://zh.wikipedia.org/wiki/Avenue_K%E5%95%86%E5%A0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/AvenueKFloor4.jpg","page_title":"Avenue K商場","context_page_description":"Avenue K商場是一棟位在吉隆坡城中城的購物中心，面積為421,612平方公尺，整棟商場共有八層樓高。Avenue K為輕快鐵城中城站的共構大樓，其50樓高的高級住宅大樓曾是馬來西亞最高的住宅大樓，麗晶酒店原本預計於2014年開幕，但因遭遇亞洲金融風暴後消費氣氛的低迷及商場早期無法吸引人流，使得該酒店大樓的興建工程無限制延後。"},{"page_url":"https://bg.wikipedia.org/wiki/Millepora_platyphylla","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Millepora_platyphylla_Maldives.jpg","page_title":"Millepora platyphylla","context_page_description":"Millepora platyphylla е вид безгръбначно животно от семейство Milleporidae. Видът не е застрашен от изчезване."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%90%D7%AA%D7%99%D7%A0%D7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Mathinna_1842_by_Thomas_Bock.jpg","page_title":"מאתינה","context_page_description":"מאתינה הייתה נערה אבוריג'ינית אוסטרלית, שאומצה, ולאחר מכן ננטשה על ידי מושל טסמניה, סר ג'ון פרנקלין. היא מתה בגיל צעיר, שרידי גופתה כנראה הוצאו מהקבר, נבדקו על ידי חוקר בריטי ונלקחו לאוניברסיטת מלבורן, לכאורה לצורכי מחקר. לימים הפכה לסמל של ההתייחסות הרעה של הבריטים והלבנים האוסטרליים לאבוריג'ינים."},{"page_url":"https://en.wikipedia.org/wiki/SU-152G","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/SU-152G.jpg","page_title":"SU-152G","context_page_description":"The SU-152G is a Soviet experimental 152-mm self-propelled howitzer, and is designed by OKB-3 of the heavy machine construction division of Uralmash. The main designer of the SU-152G is Lev Gorlitsky. The SU-152G was intended to suppress and destroy enemy firing positions, engage armored hostiles as well as area denial, in addition to conducting counter-battery tasks."},{"page_url":"https://be.wikipedia.org/wiki/%D0%AF%D0%BB%D1%83%D0%BD%D1%86%D0%B7%D1%8F%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Dukou_Railway_over_Yalong_Jiang.jpg","page_title":"Ялунцзян","context_page_description":"Ялунцзя́н — рака ў паўднёва-заходняй частцы Кітая, левы прыток ракі Янцзы.\\nДаўжыня ракі 1324 км. Плошча вадазбору 144 000 км². Сярэдні расход вады каля 2000 м³/с. Рака бярэ пачатак на хрыбце Баян-Хара-Ула Тыбецкага нагор’я. Працякае пераважна ў Сіна-Тыбецкіх гарах у глыбокай даліне. На рацэ шматлікія парогі і вадаспады. Паводкі ўлетку."},{"page_url":"https://nl.wikipedia.org/wiki/Nakajima_E8N","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/55/95siki-suitei_1929.jpg","page_title":"Nakajima E8N","context_page_description":"De Nakajima E8N was een Japans watervliegtuig in dienst van de Japanse Keizerlijke Marineluchtmacht, dat vanaf een vrachtschip of oorlogsschip, vooral op kruisers en slagschepen was gestationeerd. Het was een verkenningsvliegtuig uit de Tweede Chinees-Japanse Oorlog vlak voor de Tweede Wereldoorlog. De E8N1 en/of E8N2 Type 95 was een eenmotorige en tweepersoons tweedekker met een grote centrale hoofdvlotter onder het vliegtuig en twee ondervleugelde kleinere drijfvlotters. Tijdens de Pacifische Oorlog was het bekend bij de geallieerden onder de codenaam \\"Dave\\". Het vliegtuig kon opstijgen vanaf schepen, met behulp van een katapult. De landing moest op het water plaatsvinden. Ook vanaf het water kon het toestel opstijgen."},{"page_url":"https://fr.wikipedia.org/wiki/Dimorphisme_sexuel","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Huia_Buller.jpg","page_title":"Dimorphisme sexuel","context_page_description":"Le dimorphisme sexuel est l'ensemble des différences morphologiques plus ou moins marquées entre les individus mâle et femelle d'une même espèce. Plus généralement, le dimorphisme sexuel peut porter : soit sur des caractères sexuels primaires, soit sur des caractères sexuels secondaires, qui peuvent être morphologiques, physiologiques ou comportementaux.\\nLorsque ces différences ne peuvent se distinguer, les zoologues parlent de monomorphisme sexuel. Cette caractéristique peut être vue comme une adaptation en vue d'éviter la compétition.\\nL'origine évolutive de telles différences entre mâles et femelles d'une même espèce s'explique en général par la sélection sexuelle ou le conflit sexuel mais aussi par des pressions de sélection différentes liées à l'investissement parental."},{"page_url":"https://de.wikipedia.org/wiki/Stra%C3%9Fenbahn_Brest","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Brest_tram_Pontan%C3%A9zen.JPG","page_title":"Straßenbahn Brest","context_page_description":"Die Straßenbahn Brest ist ein am 23. Juni 2012 neu in Betrieb gegangenes Straßenbahnsystem in der zweitgrößten Stadt der Bretagne. Sie ist der Nachfolger eines Straßenbahnnetzes, das von 1898 bis 1944 in Brest betrieben wurde."},{"page_url":"https://it.wikipedia.org/wiki/Battaglia_di_Dakar","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Georges-Leygues-1.jpg","page_title":"Battaglia di Dakar","context_page_description":"La battaglia di Dakar si svolse tra il 23 e il 25 settembre 1940 davanti al porto di Dakar nell'ambito dei più vasti eventi della campagna dell'Africa occidentale della seconda guerra mondiale: lo scontro vide contrapposte la squadra navale dell'ammiraglio John Cunningham della Royal Navy britannica, di scorta a un corpo di spedizione di truppe britanniche e della Francia Libera agli ordini del generale Charles De Gaulle, alla guarnigione francese di Dakar e alle unità della Marine nationale presenti in porto, fedeli al governo di Vichy.\\nIl piano di Cunningham e De Gaulle, nome in codice Operazione Menace, era quello di occupare la città senza colpo ferire o al limite dopo una breve dimostrazione di forza, confidando su un presunto sostegno della popolazione locale e dei soldati della guarnigione alla causa della Francia Libera; il governatore della città Pierre François Boisson, invece, rifiutò le offerte avanzate dai gollisti e in breve tempo tra le difese a terra e le navi britanniche si scatenò un violento cannoneggiamento."},{"page_url":"https://en.wikipedia.org/wiki/List_of_tallest_buildings_in_Baltimore","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Silo_Point.jpg","page_title":"List of tallest buildings in Baltimore","context_page_description":"This list of tallest buildings in Baltimore ranks skyscrapers and high-rises in the United States city of Baltimore by height. The tallest building in Baltimore is the 40-story Transamerica Tower, which rises 529 feet and was completed in 1973. It also stands as the tallest building in the State of Maryland."},{"page_url":"https://ar.wikipedia.org/wiki/TNRC6B","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/PBB_GE_TNRC6B_213254_at_fs.png","page_title":"TNRC6B","context_page_description":"TNRC6B‏ هوَ بروتين يُشَفر بواسطة جين TNRC6B في الإنسان."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D9%84%D8%AA%D9%88%D9%81%D9%8A%D9%82%D9%8A%D8%A9_(%D8%A3%D8%B9%D8%A7%D9%84%D9%8A_%D8%A7%D9%84%D9%86%D9%8A%D9%84)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Taufikia_%281906%29_-_TIMEA.jpg","page_title":"التوفيقية (أعالي النيل)","context_page_description":"التوفيقية قرية كانت تقع في أعالي النيل بجنوب السودان."},{"page_url":"https://de.wikipedia.org/wiki/Teutoburger_Wald-Eisenbahn","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Verl-twe01.jpg","page_title":"Teutoburger Wald-Eisenbahn","context_page_description":"Die Teutoburger Wald-Eisenbahn ist eine 1899 als Aktiengesellschaft gegründete und seit 2014 in der Rechtsform einer GmbH geführte Nichtbundeseigene Eisenbahn mit Unternehmenssitz in Gütersloh. Auch die zwischen 1900 und 1903 von der gleichnamigen Privatbahn-Gesellschaft in Betrieb genommene eingleisige Bahnstrecke Ibbenbüren–Hövelhof, die Ibbenbüren, Tecklenburg, Lengerich, Lienen, Bad Iburg und Bad Laer mit Versmold, Harsewinkel, Gütersloh, Verl und Hövelhof verbindet, wird als Teutoburger Wald-Eisenbahn bezeichnet. Unter dem Namen Teuto-Express findet auf der Strecke seit 1977 ein Museumsbahnverkehr mit historischen Dampflokomotiven statt."},{"page_url":"https://de.wikipedia.org/wiki/M%C3%B6thlitz","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Kirche_Moethlitz_2014_Suedansicht.JPG","page_title":"Möthlitz","context_page_description":"Möthlitz ist ein Ortsteil der Gemeinde Milower Land im Havelland in Brandenburg. Zu Möthlitz gehört der Wohnplatz Lutze."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AB%E3%83%88%E3%83%AA%E3%83%83%E3%82%AF%E5%A4%99%E5%B7%9D%E6%95%99%E4%BC%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Shukugawa_Catholic_Church_Nishinomiya07s5s2048.jpg","page_title":"カトリック夙川教会","context_page_description":"カトリック夙川教会は、兵庫県西宮市にあるキリスト教カトリック大阪大司教区の教会およびその聖堂。かつて大阪教区の臨時司教座が置かれていた旧司教座聖堂である。信徒数は教区内で最も多い。"},{"page_url":"https://de.wikipedia.org/wiki/Pfingstwiesengraben","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Pfingstwiesengraben_nahe_der_Quelle.jpg","page_title":"Pfingstwiesengraben","context_page_description":"Der Pfingstwiesengraben ist ein Wasserlauf im Magdeburger Stadtteil Westerhüsen."},{"page_url":"https://en.wikipedia.org/wiki/Kerman","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Kerman_Railway_Station.jpg","page_title":"Kerman","context_page_description":"Kerman, also known as Carmania, is the capital city of Kerman Province, Iran. At the 2011 census, its population was 821,394, in 221,389 households, making it the 10th most populous city of Iran.\\nIt is the largest and most developed city in Kerman Province and the most important city in the southeast of Iran. It is also one of the largest cities of Iran in terms of area. Kerman is famous for its long history and strong cultural heritage. The city is home to many historic mosques and Zoroastrian fire temples. Kerman became the capital city of Iranian dynasties several times during its history. It is located on a large, flat plain, 800 km south-east of Tehran, the capital of Iran."},{"page_url":"https://de.wikipedia.org/wiki/Litauischer_Pass","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Pasas2008.gif","page_title":"Litauischer Pass","context_page_description":"Der litauische Pass ist ein Reisedokument, das für allgemeine Reisen der litauischen Staatsangehörigen ins Ausland ausgegeben wird. Zu unterscheiden sind hiervon insbesondere der Dienstpass und der Diplomatenpass, die für Reisen der Repräsentanten des ausgebenden Staates in dienstlicher Eigenschaft bestimmt sind.\\nBeim litauischen Reisepass handelt es sich um ein hoheitliches Dokument, dessen Ausgestaltung im Litauischen Passgesetz geregelt wird. Litauische Identitätsausweise wie Pass und Identitätskarte fallen in Litauen in die Zuständigkeit des Innenministerium Litauens.\\nMit dem litauischen Reisepass lassen sich viele Länder visafrei bereisen – im Mai 2018 erschienenen Henley Passport Index belegte er den 10. Platz.\\nJeder Litauer kann von Geburt an einen Reisepass erhalten, bei Minderjährigen bis 16 Jahren bedarf der Antrag jedoch der Zustimmung der Sorgeberechtigten."},{"page_url":"https://ast.wikipedia.org/wiki/Pinus_canariensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Caldera_de_Taburiente_La_Palma.jpg","page_title":"Pinus canariensis","context_page_description":"Pinus canariensis, el Pinu canariu o Pinu de Canaries ye una conífera endémica de les Islles Canaries. El pinu canariu considérase, según una llei del Gobiernu de Canaries, el símbolu natural de la islla de La Palma, conxuntamente cola graja."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%BB%D0%BE%D1%89%D0%B0%D0%B4%D1%8C_%D0%92%D0%BE%D1%81%D1%81%D1%82%D0%B0%D0%BD%D0%B8%D1%8F_(%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/%D0%9F%D0%BB%D0%BE%D1%89%D0%B0%D0%B4%D1%8C_%D0%B2%D0%BE%D1%81%D1%81%D1%82%D0%B0%D0%BD%D0%B8%D1%8F_%D0%BD%D0%BE%D1%87%D1%8C%D1%8E%2C_%D0%B2%D0%B8%D0%B4_%D0%BE%D1%82_%D0%9C%D0%BE%D1%81%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D0%B2%D0%BE%D0%BA%D0%B7%D0%B0%D0%BB%D0%B0.jpg","page_title":"Площадь Восстания (Санкт-Петербург)","context_page_description":"Площадь Восстания — одна из центральных площадей Санкт-Петербурга. Расположена на пересечении Невского и Лиговского проспектов.\\nНа площади расположены Московский вокзал, гостиница «Октябрьская», наземный павильон станции метро «Площадь Восстания». В центре установлен Обелиск «Городу-герою Ленинграду»."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A4%D0%B0%D0%BA%D1%82%D0%BE%D1%80%D0%B3%D1%80%D0%B0%D1%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Graph_Condensation.svg","page_title":"Факторграф","context_page_description":"Факторграф Q графа G — граф, вершины которого являются блоками разбиения вершин графа G, а блок B смежен блоку C, если некоторая вершина в B смежна некоторой вершине в C. Другими словами, если G имеет набор рёбер E и набор вершин V и R является отношением эквивалентности, порождённым разбиением, то факторграф имеет набор вершин V/R и набор рёбер.\\nБолее формально, факторграф — это факторобъект в категории графов. Категория графов конкретизируема — отображение графа в его множество вершин делает его конкретной категорией, так что его объекты можно рассматривать как «множества с дополнительной структурой», а факторграф соответствует графу, порождённому на фактормножестве V/R его множеством вершин V. Далее имеется гомоморфизм графов из графа в факторграф, переводящее каждую вершину или ребро в класс эквивалентности, которому он принадлежит. Интуитивно, это соответствует «склеиванию» вершин и рёбер графа."},{"page_url":"https://it.wikipedia.org/wiki/Maria_Gasparina_di_Sassonia-Altenburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Prinzessin_Marie_Gasparine_von_Sachsen-Altenburg.jpg","page_title":"Maria Gasparina di Sassonia-Altenburg","context_page_description":"Principessa Maria Gasparina di Sassonia-Altenburg nata principessa di Sassonia-Altenburg, duchessa di Sassonia. Proveniva dalla vecchia dinastia dei Wettin, dalla linea ernestina. Attraverso il matrimonio con il principe Karl Günther ricevette il titolo di principessa di Schwarzburg-Sondershausen."},{"page_url":"https://sl.wikipedia.org/wiki/Seznam_cerkva_v_Sloveniji_(L)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Veliki_Osolnik_Slovenia_-_church.jpg","page_title":"Seznam cerkva v Sloveniji (L)","context_page_description":null},{"page_url":"https://fr.wikipedia.org/wiki/Bassins_houillers_des_Vosges_et_du_Jura","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/2018-05_-_Maison_du_Val_de_Vill%C3%A9_-_11.jpg","page_title":"Bassins houillers des Vosges et du Jura","context_page_description":"Les bassins houillers des Vosges et du Jura sont un ensemble de gisements de houille géologiquement différents, identifiés et répartis sur trois zones distinctes alignées le long du massif des Vosges et du massif du Jura, situés dans les régions historiques de Franche-Comté et d'Alsace. Ils sont liés par des aspects géographiques, géologiques, économiques et historiques. Parmi ces gisements, seulement quelques-uns sont réellement exploités entre le XVIᵉ siècle et le XXᵉ siècle, principalement dans la Haute-Saône, le plus important et le plus récent étant le bassin minier de Ronchamp et Champagney."},{"page_url":"https://de.wikipedia.org/wiki/Space_Shuttle","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/STS-5_SBS_deploy1.png","page_title":"Space Shuttle","context_page_description":"Das Space Shuttle war der bislang einzige für bemannte Raumflüge eingesetzte Raumfährentyp. Das System wurde seit den 1970er-Jahren von der US-Raumfahrtbehörde NASA entwickelt, die erste Mission STS-1 startete am 12. April 1981. Durch die Wiederverwendung der Teile des Systems sollten die Flüge in den Weltraum deutlich kostengünstiger als mit nicht wiederverwendbaren Trägerraketen werden. Diese Erwartung erfüllte sich wegen hoher Instandsetzungskosten nicht. Zudem bargen die vielen Instandsetzungen innerhalb kurzer Intervalle viele Risiken, schon ein Fehler konnte eine Katastrophe auslösen. 2011 fand der letzte Flug statt.\\nDie Komponenten gliederten sich neben dem Orbiter in den externen Treibstofftank und zwei Feststoffraketen. Dieses System wurde Space Transportation System genannt. Fachleute nannten stets nur den Orbiter das Space Shuttle. Insgesamt wurden fünf Orbiter im Weltraum eingesetzt, von denen zwei durch Unglücke zerstört worden sind. Dabei kamen jeweils alle sieben Besatzungsmitglieder ums Leben.\\nEine Raumfähre konnte bis zu acht Astronauten und gleichzeitig 24,5 Tonnen Nutzlast in eine niedrige Erdumlaufbahn bringen."},{"page_url":"https://en.wikipedia.org/wiki/Ho_Man_Tin_Estate","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/HK_Ho_Man_Tin_Estate_2008.jpg","page_title":"Ho Man Tin Estate","context_page_description":"Ho Man Tin Estate is a public housing estate in Quarry Hill, Kowloon City District, Kowloon, Hong Kong. It consists of 9 residential blocks and a shopping arcade, including 8 blocks and the shopping arcade of Ho Man Tin Estate.\\nKwun Fai Court is a Home Ownership Scheme court in Quarry Hill, next to Ho Man Tin Estate. It consists of 2 blocks built in 1999. The blocks were originally the rental housing of Ho Man Tin Estate, but they were converted to HOS housing finally and sold to the residents affected by the clearance of Valley Road Estate, Ho Man Tin Estate and Hung Hom Estate privately.\\nKwun Hei Court is a Home Ownership Scheme court in Quarry Hill, next to Ho Man Tin Estate. It has 1 block built in 2000.\\nKwun Tak Court is a Home Ownership Scheme court in Sheung Tak Street, Ho Man Tin. It comprises 3 blocks with totally 603 flats in two sizes - 445 to 483 square feet and 562 to 568 square feet sold at an average price of HK$8,551 per square foot. It completed in 2019."},{"page_url":"https://gl.wikipedia.org/wiki/Eduardo_II_de_Inglaterra","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Philippe4_eduard2_ludvikNavarra.jpg","page_title":"Eduardo II de Inglaterra","context_page_description":"Eduardo II de Inglaterra tamén coñecido como Eduardo de Carnarvon, nado no castelo de Caernarfon o 25 de abril de 1284 e finado no castelo de Berkeley o 21 de setembro de 1327, foi rei de Inglaterra desde 1307 ata a súa deposición en xaneiro de 1327. Foi o cuarto fillo de Eduardo I, e converteuse en herdeiro ao trono tras a morte do seu irmán Afonso. A comezos do ano 1300 acompañou o seu pai nas campañas no marco das campañas para pacificar Escocia, e en 1306 foi nomeado cabaleiro nunha cerimonia celebrada na abadía de Westminster. Accedeu ao trono en 1307 tras a morte do seu pai. En 1308 casou con Isabel de Francia, filla de Filipe IV de Francia, como parte dos esforzos para resolver as tensións entre ambos os países.\\nEduardo mantivo unha controvertida relación con Piers Gaveston, quen se unira á súa casa en 1300. A natureza da relación de Eduardo con Gaveston non está clara: puideron ser simples amigos, amantes ou irmáns de sangue. A arrogancia de Gaveston como favorito de Eduardo provocou o descontento tanto dos baróns como da familia real francesa, e Eduardo tivo que mandalo ao exilio."},{"page_url":"https://en.wikipedia.org/wiki/Antonio_Ranieri","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Michele_Tripisciano_-_Leopardi_op._1.jpg","page_title":"Antonio Ranieri","context_page_description":"Antonio Ranieri was an Italian writer, patriot and politician, better known for his juvenile intimate friendship with Giacomo Leopardi, the most renowned 19th century Italian poet."},{"page_url":"https://eo.wikipedia.org/wiki/La_Rhune","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/23/Petit_train_la_rhune.jpg","page_title":"La Rhune","context_page_description":"La Rhune, Larrún, Larrun estas monto situanta en okcidentaj Pireneoj, inter la provincoj de Navaro kaj Lapurdo kaj ĉe la landlimo inter Francio kaj Hispanio. Ĝi estas 905 m-ojn alta. Larrun signifas \\"paŝtejo bona\\" en la Eŭska lingvo, verŝajne popola etimologio. En la franca, ĝis la 20-a jarcento Larhune, nuntempe La Rhune, estas notinda turisma celo, ĉefe ekde 1924, dank' al la Trajneto de La Rhune, dentorela fervojo kiu eliras de la montpasejo de Saint-Ignace. La panoramo donas klaran elrigardon al la ĉirkaŭaĵoj, ĝis okcidentaj Landes kaj la Atlantika oceano."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Catholic_cathedrals_in_the_United_States","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Cathedral_of_St._Paul_Birmingham_Nov_2011_01.jpg","page_title":"List of Catholic cathedrals in the United States","context_page_description":"The following is a list of the Catholic cathedrals in the United States. The Catholic Church in the United States comprises ecclesiastical territories called dioceses led by prelate bishops. Each bishop is assigned to a cathedral from which he is pastor to the people of his diocese. Some dioceses also have a co-cathedral or a pro-cathedral. This is a complete list of the 195 cathedrals of the Latin Church and the 20 cathedrals of the Eastern Catholic Churches in the United States."},{"page_url":"https://en.wikipedia.org/wiki/Matthew_Harris_Jouett","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Thomas_Jefferson_by_Matthew_Harris_Jouett.jpg","page_title":"Matthew Harris Jouett","context_page_description":"Matthew Harris Jouett was a noted American portrait painter, famous for painting portraits including Thomas Jefferson, George Rogers Clark and Lafayette."},{"page_url":"https://de.wikipedia.org/wiki/Samuel_Benchetrit","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0b/Samuel_Benchetrit_Deauville_2011_cropped.jpg","page_title":"Samuel Benchetrit","context_page_description":"Samuel Benchetrit ist ein französischer Regisseur, Drehbuchautor, Schauspieler und Schriftsteller."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9F%D0%B5%D1%82%D1%8A%D1%80_%D0%A8%D0%B8%D0%BB%D0%B5%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/BASA_Regional_State_Archives_Directorate_Plovdiv_Petar_Shilev_not_classified.jpg","page_title":"Петър Шилев","context_page_description":"Петър Шилев е български общественик."},{"page_url":"https://it.wikipedia.org/wiki/Horace_Farquhar,_I_conte_Farquhar","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Horace_Farquhar_Vanity_Fair_2_June_1898.jpg","page_title":"Horace Farquhar, I conte Farquhar","context_page_description":"Horace Brand Farquhar, I conte Farquhar è stato un politico inglese."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E5%A4%8F%E7%B6%A0%E8%92%82%C2%B7%E5%8B%83%E6%9C%97%E7%89%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Jane_Eyre_title_page.jpg","page_title":"夏綠蒂·勃朗特","context_page_description":"夏洛特·勃朗特，19世纪著名英国作家、诗人，世界文学名著《简·爱》的作者，勃朗特三姐妹之一。"},{"page_url":"https://en.wikipedia.org/wiki/Anna_Herdenstam","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f4/Anna_Herdenstam_2011.jpg","page_title":"Anna Herdenstam","context_page_description":"Anna Herdenstam is a Swedish model, journalist and television host that works for TV4 in Sweden. She has been a news anchor for TV4 Nyheterna. Along with Olle Bergman she in 2000 wrote the book Den lilla sorgen: en bok om missfall. Herdenstam married actor Måns Herngren in 1988, and in 2007 married her current husband and changed her last name from Normelli which she had at the time to Herdenstam."},{"page_url":"https://eu.wikipedia.org/wiki/Pello_Lizarralde","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Pello_lizarralde.jpg","page_title":"Pello Lizarralde","context_page_description":"Pello Lizarralde Larraza euskal idazlea da. 1980az geroztik Iruñean bizi da, ogibidez Euskara irakasle."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%A9%BA%E4%B8%AD%E5%AE%A2%E8%BD%A6A350_XWB","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Qatar_Airways_A350-941_%28A7-ALA%29_landing_at_Frankfurt_Airport.jpg","page_title":"空中客车A350 XWB","context_page_description":"空中巴士A350 XWB，是歐洲飛機製造商空中巴士所研發的長程雙引擎廣體客機系列。A350是最先在機身與機翼同時使用碳纖維強化聚合物的民航飛機，亦是目前全球越洋飛行許可級別最高，以及航程最遠的一款民航飛機。在典型的三等級座艙組態裡，它可搭載280至366位旅客。A350定位為取代A340與部分機齡較高的A330，主要競爭機型為波音公司的波音777及787客機。\\nA350系列機型最初構想於2004年，以A330機身搭配新型空氣動力學外形和引擎，當時是因為歐洲不少航空公司曾催促空中巴士提供一款新飛機與787競爭，因波音曾承諾787的耗油量比A330低20%。起初空中巴士提議設計一種A330的衍生型，稱為A330-200Lite，改善其原有的空氣動力設計及引擎，而航空公司對其改善幅度過小感到不滿，因此空中巴士投入40億歐元重新擬定一個設計方案，並將即將生產的新機型定名為A350。但是最初的A350改進機型與原機型A330之間相異仍然甚小，因為兩款型號皆使用與A330、A340相同的機身結構。2006年，為解決客戶在使用中所回饋的問題，空中巴士改進了這架飛機的設計，之後便生產出此款名為「A350 XWB」的全新系列。開發成本估計為110億歐元。\\nA350原型機於2013年6月14日首次從法國土魯斯起飛。截至2019年2月，空中巴士已收到全球47家客戶的852架A350訂單。2014年9月收到歐洲飛航安全局的認證，兩個月後獲得聯邦航空總署的認證。2015年1月15日，卡達航空完成了A350-900機型的試飛；2018年2月24日，卡達航空完成A350-1000機型的試飛。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_deutscher_Gerichte","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Dresden-Carolabruecke-Staendehaus.jpg","page_title":"Liste deutscher Gerichte","context_page_description":"Diese Liste deutscher Gerichte dient der Aufnahme sämtlicher gegenwärtiger staatlicher Gerichte in Deutschland in sämtlichen Gerichtsbarkeiten.\\nIn Deutschland gibt es 1086 Gerichte, wovon die große Mehrheit Amtsgerichte sind.\\nDiese Liste ist gegliedert nach den Kriterien\\nGerichtsbarkeit\\nGerichtsträger\\nRang im Instanzenzug\\nAlphabet.\\nHistorische deutsche Gerichte sind in einer eigenen Liste verzeichnet."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Leubsdorf_(Sachsen)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Hohenfichte%2C_ehemalige_Baumwollspinnerei.jpg","page_title":"Liste der Kulturdenkmale in Leubsdorf (Sachsen)","context_page_description":"Die Liste der Kulturdenkmale in Leubsdorf enthält die Kulturdenkmale in Leubsdorf.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale in Sachsen."},{"page_url":"https://es.wikipedia.org/wiki/D%C3%B3lar_surinam%C3%A9s","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9a/SUR002.JPG","page_title":"Dólar surinamés","context_page_description":"El dólar surinamés es la moneda de curso legal de Surinam.\\nEntró en circulación el 1 de enero de 2004 sustituyendo al florín de Surinam, estableciéndose billetes de valores nominales de 5, 10, 20, 50 y 100 dólares.\\nEn el año 2005, 1 dólar de los Estados Unidos equivalía a 2,70 dólares de Surinam."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%85%92%E4%BA%95%E5%BF%A0%E9%9F%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Sakai_Tadaoto%27s_Grave.jpg","page_title":"酒井忠音","context_page_description":"酒井 忠音は、江戸時代中期の若狭小浜藩第5代藩主。老中。小浜藩酒井家6代。"},{"page_url":"https://en.wikipedia.org/wiki/International_Committee_of_the_Red_Cross_archives","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/CommemorativePlaque_MuseeRathGeneva_InternationalPrisonersOfWarAgency.jpg","page_title":"International Committee of the Red Cross archives","context_page_description":"The archives of the International Committee of the Red Cross are based in Geneva and were founded in 1863 at the time of the ICRC's inception. It has the dual function to manage both current records and historical archives. The general historical archives are openly accessible to the general public up to 1975.\\nAlong with the ICRC Library, the archives are widely considered to be the greatest repository for records on International Humanitarian Law. They have been dubbed by some researchers as \\"the storehouses of sorrow\\", since they preserve the memory of many millions of victims of armed conflicts as\\n\\"a legacy for mankind\\"."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%BE%D0%BB%D1%8C%D1%88%D0%BE%D0%B9_%D0%BF%D0%B5%D1%80%D0%B5%D0%BF%D0%BE%D0%BB%D0%BE%D1%85_%D0%B2_%D0%BC%D0%B0%D0%BB%D0%B5%D0%BD%D1%8C%D0%BA%D0%BE%D0%BC_%D0%9A%D0%B8%D1%82%D0%B0%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/WW_Chicago_2011_-_Jack_Burton_%288168334643%29.jpg","page_title":"Большой переполох в маленьком Китае","context_page_description":"«Большо́й переполо́х в ма́леньком Кита́е» — художественный фильм 1986 года, в жанре комедия с элементами мистики и боевика, режиссёра Джона Карпентера. Рейтинг картины PG-13. Главные роли в картине исполнили Курт Расселл, Ким Кэттролл, Джеймс Хонг, Виктор Вонг.\\nСогласно оригинальному сценарию Гэри Голдмана и Дэвида Вайнштейна картина должна была быть «вестерном» с сюжетом, протекающим в 1880 годах, студия наняла сценариста Рихтера для адаптации и модернизации сценария. Затем был нанят режиссёр Джон Карпентер, который должен был снять картину, чтобы она успела выйти в прокат до схожей по теме картины с Эдди Мэрфи под названием «Золотой ребёнок». Съемки фильма проходили в китайском квартале Сан-Франциско.\\nВ центре сюжета история дальнобойщика Джека Бертона, помогающего спасти невесту друга Ванг Чи от могущественного колдуна Дэвида Ло Пэна, который хочет вернуть свою плоть и править миром.\\nПремьера состоялась 1 июля 1986 года. Фильм провалился в прокате, принеся студии 11,1 миллионов долларов при бюджете 25 миллионов. Изначально планировался бюджет в размере 18 миллионов долларов."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0_%D0%90%D0%B2%D1%80%D0%B0%D0%BC%D0%BE%D0%B2_(%D1%85%D1%83%D0%B4%D0%BE%D0%B6%D0%BD%D0%B8%D0%BA)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/BASA-1772K-1-92-2-Painting_by_Nikola_Avramov.JPG","page_title":"Никола Аврамов (художник)","context_page_description":"Никола Василев Аврамов е български художник."},{"page_url":"https://en.wikipedia.org/wiki/D%C3%ADlce","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Dilce_hriste.jpg","page_title":"Dílce","context_page_description":"Dílce is a village and municipality in Jičín District in the Hradec Králové Region of the Czech Republic."},{"page_url":"https://de.wikipedia.org/wiki/Malestroit","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Malestroit_-_Chapelle_de_la_Madeleine_02.JPG","page_title":"Malestroit","context_page_description":"Malestroit ist eine französische Gemeinde mit 2456 Einwohnern im Département Morbihan in der Region Bretagne."},{"page_url":"https://en.wikipedia.org/wiki/Symphoricarpos_albus","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Symphoricarpos_albus_3054.JPG","page_title":"Symphoricarpos albus","context_page_description":"Symphoricarpos albus is a species of flowering plant in the honeysuckle family known by the common name common snowberry. It is native to North America, where it occurs across much of Canada and the northern and western United States.\\nSymphoricarpos albus grows in shady and moist mountain and forest habitat, in woodlands and on floodplains and riverbanks. It can grow in a wide variety of habitat types. It is naturalized in parts of Britain, where it has been planted as an ornamental and a cover for game.\\nSymphoricarpos albus is an erect, deciduous shrub, producing a stiff, branching main stem and often several smaller shoots from a rhizome. It can spread and colonize an area to form a dense thicket. It reaches 1–2 m in maximum height. Leaves are oppositely arranged on the spreading branches. They are generally oval, differing in size and shape, and up to 5 cm long, or slightly larger on the shoots. The inflorescence is a raceme of up to 16 flowers. Each flower has a small, five-toothed calyx of sepals. The bell-shaped, rounded corolla is about 0.5 cm long and bright pink in color. It has pointed lobes at the mouth and the inside is filled with white hairs."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%97%A5%E7%94%A2Tiida","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Nissan_Pulsar_DIG-T_1.6_2015_%2820256448091%29.jpg","page_title":"日產Tiida","context_page_description":"日產Tiida是由日本日產汽車公司自2004年起製造販售的緊湊型轎車。由於日產汽車和法國雷諾汽車具有聯盟合作關係，該款車之底盤與第二代雷諾Mégane、第三代March共用，但前二者延長其軸距而成。此款車在臺灣、日本、俄羅斯等地稱為Tiida，另外日本針對三廂式四門轎車稱作Tiida Latio。而二廂式五門掀背車在中國大陸、香港等地稱作騏達，三廂式四門轎車稱為頤達；但中國大陸於2016年改款稱Tiida，不再使用前述名稱。美國和加拿大市場叫做Versa；新加坡、馬來西亞、印度尼西亞等地則命名為Latio；此外在一部分南美洲國家銷售的掛上道奇汽車的品牌，稱為Trazo。"},{"page_url":"https://en.wikipedia.org/wiki/Rijssen-Holten","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Wolter_Wierbos.jpg","page_title":"Rijssen-Holten","context_page_description":"Rijssen-Holten is a municipality in the eastern Netherlands, in the province of Overijssel.\\nThe municipality was formed in 2001 by the joining of the municipalities of Holten and Rijssen. The area of Holten belongs to the region of Salland and the area of Rijssen to the region of Twente."},{"page_url":"https://it.wikipedia.org/wiki/Jaguar_XJ","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b1/Jaguar_XJ6_--_06-09-2011.jpg","page_title":"Jaguar XJ","context_page_description":"La XJ è un modello di berlina di lusso prodotta dalla Jaguar a partire dal 1968.\\nNel corso degli anni ne sono state realizzate varie serie ma quella attualmente in produzione, benché conservi l'impostazione e la filosofia tipica del modello, è molto differente dalla versione originaria.\\nLe serie del modello XJ prodotte sono le seguenti:\\nSeries I\\nSeries II\\nSeries III\\nXJ40\\nX300\\nX308\\nX350\\nX358\\nX351\\nJaguar XJ Elettrica"},{"page_url":"https://de.wikipedia.org/wiki/Johann_Nepomuk_van_Recum","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Johann_Nepomuk_van_Recum_1.jpg","page_title":"Johann Nepomuk van Recum","context_page_description":"Johann Nepomuk van Recum war ein Unternehmer in Frankenthal und Grünstadt; letzter Betreiber der Frankenthaler Porzellanmanufaktur und Gründer der Steingutfabrik Grünstadt."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AA%D9%8A%D8%A7%D8%B1_%D8%A7%D9%84%D8%AD%D9%83%D9%85%D8%A9_%D8%A7%D9%84%D9%88%D8%B7%D9%86%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Ahekma_tayar.png","page_title":"تيار الحكمة الوطني","context_page_description":"تيار الحكمة الوطني هو أحد الأحزاب السياسية العراقية تأسس في بغداد بتاريخ 24 يوليو 2017 حيث أعلن تأسيسه \\"السيد\\" عمار الحكيم وذكرا مراقبون أن \\"أساس دوام هذا التيار هو ترك هذا الإرث المجلس الأعلى الإسلامي العراقي لما يراه من اصطدام مشروعه الشبابي الوطني ببعض الرؤى التي خالفته من اخوانه المخضرمين في المجلس الاعلى وقرر احتراماً لاخوته المؤسسين وعدم الكسر بهم أن يبدأ بعنوان جديد على أساس بناء دولة عراقية تحفظ فيها الحقوق بشكل منسجم شامل وأوسع من المشروع الضيق الذي كان يعمل به المجلس الأعلى\\"."},{"page_url":"https://en.wikipedia.org/wiki/Hartford_railway_station","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Hartford_railway_station%2C_Cheshire_%285%29.JPG","page_title":"Hartford railway station","context_page_description":"Hartford railway station is in the village of Hartford, in Cheshire, England. It is situated on the A559 road approximately two miles west of the town of Northwich."},{"page_url":"https://en.wikipedia.org/wiki/Glossary_of_project_management","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Capability_Maturity_Model.jpg","page_title":"Glossary of project management","context_page_description":"A glossary of terms relating to project management and consulting."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%86%D9%87%D8%B1_%D9%84%D9%88%D8%A8%D8%A7%D9%88%D9%8A%D8%B1_%D9%88%D8%A7%D8%B3%D9%8A%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Georgewitzer_Skala_060521_1.jpg","page_title":"نهر لوباوير واسير","context_page_description":"لوباوير واسير هوا نهر فى المانيا"},{"page_url":"https://es.wikipedia.org/wiki/Orthocoronavirinae","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/3D-medical-animation-coronavirus-structure_scientificanimations_com_esp2.jpg","page_title":"Orthocoronavirinae","context_page_description":"Orthocoronavirinae, comúnmente conocidos como coronavirus, es una subfamilia de virus ARN monocatenario positivos perteneciente a la familia Coronaviridae. Se subdivide en los géneros Alphacoronavirus, Betacoronavirus, Gammacoronavirus y Deltacoronavirus.​​ Estos incluyen genogrupos filogenéticamente similares de virus con una nucleocápside de simetría helicoidal con envoltura cuyos viriones pueden medir entre aproximadamente 50 y 200 nm de diámetro. Su material genético es el de mayor tamaño dentro de los virus de ARN, con genomas que van desde los 26 a 32 kilonucleótidos.​​ Se les llama coronavirus por la corona de puntas que se ve alrededor de la superficie del virus.\\nLos coronavirus pueden infectar aves y mamíferos produciendo una serie de enfermedades respiratorias y digestivas, muchas de ellas letales trayendo como consecuencia serios perjuicios en la avicultura y la ganadería; también pueden infectar al ser humano causando enfermedades que van desde el resfriado común hasta enfermedades más graves, como bronquitis, bronquiolitis, neumonía, el síndrome respiratorio de Oriente Medio y el síndrome respiratorio agudo grave, entre otras."},{"page_url":"https://en.wikipedia.org/wiki/USS_Absecon_(ID-3131)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/USS_Absecon_%28ID-3131%29_1_July_1918_On_trial_trip_in_Delaware_Bay.jpg","page_title":"USS Absecon (ID-3131)","context_page_description":"The first USS Absecon (ID-3131) was a freighter that operated in the United States Navy in 1918. She was the first U.S. Navy ship to be named for Absecon Inlet, a small inlet north of Atlantic City, New Jersey.\\nOn 17 June 1918, officers of the U.S. Navy's 4th Naval District inspected Absecon, a single-screw, steel-hulled freighter built in 1918 by the New York Shipbuilding Company in Camden, New Jersey. Although the Navy gave the ship Identification Number 3131, as it did with most commercial cargo ships and tankers commissioned into U.S. Navy service for use in World War I, the United States Government never took possession of the ship. However, she was armed, and a Navy armed guard crew was placed on board the ship.\\nAbsecon earned the World War I Victory Medal with Armed Guard Clasp for service between 12 October 1918 and 5 November 1918. She then left naval service."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Essex_County,_New_York","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/29/Bogie_Cottage%2C_Saranac_Lake%2C_NY.jpg","page_title":"National Register of Historic Places listings in Essex County, New York","context_page_description":"List of the National Register of Historic Places listings in Essex County, New York.\\nThis is intended to be a complete list of properties and districts listed on the National Register of Historic Places in Essex County, New York, United States. The locations of National Register properties and districts can be seen in a map by clicking on \\"Map of all coordinates\\". Seven of the properties and districts are further designated National Historic Landmarks and are indicated by light blue color in the table below.\\nThis National Park Service list is complete through NPS recent listings posted July 31, 2020."},{"page_url":"https://de.wikipedia.org/wiki/He%C3%9Fberg_(Adelsgeschlecht)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Ha%C3%9Ffurt_Ritterkapelle_-_Epitaph_14d_Schaumberg.jpg","page_title":"Heßberg (Adelsgeschlecht)","context_page_description":"Heßberg, historisch teilweise auch Hesberg und Hesperg, ist der Name eines edelfreien fränkischen Adelsgeschlechts mit Ursprung im heutigen Südthüringen. Der einst in Hessen landsässige Teil der Familie gehört bis in die Gegenwart zur Althessischen Ritterschaft."},{"page_url":"https://la.wikipedia.org/wiki/Wood_Comitatus_(Visconsinia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Map_of_Wisconsin_highlighting_Wood_County.svg","page_title":"Wood Comitatus (Visconsinia)","context_page_description":"Wood Comitatus est Visconsiniae comitatus in Civitatibus Foederatis Americae 75555 incolarum. Comitatus, cuius caput est urbs Wisconsin Rapids, anno 1856 creatus est. In hoc comitatu minima pars incolarum haud Anglice domu loquitur."},{"page_url":"https://es.wikipedia.org/wiki/Alto_y_bajo_clero","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Gloeden%2C_Wilhelm_von_%281856-1931%29_-_n._0021_-_Da_Amore_e_arte.jpg","page_title":"Alto y bajo clero","context_page_description":"Alto y bajo clero o clero superior e inferior, historiográficamente, es la principal división social dentro del clero; y se extiende tanto al clero secular como al clero regular.\\nEn la Edad Media, la diferencia de condiciones socioeconómicas y cultura entre el bajo clero y el alto clero era enorme.​ El clero forma parte de los tres estamentos. Colocando al clero y a la nobleza en el segundo estamento. En el Antiguo Régimen, sociológicamente, el bajo clero procedía de familias campesinas acomodadas y del artesanado urbano; mientras que el alto clero procedía, en su cúspide, de la alta nobleza y las familias reales, y en su mayor parte, de la baja nobleza y el patriciado urbano.​ Las ventajas que proporcionaba la pertenencia al clero, su estrecha vinculación con los estudios universitarios, y la facilidad con que se accedía a las órdenes menores incrementó de forma notable el número de \\"abates\\", ​ mientras que la \\"cura de almas\\" podía no estar suficientemente atendida."},{"page_url":"https://te.wikipedia.org/wiki/%E0%B0%9A%E0%B0%BF%E0%B0%82%E0%B0%A1%E0%B1%81%E0%B0%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Albizia_odoratissima19.jpg","page_title":"చిండుగ","context_page_description":"చిండుగ వృక్ష శాస్త్రీయ నామం అల్బిజియా ఒడోరాటిస్సిమా. చిండుగను సిరిసి, తెల్సు, గనర అని కూడా అంటారు."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%AF%D9%88%D8%B4%E2%80%8C%D9%82%D8%B1%D9%85%D8%B2_%D8%A8%D8%B2%D8%B1%DA%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Trachemys_gaigeae.jpeg","page_title":"گوش‌قرمز بزرگ","context_page_description":"گوش‌قرمز بزرگ نام یک گونه از زیرراسته نهان‌گردن است.این گونه بوم‌زاد ایالات متحده آمریکا و قسمت‌های کوچکی از کشور مکزیک می‌باشد.دامنه پراکنش این لاک‌پشت شامل نیومکزیکو و تگزاس، و تا شمال ایالت چی واوا می‌باشد.این گونه برای نخستین بار در جهان توسط خزنده‌شناسی به نام بئولاه تامپسون گایگ در سال ۱۹۳۹ میلادی کشف و نامگذاری شده است."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%B8%8A%E7%93%9C%E8%BE%BE%E5%B0%94%E5%9F%BA%E7%BB%B4%E5%B0%94%E5%8E%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Montoro2.jpg","page_title":"上瓜达尔基维尔县","context_page_description":"上瓜达尔基维尔县是西班牙南部科尔多瓦省的一个县。分布着8个市镇。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stra%C3%9Fen_und_Pl%C3%A4tze_in_Berlin-Biesdorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Bischofstaler_Stra%C3%9Fe%2C_Berlin-Biesdorf%2C_588-694.jpg","page_title":"Liste der Straßen und Plätze in Berlin-Biesdorf","context_page_description":"Die Liste der Straßen und Plätze in Berlin-Biesdorf beschreibt das komplette Straßensystem im Berliner Ortsteil Biesdorf des Bezirks Marzahn-Hellersdorf mit den entsprechenden historischen Bezügen. Gleichzeitig ist diese Zusammenstellung ein Teil der Listen aller Berliner Straßen und Plätze."},{"page_url":"https://pt.wikipedia.org/wiki/Winter_(Wisconsin)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Winter_Wisconsin.jpg","page_title":"Winter (Wisconsin)","context_page_description":"Winter é uma vila localizada no estado norte-americano de Wisconsin, no Condado de Sawyer."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%AF%E0%AE%BE%E0%AE%B4%E0%AF%8D%E0%AE%AA%E0%AF%8D%E0%AE%AA%E0%AE%BE%E0%AE%A3%E0%AE%AE%E0%AF%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Clock_tower%2C_Jaffna.JPG","page_title":"யாழ்ப்பாணம்","context_page_description":"யாழ்ப்பாணம் என்பது இலங்கைத் தீவின் வடமுனையிலுள்ள யாழ்ப்பாண மாவட்டத்தின் தலைநகராகும். இது யாழ்ப்பாணக் குடாநாட்டின் தென்மேற்குப் பகுதியில் யாழ்ப்பாண நீரேரியைப் பார்த்தபடி அமைந்துள்ளது. இலங்கையின் தலைநகரான கொழும்பிலிருந்து 396 கிமீ தூரத்தில் அமைந்துள்ள இந்நகரம், 88,138 மக்கட்தொகையினைக் கொண்டு 12வது பெரிய நகரமாக விளங்குகிறது. 1987 ஆம் ஆண்டுக்கு முன்னர் வடமாகாணத்தின் தலைநகரமாக விளங்கிய யாழ்ப்பாணம், அந்த ஆண்டில், தற்காலிகமாக வடக்கு, கிழக்கு மாகாணங்களை இணைத்து உருவான வட-கிழக்கு மாகாணசபைக்குத் திருகோணமலையைத் தலைநகரமாக்கியபின், மாகாணத் தலைநகரம் என்ற நிலையை இழந்தது. வடக்குக் கிழக்கு மாகாணம் பிரிக்கப்பட்ட பின்னர் வடமாகாணத் தலைநகராக யாழ்ப்பாணம் தேர்ந்தெடுக்கப்பட்டுள்ளது.\\n1981இல் யாழ்ப்பாணத்தில் எடுக்கப்பட்ட கணக்கெடுப்பின்படி, யாழ் நகரின் மக்கள்தொகை 118,000 ஆக இருந்தது. 20 ஆண்டுகளின் பின் நாட்டில் 2001ல் கணக்கெடுப்பு நடந்தபோது, யாழ்ப்பாணத்தில் கணக்கெடுப்பு நடத்தப்படவில்லை. எனினும் அவ்வாண்டில் இந்நகரின் மக்கள்தொகை 145,000 ஆக இருக்கும் என மதிப்பிடப்பட்டது. கடந்த 20 ஆண்டுகளுக்கும் மேலாக இலங்கையில் நடைபெற்ற உள்நாட்டுப் போர் காரணமாகப் பல வழிகளிலும் பெரிதும் பாதிக்கப்பட்ட யாழ்ப்பாணம், உரிய வளர்ச்சியைப் பெறவில்லை."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%BD%D0%B6_%D0%96%D0%B0%D0%BA_%D2%90%D0%B0%D0%B1%D1%80%D1%96%D0%B5%D0%BB%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Choisy_Perelle.jpg","page_title":"Анж Жак Ґабріель","context_page_description":"Анж Жак Ґабріель — французький архітектор, один з основоположників й останній найбільший майстер французького класицизму XVIII ст."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A1%D0%B0%D0%B3%D0%B8%D0%BD%D0%BE_(%D1%80%D0%B5%D0%BA%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Saginawrivermap.png","page_title":"Сагино (река)","context_page_description":"Сагино је река која протиче кроз САД. Дуга је 35 km. Протиче кроз америчку савезну државу Мичиген. Улива се у залив Сагино."},{"page_url":"https://fr.wikipedia.org/wiki/Marjaliza","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Marjaliza.png","page_title":"Marjaliza","context_page_description":"Marjaliza est une commune d'Espagne de la province de Tolède dans la communauté autonome de Castille-La Manche."},{"page_url":"https://en.wikipedia.org/wiki/History_of_art","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Ebih-Il_Louvre_AO17551_n01.jpg","page_title":"History of art","context_page_description":"The history of art focuses on objects made by humans in visual form for aesthetic purposes. Visual art can be classified in diverse ways, such as separating fine arts from applied arts; inclusively focusing on human creativity; or focusing on different media such as architecture, sculpture, painting, film, photography, and graphic arts. In recent years, technological advances have led to video art, computer art, Performance art, animation, television, and videogames.\\nThe history of art is often told as a chronology of masterpieces created during each civilization. It can thus be framed as a story of high culture, epitomized by the Wonders of the World. On the other hand, vernacular art expressions can also be integrated into art historical narratives, referred to as folk arts or craft. The more closely that an art historian engages with these latter forms of low culture, the more likely it is that they will identify their work as examining visual culture or material culture, or as contributing to fields related to art history, such as anthropology or archaeology. In the latter cases, art objects may be referred to as archeological artifacts."},{"page_url":"https://es.wikipedia.org/wiki/Presa_de_Ricobayo","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Entrada_conducto.JPG","page_title":"Presa de Ricobayo","context_page_description":"El embalse, la central y la presa de Ricobayo son una obra de ingeniería hidroeléctrica construida en el curso inferior del río Esla. Está situada a menos de 1 km de Ricobayo de Alba, en la provincia de Zamora, Castilla y León, España.\\nEl tramo en el que se sitúa se conoce como los arribes del Esla, una profunda depresión geográfica originada por la erosión milenaria del río.\\nForma parte del sistema Saltos del Duero junto con las infraestructuras instaladas en Aldeadávila, Almendra, Castro, Saucelle y Villalcampo.​"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%AB%E3%83%BB%E3%83%88%E3%83%AD%E3%83%B3%E3%82%B7%E3%82%A7_(%E3%82%A4%E3%83%AB%EF%BC%9D%E3%82%A8%EF%BC%9D%E3%83%B4%E3%82%A3%E3%83%AC%E3%83%BC%E3%83%8C%E7%9C%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Le_Tronchet_%2835%29_Abbatiale_Notre-Dame_7.jpg","page_title":"ル・トロンシェ (イル＝エ＝ヴィレーヌ県)","context_page_description":"ル・トロンシェ は、フランス、ブルターニュ地域圏、イル＝エ＝ヴィレーヌ県のコミューン。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B8%D0%BB%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Zamek_%28ruina%29.JPG","page_title":"Милич","context_page_description":"Милич — город в Польше, входит в Нижнесилезское воеводство, Миличский повят. Имеет статус городско-сельской гмины. Занимает площадь 13,5 км². Население 12.113 человек."},{"page_url":"https://es.wikipedia.org/wiki/Real_Alc%C3%A1zar_de_Sevilla","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Real_Alc%C3%A1zar._Sal%C3%B3n_de_los_Tapices._Pa%C3%B1o_I_El_mapa.jpg","page_title":"Real Alcázar de Sevilla","context_page_description":"El Real Alcázar de Sevilla es un conjunto palaciego amurallado construido en diferentes etapas históricas. Aunque el palacio original se edificó en la Alta Edad Media, se conservan algunos vestigios de arte islámico y, de la etapa posterior a la conquista castellana, un espacio palaciego mudéjar y otro de estilo gótico. En reformas posteriores se añadieron elementos renacentistas, manieristas​ y barrocos.​\\nEs la residencia de los miembros de la Familia Real Española cuando visitan Sevilla.​ Esto hace que sea el palacio real en uso más antiguo de Europa.​ La Unesco lo declaró Patrimonio de la Humanidad, junto a la catedral de Sevilla y al Archivo de Indias, en el año 1987.​\\nEn 2019 recibió 2 067 016 visitantes, convirtiéndolo en uno de los monumentos más visitados de España.​"},{"page_url":"https://eu.wikipedia.org/wiki/Eulidia_yarrellii","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Eulidia_yarrellii.jpg","page_title":"Eulidia yarrellii","context_page_description":"Eulidia yarrellii Eulidia generoko animalia da. Hegaztien barruko Trochilidae familian sailkatua dago."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%85%D8%A7%D9%8A%D9%83%D9%84_%D9%83%D9%88%D8%B3%D8%AA%D8%B1%D9%84%D9%8A%D8%AA%D8%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Jkosterl.jpg","page_title":"مايكل كوسترليتز","context_page_description":"مايكل كوسترليتز عالم فيزيا من امريكا و المملكه المتحده."},{"page_url":"https://de.wikipedia.org/wiki/Joshua_Chelanga","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Joshua_Chelanga.jpg","page_title":"Joshua Chelanga","context_page_description":"Joshua Chelanga ist ein kenianischer Marathonläufer.\\nEr wurde 2001 Dritter beim Boston-Marathon und Zweiter beim Marathon der Commonwealth Games 2002. Beim Berlin-Marathon 2003 stellte er mit 2:07:05 seine Bestzeit auf, 2005 wurde er an gleicher Stelle Vierter.\\n2007 siegte er in einer Hitzeschlacht beim wegen extremer Hitze abgebrochenen Rotterdam-Marathon in 2:08:21."},{"page_url":"https://es.wikipedia.org/wiki/Rafael_Dur%C3%A1n","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Rafael_Duran.jpg","page_title":"Rafael Durán","context_page_description":"Rafael Durán Espayaldo fue un actor español.​"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stra%C3%9Fen_und_Pl%C3%A4tze_in_Berlin-Frohnau","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Frohnau_BergfelderStradtweg_nord.JPG","page_title":"Liste der Straßen und Plätze in Berlin-Frohnau","context_page_description":"Die Liste der Straßen in Berlin-Frohnau stellt die im Berliner Ortsteil Frohnau liegenden Straßen mit ihren historischen Bezügen dar. Gleichzeitig ist diese Zusammenstellung ein Teil der Listen aller Berliner Straßen und Plätze."},{"page_url":"https://en.wikipedia.org/wiki/Chalarodon","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7b/Chalarodon_madagascariensis_male.jpg","page_title":"Chalarodon","context_page_description":"Chalarodon is a genus of Malagasy terrestrial iguanian lizard. It was considered a monotypic genus, until in 2015 a second species, Chalarodon steinkampi, was recognised based on morphology and DNA sequence data. The common names of this genus include Chalarodon or Dangalia lizard.\\nIts Malagasy relatives are the iguanians of the genus Oplurus."},{"page_url":"https://it.wikipedia.org/wiki/Arena_di_Arles","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Outside_Arles_Roman_Arena.jpg","page_title":"Arena di Arles","context_page_description":"L'arena di Arles o anfiteatro romano di Arles è uno storico edificio romano della città di Arles, in Provenza, costruito alla fine del I secolo d.C. Si tratta del più grande anfiteatro romano della Gallia, nonché di uno dei monumenti romani meglio conservati in Provenza ed è spesso considerato come la più antica plaza de toros del mondo."},{"page_url":"https://fr.wikipedia.org/wiki/Ch%C3%A2teau_de_Keranroux","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Ch%C3%A2teau_de_K%C3%A9ranroux_Ploujean_01.JPG","page_title":"Château de Keranroux","context_page_description":"Le château de Keranroux, est un château situé sur la commune de Morlaix, Finistère.\\nIl est inscrit aux monuments historique par arrêté du 19 novembre 1992."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%B0%96%E6%B2%99%E5%92%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Tsim_Sha_Tsui_Aerial_view_1975.jpg","page_title":"尖沙咀","context_page_description":"尖沙咀，亦作尖沙嘴，原名香埗頭，是香港油尖旺區的一部份，位於九龍半島南端，隔維多利亞港與香港島對望，是商業、娛樂、文藝、旅遊及購物活動為主的地方，亦是香港著名商業中心之一，終日人流熙來攘往。這裏設有多座不同主題的展覽館及不少高級酒店，同時亦有著名景點、古蹟和特色建築如星光大道、尖沙咀鐘樓、1881和柏麗購物大道。"},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_gemeentelijke_monumenten_in_Soest_(Nederland)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Soesterberg_Oude_Postkantoor_Koppenlaan_17-17a.JPG","page_title":"Lijst van gemeentelijke monumenten in Soest (Nederland)","context_page_description":"De lijst van gemeentelijke monumenten in de gemeente Soest telt in 2013 bijna 200 panden:"},{"page_url":"https://en.wikipedia.org/wiki/Miodrag_Bulatovi%C4%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Miodrag_Bulatovi%C4%87_1969.jpg","page_title":"Miodrag Bulatović","context_page_description":"Miodrag Bulatović was a writer, novelist, journalist and playwright. He is considered to be one of the best Serbian novelists and remains one of the most translated Serbian authors."},{"page_url":"https://sv.wikipedia.org/wiki/Luddk%C3%B6rsb%C3%A4r","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/40/Prunus_tomentosa1.jpg","page_title":"Luddkörsbär","context_page_description":"Luddkörsbär är en art i familjen rosväxter. Arten är utbredd från centrala Kina till Mongoliet och Korea. Luddkörsbär odlas som prydnadsväxt i Sverige.\\nFrukterna är mindre smakrika än surkörsbär men kan användas till saft, sylt, vin och konservering."},{"page_url":"https://de.wikipedia.org/wiki/Eisenk%C3%BCppel","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Grey_Partridge_from_the_Crossley_ID_Guide_Britain_and_Ireland.jpg","page_title":"Eisenküppel","context_page_description":"Der Eisenküppel ist ein 354 m ü. NN hoher Berg auf dem Landrücken in den Gemarkungen von Rückers und Flieden im Landkreis Fulda in Hessen in."},{"page_url":"https://simple.wikipedia.org/wiki/Bathgate","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Bathgate_aerial.JPG","page_title":"Bathgate","context_page_description":"Bathgate is a town in West Lothian, Scotland, UK."},{"page_url":"https://bg.wikipedia.org/wiki/Siemens_EuroSprinter_ES-64","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Northeast_Regional_152_%2812384830114%29.jpg","page_title":"Siemens EuroSprinter ES-64","context_page_description":"Фамилията „EuroSprinter“ е модулна концепция за строеж на електрически локомотиви на „Siemens“ за европейския пазар. Заводското означение в „Siemens“ е ES 64.\\nРазработени са няколко варианта, които се добавят в името като допълнителна буква и броя на поддържаните електроенергийни системи.\\nПървият прототип ES 64P е построен през 1992 г., като се очаква „Deutsche Bahn“ AG да поръча голям брой локомотиви като заместител на остаряващия вече „Einheits-Elektrolokomotiven“. Външният вид е подобен на по-ранния модел на Siemens / Krauss-Maffei, произведен през 1991 г. и използващ два вида напрежение серия RENFE 252. На него е инсталирана и трифазна асинхронна задвижваща технология, въведена вече в серия DB 120. Това е първият трифазен локомотив на „Siemens“. На 6 август 1993 г. поставя световен рекорд за скорост за трифазен локомотив на линията Хановер – Вюрцбург. Прототипът е бил използван за тестове в няколко страни от Европа. Прототипът получава серия и номер DB 127 001 и все още е в експлоатация."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%AC%AC%E4%B8%80%E5%B1%8A%E5%9B%BD%E6%B0%91%E5%A4%A7%E4%BC%9A%E7%AC%AC%E4%B8%80%E6%AC%A1%E4%BC%9A%E8%AE%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/%E7%AC%AC%E4%B8%83%E6%AC%A1%E5%A4%A7%E6%9C%83%E4%B8%BB%E5%B8%AD%E4%BD%95%E6%87%89%E6%AC%BD.jpg","page_title":"第一届国民大会第一次会议","context_page_description":"第一屆國民大會第一次會議，是中華民國國民大會成立後所召開的第一次例行會議，於民國三十七年3月29日—5月1日在南京國民大會堂舉行，主要內容為按照中華民國憲法選舉第一任中華民國總統、副總統。該次會議與兩年前的制憲國民大會，是國民大會僅有兩次在中國大陸舉行的會議，以後國民大會的歷次會議均在台北中山樓舉行。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AC%E3%82%A4%E3%82%A2%E3%83%8A%E3%81%AE%E5%A4%A7%E7%B5%B1%E9%A0%98%E4%B8%80%E8%A6%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/David_Arthur_Granger_%2821605566518%29_%28cropped%29.jpg","page_title":"ガイアナの大統領一覧","context_page_description":"ガイアナの大統領一覧は、ガイアナ共和国の国家元首である大統領の一覧である。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%BE%D0%BC%D0%B0%D0%BD%D0%B4%D0%BE%D0%B2%D0%B0%D0%BD%D0%B8%D0%B5_%D1%81%D0%BF%D0%B5%D1%86%D0%B8%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B%D1%85_%D0%BE%D0%BF%D0%B5%D1%80%D0%B0%D1%86%D0%B8%D0%B9_%D0%A1%D0%A8%D0%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/GEN_Bryan_Brown_official_portrait.jpg","page_title":"Командование специальных операций США","context_page_description":"Командование специальных операций ВС США — одно из девяти единых строевых командований, осуществляющее единое оперативное руководство войсками специального назначения во всех видах Вооружённых сил США: Сухопутных войсках США, Военно-воздушных силах США, Военно-морских силах США.\\nКомандование СпН было сформировано 16 апреля 1987 г. на основе существовавшего с 1980 г. Управления специальных операций МО США. Штаб и основные органы оперативного управления войсками расквартированы на территории в/ч ВВС «МакДилл»."},{"page_url":"https://tr.wikipedia.org/wiki/Brantford","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Brantford_city_hall.jpg","page_title":"Brantford","context_page_description":"Brantford, Kanada'nın Ontario eyaletinde yer alan ve Brant ilçesinde yer alan bir şehirdir. Şehrin toplam nüfusu 93,650 olup metropol nüfusu 135,501'dir."},{"page_url":"https://vi.wikipedia.org/wiki/Danh_s%C3%A1ch_di_s%E1%BA%A3n_v%C4%83n_h%C3%B3a_T%C3%A2y_Ban_Nha_%C4%91%C6%B0%E1%BB%A3c_quan_t%C3%A2m_%E1%BB%9F_t%E1%BB%89nh_Santa_Cruz_de_Tenerife","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Fortalezza_la_gomera.JPG","page_title":"Danh sách di sản văn hóa Tây Ban Nha được quan tâm ở tỉnh Santa Cruz de Tenerife","context_page_description":"Danh sách di sản văn hóa Tây Ban Nha được quan tâm ở Santa Cruz de Tenerife."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%BE%D1%80%D0%BE%D0%B4%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e2/Alan_Cox_at_FOSS_2007.jpg","page_title":"Борода","context_page_description":"Борода́ — волосяной покров на нижней части лица. Один из мужских вторичных половых признаков у человека, обусловленных наличием тестостерона. Борода начинает развиваться в период полового созревания."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%88%D8%A7%D9%84%D8%AA%D8%B1_%D8%A7%D9%86%D8%AF%D9%8A%D8%B1%D8%B3%D9%8A%D9%86","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c7/Walter_Andersin.jpg","page_title":"والتر انديرسين","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nوالتر انديرسين كان سياسى من فينلاندا."},{"page_url":"https://tr.wikipedia.org/wiki/2014_K%C4%B1%C5%9F_Olimpiyatlar%C4%B1%27nda_alp_disiplini_-_Erkekler_ini%C5%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/RosaKhutor2013.jpg","page_title":"2014 Kış Olimpiyatları'nda alp disiplini - Erkekler iniş","context_page_description":"2014 Kış Olimpiyatları'nda alp disiplini – Erkekler iniş Rosa Khutor Alpine Resort'da 9 Şubat tarihinde yapılmıştır. Yarışmadaki pist uzunluğu 3.495 m, start ile bitiş noktasındaki yükseklik farkı ise 1.075 m idi.\\nMüsabakalar sonucunda 1988 Calgary'de alp disiplini Super-G dalında gümüş madalya kazanan Helmut Mayer'in oğlu 23 yaşındaki Avusturyalı atlet Matthias Mayer ilk kez katıldığı olimpiyatlarda altın madalyanın sahibi olmuştur. Son olimpiyat oyunlarında on dokuzuncu sırayı alan İtalyan Christof Innerhofer gümüş, otuzbirinci sırayı alan Norveçli Kjetil Jansrud ise bronz madalyayı kazanmıştır."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B3%D8%B1%D8%B7%D8%A7%D9%86_(%D8%AD%D9%8A%D9%88%D8%A7%D9%86)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Ristet_br%C3%B8d_med_krabbekl%C3%B8er_%284898535215%29.jpg","page_title":"سرطان (حيوان)","context_page_description":"السرطان أو السلطعون. هو حيوان قشري عشر قدمي، ينتمي لما تحت رتبة قصيرات الذنب، نظراً لقصر ذيله البارز أو المخفي تحت قفصه الصدري. تنتشر السراطانات في كل محيطات العالم، وتوجد عدة أنواع منها تستوطن المياه العذبة والبر، خاصة في المناطق الاستوائية. هناك حوالي 6,793 نوع معروف حالياً و 1800 أحافير غير مبهمة لأنواع منقرضة مختلفة مختلف من 93 عائلة مختلفة ينتمي إلى رتبة السرطانات. لا ينتمي السرطان الناسك وجراد البحر والجمبري والقريدس والروبيان وسرطان حدوة الحصان إلى رتبة السرطانات بالرغم من تشابه التسمية أو الشكل. الأنواع التي تنتمي إلى عائلة متفاوتات الذيول ‏ تشبه عادة السرطانات الحقيقة ولكنها ليست كذلك."},{"page_url":"https://fr.wikipedia.org/wiki/Joseph_Unger","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Schey_von_Koromla_family_grave%2C_Vienna%2C_2016.jpg","page_title":"Joseph Unger","context_page_description":"Joseph Unger est un avocat, écrivain et politicien autrichien qui atteint le statut de président de la Cour suprême. Il est considéré comme le fondateur de la loi autrichienne."},{"page_url":"https://sv.wikipedia.org/wiki/Oberthueria","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Oberthueria_formosibia0.jpg","page_title":"Oberthueria","context_page_description":"Oberthueria är ett släkte av fjärilar. Oberthueria ingår i familjen silkesspinnare.\\nKladogram enligt Catalogue of Life:"},{"page_url":"https://en.wikipedia.org/wiki/Adobe_Animate","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Adobe_Flash_Professional_CS3_icon.png","page_title":"Adobe Animate","context_page_description":"Adobe Animate is a multimedia authoring and computer animation program developed by Adobe Systems.\\nAnimate is used to design vector graphics and animation for television programs, online video, websites, web applications, rich internet applications, and video games. The program also offers support for raster graphics, rich text, audio and video embedding, and ActionScript scripting. Animations may be published for HTML5, WebGL, Scalable Vector Graphics animation and spritesheets, and legacy Flash Player and Adobe AIR formats.\\nIt was first released in 1996 as FutureSplash Animator, and then renamed Macromedia Flash upon its acquisition by Macromedia. It was created to serve as the main authoring environment for the Adobe Flash platform, vector-based software for creating animated and interactive content. It was renamed Adobe Animate in 2015 to more accurately reflect its market position then, since over a third of all content created in Animate uses HTML5."},{"page_url":"https://sl.wikipedia.org/wiki/Voja%C5%A1ka_galerija,_Zimski_dvorec","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Knyper_Fyodor_Evstafievich.jpg","page_title":"Vojaška galerija, Zimski dvorec","context_page_description":"Vojaška galerija je galerija portretov 332 generalov patriotske vojne leta 1812, ki se nahaja v Zimskem dvorcu v Sankt Peterburgu. Zbirko je ukazal izdelati car Aleksander I. z namenom počastitve generalov, ki so pomagali premagati Napoleona med njegovo invazijo na Rusijo ter nadaljnjimi vojnami."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%B8%AD%E5%9B%BD%E3%81%AE%E6%9B%B8%E8%AB%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Ink_brushes_write.jpg","page_title":"中国の書論","context_page_description":"中国の書論では、中国における書論の概要と歴史を記す。"},{"page_url":"https://ru.wikipedia.org/wiki/Lotte_World_Tower","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Lotte_World_Tower_%281%29.jpg","page_title":"Lotte World Tower","context_page_description":"Lotte World Tower — 123-этажный сверхвысокий небоскрёб, в районе развлекательного комплекса Lotte World в Сеуле, Южная Корея. Церемония закладки первого камня состоялась в 2005 году, однако затем строительство было отложено из-за ограничений по высотности, введённых в этом районе ввиду находящегося поблизости аэропорта. Ограничения были сняты в 2009 году и уже в феврале 2010 года строительство возобновилось. Согласно проекту, высота здания составит 555 метров, что сделает его одним из самых высоких зданий в мире. Владельцем и главным подрядчиком строительства являются структуры, входящие в группу компаний Lotte.\\nЗдание будет представлять собой стройный конус с выпуклым в средней части силуэтом. Внешняя отделка — светлые стеклянные панели — должны напоминать традиционную корейскую керамику. Здание расположится на берегу реки Ханган, этажи с 1 по 6 займут магазины, с 7 по 60 — офисы, с 61 по 85 — апартаменты и с 86 по 119 — гостиница. Этажи с 120 по 123 будут открыты для свободного доступа, здесь будет находиться одна из самых высоких в мире смотровых площадок.\\nАрхитектурный проект здания был выполнен в известной фирме Kohn Pedersen Fox командой Джеймса фон Клемперера."},{"page_url":"https://nv.wikipedia.org/wiki/Ch%CA%BCa%C5%82_k%CA%BCaasd%C3%A1h%C3%AD_bij%C3%A1%C3%A1d_doot%C5%82%CA%BCizhgo_naashch%CA%BC%C4%85%C4%85%CA%BC%C3%ADg%C3%AD%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Ventri.jpg","page_title":"Chʼał kʼaasdáhí bijáád dootłʼizhgo naashchʼąąʼígíí","context_page_description":"Chʼał kʼaasdáhí bijáád dootłʼizhgo naashchʼąąʼígíí éí tsinlátah chʼał dah yikahjí atah yisdzoh, áádóó éí Shádiʼááhjí kéyah dah siʼánígíí bikááʼgóó hólǫ́. Ndaʼałkaahí dóó ééʼdeetįįhii éí \\"Ranitomeya ventrimaculata\\" deiłníigo dayózhí."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%9C%B1%E8%8E%89%E4%BA%9E%E5%88%A5%E5%A2%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Villa_Giulia_%28Roma%29_2.jpg","page_title":"朱莉亞別墅","context_page_description":"朱莉亞別墅是位於義大利首都羅馬的一座博物館，由教宗儒略三世在1551年至1553年期間修建，當時是教宗的別墅。現在朱莉亞別墅是國家伊特拉斯坎博物館，收藏有眾多珍貴的藏品。1870年時，別墅被義大利收為自己所有，並在20世紀初期改為博物館。"},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%9E%E1%83%94%E1%83%A0%E1%83%A3%E1%83%A1_%E1%83%9E%E1%83%A0%E1%83%94%E1%83%96%E1%83%98%E1%83%93%E1%83%94%E1%83%9C%E1%83%A2%E1%83%98","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a6/VPC_May_2003.jpg","page_title":"პერუს პრეზიდენტი","context_page_description":"პერუს პრეზიდენტი — სახელმწიფოს უმაღლესი თანამდებობა პერუში, ქვეყნის მეთაური. პერუს კონსტიტუციის მიხედვით იგი წარმოადგენს ქვეყანას საშინაო და საგარეო ურთიერთობებში. არის შეიარაღებული და პოლიციური ძალების მთავარსარდალი. 1993 წლის კონსტიტუციის მიხედვით პრეზიდენტს ირჩევენ საყოველთაო, პირდაპირი და ფარული არჩევნების გზით 5 წლის ვადით. ინაუგურაცია ხდება 28 ივლისს, რომელიც წარმოადგენს ეროვნულ დღესასწაულს და არის დასვენების დღე."},{"page_url":"https://fr.wikipedia.org/wiki/Poma_2000_de_Laon","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Barnaud_49_-_LAON_-_Place_de_l%27Hotel-de-Ville_%28D%C3%A9tail%29.jpg","page_title":"Poma 2000 de Laon","context_page_description":"Le Poma 2000 de Laon, couramment appelé « le Poma », est un système de transport guidé léger automatique, prototype de mini-métro funiculaire sur pneus de type transport hectométrique, mis au point par la société Pomagalski, utilisé de 1989 à 2016 dans la ville de Laon, dans le nord-est de la France, entre le quartier de la gare et la ville haute.\\nEn 2009, il subit quelques rénovations pour un montant de 9 600 000 euros. La première cabine rénovée, comprenant la nouvelle livrée TUL, a été inaugurée le 4 février 2009, soit 20 ans jour pour jour après la première mise en service du Poma. Mais devant le coût d'une seconde rénovation, la fermeture de la ligne, décidée le 7 juillet 2016, est effective le 27 août 2016 au soir."},{"page_url":"https://lt.wikipedia.org/wiki/Druskinink%C5%B3_%C5%A1vietimo_centras","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Druskininkai%2C_%C5%A1vietimo_centras.JPG","page_title":"Druskininkų švietimo centras","context_page_description":"Druskininkų švietimo centras – dieninė, savarankiško mokymosi bendrojo lavinimo mokykla Druskininkuose., M. K. Čiurlionio g. 80, vykdanti suaugusiųjų pagrindinio, vidurinio ir papildomo ugdymo programas. Įstaigos kodas 300035075."},{"page_url":"https://it.wikipedia.org/wiki/Ga%E1%B9%87%E1%B8%8Dak%C4%AB_(fiume)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Kaligandaki_ghasa.jpg","page_title":"Gaṇḍakī (fiume)","context_page_description":"Il fiume Gaṇḍakī, conosciuto anche come Narayani nel Nepal meridionale e come Gandak in India, è uno dei maggiori fiumi del Nepal e un affluente del Gange in India. In Nepal il fiume è reso degno di nota dalla sua profonda gola attraverso la Catena Montuosa dell'Himalaya e dal suo enorme potenziale idroelettrico. Ha un bacino di 46 300 km², la cui maggior parte si trova nel Nepal; scorre, inoltre, attraverso tre delle 14 montagne che superano gli 8 000 metri."},{"page_url":"https://no.wikipedia.org/wiki/Liller%C3%B8d","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Lillerod.jpg","page_title":"Lillerød","context_page_description":"Lillerød ligger i Nordsjælland og er administrasjonssentrum i Allerød kommune. Byen har 15 904 innbyggere og kalles ofte for Allerød, med referanse til jernbanestasjonen og kommunen. Den tilhører Region Hovedstaden.\\nByens gågate heter M.D. Madsensvej. I Lillerød ligger et mindre teater ved navn Mungo Park, oppkalt etter en oppdagelsesreisende. Tidligere huset byen teatergruppen Dr. Dante, som startet sin virksomhet her. Byen har sin egen kino, Allerød kino, som er drevet av frivillig arbeidskraft.\\nByen er kjent for sine skilt med Stridsvogner forbudt, som skyldes at byen ligger rett ved Sjælsmark og Høvelte kaserne."},{"page_url":"https://it.wikipedia.org/wiki/Basilica_del_Santo_Sepolcro","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Exterior_of_the_Holy_Sepulchre._%281841%29_-_TIMEA.jpg","page_title":"Basilica del Santo Sepolcro","context_page_description":"La basilica del Santo Sepolcro, chiamata anche la chiesa della Resurrezione, si tratta di una delle più importanti chiese cristiane di tutto il mondo essendo costruita sul luogo che la tradizione indica come quello della crocifissione, unzione, sepoltura e resurrezione di Gesù. Secondo la tradizione ortodossa, ogni anno, a mezzogiorno, durante la celebrazione del Sabato Santo della Pasqua ortodossa, vi si ripete il «miracolo del Fuoco Santo».\\nSituata a Gerusalemme, attualmente è ricompresa all'interno delle mura della Città Vecchia, al termine della Via Dolorosa, e ingloba sia quella che è ritenuta la «collina del Golgota», luogo della crocifissione, sia il sepolcro scavato nella roccia, dove il Nuovo Testamento riferisce che Gesù fu sepolto. Oggi è la sede del Patriarcato greco-ortodosso di Gerusalemme, il quale, al centro della chiesa, vi ha il proprio Katholikon, ossia la propria cattedrale, e la propria cattedra.\\nLa chiesa del Santo Sepolcro è una delle mete principali e irrinunciabili dei pellegrini che visitano la Terra Santa, insieme con la Basilica dell'Annunciazione di Nazareth e la Basilica della Natività di Betlemme."},{"page_url":"https://de.wikipedia.org/wiki/Liste_chinesischer_Triebfahrzeuge","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8f/China_Railways_DFH2_0008_20111007.jpg","page_title":"Liste chinesischer Triebfahrzeuge","context_page_description":"Diese Liste gibt einen Überblick über die chinesischen Triebfahrzeuge."},{"page_url":"https://hu.wikipedia.org/wiki/Neuvy-en-Champagne","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/07/Neuvy-en-Champagne_-_Church_-_2.jpg","page_title":"Neuvy-en-Champagne","context_page_description":"Neuvy-en-Champagne település Franciaországban, Sarthe megyében. Lakosainak száma 373 fő. +/- Neuvy-en-Champagne Conlie, Tennie, Amné, Bernay-en-Champagne, Coulans-sur-Gée, Cures és La Quinte községekkel határos."},{"page_url":"https://de.wikipedia.org/wiki/Liemba_(Schiff)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Graf_Geoetzen_Modell.JPG","page_title":"Liemba (Schiff)","context_page_description":"Das Motorschiff Liemba ist ein kombiniertes Passagier- und Frachtschiff, das auf dem afrikanischen Tanganjikasee verkehrt. Es wurde 1913 als Dampfschiff in Deutschland gebaut und im Ersten Weltkrieg bewaffnet. Bis zum 16. Mai 1927 trug es den Namen Goetzen, benannt nach Gustav Adolf Graf von Goetzen."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%82%96%E5%B0%94%E7%B4%A2%E6%B2%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Tindfjallaj%C3%B6kull_Sept._2004.jpg","page_title":"肖尔索河","context_page_description":"肖尔索河也译作索尔萨河、锡尤尔骚河，是冰岛南部的一条河流，发源于霍夫斯冰原东北部，流向西南方，在斯托克赛里以南注入大西洋。全长230公里，流量为364 m³/s，是冰岛第一长河和流量第二大的河流。"},{"page_url":"https://fa.wikipedia.org/wiki/%DA%A9%D8%A7%D8%B3%D8%AA%DB%8C%DB%8C%D8%AE%D9%88_%D8%AF_%D8%B1%D8%A8%D9%84%D8%AF%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Riachuelo_de_Castillejo_de_Robledo.jpg","page_title":"کاستییخو د ربلدو","context_page_description":"کاستییخو د ربلدو یک دهستان در اسپانیا است که در سریا واقع شده‌است."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%BE%90%E5%B7%9E%E6%A2%86%E5%AD%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/%E7%A9%86%E6%A1%82%E8%8B%B1%E6%8C%82%E5%B8%85202647.jpg","page_title":"徐州梆子","context_page_description":"徐州梆子，也称江苏梆子是豫剧在江苏地区的别称，是中国戏曲的一个剧种。由豫剧流入徐州地区后发展而成。代表剧目有“四大征”“四大铡”及“老十八本”“新十八本”等。"},{"page_url":"https://pl.wikipedia.org/wiki/Eihei-ji","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Eiheiji34st3200.jpg","page_title":"Eihei-ji","context_page_description":"Eihei-ji – jedna z dwóch głównych świątyń buddyzmu sōtō zen. Jej założycielem był Eihei Dōgen. Świątynia znajduje się w górach, około 10 km na wschód od miasta Fukui w Japonii."},{"page_url":"https://vec.wikipedia.org/wiki/Br%C3%B9xene","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Town_hall_%28Brugine%29.jpg","page_title":"Brùxene","context_page_description":"Brùxene el xe un comun de 6403 abitanti 'nte ła provincia de Pàdova."},{"page_url":"https://pt.wikipedia.org/wiki/Esta%C3%A7%C3%A3o_Col%C3%A9gio_Militar/Luz","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Col%C3%A9gio_Militar_Metro_Station_%282%29_2005_12_29.jpg","page_title":"Estação Colégio Militar/Luz","context_page_description":"Colégio Militar/Luz é uma estação do Metro de Lisboa. Situa-se no concelho de Lisboa, em Portugal, entre as estações Carnide e Alto dos Moinhos da Linha Azul. Foi inaugurada a 14 de outubro de 1988 em conjunto com as estações Alto dos Moinhos e Laranjeiras, no âmbito da expansão desta linha à zona de Benfica.\\nEsta estação está localizada na Av. do Colégio Militar, junto ao cruzamento com a Av. Lusíada, possibilitando o acesso ao Centro Colombo, ao Estádio da Luz, e ao terminal de autocarros que se localiza nessa zona. O projeto arquitetónico é da autoria do arquiteto António J. Mendes e as intervenções plásticas do pintor Manuel Cargaleiro.\\nEm 2011, o Metropolitano de Lisboa iniciou um conjunto de intervenções de refrescamento na estação do Colégio Militar/Luz, no qual se incluía a instalação de elevadores, a substituição da sinalética e a limpeza dos revestimentos. No entanto, estas obras acabariam por ser suspensas ainda no decorrer desse ano. Só oito anos depois, em 28 de Março de 2019, voltariam a ser retomados os trabalhos, agora orçamentados em 2,6 milhões de euros."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A7%DB%8C%D8%B3%D8%A7%D8%B1_%DA%86%D8%A7%DB%8C%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Isarpyramiden.jpg","page_title":"ایسار چایی","context_page_description":"ایسار چایی"},{"page_url":"https://no.wikipedia.org/wiki/Den_russiske_h%C3%A6ren","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Military_districts_of_Russia_April_2nd_2014.svg","page_title":"Den russiske hæren","context_page_description":"Den russiske hæren utgjør det meste av landstyrkene til Den russiske føderasjonen, og er en del av Det russiske forsvaret."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E7%A0%82%E6%8B%89%E8%B6%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Sarawak_anti-cession_demonstration.JPG","page_title":"砂拉越","context_page_description":"砂拉越，旧译砂磱越或砂𦛨越、砂劳越、砂罗越、砂捞越，简称砂或砂州，马来语又称作“犀鸟之乡”，是马来西亚联邦在婆罗洲领土上两个行政区域之一，也是全马面积最大的州。砂拉越州在行政、移民和司法制度上与马来西亚半岛的其他州属明显不同。地理上砂拉越州位于婆罗洲西北，东北与沙巴州相邻，并把文莱这一独立国家隔成两部分，而其南与印尼加里曼丹接壤。砂拉越的州首府古晋市是砂拉越的经济和政治中心，州内还有美里、诗巫和民都鲁等大大小小的城市分布。根据2015年的人口估查，砂拉越州共有2,636,000人。全州的气候类型是热带雨林气候，生长着大片热带雨林，为各种各样的动植物提供了生存环境。以许多著名的洞穴系统而闻名的姆禄山国家公园也位于砂拉越州。发源于依兰山脉的拉让江既是该州的重要河流之一，也是马来西亚最长的河流；其支流上的巴贡水电站是东南亚的大型水电站之一。砂拉越的最高点为2,423米高的毛律山。\\n在尼亚洞发现了距今四万年前早期人类在砂拉越的居住遗迹。在公元八至十三世纪砂拉越，这一地区与古代中国维持着贸易往来。在十六世纪时这一地区开始受到文莱帝国的控制。1841年，英国探险家詹姆士·布鲁克从文莱手中取得砂拉越的统治权，成为了独立的王国，并逐步将版图扩张至今天的范围。随着第二次世界大战太平洋战争的爆发，砂拉越在1941年被日本占领。战后的1946年，砂拉越又被划给英国成为了直辖殖民地，直到1963年7月22日才从英国取得自治权。同年9月16日，砂拉越与北婆罗洲、新加坡和马来亚联合邦组成今天的马来西亚。这一联邦体制的建立受到了邻国印尼的反对，并导致了两国陷入了长达三年的武装对抗。1966年8月对抗平息后的砂拉越又经历了砂共叛乱，这场叛乱直到1990年才停息。\\n砂拉越州呈现出富有代表性的民族特点、文化特色和多样化语言。砂拉越州的州元首称作“Yang di-Pertua Negeri”，而州政府首脑称为“首席部长”。砂拉越州的政府架构与西敏制相似，并在国内拥有最早的州议会制度。砂拉越的官方语言为英语和马来语，并没有规定官方宗教。位于古晋的砂拉越博物馆是婆罗洲历史最悠久的博物馆。砂拉越还以它的传统乐器沙贝而闻名。为期三天的热带雨林世界音乐节便是在砂拉越州举行。同时砂拉越州也是全国唯一庆祝达雅克丰收节的地方。\\n砂拉越州蕴藏着大量自然资源，其经济发展在很大程度上属于外向出口型，特别是在石油、天然气、木材和油棕方面。砂拉越还有制造业、能源和旅游等产业。"},{"page_url":"https://fr.wikipedia.org/wiki/Rhinarium","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Cat_rhinarium.JPG","page_title":"Rhinarium","context_page_description":"Le rhinarium ou la truffe est la surface sans poil, souvent humide et de température plus froide, qui entoure les narines d'un grand nombre de mammifères, avec absence de soudure de la lèvre supérieure.\\nLa truffe est parcourue par de nombreuses rainures qui offrent une apparence granuleuse caractéristique, servant à maintenir la structure toujours humide et augmentant la surface de la zone olfactive. Chez les primates simiens, la tendance évolutive vers la disparition du museau, la régression du prognathisme facial et le développement du nez à la place du rhinarium est liée à la réduction de l'appareil olfactif au profit du système tactile et visuel.\\nLa surface externe du rhinarium contient de nombreux capteurs de pression et de température. L'évaporation forcée et rapide de la pellicule d'humidité sous l'effet du vent refroidit la surface de la truffe, ce froid étant perçu par les thermorécepteurs. Ces récepteurs donnent ainsi à l'animal la direction du vent."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%BF%A0%EB%B0%94%EC%9D%98_%EC%9E%AC%EC%99%B8%EA%B3%B5%EA%B4%80_%EB%AA%A9%EB%A1%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Villa_Skoga_2014e.jpg","page_title":"쿠바의 재외공관 목록","context_page_description":"쿠바의 재외공관 목록은 쿠바 주재 대사관을 각국에 상주시켜 놓는 것을 의미하며 쿠바의 재외공관을 나열한 목록이다."},{"page_url":"https://en.wikipedia.org/wiki/Intensive_care_unit","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Sick_baby_with_nurses.jpg","page_title":"Intensive care unit","context_page_description":"An intensive care unit, also known as an intensive therapy unit or intensive treatment unit or critical care unit, is a special department of a hospital or health care facility that provides intensive care medicine.\\nIntensive care units cater to patients with severe or life-threatening illnesses and injuries, which require constant care, close supervision from life support equipment and medication in order to ensure normal bodily functions. They are staffed by highly trained physicians, nurses and respiratory therapists who specialize in caring for critically ill patients. ICUs are also distinguished from general hospital wards by a higher staff-to-patient ratio and access to advanced medical resources and equipment that is not routinely available elsewhere. Common conditions that are treated within ICUs include acute respiratory distress syndrome, septic shock and other life-threatening conditions.\\nPatients may be referred directly from an emergency department or from a ward if they rapidly deteriorate, or immediately after surgery if the surgery is very invasive and the patient is at high risk of complications."},{"page_url":"https://en.wikipedia.org/wiki/List_of_tallest_buildings_in_Birmingham,_Alabama","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Leer_Tower%2C_Birmingham%2C_AL.jpg","page_title":"List of tallest buildings in Birmingham, Alabama","context_page_description":"The U.S. city of Birmingham, Alabama is the site of 66 high-rises, all of which stand taller than 115 feet. The tallest building in the city is the 34-story Wells Fargo Tower, completed in 1986, which is 454 feet tall. The tower was also the tallest building in the U.S. state of Alabama until the completion of the RSA Battle House Tower in Mobile in 2007. Birmingham's second-tallest skyscraper, the Regions-Harbert Plaza, rises 437 feet and has stood as the second tallest structure in the city since its completion in 1989. Overall, five of the ten tallest buildings in Alabama are located in Birmingham."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%94%D0%B5%D0%B2%D1%96%D0%B4_%D0%A2%D0%BE%D0%BC%D0%BF%D1%81%D0%BE%D0%BD_(%D0%BC%D0%B0%D0%BD%D0%B4%D1%80%D1%96%D0%B2%D0%BD%D0%B8%D0%BA)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Stamp-Thompson-1957.jpg","page_title":"Девід Томпсон (мандрівник)","context_page_description":"Девід Томпсон — британсько-канадійський дослідник, картограф, першовідкривач, торговець хутром.\\nВсе своє життя присвятив практичному вивченню географії та картографії. Склав карту басейну річки Колумбії від її витоків до самого гирла. Сухопутна територія, нанесена на карту Томпсоном, дорівнює 3900000 квадратних кілометрів. Томпсона називають найвеличнішим із сухопутних географів, що коли-небудь жили на Землі.\\nЙого сучасник, відомий дослідник Александр Макензі зауважив, що Томпсон зробив більше за десять місяців, ніж було можливим зробити за два роки. Саймон Фрейзер назвав на честь свого друга річку і льодовик."},{"page_url":"https://no.wikipedia.org/wiki/Leif_Erikson_Day","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Viking_at_MN_Capitol.jpg","page_title":"Leif Erikson Day","context_page_description":"Leif Erikson Day er en amerikansk merkedag som inntreffer 9. oktober hvert år. Dagen er oppkalt etter den norrøne sjøfareren Leiv Eiriksson som anses å ha ledet en ekspedisjon med de første europeerne som slo seg ned i Nord-Amerika på 1000-tallet i hva de kalte Vinland. Formålet med dagen er å gi oppmerksomhet til amerikanere med nordisk opphav og den nordiske innflytelsen i amerikansk kultur og utvikling.\\nDatoen 9. oktober ble gjort til Leif Erikson Day etter vedtak i Kongressen i 1964. Datoen ble valgt etter den datoen i 1825 da skipet «Restauration» fra Stavanger anløp New York City med 52 norske immigranter, noe som betegnes som den første organiserte norske emigrasjonen til Nord-Amerika. Innen dagen ble antatt som nasjonal merkedag hadde Leif Erikson Day blitt innført i delstatene Wisconsin og Minnesota allerede på 1930-tallet. Begge delstatene har en stor andel innbyggere med nordisk opphav."},{"page_url":"https://vi.wikipedia.org/wiki/%E1%BA%A8m_th%E1%BB%B1c_Bulgaria","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Zagorka.jpg","page_title":"Ẩm thực Bulgaria","context_page_description":"Ẩm thực Bungaria, là một đại diện của ẩm thực Đông Nam Âu. Nó có các đặc điểm chung với các ẩm thực vùng Balkan. Món ăn truyền thống của Bungaria rất đa dạng vì yếu tố địa lý như điều kiện khí hậu thích hợp cho một loạt các loại rau, rau thơm và trái cây. Ngoài sự đa dạng của món ăn địa phương Bulgaria, ẩm thực Bungaria một số món giống với món ăn của Nga, Ý, Hy Lạp và thậm chí Trung Đông\\nĐồ ăn Bungaria thường kết hợp salad làm món khai vị và cũng sử dụng nhiều các sản phẩm từ sữa, rượu vang và các đồ uống có cồn như rakia. Ẩm thực này cũng có các loại súp đa dạng, như súp lạnh tarator, và bánh nướng, như filo đế banitsa, pita và các loại Börek khác nhau.\\nMón chính được thường là các món hầm, hoặc là chay hoặc với thịt cừu, dê, bê, gà hay lợn. Đồ rán không phổ biến, nhưng nướng hun khói- đặc biệt là các loại xúc xích khác nhau- rất được ưa chuộng. Thịt lợn cũng phổ biến, thường được trộn với bê hay thịt cừu, mặc dù cá và thịt gà cũng được sử dụng rộng rãi. Trong khi hầu hết gia súc được nuôi cho sản xuất sữa hơn là lấy thịt, thịt bê phổ biến để làm món nướng khai vị và trong một số món chính."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AF%D8%A7%D9%86%D8%B4%DA%AF%D8%A7%D9%87_%D8%A7%D8%AA%D9%88_%D9%81%D9%88%D9%86_%DA%AF%D8%B1%DB%8C%DA%A9_%D9%85%D8%A7%DA%AF%D8%AF%D8%A8%D9%88%D8%B1%DA%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Unibibliothek_magdeburg.jpg","page_title":"دانشگاه اتو فون گریک ماگدبورگ","context_page_description":"دانشگاه اتو فون گریک ماگدبورگ در سال ۱۹۹۳ در شهر ماگدبورگ آلمان تأسیس شده و یکی از جوانترین دانشگاههای آلمان است. این دانشگاه در حال حاضر ۱۳٫۰۰۰ دانشجو دارد و ۱۱٫۷۰۰ مقاله در مجلات بین‌المللی منتشر کرده‌است. این دانشگاه به نام اتو فون گریک، فیزیکدان آلمانی نامگذاری شده که در همین شهر مدفون است.\\nدانشگاه اتو فون گریک، پس از ادغام سه دانشکده فنی، پزشکی و مدرسهٔ تربیت معلم ماگدبورگ ایجاد شد و هم‌اکنون دارای ۹ دانشکده‌است."},{"page_url":"https://hu.wikipedia.org/wiki/Hofbieber","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Wappen_Hofbieber.png","page_title":"Hofbieber","context_page_description":"Hofbieber település Németországban, Hessen tartományban. Lakosainak száma 6072 fő. +/- Hofbieber Hilders, Tann és Poppenhausen községekkel határos."},{"page_url":"https://fr.wikipedia.org/wiki/Ambroise_Calfa","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Armoiries_Chypre_1393.svg","page_title":"Ambroise Calfa","context_page_description":"Ambroise Calfa Nar Bey, dit Guy de Lusignan, né à Constantinople le 2 mars 1831 et mort à Neuilly en 1906, est un historien et linguiste franco-arménien de la seconde moitié du XIXᵉ siècle et du début du XXᵉ siècle."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AB%E3%83%A9%E3%83%BC%E3%83%9C%E3%83%BC%E3%83%AB","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6c/BS001.jpg","page_title":"カラーボール","context_page_description":"カラーボール は、中に特殊染料が入った防犯用のボールである。\\n防犯装備の一つであり、金融機関、店舗等の防犯に用いられている。"},{"page_url":"https://nl.wikipedia.org/wiki/Willem_Key","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/After_Willem_Key_-_Portrait_of_Fernando_%C3%81lvarez_de_Toledo.jpg","page_title":"Willem Key","context_page_description":"Willem Adriaensz. Key was een kunstschilder uit de Nederlanden."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B9%80%E0%B8%AD%E0%B8%AA%E0%B8%A2%E0%B8%B9-100","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Su-100_-_TankBiathlon2013-07.jpg","page_title":"เอสยู-100","context_page_description":"เอสยู-100 เป็นรถถังพิฆาตสัญชาติโซเวียตติดตั้งด้วยปืนต่อต้านรถถังขนาด 100 มม.ในโครงส่วนบนป้อมปืน ได้ถูกใช้อย่างกว้างขวางในช่วงปีสุดท้ายของสงครามโลกครั้งที่สองและได้แสดงให้เห็นถึงการเข้าประจำการในช่วงเวลาหลายปีกับกองทัพพันธมิตรของโซเวียตทั่วโลก"},{"page_url":"https://de.wikipedia.org/wiki/Kloster_Bredelar","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Kloster_Bredelar_Eingang.jpg","page_title":"Kloster Bredelar","context_page_description":"Das Kloster Bredelar ist ein ehemaliges Prämonstratenserinnenkloster- und spätere Zisterzienserabtei in Bredelar bei Marsberg in Nordrhein-Westfalen. Teile des Klostergeländes sind heute ein Kultur- und Tagungszentrum und besitzt ein Museum zur ehemaligen Theodorshütte."},{"page_url":"https://hu.wikipedia.org/wiki/Obliquogobius","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/GobiusCometesAlcock.jpg","page_title":"Obliquogobius","context_page_description":"Az Obliquogobius a csontos halak főosztályának a sugarasúszójú halak osztályába, ezen belül a sügéralakúak rendjébe, a gébfélék családjába és a Gobiinae alcsaládjába tartozó nem."},{"page_url":"https://it.wikipedia.org/wiki/Solar_Energy_Generating_Systems","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/40/Solarplant-050406-05.jpg","page_title":"Solar Energy Generating Systems","context_page_description":"Il Solar Energy Generating Systems, o SEGS è composto da nove centrali solari in California nel Deserto del Mojave dove si trova la più alta insolazione degli Stati Uniti. I SEGS I-II si trovano presso Daggett, i SEGS III-VII presso Kramer Junction e i SEGS VIII-IX presso Harper Lake. La gestione della struttura è affidata alla FPL Energy che ne è anche comproprietaria. Era stata avviata anche la costruzione della centrale SEGS X, e pianificata la costruzione delle centrali SEGS XI e SEGS XII, tutte da 80 MW cadauna, ma l'azienda costruttrice, Luz Industries, mancò di ottenere i necessari finanziamenti e fece bancarotta nel 1991-1992."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9D%D0%BE%D0%B2%D0%BE%D1%87%D0%B5%D1%80%D0%BA%D0%B0%D1%81%D1%81%D0%BA%D0%B8%D0%B9_%D1%8D%D0%BB%D0%B5%D0%BA%D1%82%D1%80%D0%BE%D0%B2%D0%BE%D0%B7%D0%BE%D1%81%D1%82%D1%80%D0%BE%D0%B8%D1%82%D0%B5%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D0%B7%D0%B0%D0%B2%D0%BE%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/VL60pk-1892.jpg","page_title":"Новочеркасский электровозостроительный завод","context_page_description":"Производственная компания «Новочерка́сский электровозострои́тельный заво́д» — советское/российское предприятие по выпуску магистральных грузовых и пассажирских электровозов.\\nЗавод расположен в городе Новочеркасске Ростовской области. Рядом — одноимённая железнодорожная платформа Северо-Кавказской железной дороги."},{"page_url":"https://de.wikipedia.org/wiki/Arnold_Oberschelp","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Arnold_Oberschelp.jpg","page_title":"Arnold Oberschelp","context_page_description":"Arnold Oberschelp ist ein deutscher Mathematiker und Logiker und war lange Jahre Professor für Logik und Wissenschaftslehre in Kiel."},{"page_url":"https://en.wikipedia.org/wiki/Karnati_Lingaiah","image_url":"https://upload.wikimedia.org/wikipedia/en/9/9d/Lingaiahk2014.jpg","page_title":"Karnati Lingaiah","context_page_description":"Dr. Karnati Lingaiah born on 10 June 1944 in Narasimhapuram Village, Nalgonda District, Telangana, India. He is a retired Lecturer in Economics and recipient of State Best Teacher Award given by Government of Andhra Pradesh, India in 1984. He is also a poet who has written books in Telugu Language. He has authored about 17 books in Economics and 18 books in Telugu Literature."},{"page_url":"https://en.wikipedia.org/wiki/Opinion_polling_for_the_2017_New_Zealand_general_election","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/NZ_opinion_polls_2015-2017_-PPM.png","page_title":"Opinion polling for the 2017 New Zealand general election","context_page_description":"Various organisations commissioned opinion polls for the 2017 New Zealand general election during the term of the 51st New Zealand Parliament. Roy Morgan Research polled monthly, with MediaWorks New Zealand and Television New Zealand polling less frequently. The last The New Zealand Herald was in December 2015, and Fairfax Media discontinued their poll after the 2014 election. The sample size, margin of error and confidence interval of each poll varied by organisation and date, but were typically 800–1000 participants with a margin of error of just over 3%.\\nThe previous Parliament was elected on Saturday 20 September 2014. The 2017 general election was held on Saturday 23 September 2017."},{"page_url":"https://it.wikipedia.org/wiki/Atlantide","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Carte_atlantide.jpeg","page_title":"Atlantide","context_page_description":"Atlantide è un'isola leggendaria, il cui mito è menzionato per la prima volta da Platone nei dialoghi Timeo e Crizia, nel IV secolo a.C.\\nSecondo il racconto di Platone, Atlantide sarebbe stata una potenza navale situata \\"oltre le Colonne d'Ercole\\", che avrebbe conquistato molte parti dell'Europa occidentale e dell'Africa novemila anni prima del tempo di Solone. Dopo avere fallito l'invasione di Atene, Atlantide sarebbe sprofondata \\"in un singolo giorno e notte di disgrazia\\" per opera di Poseidone. Il nome dell'isola deriva da quello di Atlante, leggendario governatore dell'oceano Atlantico, figlio di Poseidone, che sarebbe stato anche, secondo Platone, il primo re dell'isola.\\nLa descrizione geografica sembra anche indicare le Americhe come un continente circondato da un vero mare, in contrapposizione al mar Mediterraneo, definito \\"un porto di angusto ingresso\\".\\nEssendo una storia funzionale ai dialoghi di Platone, Atlantide è generalmente vista come un mito concepito dal filosofo greco per illustrare le proprie idee politiche."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_chr%C3%A1n%C4%9Bn%C3%BDch_%C3%BAzem%C3%AD_v_okrese_Brno-venkov","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f5/Rybi%C4%8Dkov%C3%A1_sk%C3%A1la_%281%29.jpg","page_title":"Seznam chráněných území v okrese Brno-venkov","context_page_description":"Toto je seznam chráněných území v okrese Brno-venkov aktuální k roku 2018, ve kterém jsou uvedena chráněná území v okrese Brno-venkov."},{"page_url":"https://ceb.wikipedia.org/wiki/Pholiota_gummosa","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/2010-11-06_Pholiota_gummosa_%28Lasch%29_Singer_118899.jpg","page_title":"Pholiota gummosa","context_page_description":"Espesye sa uhong sakop sa division nga Basidiomycota ang Pholiota gummosa. Una ning gihulagway ni Wilhelm Gottfried Lasch, ug nga gihatagan sa eksakto nga ngalan ni Rolf Singer ni adtong 1951. Ang Pholiota gummosa sakop sa kahenera nga Pholiota sa kabanay nga Strophariaceae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%8D%B0%E5%B0%BC%E7%9F%9B%E5%B0%BE%E9%B1%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Indonesian_coelacanth%2C_Expo_2015.jpg","page_title":"印尼矛尾鱼","context_page_description":"印尼矛尾魚，又稱蘇拉威西島矛尾魚，是腔棘魚目矛尾魚屬的其中一種。1997年，在印尼蘇拉威西島發現了一種奇特的魚，經基因測試發現這個標本在基因上與西印度洋矛尾魚略有差異。後來於2000年被正式描述，是為矛尾魚的另一個物種。分子分析估計兩個物種的分支時間大約在2,500萬年前。\\n該物種已被評定為易危。"},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_op_24_januari","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/John_Vanbrugh.jpg","page_title":"Lijst van personen geboren op 24 januari","context_page_description":"Dit is een lijst van personen die geboren zijn op 24 januari.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina.\\n76 - Hadrianus, Romeinse keizer, Romeins senator, volkstribuun en archont van Athene, militair en dichter uit het Oude Rome bewerken\\n1236 - Leo III van Armenië, monarch en soeverein bewerken\\n1287 - Richard de Bury, bisschop of Durham, rooms-katholiek priester, rechter en schrijver uit het Koninkrijk Engeland bewerken\\n1391 - Johanna van Valois, Franse koningin en hertogin bewerken\\n1444 - Galeazzo Maria Sforza, lijst van heersers van Milaan, politicus bewerken\\n1534 - Sai Setthathirat I, Laotiaanse monarch bewerken\\n1540 - Edmund Campion, Britse rooms-katholiek priester bewerken\\n1541 - Magdalena Moons, heldin van het Leidens ontzet bewerken\\n1547 - Johanna van Oostenrijk, Oostenrijkse aartshertogin, Groothertogin en hertogin, aristocraat bewerken"},{"page_url":"https://es.wikipedia.org/wiki/Montes_de_Bocelo","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/O_Bocelo_034.jpg","page_title":"Montes de Bocelo","context_page_description":"Los montes de Bocelo son una importante elevación ubicada en los ayuntamientos de Boimorto, Toques y Sobrado."},{"page_url":"https://el.wikipedia.org/wiki/%CE%97%CF%81%CE%B1%CE%BA%CE%BB%CE%AE%CF%82_%CE%98%CE%B5%CF%83%CF%83%CE%B1%CE%BB%CE%BF%CE%BD%CE%AF%CE%BA%CE%B7%CF%82_(%CF%80%CE%B5%CF%84%CE%BF%CF%83%CF%86%CE%B1%CE%AF%CF%81%CE%B9%CF%83%CE%B7_%CE%B1%CE%BD%CE%B4%CF%81%CF%8E%CE%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Matej_%C4%8Cerni%C4%8D_4.jpg","page_title":"Ηρακλής Θεσσαλονίκης (πετοσφαίριση ανδρών)","context_page_description":"Το τμήμα πετοσφαίρισης ανδρών του Ηρακλή αποτελεί μία από τις πιο αξιόλογες και πετυχημένες ελληνικές ομάδες τόσο στην Ελλάδα όσο και στα ευρωπαϊκά κύπελλα. Το τμήμα έχει κατακτήσει συνολικά 16 τίτλους. Από το 2000 και μετά η ομάδα διακρίθηκε όχι μόνο σε εθνικό επίπεδο αλλά και στις Ευρωπαϊκές διοργανώσεις, συμμετέχοντας 3 φορές στον τελικό του Τσάμπιονς Λιγκ, ενώ 5 φορές συνολικά βρέθηκε στις 4 κορυφαίες ομάδες της Ευρώπης.\\nΗ ομάδα η οποία από την περίοδο 2015–16 αγωνίζεται στην Α1 Εθνική κατηγορία, προέκυψε από τη συγχώνευση του τμήματος πετοσφαίρισης ανδρών του «Γ.Σ. Ηρακλής» με τον τότε δημιουργηθέντα σύλλογο «Ηρακλής Πετοσφαίριση 2015», ο οποίος επί της ουσίας απορρόφησε το τμήμα του Γ.Σ. Ηρακλή. Μετέχει στο Πρωτάθλημα Ελλάδας με την επωνυμία ΤΑΠ Ηρακλής Πετοσφαίριση 2015."},{"page_url":"https://de.wikipedia.org/wiki/Schwedische_EU-Ratspr%C3%A4sidentschaft_2009","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Fredrik_Reinfeldt_during_Stockholm_Pride_2007.jpg","page_title":"Schwedische EU-Ratspräsidentschaft 2009","context_page_description":"Die schwedische EU-Ratspräsidentschaft in der zweiten Jahreshälfte 2009 bezeichnet den Vorsitz Schwedens im Rat der Europäischen Union und im Europäischen Rat. Turnusgemäß übernahm der schwedische Premierminister Fredrik Reinfeldt am 1. Juli 2009 den Vorsitz des Europäischen Rates, der schwedische Außenminister Carl Bildt übernahm das Amt des Präsidenten des Rats der Europäischen Union. Mit Schweden endete die zweite Dreier-Präsidentschaft, die auch die vorangegangene französische und tschechische EU-Ratspräsidentschaft umfasst hatte. Ab 1. Januar 2010 übernahm Spanien die Ratspräsidentschaft.\\nDa während der schwedischen Ratspräsidentschaft der Vertrag von Lissabon in Kraft trat, war Reinfeldt der letzte Regierungschef, der den Vorsitz im Europäischen Rat innehatte. Ab 1. Dezember 2009 ging dieser an den neu ernannten hauptamtlichen Ratspräsidenten Herman Van Rompuy über, dessen Amt durch den Vertrag neu geschaffen worden war. Der Gipfel des Europäischen Rates am 10./11. Dezember 2009 wurde allerdings noch von Reinfeldt geleitet, Van Rompuy nahm lediglich daran teil."},{"page_url":"https://pt.wikipedia.org/wiki/Catas_Altas","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Altar_e_ret%C3%A1bulo_da_Capela_de_Santa_Quit%C3%A9ria%2C_Catas_Altas_MG.JPG","page_title":"Catas Altas","context_page_description":"Catas Altas é um município brasileiro no estado de Minas Gerais, Região Sudeste do país. Sua população estimada em 2019 era de 5 376 habitantes.\\nO nome 'provém das profundas escavações que se faziam no alto do morro'."},{"page_url":"https://nl.wikipedia.org/wiki/Mennens","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Staaldraadkous.JPG","page_title":"Mennens","context_page_description":"Mennens is een Rotterdams bedrijf, dat specialist is op het gebied van staalkabel, hijs- en heftechniek en valbeveiliging. Sinds 2012 is het onderdeel van de Zweedse multinational Axel Johnson International."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%96%AF%E9%AB%98%E7%89%B9%E8%8D%92%E5%8E%9F%E9%A3%8E%E5%8A%9B%E5%8F%91%E7%94%B5%E5%8E%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Scout_Moor_from_Radcliffe.jpg","page_title":"斯高特荒原风力发电厂","context_page_description":"斯高特荒原風力發電廠是英國內陸最大的風力發電廠，係為皮爾風力電力有限公司而建。儘管興建之中一直頗有爭論，英國政府仍於2005年給電廠頒發了規劃許可證，2007年動工。由於受惡劣天氣、複雜地形以及之前採礦活動的影響，工程一度受阻。2008年9月25日耗資5000萬英鎊的電廠正式竣工投產。現共有26台諾德克斯N80型風力渦輪機，電廠渦輪機支柱高度為60米，外部旋轉葉片長40米，總高100米，遠在15至20英里外的南曼徹斯特也能看到。電廠總裝機容量65 MW，年供電1.54億千瓦時，可滿足4萬個家庭的用電需求。"},{"page_url":"https://de.wikipedia.org/wiki/Scotty_Bullock","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Scotty_Bullock_privat.jpg","page_title":"Scotty Bullock","context_page_description":"Scotty Bullock ist ein deutscher Rock-’n’-Roll-Musiker aus der Oberpfalz. Der Sänger und Gitarrist tritt seit 2015 mit seinem Trio auf. Er singt neben Coversongs auch eigene Stücke, vorwiegend in englisch. Das Trio hat aber auch deutsch- und bayerischsprachige Nummern im Repertoire. Bullock\`s Musik fällt im weitesten Sinne unter das Genre Americana, mit dabei ist Rockmusik, Rock ’n’ Roll, Rockabilly, Blues, 60er Jahre Beat, Surf, Bluegrass und Alternativ- Country."},{"page_url":"https://fy.wikipedia.org/wiki/Alfred_Tepe","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Hellendoorn%2C_de_Sint_Sebastianuskerk_GM-0163WN038_foto7_2014-10-04_12.414.jpg","page_title":"Alfred Tepe","context_page_description":"Alfred Tepe wie in Nederlânsk arsjitekt. Nei P.J.H. Cuypers wie er de wichtichste arsjitekt fan de neogotyk yn Nederlân. Hy ûntwurp in soad tsjerken, fral yn it earder aartsbisdom Utert."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%82%A8%EC%88%98%EB%8B%A8_%EB%82%B4%EC%A0%84","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/64/JEM_Logo_June_2013.jpg","page_title":"남수단 내전","context_page_description":"남수단 내전은 2013년 12월 14일, 남수단에서 남수단 육군의 파벌 중 일부가 쿠데타를 일으킨 후 발발한 내전이다. 남수단의 대통령 살바 키르 마야르디트는 다음날 쿠데타가 진압되었다고 발표했다. 그러나, 16일 이후 전투가 재개되었고 전투가 수도 주바를 넘어서 종글레이 주의 민족 경계선을 따라 전투가 확장되고 있다. 적어도 1,000명이 사망했고 800명 이상이 부상을 입었다. 대통령 키르 마야르디트는 전 부통령인 리에크 마차르가 쿠데타를 일으켰다고 주장했지만, 마차르는 이를 부인했고 대통령이 권력정치를 일으키려 한다며 키르 마야르디트를 비난했다. 12월 19일에는 남수단 인민군이 보르를 점령했다. 같은 날, 아코보의 UN 구내가 습격당해 UNMISS 소속 인도인 직원 2명이 사망했다."},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_equ%C3%ADvocos_comuns","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Great_Wall_of_China%2C_Satellite_image.jpeg","page_title":"Lista de equívocos comuns","context_page_description":"Esta é uma lista de equívocos comuns, tais como mitos populares ou interpretações errôneas de fatos. Cada item comunica uma correção e não o fato errôneo em si. Esta lista é feita para ser concisa, porém mais detalhes podem ser encontrados nos respectivos artigos."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%90%D0%BB%D0%B2%D0%B5%D1%80%D0%BD%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Alwernia-Urz%C4%85d_Miejski.jpg","page_title":"Алверня","context_page_description":"Алвѐрня е град в Южна Полша, Малополско войводство, Хшановски окръг. Административен център е на градско-селската Алвернска община. Заема площ от 8,88 км²."},{"page_url":"https://no.wikipedia.org/wiki/Friedrich_W%C3%B6hler","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Friedrich_W%C3%B6hler_Litho.jpg","page_title":"Friedrich Wöhler","context_page_description":"Friedrich Wöhler var en tysk kjemiker, best kjent for sin syntese av urea i 1828. Detta var det første organiske stoffet som ble laget syntetitisk fra helt ikke-organiske utgangsstoff. Dette ledet til at man gikk bort fra teorien om at en særlig \\"livskraft\\" behøvdes for å skape karbonforbindelser. Wöhler var også først til å isolere mange av grunnstoffene.\\nWöhler ble født i Eschersheim, i dag et distrikt i Frankfurt am Main. I 1823 avslutet Wöhler sine medisinstudier i Heidelberg ved Leopold Gmelins laboratorium, som arrangerte en mulighet for Wöhler å arbeide hos Jöns Jakob Berzelius i Stockholm. Fra 1825 til 1831 var Wöhler lærer ved yrkesskolen i Berlin, fra 1828 med tittelen professor. Fra 1831 til 1836 var han professor ved den høyere yrkesskolen i Kassel. Etter Friedrich Stromeyers død i 1835 ble Wöhler i 1836 hans etterfølger i professoratet i medisin, kjemi og farmasi ved Universitetet i Göttingen og arbeidet der til sin død i 1882.\\nWöhler var medlem av Vitenskapsakademiet i Göttingen og ble i 1834 innvalgt som utenlandsk medlem av den svenske Kungliga Vetenskapsakademien."},{"page_url":"https://de.wikipedia.org/wiki/Santenay_(C%C3%B4te-d%E2%80%99Or)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Santenay_%28C%C3%B4te_d%27Or%2C_Fr%29_Ch%C3%A2teau_Philippe_Le_Hardi.JPG","page_title":"Santenay (Côte-d’Or)","context_page_description":"Santenay ist eine französische Gemeinde mit 874 Einwohnern. Sie liegt im Tal des Flusses Dheune, im Süden der Côte de Beaune und gehört zum Département Côte-d’Or. Besonders wegen seiner Weine ist Santenay weltweit bekannt geworden. Der Ort verfügt über einige Heilquellen, weshalb Santenay auch als Heilbad berühmt ist. Zur Römerzeit wurde die Gemeinde Sentilliacum genannt. Den Namen verdankte sie einem ihrer Quellen, der Santana. Am Ende des 19. Jahrhunderts gab es noch vier Brunnen, nämlich:\\ndie Fontaine Salée\\nden Santana Brunnen,\\nden Carnot Brunnen und\\nden Lithium Brunnen.\\nHeute sind nur noch die beiden letzteren in Betrieb. Das Wasser enthält viel Lithium, das für seine heilsame Wirkung bekannt ist. Wie häufig bei Heilbädern, gibt es hier auch ein Spielcasino.\\nSantenay ist die südlichste Gemeinde des Departements Côte-d’Or."},{"page_url":"https://es.wikipedia.org/wiki/Elecciones_parlamentarias_de_Hungr%C3%ADa_de_2014","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Schiffer_Andr%C3%A1s_%28VEH%C3%8DR%29.jpg","page_title":"Elecciones parlamentarias de Hungría de 2014","context_page_description":"Las elecciones legislativas de 2014 se llevaron a cabo en Hungría el día 6 de abril. En estas elecciones los conservadores arrasaron en los resultados, aunque con menor resultado que en las anteriores elecciones, ofreciendo a la coalición gubernamental la victoria electoral tal como se esperaba.​"},{"page_url":"https://sv.wikipedia.org/wiki/Televerket","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Dialog_1966_grau.jpg","page_title":"Televerket","context_page_description":"Televerket var fram till 1 juli 1993 ett verk som ägde och drev Sveriges telenät, TV-nät och mobila nät. Det grundades genom regeringsbeslut i februari 1853. Redan från starten var verket både en myndighet och ett affärsdrivande verk. Från 1920-talet fram till 1993 hade verket de facto ett monopol på telefoni i hela Sverige, även om något monopol i strikt lagteknisk mening aldrig existerade.\\nVerket grundades som Kongl. Elecktriska Telegraf-Werket. Namnet förenklades 1871 till Kongl. Telegrafverket och 1903 ändrades stavningen till Kungl. Telegrafverket men under 1946 kapades \\"Kungl.\\" bort och till hundraårsjubileet 1953 kortades namnet till Televerket."},{"page_url":"https://vi.wikipedia.org/wiki/Eburodacrys_sticticollis","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Biologia_Centrali-Americana_-_Eburodacrys_sticticollis.jpg","page_title":"Eburodacrys sticticollis","context_page_description":"Eburodacrys sticticollis là một loài bọ cánh cứng trong họ Cerambycidae."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%83%95%E3%83%AA%E3%82%AB%E3%83%97%E3%83%AC%E3%83%BC%E3%83%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Plates_tect2_ja.svg","page_title":"アフリカプレート","context_page_description":"アフリカプレートは、アフリカ大陸とその周辺海域の地殻及びマントル上方のリソスフェアを形成する大陸プレートである。"},{"page_url":"https://sv.wikipedia.org/wiki/Commelina_maculata","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Commelina_maculata_W_IMG_0457.jpg","page_title":"Commelina maculata","context_page_description":"Commelina maculata är en himmelsblomsväxtart som beskrevs av Michael Pakenham Edgeworth. Commelina maculata ingår i släktet himmelsblommor, och familjen himmelsblomsväxter. Inga underarter finns listade."},{"page_url":"https://ceb.wikipedia.org/wiki/Chvalkovice_(lungsod_sa_Nasod_nga_Czech,_lat_50,41,_long_15,98)","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/39/Chvalkovice-vlajka.jpg","page_title":"Chvalkovice (lungsod sa Nasod nga Czech, lat 50,41, long 15,98)","context_page_description":"Lungsod ang Chvalkovice sa Nasod nga Czech. Nahimutang ni sa amihanan-sidlakang bahin sa nasod, 120 km sa sidlakan sa Prague ang ulohan sa nasod. 310 metros ibabaw sa dagat kahaboga ang nahimutangan sa Chvalkovice, ug adunay 647 ka molupyo.\\nAng yuta palibot sa Chvalkovice kay medyo bungtoron. Ang kinahabogang dapit sa palibot dunay gihabogon nga 392 ka metro ug 1.0 km sa amihanan sa Chvalkovice. Dunay mga 40 ka tawo kada kilometro kwadrado sa palibot sa Chvalkovice medyo gamay nga populasyon. Ang kinadul-ang mas dakong lungsod mao ang Trutnov, 16.9 km sa amihanan sa Chvalkovice. Hapit nalukop sa kaumahan ang palibot sa Chvalkovice. Sa rehiyon palibot sa Chvalkovice, mga bungtod talagsaon komon.\\nAng klima hemiboreal. Ang kasarangang giiniton 7 °C. Ang kinainitan nga bulan Agosto, sa 20 °C, ug ang kinabugnawan Enero, sa -8 °C."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%9B%84%E9%A6%99%E5%AF%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Yukoji_Kaizando.jpg","page_title":"雄香寺","context_page_description":"雄香寺は長崎県平戸市にある臨済宗妙心寺派の寺院。山号は俊林山。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kaiser-Josef-II.-Denkm%C3%A4ler","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/POL_Cieszyn_Park_Pokoju_lapidarium_-_pomnik_J%C3%B3zefa_II.jpg","page_title":"Liste der Kaiser-Josef-II.-Denkmäler","context_page_description":"Denkmäler zur Erinnerung an den Kaiser Joseph II. wurden im 19. Jahrhundert in zahlreichen Städten und Gemeinden der Länder der böhmischen Krone und in den Österreichischen Erbländern errichtet. Die Initiatoren dieser Denkmäler wollten damit an wichtige Ergebnisse seiner Josephinischen Reformen erinnern, insbesondere an die „Aufhebung der Leibeigenschaft“ durch das Untertanenpatent von 1781 und das Toleranzpatent von 1781 zur Religionsfreiheit, sowie die Reformen zur Neuordnung der Grundsteuer und Verbesserung der Volksgesundheit."},{"page_url":"https://war.wikipedia.org/wiki/Aratinga_pertinax","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Brown-throated_Parakeet_%28Aratinga_pertinax%29_-pet.jpg","page_title":"Aratinga pertinax","context_page_description":"An Aratinga pertinax in uska species han Aves nga syahan ginhulagway ni Linnaeus hadton 1758. An Aratinga pertinax in nahilalakip ha genus nga Aratinga, ngan familia nga Psittacidae. Ginklasipika han IUCN an species komo diri gud kababarak-an."},{"page_url":"https://en.wikipedia.org/wiki/R%C3%B6chling_shell","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Bundesarchiv_N_1603_Bild-117%2C_Russland%2C_Sewastopol%2C_zerst%C3%B6rte_Festung_Maxim_Gorki.jpg","page_title":"Röchling shell","context_page_description":"Röchling shells were bunker-busting artillery shells, developed by German engineer August Cönders during World War II, based on the theory of increasing the sectional density to improve penetration."},{"page_url":"https://fi.wikipedia.org/wiki/Miloslav_Me%C4%8D%C3%AD%C5%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Tennis%2C_Melkhuisje_open_kampioenschappen_winnaar_Mecir_met_beker%2C_Bestanddeelnr_934-0434.jpg","page_title":"Miloslav Mečíř","context_page_description":"Miloslav Mečíř on nykyisin slovakialainen, ammattilaisvuosinaan tšekkoslovakialainen tennispelaaja ja olympiavoittaja. Soulin kesäolympialaisissa 1988 hän voitti kaksinpelissä miesten tenniksen kultaa ja nelinpelissä pronssia.\\nMečíř eteni finaaliin Yhdysvaltain ja Australian avoimissa; hänet päihitti kummallakin kerralla Ivan Lendl.\\nOikeakätinen Mečíř oli ammattilaisena vuosina 1982–1990. Hän saavutti sekä kaksin- että nelinpelissä korkeimmillaan kansainvälisen rankinglistan neljännen sijan vuonna 1988.\\nMečířin poika Miloslav Mečíř Jr. pelaa nykyisin tennisammattilaisena."},{"page_url":"https://ceb.wikipedia.org/wiki/Sulham","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Sulham_-_geograph.org.uk_-_4222.jpg","page_title":"Sulham","context_page_description":"Distrito ang Sulham sa Hiniusang Gingharian. Nahimutang ni sa kondado sa West Berkshire ug apil sa nasod sa Inglatera, sa habagatang bahin sa nasod, 70 km sa kasadpan sa London ang ulohan sa nasod.\\nAng klima baybayon. Ang kasarangang giiniton 10 °C. Ang kinainitan nga bulan Hulyo, sa 18 °C, ug ang kinabugnawan Disyembre, sa 2 °C."},{"page_url":"https://en.wikipedia.org/wiki/Gr%C3%AAmio_Foot-Ball_Porto_Alegrense","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/CBF_Brazilian_Cup.png","page_title":"Grêmio Foot-Ball Porto Alegrense","context_page_description":"Grêmio Foot-Ball Porto Alegrense, commonly known as Grêmio, is a Brazilian professional football club based in Porto Alegre, Rio Grande do Sul. The club plays in the Campeonato Brasileiro Série A, the top tier of the Brazilian football league system, and the Campeonato Gaúcho, Rio Grande do Sul's top state league. The club was founded in 1903. The club's home ground is the Arena do Grêmio, to which it moved in 2013, having previously played at Estádio Olímpico Monumental since 1954.\\nGrêmio also became Champions of the Intercontinental Cup, after beating Hamburger SV in 1983. Also, Grêmio is the Brazilian club that most won the Copa Libertadores da América, alongside São Paulo and Santos.\\nAs of 2017, Grêmio was ranked number one in the CBF club rankings and is listed by Forbes as the third most valuable football club in the Americas with an estimated value of $295.5 million. Grêmio has won 38 Campeonato Gaúcho, 2 Campeonato Brasileiro Série A, 1 Campeonato Brasileiro Série B, 1 Supercopa do Brasil, 1 Copa Sul and 5 Copa do Brasil. Internationally, Grêmio has won 1 Intercontinental Cup, 3 Copa Libertadores de América, 2 Recopa Sudamericana and 1 Sanwa Bank Cup."},{"page_url":"https://gl.wikipedia.org/wiki/Constantino_Draga%C5%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Central_balkans_1373_1395V1.svg","page_title":"Constantino Dragaš","context_page_description":"Constantino Dragaš, finado o 17 de maio de 1395, foi un señor rexional semi-independente no fragmentado reino de Serbia centrado en Velbazhd de 1378 até a súa morte na batalla de Rovine."},{"page_url":"https://fr.wikipedia.org/wiki/Harakat_al-Muthanna","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/IslamicMuthannaMovementFlag.png","page_title":"Harakat al-Muthanna","context_page_description":"Le Harakat al-Muthanna al-Islamiyyah était un groupe rebelle djihadiste actif de 2012 à 2016 lors de la guerre civile syrienne."},{"page_url":"https://af.wikipedia.org/wiki/Burlington,_Vermont","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/DanielWebsterRobinsonHouse_1352x900_crop.png","page_title":"Burlington, Vermont","context_page_description":"Burlington is die grootste stad in die deelstaat Vermont en die administratiewe hoofstad van Chittenden County. Burlington dien as die ekonomiese, finansiële, nywerheids-, kulturele en opvoedkundige sentrum van Vermont.\\nMet 'n bevolking van 42 417 is Burlington die sentrum van een van die kleiner metropolitaanse gebiede van die Verenigde State, wat naas Burlington uit die stede South Burlington en Winooski en die dorpe Colchester, Essex en Essex Junction bestaan. Die metropolitaanse gebied beslaan die drie noordwestelike distrikte Chittenden, Franklin en Grand Isle met 'n totale bevolking van 203 503. Nogtans is Burlington die \\"kleinste\\" grootste stad van enige VSA-deelstaat.\\nDanksy sy ligging aan die oostelike oewer van die Champlainmeer naby die Groen Berge en sy verruklike natuurskoon het Burlington tot 'n belangrike hawestad en toeristebestemming ontwikkel."},{"page_url":"https://sh.wikipedia.org/wiki/Homoseksualno_pona%C5%A1anje_kod_%C5%BEivotinja","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Black_Swans.jpg","page_title":"Homoseksualno ponašanje kod životinja","context_page_description":"Homoseksualno ponašanje kod životinja je seksualno ponašanje među životinjskim vrstama, osim ljudi, koje se odnosi kako na homoseksualno tako i na biseksualno ponašanje. Ovo može uključivati seksualnu aktivnost, udvaranje, naklonost, sparivanje i roditeljstvo istopolnih parova. Istraživanja ukazuju na to da se razni oblici ovakvog ponašanja sreću u čitavom životinjskom carstvu. Od 1999. godine je za skoro 500 vrsta, počev od primata pa do kukastih crva, dokumetovano da imaju neku formu istopolnog seksualnog ponašanja. Prema mišljenju organizatora izložbe „Protiv prirode?”, to je zapaženo kod 1.500 vrsta.\\nPrema Brusu Bagemilu, „životinjsko carstvo” ima veliku seksualnu raznovrsnost koja uključuje i homoseksualni, biseksualni i neproduktivni seksualni čin. Raznovrsnost je toliko velika da naučna zajednica i društvo uopšte nisu bili spremni da to prihvate. Bagemil dodaje da je o ovome neophodno govoriti kako bi ljudi na pravi način tumačili fenomen."},{"page_url":"https://de.wikipedia.org/wiki/Briefmarken-Ausgaben_f%C3%BCr_Berlin_und_Brandenburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/OPD_BLN_1945_2A_Berliner_B%C3%A4r.jpg","page_title":"Briefmarken-Ausgaben für Berlin und Brandenburg","context_page_description":"Die Briefmarken-Ausgaben Berlin und Brandenburg der Sowjetischen Besatzungszone wurden ab dem 3. August 1945 herausgegeben, sie waren bis zum 21. Oktober 1946 gültig. Ab Februar 1946 bis Anfang 1947 wurden Briefmarken des Kontrollrats, also für die Bizone und die Sowjetische Besatzungszone gemeinsam ausgegeben. Die insgesamt sieben Briefmarken unterscheiden sich in drei Zähnungsvarianten."},{"page_url":"https://en.wikipedia.org/wiki/Conservative_transposition","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/DNA_transposition.gif","page_title":"Conservative transposition","context_page_description":"Transposition is the process by which a specific genetic sequence, known as a transposon, is moved from one location of the genome to another. Simple, or conservative transposition, is a non-replicative mode of transposition. That is, in conservative transposition the transposon is completely removed from the genome and reintegrated into a new, non-homologous locus, the same genetic sequence is conserved throughout the entire process. The site in which the transposon is reintegrated into the genome is called the target site. A target site can be in the same chromosome as the transposon or within a different chromosome. Conservative transposition uses the \\"cut-and-paste\\" mechanism driven by the catalytic activity of the enzyme transposase. Transposase acts like DNA scissors; it is an enzyme that cuts through double-stranded DNA to remove the transposon, then transfers and pastes it into a target site.\\nA simple, or conservative, transposon refers to the specific genetic sequence that is moved via conservative transposition. These specific genetic sequences range in size, they can be hundreds to thousands of nucleotide base-pairs long."},{"page_url":"https://eo.wikipedia.org/wiki/Kristiano_la_4-a_(Danio-Norvegio)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Kristian_IV_av_Danmark%2C_malning_av_Pieter_Isaacsz_1611-1616.jpg","page_title":"Kristiano la 4-a (Danio-Norvegio)","context_page_description":"Kristiano la 4-a, dane Christian 4., reĝo de Danio-Norvegio 1588 – 1648. Filo de Frederiko la 2-a.\\nKristiano estis ambicia kaj potenca monarko, kiu dum sia nekutime longa regado reformis la landon kaj klopodis establi grandpotencon Danio-Norvegio. Per pluraj kostaj militiroj li gajnis, sed fine ankaŭ denove perdis multan potencon por la reĝlando. Li konstruigis plurajn urbojn, ofte nomataj laŭ li mem."},{"page_url":"https://be.wikipedia.org/wiki/%D0%9C%D1%81%D1%86%D1%96%D1%81%D0%BB%D0%B0%D1%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Am%C5%9Bcis%C5%82a%C5%AD%2C_Pahonia._%D0%90%D0%BC%D1%81%D1%8C%D1%86%D1%96%D1%81%D0%BB%D0%B0%D1%9E%2C_%D0%9F%D0%B0%D0%B3%D0%BE%D0%BD%D1%8F_%281720%29.jpg","page_title":"Мсціслаў","context_page_description":"Мсцісла́ў — горад раённага падпарадкавання ў Магілёўскай вобласці Беларусі, адміністрацыйны цэнтр Мсціслаўскага раёна, на рацэ Віхра. За 95 км ад Магілёва, за 19 км ад чыгуначнай станцыі Ходасы на лініі Орша—Крычаў. Вузел аўтамабільных дарог на Магілёў, Горкі, Крычаў, Чавусы; Хіславічы. Насельніцтва 10 370 чал."},{"page_url":"https://en.wikipedia.org/wiki/Thomas_Eisfeld","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Thomas_Eisfeld_2013.jpg","page_title":"Thomas Eisfeld","context_page_description":"Thomas Eisfeld is a German professional footballer who plays for VfL Bochum as an attacking midfielder."},{"page_url":"https://et.wikipedia.org/wiki/David_Copperfield","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/DavidCopperfieldNewJersey2008-05-08.jpg","page_title":"David Copperfield","context_page_description":"David Copperfield on USA juudi päritolu mustkunstnik.\\nLavanime \\"David Copperfield\\" on ta nooruses võtnud Charles Dickensi samanimelisest raamatust."},{"page_url":"https://sh.wikipedia.org/wiki/Nicolas_Cage","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/NicolasCage.jpg","page_title":"Nicolas Cage","context_page_description":"Nicolas Cage, američki glumac, dobitnik Oscara za najbolju glavnu ulogu u filmu Napuštajući Las Vegas."},{"page_url":"https://en.wikipedia.org/wiki/2016_European_Aquatics_Championships","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Interior_London_Aquatics_Centre_Aug_2014_02.JPG","page_title":"2016 European Aquatics Championships","context_page_description":"The 2016 European Aquatics Championships took place from 9 to 22 May 2016 in London, United Kingdom, in the London Aquatics Centre. It was the thirty second edition of the event, and the second held in the same year as a Summer Olympics. Hosts Great Britain headed the medal table for the second successive event; although their swimming return was slightly down, partly down to a small number of star names resting prior to Rio, the gap was made up by an outstanding performance in the diving pool."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%9D%9E%E5%B8%B8%E7%B7%9A%E3%81%AE%E5%A5%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Dragnet_Girl_1933.jpeg","page_title":"非常線の女","context_page_description":"『非常線の女』は、1933年4月27日公開の日本映画である。松竹キネマ製作・配給。監督は小津安二郎。モノクロ、スタンダード、サイレント、100分。\\nアメリカ映画に影響を受けた小津監督による和製ギャング映画で、岡譲二が暗黒街の男、田中絹代がその情婦を演じた。東京国立近代美術館フィルムセンターが119分尺および120分尺の35mmフィルム、120分尺の16mmフィルムの3種類の上映用ポジプリントを所蔵している。2003年12月25日に、松竹が発売した『小津安二郎 DVD-BOX 第四集』に収録された"},{"page_url":"https://fr.wikipedia.org/wiki/PreZero_Arena","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Sinsheim_-_Rhein-Neckar-Arena_-_blick_von_der_Burg_Steinsberg_2016-03-28_17-08-31.JPG","page_title":"PreZero Arena","context_page_description":"La PreZero Arena est un stade de football où se déroulent les matchs à domicile du TSG 1899 Hoffenheim, club évoluant en Bundesliga.\\nSitué à Sinsheim dans le Land du Bade-Wurtemberg en Allemagne, il fut inauguré le 24 janvier 2009."},{"page_url":"https://en.wikipedia.org/wiki/Solanaceae","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Goetzea_elegans_flower.jpg","page_title":"Solanaceae","context_page_description":"The Solanaceae, or nightshades, are a family of flowering plants that ranges from annual and perennial herbs to vines, lianas, epiphytes, shrubs, and trees, and includes a number of agricultural crops, medicinal plants, spices, weeds, and ornamentals. Many members of the family contain potent alkaloids, and some are highly toxic, but many—including tomatoes, potatoes, eggplant, bell and chili peppers—are used as food. The family belongs to the order Solanales, in the asterid group and class Magnoliopsida. The Solanaceae consists of about 98 genera and some 2,700 species, with a great diversity of habitats, morphology and ecology.\\nThe name Solanaceae derives from the genus Solanum, \\"the nightshade plant\\". The etymology of the Latin word is unclear. The name may come from a perceived resemblance of certain solanaceous flowers to the sun and its rays. At least one species of Solanum is known as the \\"sunberry\\". Alternatively, the name could originate from the Latin verb solare, meaning \\"to soothe\\", presumably referring to the soothing pharmacological properties of some of the psychoactive species of the family."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D0%B0%D1%81%D1%96%D0%BB_%D0%90%D0%BC%D0%B0%D1%88%D1%83%D0%BA%D0%B5%D0%BB%D1%96","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7b/%E1%83%90%E1%83%99%E1%83%90%E1%83%99%E1%83%98_%E1%83%AC%E1%83%94%E1%83%A0%E1%83%94%E1%83%97%E1%83%94%E1%83%9A%E1%83%98%2C_%E1%83%95%E1%83%90%E1%83%A1%E1%83%98%E1%83%9A_%E1%83%90%E1%83%9B%E1%83%90%E1%83%A8%E1%83%A3%E1%83%99%E1%83%94%E1%83%9A%E1%83%98.jpg","page_title":"Васіл Амашукелі","context_page_description":"Васіл Амашукелі — перший грузинський кінорежисер, автор документальних фільмів. Працював у кіноіндустрії Азербайджану та Грузії до Першої світової війни."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%AF%BA%E8%B4%9D%E5%B0%94%E5%8C%96%E5%AD%A6%E5%A5%96%E5%BE%97%E4%B8%BB%E5%88%97%E8%A1%A8","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/15/Hans_Fischer_%28Nobel%29.jpg","page_title":"诺贝尔化学奖得主列表","context_page_description":"諾貝爾化學獎 是諾貝爾獎的六個獎項之一，1895年設立，由瑞典皇家科學院每年頒發給在化學相關的各個領域中做出傑出貢獻的科學家。根據獎項設立者阿佛烈·諾貝爾的遺願，該獎由諾貝爾基金會管理，瑞典皇家科學院每年選出五人委員會來評選出當年獲獎者。第一個諾貝爾化學獎於1901年頒發給荷蘭科學家雅各布斯·亨里克斯·凡特荷夫。每一位獲獎者都會得到一塊獎牌，一份獲獎證書，以及一筆不菲的獎金，獎金的數額每年會有變化。例如，1901年，凡特荷夫得到的獎金為150,782瑞典克朗，相當於2007年12月的7,731,004瑞典克朗；而2008年，下村脩、馬丁·查爾菲和錢永健分享了總數為一千萬瑞典克朗的獎金。該獎每年於12月10日，即阿佛烈·諾貝爾逝世周年紀念日，以隆重的儀式在斯德哥爾摩頒發。\\n就獲獎領域而言，有至少25名獲獎者在有機化學研究中做出貢獻，比其他化學領域的獲獎者都多。有兩位諾貝爾化學獎獲獎者，德國的里夏德·庫恩和阿道夫·布特南特，受其政府阻止不能接受獎金。他們雖然後來收到了獎牌和獲獎證書，但沒有收到獎金。弗雷德里克·桑格是至今唯一一位兩次獲得諾貝爾化學獎的科學家。其他兩次獲得諾貝爾獎的瑪麗·居禮和萊納斯·鮑林都是在不同領域獲獎。有五位女性獲得過化學獎：瑪麗·居禮、伊雷娜·約里奧-居里、桃樂絲·克勞福特·霍奇金、艾妲·尤納特和弗朗西斯·阿諾德。截至2019年，已經有183人獲得諾貝爾化學獎。從1901年至今，該獎有8年因故停發，有9年延遲一年頒發。"},{"page_url":"https://en.wikipedia.org/wiki/New_Plymouth_Boys%27_High_School","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/NPBHS20081123.jpg","page_title":"New Plymouth Boys' High School","context_page_description":"New Plymouth Boys' High School is a single-sex boys' state secondary school in New Plymouth, Taranaki, New Zealand.\\nThe school currently caters for approximately 1300 students, including 210 boarders, on its 15 hectares site.\\nThe school often collaborates with the very close-by New Plymouth Girls' High School. For example, the Hillary Challenge team for New Plymouth always draws students from both schools and the jazz band and concert band include musicians from both schools."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D9%82%D8%A8%D8%B1%D8%A9_%D9%85%D9%88%D9%86%D8%A8%D8%A7%D8%B1%D9%86%D8%A7%D8%B3","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9b/Juliocortazar.jpg","page_title":"مقبرة مونبارناس","context_page_description":"مقبرة مونبارناس ‏ هي مقبرة تقع في حي مونبارناس بالمنطقة الرابعة عشرة من العاصمة الفرنسية باريس."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%85%D8%A7%D8%B1_%D8%B4%D8%A7%D8%AE%D9%87%E2%80%8C%D8%A7%D9%86%DA%AF%D9%88%D8%B1%DB%8C_%D8%B3%D8%A8%D8%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/CulebraChocoya2.JPG","page_title":"مار شاخه‌انگوری سبز","context_page_description":"مار شاخه‌انگوری سبز یا مار نان‌لواشی گونه‌ای مار درختی لاغر دراز از تیره قمچه‌ماران است که بومی آمریکای مرکزی و آمریکای جنوبی است."},{"page_url":"https://ja.wikipedia.org/wiki/JR%E8%B2%A8%E7%89%A9%E3%82%BF%E3%82%AD1100%E5%BD%A2%E8%B2%A8%E8%BB%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/JRW_Yamaguchi_line_cargo_train.jpg","page_title":"JR貨物タキ1100形貨車","context_page_description":"JR貨物タキ1100形貨車は、1997年から1998年に24両が日本車輌製造にて製作された、37t積のフライアッシュおよび炭酸カルシウム専用のタンク車である。\\n車籍は日本貨物鉄道、所有者は宇部興産の子会社である宇部興産セメントサービスである。"},{"page_url":"https://es.wikipedia.org/wiki/Elecciones_estatales_de_Aguascalientes_de_1986","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/CENMABV.jpg","page_title":"Elecciones estatales de Aguascalientes de 1986","context_page_description":"Las Elecciones estatales de Aguascalientes de 1986 se llevaron a cabo el domingo 5 de octubre de 1986, y en ellas se renovaron los siguientes cargos de elección popular en el estado mexicano de Aguascalientes:\\nGobernador de Aguascalientes. Titular del Poder Ejecutivo del estado, electo para un periodo de seis años no reelegibles en ningún caso, el candidato electo fue Miguel Ángel Barberena Vega.\\n9 Ayuntamientos. Compuestos por un Presidente Municipal y regidores, electos para un periodo de tres años no reelegibles para el periodo inmediato.\\n16 Diputados al Congreso del Estado. 12 electos por mayoría relativa en cada uno de los Distrito Electorales y 4 por representación proporcional."},{"page_url":"https://el.wikipedia.org/wiki/%CE%91%CE%BB%CE%B2%CE%AD%CF%81%CF%84%CE%BF%CF%82_%CF%84%CE%B7%CF%82_%CE%A3%CE%B1%CE%BE%CE%BF%CE%BD%CE%AF%CE%B1%CF%82-%CE%9A%CF%8C%CE%BC%CF%80%CE%BF%CF%85%CF%81%CE%B3%CE%BA_%26_%CE%93%CE%BA%CF%8C%CF%84%CE%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Prince_Albert_-_Partridge_1840.jpg","page_title":"Αλβέρτος της Σαξονίας-Κόμπουργκ & Γκότα","context_page_description":"Ο Αλβέρτος της Σαξονίας-Κόμπουργκ και Γκότα ήταν ο δευτερότοκος γιος του Ερνέστου Α΄, δούκα της Σαξονίας-Κόμπουργκ & Γκότα και σύζυγος της Βικτωρίας, βασίλισσας της Βρετανίας.\\nΟ Αλβέρτος πέθανε στη σχετικά νεαρή ηλικία των 42 ετών, βυθίζοντας τη σύζυγό του σε βαθύ πένθος για το υπόλοιπο της ζωής της. Μετά το θάνατο της βασίλισσας Βικτωρίας το 1901, ο μεγαλύτερος γιος τους ανέβηκε στο θρόνο ως Εδουάρδος Ζ΄ και έγινε ο πρώτος Βρετανός μονάρχης του Οίκου της Σαξονίας-Κόμπουργκ & Γκότα."},{"page_url":"https://de.wikipedia.org/wiki/Gasbeh%C3%A4lter","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d5/Mittledruck_Membrangasbeh%C3%A4lter_Saldanha-Steel.jpg","page_title":"Gasbehälter","context_page_description":"Ein Gasspeicher ist ein Reservoir, das zur Speicherung von brennbaren Gasen wie Stadtgas, Erdgas, Flüssiggas, Biogas und Klärgas eingesetzt wird. Der Begriff umfasst oberirdische Gasbehälter, bodennah verlegte Röhrenspeicher, tiefe Kavernen und geogene Untergrundspeicher."},{"page_url":"https://mn.wikipedia.org/wiki/%D0%98%D0%B4%D1%8D%D1%80_%D1%81%D1%83%D0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Ider%2C_Zavkhan.png","page_title":"Идэр сум","context_page_description":"Идэр сум нь Завхан аймгийн 24 сумын нэг нь юм. Завхан аймгийн төв Улиастай хотоос зүүн тийш, Тэлмэн, Тосонцэнгэл, Отгон, Алдархаан, Яруу сумдтай хиллэн, Хангайн нурууны баруун хэсгийн араар уулын царам өндөрлөг газар, Идэрийн голын эхэн биед оршино.\\nСумын төв нь Зуунмод, аймгийн төв Улиастайгаас 78 км, Отгонтэнгэр уулаас 65 км, Улаанбаатар хотоос 920 км зайтай оршино.\\nЦэцэрлэг, Дархан-Уул, Загастай, Мануустай гэсэн дөрвөн баг, 800 гаруй өрх, 3 мянга орчим хүн ам, 49,9 мянган толгой малтай. Гол эрхлэх аж ахуй нь мал аж ахуй. Тус нутгийн уугуул олон өрх айл Улаанбаатар, Дархан, Эрдэнэт, Улиастай зэрэг төв суурин газарт тархан суурьшсан байдгаас нэлээд нь Завхан аймгийн Тосонцэнгэл суманд байдаг."},{"page_url":"https://sv.wikipedia.org/wiki/Platyrhinoidis_triseriata","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Platyrhinoidis_triseriata_rangemap.png","page_title":"Platyrhinoidis triseriata","context_page_description":"Platyrhinoidis triseriata är en rockeart som först beskrevs av Jordan och Gilbert 1880. Platyrhinoidis triseriata ingår i släktet Platyrhinoidis och familjen Rhinobatidae. IUCN kategoriserar arten globalt som livskraftig. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://en.wikipedia.org/wiki/Gosen_Canal","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b2/Gosener_Kanal_%283%29.JPG","page_title":"Gosen Canal","context_page_description":"The Gosen Canal is a canal in the eastern suburbs of Berlin, the capital city of Germany. It takes its name from the village Gosen, at the southern end of the canal. It is 4 kilometres in length and links the Dämeritzsee and Seddinsee lakes. The Dämeritzsee and Seddinsee are both navigable, with the Seddinsee providing a link to the River Dahme and the Oder-Spree Canal, and the Dämeritzsee providing a link to the Müggelspree reach of the River Spree and to the Flakensee.\\nAlthough the plan for the Gosen Canal goes back to 1872, construction did not start until 1933, and the canal opened in 1936. The principal reason for the construction was to provide an alternative route for commercial shipping between Berlin and the Oder-Spree Canal during the 1936 Summer Olympics, when the more normal route via the Langer See was closed in order to use the regatta course at Grünau for the Olympic canoeing and rowing events.\\nThe canal is navigable by boats with a draught of up to 2 metres. It has no locks, but is crossed by a single bridge, with a maximum clearance of 4.3 metres. Small craft are also able to navigate between the two lakes using the roughly parallel Gosener Graben."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D1%83%D1%80%D0%BE%D0%B2%D0%BB%D1%8F%D0%BD%D0%BA%D0%B0_(%D1%80%D0%B5%D0%BA%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/%D0%9D%D0%B0_%D0%BC%D0%BE%D1%81%D1%82%D1%83_%D1%87%D0%B5%D1%80%D0%B5%D0%B7_%D0%91%D1%83%D1%80%D0%BE%D0%B2%D0%BB%D1%8F%D0%BD%D0%BA%D1%83.jpg","page_title":"Буровлянка (река)","context_page_description":"Буровлянка — река в Рамонском районе Воронежской области России. Устье реки находится на 1461 км по левому берегу реки Дон. Длина реки составляет 18 км, площадь водосборного бассейна 134 км².\\nРека берёт начало в балках к северо-востоку от посёлка Комсомольский, на большей части русла пересыхающая. На реке расположены населённые пункты Буровлянка и Кулешовка."},{"page_url":"https://en.wikipedia.org/wiki/Era_Station","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Kyushu_Railway_-_Era_Station_-_01.JPG","page_title":"Era Station","context_page_description":"Era Station is a railway station on the Kyūdai Main Line in Kokonoe, Ōita Prefecture, Japan."},{"page_url":"https://fr.wikipedia.org/wiki/Contay","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Contay_-_L%27ancienne_route_nationale_-_IMG_20190809_160656.jpg","page_title":"Contay","context_page_description":"Contay est une commune française située dans le département de la Somme, en région Hauts-de-France."},{"page_url":"https://en.wikipedia.org/wiki/2009_Commonwealth_Bank_Tournament_of_Champions","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Vera_Dushevina_2009.jpg","page_title":"2009 Commonwealth Bank Tournament of Champions","context_page_description":"The 2009 Commonwealth Bank Tournament of Champions was a singles-only tennis tournament that was played on indoor hard courts. It was the first edition of the Commonwealth Bank Tournament of Champions and was part of the 2009 WTA Tour. It was held at the Bali International Convention Centre in Bali, Indonesia, from November 4 through November 8, 2009."},{"page_url":"https://en.wikipedia.org/wiki/Whale","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Delfinekko.gif","page_title":"Whale","context_page_description":"Whales are a widely distributed and diverse group of fully aquatic placental marine mammals. They are an informal grouping within the infraorder Cetacea, usually excluding dolphins and porpoises. Whales, dolphins and porpoises belong to the order Cetartiodactyla, which consists of even-toed ungulates. Their closest living relatives are the hippopotamuses, having diverged about 40 million years ago. The two parvorders of whales, baleen whales and toothed whales, are thought to have split apart around 34 million years ago. Whales consist of eight extant families: Balaenopteridae, Balaenidae, Cetotheriidae, Eschrichtiidae, Monodontidae, Physeteridae, Kogiidae, and Ziphiidae.\\nWhales are fully aquatic, open ocean creatures, and feed, mate, give birth, suckle and raise their young at sea. Whales range in size from the 2.6 metres and 135 kilograms dwarf sperm whale to the 29.9 metres and 190 metric tons blue whale, which is the largest known creature that has ever lived. The sperm whale is the largest toothed predator on earth. Several species exhibit sexual dimorphism, in that the females are larger than males."},{"page_url":"https://en.wikipedia.org/wiki/Raynham_Center,_Massachusetts","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Johnson_Pond%2C_Raynham_Center_MA.jpg","page_title":"Raynham Center, Massachusetts","context_page_description":"Raynham Center is a census-designated place in the town of Raynham in Bristol County, Massachusetts, United States. The population was 4,100 at the 2010 census."},{"page_url":"https://no.wikipedia.org/wiki/Tylldalen_kirke","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ad/Tylldal_Kirke.jpg","page_title":"Tylldalen kirke","context_page_description":"Tylldalen kirke er en langkirke fra 1736 i Tynset kommune, Innlandet fylke.\\nByggverket er i tømmer og har 240 plasser. Bygget ble reist av Karl Brandvold og sønnen Arne. De to bygget også de nå nedrevne kirkene på Tynset og i Alvdal. Tømmerveggene fikk grov bordkleding utvendig i 1756. Innvendig er tømmervegger og himling fullstendig dekket med malte dekorasjoner. Blant annet rosemaling, Christian 6.s monogram og lidelseshistorien fremstilt av Jens Rasmussen Sandberg. Dekorasjonene var lenge tildekket, men bel avdekket av Domenico Erdmann og Ola Seter. Alvdal og Kvikne kirker har lignende dekorasjoner og trolig står samme kunstner bak. Altertavlene er barokk og tradisjonell for den tiden. Et opprinnelig korskille ble fjernet i 1785."},{"page_url":"https://fi.wikipedia.org/wiki/Utica_(New_York)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/UticaNY_1855.jpg","page_title":"Utica (New York)","context_page_description":"Utica on kaupunki New Yorkin osavaltiossa Yhdysvalloissa. Utica on Oneidan piirikunnan pääkaupunki. Utican arvioitu asukasluku vuonna 2013 oli 61 808.\\nUtica ja sen naapurikaupunki Rome muodostavat yhdessä Utica–Rome-metropolialueen, jonka asukasluku on noin 300 000."},{"page_url":"https://en.wikipedia.org/wiki/Pasped_Skylark","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/PaspedW1Skylark.jpg","page_title":"Pasped Skylark","context_page_description":"The Pasped W-1 Skylark is a 1930s American two-seat single-engined cabin monoplane designed and built by the Pasped Aircraft Company of Glendale, California."},{"page_url":"https://pl.wikipedia.org/wiki/Devan_Dubnyk","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Devan_Dubnyk_-_Switzerland_vs._Canada%2C_29th_April_2012-3.jpg","page_title":"Devan Dubnyk","context_page_description":"Devan Dubnyk – kanadyjski hokeista pochodzenia ukraińskiego, reprezentant Kanady."},{"page_url":"https://en.wikipedia.org/wiki/Dabo,_Moselle","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Dabo_et_Rocher_de_Dabo.jpg","page_title":"Dabo, Moselle","context_page_description":"Dabo is a commune in the Moselle department in Grand Est in north-eastern France."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AA%D8%B4%D8%A7%D8%B1%D9%84%D8%B2_%D8%A5%D9%86%D8%BA%D8%B1%D8%A7%D9%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Charles_Ingram_1.jpg","page_title":"تشارلز إنغرام","context_page_description":"تشارلز إنغرام ‏ هو رائد سابق في الجيش البريطاني اُشتهر بسبب إدانته في الغش في برنامج من سيربح المليون في نسخته الأصلية في عام 2001، وذلك بالاتفاق مع زوجته وشخصٍ آخر عن طريق الكحكحة عندما يقوم بذكر الجواب الصحيح، يُذكر بأن تشارلز استطاع الفوز بالجائزة الكبرى والإجابة على خمسة عشر سؤالاً."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Kempen","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Kempen_Denkmal-Nr._229%2C_Donkring_47_%282299%29.jpg","page_title":"Liste der Baudenkmäler in Kempen","context_page_description":"Die Liste der Baudenkmäler in Kempen enthält die denkmalgeschützten Bauwerke auf dem Gebiet der Stadt Kempen im Kreis Viersen in Nordrhein-Westfalen. Diese Baudenkmäler sind in der Denkmalliste der Stadt Kempen eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen."},{"page_url":"https://ca.wikipedia.org/wiki/Oristany","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Eleanor_statue_Oristano.jpg","page_title":"Oristany","context_page_description":"Oristany és un municipi italià, situat a la regió de Sardenya i capital de l'homònima província d'Oristany. L'any 2006 tenia 32.932 habitants. Es troba a la regió de Campidano di Oristano. Conté les fraccions de Donigala, Massama, Marina di Torre Grande, Nuraxinieddu i Silì, i limita amb els municipis de Baratili San Pietro, Cabras, Nurachi, Palmas Arborea, Santa Giusta, Siamaggiore, Siamanna, Simaxis, Solarussa, Villaurbana i Zeddiani."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%97%E3%83%AA%E3%83%A0%E3%82%B9%E3%83%BB%E3%83%95%E3%83%A5%E3%83%BC%E3%83%AA%E3%83%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Plymouth_Sport_Fury_Convertible_%28Byward_Auto_Classic%29.jpg","page_title":"プリムス・フューリー","context_page_description":"フューリーは、1956年から1968年までクライスラー社のプリムス部門によって販売された自動車である。\\n当時のプリムスのフラッグシップモデルであった。"},{"page_url":"https://zh.wikipedia.org/wiki/%E9%AA%A8%E9%AA%BC%E5%8D%9A%E7%89%A9%E9%A6%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Museum_of_osteology_ungulate_exhibits.JPG","page_title":"骨骼博物馆","context_page_description":"位于美国俄克拉荷马州，俄克拉荷马市，是一个私人博物馆，专门研究骨骼和骨骼。 这个博物馆展示了超过350具来自世界各地动物物种的骨骼。 另有7000件标本作为收藏的一部分，但没有展出，这是世界上私人拥有的最大的骨骼标本收藏。"},{"page_url":"https://sw.wikipedia.org/wiki/Yesu_kutolewa_hekaluni","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/dc/Virgendecandelariacamarin02.jpg","page_title":"Yesu kutolewa hekaluni","context_page_description":"Yesu kutolewa hekaluni ni tukio la utoto wake, siku arubaini baada ya kuzaliwa."},{"page_url":"https://pl.wikipedia.org/wiki/Bitwa_pod_Hittin","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e0/Hittin.jpg","page_title":"Bitwa pod Hittin","context_page_description":"Bitwa pod Hittin – bitwa lądowa, która miała miejsce 4 lipca 1187 roku, pomiędzy wojskami Królestwa Jerozolimskiego pod wodzą króla Gwidona z Lusignan a wojskami muzułmańskimi sułtana Saladyna.\\nArmia muzułmańska pod wodzą Saladyna zabiła albo pojmała większość sił krzyżowców, przesądzając wynik wojny. Głównym rezultatem bitwy było to, że siły muzułmanów stały się najsilniejszym zgrupowaniem wojsk w Ziemi Świętej, odbiły Jerozolimę i dużo innych ziem łacinników."},{"page_url":"https://sl.wikipedia.org/wiki/Cerkev_sv._Mihaela_na_Blokah","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Fara-farovz.jpg","page_title":"Cerkev sv. Mihaela na Blokah","context_page_description":"Cerkev sv. Mihaela na Blokah je glavna cerkev župnije Bloke. Nahaja se pri Fari na Blokah. Župnijo so ustanovili oglejski patriarhi, ki so imeli od 11. stoletja v lasti Kras z Vipavo, Postojno, Cerknico, Lož in zemljo do Reke."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D1%80%D1%85%D1%96%D1%82%D0%B5%D0%BA%D1%82%D1%83%D1%80%D0%B0_%D0%A1%D1%82%D0%B0%D1%80%D0%BE%D0%B4%D0%B0%D0%B2%D0%BD%D1%8C%D0%BE%D0%B3%D0%BE_%D0%84%D0%B3%D0%B8%D0%BF%D1%82%D1%83","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7a/Luxor07%28js%29.jpg","page_title":"Архітектура Стародавнього Єгипту","context_page_description":"У той час, коли інші народи знаходилися ще на стадії доісторичного розвитку, єгиптяни володіли вже високим і розвиненим мистецтвом. Історія архітектури починається в Єгипті. Точні археологічні дати встановити неможливо: при теперішньому стані наших знань, доводиться класифікувати пам'ятники в порядку проходження сучасних їм династій.\\nТаким чином, архітектуру Стародавнього Єгипту можна розділити на 5 періодів: архітектура Раннього царства, архітектура Стародавнього Царства, архітектура Середнього царства, архітектура Нового царства, архітектура Пізнього царства."},{"page_url":"https://pt.wikipedia.org/wiki/Eirik_Bakke","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Eirik_Bakke%2C_2016.jpg","page_title":"Eirik Bakke","context_page_description":"Eirik Bakke é um treinador e ex-futebolista norueguês, que atuava como meia."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%BA%D8%B1%D9%8A%D8%BA_%D9%87%D8%A7%D8%B1%D8%A8%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Greg_Harper_official_photo.jpg","page_title":"غريغ هاربر","context_page_description":"غريغ هاربر ‏ هو محامي ومدع وسياسي أمريكي، ولد في 1 يونيو 1956 في الولايات المتحدة. حزبياً، نشط في الحزب الجمهوري."},{"page_url":"https://en.wikipedia.org/wiki/Wilhelm_D%C3%B6rpfeld","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Treasure_of_Atreus.jpg","page_title":"Wilhelm Dörpfeld","context_page_description":"Wilhelm Dörpfeld was a German architect and archaeologist, a pioneer of stratigraphic excavation and precise graphical documentation of archaeological projects. He is famous for his work on Bronze Age sites around the Mediterranean, such as Tiryns and Hisarlik, where he continued Heinrich Schliemann's excavations. Like Schliemann, Dörpfeld was an advocate of the historical reality of places mentioned in the works of Homer. While the details of his claims regarding locations mentioned in Homer's writings are not considered accurate by later archaeologists, his fundamental idea that they correspond to real places is accepted. Thus, his work greatly contributed to not only scientific techniques and study of these historically significant sites but also a renewed public interest in the culture and the mythology of Ancient Greece."},{"page_url":"https://en.wikipedia.org/wiki/Aviation_in_Moldova","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Chisinau_Airport_2.JPG","page_title":"Aviation in Moldova","context_page_description":"Aviation has been a part of Moldovan society since the early 20th century."},{"page_url":"https://ca.wikipedia.org/wiki/Verdun_(Aude)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Verdun-en-Lauragais_-_Mairie.jpg","page_title":"Verdun (Aude)","context_page_description":"Verdun de Lauragués és un municipi del departament de l'Aude a la regió francesa d'Occitània."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B3%D8%AA%D8%B1%D8%A7%DA%A9_%D8%B3%D8%AA%D8%B1%D8%A7%DA%A9%DB%8C%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Sedrak_.jpg","page_title":"ستراک ستراکیان","context_page_description":"ستراک ستراکیان روان‌شناس استاد دانشگاه و دکتری علوم روان‌شناسی اهل ارمنستان است."},{"page_url":"https://de.wikipedia.org/wiki/Klein_Flottbek","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/37/HamburgSpringDerby.jpg","page_title":"Klein Flottbek","context_page_description":"Klein Flottbek ist eine Gemarkung am Nordufer der Unterelbe im Bezirk Altona der Freien und Hansestadt Hamburg. Es ist ebenfalls der Name des hier gelegenen S-Bahnhofs an der Altona-Blankeneser Eisenbahn.\\nDer Name der Gemarkung leitet sich vermutlich vom Bach Kleine Flottbek ab, der im Gebiet von Klein Flottbek im Westerpark und im Wesselhoeftpark liegt und in die Elbe mündet. Infrage kommt aber auch die bekanntere Flottbek, die durch den im östlichen Klein Flottbek gelegenen Jenischpark und das Naturschutzgebiet Flottbektal zur Elbe fließt. Das von Senator Jenisch errichtete Jenisch-Haus steht Besuchern heute als Museum für hanseatische Wohnkultur offen. Unweit hiervon befindet sich das Kunstmuseum Ernst-Barlach-Haus.\\nDer westliche Teil von Klein Flottbek umfasst unter anderem den Wesselhoeftpark sowie den bis 2003 wiederhergestellten Westerpark, dessen Teil der Derby-Park ist. Wie der Jenischpark geht der Westerpark auf das Kanzleigut von Baron Caspar Voght als Teil seiner „Ornamented Farm“ zurück.\\nDas Klein Flottbeker Elbufer ist durch den Elbuferweg bei Teufelsbrück ein beliebtes Ziel für Spaziergänger. Von hier aus besteht Nahverkehrsanbindung durch Busse und Fähren."},{"page_url":"https://pt.wikipedia.org/wiki/Mosteiro_do_Escorial","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/EscorialBiblioteca.jpg","page_title":"Mosteiro do Escorial","context_page_description":"O Mosteiro do Escorial é um grande e complexo edifício localizado em San Lorenzo de El Escorial, município situado 45 km a noroeste de Madrid, na comunidade autónoma homónima, Espanha.\\nO nome de El Escorial deve-se a uns antigos depósitos de escória procedentes de uma ferraria da zona, dos quais tomou topónimo a aldeia situada nas proximidades do lugar onde se construiu este mosteiro-palácio e que na actualidade é o município de El Escorial, distinto do de San Lorenzo de El Escorial, surgido posteriormente junto ao monumento."},{"page_url":"https://fr.wikipedia.org/wiki/Lion_des_cavernes_d%27Eurasie","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/MUT127060.jpg","page_title":"Lion des cavernes d'Eurasie","context_page_description":"Le lion des cavernes eurasiatique est une espèce éteinte de grands félins, apparentée au lion, qui peuplait l’Eurasie durant la seconde moitié du Pléistocène.\\nSon extinction pourrait avoir été provoquée par le réchauffement rapide du climat lors de l'interstade du « Groenland 1 », intervenu il y a environ 14 700 ans avant J.C., entraînant la disparition de ses proies. Les datations carbone obtenues en spectrométrie de masse par accélérateur datent cette extinction en Eurasie entre environ 14 500 et 14 000 ans avant J.C., et en Amérique du Nord, d'environ 1 000 ans plus tard.\\nIl a été décrit par le paléontologue allemand Georg August Goldfuss en 1810 sous le nom scientifique Felis spelaea.\\nL'analyse phylogénétique d'os fossiles montre qu'il était nettement distinct et génétiquement isolé du lion moderne."},{"page_url":"https://ca.wikipedia.org/wiki/Castell_de_Tatz%C3%B3_d%27Avall","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Argelers_de_la_Marenda._Tatz%C3%B3_d%27Avall_20.jpg","page_title":"Castell de Tatzó d'Avall","context_page_description":"El Castell de Tatzó d'Avall, és una fortificació situada a un quilòmetre i mig al nord-oest de la població nord-catalana d'Argelers de la Marenda, terme comunal al qual pertany. El castell és l'antic poble en forma de cellera, convertit modernament en centre d'una urbanització que s'ha anat formant en el seu entorn."},{"page_url":"https://simple.wikipedia.org/wiki/Argentavis","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Argentavis_magnificens.JPG","page_title":"Argentavis","context_page_description":"Argentavis magnificens is one of the two largest flying birds ever discovered. This bird, sometimes called the Giant Teratorn, is an extinct species known from three sites from the late Miocene of central and northwestern Argentina, where a good sample of fossils have been obtained.\\nCurrently accepted estimates:\\nWingspan: approximately 8 m\\nWing area: 8.11 m²\\nWing loading: 84.6 N/m²\\nBody Length: 1.26 m\\nHeight: 1.7–2 m\\nMass: 70–72 kg"},{"page_url":"https://de.wikipedia.org/wiki/Regierungssitz","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Die_Sportschule_Flensburg-M%C3%BCrwik_%28Mai_2014%29%2C_Bild_004.JPG","page_title":"Regierungssitz","context_page_description":"Der Regierungssitz ist der Ort eines Staates, in dem die Regierung ansässig ist. Dies ist in der Regel die Hauptstadt des Landes, weswegen man normalerweise nur dann ausdrücklich vom „Regierungssitz“ spricht, wenn dies nicht der Fall ist."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%BC%D5%AB%D5%BF%D5%BE%D5%A1%D5%B5%D5%AB_%D6%84%D5%A1%D5%B2%D5%A1%D6%84%D5%B6%D5%A5%D6%80%D5%AB_%D6%81%D5%A1%D5%B6%D5%AF","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/44/Pasvalys2009.JPG","page_title":"Լիտվայի քաղաքների ցանկ","context_page_description":"Լիտվայում առանձնացվում են երեք տիպի բնակավայրեր՝ քաղաքներ, փոքր քաղաքներ ու գյուղեր ։\\nԲնակավայրին քաղաքի կարգավիճակ է տալիս Լիտվայի Հանրապետության Սեյմը։ Լիտվայի վիճակագրական դեպարտամենտի տվյալներով՝ Լիտվայում կան 103 քաղաքներ ։"},{"page_url":"https://de.wikipedia.org/wiki/Dekanat_Cottbus-Neuzelle","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Beeskow_Heilig_Geist_01.jpg","page_title":"Dekanat Cottbus-Neuzelle","context_page_description":"Das Dekanat Cottbus-Neuzelle ist eines der drei Dekanate im römisch-katholischen Bistum Görlitz. Es liegt auf dem Gebiet des Landes Brandenburg und umfasst die Pfarreien und Pfarrkuratien Beeskow, Cottbus, Eisenhüttenstadt, Guben, Neuzelle und Spremberg."},{"page_url":"https://de.wikipedia.org/wiki/Rieux-Volvestre","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Rieux-Volvestre_pont_d%27Auriac_%282%29.jpg","page_title":"Rieux-Volvestre","context_page_description":"Rieux-Volvestre ist eine französische Gemeinde des Départements Haute-Garonne in der Region Okzitanien und ist administrativ dem Arrondissement Muret zugeteilt. Sie war bis zu dessen Auflösung 2015 der Hauptort des gleichnamigen Kantons Rieux-Volvestre, seither gehört sie zum Kanton Auterive. Bis zum 22. Juni 2009 hieß die Gemeinde offiziell Rieux."},{"page_url":"https://pt.wikipedia.org/wiki/Le%C3%A3o_de_Nova_Igua%C3%A7u","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/2013-02-12_-_Le%C3%A3o_de_Nova_Igua%C3%A7u_%284%29_-_comiss%C3%A3o_de_frente.JPG","page_title":"Leão de Nova Iguaçu","context_page_description":"Grêmio Recreativo Escola de Samba Leão de Nova Iguaçu é uma escola de samba de Nova Iguaçu, que participa do carnaval da cidade do Rio de Janeiro desde 1986, quando resolveu transformar-se em escola de samba.\\nJá esteve sediada no Centro do município e atualmente está no bairro de Santa Eugênia. Seu padroeiro é São Jerônimo."},{"page_url":"https://en.wikipedia.org/wiki/Butterwood_Methodist_Church_and_Butterwood_Cemetery","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Butterwood_Chapel_oblique_view_with_flagpole.jpg","page_title":"Butterwood Methodist Church and Butterwood Cemetery","context_page_description":"Butterwood Methodist Church and Butterwood Cemetery is a historic Methodist church and cemetery located at Blackstone, Nottoway County, Virginia. It was built in 1866–1867, and is a one-story, frame building in the Carpenter Gothic style. It measures approximately 34 feet wide and 45 feet long, and features board and batten siding and concave gingerbread trim. Surrounding the church are approximately nine additional acres to which about 1,000 graves were moved from cemeteries that had to be abandoned when the 48,000-acre Camp Pickett Military Reservation was created at the beginning of World War II.\\nIt was listed on the National Register of Historic Places in 2003."},{"page_url":"https://en.wikipedia.org/wiki/Genetic_engineering","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Breeding_transgenesis_cisgenesis.svg","page_title":"Genetic engineering","context_page_description":"Genetic engineering, also called genetic modification or genetic manipulation, is the direct manipulation of an organism's genes using biotechnology. It is a set of technologies used to change the genetic makeup of cells, including the transfer of genes within and across species boundaries to produce improved or novel organisms. New DNA is obtained by either isolating and copying the genetic material of interest using recombinant DNA methods or by artificially synthesising the DNA. A construct is usually created and used to insert this DNA into the host organism. The first recombinant DNA molecule was made by Paul Berg in 1972 by combining DNA from the monkey virus SV40 with the lambda virus. As well as inserting genes, the process can be used to remove, or \\"knock out\\", genes. The new DNA can be inserted randomly, or targeted to a specific part of the genome.\\nAn organism that is generated through genetic engineering is considered to be genetically modified and the resulting entity is a genetically modified organism. The first GMO was a bacterium generated by Herbert Boyer and Stanley Cohen in 1973."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Ministers_of_Finance_of_the_Netherlands","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Graaf_Schimmelpenninck_van_Nijenhuis.jpeg","page_title":"List of Ministers of Finance of the Netherlands","context_page_description":"The Minister of Finance is the head of the Ministry of Finance and a member of the Cabinet of the Netherlands. The current Minister of Finance is Wopke Hoekstra of the Christian Democratic Appeal, who has been in office since 26 October 2017."},{"page_url":"https://en.wikipedia.org/wiki/Pennsylvania%27s_12th_congressional_district","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/George_Washington_Woodward_-_Brady-Handy.jpg","page_title":"Pennsylvania's 12th congressional district","context_page_description":"Pennsylvania's 12th congressional district is located in the north central and northeastern parts of Pennsylvania, including the Northern Tier region, parts of the Susquehanna Valley, and part of Happy Valley including State College. It has been represented by Fred Keller since May 21, 2019, who won a special election to fill the vacancy caused by the resignation of former representative Tom Marino.\\nPrior to 2018, the 12th district was located in southwestern Pennsylvania, and included all of Beaver County, and parts of Allegheny, Cambria, Lawrence, Somerset, and Westmoreland Counties. The Supreme Court of Pennsylvania redrew this and other state congressional districts in February 2018 after ruling the previous map unconstitutional due to partisan gerrymandering. The new 12th district covers much of the old 10th district. The old 12th district was redrawn to an area north and west of Pittsburgh and renamed the 17th district, for the 2018 elections and representation thereafter.\\nBefore the 2011 round of redistricting, the 12th District was widely considered to be gerrymandered by the Republican-controlled state legislature as a heavily Democratic district."},{"page_url":"https://de.wikipedia.org/wiki/K%C3%B6nigsmantel_Wilhelms_I._der_Niederlande","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Queen_Wilhelmina%2C_by_Th%C3%A9r%C3%A8se_Schwartze.jpg","page_title":"Königsmantel Wilhelms I. der Niederlande","context_page_description":"Der vom derzeitigen Oberhaupt der Niederlande Willem-Alexander bei seiner Amtseinführung getragene Ornat geht auf den Königsmantel Wilhelms I. der Niederlande zurück. Reste dieses Königsmantels befinden sich, sechs Generationen später, noch an der heutigen Robe. In der ersten Ausführung wurde er von Fürst Wilhelm I. im Jahr 1815 bei seiner Ernennung zum König getragen.\\nDie Fürsterhebung und die Inthronisation zum König Wilhelms I., in den Niederlanden jeweils „Huldigung“ genannt, legten die Basis für die folgenden Herrschergenerationen des Hauses Oranien, des regierenden Königshauses der Niederlande."},{"page_url":"https://de.wikipedia.org/wiki/Favoriten","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Wien_und_Wolken_%28658516636%29_%28cropped_Favoriten%29.jpg","page_title":"Favoriten","context_page_description":"Favoriten ist der 10. Wiener Gemeindebezirk. Er liegt südlich der inneren Bezirke, reicht bis an die südliche Stadtgrenze und ist mit rund 200.000 Einwohnern der bevölkerungsreichste der Stadt. Hier wohnen etwa 10 Prozent aller Einwohner Wiens."},{"page_url":"https://pl.wikipedia.org/wiki/Michai%C5%82_Cysielski","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Tsiselsky-01.jpg","page_title":"Michaił Cysielski","context_page_description":"Michaił Pietrowicz Cysielski – radziecki lotnik wojskowy, Bohater Związku Radzieckiego."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D1%83%D0%B6_%D0%B3%D0%B0%D0%B4%D1%8E%D0%BA%D0%BE%D0%B2%D0%B8%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Natrix_maura.jpg","page_title":"Вуж гадюковий","context_page_description":"Вуж гадюковий — неотруйна змія з роду Вуж родини Вужеві."},{"page_url":"https://fr.wikipedia.org/wiki/Garde_imp%C3%A9riale_(Premier_Empire)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Napoleon_Guard_Chasseurs_by_Bellange.jpg","page_title":"Garde impériale (Premier Empire)","context_page_description":"La Garde impériale était un corps d'armée d'élite du Premier Empire, constitué de soldats vétérans et destiné à protéger fidèlement l'Empereur des Français et à servir de réserve d'élite à la Grande Armée lors des batailles. Elle fut créée par l'empereur Napoléon Iᵉʳ le 18 mai 1804 à partir de l'ancienne Garde des consuls, simple unité assurant la protection du gouvernement à l'intérieur ainsi que la sécurité des consuls de la République.\\nDans les faits, la Garde impériale ne servit que sous le commandement direct de Napoléon et constitua la force sur laquelle ce dernier pouvait toujours s'appuyer en toute circonstance. La Garde était composée des soldats les plus valeureux qui avaient pour la plupart participé aux guerres de la Révolution et qui étaient totalement dévoués à la personne de l'Empereur. Son effectif ne cessa d'augmenter : de 9 798 hommes en 1804, elle atteignit celui d'une armée, 112 482 hommes en 1814, placée sous les ordres directs de l'Empereur. Elle fut finalement divisée en Jeune Garde, Moyenne Garde et Vieille Garde, chacune possédant leurs unités de cavalerie, d'artillerie et d'infanterie."},{"page_url":"https://de.wikipedia.org/wiki/Rathaus_Schneeberg","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3d/Schneeberg_Rathaus_Kartusche_110430_KHA_%2829%29.jpg","page_title":"Rathaus Schneeberg","context_page_description":"Das Rathaus der Stadt Schneeberg im sächsischen Erzgebirgskreis wurde 1852 fertiggestellt und danach mehrfach umgestaltet. Das Gebäude ist der Sitz der Stadtverwaltung und der dritte Rathausbau in der Geschichte der Stadt. Seit 2006 befindet sich ein Porzellan-Glockenspiel in seinem Turm."},{"page_url":"https://ms.wikipedia.org/wiki/Astronomy_Picture_of_the_Day","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Opportunity%27s_shadow_sol_180_%28PIA06739%29.jpg","page_title":"Astronomy Picture of the Day","context_page_description":"Astronomy Picture of the Day ialah laman web yang disediakan oleh NASA dan Universiti Teknologi Michigan. Menurut laman web itu, \\"Setiap hari gambar atau foto alam semesta kita yang berbeza ditampilkan, bersama dengan penjelasan ringkas yang ditulis oleh ahli astronomi profesional.\\" Foto tersebut tidak semestinya sesuai dengan kejadian cakerawala pada hari yang tepat ketika ia dipaparkan, dan gambar kadang-kadang diulang. Walau bagaimanapun, gambar dan keterangannya sering kali berkaitan dengan peristiwa semasa dalam astronomi dan penerokaan angkasa lepas. Teks ini mempunyai beberapa pautan ke lebih banyak gambar dan laman web untuk maklumat lebih lanjut. Gambar-gambar itu adalah gambar spektrum yang dapat dilihat, gambar yang diambil pada panjang gelombang yang tidak dapat dilihat dan dipaparkan dengan warna palsu, rakaman video, animasi, konsep artis, atau mikrograf yang berkaitan dengan ruang atau kosmologi. Gambar yang lalu disimpan dalam Arkib APOD, dengan gambar pertama muncul pada 16 Jun 1995. Inisiatif ini telah mendapat sokongan dari NASA, Yayasan Sains Kebangsaan, dan MTU."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%92%D1%8A%D0%B7%D0%B4%D1%83%D1%88%D0%BD%D0%B0_%D0%BE%D0%B1%D0%B2%D0%B8%D0%B2%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Mars_Science_Laboratory_Heat_Shield_PIA12117.jpg","page_title":"Въздушна обвивка","context_page_description":"Въздушната обвивка е тъврда топлинно защитна обвивка, която предпазва космическия апарат от налягането и триенето по време на навлизането в атмосферата, като го забавя и също може да го предпазва от отломки по време на космическия полет. Задния капак пренася оборудването на апарата, заедно с важни компоненти като парашута, ракетните двигатели, и извършва мониторинг на важната електроника като жиростабилизатора, който контролира ориентацията на задния капак при спускане с парашут.\\nВъздушните обвивки са ключов компонент в междупланетните космически мисии. Използвани са при програма Аполо до Луната през 60-те и 70-те години на 20 век, при програма Викинг до Марс през 1975 г., при Марс Патфайндър от 1997 г., при мисията на Финикс през 2007 г. и при Марс Сайънс Лаборътории през 2011 г."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A7%D0%B5%D1%80%D0%BD%D0%BE_%D0%B4%D1%80%D0%BE%D0%BD%D0%B3%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Black_Drongo_%28Dicrurus_macrocercus%29_IMG_7702_%281%29..JPG","page_title":"Черно дронго","context_page_description":"Черно дронго е вид птица от семейство Dicruridae. Видът е незастрашен от изчезване."},{"page_url":"https://en.wikipedia.org/wiki/Fanno_flow","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/19/Fanno1.PNG","page_title":"Fanno flow","context_page_description":"Fanno flow is the adiabatic flow through a constant area duct where the effect of friction is considered. Compressibility effects often come into consideration, although the Fanno flow model certainly also applies to incompressible flow. For this model, the duct area remains constant, the flow is assumed to be steady and one-dimensional, and no mass is added within the duct. The Fanno flow model is considered an irreversible process due to viscous effects. The viscous friction causes the flow properties to change along the duct. The frictional effect is modeled as a shear stress at the wall acting on the fluid with uniform properties over any cross section of the duct.\\nFor a flow with an upstream Mach number greater than 1.0 in a sufficiently long enough duct, deceleration occurs and the flow can become choked. On the other hand, for a flow with an upstream Mach number less than 1.0, acceleration occurs and the flow can become choked in a sufficiently long duct. It can be shown that for flow of calorically perfect gas the maximum entropy occurs at M = 1.0. Fanno flow is named after Gino Girolamo Fanno."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D0%B8%D0%BF%D0%BE%D0%B3%D1%80%D0%B0%D1%84%D1%81%D0%BA%D0%BE%D0%B5_%D0%B1%D1%80%D0%B0%D1%82%D1%81%D1%82%D0%B2%D0%BE_%D0%BF%D1%80%D0%B5%D0%BF%D0%BE%D0%B4%D0%BE%D0%B1%D0%BD%D0%BE%D0%B3%D0%BE_%D0%98%D0%BE%D0%B2%D0%B0_%D0%9F%D0%BE%D1%87%D0%B0%D0%B5%D0%B2%D1%81%D0%BA%D0%BE%D0%B3%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Kalendar1939_Grafika_Pyziov2.jpg","page_title":"Типографское братство преподобного Иова Почаевского","context_page_description":"«Типографское братство преподобного Иова Почаевского» — православное русскоязычное издательство религиозной и художественной литературы, периодики и богослужебных книг для диаспоры. Действовало при Монастыре преподобного Иова Почаевского в селе Ладомирова на Пряшевской Руси в Чехословакии с 1923 по 1944 годы. С 1946 года действует при Свято-Троицкой духовной семинарии в Джорданвилле, штат Нью-Йорк."},{"page_url":"https://fr.wikipedia.org/wiki/Coupe_d%27Allemagne_de_football","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3b/DFB-Pokal_2007_N%C3%BCrnberg.jpg","page_title":"Coupe d'Allemagne de football","context_page_description":"La Coupe d'Allemagne de football est une compétition allemande à élimination directe qui se tient entre 1935 et 1943 puis DFB-Pokal depuis 1953. La finale a lieu à Berlin, au Stade Olympique, depuis 1985.\\nLe tenant du titre est le Bayern Munich qui remporte la finale 2020 sur le score de 4-2 face au Bayer Leverkusen."},{"page_url":"https://et.wikipedia.org/wiki/Bracciano_j%C3%A4rv","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Bracciano-sabatini-region-NASA-1-.jpg","page_title":"Bracciano järv","context_page_description":"Bracciano järv on vulkaanilise tekkega järv Kesk-Itaalias Lazio maakonnas Rooma provintsi põhjaosas. Bracciano on pindalalt Itaalia kaheksas järv. Paari kilomeetri kaugusel idas asub samuti vulkaanilise tekkega Martignano järv.\\n164 meetri kõrgusel merepinnast asuva järve pindala on 57,5 km², rannajoone pikkus umbes 32 km, suurim sügavus 160 meetrit, valgala suurus 150 km².\\nBracciano kallastel asuvad Bracciano, Anguillara Sabazia, Trevignano Romano ja Rooma.\\nMõnesaja meetri kaugusel Anguillara Sabaziast läänes, La Marmettas, on veealuste arheoloogiliste uuringute käigus leitud 7,5 meetri sügavuselt neoliitikumi-aegne küla, mis oli asustatud vahemikus 5700 kuni 5200 e.m.a."},{"page_url":"https://en.wikipedia.org/wiki/Distinctive_unit_insignia","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/210th_FA_Gp_crest_official.jpg","page_title":"Distinctive unit insignia","context_page_description":"A distinctive unit insignia is a metallic heraldic badge or device worn by soldiers in the United States Army. The DUI design is derived from the coat of arms authorized for a unit. DUIs may also be called \\"distinctive insignia\\" or, imprecisely, a \\"crest\\" or a \\"unit crest\\" by soldiers or collectors. The U.S. Army Institute of Heraldry is responsible for the design, development and authorization of all DUIs."},{"page_url":"https://sv.wikipedia.org/wiki/Tartu_universitetsmuseum","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Morgensterni_raamatukogu_02.jpg","page_title":"Tartu universitetsmuseum","context_page_description":"Tartu universitetsmuseum ligger i en byggnad på Domberget i Tartu i Estland, som ursprungligen uppfördes 1804–1807 för Tartu universitetsbibliotek i ruinerna av Dorpats domkyrka, och som ritades av Johann Wilhelm Krause. Universitetsmuseet flyttade in i en ny byggnad 1987, varefter den tidigare biblioteksbyggnaden övertogs av universitetsmuseet.\\nMuseets föremålsinsamling började på 1960-talet på initiativ av kemisten Tullio Ilomets. Tartu universitets historiska museum etablerades 1976.\\nDen permanenta utställningen ger bland annat en överblick av Tartu universitets historia.\\nTartu domkyrkas torn och dess utsiktsplattformar är öppna för besökare mellan vår och höst."},{"page_url":"https://no.wikipedia.org/wiki/Dunkjempe","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/41/Jitrocel_prost%C5%99edn%C3%AD.jpg","page_title":"Dunkjempe","context_page_description":"Dunkjempe er en plante i kjempeslekten.\\nDen er en flerårig urt med en lang stilk der blomstene sitter i et aks i toppen. Bladene er samlet i en rosett ved marka, og er hele, ovale og med kort stilk. Både bladene og blomsterstilken er dekket av korte hår. Blomstene dufter og er hvite med lilla pollenknapper. Blomstringstiden er fra mai til juli. Den vokser på tørre enger og bakker, helst på kalkrik jord.\\nDunkjempe er utbredt i Europa og Sibir og spredte seg med europeerne til det nordøstlige Nord-Amerika. En egen underart, P. m. subsp. urvilleana forkommer på steppene i Øst-Europa og Sentral-Asia.\\nI Norge er dunkjempe bare vanlig på Østlandet, men den forekommer spredt helt nord til Finnmark."},{"page_url":"https://sv.wikipedia.org/wiki/Fraxinus_uhdei","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Starr_030405-0041_Fraxinus_uhdei.jpg","page_title":"Fraxinus uhdei","context_page_description":"Fraxinus uhdei är en syrenväxtart som först beskrevs av Theodor Wenzig, och fick sitt nu gällande namn av Alexander von Lingelsheim. Fraxinus uhdei ingår i släktet askar, och familjen syrenväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://fr.wikipedia.org/wiki/Hugo_Claus","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Hugo_Claus.jpg","page_title":"Hugo Claus","context_page_description":"Hugo Claus, né le 5 avril 1929 à Bruges et mort le 19 mars 2008 à Anvers, est un écrivain, poète, dramaturge, scénariste et réalisateur belge d'expression néerlandaise."},{"page_url":"https://de.wikipedia.org/wiki/Cyriakus-Schlacht","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Cyriakusschlacht_folio_2_0207r.jpg","page_title":"Cyriakus-Schlacht","context_page_description":"Die Cyriakus-Schlacht war eine kriegerische Auseinandersetzung zwischen dem Würzburger Domkapitel und den Herren von Henneberg am 8. August 1266. Die beiden Parteien waren wegen der Kandidaten für die Würzburger Bischofswahl zerstritten. Während die Schlacht ursprünglich als eine der größten des Mittelalters in Franken angesehen wurde, überwiegt heute die Meinung, dass es sich lediglich um einen kleinen Waffengang gehandelt hat."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D1%83%D0%BD%D0%B2%D0%B8%D0%BB%D0%BB_(%D0%90%D1%80%D0%BA%D0%B0%D0%BD%D0%B7%D0%B0%D1%81)","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ee/Main_Street_in_Booneville.jpg","page_title":"Бунвилл (Арканзас)","context_page_description":"Бунвилл — город, расположенный в округе Логан с населением в 4117 человек по статистическим данным переписи 2000 года. Является административным центром округа.\\nБунвилл находится в долине поймы реки Арканзас между горой Уошита и плато Озарк.\\nВ черте городе пересекаются две автомагистрали: AR 10 и AR 23."},{"page_url":"https://de.wikipedia.org/wiki/Samsun_(Provinz)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Samsun_districts.png","page_title":"Samsun (Provinz)","context_page_description":"Samsun ist eine Provinz der Türkei am Schwarzen Meer. Ihre Hauptstadt ist Samsun.\\nDie Provinz hat 1.295.927 Einwohner auf einer Fläche von 9.474 km². Sie grenzt im Westen an die Provinz Sinop, im Osten an Ordu und im Süden an Amasya, Tokat und Çorum.\\nDie Einwohnerdichte beträgt rund 137 Einwohner/km²."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%9C%E0%A7%8D%E0%A6%AF%E0%A6%BE%E0%A6%95%E0%A6%B8%E0%A6%A8_%E0%A6%B8%E0%A7%8D%E0%A6%9F%E0%A7%87%E0%A6%9F_%E0%A6%87%E0%A6%89%E0%A6%A8%E0%A6%BF%E0%A6%AD%E0%A6%BE%E0%A6%B0%E0%A7%8D%E0%A6%B8%E0%A6%BF%E0%A6%9F%E0%A6%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Jackson_State_University_logo.png","page_title":"জ্যাকসন স্টেট ইউনিভার্সিটি","context_page_description":"জ্যাকসন স্টেট ইউনিভার্সিটি একটি যুক্তরাষ্ট্রের মিসিসিপি রাজ্যের ঐতিহাসিকভাবে কালো বিশ্ববিদ্যালয়। এটি ১৮৭৭ সালে প্রতিষ্ঠিত হয়। ১৯৪০ সালে এটি রাষ্ট্র-সমর্থিত প্রতিষ্ঠান হয়ে ওঠে এবং এটি থরগুড মার্শাল কলেজ তহবিল এর সদস্য।"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A-152_%C2%AB%D0%9D%D0%B5%D1%80%D0%BF%D0%B0%C2%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/INS_Chakra_SSN_attribute_Ajai_Shukla.jpg","page_title":"К-152 «Нерпа»","context_page_description":"К-152 «Нерпа» — российская многоцелевая гвардейская большая атомная подводная лодка 971У «Щука-Б».\\n8 ноября 2008 года во время проведения испытаний в результате несанкционированного срабатывания системы пожаротушения на подводной лодке погибло 20 членов экипажа. 28 декабря 2009 года была введена в состав ВМФ России.\\n23 января 2012 года АПЛ 971У «Щука-Б» под именем «Chakra» передана в лизинг ВМС Индии."},{"page_url":"https://en.wikipedia.org/wiki/List_of_National_Historic_Landmarks_in_Washington,_D.C.","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/US_Naval_Observatory_%28Washington%2C_District_of_Columbia%29.jpg","page_title":"List of National Historic Landmarks in Washington, D.C.","context_page_description":"The District of Columbia, capital of the United States, is home to 74 National Historic Landmarks. The National Historic Landmark program is operated under the auspices of the National Park Service, and recognizes structures, districts, objects, and similar resources according to a list of criteria of national significance. The city's landmarks reflect its status as the national capital, including grand government buildings, homes of politicians, military facilities, and museums. The list also includes sites relating to support for the disabled, the Civil Rights Movement, pioneering urban infrastructure, and other historic themes.\\nNational Historic Landmarks are normally listed on the National Register of Historic Places. Washington is home to three specifically legislated exceptions to this rule: the White House, the United States Capitol, and the United States Supreme Court Building. All are designated landmarks, but are not on the National Register."},{"page_url":"https://af.wikipedia.org/wiki/Glasgow","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Scotland_%2817459540645%29.jpg","page_title":"Glasgow","context_page_description":"Glasgow is die grootste stad in Skotland en die derde mees bevolkte in die Verenigde Koninkryk, met 'n bevolking van 633 120. Sy bewoners word in Engels Glaswegians of kort Weegies genoem. Die stad is aan die Clyde-rivier in die Westelike Sentrale Laagland van Skotland geleë.\\nGlasgow het van 'n klein landelike nedersetting teen die Clyde tot een van die grootste seehawens in Groot-Brittanje ontwikkel. Die Middeleeuse biskopsetel, waar later, in die 15de eeu, die Universiteit van Glasgow gestig is, sou uiteindelik 'n beduidende sentrum van die 18de eeuse Skotse Verligting word. Vanaf die 18de eeu was Glasgow een van die belangrikste Britse seehawens vir die transatlantiese handel met Brits-Noord-Amerika en die Britse Wes-Indiese Eilande.\\nDie nywerheidsomwenteling het van Glasgow en die omliggende gebiede een van die wêreld se grootste sentrums van swaar nywerhede gemaak waar skeepsbou en mariene ingenieurswese gefloreer het. 'n Groot aantal innovatiewe en beroemde skepe is hier gebou. Gedurende die Victoriaanse en Edwardiaanse tydperk het Glasgow die trotse bynaam \\"Tweede Stad van die Britse Ryk\\" gedra."},{"page_url":"https://de.wikipedia.org/wiki/Stra%C5%A1ice","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Strasice_RO_CZ_CoA.jpg","page_title":"Strašice","context_page_description":"Strašice ist eine Gemeinde im Bezirk Rokycany im Pilsner Kreis in Tschechien. Sie liegt etwa 15 km östlich der Stadt Rokycany."},{"page_url":"https://lv.wikipedia.org/wiki/Valsts_aizsarg%C4%81jamie_kult%C5%ABras_pieminek%C4%BCi_Krimuldas_novad%C4%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Gav%C4%93%C5%86u_pilskalns%2C_Ragana_03.jpg","page_title":"Valsts aizsargājamie kultūras pieminekļi Krimuldas novadā","context_page_description":"Šajā lapā apkopoti valsts aizsargājamie kultūras pieminekļi Krimuldas novadā.\\nKultūras pieminekļu karte\\nŠis saraksts tiek veidots no Vikidatiem, to periodiski atjaunina bots."},{"page_url":"https://en.wikipedia.org/wiki/List_of_San_Francisco_Bay_Area_trains","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/GoldenStateModelRailroadMuseum_Interior1.JPG","page_title":"List of San Francisco Bay Area trains","context_page_description":"This is a list of trains and train museums in the San Francisco Bay Area of Northern California in the United States."},{"page_url":"https://ro.wikipedia.org/wiki/Biserica_Curelari","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Biserica_%E2%80%9EPogor%C3%A2rea_Sf._Duh%E2%80%9D_-_Curelari_26.JPG","page_title":"Biserica Curelari","context_page_description":"Biserica „Pogorârea Sfântului Duh” - Curelari este localizată în Iași, în cartierul Podul de Fier. Biserica este menționată în documente începând cu secolul al XVII-lea. Hramul bisericii este „Pogorârea Sfântului Duh”.\\nDupă numele său, se pare că enoriașii bisericii erau în marea lor majoritate membri ai breslei curelarilor, care locuiau pe valea pârâului Cacaina. Se mai închina la această biserică și breasla ciubotarilor conform unui act al Mitropolitului Veniamin din 1814.\\nAspectul actual al bisericii este și rezultatul mai multor renovări și adăugiri, din care se pot menționa cele din 1761 și 1875. Biserica a fost incendiată în 1822 din cauza ienicerilor.\\nLocașul funcționează astazi ca biserică afierosită asociației religioase „Oastea Domnului”, cu binecuvântarea Mitropoliei Moldovei și Bucovinei.\\nBiserica „Pogorârea Sfântului Duh” - Curelari din Iași a fost inclusă pe Lista monumentelor istorice din județul Iași din anul 2015, având codul de clasificare IS-II-m-B-03834."},{"page_url":"https://pl.wikipedia.org/wiki/Unihokej","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Djurg%C3%A5rden_IF_-_Tyres%C3%B6_Trollb%C3%A4cken_IBK.jpg","page_title":"Unihokej","context_page_description":"Unihokej – sport drużynowy z pięcioma zawodnikami i bramkarzem w każdej drużynie. Zawodnicy do gry używają poliwęglanowych kijów zakończonych kompozytową blendą oraz ażurowej plastikowej piłki. Celem jest zwycięstwo w meczu poprzez zdobycie większej liczby bramek niż rywal."},{"page_url":"https://en.wikipedia.org/wiki/York,_Nebraska","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/ce/York_County_Nebraska_Incorporated_and_Unincorporated_areas_York_Highlighted.svg","page_title":"York, Nebraska","context_page_description":"York is a city in, and the county seat of, York County, Nebraska, United States. As of the 2010 census, the city population was 7,766. It is the home of York College and the Nebraska Correctional Center for Women."},{"page_url":"https://arz.wikipedia.org/wiki/%DA%86%D9%88%D8%A8%D8%B3%D8%A7%D9%86%D8%AA_%D8%A8%D8%B1%D8%A7%D9%86%D8%AF%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Jobst_Brandt_2008.jpg","page_title":"چوبسانت براندت","context_page_description":"چوبسانت براندت كان لاعب سباق عجل من امريكا."},{"page_url":"https://nl.wikipedia.org/wiki/Irene_(orkaan,_2011)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Irene_2011_track.png","page_title":"Irene (orkaan, 2011)","context_page_description":"Irene is een tropische cycloon die vanaf 14 augustus 2011 over de Caraïben trok en naar de oostkust van de Verenigde Staten doorstootte tot de orkaan op 29 augustus volledig was afgezwakt.\\nDe avond van 20 augustus nam een groot gebied van lage luchtdruk een dusdanig vorm aan dat het werd erkend als tropische cycloon. Het trok over de Benedenwindse Eilanden op 21 augustus. Orkaan en stormwaarschuwingen zijn van kracht in Puerto Rico, Hispaniola, de Maagdeneilanden en andere Caribische eilanden in deze lijn. Op 22 augustus zwol Irene aan tot orkaankracht met windsnelheden tot 120 km/h en een luchtdruk van 987 mbar. Hiermee werd het de eerste orkaan van het seizoen. Op 24 augustus zwol Irene aan tot orkaan van categorie 3. Op Puerto Rico heeft Irene voor meer dan US$152 miljoen aan schade aangericht en de schattingen voor de totale schade loopt op tot US$500 miljoen.\\nDe burgemeester van New York Michael Bloomberg liet op vrijdag 26 augustus kwetsbare wijken ontruimen. Minstens 250.000 mensen verlieten hun huis, de eerste keer dat zo'n maatregel genomen wordt. Kwetsbare zones bevinden zich in Brooklyn, Queens, Staten Island en het zuiden van Manhattan."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%AF%94%E4%BD%9B%E5%88%A9%E5%AC%8C%E5%A6%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Kyle_Richards-2014.jpg","page_title":"比佛利嬌妻","context_page_description":"《比佛利娇妻》是一个美国真人实境秀系列节目，最早于2010年10月14日在美国精彩电视台开播，目前共有九季。本作是娇妻系列的第六个实境秀节目，以居住在比佛利山的其中几名妇女的家庭与个人生活为节目主题。\\n本节目在美国精彩电视台上定期播出，每集长度约在四十二分钟上下，且自开播以来经常调动播映时段，曾在星期一、星期二或星期四晚上的20:00、21:00或22:00播出。\\n本节目最新一季由凯尔·理查兹、丽莎·里纳、艾莉卡·吉拉迪、多莉·甘斯利、泰迪·麦伦坎普·艾瑞阿瓦、丹妮丝·理查兹和嘉丝莉·毕薇斯等人担纲主演。前几季的主演名单则还有泰勒·阿姆斯壮、卡蜜儿·葛拉默、艾德丽安·马路夫、金·理查兹、丽莎·凡德庞、布兰迪·格兰维尔、约兰达·哈蒂德、卡尔顿·杰比亚、乔伊丝·吉罗、艾琳·戴维森和凯瑟琳·爱德华兹等人。\\n本剧另有衍生实境秀《凡德庞店规》，该节目将本剧要角丽莎·凡德庞所经营的餐厅设为节目主题。"},{"page_url":"https://en.wikipedia.org/wiki/Beaulieu,_H%C3%A9rault","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Beaulieu_et_Restinclieres.jpg","page_title":"Beaulieu, Hérault","context_page_description":"Beaulieu is a commune in the Hérault department in the Occitanie region in southern France."},{"page_url":"https://de.wikipedia.org/wiki/Bahnhof_Ky%C5%8Dto","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/130609_Kyoto_Station_Kyoto_Japan03s3.jpg","page_title":"Bahnhof Kyōto","context_page_description":"Der Bahnhof Kyōto ist ein Großbahnhof in der japanischen Stadt Kyōto."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%9E%E1%83%A0%E1%83%9D%E1%83%99%E1%83%A3%E1%83%9E%E1%83%9A%E1%83%98%E1%83%94%E1%83%A1_%E1%83%97%E1%83%94%E1%83%9B%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Skup%C5%A1tina_Op%C5%A1tine_Prokuplje_06.jpg","page_title":"პროკუპლიეს თემი","context_page_description":"პროკუპლიეს თემი — თემი სერბეთში, შედის ტოპლიჩის ოლქში.\\nთემის მოსახლეობა შეადგენს 46 729 ადამიანს, მოსახლეობის სიმჭიდროვე შეადგენს 62 ადამ./კმ². თემის ფართობი — 759 კმ².\\nთემის ადმინისტრაციული ცენტრი — ქალაქი პროკუპლიე. პროკუპლიეს თემი შედგება 107 დასახლებული პუნქტისგან, მათი საშუალო ფართობია 7.1 კმ²."},{"page_url":"https://lv.wikipedia.org/wiki/Pl%C4%ABvurp%C5%ABce","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Schleiereule-Tyto_alba-World.png","page_title":"Plīvurpūce","context_page_description":"Plīvurpūce ir visbiežāk sastopamais pūčveidīgais putns un viens no visdaudzskaitlīgākajiem putniem pasaulē kopumā. Tā pieder plīvurpūču dzimtas plīvurpūču ģintij. To bieži sauc arī par parasto plīvurpūci, lai atšķirtu no citām daudzajām plīvurpūču sugām.\\nPlīvurpūce ir sastopama visos kontinentos, izņemot Antarktīdu. Tā mājo vai ir novērojama lielākajā daļā sauszemes, izņemot polāros un tuksneša reģionus. Izplatība Āzijā, salīdzinoši ar citiem kontinentiem, ir samērā ierobežota. Tā ir sastopama tikai Āzijas dienvidos: Tuvajos Austrumos, Indijā, Ķīnā, Indoķīnas pussalā un salās starp Āziju un Austrāliju. Eiropā plīvurpūces izplatība ziemeļos sasniedz Dāniju, daži pāri reizēm ligzdo arī Zviedrijas dienvidos. Izplatības austrumu robeža iesniedzas Lietuvā, Baltkrievijā un Ukrainā. Ārpus Eirāzijas plīvurpūce novērojama gandrīz visā Āfrikā, Ziemeļamerikā, Dienvidamerikā un Austrālijā."},{"page_url":"https://fr.wikipedia.org/wiki/Cres","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/33/Cres-Cres1.jpg","page_title":"Cres","context_page_description":"Cres est une île croate de la mer Adriatique, en Dalmatie. Elle est la deuxième plus grande des îles de Croatie juste derrière Krk et ses également 405,78 km². Il existe d'ailleurs chez les habitants de Cres et Krk une rivalité concernant la taille des deux îles à tel point que les sites des offices de tourisme respectifs mentionnent chacun que leur île est la plus grande."},{"page_url":"https://es.wikipedia.org/wiki/Kiatisuk_Senamuang","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Kiatisuk_Senamuang.jpg","page_title":"Kiatisuk Senamuang","context_page_description":"Kiatisuk Senamuang, también conocido como Zico, es un ex-futbolista y entrenador tailandés. Jugaba de delantero y su último club fue el Hoang Anh Gia Lai FC de la V-League. Actualmente es el director técnico del Bangkok F.C. de la Primera División de Tailandia.\\nSenamuang es el futbolista tailandés que más partidos ha jugado a nivel internacional con su selección, .​ En 1996 cuando jugaba en el Rajpracha FC marcó un total de 127 goles anotados en 71 partidos, consiguiendo así el récord de máximo goleador en un año natural."},{"page_url":"https://lt.wikipedia.org/wiki/Miranda_(palydovas)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/PIA18185_Miranda%27s_Icy_Face.jpg","page_title":"Miranda (palydovas)","context_page_description":"Miranda – mažiausias iš vidinių Urano palydovų. Ištirtas Voyager 2 ekspedicijos metu.\\nČia gausu įvairiausių geologinių darinių – kraterių, gūburių, labai aukštų ir stačių skardžių, slėnių, tektoninių lūžių, matomi keisčiausių formų dariniai, pavyzdžiui, tarytum plūgu išvagoti laukai. Kai kurie astronomai teigia, kad prieš daugelį metų Mirandą sutrupino kitas kūnas, o vėliau jos dalys vėl susijungė, sudarydamos dabartinį kraštovaizdį."},{"page_url":"https://sv.wikipedia.org/wiki/Juho_Kusti_Paasikivi","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Paasikivi_ja_Voroshilov.jpg","page_title":"Juho Kusti Paasikivi","context_page_description":"Juho Kusti Paasikivi, född 27 november 1870, död 14 december 1956, var Finlands president under åren 1946–1956. Hans företrädare var Gustaf Mannerheim och efterträdare Urho Kekkonen. Paasikivi var även statsminister tre gånger. Han var den president som inledde den finländska så kallade Paasikivi-Kekkonen-linjen, den realpolitiska utrikespolitiken som betonade goda relationer till Sovjetunionen. Han var far till Annikki Paasikivi."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8F%D5%B8%D5%BC%D5%A5%D5%B6%D5%BF%D5%A5_(%D6%84%D5%A1%D5%B2%D5%A1%D6%84)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Policia_Local_Torrent.PNG","page_title":"Տոռենտե (քաղաք)","context_page_description":"Տոռենտե, կատ.՝ Torrent), քաղաք և համայնք Իսպանիայում, մտնում է Վալենսիա մեջ, որն էլ իր հերթին մտնում է Վալենսիա ինքնավար համայնքի մեջ։ Համայնքը մտնում է Ուէրտա-Օստե շրջանի կազմի մեջ։ Տարածքը՝ 69,3 կմ²։ Բնակչությունը՝ 79843 ։ Վարչական կենտրոնից հեռավորությունը՝ 9 կմ։"},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Hanover_County,_Virginia","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Hanover_Little_River_UDC.jpg","page_title":"National Register of Historic Places listings in Hanover County, Virginia","context_page_description":"This is a list of the National Register of Historic Places listings in Hanover County, Virginia.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in Hanover County, Virginia, United States. The locations of National Register properties and districts for which the latitude and longitude coordinates are included below, may be seen in an online map.\\nThere are 43 properties and districts listed on the National Register in the county, including 3 National Historic Landmarks.\\nThis National Park Service list is complete through NPS recent listings posted August 7, 2020."},{"page_url":"https://es.wikipedia.org/wiki/Bubierca","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Escudo_de_Bubierca.svg","page_title":"Bubierca","context_page_description":"Bubierca es un municipio de España, en la provincia de Zaragoza, Comunidad Autónoma de Aragón. Tiene un área de 29,61 km² con una población de 66 habitantes y una densidad de 2,23 hab/km²."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%83%D8%B1%D9%88%D9%8A%D8%A9_%D8%A7%D9%84%D8%A3%D8%B1%D8%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/John_Gower_world_Vox_Clamantis_detail.jpg","page_title":"كروية الأرض","context_page_description":"يرجع تاريخ أول ذكر موثق لمفهوم الأرض الكروية إلى حوالي القرن الخامس قبل الميلاد، عندما ذكرها الفلاسفة اليونانيون القدماء. ولكنها ظلت أمرًا من أمور التخمين الفلسفي حتى القرن الثالث قبل الميلاد عندما أسس علم الفلك الهلنستي الشكل الكروي للأرض كنظرية فلسفية. تم قبول النموذج الهلنستي بصورة تدريجية في جميع أنحاء العالم القديم أثناء أواخر العصور القديمة والعصور الوسطى.\\nتم إنجاز وصف عملي للأرض عن طريق فرديناند ماجلان ورحلات الطواف التي قام بها خوان سيباستيان إكلانو.\\nحل مفهوم كروية الأرض محل المعتقدات القديمة بـ سطحية الأرض: في أساطير بلاد ما بين النهرين المبكرة، حيث تم تصوير العالم على أنه قرص مسطح يطوف في المحيط ومحاط بسماء كروية، ويشكل هذا المفهوم الافتراض الذي قامت عليه الخرائط العالمية الأولى مثل تلك الخاصة بـ أناكسيماندر وهيكاتيوس من ميليتس. أما التصورات الأخرى عن شكل الأرض، فتتضمن أنها عبارة عن زقورة أو جبل كوني يتكون من سبع طبقات، مشار إليها في الأفستا وكتابات الفرس القديمة أو العجلة أو القدر أو الطائرة ذات الأربعة أركان المشار إليها في رجفدا.\\nيرجع تاريخ إدراك شكل الأرض والذي يوصف بصورة أكبر دقة على أنها مفلطحة إلى القرن الثامن عشر.\\nفي أوائل القرن التاسع عشر، تم تحديد تسطح إهليليجية الأرض على أن تكون من 1/300."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%AF%BC%EA%BC%AC%EB%A6%AC%EA%B3%BC%EC%9D%BC%EB%B0%95%EC%A5%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Tailess_Fruit_Bat_area.png","page_title":"민꼬리과일박쥐","context_page_description":"민꼬리과일박쥐는 큰박쥐과에 속하는 박쥐의 일종이다."},{"page_url":"https://fr.wikipedia.org/wiki/Grand_Prix_automobile_des_Pays-Bas_1955","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Stirling_Moss_Zandvoort_1955.jpg","page_title":"Grand Prix automobile des Pays-Bas 1955","context_page_description":"Le Grand Prix des Pays-Bas 1955, disputé sur le circuit de Zandvoort le 19 juin 1955, est la quarante-sixième épreuve du championnat du monde de Formule 1 courue depuis 1950 et la cinquième manche du championnat 1955."},{"page_url":"https://br.wikipedia.org/wiki/Cabana_de_Berganti%C3%B1os","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Situacion_Cabana_de_Berganti%C3%B1os.PNG","page_title":"Cabana de Bergantiños","context_page_description":"Cabana de Bergantiños zo ur gumun eus arvor Galiza, e proviñs A Coruña."},{"page_url":"https://sk.wikipedia.org/wiki/Quiberon","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/53/Map_commune_FR_insee_code_56186.png","page_title":"Quiberon","context_page_description":"Quiberon je francúzska obec, ktorá sa nachádza v departemente Morbihan, v regióne Bretónsko."},{"page_url":"https://en.wikipedia.org/wiki/Asz%C3%B3d_District","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Asz%C3%B3d.jpg","page_title":"Aszód District","context_page_description":"Aszód is a district in north-eastern part of Pest County. Aszód is also the name of the town where the district seat is found. The district is located in the Central Hungary Statistical Region."},{"page_url":"https://ca.wikipedia.org/wiki/Power_Ball","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Powerball_neon_green_work.jpg","page_title":"Power Ball","context_page_description":"Una Power Ball és un dispositiu giroscòpic dissenyat per a exercitar, especialment, el canell com fisioteràpia, o per a enfortir, en general, els diversos músculs de l'extremitat superior.\\nEstà basat en el giroscopi creat l'any 1852 per Léon Foucault per demostrar la rotació de la Terra. Funciona gràcies al principi de la força centrífuga. La força del rotor que es troba en el seu interior va en funció de la velocitat amb la qual se li fa girar. En girar la Power Ball amb més intensitat, el rotor augmenta el nombre de revolucions, generant un soroll o xiulada cada vegada més agut en proporció a les revolucions. No necessita alimentació elèctrica ni bateries, i els díodes LED que s'inclouen en la majoria dels seus models s'il·luminen amb l'energia que el giroscopi genera.\\nActualment es comercialitza, usant-se per a exercitar els músculs de la mà, avantbraç, bíceps, tríceps i muscle. És molt recomanable per a enfortir braços en diferents esports com el golf, tennis, o, també per a músics com guitarristes, baixistes, pianistes, etc\\nExisteixen diverses versions de NSD Power Ball amb l'opció d'incloure un velocímetre que mesura entre altres funcions les rpm."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9C%CF%80%CE%B1%CE%BB%CE%B1%CE%B3%CE%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Balaguer_Pla%C3%A7a_del_Mercadal_Catalonia.jpg","page_title":"Μπαλαγέ","context_page_description":"Το Μπαλαγέ είναι μια πόλη της Καταλονίας, πρωτεύουσα της κομητείας της Νογέρα και δεύτερο μεγαλύτερο αστικό κέντρο της επαρχίας της Λιέιδα. Ιστορικά αποτέλεσε πρωτεύουσα της μεσαιωνικής Κομητείας του Ουρζέλ ενώ βρέχεται από τον ποταμό Σέγρε."},{"page_url":"https://az.wikipedia.org/wiki/Robbi_Rocers","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Robbie_Rogers.jpg","page_title":"Robbi Rocers","context_page_description":"Robert Hempton \\"Robbi\\" Rocers - MLS-də çıxış edən \\"Los Anceles Qalaksi\\" komandasında oynayan ABŞ peşəkar futbolçusu. O, komandada yarımmüdafiəçi vəzifəsini yerinə yetirir. Rocers həm də ABŞ milli futbol komandasında çıxış edir. 2013-cü ilin fevralında kaminq aut edən Rocers 1990-cı ildə kamminq aut etmiş Castin Faşanudan sonra ikinci açıq gey Britaniya futbolçusu olmuşdur. 2013–cü ilin mayında Qalaksinin tərkibində ilk futbol oyununa çıxdıqdan sonra Rocers bütün Şimali Amerika peşəkar idman liqalarında çıxış edən komandalarda ilk açıq gey futbolçu kimi tarixə düşmüşdür.\\nBir il Merilend Universitetinin kollec komandasında oynadıqdan sonra, o, Eredivisie liqasında oynayan \\"Herenven\\" komandasının diqqətini cəlb edir. 2006-cı ilin avqustunda o, \\"Herenven\\"lə müqavilə imzalasa da, klubun tərkibində çıxış etməmiş müqavilə pozulur. 2007-ci ilin fevralında qarşılıqlı razılıq əsasında klubdan ayrılan Rocers ABŞ-a qayıdır və \\"Kolambus Kryu\\" komandası ilə müqavilə bağlayır."},{"page_url":"https://nl.wikipedia.org/wiki/Juni","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Chronography_of_354_Mensis_Iunius.png","page_title":"Juni","context_page_description":"Juni is de zesde maand van het jaar in de gregoriaanse kalender. De maand heeft 30 dagen. Er zijn geen andere maanden in eenzelfde jaar die op dezelfde dag van de week beginnen als juni.\\nVoor een duidelijker te horen onderscheid met de maand juli wordt juni soms juno genoemd."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%A4%D7%9C%D7%92%D7%AA_%D7%94%D7%A9%D7%95%D7%9E%D7%A8_%D7%94%D7%A6%D7%A2%D7%99%D7%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/%D7%9E%D7%A4%D7%9C%D7%92%D7%95%D7%AA_%D7%94%D7%A4%D7%95%D7%A2%D7%9C%D7%99%D7%9D_%D7%94%D7%A6%D7%99%D7%95%D7%A0%D7%99%D7%95%D7%AA_%D7%91%D7%99%D7%99%D7%A9%D7%95%D7%91.png","page_title":"מפלגת השומר הצעיר","context_page_description":"מפלגת השומר הצעיר הייתה מפלגת פועלים ציונית מרקסיסטית ביישוב בהנהגת מאיר יערי ויעקב חזן, שפעלה במסגרת הקיבוץ הארצי השומר הצעיר ובשיתוף מלא עם תנועת השומר הצעיר. בשנת 1946 התמזגה עם מפלגת הלוויין שלה הליגה הסוציאליסטית למפלגת פועלים השומר הצעיר."},{"page_url":"https://en.wikipedia.org/wiki/Deep_Impact_(spacecraft)","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e3/Deep_Impact_Discovery_Mission_to_Comet_Tempel_1.PNG","page_title":"Deep Impact (spacecraft)","context_page_description":"Deep Impact was a NASA space probe launched from Cape Canaveral Air Force Station on January 12, 2005. It was designed to study the interior composition of the comet Tempel 1, by releasing an impactor into the comet. At 05:52 UTC on July 4, 2005, the Impactor successfully collided with the comet's nucleus. The impact excavated debris from the interior of the nucleus, forming an impact crater. Photographs taken by the spacecraft showed the comet to be more dusty and less icy than had been expected. The impact generated an unexpectedly large and bright dust cloud, obscuring the view of the impact crater.\\nPrevious space missions to comets, such as Giotto, Deep Space 1, and Stardust, were fly-by missions. These missions were able to photograph and examine only the surfaces of cometary nuclei, and even then from considerable distances. The Deep Impact mission was the first to eject material from a comet's surface, and the mission garnered considerable publicity from the media, international scientists, and amateur astronomers alike.\\nUpon the completion of its primary mission, proposals were made to further utilize the spacecraft."},{"page_url":"https://it.wikipedia.org/wiki/Neo-tifinagh","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/2D43.png","page_title":"Neo-tifinagh","context_page_description":"Col nome di neo-tifinagh ci si riferisce ad una revisione moderna della tradizionale scrittura tifinagh dei tuareg, ideata per trascrivere anche altri dialetti berberi.\\nLa scrittura tradizionale dei tuareg, infatti, presenta diversi svantaggi per la trascrizione del berbero.\\nInnanzitutto, è rigorosamente consonantica, non trascrive, cioè, le vocali, il che è un principio che potrebbe adattarsi a lingue come l'arabo o l'ebraico, in cui l'ossatura consonantica delle parole rivela il valore semantico della radice, mentre è molto poco pratico per il berbero, in cui molte radici diverse hanno lo stesso consonantismo.\\nInoltre, essendo adatta alla trascrizione del tuareg, non contempla numerosi suoni tipici dei varietà berbere del Nord, in particolare quei suoni che sono stati introdotti insieme a numerosi prestiti arabi.\\nSenza contare che la scrittura tifinagh tradizionale è priva di molti elementi indispensabili in una scrittura moderna: un senso di scrittura prestabilito, modi di segnalare la separazione tra le parole, segni di interpunzione, ecc."},{"page_url":"https://de.wikipedia.org/wiki/Hollum","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Herenweg_2-4_-_Hollum_-_20113856_-_RCE.jpg","page_title":"Hollum","context_page_description":"Hollum ist mit 1.260 Einwohnern die größte Ortschaft der westfriesischen Insel Ameland und liegt an deren Westende. Der Ortskern ist geprägt von alten Kapitäns- und Seefahrerhäuschen, ganze Straßenzüge stehen unter einer Art Denkmalschutz, darunter das älteste Haus Amelands, das 1615 erbaut wurde. In dem kleinen Ort gibt es drei Kirchen, außerdem befinden sich dort und in der Umgebung zahlreiche Ferienunterkünfte."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B8%D1%80%D0%B0%D0%BC%D0%B8%D0%B4%D0%B0_G1-c","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Pyramid_of_Henutsen_%28G1C%29%2C_Giza%2C_Egypt2.jpg","page_title":"Пирамида G1-c","context_page_description":"G1-c — одна из четырёх пирамид-спутниц пирамиды Хеопса. Расположена на территории восточных гробниц с восточной стороны пирамиды Хеопса в Некрополе Гизы. Является самой южной из четырёх пирамид-спутниц. Построена во времена IV династии для второй жены Хеопса Хенутсен. Размер основания пирамиды 46,25 м, первоначальная высота 29,60 м. Как считает египтолог Вернер, пирамида G1c изначально не была частью пирамидального комплекса Хеопса, так как её южная сторона была выровнена не по стороне пирамиды Хеопса, а по расположенной рядом мастабе сына Хеопса Хуфухафта. В расположенном поблизости погребальном храме была найдена надпись, которая позволяет относить данную пирамиду к Хенутсен:\\n«Живой Хор, Меджу Хор, повелитель Верхнего и Нижнего Египта, Хуфу, получил жизнь. Находящийся рядом с часовней сфинкса, на северо-западе дома Осириса, господина Розетты. Он основал дом Исиды, рядом с храмом богини, которой он построил эту пирамиду. Рядом с храмом он построил пирамиду для дочери Хенутсен»."},{"page_url":"https://vec.wikipedia.org/wiki/Les_Touches-de-P%C3%A9rigny","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/661_-_Mairie_-_Les_touches_de_P%C3%A9rigny.jpg","page_title":"Les Touches-de-Périgny","context_page_description":"Les Touches-de-Périgny el xé on comun de 568 abitanti del departemento de Charente-Maritime che el fa parte del rejon Nova Acuitania in Fransa."},{"page_url":"https://de.wikipedia.org/wiki/Gusch_Etzion","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/NevedanC.jpg","page_title":"Gusch Etzion","context_page_description":"Gusch Etzion ist eine Gruppe israelischer Siedlungen im Westjordanland und eine Regionalverwaltung in Judäa und Samaria. Die Gebiete von Siedlungsblock und Regionalverwaltung sind nicht völlig identisch. Gusch Etzion liegt auf halber Strecke zwischen Jerusalem und Hebron."},{"page_url":"https://fr.wikipedia.org/wiki/Hamadryas","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Guatemalan_Cracker_%28Hamadryas_guatemalena%29_2.jpg","page_title":"Hamadryas","context_page_description":"Le genre Hamadryas regroupe des lépidoptères de la famille des Nymphalidae, de la sous-famille des Biblidinae."},{"page_url":"https://eu.wikipedia.org/wiki/Mornans","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Mornans.JPG","page_title":"Mornans","context_page_description":"Mornans Frantziako udalerri bat da, Drôme departamenduan dagoena, Auvernia-Rhône-Alpeak eskualdean. 2013an 72 biztanle zituen."},{"page_url":"https://lt.wikipedia.org/wiki/Holos_%C5%A0v._Antano_Pie%C4%8Derskio_cerkv%C4%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Hola_cerkiew_2010_%283%29.JPG","page_title":"Holos Šv. Antano Piečerskio cerkvė","context_page_description":"Holos Šv. Antano Piečerskio cerkvė – cerkvė, esanti Holos kaime Lenkijoje. Cerkvė priklauso Horostitos Aukščiausiojo Viešpaties Kryžiaus parapijai. Medinė cerkvė pastatyta 1702 metais. 1966 m. gegužės 19 d. cerkvė buvo įtraukta į Liublino vaivadijos saugomų istorijos paminklų sąrašą."},{"page_url":"https://it.wikipedia.org/wiki/Msta","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Dubrovka_ND_1.jpg","page_title":"Msta","context_page_description":"La Msta è un fiume della Russia europea occidentale, tributario del lago Il'men'.\\nHa origine dal piccolo lago Mstino, situato sulle propaggini nordorientali del rialto del Valdaj a pochissimi chilometri di distanza dalla città di Vyšnij Voločëk, nella oblast' di Tver'. Si dirige dapprima verso nord; poi, a valle dell'insediamento di Berëzovskij Rjadok, volge il suo corso verso nordovest ed entra nella oblast' di Novgorod. Il fiume attraversa in questo tratto una zona di modeste alture collinari; tocca la città di Boroviči e successivamente, a valle di Ljubitino, assume direzione mediamente ovest-sudovest che mantiene fino alla sua foce nel lago Il'men', poco distante dalla città di Velikij Novgorod.\\nI principali affluenti sono Berezajka, Volma e Cholova dalla sinistra idrografica, Uver', Šegrinka e Mda dalla destra.\\nLa Msta è gelata, mediamente, in un periodo compreso fra gli inizi di dicembre ed aprile; nei rimanenti mesi è navigabile a valle della confluenza dell'affluente Cholova."},{"page_url":"https://fr.wikipedia.org/wiki/Lepa_Brena","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Lepa_brena.jpg","page_title":"Lepa Brena","context_page_description":"Fahreta Živojinović, plus connue sous le nom de scène Lepa Brena est la plus connue des chanteuses yougoslaves des années 1980."},{"page_url":"https://en.wikipedia.org/wiki/Hayman_Fire","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Hayman_Fire_%286%29.jpg","page_title":"Hayman Fire","context_page_description":"The Hayman Fire was a forest fire started on June 8, 2002, 35 miles northwest of Colorado Springs, Colorado and 22 miles southwest of Denver, Colorado and became the 2nd largest wildfire in the state's recorded history at over 138,114 acres.\\nHundreds of firefighters fought the fast-moving fire, which caused nearly $40 million in firefighting costs, burned 133 homes, 138,114 acres, and forced the evacuation of 5,340 people.\\nSmoke could be seen and smelled across the state from Vail, 55 miles northwest, to Burlington, 188 miles east, and from Broomfield, 50 miles north, to Walsenburg, 130 miles south.\\nThe Hayman Fire burned from June 8, 2002, until it was classified as contained on July 18, 2002. The cause of the wildfire was found to be arson.\\nWhen then-Governor Bill Owens responded to a reporter's question following an aerial tour of the fires, Owens said \\"It looks as if all of Colorado is burning today.\\" Many western slope residents blamed Owens for driving away tourists with the press' truncated version of the quote The Hayman Fire was named for a mining ghost town near Tappan Gulch."},{"page_url":"https://cy.wikipedia.org/wiki/Deugotyledon","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/76/Magnolia_liliiflora3.jpg","page_title":"Deugotyledon","context_page_description":"Planhigion blodeuol â dwy had-ddeilen yw'r deugotyledonau. Maent yn cynnwys tua 200,000 o rywogaethau. Fe'u dosberthir yn y dosbarth Magnoliopsida yn draddodiadol, ond mae astudiaethau o'u DNA a'u paill yn dangos bod nhw'n ffurfio sawl grŵp gwahanol; yr ewdicotau yw'r grŵp mwyaf ac maent yn cynnwys y rhan fwyaf o'r deugotyledonau."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_N%C3%BCrnberg/Nordwestliche_Au%C3%9Fenstadt","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Nuremberg_Kleinreuth_hinter_der_Veste_Mittelstra%C3%9Fe_6_001.JPG","page_title":"Liste der Baudenkmäler in Nürnberg/Nordwestliche Außenstadt","context_page_description":"Dies ist eine Teilliste der Liste der Baudenkmäler in Nürnberg. Sie enthält die in der Bayerischen Denkmalliste ausgewiesenen Baudenkmäler auf dem Gebiet des statistischen Stadtteils Nordwestliche Außenstadt der kreisfreien Stadt Nürnberg in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt und aktualisiert wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://sv.wikipedia.org/wiki/Pansart%C3%A5g","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/%D0%91%D1%80%D0%BE%D0%BD%D0%B5%D0%BF%D0%BE%D0%B5%D0%B7%D0%B4_%D0%A1%D0%B8%D0%B1%D0%B8%D1%80%D1%8F%D0%BA_%D0%9A%D0%BE%D0%BB%D1%87%D0%B0%D0%BA%D0%B0_%D0%BB%D0%B5%D1%82%D0%BE_1919.jpg","page_title":"Pansartåg","context_page_description":"Pansartåg är ett bepansrat och beväpnat tåg avsett för militärt bruk. Dess roll går mellan skyddad trupp- och godstransport till stridsfordon.\\nPansartåg användes främst under första världskriget och ryska inbördeskriget, men de förekom även under andra världskriget. Användningen av pansartåg minskade allteftersom vägfordon ökade i kraft och flexibilitet. Pansartågen var alltför känsliga för järnvägssabotage och flygangrepp.\\nPansartågens styrka var eldkraften, men deras räckvidd var begränsad, varför fienden lätt kunde få skydd genom att dra sig tillbaka från järnvägslinjen. Denna svaghet kunde övervinnas genom att trupper, som kunde strida utanför tåget, medfördes."},{"page_url":"https://es.wikipedia.org/wiki/Escudo_de_Comala_(Colima)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Escudo_Comala.png","page_title":"Escudo de Comala (Colima)","context_page_description":"El escudo fue elaborado por el Lic. Álvaro Gabriel Rivera Muñoz, a partir de un concurso celebrado en el año de 1984.\\nSignificado\\nEste emblema presenta en la bordura la leyenda “Comala”, y en la punta, un listón flotante dorado con el lema: “Fértil el suelo y leal su pueblo”.\\nSe encuentra dividido en tres fajas. En la parte superior aparecen los volcanes y un nogal; en la faja central se encuentra el acueducto de la ex hacienda de San Antonio y los Perros Cebados representativos de la cerámica colimense, y en la inferior se observa la Laguna de Carrizalillos flanqueada por una trucha y dos parotas. Al centro tiene en forma gráfica la etimología de la palabra Comal.\\nComo ornamentos exteriores presenta un yelmo de acero bruñido con cimera de plumas, vuelto hacia el lado diestro y colocado en la parte superior. En el soporte inferior, dos venados nacientes, dispuestos hacia fuera y la planta de café con hojas, flores y frutos, que envuelven al escudo.\\nSignificado de los colores:\\nEl oro, poder y riqueza; el rojo, fortaleza y el fuego del volcán; el verde, la esperanza; el azul, justicia y lealtad; campo de plata, vigilancia."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%B8%8C%E7%BD%97%E7%BA%B3","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/18/Sironadist.png","page_title":"希罗纳","context_page_description":"希羅納古羅馬凱爾特神話女性神祇之一。長期盛行於今中歐與西歐等地區。其事跡亦反映於相關碑文等文物中，具有重要地影響與積極意義。"},{"page_url":"https://pt.wikipedia.org/wiki/Advanced_Photo_System","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Nikon_Pronea_600i_img_0604.jpg","page_title":"Advanced Photo System","context_page_description":"O Advanced Photo System, ou APS, foi um sistema resultante de uma join venture das empresas Canon, Fujifilm, Kodak, Minolta e Nikon que decidiram envidar esforços conjuntos no sentido de informatizar o processo fotográfico, estabelecendo um novo padrão para a fotografia e, ao mesmo tempo, consolidando os avanços técnicos e tecnológicos alcançados no decorrer do empreendimento. O APS foi apresentado ao público oficialmente em 22 de abril de 1996.\\nO nome comercial IX foi dado para o APS. Apesar da sua tecnologia avançada, a linha IX teve uma existência efêmera. Perdeu mercado para as câmeras digitais compactas, que se tornavam cada vez melhores e mais acessíveis rapidamente. Em 2004, o IX sofreu descontinuidade, quando a Kodak deixou de fabricar câmeras e filmes Advantix.\\nPermaneceu a visão sistêmica do APS, que foi integrada, mais tarde, à fotografia digital. Outra herança do APS é o tamanho APS-C, aproveitado no design de câmeras SLR digitais para amadores avançados."},{"page_url":"https://fr.wikipedia.org/wiki/Star_Wars_Rebels","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Taylor_Gray_%2845710583344%29.jpg","page_title":"Star Wars Rebels","context_page_description":"Star Wars Rebels, ou Star Wars Rebelles au Québec, ou simplement Rebels, est une série télévisée d'animation américaine en 75 épisodes de 22 minutes, créée par Simon Kinberg, Dave Filoni et Carrie Beck et diffusée du 3 octobre 2014 au 5 mars 2018 sur Disney XD.\\nUn double épisode, intitulé Prémices d'une Rébellion, préparant l'univers de la série, a été diffusé en avant-première dans le monde entier sur les différentes chaînes Disney Channel et Disney XD le 3 octobre 2014. Par la suite, le reste de la série a débuté le 13 octobre 2014 sur Disney XD.\\nStar Wars Rebels se déroule entre l'épisode III et l'épisode IV de la série de films Star Wars, à une époque où l'Empire galactique affermit son emprise sur la galaxie. Tandis que les forces impériales traquent les derniers chevaliers Jedi ayant survécu à la Grande purge Jedi, une rébellion naissante contre l'Empire prend forme.\\nEn France, la série est diffusée depuis le 19 octobre 2014, également sur Disney XD, et depuis le 15 février 2015 sur France 4, et au Québec depuis l'automne 2015 sur La Chaîne Disney."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%9E%D0%B4%D0%B5%D1%81%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Tram_K-1_in_Odessa.JPG","page_title":"Одеса","context_page_description":"Одеса — град во Украина на Црното Море. Одеса е големо пристаниште и културен центар, како и административен центар на Одеската област. Населението на градот според последниот попис во 2004 било 1 012 500 жители. Во 1945 г. година е прогласен за град-херој.\\nПретходница на градот Одеса било едно мало место населено со Татари, чиј водач бил Хаџи I Герај, кримски хан, по кого и тогашното гратче се викало „Хаџибеј“. По кус период на литванско владеење, градот потпаднал под османлиска власт во 1529 г. Под нивна управа останал сè до поразот на Османлиите во Руско-турската војна од 1792. Денешната Одеса била изградена по декрет од кралицата Катерина II во 1794. Од 1819 до 1858 градот бил слободна зона, а за време на Советскиот Сојуз претставувал главно поморско упориште и важна база за морнарицата. На 1 јануари 2000 г. одеското пристаниште било прогласено за слободна економска зона во период од 25 години.\\nВо 19. век Одеса бил четвртиот најголем град во Руската Империја, веднаш зад Москва, Санкт Петербург и Варшава. Архитектонскиот стил на градот повеќе наликува на оној од медитеранските земји, отколку на стилот од словенските."},{"page_url":"https://nl.wikipedia.org/wiki/%C3%89vreux_(Frankrijk)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Evreux_H%C3%B4tel_de_Ville_R01.jpg","page_title":"Évreux (Frankrijk)","context_page_description":"Évreux is een gemeente in het Franse departement Eure en telt 53 705 inwoners. De plaats maakt deel uit van het arrondissement Évreux. Na Le Havre en Rouen is het de op twee na grootste stad van de regio. De agglomeratie van Évreux telt 84 101 inwoners. Évreux is ook de hoofdplaats van het gelijknamige bisdom."},{"page_url":"https://af.wikipedia.org/wiki/Los_Angeles","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b2/LA.jpg","page_title":"Los Angeles","context_page_description":"Los Angeles is 'n groot, uitgestrekte metropool aan die weskus van die Verenigde State en die administratiewe setel van die Los Angeles-distrik in Suid-Kalifornië.\\nDie stad is in 1781 deur die Spaanse kaptein Rivera y Moncada onder die naam El Pueblo de Nuestra Señora Reina de los Ángeles de la Porciúncula met elf Spaanse gesinne langs die Los Angeles-rivier gestig, maar dit is eers op 4 April 1850 – vyf maande voordat Kalifornië amptelik tot die Unie toegelaat is – as 'n munisipaliteit geïnkorporeer.\\nLos Angeles is by verre die grootste stedelike nedersetting in Kalifornië, en sedert 1990, toe dit die tradisionele Second City Chicago verbygesteek het, op een na die grootste metropool in die Verenigde State, met 'n inwonertal wat in 2015 vir die eerste keer in sy geskiedenis die vier-miljoenkerf verbygesteek het. Die metropolitaanse gebied van Los Angeles huisves 'n bevolking van meer as 17 miljoen met uiteenlopende etniese en ekonomiese agtergronde. Die stad is in die 20ste eeu as die prototipe van 'n toekomstige metropool beskou wat alle voor- en nadele van 'n uitgestrekte metropolitaanse gebied in hom verenig het."},{"page_url":"https://nl.wikipedia.org/wiki/Tsjornoliscultuur","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Eastern_and_Central_Europe_around_750_BC.png","page_title":"Tsjornoliscultuur","context_page_description":"De Tsjornoliscultuur is een ijzertijdcultuur van ca. 1025-700 v.Chr. vernoemd naar de streek Tsjorny lis in de oblast Kirovohrad van Oekraïne.\\nDe cultuur was gelegen in de bossteppe tussen de Dnjestr en de Dnjepr-rivieren. Deze locatie komt overeen met waar Herodotus later zijn \\"Scythische landbouwers\\" plaatste.\\nVerschillende onderzoekers vermoeden er een vroege Slavische cultuur."},{"page_url":"https://es.wikipedia.org/wiki/Campa%C3%B1a_de_Rivera_a_las_Misiones_Orientales","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Dorrego.jpg","page_title":"Campaña de Rivera a las Misiones Orientales","context_page_description":"El general Fructuoso Rivera conquistó las Misiones Orientales para las Provincias Unidas del Río de la Plata en una rápida campaña durante el año 1828, como parte de la llamada Guerra del Brasil. Ese territorio, ubicado en el oeste del actual Estado de Río Grande del Sur y habitado hasta entonces por indígenas guaraníes, había sido colonizado por jesuitas españoles, pero permanecía en manos del Imperio del Brasil como herencia de su metrópoli colonial, Portugal, desde su ocupación en 1801.\\nNo obstante, debió evacuar ese territorio a fines de ese mismo año, como resultado de las negociaciones que condujeron al Tratado de Paz que suscribieron el Imperio del Brasil y las Provincias Unidas, y que otorgó la independencia al Estado Oriental del Uruguay, país del cual el mismo Rivera sería el primer presidente."},{"page_url":"https://ro.wikipedia.org/wiki/Pactul_Kellogg-Briand","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/FrankKellogg.jpg","page_title":"Pactul Kellogg-Briand","context_page_description":"Pactul Kellogg-Briand, cunoscut și ca Pactul de la Paris, după orașul în care a fost semnată această înțelegere pe 27 august 1928, a fost un tratat internațional \\"care milita pentru renunțarea la război ca instrument al politicii naționale\\". Scopurile sale nu au fost atinse, dar a fost un pas înainte pentru dezvoltarea doctrinelor dreptului internațional. Pactul a fost botezat cu numele secretarului de stat american Frank B. Kellogg și al ministrului de externe francez Aristide Briand, inițiatorii tratatului."},{"page_url":"https://ca.wikipedia.org/wiki/Sauropelta_edwardsorum","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4a/Sauropelta.png","page_title":"Sauropelta edwardsorum","context_page_description":"Sauropelta edwardsorum és una espècie de dinosaure nodosàurid que visqué al Cretaci inferior al que avui en dia és Nord-amèrica. És l'única espècie coneguda del gènere Sauropelta. Anatòmicament, és un dels nodosàurids més ben coneguts, i se n'han recuperat restes fossilitzades als estats nord-americans de Wyoming, Montana i possiblement Utah. També és l'espècie més antiga coneguda de nodosàurid; la majoria de les seves restes s'han trobat a la formació de Cloverly, que data d'entre fa 115 i fa 110 milions d'anys.\\nEra un nodosàurid de mida mitjana, amb una longitud de cinc metres en els adults. Sauropelta tenia una cua característicament llarga que mesurava més o menys la meitat de la longitud total de l'animal. Tot i que el cos era més petit que el dels rinoceronts negres actuals, Sauropelta pesava més o menys el mateix, uns 1.500 kg. El pes addicional era degut principalment a l'extensa cuirassa òssia, incloent-hi les llargues espines característiques que li sortien del coll."},{"page_url":"https://la.wikipedia.org/wiki/Magicus_Johnson","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Earvin.JPG","page_title":"Magicus Johnson","context_page_description":"Magicus Johnson est praeclarus lusor pristinus canistriludii, qui omnes 13 annos Los Angeles Lakers turmae lusit, quacum quinquies primatum National Basketball Association certaminis vicit. Praeterea in Olympiis 1992 nomisma aureum turmae nationali Civitatum Foederatarum cum inter alia lusoribus illustrissimis Michaele Jordan Laurentioque Bird vicit."},{"page_url":"https://pl.wikipedia.org/wiki/Cirey-sur-Vezouze","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Cirey-sur-Vezouze_maison_de_retraite.JPG","page_title":"Cirey-sur-Vezouze","context_page_description":"Cirey-sur-Vezouze – miejscowość i gmina we Francji, w regionie Grand Est, w departamencie Meurthe i Mozela.\\nWedług danych na rok 1990 gminę zamieszkiwało 1989 osób, a gęstość zaludnienia wynosiła 121 osób/km²."},{"page_url":"https://pa.wikipedia.org/wiki/%E0%A8%93_%E0%A8%90%E0%A8%A8_%E0%A8%B5%E0%A9%80_%E0%A8%95%E0%A9%81%E0%A8%B0%E0%A9%81%E0%A8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Onv.JPG","page_title":"ਓ ਐਨ ਵੀ ਕੁਰੁਪ","context_page_description":"ਓੱਟਪਲੱਕਲ ਨੀਲਕੰਠਨ ਵੇਲੁ ਕੁਰੁਪ, ਜਿਸ ਨੂੰ ਆਮ ਤੌਰ 'ਤੇ ਓ ਐਨ ਵੀ ਕੁਰੁਪ ਦੇ ਤੌਰ 'ਤੇ ਜਾਣਿਆ ਜਾਂਦਾ ਸੀ ਜਾਂ ਬਸ ਅਤੇ ਪਿਆਰ ਨਾਲ ਓ ਐਨ ਵੀ ਕਹਿ ਦਿੱਤਾ ਜਾਂਦਾ ਸੀ, ਉਹ ਕੇਰਲ, ਭਾਰਤ ਤੋਂ ਮਲਿਆਲਮ ਕਵੀ ਅਤੇ ਗੀਤਕਾਰ ਸੀ। ਉਸਨੇ ਸਾਲ 2007 ਲਈ ਭਾਰਤ ਵਿੱਚ ਸਭ ਤੋਂ ਵੱਧ ਸਾਹਿਤਕ ਪੁਰਸਕਾਰ ਗਿਆਨਪੀਠ ਪੁਰਸਕਾਰ ਪ੍ਰਾਪਤ ਕੀਤਾ। ਉਸ ਨੇ 1998 ਵਿੱਚ ਪਦਮ ਸ਼੍ਰੀ ਅਤੇ 2011 ਵਿੱਚ ਪਦਮ ਵਿਭੂਸ਼ਨ ਭਾਰਤ ਸਰਕਾਰ ਦੇ ਚੌਥੇ ਅਤੇ ਦੂਜੇ ਸਭ ਤੋਂ ਵੱਡੇ ਨਾਗਰਿਕ ਸਨਮਾਨ ਪ੍ਰਾਪਤ ਕੀਤੇ। 2007 ਵਿਚ ਕੇਰਲਾ ਯੂਨੀਵਰਸਿਟੀ, ਤ੍ਰਿਵਿੰਦਰਮ ਨੇ ਉਸਨੂੰ ਆਨਰੇਰੀ ਡਾਕਟਰੇਟ ਨਾਲ ਸਨਮਾਨਿਤ ਕੀਤਾ। ਓ. ਐੱਨ. ਵੀ. ਆਪਣੇ ਖੱਬੇਪੱਖੀ ਝੁਕਾਅ ਲਈ ਜਾਣਿਆ ਜਾਂਦਾ ਹੈ। ਉਹ ਆਲ ਇੰਡੀਆ ਸਟੂਡੈਂਟਸ ਫੈਡਰੇਸ਼ਨ ਦੇ ਸਾਬਕਾ ਨੇਤਾ ਸੀ। ਉਸ ਦੀ ਮੌਤ ਹੋ ਗਈ ਤੇ 13 ਫਰਵਰੀ 2016."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%8B%B4%EB%B1%83%EB%8C%80","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e1/Pipa_savinelli.jpg","page_title":"담뱃대","context_page_description":"담뱃대는 연초를 다져넣어 담배를 피우는 도구이다. 담뱃대의 디자인은 여러 가지이지만, 대체로 연초를 넣는 연초주걱, 대롱, 그리고 마우스피스로 이루어져 있다. 연초주걱에 담뱃가루를 넣고 다지게로 다져서 피운뒤, 긁게로 긁어내어 청소해줘야 하는 번거로움이 있어 시가가 유행한 이후 사용자가 많이 줄었다."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_in_Pfunds","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Enskapelle%2C_Pfunds_02.JPG","page_title":"Liste der denkmalgeschützten Objekte in Pfunds","context_page_description":"Die Liste der denkmalgeschützten Objekte in Pfunds enthält die 38 denkmalgeschützten, unbeweglichen Objekte der Tiroler Gemeinde Pfunds im Bezirk Landeck."},{"page_url":"https://cs.wikipedia.org/wiki/Zho%C5%99_(okres_Jihlava)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Zho%C5%99.jpg","page_title":"Zhoř (okres Jihlava)","context_page_description":"Obec Zhoř se nachází v okrese Jihlava v kraji Vysočina na moravské straně historické zemské hranice Čech a Moravy. Žije zde 447 obyvatel. Nachází se zde nová dráha pro koně. Přímo na zemské hranici se nachází sportovní letiště Zhoř u Polné."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%B7%A5%E5%85%9A%E4%B8%BB%E5%B8%AD_(%E8%8B%B1%E5%9B%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/John_Reid_on_his_last_day_as_Home_Secretary%2C_June_2007.jpg","page_title":"工党主席 (英国)","context_page_description":"英國工黨主席是首相兼工黨領袖托尼·布萊爾在2001年大選後創設的禮儀性職位。這個職位不能與根據《工黨黨章》設立的黨主席職位混淆。2007年後，這個職位由工黨副領袖兼任。\\n2007年之前，這個職務通常與不管部大臣由同一人擔任而成為內閣職位。這樣的安排類似於保守黨執政時，保守黨主席兼不管部大臣入閣的模式，但工黨主席不能與保守黨主席相比的是，後者擔負管理中央庶務和監督選舉的重任，前者則無此職責，工黨另有總書記一職負責這兩項工作。布萊爾在介紹這個職務時稱之為「政府和黨的聯絡人」，而當時工黨的國會后座議員和普通黨員正越來越不滿於布萊爾的總統式風格。有人指出設立這個職位是「從保守黨處學來的」，更有人表示「這不是黨內民主的勝利」。\\n2007年布朗上台後，多次表示英國是「議會制而非總統制國家」，極力淡化其前任總統式風格的負面影響。作為變革的一部分，「政府和黨之間溝通的橋樑」——工黨主席應由黨員選舉產生而非領袖任命，布朗在其當選黨領袖的演講中既做出了這一承諾。出於精簡提效的考慮，工黨主席與工黨副領袖由同一人擔任，副領袖既是黨的二號人物又由黨員選舉產生。這種安排延續至2017年。\\n2017年大選工黨席位數上升了30席，黨領袖科爾賓地位空前穩固，在隨後6月14日的影子內閣改組中，他任命影子不管部大臣伊恩·拉弗利接替黨的副領袖湯姆·沃特森兼任黨主席，使黨主席的任命方式回歸2001年模式。拉弗利同時擔任大選協調員。科爾賓在解釋這一變動時表示，這樣安排是為了應付可能發生的今年內第二次大選。分析認為，這一人事任命是為了抵消沃特森在黨內日益上升的影響力並增加科爾賓的政治實力。"},{"page_url":"https://vi.wikipedia.org/wiki/Lathyrus_laxiflorus","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/69/Lathyrus_laxiflorus.JPG","page_title":"Lathyrus laxiflorus","context_page_description":"Lathyrus laxiflorus là một loài thực vật có hoa trong họ Đậu. Loài này được Kuntze miêu tả khoa học đầu tiên."},{"page_url":"https://es.wikipedia.org/wiki/Sitio_de_Gibraltar_(1779-1783)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Gibraltar_fuertes_ingl%C3%A9s_3.jpg","page_title":"Sitio de Gibraltar (1779-1783)","context_page_description":"El sitio de Gibraltar de 1779 o Gran asedio de Gibraltar, el tercero llevado a cabo por España desde la pérdida de la ciudad para recuperar la colonia británica, fue la campaña más importante que se realizó en la zona durante el siglo XVIII y tuvo como antecedentes los asedios de 1704 y 1727. Durante casi cuatro años de bloqueo naval, bombardeos y la novedosa utilización de las llamadas baterías flotantes, el imperio británico fue capaz de resistir la última acción militar española sobre Gibraltar."},{"page_url":"https://arz.wikipedia.org/wiki/%DA%86%D9%88%D9%84%D9%8A%D8%A7%D9%86_%D8%B1%D8%A7%D8%AF%D9%88%D9%84%D8%B3%D9%83%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Julian_Radulski_2010.JPG","page_title":"چوليان رادولسكى","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nچوليان رادولسكى كان لاعب شطرنج من بلجاريا."},{"page_url":"https://la.wikipedia.org/wiki/Saint-Barth%C3%A9lemy-Lestra","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/12/Map_commune_FR_insee_code_42202.png","page_title":"Saint-Barthélemy-Lestra","context_page_description":"Saint-Barthélemy-Lestra est commune Francicum 675 incolarum praefecturae Ligeris in regione orientali Rhodano et Alpibus."},{"page_url":"https://fr.wikipedia.org/wiki/Maison_Popovi%C4%87-Predi%C4%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Ku%C4%87a_porodice_Popovi%C4%87-Predi%C4%87_1.jpg","page_title":"Maison Popović-Predić","context_page_description":"La maison Popović-Predić est située à Belgrade, la capitale de la Serbie, dans la municipalité urbaine de Savski venac. Construite en 1937, elle est inscrite sur la liste des biens culturels de la ville de Belgrade."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%B5%D1%80%D0%B1_%D0%A1%D0%B0%D0%BB%D1%8C%D1%81%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Coat_of_Arms_of_Salsk_%28Rostov_oblast%29.png","page_title":"Герб Сальска","context_page_description":"Герб муниципального образования Сальский район Ростовской области Российской Федерации — главный символ города и района, составляет особую гордость ее жителей, служит залогом преемственности органов местного самоуправления прошлых лет и многих поколений сальчан, возрождения историко-культурных реликвий города Сальска и Сальского района.\\nВ мае 2003 года герб города Сальска и Сальского района внесён в Государственный геральдический регистр РФ под № 1129."},{"page_url":"https://pl.wikipedia.org/wiki/Dart","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Dart.svg","page_title":"Dart","context_page_description":"Dart, rzutki, lotki – gra, a raczej różne powiązane ze sobą gry, w których celem jest trafianie niewielkimi lotkami w tarczę zawieszoną na ścianie. Przez lata korzystano z różnych tarcz i różnych zasad. Dziś określenie „dart” kojarzone jest głównie ze standaryzowaną grą, mającą specyficzną tarczę i ustalone zasady.\\nDart jest zarówno profesjonalnym sportem, jak również tradycyjną lokalową rozrywką, bardzo popularną w Wielkiej Brytanii, Irlandii, Holandii, krajach skandynawskich, Stanach Zjednoczonych oraz w wielu innych krajach."},{"page_url":"https://en.wikipedia.org/wiki/The_Devil_Put_Dinosaurs_Here","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Jerry_Cantrell_2010.jpg","page_title":"The Devil Put Dinosaurs Here","context_page_description":"The Devil Put Dinosaurs Here is the fifth studio album by the American rock band Alice in Chains, released on May 28, 2013 through Capitol Records. It is the band's second reunion album. Following a worldwide tour in support of its previous album, Black Gives Way to Blue, Alice in Chains began work on a new album. The making of The Devil Put Dinosaurs Here lasted for more than a year and the release of the album was delayed numerous times. The band entered the studio in July 2011 to start work on their fifth album. During the writing and recording sessions, guitarist and vocalist Jerry Cantrell underwent shoulder surgery, which resulted in the delay of the album. The recording sessions of The Devil Put Dinosaurs Here were completed in December 2012.\\nPeaking at No. 2 on the Billboard 200 chart and at No. 1 on the Top Rock Albums chart, the album was well received by music critics, and \\"Hollow\\", \\"Stone\\", \\"Voices\\" were released as singles to promote the album. \\"Hollow\\" and \\"Stone\\" reached No. 1 on Billboard's Mainstream Rock Tracks, while \\"Voices\\" reached No. 3, and each one of the three songs stayed on the chart for 20 weeks."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%AC%AC%E4%BA%8C%E6%AC%A1%E3%83%9D%E3%83%BC%E3%83%A9%E3%83%B3%E3%83%89%E5%88%86%E5%89%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Rzeczpospolita_Rozbiory_2.png","page_title":"第二次ポーランド分割","context_page_description":"第二次ポーランド分割は、1793年に行われたポーランド・リトアニア共和国の分割。1792年、ポーランド王スタニスワフ2世アウグストと改革派がポーランド・ロシア戦争でロシア帝国・タルゴヴィツァ連盟連合軍に敗れた。これにより、1793年のグロドノ・セイムにおいて、ポーランドはロシア帝国とプロイセン王国による国土の一部分割を承認せざるを得なくなった。この分割を受けて、ポーランド人は改革派を中心にコシチュシュコの蜂起を起こしたが鎮圧され、1795年の第三次ポーランド分割で完全な国家滅亡を迎えることになる。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B5_%D1%83%D0%BA%D1%80%D0%B5%D0%BF%D0%BB%D1%91%D0%BD%D0%BD%D1%8B%D0%B5_%D0%BB%D0%B8%D0%BD%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Laskovskii_2_Albom_2.jpg","page_title":"Российские укреплённые линии","context_page_description":"Российские укреплённые линии — укреплённые линии в России как система охраны и обороны границ и приграничных районов Русского государства, заключавшаяся в возведении укреплённых пограничных, сторожевых, оборонительных, кордонных, береговых линий и засечных черт на окраинах Российского государства в XVI — XIX веках для защиты внутренних территорий страны от нападений извне.\\nСистема укреплённых линий получила преимущественное развитие на южных и юго-восточных рубежах, она существовала в России наряду с крепостной системой прикрытия границ, пока окончательно не уступила последней в конце XIX века. Крепостная система после Первой мировой войны была заменена в СССР системой укреплённых районов."},{"page_url":"https://es.wikipedia.org/wiki/Eduardo_Cesti","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Eduardo_Cesti_Freddy_Montesa_Eusebio_Chato_Grados.JPG","page_title":"Eduardo Cesti","context_page_description":"Eduardo Cesti Vílchez es un actor peruano de cine y televisión."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%93%D0%BE%D1%81%D1%82%D1%96%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Kleste_na_hostie_detail.jpg","page_title":"Гостія","context_page_description":"Го́стія — євхаристичний хліб у католиків латинського обряду та в Англіканстві. Слово «гостія» походить від латинського «hostia». Використовується під час літургії для таїнства Євхаристії. У католицьких храмах вже освячені гостії, які стали Святими Дарами, зберігаються в дароохоронниці, яка розташовується або за вівтарем, або в бічному боковому вівтарі храму. Гостії випікаються з прісного тіста, що складається виключно з борошна й води. Для їх виготовлення використовуються спеціальні форми з рельєфними зображеннями хреста та інших християнських символів, завдяки чому ці зображення відображаються на випечених гостіях. У католицизмі часто, але не завжди, приготуванням гостії займаються черниці жіночих монастирів. У східних католицьких церквах, як і в православ'ї, для таїнства Євхаристії використовується квасний хліб. У деяких некатолицьких джерелах гостії ще називаються облатками. Не слід плутати гостію з традиційними різдвяними хлібцями у Польщі та інших країнах Східної Європи, які називають оплатками і які не мають ніякого богослужбового використання."},{"page_url":"https://it.wikipedia.org/wiki/Jon_Ola_Sand","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/JESC_2018._Jon_Ola_Sand_during_press_conference_%282%29.jpg","page_title":"Jon Ola Sand","context_page_description":"Jon Ola Sand è un dirigente d'azienda norvegese, supervisore esecutivo dell'Eurovision Song Contest e del Junior Eurovision Song Contest."},{"page_url":"https://en.wikipedia.org/wiki/Sydney","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Sydney_CBD_on_a_sunny_day_%284607955327%29.jpg","page_title":"Sydney","context_page_description":"Sydney is the state capital of New South Wales and the most populous city in Australia and Oceania. Located on Australia's east coast, the metropolis surrounds Port Jackson and extends about 70 km on its periphery towards the Blue Mountains to the west, Hawkesbury to the north, the Royal National Park to the south and Macarthur to the south-west. Sydney is made up of 658 suburbs, 40 local government areas and 15 contiguous regions. Residents of the city are known as \\"Sydneysiders\\". As of June 2019, Sydney's estimated metropolitan population was 5,312,163, meaning the city is home to approximately 65% of the state's population.\\nIndigenous Australians have inhabited the Sydney area for at least 30,000 years, and thousands of engravings remain throughout the region, making it one of the richest in Australia in terms of Aboriginal archaeological sites. During his first Pacific voyage in 1770, Lieutenant James Cook and his crew became the first Europeans to chart the eastern coast of Australia, making landfall at Botany Bay and inspiring British interest in the area."},{"page_url":"https://it.wikipedia.org/wiki/Mannesmann","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Laminatoio_Mannesmann_Museo_scienza_e_tecnologia_Milano.jpg","page_title":"Mannesmann","context_page_description":"Il gruppo industriale tedesco Mannesmann è stato fondato nel 1890 come produttore di tubi di acciaio con la denominazione \\"Deutsch-Österreichische Mannesmannröhren-Werke AG. Nel ventesimo secolo la gamma produttiva della Mannesmann venne accresciuta e la società si espanse in svariati settori – a partire dai più diversi prodotti siderurgici ed attività commerciali, fino al settore ingegneristico dell'industria meccanica ed elettrotecnica, al settore automobilistico ed a quello delle telecomunicazioni. A partire dal 1955, la Holding del Gruppo con sede principale a Düsseldorf ha assunto la denominazione Mannesmann AG.\\nIl particolare successo delle attività del Gruppo nel settore delle telecomunicazioni, avviato nel 1990, è stata la principale causa che motivò l'acquisizione della Mannesmann nel 2000 da parte della società inglese della telefonia Vodafone – che ancora oggi rappresenta una delle più rilevanti operazioni di Acquisizione a livello mondiale. All'epoca, il Gruppo Mannesmann contava 130.860 dipendenti nel mondo e vantava un fatturato di 23.27 miliardi di Euro."},{"page_url":"https://en.wikipedia.org/wiki/Edward_Bulwer-Lytton","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Pelham.jpg","page_title":"Edward Bulwer-Lytton","context_page_description":"Edward George Earle Lytton Bulwer-Lytton, 1st Baron Lytton, PC was an English writer and politician. He served as a Whig member of Parliament from 1831 to 1841 and a Conservative from 1851 to 1866. He was Secretary of State for the Colonies from June 1858 to June 1859, choosing Richard Clement Moody as founder of British Columbia. He declined the Crown of Greece in 1862 after King Otto abdicated. He was created Baron Lytton of Knebworth in 1866. His marriage to the writer Rosina Bulwer Lytton broke down. Her detention in an insane asylum provoked a public outcry. Bulwer-Lytton's works sold and paid him well. He coined the phrases \\"the great unwashed\\", \\"pursuit of the almighty dollar\\", \\"the pen is mightier than the sword\\", and \\"dweller on the threshold\\", and the opening phrase \\"It was a dark and stormy night.\\" Yet his standing declined and he is little read today. The sardonic Bulwer-Lytton Fiction Contest, held annually since 1982, claims to seek the \\"opening sentence of the worst of all possible novels\\"."},{"page_url":"https://en.wikipedia.org/wiki/Elasmosaurus","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Elasmosaurus_corrected.jpg","page_title":"Elasmosaurus","context_page_description":"Elasmosaurus is a genus of plesiosaur that lived in North America during the Campanian stage of the Late Cretaceous period, about 80.5 million years ago. The first specimen was discovered in 1867 near Fort Wallace, Kansas, US, and was sent to the American paleontologist Edward Drinker Cope, who named it E. platyurus in 1868. The generic name means \\"thin-plate reptile\\", and the specific name means \\"flat-tailed\\". Cope originally reconstructed the skeleton of Elasmosaurus with the skull at the end of the tail, an error which was made light of by the paleontologist Othniel Charles Marsh, and became part of their \\"Bone Wars\\" rivalry. Only one incomplete Elasmosaurus skeleton is definitely known, consisting of a fragmentary skull, the spine, and the pectoral and pelvic girdles, and a single species is recognized today; other species are now considered invalid or have been moved to other genera.\\nMeasuring 10.3 meters long, Elasmosaurus would have had a streamlined body with paddle-like limbs, a short tail, a small head, and an extremely long neck. The neck alone was around 7.1 meters long."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_overleden_in_1896","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a2/CDelano.jpg","page_title":"Lijst van personen overleden in 1896","context_page_description":"Dit is een lijst van personen die overleden zijn in 1896.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%81%D9%88%D9%86%D8%A7_%D8%A7%DB%8C._%DA%86%D8%A7%D9%85%D8%A8%D8%B1%D8%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Faune-chambers.jpg","page_title":"فونا ای. چامبرز","context_page_description":"فونا ای. چامبرز آمریکالی رقاص، و اوْیونچو"},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Domarin","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4e/Map_commune_FR_insee_code_38149.png","page_title":"Domarin","context_page_description":"Domarin sī ūi-tī Hoat-kok Rhône-Alpes toā-khu Isère séng ê chi̍t ê commune."},{"page_url":"https://es.wikipedia.org/wiki/R%C3%ADo_Sweetwater","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Wpdms_nasa_topo_sweetwater_river_wyoming.jpg","page_title":"Río Sweetwater","context_page_description":"El río Sweetwater es un corto río del Medio Oeste de los Estados Unidos, uno de los principales afluentes del río Platte Norte, que discurre por la parte central de la vertiente oriental de las Montañas Rocosas. Tiene una longitud aproximada de unos 282 km.​\\nAdministrativamente, el río discurre íntegramente por el estado de Wyoming."},{"page_url":"https://fr.wikipedia.org/wiki/Basilique_du_Saint-Esprit_de_Naples","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Oratorio_Bianchi.jpg","page_title":"Basilique du Saint-Esprit de Naples","context_page_description":"La basilique du Saint-Esprit ou complexe du Saint-Esprit est une basilique de Naples située sur la Piazza Sette Settembre, le long de la Via Toledo, en face du Palazzo Doria d'Angri."},{"page_url":"https://de.wikipedia.org/wiki/Uchaux","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3b/Uchaux_%283%29.JPG","page_title":"Uchaux","context_page_description":"Uchaux ist eine südfranzösische Gemeinde mit 1582 Einwohnern im Département Vaucluse in der Region Provence-Alpes-Côte d’Azur. Sie gehört zum Kanton Bollène im Arrondissement Carpentras."},{"page_url":"https://en.wikipedia.org/wiki/Abydos,_Egypt","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Hieroglif_z_Abydos.jpg","page_title":"Abydos, Egypt","context_page_description":"Abydos is one of the oldest cities of ancient Egypt, and also of the eighth nome in Upper Egypt. It is located about 11 kilometres west of the Nile at latitude 26° 10' N, near the modern Egyptian towns of El Araba El Madfuna and El Balyana. In the ancient Egyptian language, the city was called Abdju. The English name Abydos comes from the Greek Ἄβυδος, a name borrowed by Greek geographers from the unrelated city of Abydos on the Hellespont.\\nConsidered one of the most important archaeological sites in Egypt, the sacred city of Abydos was the site of many ancient temples, including Umm el-Qa'ab, a royal necropolis where early pharaohs were entombed. These tombs began to be seen as extremely significant burials and in later times it became desirable to be buried in the area, leading to the growth of the town's importance as a cult site.\\nToday, Abydos is notable for the memorial temple of Seti I, which contains an inscription from the nineteenth dynasty known to the modern world as the Abydos King List. It is a chronological list showing cartouches of most dynastic pharaohs of Egypt from Menes until Seti I's father, Ramesses I."},{"page_url":"https://fi.wikipedia.org/wiki/Tungurahua","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Tungurahua_erupcuion_deciembre.JPG","page_title":"Tungurahua","context_page_description":"Tungurahua on Ecuadorissa sijaitseva aktiivinen tulivuori."},{"page_url":"https://ca.wikipedia.org/wiki/Gregorio_Barbarigo","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Duomo_%28Padua%29_-_Chapel_of_St._Gregorio_Barbarigo.jpg","page_title":"Gregorio Barbarigo","context_page_description":"Gregorio Barbarigo fou un cardenal catòlic, diplomàtic i acadèmic italià. És venerat com a sant per l'Església Catòlica.\\nGregorio Giovanni Gasparo Barbarigo nasqué en Venècia en 1625, en el si d'una família noble, rica i reconeguda a la ciutat. Va rebre una sòlida formació religiosa i intel·lectual. Formà part d'una congregació mariana. Als divuit anys era secretari de l'ambaixador de Venècia, i en 1648 viatjà amb l'ambaixador venecià Alvise Contarini al Congrés de Münster i a les negociacions del Tractat de Westfàlia, que posà fi a la Guerra dels Trenta Anys. Al congrés conegué al nunci apostòlic Fabio Chigi, que l'orientà envers el sacerdoci.\\nCompletà els estudis a la Universitat de Pàdua i fou ordenat sacerdot en 1655, any que fou nomenat canonge de Pàdua i prelat de la Casa Pontifícia per Alexandre VII. Conseller i proper al Papa, formà part del Suprem Tribunal de la Signatura Apostòlica. Entre 1657 i 1664 fou bisbe de Bèrgam, i entre 1664 i 1697 bisbe de Pàdua. En 1660, fou nomenat cardenal-prevere de San Tommaso in Parione, i el 1677 cardenal de San Marco.\\nEn arribar a Bèrgam com a bisbe, ordenà donar als pobres els diners que es volien gastar en la festa de la seva rebuda."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%9B%BD%E9%89%845500%E5%BD%A2%E8%92%B8%E6%B0%97%E6%A9%9F%E9%96%A2%E8%BB%8A","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/33/JGR-5500SLa.jpg","page_title":"国鉄5500形蒸気機関車","context_page_description":"5500形は、1893年から1898年にかけて、イギリスのベイヤー・ピーコック社 で製造され、輸入された蒸気機関車である。"},{"page_url":"https://en.wikipedia.org/wiki/D%C3%B9n_Beic","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Scotland_relief_location_map.jpg","page_title":"Dùn Beic","context_page_description":"Dùn Beic is a dun located on the Inner Hebridean island of Coll. It is located at grid reference NM15495644 and is thought to date to between 1000 BCE to 1000 CE. The etymology of the dun's name is uncertain; one possibility is that it could be made up of a personal name. The dun appears in local legend as being one of several fortresses held by Norsemen, who were defeated in battle against the ancestor of the Macleans of Coll. There have been several archaeological finds at Dùn Beic; these include pieces of flint, burnt bone, and fragments of incised pottery."},{"page_url":"https://en.wikipedia.org/wiki/Anaal_Nathrakh","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Anaal_Nathrakh%2C_Dave_%E2%80%9EV.I.T.R.I.O.L.%E2%80%9C_Hunt_at_Party.San_Metal_Open_Air_2013_07.jpg","page_title":"Anaal Nathrakh","context_page_description":"Anaal Nathrakh are a British extreme metal band formed in 1999 in Birmingham, England. They are currently signed to Metal Blade Records. The band's name is Irish for snake's breath and was taken from Merlin's Charm of Making in John Boorman's 1981 film Excalibur. The band recorded two demos in 1999, which were later released as an album.\\nThe band has released ten studio albums, one EP, and one compilation album. The band has been praised for mixing elements of grindcore, black metal, death metal, industrial, and other genres. The band was created in 1999 by multi-instrumentalist Mick Kenney and vocalist Dave Hunt."},{"page_url":"https://en.wikipedia.org/wiki/Historical_Jewish_population_comparisons","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Jewish_distrib_country.png","page_title":"Historical Jewish population comparisons","context_page_description":"Jewish population centers have shifted tremendously over time, due to the constant streams of Jewish refugees created by expulsions, persecution, and officially sanctioned killing of Jews in various places at various times. In addition, assimilation and forced conversions have also impacted Jewish population sizes throughout Jewish history.\\nThe 20th century saw a large shift in Jewish populations, as a result of large-scale migration to the Americas and to Israel due to pogroms in the Russian Empire followed by the Holocaust. The independence of Israel sparked mass emigrations and expulsions of Jews from the Arab world.\\nToday, the majority of the world's Jewish population is concentrated in two countries, the United States and Israel."},{"page_url":"https://es.wikipedia.org/wiki/Rebeli%C3%B3n_jacobita_de_1689","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Battle_of_Bothwell_Bridge.jpg","page_title":"Rebelión jacobita de 1689","context_page_description":"La rebelión jacobita de 1689 fue la primera de una serie de levantamientos se llevaron a cabo con el objetivo de restaurar a Jacobo II de Inglaterra y VII de Escocia, el pasado monarca católico, y más tarde a sus descendientes de la Casa de Estuardo en el trono de Gran Bretaña, después de que había sido destituido por el Parlamento en la Revolución Gloriosa de 1688. Los partidarios de los exiliados Stuardo eran conocidos como \\"Jacobitas\\" y el movimiento político asociado como Jacobismo."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A9%D7%A2%D7%A8%D7%99_%D7%A6%D7%93%D7%A7_(%D7%A9%D7%9B%D7%95%D7%A0%D7%94)","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/69/%D7%A9%D7%A2%D7%A8%D7%99_%D7%A6%D7%93%D7%A7.JPG","page_title":"שערי צדק (שכונה)","context_page_description":"שכונת שערי צדק היא שכונה קטנה בירושלים, השוכנת בצמוד לרחוב יפו מצפונו, מול מבנה שערי צדק הישן, הקרוי על שם השכונה, וממערב לשכונת מחנה יהודה."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D0%B5%D0%B2%D0%BE%D0%BB%D1%8E%D1%86%D0%B8%D1%8F_1848%E2%80%941849_%D0%B3%D0%BE%D0%B4%D0%BE%D0%B2_%D0%B2_%D0%92%D0%B5%D0%BD%D0%B3%D1%80%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/1848-49_Batthyany-kormany.jpg","page_title":"Революция 1848—1849 годов в Венгрии","context_page_description":"Венгерская революция 1848 года представляла собой локальную версию общеевропейской революции, осложнённой острым кризисом Австрийской империи и ростом национального самосознания венгров. Главными лозунгами венгерской революции были децентрализация Австрийской империи, демократизация и мадьяризация. Движущей силой революции явилось либеральное среднее дворянство и городская интеллигенция. Однако революционная политика венгров натолкнулась на сопротивление славянских народов, чьи интересы не были достаточно учтены, а также российской монархии, которая в росте национального самосознания венгров и других народов увидела угрозу своему существованию. В результате революцию ждало поражение от российских войск. Независимость Венгрии была отложена на 70 лет, а венгры лишились своих позиций в Трансильвании, Словакии и Воеводине."},{"page_url":"https://br.wikipedia.org/wiki/India","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Sacred_lotus_Nelumbo_nucifera.jpg","page_title":"India","context_page_description":"Krogit e-barzh!\\nUn danvez pennad eo ar pennad-mañ ha labour zo d'ober c'hoazh a-raok e beurechuiñ.\\nGallout a rit skoazellañ Wikipedia dre glokaat anezhañ.\\nE Su kevandir Azia emañ Republik India, ent-berr India. Gant Bangladesh ha Pakistan en em led war iskevandir Indez etre aradennad an Himalaya en Norzh ha Meurvor Indez, hemañ o vezañ a-dal d'hec'h aodoù Kornôg ha Reter. Ar 7vet brasañ bro er bed eo hag an eil pobletañ gant 1 210 193 422 a dud, war-dro 1 miliard 200 milion eta."},{"page_url":"https://ceb.wikipedia.org/wiki/Bosque_Farms","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Municipal_Complex%2C_Bosque_Farms_NM.jpg","page_title":"Bosque Farms","context_page_description":"Lungsod ang Bosque Farms sa Tinipong Bansa. Ang Bosque Farms nahimutang sa kondado sa Valencia County ug estado sa New Mexico, sa sentro nga bahin sa nasod, 2,700 km sa kasadpan sa ulohang dakbayan Washington, D.C. 1,483 metros ibabaw sa dagat kahaboga ang nahimutangan sa Bosque Farms, ug adunay 3,904 ka molupyo.\\nAng yuta palibot sa Bosque Farms kay kasagaran hataas nga gitas patag. Bosque Farms nahimutang sa usa ka walog nga mihatag og sa amihanan-habagatan nga direksyon. Kinahabogang dapit sa palibot ang El Cerro De Los Lunas, 1,804 ka metros ni kahaboga ibabaw sa dagat, 10.4 km sa habagatan-kasadpan sa Bosque Farms. Dunay mga 40 ka tawo kada kilometro kwadrado sa palibot sa Bosque Farms medyo gamay nga populasyon. Ang kinadul-ang mas dakong lungsod mao ang Los Lunas, 6.0 km sa habagatan sa Bosque Farms. Hapit nalukop sa kaumahan ang palibot sa Bosque Farms. Sa rehiyon palibot sa Bosque Farms, mga kanal, ug mga kapanguhaan talagsaon komon.\\nAng klima bugnaw nga ugahon. Ang kasarangang giiniton 18 °C. Ang kinainitan nga bulan Hunyo, sa 31 °C, ug ang kinabugnawan Disyembre, sa 3 °C. Ang kasarangang pag-ulan 297 milimetro matag tuig."},{"page_url":"https://nl.wikipedia.org/wiki/Alpenovereenkomst","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Logo_Alpine_Convention.jpg","page_title":"Alpenovereenkomst","context_page_description":"De Alpenovereenkomst is een internationaal verdrag dat bedoeld is om de duurzame ontwikkeling van de Alpen garanderen. Het was een initiatief van de Europese Unie en de acht landen in de regio. Het verdrag is voor ondertekening opengesteld in 1991 en trad in werking in 1995. Doelstellingen bestaan uit bescherming van het milieu, het behoud van culturele tradities, evenals uitgebreide ontwikkeling. De doelstellingen worden gehaald aan de hand van specifieke protocollen, die rekening houden met de regionale samenwerking over de landsgrenzen heen."},{"page_url":"https://bar.wikipedia.org/wiki/Beziak_Neinkiachn","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Ternitz_im_Bezirk_NK.PNG","page_title":"Beziak Neinkiachn","context_page_description":"Da Beziak Neinkiachn is im sidlichn Niedaöstareich, an da Grenz ins Steirische."},{"page_url":"https://gl.wikipedia.org/wiki/Torres_de_Quart","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b3/Torres_de_Quart.jpg","page_title":"Torres de Quart","context_page_description":"As Torres de Quart ou Porta de Quart é un portal que formaba parte da muralla medieval que envolvía a Ciutat Vella de Valencia, para defendela. Están situades na encrucillada da rúa de Guillem de Castro coa rúa de Quart.\\nA Porta de Quart debe o seu nome ao feito de que se atopa no camiño que dende o centro da cidade, onde está a Catedral de Valencia, cara a Quart de Poblet. Esta porta era o acceso poñente á cidade, o que proviña do oeste e Castela. Despois de ser derrubada a muralla durante a segunda metade do século XIX, portal de Quart queda exento, e pasa a ser coñecido coma as torres de Quart, que é o nome máis empregado hoxe en día para designala."},{"page_url":"https://fr.wikipedia.org/wiki/Jaume_Cabr%C3%A9","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/04/Jaume_Cabr%C3%A9.jpg","page_title":"Jaume Cabré","context_page_description":"Jaume Cabré i Fabré, né le 30 avril 1947 à Barcelone, est un philologue, écrivain et scénariste espagnol d'expression catalane."},{"page_url":"https://es.wikipedia.org/wiki/Piedigrotta","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Napolo%2C_Maria_di_Piedigrotta%2C_10.jpeg","page_title":"Piedigrotta","context_page_description":"Piedigrotta es una zona de la ciudad de Nápoles perteneciente al barrio de Chiaia, situada entre Fuorigrotta, la Piazza Sannazaro y la estación de ferrocarril de Mergellina."},{"page_url":"https://pt.wikipedia.org/wiki/Hyrum_Smith","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/07/Hyrum_Smith_ca_1880-1920.png","page_title":"Hyrum Smith","context_page_description":"Hyrum Smith foi um religioso estadunidense. Era o irmão mais velho de Joseph Smith Jr., fundador do movimento dos Santos dos Últimos Dias. Hyrum foi um dos líderes de A Igreja de Jesus Cristo dos Santos dos Últimos Dias nos seus primórdios e uma das oito testemunhas do Livro de Mórmon. Morreu na cadeia, assassinado no levante popular contra seu irmão Joseph.\\nSeus descendentes desempenharam papéis importantes no desenvolvimento da Igreja de Jesus Cristo dos Santos dos Últimos Dias. Seu filho Joseph Fielding Smith foi presidente da igreja, assim como seu neto também chamado Joseph Fielding Smith."},{"page_url":"https://pl.wikipedia.org/wiki/Obsada_serii_film%C3%B3w_Harry_Potter","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Daniel_Radcliffe_SDCC_2014.jpg","page_title":"Obsada serii filmów Harry Potter","context_page_description":"Obsada serii filmów Harry Potter – obsada brytyjsko-amerykańskiej serii filmowej Harry Potter. Cykl obejmuje osiem filmów studia Warner Bros. z lat 2001–2011, powstałych na podstawie serii powieści J.K. Rowling pod tym samym tytułem. Artykuł przedstawia obsadę filmów oraz obsadę polskojęzycznej wersji językowej w dubbingu."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%86%D8%B3%D9%84%E2%80%8C%DA%A9%D8%B4%DB%8C_%D8%A7%D8%B1%D9%85%D9%86%DB%8C%E2%80%8C%D9%87%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Armenian_woman_kneeling_beside_dead_child_in_field.png","page_title":"نسل‌کشی ارمنی‌ها","context_page_description":"نسل‌کشی ارمنی‌ها که گاهی با نام‌های دیگری چون هولوکاست ارامنه، کشتار ارامنه و نیز توسط خود ارمنی‌ها با عنوان جنایت بزرگ شناخته می‌شود، به نابودی عمدی و از پیش برنامه‌ریزی شده جمعیت ارمنی ساکن سرزمین‌های زیر کنترل امپراتوری عثمانی در دوران جنگ جهانی اول توسط دولتمردان عثمانی و رهبران قیام ترکان جوان گفته می‌شود. عملیات در قالب کشتارهای دسته‌جمعی و نیز تبعیدهای اجباری در شرایطی که موجبات مرگ تبعیدشدگان را فراهم آورد، انجام می‌پذیرفت. امروزه تعداد کل قربانیان نسل‌کشی ارمنیان بین یک تا یک و نیم میلیون نفر برآورد شده‌است. در طی این دوران دیگر گروه‌های قومی منطقه، از جمله آشوریان، یونانیان و کردها نیز به طریقی مشابه مورد حملهٔ ترکان عثمانی قرار گرفتند؛ به گونه‌ای که بسیاری از محققان این رویدادها را نیز بخشی از همان سیاست نابودسازی قومی دولت‌مردان تُرک دانسته‌اند. امروزه این رویداد به‌طور گسترده به عنوان یکی از اولین نسل‌کشی‌های سده بیستم شناخته می‌شود.\\nعلاوه بر دستگیری و اعدام ارمنی‌ها، جمعیت بسیار زیادی از مردان، زنان و کودکان ارمنی از خانه و کاشانه خود تبعید، بدون هیچ دسترسی به آب\\nو غذا به قصد مرگ وادار به راهپیمایی در مسیرهای طولانی و بیابانی شدند. تجاوز و آزار و اذیت جنسی قربانیان توسط نیروهای متخاصم در طول تبعید به دفعات گزارش شده‌است."},{"page_url":"https://fr.wikipedia.org/wiki/Kerlouan","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Kerlouan_6_Rochers_pr%C3%A8s_de_Kerzenval.JPG","page_title":"Kerlouan","context_page_description":"Kerlouan [kɛʁluɑ̃] est une commune du département du Finistère, dans la région Bretagne, en France."},{"page_url":"https://en.wikipedia.org/wiki/Citro%C3%ABn_Xsara_WRC","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Jes%C3%BAs_Puras_-_1998_Rallye_Villa_de_Llanes.jpg","page_title":"Citroën Xsara WRC","context_page_description":"The Citroën Xsara WRC is a World Rally Car built for the Citroën World Rally Team by Citroën Racing to compete in the World Rally Championship. It is based upon the Citroën Xsara road car. The car was introduced for the 2001 World Rally Championship season and has taken first three of nine drivers' titles for Sébastien Loeb, as well as the manufacturers' title in 2003, 2004, and 2005."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E6%9D%B1%E9%83%A8%E7%99%BC%E9%9B%BB%E5%BB%A0%E6%B0%B4%E7%B0%BE%E6%A9%9F%E7%B5%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Shui-Lien_Power_Plant04.jpg","page_title":"東部發電廠水簾機組","context_page_description":"东部发电厂水帘机组，为一座位于台湾花莲县秀林乡水帘坝北岸山腹内的小型惯常式- 川流式水力发电厂，邻近龙涧发电厂，由台湾电力公司东部发电厂所管辖，旧称为水帘发电厂，后于2001年台电公司组织改造后，全名改名为台湾电力公司东部发电厂水帘机组。。"},{"page_url":"https://he.wikipedia.org/wiki/%D7%93%D7%99%D7%99%D7%9C_%D7%90%D7%95%D7%95%D7%99%D7%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Flight_Attendants_with_President_George_W._Bush_at_Chicago%27s_O%27Hare_International_Airport.jpg","page_title":"דייל אוויר","context_page_description":"דייל במטוס נוסעים, הוא איש צוות אוויר בחברת תעופה, הממונה על בטיחותם ורווחתם של הנוסעים, ועל מתן מידע ושירותים שונים להם."},{"page_url":"https://tr.wikipedia.org/wiki/Levant","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/A%29_Prince_of_Lebanon%2C_Moslem_of_Damascus.jpg","page_title":"Levant","context_page_description":"Levant, Akdeniz'in doğu sahillerinde bulunan geniş bir araziyi tanımlamak için kullanılan, sınırları kesin olmayan, coğrafî, tarihî ve kültürel bir adlandırma. Genel olarak tarih süreci içerisinde Toros Dağları'nın güneyinde, Orta Doğu'da geniş bir alanı belirtmektedir. Batısında Akdeniz, güneyinde Arabistan Çölü ve doğusunda Mezopotamya ile sınırlanmıştır. Levant Kafkasya Dağları'nı, Arap Yarımadası'nın belirli bir parçasını ve -her ne kadar kimi kaynaklarda Kilikya dahil edilse de- Anadolu'yu içermez. Sina Yarımadası, Levant ile Mısır arasında bir kara köprüsü oluşturduğundan dışarıda tutulabilir. Zamanla Levant insanı ve kültürü Sina ve Nil Nehri arasındaki bölgeye egemen olmuş olsa da, bu bölge coğrafi Levant'ı tam olarak karşılamaz.\\nDar anlamda Lübnan ve Filistin ile sınırlandırabileceğimiz Levant, Osmanlı dönemindeki karşılığıyla Bilâdü'ş-Şâm yani Şam Vilayeti'dir, bu da Şam kenti ve yakın Akdeniz kıyısındaki beldeleri içerir. Fakat bu tabir ne Hatay'ı ne de Suriye'nin Akdeniz kıyılarını kapsar. Bu açıdan bir diğer dar görüştür. Geniş anlamda ise İtalya'nın doğusundaki Doğu Akdeniz Havzası 'nın tamamını tanımlamak için kullanılır."},{"page_url":"https://az.wikipedia.org/wiki/S%C9%99kkizminlikl%C9%99r","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Kangchenjunga.JPG","page_title":"Səkkizminliklər","context_page_description":"Səkkizminliklər — Yer planetində yerləşən və hündürlüyü dəniz səviyyəsindən 8000 metrdən çox yüksəklikdə olan 14 dağ zirvəsi. Bütün səkkizminlik dağlar Asiyada Himalay və Karakorum dağ silsilələrində yerləşir. Bu zirvələrin hər biri ölüm zonasında yerləşir.\\nİlk dəfə səkkizminlik zirvəni Pakistanın Nanqa Parbat dağında Albert Mameri və Norman Koli 1895-ci ildə fəth etməyə cəhd edib. Ancaq bu cəhd qar uçqunu nəticəsində Mammeri və Raghobir Thampa və Goman Singh adlı iki Gurkhanın ölümü ilə nəticələndi və zirvə fəth edilə bilmədi.\\nİlk dəfə olaraq uğurlu birinci səkkizminliyi fəth etmə cəhdi Moris Ersoq və Lui Laşenalın 3 iyun 1950-ci ildə Annapurna zirvəsinin fəth etməsi oldu.\\nHündürlüyü 8000 metrdən çox olan 14 zirvənin hamısını fəth etmiş birinci şəxs Raynhold Messner olub. O bu tapşırığın öhdəsindən 16 oktyabr 1986-cı ildə gəldi. 1 il sonra 1987-ci ildə Eji Kukuçka 14 hündürlüyü 8000 metrdən çox olan bütün zirvələri fəth edən ikinci şəxs oldu. Messner 14 zirvənin hər birini oksigen balonu olmadan fəth edib. Bu nailiyyət 9 il sonra 1995-ci ildə Erhard Loretan tərəfindən təkrarlandı."},{"page_url":"https://cs.wikipedia.org/wiki/Vjezd_gladi%C3%A1tor%C5%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Julius_fucik.jpg","page_title":"Vjezd gladiátorů","context_page_description":"Vjezd gladiátorů je jeden z nejznámějších pochodů na světě, nejslavnější dílo českého hudebního skladatele Julia Fučíka. Fučík skladbu napsal jako vojenský pochod roku 1897. Ve Spojených státech ji zpopularizoval kanadský skladatel Louis-Phillipe Laurendeau, který pochod upravil a vydal pod názvem Thunder and Blazes. Tato verze začala být masivně užívána v cirkusech, zejména při nástupu klaunů. V důsledku toho se Fučíkova melodie stala jednou z nejznámějších na světě, byť původní autor zůstával neznámý. Další úpravu provedl italský skladatel Nino Rota pro Felliniho televizní film Klauni, proto také je v Itálii Rota často uváděn jako autor této světoznámé melodie. Užití v souvislosti s klauny je kuriózní v tom, že Fučík skladbu spojil s představou triumfálního nástupu starořímských gladiátorů do arény. Tuto představu načerpal ze svého dlouholetého zájmu o antickou kulturu a obdivu k ní."},{"page_url":"https://it.wikipedia.org/wiki/H%C3%BCtten_(Schleswig-Holstein)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/H%C3%BCtten_Kirche_1984.jpg","page_title":"Hütten (Schleswig-Holstein)","context_page_description":"Hütten è un comune di 203 abitanti dello Schleswig-Holstein, in Germania.\\nAppartiene al circondario di Rendsburg-Eckernförde ed è parte della comunità amministrativa di Hüttener Berge."},{"page_url":"https://en.wikipedia.org/wiki/Tehrik-i-Taliban_Pakistan","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Variant_flag_of_the_Islamic_State.svg","page_title":"Tehrik-i-Taliban Pakistan","context_page_description":"Tehrik-i-Taliban in Pakistan, alternatively referred to as the Pakistani Taliban, is a radical terrorist armed group which is an umbrella organization of various militant groups based along the Afghan–Pakistani border. Most Taliban groups in Pakistan coalesce under the TTP. In December 2007 about 13 groups united under the leadership of Baitullah Mehsud to form the Tehrik-i-Taliban. Among the stated objectives of Tehrik-i-Taliban is resistance against the Pakistani state. The TTP's aim is to overthrow the government of Pakistan by waging a terrorist campaign against the Pakistan armed forces and the state. The TTP depends on the tribal belt along the Afghanistan-Pakistan border from which to draw its recruits. The TTP draws ideological guidance from al-Qaeda and maintains ties with al-Qaeda.\\nMany of the militants belonging to the TTP were killed as result of the military operations conducted by the Pakistan Armed Forces to destroy TTP infrastructure and support in Pakistan. However, some of the TTP militants escaped into Afghanistan through the ungoverned areas of Afghanistan–Pakistan border."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D1%80%D0%BE%D0%B1%D0%BD%D0%B5%D1%80,_%D0%91%D0%BE%D0%BB%D0%B5%D1%81%D0%BB%D0%B0%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Boles%C5%82aw_Drobner_-_signature.png","page_title":"Дробнер, Болеслав","context_page_description":"Болеслав Дробнер — польский политический и государственный деятель, революционер, публицист. Первый послевоенный президент Вроцлава."},{"page_url":"https://pl.wikipedia.org/wiki/K%C5%82okoczka_po%C5%82udniowa","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Illustration_Staphylea_pinnata0.jpg","page_title":"Kłokoczka południowa","context_page_description":"Kłokoczka południowa – gatunek rośliny z rodziny kłokoczkowatych. Pochodzi ze środkowej i południowej Europy, oraz Azji Mniejszej. Występuje rzadko w południowej Polsce, jest także uprawiany."},{"page_url":"https://nl.wikipedia.org/wiki/%C3%9Ajk%C3%A9r","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/%C3%9Ajk%C3%A9r_ker%C3%A1mia_manufakt%C3%BAra.JPG","page_title":"Újkér","context_page_description":"Újkér is een plaats en gemeente in het Hongaarse comitaat Győr-Moson-Sopron. Újkér telt 977 inwoners."},{"page_url":"https://fr.wikipedia.org/wiki/Sherlock_Holmes_(pi%C3%A8ce_de_th%C3%A9%C3%A2tre)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/H._A._Saintsbury_as_Holmes.png","page_title":"Sherlock Holmes (pièce de théâtre)","context_page_description":"Sherlock Holmes est une pièce de théâtre en quatre actes écrite par William Gillette et créée en 1899 à New York. La pièce raconte une nouvelle enquête du détective Sherlock Holmes, dont certaines séquences sont inspirées d'aventures du canon holmésien, notamment Un scandale en Bohême, Le Dernier Problème et Une étude en rouge. Le détective Sherlock Holmes est joué par William Gillette lors des premières représentations.\\nL'accueil critique de Sherlock Holmes est très favorable et la pièce est représentée à de nombreuses reprises dans différents pays pendant plusieurs décennies. L'œuvre a par la suite été adaptée au cinéma, à la radio, à la télévision et en bande dessinée.\\nTraduite par Pierre Decourcelle, la pièce est publiée en français en 1907 aux éditions Pierre Lafitte. Cette traduction diffère sensiblement de la version originale : certains personnages changent de nom, la pièce est redécoupée en cinq actes et propose une fin différente de celle d'origine, s'inspirant de La Maison vide.\\nCette pièce de théâtre n'étant pas écrite par Arthur Conan Doyle, elle n'est pas considérée comme faisant partie du canon holmésien."},{"page_url":"https://nn.wikipedia.org/wiki/Hyperbolsk_funksjon","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Csch_sech_coth.svg","page_title":"Hyperbolsk funksjon","context_page_description":"Ein hyperbolsk funksjon er funksjonane sinh, cosh, tanh, coth, sech og csch.\\nHer er e grunntalet i det naturlege logaritmesystemet.\\nDei hyperbolske funksjonane har eigenskapar som er analoge med dei trigonometriske funksjonane. På same måte som og kan nyttast til å parametrisere ein sirkel, kan dei hyperbolske funksjonane og parametrisere ein hyperbel."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%B1%B1%E6%9C%AC%E5%86%AC%E9%83%B7","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/T%C5%8Dg%C5%8D_Yamamoto_Sono_yo_no_tsuma_%281930%29.jpg","page_title":"山本冬郷","context_page_description":"山本 冬郷は、日本の俳優である。本名は山本 鎌蔵。"},{"page_url":"https://en.wikipedia.org/wiki/Narcissus_in_culture","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Field_of_Narcissuses_-_20070502.jpg","page_title":"Narcissus in culture","context_page_description":"Long celebrated in art and literature, narcissi are associated with a number of themes in different cultures, ranging from death to good fortune, and as symbols of Spring. The daffodil is the national flower of Wales associated with St. David's Day. In other cultures it many be associated with wealth, good fortune and beauty. Because of the time that it flowers it is also a symbol of Spring, and associated religious festivals such as Easter, hence the use of Lent lily or in German, Easter bells, amongst its common names. The appearance of the wild flowers in spring is also associated with festivals in many places. While prized for its ornamental value, there is also an ancient cultural association with death, at least for pure white forms.\\nHistorically the narcissus has appeared in written and visual arts since antiquity, being found in graves from Ancient Egypt. In classical Graeco-Roman literature the narcissus is associated with both the myth of the youth who was turned into a flower of that time, and with the Goddess Persephone, snatched into the underworld as she gathered their blooms. Narcissi were said to grow in meadows in the underworld."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stra%C3%9Fen_und_Pl%C3%A4tze_in_Berlin-Friedenau","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Perelsplatz_Bistro2.JPG","page_title":"Liste der Straßen und Plätze in Berlin-Friedenau","context_page_description":"Die Liste der Straßen und Plätze in Berlin-Friedenau beschreibt das Straßensystem im Berliner Ortsteil Friedenau mit den entsprechenden historischen Bezügen. Gleichzeitig ist diese Zusammenstellung ein Teil der Listen aller Berliner Straßen und Plätze."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%B0%91%E5%B9%B4%E5%AE%AE%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Shenzhen_Metro_Line_3%264_Children%27s_Palace_Sta_Exit_C1.jpg","page_title":"少年宮站","context_page_description":"少年宮站是深圳地鐵4號綫和3號綫的換乘站。地處市民中心後花園，位於蓮花山的南側。該站主體位於中國廣東省深圳市福田區紅荔路與鵬城四路的交匯路口的地下，3號線車站在紅荔路道路下面，沿紅荔路呈東西走向；4號線車站在鵬城四路道路下面，沿鵬城四路呈南北走向，車站的南北方向位於紅荔路與福中一路之間，車站的東側是深圳少年宮，西側是深圳書城中心城，4號線月台位於深圳市中心區中軸線以東。少年宮站在2011年清湖站啟用以前，是4號綫北面總站。在2010年12月28日深圳地鐵3號綫通車前亦曾為深圳地鐵系統中最北的車站。"},{"page_url":"https://sr.wikipedia.org/wiki/%D0%91%D0%B5%D1%80%D0%BC%D0%B5%D1%85%D0%BE","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b2/Rio_bermejo%28pcia._roca_-chaco%29-.jpg","page_title":"Бермехо","context_page_description":"Бермехо је река у Јужној Америци у региону Гран Чако. Извире на Андима у планинском венцу Сијера де Санта Викторија у јужном делу Боливије. Дугачак је 1.060 km и највећим делом тече кроз Аргентину у правцу југоистока. Прима неколико притока међу којима су Липео и Сан Франсиско. Након извора река формира мочвару и из ње истичу два тока, јужни познат под имено Стари Бермехо или Бермехито и северни познат као Теуко. У доњем делу тока пре ушћа ове две реке се спајају у јединствени Бермехо, који се улива у Парагвај."},{"page_url":"https://no.wikipedia.org/wiki/Liste_over_norske_geografiske_ytterpunkter","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1f/Knivskjellodden_2005-07-18.JPG","page_title":"Liste over norske geografiske ytterpunkter","context_page_description":"Oversikt over norske geografiske ytterpunkter er en liste over største og minste avstander og andre norske geografiske ytterpunkter."},{"page_url":"https://en.wikipedia.org/wiki/Gorsial","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Forestingorsial.JPG","page_title":"Gorsial","context_page_description":"Gorsial is a village of Tehsil Shakargarh, Narowal District. Its population is about 5000. It is a Union council.[clarification needed]. It is located near badwal forest which surrounds the village from south side.Village has primary schools for boys and girls. Literacy rate is significantly high.[vague] Village has rich agriculture base. Rice, wheat, cane and, millet are important crops.A water tunnel surrounds the village on north to west sides, while open fields are present on the eastern side. Village lacks the basic facilities. No Primary Health Centre and High School are present. Most of its inhabitants have joined armed forces and a significant number of people have gone to abroad for earning purposes.\\nCricket, volleyball and soccer are most played games here. Shrines of Baba Lal Hussain Shah Bukhari and Baba Peer Shah are popular sacred places among the people of the village. Paa Hashim and Baba Shahab were the notable agri advisers, significant farmers and selfmade figures of the village. Baba Shafi, late was one of the most popular religious man and was famous with the title of Key Of The Heaven."},{"page_url":"https://sv.wikipedia.org/wiki/Lycaena_cyna","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Cyna_blue_%28Zizula_cyna%29%2C_ventral.jpg","page_title":"Lycaena cyna","context_page_description":"Lycaena cyna är en fjärilsart som beskrevs av Edwards 1882. Lycaena cyna ingår i släktet Lycaena och familjen juvelvingar. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://pl.wikipedia.org/wiki/Huta_Pieniacka","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/be/HutaPieniacka-2.jpg","page_title":"Huta Pieniacka","context_page_description":"Huta Pieniacka – wyludniona wieś na Ukrainie, w obwodzie lwowskim, w rejonie brodzkim, od 1919 do 1945 roku w Polsce, od grudnia 1920 w województwie tarnopolskim, w powiecie brodzkim, w gminie Pieniaki.\\nHuta Pieniacka leży w odległości 5 km na północny zachód od Pieniak."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%A8%E0%AE%BF%E0%AE%B1%E0%AE%95%E0%AF%8D%E0%AE%95%E0%AF%8B%E0%AE%B2%E0%AE%AE%E0%AF%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/A_scene_of_colour_powder.JPG","page_title":"நிறக்கோலம்","context_page_description":"நிறக்கோலம் அல்லது வண்ணக்கோலம் என்பது இந்தியத் துணைக்கண்டத்தின் பல பகுதிகளிலும் பயிலப்பட்டு வரும் மரபுவழிக் கலைகளுள் ஒன்று ஆகும். தரையில் கோட்டுருக்கள் அல்லது கோலங்களை வரைந்து அதற்குப் பல்வேறு நிறப் பொடிகள் அல்லது பிற பொருட்களைக் கொண்டு நிறமூட்டி அழகுபடுத்துவர். நிறக்கோலத்தின் ஒரு பகுதியாகத் சிறு விளக்குகளையும் ஏற்றி வைப்பதும் உண்டு. தமிழ்நாட்டில் கோலம் என்று வழங்கப்படும் மரபுவழிக் கலை இதற்கு நெருங்கியதாயினும், தமிழ்நாட்டுக் கோலங்களுக்கு நிறமூட்டுவது இல்லை. இவை கோட்டுருக்களாகவே வரையப்பட்டு வருவதுடன் கோலமிடும் நுட்பங்களிலும் சில வேறுபாடுகள் உண்டு"},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%99%D7%A6%D7%95%D7%91%D7%99%D7%A9%D7%99_%D7%A1%D7%99%D7%92%D7%9E%D7%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/1982_Mitsubishi_Sigma_%28GJ%29_GL_Satellite_sedan_%2828694234015%29.jpg","page_title":"מיצובישי סיגמא","context_page_description":"מיצובישי סיגמא היא מכונית סלון, ומכונית משפחתית גדולה מתוצרת התאגיד הרב-לאומי מיצובישי מוטורס היפני, אשר יוצרה בין השנים 1976–1990 ביפן.\\n\\"מיצובושי מוטורס\\" ניצלה את דגם \\"מיצובישי סיגמא\\" במספר כלי רכב שונים המבוססים על הדגמים: \\"Mitsubishi Galant\\" ו-\\"מיצובישי דיאמנטה\\" אשר נמכרו בשווקים שונים בתקופה זו.\\nכל גרסאות ה\\"מיצובישי סיגמא\\" יוצרו בין השנים 1976–1996."},{"page_url":"https://pl.wikipedia.org/wiki/Ursus_5714","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d8/5714SPS06.jpg","page_title":"Ursus 5714","context_page_description":"Ursus 5714 – ciężki ciągnik postlicencyjny z napędem na 4 koła produkowany w latach 2002-2009 przez ZPC Ursus."},{"page_url":"https://cs.wikipedia.org/wiki/Vladimirsko-suzdalsk%C3%A9_kn%C3%AD%C5%BEectv%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Vladimirskaya.jpg","page_title":"Vladimirsko-suzdalské knížectví","context_page_description":"Vladimirsko-suzdalské knížectví, později veliké knížectví vladimirské, byl historický státní útvar, který se ve středověku rozkládal na severovýchodní Rusi."},{"page_url":"https://it.wikipedia.org/wiki/Heap_(struttura_dati)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Max-Heap.svg","page_title":"Heap (struttura dati)","context_page_description":"In informatica, un heap è una struttura dati basata sugli alberi che soddisfa la \\"proprietà di heap\\": se A è un genitore di B, allora la chiave di A è ordinata rispetto alla chiave di B conformemente alla relazione d'ordine applicata all'intero heap. Di conseguenza, gli heap possono essere suddivisi in \\"max heap\\" e \\"min heap\\". In un max heap, le chiavi di ciascun nodo sono sempre maggiori o uguali di quelle dei figli, e la chiave dal valore massimo appartiene alla radice. In un min heap, le chiavi di ciascun nodo sono sempre minori o uguali di quelle dei figli, e la chiave dal valore minimo appartiene alla radice.\\nQuindi, dato un heap v ed un indice di posizione j, v si dice\\nmin-heap: se\\nmax-heap: se\\nIn questo modo si garantisce che compiendo un qualsiasi percorso che parte da un nodo dell'albero e scendendo nella struttura verso le foglie, si attraversano nodi con chiave sempre maggiore della l'ultima foglia visitata. La scelta di utilizzare un tipo di heap anziché l'altro è data dal tipo di impiego che se ne vuole fare."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%B2%A7%E7%AA%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Oxfam_East_Africa_-_Luli_looks_after_her_severely_malnourished_child_Aden.jpg","page_title":"貧窮","context_page_description":"貧窮是個很廣泛的觀念，沒有絕對的定義。在中文裡，貧、窮兩字本解作「極度不足」，滿足與否則是個很個人的感覺。不過，現代的貧窮不限於錢財方面的不足，貧窮可形容人類一般生活情況非常困難、資源短缺。有些人認為貧窮的定義是主觀、具比較性的。貧窮可能會包括社會、經濟及政治上的概念。而極端貧窮或是絕對貧窮是指完全沒有滿足基本需求所需的物資，例如食物、服裝及住房等。\\n絕對貧窮的基準一般會是固定的，不會隨個人居住的國家或地區而不同。而相對貧窮是指一個人的生活水平無法維持在同一國家其他人的最低水準。因此相對貧窮的基準會隨國家而不同，也會隨社會而不同。\\n各國所能提供的基本需要會受到各國政府施政的限制或不足而受到影響，例如貪污、節稅、國家債務及貸款條件性，也會受到醫學或是教育專業人士的人才外流所影響。提高所得讓更多人可以滿足基本需求的策略包括福利、經濟自由或是提到金融服務。\\n扶助貧窮，減少貧窮人口仍然是許多國際組織的主要目標之一。"},{"page_url":"https://de.wikipedia.org/wiki/Leichtathletik-Weltmeisterschaften_1997/10.000_m_der_M%C3%A4nner","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Haile_Gebrselassie_at_Vienna_City_Marathon_2011.jpg","page_title":"Leichtathletik-Weltmeisterschaften 1997/10.000 m der Männer","context_page_description":"Der 10.000-Meter-Lauf der Männer bei den Leichtathletik-Weltmeisterschaften 1997 wurde am 3. und 6. August 1997 im Olympiastadion der griechischen Hauptstadt Athen ausgetragen.\\nSeinen dritten Titel in Folge errang der äthiopische Olympiasieger von 1996 Haile Gebrselassie, der 1993 auch Vizeweltmeister über 5000 Meter war. Den zweiten Rang belegte sein kenianischer Dauerrivale Paul Tergat, der 1995 WM-Dritter und 1996 Olympiazweiter war. Bronze ging an den marokkanischen Olympiadritten von 1996 Salah Hissou.\\nHier gab es auf den ersten drei Plätzen dieselbe Rangfolge wie ein Jahr zuvor bei den Olympischen Spielen. Weltmeister Haile Gebrselassie legte die erste Streckenhälfte in 13:59,5 min, die zweite dann in 13:25,1 min zurück. Den letzten Kilometer lief er in 2:30,7 min, die letzten vierhundert Meter in 56,0 s. Der zweitplatzierte Paul Tergat erzielte auf der letzten Runde sogar 55,2 s, doch sein Rückstand war vorher schon zu groß, um den enteilten Äthiopier noch zu gefährden."},{"page_url":"https://it.wikipedia.org/wiki/Ordine_dell%27Unione","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Lodewijk_Napoleon_Koning_van_Holland.jpg","page_title":"Ordine dell'Unione","context_page_description":"L'Ordine dell'Unione, fu un ordine cavalleresco del Regno d'Olanda."},{"page_url":"https://he.wikipedia.org/wiki/%D7%AA%D7%97%D7%A0%D7%AA_%D7%94%D7%97%D7%9C%D7%9C_%D7%94%D7%91%D7%99%D7%A0%D7%9C%D7%90%D7%95%D7%9E%D7%99%D7%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Poisk.Jpeg","page_title":"תחנת החלל הבינלאומית","context_page_description":"תחנת החלל הבינלאומית היא לוויין מלאכותי מאויש המקיף את כדור הארץ במסלול לווייני נמוך ומשמש כתחנת מחקר. תחנת החלל נמצאת בגובה ממוצע של 400 קילומטר וממומנת על ידי חמש סוכנויות חלל שונות: נאס\\"א, רוסקוסמוס, הסוכנות היפנית לחקר החלל, סוכנות החלל הקנדית וסוכנות החלל האירופית.\\nבניית תחנת החלל החלה בנובמבר 1998 עם הצבת היחידה הראשונה, זאריה. התחנה תוכננה לפעול לכל הפחות עד שנת 2020 ולכל היותר עד 2028.\\nניתן לראות את התחנה מכדור הארץ בעין בלתי מזוינת כנקודת אור הנעה על פני השמיים בזמנים מסוימים."},{"page_url":"https://de.wikipedia.org/wiki/Hurrikan","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Hurricane_Dennis_on_July_7_2005_1550_UTC.jpg","page_title":"Hurrikan","context_page_description":"Hurrikan wird ein tropischer Wirbelsturm im nördlichen atlantischen Ozean sowie im Nordpazifik östlich von 180° Länge und im Südpazifik östlich von 160° Ost genannt. Dieser muss mindestens Orkanstärke erreichen, also Windstärke 12 auf der Beaufortskala. Hurrikane entstehen in der Regel zwischen Mai und Dezember, die meisten davon zwischen Juli und September. Die offizielle Hurrikansaison dauert im Atlantischen Ozean und im zentralen Nordpazifik vom 1. Juni bis zum 30. November, im östlichen Nordpazifik beginnt sie bereits am 15. Mai."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AC%D9%88%D8%A7%D8%AF_%D8%AD%D8%AC%D8%A7%D8%B2%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/%D8%AC%D9%88%D8%A7%D8%AF_%D8%AD%D8%AC%D8%A7%D8%B2%D9%8A.jpg","page_title":"جواد حجازي","context_page_description":"جواد حجازي\\nاسمه بالكامل عبد الجواد أحمد محمد حجازي، المعروف ب جواد حجازي\\nفنان و رسام كارياتير مصري وله العديد من القصص القصيرة وقصص الأطفال\\nحاصل على بكالوريوس التربية من \\"المعهد العالى للتربية الفنية للمعلمين\\"والمعروف حاليا ب كلية التربية الفنية بجامعة حلوان\\nحاصل على دبلومة الفنون الجميلة القسم الحر جامعة القاهرةعام 1965م\\nحاصل على دبلومة في الإخراج المسرحي من المعهد العالي للفنون المسرحية\\nكان له باع طويل في مسرح العرائس بمصر وحصل على العديد من الجوائز التشجيعية وشهادات التقدير من الدولة في هذا المجال."},{"page_url":"https://ca.wikipedia.org/wiki/Another_Brick_in_the_Wall","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e8/Roger_Waters_concert_11.jpg","page_title":"Another Brick in the Wall","context_page_description":"«Another Brick in the Wall» és el títol de tres cançons del grup britànic de rock progressiu Pink Floyd, compostes pel baixista de la banda Roger Waters. Les tres parts van ser incloses en l'àlbum The Wall, editat el 1979. Està dividida en tres parts, Part 1, Part 2 i Part 3 respectivament, i són fonamentals en el concepte de l'àlbum, tal com s'evidencia en el fet que és darrere la paret a la que es retira Pink, el personatge principal de l'àlbum."},{"page_url":"https://en.wikipedia.org/wiki/Aermacchi_MB-326","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7e/Royal_Australian_Air_Force_-_A7-043_-_CAC_CA-30_Macchi_MB-326H.jpg","page_title":"Aermacchi MB-326","context_page_description":"The Aermacchi or Macchi MB-326 is a light military jet trainer designed in Italy. Originally conceived as a two-seat trainer, there have also been single and two-seat light attack versions produced. It is one of the most commercially successful aircraft of its type, being bought by more than 10 countries and produced under licence in Australia, Brazil and South Africa. It set many category records, including an altitude record of 56,807 ft on 18 March 1966. More than 800 MB-326s were constructed between 1961–1975.\\nThe MB-326 had been developed and ordered during a period in which \\"all-through\\" jet training was considered by many air forces to be the most cost-effective model for training of military pilots. It was intended to provide a single type of aircraft that could be used to perform both elementary and advanced training right through to a near combat-ready standard. In practice, it was soon discovered that the simplicity and economy of scale of operating just one type for all training purposes was outweighed by the purchase and operating costs of a large all-jet training fleet."},{"page_url":"https://tr.wikipedia.org/wiki/Dinozorlar_listesi","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Avaceratops_BW.jpg","page_title":"Dinozorlar listesi","context_page_description":"Bu listede dinozor cinsleri kapsamlı bir şekilde listelenmiştir. Listede, geçerli olan veya henüz resmi isimlendirmesi yapılmamış 1379 cins ve alt sınıf dinozor ismi yer almıştır. Bazı isimlerin yanına aşağıdaki terminolojide belirtilen açıklamalar eklenmiştir."},{"page_url":"https://pl.wikipedia.org/wiki/P%C3%A0dua","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Estaci%C3%B3_de_P%C3%A0dua.JPG","page_title":"Pàdua","context_page_description":"Pàdua – stacja metra w Barcelonie, na linii 7. Stacja znajduje się w dzielnicy Sarrià-Sant Gervasi.\\nStacja została otwarta w 1954, kiedy ukończono odcinek pomiędzy stacjami Gràcia a Avinguda Tibidabo."},{"page_url":"https://en.wikipedia.org/wiki/Freyellidae","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Freyastera.jpg","page_title":"Freyellidae","context_page_description":"The Freyellidae are a family of deep-sea-dwelling starfish. It is one of two families in the order Brisingida.\\nThe majority of species in this family are found in Antarctic waters and near Australia. Other species have been found near New Zealand and the United States."},{"page_url":"https://it.wikipedia.org/wiki/Polimerizzazione_anionica","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4f/Ex_polar_monomers.png","page_title":"Polimerizzazione anionica","context_page_description":"La polimerizzazione per addizione anionica è una forma di polimerizzazione a catena che riguarda monomeri vinilici dotati di gruppi fortemente elettronegativi. Questa reazione procede attraverso la formazione di specie carbanioniche e, come tutte le polimerizzazioni a catena in generale, consiste di tre fasi: inizio, propagazione e terminazione.\\nLa polimerizzazione vivente, ovvero con un'assenza della fase di terminazione, si verifica in molti casi di polimerizzazione anionica. Il vantaggio è che permettono di controllare la struttura e la composizione del polimero risultante.\\nLe polimerizzazioni anioniche sono impiegate per la produzione di gomme sintetiche a base di polidieni, per esempio la SBR."},{"page_url":"https://is.wikipedia.org/wiki/%C3%81g%C3%BAst_H._Bjarnason","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Agust_h_bjarnason_professor.jpg","page_title":"Ágúst H. Bjarnason","context_page_description":"Ágúst Hákonarson Bjarnason, var doktor í sálfræði. Ágúst var frumkvöðull í kennslu í sálarfræði og ritun bóka um sálarfræði á Íslandi. Hann samdi meðal annars fyrstu bókina um sálarfræði á íslensku."},{"page_url":"https://de.wikipedia.org/wiki/Olympische_Sommerspiele_2012/Ger%C3%A4tturnen_%E2%80%93_Qualifikation_(M%C3%A4nner)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Yang_Hak-Seon_from_acrofan.jpg","page_title":"Olympische Sommerspiele 2012/Gerätturnen – Qualifikation (Männer)","context_page_description":"Die Qualifikation im Gerätturnen der Männer bei den Olympischen Spielen 2012 in London wurde am 28. Juli 2012 im The O₂ ausgetragen. Insgesamt traten 98 Turner an.\\nDas Qualifikationsturnier erbrachte die Qualifikanten für die verschiedenen Finals. So qualifizierten sich acht Teams für den Mannschafts-Mehrkampf. 24 Turner für den Einzel-Mehrkampf und jeweils acht Turner für die sechs Gerätefinals."},{"page_url":"https://ko.wikipedia.org/wiki/%ED%8C%8C%EC%9D%B4%EC%9C%B0_%EB%AF%B8%EB%9D%BC_%EC%B4%88%EC%83%81%ED%99%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Fayum_Portrait_of_a_Boy_%28detail%29.jpg","page_title":"파이윰 미라 초상화","context_page_description":"파이윰 미라 초상화는 이집트 콥트기에 미라 앞에 놓인 나무판에 자연주의 화풍으로 그려진 초상을 가리키는 현대 용어이다.\\n미이라 초상화는 이집트 전역에서 발견되나, 하와라 및 안티노폴리스 등 파이윰 분지 지역에서 많이 발견된다. 여기에서 지명을 따 “파이윰 초상화”로 불리나, 일반적으로 이 용어는 지리적이라기보다는 표현양식을 나타내는 것이다. 미이라 관을 채색하는 전통은 파라오가 지배하던 때부터 시작되었으나, 파이윰 미이라 초상화는 로마 지배하의 이집트, 콥트기에 고안된 것이다.\\n이는 기원전 또는 기원후 1세기 로마시대부터 시작된다. 언제 마지막으로 제작되었는지는 불확실하나, 최근 연구결과에 따르면 3세기 중반일 가능성이 있다. 파이윰 초상화는 고전 시대에 빛나던 패널화의 영광스러운 전통을 이은 드문 생존자임과 동시에 이들 중 가장 많은 수를 포괄하는 것이며, 패널화의 전통은 이후 비잔틴 미술, 그리고 콥트 교회의 이콘화 등 서양의 고전시대 이후 미술양식으로 이어진다.\\n파이윰 초상화는 매장을 위하여 미이라가 된 시신의 얼굴 부분을 덮는다. 현존하는 예를 관찰해 보면, 이는 시신을 싸는 천 아래에 놓인다. 현재 초상화 대부분은 미이라로부터 분리되었다. 초상화는 일반적으로 한 사람의 정면 두상 또는 흉상을 묘사한다. 예술적인 관점에서 보면, 초상화는 이집트 양식보다는 그리스-로마 양식에서 파생된 것이 분명하다.\\n기법으로 보면 크게 납화 및 템페라화로 구분이 가능하다. 일반적으로 납화법으로 그린 초상화가 더 질이 높다.\\n현재 약 900개의 초상화가 알려져 있으며, 그 중 대부분은 파이윰의 네크로폴리스에서 발견되었다. 고온건조한 이집트의 기후 덕분에 초상화는 잘 보존되어 시간의 흐름에도 퇴색되지 않은 생생한 색을 유지하는 경우가 많다."},{"page_url":"https://nl.wikipedia.org/wiki/Europese_auto%27s_in_de_jaren_60","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/DAF_Daffodil_31_1963.jpg","page_title":"Europese auto's in de jaren 60","context_page_description":"Dit artikel geeft een overzicht van alle Europese personenwagens geproduceerd in de jaren 60. De auto's staan gegroepeerd per jaar van 1960 tot en met 1969. Daaronder staan ze per land en dan per producent/concern ingedeeld. Merken die eigendom zijn van een automobielconcern zijn onder de naam van het concern geplaatst onder het thuisland van het concern. Hoewel die concerns niet noodzakelijk Europees zijn, worden uitsluitend de Europese merken van het concern vermeld, en elk model onder het jaar waarin het op de markt verscheen."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_griechischen_T%C3%B6pfer_und_Vasenmaler/E","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Theseus_Sinis_Staatliche_Antikensammlungen_8771.jpg","page_title":"Liste der griechischen Töpfer und Vasenmaler/E","context_page_description":null},{"page_url":"https://en.wikipedia.org/wiki/USS_Langley_(CVL-27)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/USS_Langley_%28CVL-27%29_and_USS_Ticonderoga_%28CV-14%29_underway_off_Ulithi_on_12_December_1944_%2880-G-301354%29.jpg","page_title":"USS Langley (CVL-27)","context_page_description":"USS Langley (CVL-27) was an Independence-class light aircraft carrier that served the United States Navy from 1943 to 1947, and French Navy as La Fayette from 1951 to 1963."},{"page_url":"https://cs.wikipedia.org/wiki/Donje_Selo","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Donje_Selo%2C_kostel_02.jpg","page_title":"Donje Selo","context_page_description":"Donje Selo je osada na ostrově Šolta, ve Splitsko-dalmatské župě, na jihu Chorvatska. Zeměpisné souřadnice tohoto místa jsou 43° 24' s. š. a 16° 15' 37' v. d. Ve vesnici stojí kostel sv. Martina."},{"page_url":"https://vi.wikipedia.org/wiki/Fulica_cornuta","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/MeniquesWariNests.jpg","page_title":"Fulica cornuta","context_page_description":"Fulica cornuta là một loài chim trong họ Rallidae."},{"page_url":"https://eu.wikipedia.org/wiki/Vitor_J%C3%BAnior","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Vitor_Silva_Assis_de_Oliveira_J%C3%BAnior.jpg","page_title":"Vitor Júnior","context_page_description":"Vitor Silva Assis de Oliveira Júnior Brasilgo futbolaria da.\\nHainbat futbol taldetan jokatu du, esaterako Santos eta Kawasaki Frontale."},{"page_url":"https://en.wikipedia.org/wiki/Schweizerischer_Niederlaufhund","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4c/Gonczy_bernenski_pl1.jpg","page_title":"Schweizerischer Niederlaufhund","context_page_description":"The Schweizerischer Niederlaufhund all of the same breed)."},{"page_url":"https://ast.wikipedia.org/wiki/Aeropuertu_Internacional_de_Miami","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a6/Miami_airport_historical.jpg","page_title":"Aeropuertu Internacional de Miami","context_page_description":"L'Aeropuertu Internacional de Miami, tamién conocíu como MIA ya históricamente Wilcox Field, ye l'aeropuertu principal que sirve al Área metropolitana del Sur de la Florida, Estaos Xuníos. L'aeropuertu ta nun área ensin incorporar nel Condáu de Miami-Dade, Florida a 13 km al noroeste del centru de Miami, ente les ciudaes de Miami, Hialeah, Doral, Miami Springs, el pueblu de Virginia Gardens y el barriu ensin incorporar de Fountainebleau. Ye'l principal aeropuertu del sur de Florida pa vuelos internacionales de llarga distancia. Miami International ye tamién unu de los ocho aeropuertos de los Estaos Xuníos que puede afaer el superjumbo Airbus A380.\\nL'aeropuertu ye la puerta d'enllaz principal d'América Llatina d'American Airlines, xuntu con un centru de conexones domésticu pal so afiliáu rexonal American Eagle y Eastern Air Lines; los tresportistes de carga UPS Airlines y FedEx Express y la llinia aérea charter Miami Air. Ye un aeropuertu focu p'Avianca, Frontier Airlines y LATAM, tantu pa pasaxeros como pa operaciones de carga."},{"page_url":"https://es.wikipedia.org/wiki/Rafael_Yela_G%C3%BCnther","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Xela_Barrios.jpg","page_title":"Rafael Yela Günther","context_page_description":"Rafael Yela Günther, fue un escultor y pintor guatemalteco."},{"page_url":"https://it.wikipedia.org/wiki/Sushant_Singh_Rajput","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Sushant_Kriti_Raabta.jpg","page_title":"Sushant Singh Rajput","context_page_description":"Sushant Singh Rajput è stato un attore e ballerino indiano."},{"page_url":"https://de.wikipedia.org/wiki/Rhein-Maas_Klinikum","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/ff/BB_aussen_Hauptportal1_08_2005.jpg","page_title":"Rhein-Maas Klinikum","context_page_description":"Das Rhein-Maas Klinikum ist zum 1. Januar 2001 durch die Fusion des Knappschaftskrankenhauses Bardenberg und des Kreiskrankenhauses Marienhöhe in Würselen entstanden und wurde zunächst Medizinisches Zentrum Kreis Aachen gGmbH benannt. Diese erste Namensgebung ergab sich, nachdem die StädteRegion Aachen, die ebenso wie die Knappschaft 50 % der Gesellschaftsanteile hält, Rechtsnachfolgerin des Kreises Aachen wurde. Zum 1. Juli 2017 erfolgte aufgrund des erweiterten Leistungsspektrums des Medizinischen Zentrums eine erneute Umbenennung in Rhein-Maas Klinikum GmbH. Zum Oktober 2018 wurde die Akutmedizin im Nordkreis am Standort \\"Marienhöhe\\" zentralisiert.\\nDas Rhein-Maas Klinikum mit rund 1.600 Mitarbeitern verfügt über 645 Planbetten und ist mit dem Qualitätsstandard Kooperation für Transparenz und Qualität im Gesundheitswesen zertifiziert.\\nBis etwa 2021/2022 sind im Rahmen der Neuausrichtung des Klinikums einschneidende Veränderungen geplant: So wurden 2018 aus Bardenberg die Abteilungen für Lungenheilkunde und Urologie an den Standort Marienhöhe verlegt und eine neue Notfallpraxis der Kassenärztlichen Vereinigung errichtet."},{"page_url":"https://nl.wikipedia.org/wiki/Pete_Buttigieg","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Pete_Buttigieg_signature_%281%29.png","page_title":"Pete Buttigieg","context_page_description":"Peter Paul Montgomery Buttigieg, uitspraak: /ˈbuːtəˌdʒɛdʒ/, boe-te-dzjedzj is een Amerikaans politicus. Tussen 1 januari 2012 en 1 januari 2020 was hij burgemeester van zijn geboortestad South Bend in Indiana. Hij was binnen de Democratische Partij in 2020 een van de kandidaten voor het ambt van president van de Verenigde Staten, maar trok zich begin maart 2020 terug."},{"page_url":"https://en.wikipedia.org/wiki/Bryce_Drew","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c5/Bryce_drew.jpg","page_title":"Bryce Drew","context_page_description":"Bryce Homer Drew is an American college basketball coach and former player. He is currently the head coach at Grand Canyon University. Previously he served as the head coach of the Vanderbilt Commodores and in the same capacity at his alma mater, Valparaiso, having succeeded his father, Homer Drew. Bryce's brother, Scott, also coached at Valpo before becoming the head coach of the Baylor Bears. As a player, Bryce Drew was known for his buzzer-beating shot in the first round of Valparaiso's run in the 1998 NCAA Tournament. He went on to play six seasons in the National Basketball Association as a backup point guard for the Houston Rockets, Chicago Bulls, Charlotte Hornets and New Orleans Hornets."},{"page_url":"https://es.wikipedia.org/wiki/Paola_Vega_Rodr%C3%ADguez","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Paola_Vega_Rodr%C3%ADguez.jpg","page_title":"Paola Vega Rodríguez","context_page_description":"Paola Viviana Vega Rodríguez es una politóloga y política costarricense, actual diputada por el undécimo lugar de la provincia de San José, en la Asamblea Legislativa de Costa Rica, por el Partido Acción Ciudadana para el periodo legislativo 2018-2022.​ Vega es conocida por sus posturas militantes a favor de la laicidad del estado, ​ el feminismo, ​ la eutanasia, ​ el aborto libre​ y el medio ambiente.​"},{"page_url":"https://nl.wikipedia.org/wiki/Buddha-Bar","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Buddha_Bar_%2811%29.jpg","page_title":"Buddha-Bar","context_page_description":"De Buddha-Bar is een bar-restaurant in Parijs dat zich karakteriseert door de oosterse sfeer die er heerst met het grote boeddhabeeld, de Aziatische keuken\\nen de lounge- en wereldmuziek die er wordt gepeeld. De Buddha-Bar werd in 1996 opgericht door Raymond Visan en groeide uit tot een internationale restaurantketen met wereldwijd tal van franchisenemers. Ook kleinere varianten van de Buddha-Bar, Little Buddha genoemd, behoren tot de keten. Sinds de oprichting zijn er ook al weer locaties gesloten. Het concept van de officiële Buddha-Bar wordt ook toegepast op hotels en wellness-inrichtingen. In 2009 werd het eerste gelicentieerde Buddha-Bar-hotel geopend in Praag, het tweede in 2012 in Boedapest en het laatste in 2013 in Parijs. Wellness-inrichtingen bestaan in Boedapest, Dakar, Doha en Dubai.\\nEr bestaan restaurants en bars die het concept met de boeddhabeelden en de chill-out kopiëren en zich soms zelfs \\"Buddha Bar\\" noemen. Ze zijn echter geen officiële filialen van de Buddha-Bar in Parijs.\\nIn maart 2009 waren er in Jakarta protesten van een groep boeddhisten tegen de plaatselijke Buddha-Bar vanwege het gebruik van religieuze symbolen voor amusementsdoeleinden."},{"page_url":"https://es.wikipedia.org/wiki/Tehuelche_(motocicleta)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Legnano_motor_Tehuelche_distribucion_a_engranajes.jpg","page_title":"Tehuelche (motocicleta)","context_page_description":"Tehuelche fue un modelo de motocicleta de diseño argentino presentada al público en marzo de 1957, y fabricada hasta mediados de 1964.\\nFue la “Tehuelche” un verdadero orgullo nacional, no obstante quedó en el olvido de las sucesivas generaciones de argentinos.\\nSi bien hubo en el país otros intentos, en su mayoría frustrados, de fabricar una moto nacional, la Tehuelche fue la única que tuvo una continuidad seriada en sus siete años de producción. De diseño completamente propio, copia de ninguna, esta moto competía en el plano local con otras motos “argentinas”, pero que eran fabricadas bajo licencia de motos europeas, como por ejemplo: Puma Primera, Segunda, Zanella, Gilera, entre otras marcas.\\nEsta moto se distinguía tanto por el característico sonido de la cascada de engranajes de la distribución, como por sus excelentes logros en su carrera deportiva."},{"page_url":"https://nl.wikipedia.org/wiki/Felgueiras_(Fafe)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Fafe_66.PNG","page_title":"Felgueiras (Fafe)","context_page_description":"Felgueiras is een plaats in de Portugese gemeente Fafe en telt 135 inwoners."},{"page_url":"https://fi.wikipedia.org/wiki/Mahindra_%26_Mahindra","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Mahindra_Quanto_image.JPG","page_title":"Mahindra & Mahindra","context_page_description":"Mahindra & Mahindra Limited on suuri intialainen autoteollisuus- ja maatalouskoneiden valmistaja. Tämä holdingyhtiö on yhtiömuodoltaan julkinen osakeyhtiö, jonka osake noteerataan sekä Bombayn että Intian kansallisessa pörssissä. Suurin osakkeenomistaja on monialakonserni Mahindra Group. Mahindra & Mahindra on Intian suurin traktorien ja hyötyajoneuvojen valmistaja, ja Intian suurimpia henkilöautovalmistajia. Yhtiön Mahindra-traktori on maailman myydyin traktorimerkki.\\nYhdysvaltalainen talousjulkaisu Forbes listasi Mahindra & Mahindran vuonna 2015 Intian 18. ja maailman 814. suurimmaksi julkiseksi osakeyhtiöksi. Yhtiön pääkonttori on Mumbaissa ja toimitusjohtaja on Anand Mahindra. Konsernin liikevaihto oli 11,61 miljardia dollaria ja yhtiön palveluksessa oli 19 427 työntekijää. Yhtiön maaliskuuhun 2015 päättyneen toimintavuoden liikevaihdosta 38,65 % kertyi henkilöautoista, 20,78 % hyötyajoneuvoista, 27,62 % traktoreista ja 12,95 % muista liiketoiminnoista.\\nJoulukuussa 2015 uutisoitiin Mahindra & Mahindra ostavan maailmankuulun italialaisen ajoneuvosuunnitteluyritys Pininfarinan."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A4%CE%B6%CE%AD%CE%BC%CE%B9%CE%BD%CE%B9_4","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Gemini-Titan_4_portrait.jpg","page_title":"Τζέμινι 4","context_page_description":"Το Τζέμινι 4 ήταν η δεύτερη επανδρωμένη διαστημική πτήση του προγράμματος Τζέμινι της NASA και πραγματοποιήθηκε τον Ιούνιο του 1965."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A6%D7%99_%D7%9E%D7%98%D7%95%D7%A1%D7%99_%D7%90%D7%9C_%D7%A2%D7%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/4X-EHE_ErezS.jpg","page_title":"צי מטוסי אל על","context_page_description":"צי מטוסי אל על מלווה את ההיסטוריה של מדינת ישראל מעת תקומתה ומטוסיה היו שותפים לכמה מן האירועים ההיסטוריים הבולטים בישראל. מטוסי אל על הראשונים נרכשו עוד בטרם הכרזת המדינה והיוו עורק תחבורה ואספקה מרכזי למדינה בעת מלחמת העצמאות. תחילה היה מורכב הצי ממטוסים צבאיים ישנים שהוסבו למטרות אזרחיות, ועם השנים החלה אל על רוכשת מטוסים חדישים אשר אפשרו לחברה לחנוך נתיבי טיסה חדשים.\\nנכון לפברואר 2020 מנה צי החברה 45 מטוסים - כולם מטוסים מתוצרת בואינג: 24 מטוסי בואינג 737, ‏ 6 מטוסי בואינג 777, שלושה מטוסי בואינג 787-8, ‏ 12 מטוסי בואינג 787-9. הגיל הממוצע של הצי הוא 9 שנים."},{"page_url":"https://bar.wikipedia.org/wiki/Black_Veil_Brides","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Black_Veil_Brides_Logo.png","page_title":"Black Veil Brides","context_page_description":"Black Veil Brides is a amerikanische Post-Hardcore-Band, de wo seit Septemba 2009 bei Standby Records und de Labels Lava Music und Universal Repuplic Records unta Vatrog steht."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D0%B0%D0%BB%D0%B0%D1%86%D1%86%D0%BE_%D0%9A%D0%BE%D0%BB%D0%BE%D0%BD%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Palazzo_colonna%2C_appartamenti_di_donna_isabella%2C_stemma_colonna.JPG","page_title":"Палаццо Колонна","context_page_description":"Палаццо Колонна — палац у Римі на Piazza SS. Apostoli. Знаходиться у власності сім'ї Колонна протягом 23 поколінь і частково відкритий для громадськості. У приміщенні знаходиться галерея Колонна — визначна збірка предметів мистецтва."},{"page_url":"https://pl.wikipedia.org/wiki/Robert_Seymour","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/The_Writings_of_Charles_Dickens_v1_p4_%28engraving%29.jpg","page_title":"Robert Seymour","context_page_description":"Robert Seymour – brytyjski rysownik, ilustrator, karykaturzysta. Popularność zyskał jako autor ilustracji do Klubu Pickwicka Charlesa Dickensa."},{"page_url":"https://en.wikipedia.org/wiki/Russian_Revival_architecture","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Moscow%2C_Novaya_Basmannaya_23-1_July_2015_03.JPG","page_title":"Russian Revival architecture","context_page_description":"The Russian Revival style is the generic term for a number of different movements within Russian architecture that arose in the second quarter of the 19th century and was an eclectic melding of pre-Petrine Russian architecture and elements of Byzantine architecture.\\nThe Russian Revival architecture arose within the framework that the renewed interest in the national architecture, which evolved in Europe in the 19th century, and it is an interpretation and stylization of the Russian architectural heritage. Sometimes, Russian Revival architecture is often erroneously called Russian or Old-Russian architecture, but the majority of Revival architects did not directly reproduce the old architectural tradition. Being instead a skilful stylization, the Russian Revival style was consecutively combined with other international styles, from the architectural romanticism of first half of the 19th century to the modern style."},{"page_url":"https://fr.wikipedia.org/wiki/Greg_Vaydik","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Greg_Vaydik_1976.JPG","page_title":"Greg Vaydik","context_page_description":"Gregory Vaydik est un joueur professionnel canadien de hockey sur glace."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%A9%D8%B1%D8%AF%D8%B3%D8%AA%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Day_Marivan.JPG","page_title":"کردستان","context_page_description":"کردستان به منطقه‌ای تعریف‌شده به صورت تقریبی از نظر جغرافیایی و فرهنگی گفته می‌شود که بیشتر ساکنین آن کرد هستند و فرهنگ، زبان و آداب و رسوم در آن بنا شده‌است. کردستان منطقه‌ای را از شمال غربی زاگرس تا شرق توروس را دربردارد. این منطقه در حدود ۵۰۰٬۰۰۰ کیلومتر مربع مساحت دارد. همچنین واژهٔ ''کورد'' در اصل از طرف یکجانشینان به طوائف و اجتماعاتی که کوچرو بودند اطلاق می‌شده‌است. واژهٔ کردستان می‌تواند از دگرگون شدن واژهٔ پارس یا پارت به وجود آمده باشد. هنوز هم کردهای استان‌های کردستان و کرمانشاه واژه کردستان را به صورت کورسان تلفظ می‌کنند که جمع واژه کورس با واژه کورسان را می‌سازد در تاریخ اولین اشاره به کردستان در زمان سلطان سنجر سلجوقی و به نواحی سنندج و کرمانشاه بوده‌است.\\nبه‌طور کلی کردستانات از چهار بخش کردستان ایران، کردستان ترکیه، کردستان عراق و کردستان سوریه تشکیل شده‌است. تمامی این سرزمین در اصل بخشی از ایران صفوی بود که طی جنگ چالدران طی سال‌های ۱۵۱۲–۱۵۲۰ میلادی، بخش بزرگی از آن به دولت عثمانی واگذار شد. امپراتوری عثمانی در اوایل قرن بیستم فروپاشید و در نتیجه در حال حاضر بخش‌هایی از این سرزمین علاوه بر ایران، در سه کشور ترکیه، عراق و سوریه نیز وجود دارد."},{"page_url":"https://nl.wikipedia.org/wiki/Sint-Pieters-Bandenkerk_(Erwetegem)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Monument_Mijnwerkers_-_Erwetegem.jpg","page_title":"Sint-Pieters-Bandenkerk (Erwetegem)","context_page_description":"De Sint-Pieters-Bandenkerk van Erwetegem is een classicistische kerk met Lodewijk XVI-meubilair. De kerk werd voor het eerst vermeld in 1162. In 1779 werd de huidige kerk in baksteenmetselwerk met zandsteen opgetrokken ter vervanging van de hardstenen kerk. De toren is een overblijfsel van die kerk. In de kerk hangen een 17de-eeuws en drie 18de-eeuwse schilderijen van onbekende meesters. Het orgel uit 1828 is het werk van Charles van Peteghem en is sinds 1980 beschermd."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%90%D1%80%D0%BC%D1%8D%D0%BD_%D0%94%D0%B6%D1%8B%D0%B3%D0%B0%D1%80%D1%85%D0%B0%D0%BD%D1%8F%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Armen_Jigarhanian1.jpeg","page_title":"Армэн Джыгарханян","context_page_description":"Армэн Джыгарханян — армянскі і савецкі актор тэатра і кіно, рэжысэр тэатра, кіраўнік маскоўскага драматычнага тэатра пад кіраўніцтвам Армэна Джыгарханяна.\\nУключаны з Кнігу Рэкордаў Гінэса ў якасьці расейскага актора, які зьняўся ў найбольшай колькасьці фільмаў. Кавалер ордэна «За заслугі перед Айчынай» II, III і IV ступеняў, народны артыст СССР.\\nЗьняўся ў дзясятках савецкіх фільмаў і агучваў герояў шматлікіх мультфільмаў Саюзмультфільма. Заснаваў у Маскве свой уласны тэатар."},{"page_url":"https://fr.wikipedia.org/wiki/Abbaye_de_Foigny","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/La_Bouteille_%28Aisne%29_en_souvenir_de_l%27abbaye_de_Floigny_06.JPG","page_title":"Abbaye de Foigny","context_page_description":"L’abbaye de Foigny est une ancienne abbaye cistercienne située à La Bouteille."},{"page_url":"https://fr.wikipedia.org/wiki/D%C3%A9partement_des_peintures_du_mus%C3%A9e_du_Louvre","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Diane-Ec.Fontainebleau-Louvre.jpg","page_title":"Département des peintures du musée du Louvre","context_page_description":"Le département des Peintures est l'un des huit départements qui composent le musée du Louvre. Il s'agit d'une des plus importantes et des plus célèbres collections du monde. Les collections du département des peintures sont spécialisées dans l'art européen du XIIIᵉ à la fin du XIXᵉ siècle. Cependant, à l'exception de la donation Hélène et Victor Lyon, l'essentiel des œuvres datant d'après 1848 sont exposées au musée d'Orsay. On peut noter que les peintures d'autres époques sont rattachées à d'autres départements. Par exemple, le département des Antiquités égyptiennes possède des peintures coptes."},{"page_url":"https://pl.wikipedia.org/wiki/Krhanice_(przystanek_kolejowy)","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a9/Krhanice-nadrazi.jpg","page_title":"Krhanice (przystanek kolejowy)","context_page_description":"Krhanice – przystanek kolejowy w miejscowości Krhanice, w kraju środkowoczeskim, w Czechach. Znajduje się na wysokości 270 m n.p.m.\\nJest obsługiwany i zarządzany przez České dráhy. Na przystanku nie ma możliwości zakupu biletu, a obsługa podróżnych odbywa się w pociągu."},{"page_url":"https://pl.wikipedia.org/wiki/Lejkoporek_olszowy","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Gyrodon_lividus...jpg","page_title":"Lejkoporek olszowy","context_page_description":"Lejkoporek olszowy – gatunek grzybów z rodziny krowiakowatych."},{"page_url":"https://cs.wikipedia.org/wiki/Pavel_Kosat%C3%ADk","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Pavel_Kosat%C3%ADk_2015.jpg","page_title":"Pavel Kosatík","context_page_description":"Pavel Kosatík je český novinář, scenárista a spisovatel."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%B4%D0%B0%D0%BC%D0%B5%D1%88%D1%82%D1%8F%D0%BD%D1%83,_%D0%93%D0%B0%D0%B1%D1%80%D0%B8%D1%8D%D0%BB%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Gabriela_Adame%C8%99teanu%2C_G%C3%B6teborg_Book_Fair_2013_1_%28crop%29.jpg","page_title":"Адамештяну, Габриэла","context_page_description":"Габриэла Адамештяну — румынская писательница, новеллист, эссеист, журналистка, переводчик."},{"page_url":"https://id.wikipedia.org/wiki/Daftar_masjid_di_Inggris_Raya","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Suleymaniye_Mosque_London%2C_E2.jpg","page_title":"Daftar masjid di Inggris Raya","context_page_description":"Daftar Masjid di Inggris Ini adalah daftar yang tidak lengkap dari masjid-masjid terkemuka di Inggris Raya yang terdaftar di wilayah Skotlandia, Inggris dan Wales."},{"page_url":"https://es.wikipedia.org/wiki/British_Motor_Corporation","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fc/Riley_4-68.jpg","page_title":"British Motor Corporation","context_page_description":"British Motor Corporation Limited fue un conglomerado británico surgido en 1952 fruto de la fusión de los fabricantes de automóviles Morris Motor Company y Austin Motor Company.\\nTras varios intentos frustrados, el acuerdo de fusión se hizo mediante el intercambio de acciones por las de la nueva sociedad, facilitado por las cifras de producción y ventas de ambas empresas, prácticamente idénticas en 1951. Sin embargo los términos del acuerdo no incluían la desaparición de las compañías ni sus subsidiarias, que mantedrían sus propias identidades y producirían productos diferenciados.\\nEste sistema fue forzado por la diferente composición de los holdings que formaban las dos compañías.\\nAustin pasaría a ser el socio dominante, con el cuartel general situado en Longbridge, cerca de Birmingham donde Austin tenía centralizada su producción en la modernísima planta del mismo nombre.\\nMorris por su parte pertenecía a la Nuffield Organization, que producía además las marcas MG, Riley, Wolseley, junto a diversos productos de industria pesada, su producción estaba diseminada en dieciséis plantas en las Midlands con la planta principal en Cowley Oxford."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B0%D0%B1%D1%80%D0%B5%D1%80%D0%BE%D1%81-%D0%B4%D0%B5%D0%BB%D1%8C-%D0%A0%D0%B8%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/LE-Cabreros_del_R%C3%ADo_04.JPG","page_title":"Кабрерос-дель-Рио","context_page_description":"Кабрерос-дель-Рио — муниципалитет в Испании, входит в провинцию Леон, в составе автономного сообщества Кастилия и Леон. Муниципалитет находится в составе района Вега-дель-Эсла. Занимает площадь 24,80 км². Население — 481 человек."},{"page_url":"https://fr.wikipedia.org/wiki/Ars-en-R%C3%A9","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fd/Port_Ars_en_Re.jpg","page_title":"Ars-en-Ré","context_page_description":"Ars-en-Ré est une commune du Sud-Ouest de la France, située sur l'île de Ré, pôle d'équilibre du canton de l'Île de Ré, faisant partie de l'arrondissement de La Rochelle, dans le département de la Charente-Maritime, en région Nouvelle-Aquitaine.\\nLa commune appartient, depuis 2011, au réseau « Villages de pierres et d'eau », label initié par le conseil général, afin de promouvoir des sites exceptionnels présentant la particularité d'être situés au bord d'une étendue d'eau."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%97%E3%83%AD%E3%83%88%E3%83%B3%E3%83%BB%E3%82%B5%E3%82%AC","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5e/Proton_Saga_%28second_generation%29_%28front%29%2C_Serdang.jpg","page_title":"プロトン・サガ","context_page_description":"サガ は、プロトンが製造販売している自動車である。"},{"page_url":"https://bg.wikipedia.org/wiki/20_%D1%8F%D0%BD%D1%83%D0%B0%D1%80%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Federico_Fellini_NYWTS_2.jpg","page_title":"20 януари","context_page_description":"20 януари е 20-ият ден в годината според григорианския календар. Остават 345 дни до края на годината."},{"page_url":"https://pl.wikipedia.org/wiki/Gorajec","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Gorajec%2C_dzwonnica_25.10.2006r..jpg","page_title":"Gorajec","context_page_description":"Gorajec – wieś w Polsce, położona w województwie podkarpackim, w powiecie lubaczowskim, w gminie Cieszanów, nad potokiem Gnojnik na Płaskowyżu Tarnogrodzkim.\\nW latach 1975–1998 miejscowość administracyjnie należała do województwa przemyskiego.\\nWieś starostwa niegrodowego lubaczowskiego na początku XVIII wieku."},{"page_url":"https://ast.wikipedia.org/wiki/Acelerador_de_part%C3%ADcules","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Particle_accelerators_1937.jpg","page_title":"Acelerador de partícules","context_page_description":"Un acelerador de partícules ye un dispositivu qu'utiliza campos electromagnéticos p'acelerar partícules cargaes a altes velocidaes, y asina, faeles topetar con otres partícules. D'esta manera, xenérense ensame de nueves partícules que -xeneralmente- son bien inestables y duren menos d'un segundu, esto dexa estudiar más a xeitu les partícules que fueron desintegraes per mediu de les que fueron xeneraes. Hai dos tipos básicos d'aceleradores de partícules: los lliniales y los circulares. El tubu de rayos catódicos d'un televisión ye una forma simple d'acelerador de partícules.\\nEl aceleradores de partícules asonsañen, en cierta forma, l'aición de los rayos cósmicos sobre l'atmósfera terrestre, lo cual produz al azar una agua de partícules exótiques ya inestables. Sicasí, el aceleradores empresten una redolada muncho más controlada pa estudiar estes partícules xeneraes, y el so procesu de desintegración.\\nEsi estudiu de partícules, tantu inestables como estables, pue ser nun futuru útil pal desarrollu de la medicina, la esploración espacial, teunoloxía electrónica, etcétera.\\nVer tamién: Llista d'aceleradores en física de partícules"},{"page_url":"https://pt.wikipedia.org/wiki/S%C3%A3o_Benedito_(Pau_dos_Ferros)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Avenida_Senador_Dinarte_Mariz_e_Rua_S%C3%A3o_Jo%C3%A3o%2C_Pau_dos_Ferros_%28RN%29.jpg","page_title":"São Benedito (Pau dos Ferros)","context_page_description":"São Benedito é um bairro do município de Pau dos Ferros, no interior do estado do Rio Grande do Norte, Brasil."},{"page_url":"https://en.wikipedia.org/wiki/List_of_islands_of_Newfoundland_and_Labrador","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Carlb-fogo-newfoundland-2002.jpg","page_title":"List of islands of Newfoundland and Labrador","context_page_description":"The Canadian province of Newfoundland and Labrador is composed of mainland Labrador and the large island of Newfoundland. The coast of both the island and the Labrador Peninsula are lined with islands of various magnitudes."},{"page_url":"https://de.wikipedia.org/wiki/Schwarzkogel_(Granatspitzgruppe)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Wilde_Mander_vom_Abstieg_vom_Wildenkogel.jpg","page_title":"Schwarzkogel (Granatspitzgruppe)","context_page_description":"Der Schwarzkogel ist ein 2866 m ü. A. hoher Berg im Muntanitzkamm der Granatspitzgruppe im Norden Osttirols. Der Berg wurde erstmals am 19. August 1927 von W. Brandenstein bestiegen, den ersten Gratübergang vom Kalser Bärenkopf nahmen H. Peterka und M. Jedlicka am 9. August 1932 vor."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A8%D8%AD%D9%8A%D8%B1%D8%A9_%D8%AA%D8%A7%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/%D9%85%D8%A7%D8%B2_%28cropped%29.jpg","page_title":"بحيرة تار","context_page_description":"بحيرة تار هي بحيرة طبيعية جبلية ذات مياه عذبة والتي تُعَد واحدة من المناطق الطبيعية الوطنية في إيران كما وتُعتبَر من المناطق السياحية المثالية في مدينة دماوند الواقعة في شرق العاصمة طهران حيث تحاصرها سلسلة جبال البرز. وتقع هذه البحيرة الطبيعية على بعد 15 كم شرق مدينة دماوند، وعلى ارتفاع أكثر من 3000 متر فوق مستوى سطح البحر. كما وان مساحتها تبلغ سبع كيلومترات مربع. وهناك قصص كثيرة واساطير قديمة حول هذه البحيرة منها ان هناك ميزات سحرية للبحيرة لمن يبات عندها كما ويُقال ايضاً ان هناك كنوزاً دفينة في صميم البحيرة وضواحيها."},{"page_url":"https://it.wikipedia.org/wiki/Folk_metal","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Eluveitie_Cernunnos_Fest_161207_01.jpg","page_title":"Folk metal","context_page_description":"Il Folk metal è un sottogenere dell'heavy metal sorto e sviluppatosi in Europa durante gli anni novanta. Il Folk Metal mescola l'heavy metal a sonorità ispirate alla musica folkloristica occidentale. Include, quindi, l'utilizzo di strumenti popolari, e, in minor misura, stili di canto tradizionali, come per esempio, gli olandesi degli Heidevolk, i danesi degli Sylvatica e gli spagnoli degli Stone of Erech, e fuori dall'Europa i giapponesi Kiryu.\\nIl genere non subì alcuna innovazione, almeno fino alla nascita di un'altra band inglese, gli Skyclad. Il loro primo album, The Wayward Sons of Mother Earth uscì nel 1990. Solo tra il 1994 ed il 1995 vi furono ulteriori innovazioni, grazie a nuovi gruppi sorti in tutta Europa. Tra queste band, possiamo citare la band irlandese dei Cruachan e la band tedesca dei Subway to Sally, band che crearono due importantissimi sottogeneri del Folk metal, il Celtic metal e il Medieval metal. Nonostante i loro contributi, il folk metal rimase poco conosciuto, a causa dei pochi esponenti presenti durante gli anni novanta."},{"page_url":"https://vi.wikipedia.org/wiki/Horacio_Elizondo","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Kirchner_y_Elizondo.jpg","page_title":"Horacio Elizondo","context_page_description":"Horacio Marcelo Elizondo là một cựu trọng tài bóng đá quốc tế người Argentina được biết đến là trọng tài chính bắt Trận chung kết Giải vô địch bóng đá thế giới 2006. Đạt được tất cả các mục tiêu của mình trong vai trò là trọng tài, Elizondo đã giải nghệ vào ngày 10 tháng 12 sau trận đấu giữa Boca Juniors và Lanús, 3 năm trước khi tuổi nghỉ hưu bắt buộc ở 45 tuổi."},{"page_url":"https://pt.wikipedia.org/wiki/Amber","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Jaipur_03-2016_03_Amber_Fort.jpg","page_title":"Amber","context_page_description":"Amber foi uma cidade-fortaleza abandonada do estado de Rajastão, na Índia. Atualmente está incluída na Corporação Municipal da cidade de Jaipur, capital do estado de Rajastão.\\nO nome de Amber foi mencionado pela primeira vez por Ptolomeu. Uma localidade que já prosperava desde 967, foi fundada pela tribo dos Meenas. Em 1037, foi tomada pelos Kachwahas que à tornaram sua capital até abandonarem-a em 1727 em proveito de Jaipur, uma cidade moderna construída pelo rajá Jai Singh II sobre um tabuleiro plano distante uma dezena de quilômetros ao sul dela. Após a fundação da nova cidade o palácio real e as casas das pessoas proeminentes foram deslocadas para Jaipur. Porém, os sacerdotes dos templos permaneceram vivendo no forte. A capital dos Kachwahas foi suplantada pela modernizada cidade de Jaipur, que atualmente é a capital do estado de Rajasthan da Índia.\\nApós os anos 60 a cidade aumentou de população. Apresenta numerosos templos hinduístas como o belo Jagat Shiromani, templos dos jainas e a mesquita de Akbar restaurada por Aurangzeb."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9A%CE%B1%CF%84%CE%AC%CE%BB%CE%BF%CE%B3%CE%BF%CF%82_%CF%80%CF%8C%CE%BB%CE%B5%CF%89%CE%BD_%CF%84%CE%B7%CF%82_%CE%91%CE%BC%CE%B5%CF%81%CE%B9%CE%BA%CE%AE%CF%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Fortaleza_-_Cear%C3%A1_-_Brasil.jpg","page_title":"Κατάλογος πόλεων της Αμερικής","context_page_description":"Το παρών λήμμα περιλαμβάνει τις 50 μεγαλύτερες σε πληθυσμό πόλεις της Αμερικής. Ο κατάλογος ταξινομεί τις μεγαλύτερες αστικές περιοχές των δήμων αυτών των πόλεων."},{"page_url":"https://hu.wikipedia.org/wiki/Chisago_megye","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Old_Chisago_County_Courthouse.jpg","page_title":"Chisago megye","context_page_description":"Chisago megye az Amerikai Egyesült Államokban, azon belül Minnesota államban található. Megyeszékhelye Center City, legnagyobb városa North Branch. Lakosainak száma 53 761 fő. +/- Chisago megye Pine, Anoka, Polk, Washington és Burnett megyékkel határos."},{"page_url":"https://da.wikipedia.org/wiki/Amerikanske_vicepr%C3%A6sidenter","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/VPthomasrmarshall.JPG","page_title":"Amerikanske vicepræsidenter","context_page_description":"Vicepræsident er det næsthøjeste embede i USA efter præsidentembedet. Vicepræsidenten bliver valgt sammen med præsidenten og tager stillingen hvis præsidenten skulle dø, gå af eller blive afsat indenfor præsidentperioden. Vicepræsidenten er præsident og ordstyrer i USA's senat og har stemmeret ved stemmelighed, så at hans stemme i sådanne tilfælde bliver udslagsgivende. Embedet er således det eneste som har funktioner i både den udøvende gren og den lovgivende gren af statsmagten.\\nDet er de samme formelle krav til vicepræsidenten som til præsidenten: For at kunne blive valgt, skal man være født som amerikansk statsborger, være minimum 35 år gammel og have boet i USA i de sidste 14 år. Man kan heller ikke have været præsident i to mandatperioder tidligere."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%A1%E1%83%98%E1%83%93%E1%83%9D%E1%83%9C%E1%83%98%E1%83%A1_%E1%83%AA%E1%83%98%E1%83%AE%E1%83%94%E1%83%A1%E1%83%98%E1%83%9B%E1%83%90%E1%83%92%E1%83%A0%E1%83%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/%D9%85%D9%86%D8%B8%D8%B1_%D8%B9%D8%A7%D9%85_%D9%84%D9%84%D9%82%D9%84%D8%B9%D8%A9_%D9%85%D9%86_%D8%A7%D9%84%D8%AF%D8%A7%D8%AE%D9%84.JPG","page_title":"სიდონის ციხესიმაგრე","context_page_description":"სიდონის ციხესიმაგრე — ჯვაროსანთა მიერ აგებული ციხესიმაგრე წმინდა მიწაზე. ის არის ერთ-ერთი ყველაზე ცნობილი არქეოლოგიური უბანი ლიბანის საპორტო ქალაქ სიდონში."},{"page_url":"https://ht.wikipedia.org/wiki/Olga_Aleksandrovna_Ladyzhenskaya","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/O.Ladyzhenskaya.jpg","page_title":"Olga Aleksandrovna Ladyzhenskaya","context_page_description":"Olga Aleksandrovna Ladyzhenskaya, ki fèt 7 mas 1922 nan Kologriv epi ki mouri 12 janvye 2004 nan Saint-Pétersbourg, se yon matematisyèn ris, nan peyi Risi.\\nLi se selèb pou travay li yo sou ekwasyon avèk derive pasyèl, diferans fini, les ekwasyon Navier-Stokes ak dinamik likid."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D0%B0%D0%BC%27%D1%8F%D1%82%D0%BA%D0%B8_%D0%B0%D1%80%D1%85%D1%96%D1%82%D0%B5%D0%BA%D1%82%D1%83%D1%80%D0%B8_%D0%86%D0%B2%D0%B0%D0%BD%D0%BE-%D0%A4%D1%80%D0%B0%D0%BD%D0%BA%D1%96%D0%B2%D1%81%D1%8C%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/%D0%96%D0%B8%D1%82%D0%BB%D0%BE%D0%B2%D0%B8%D0%B9_%D0%B1%D1%83%D0%B4%D0%B8%D0%BD%D0%BE%D0%BA_%28%D0%BC%D1%83%D1%80.%29_%D0%86%D0%B2%D0%B0%D0%BD%D0%BE-%D0%A4%D1%80%D0%B0%D0%BD%D0%BA%D1%96%D0%B2%D1%81%D1%8C%D0%BA_%D0%B2%D1%83%D0%BB._%D0%93%D0%B0%D0%BB%D0%B8%D1%86%D1%8C%D0%BA%D0%B0%2C_5.JPG","page_title":"Пам'ятки архітектури Івано-Франківська","context_page_description":"В Івано-Франківську нараховується 5 пам'яток архітектури національного значення, та 529 місцевого значення, що внесені до Державного реєстру нерухомих пам'яток України.\\n№\\nНайменування пам'ятки\\nСвітлина\\nДатування\\nМісцезнаходження\\nНомерКороткі відомості"},{"page_url":"https://zh.wikipedia.org/zh-mo/%E6%96%AF%E9%81%94%E6%BC%A2%E8%AB%BE%E5%A4%AB%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/MosMetro_Stakhanovskaya_%282020-01%29_-_platform_%282%29.jpg","page_title":"斯達漢諾夫站","context_page_description":"斯達漢諾夫站是莫斯科地鐵內克拉索夫卡線的一個興建中的車站。車站在2020年3月27日啟用。車站以斯達漢諾夫街命名，而該街名來自阿列克謝·斯達漢諾夫，是一名被認定為社會主義勞動英雄的煤礦工。"},{"page_url":"https://en.wikipedia.org/wiki/Lacquerware","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Tiered_Stand_with_Designs_Alluding_to_The_Tale_of_Genji.jpg","page_title":"Lacquerware","context_page_description":"Lacquerware are objects decoratively covered with lacquer. Lacquerware includes small or large containers, tableware, a variety of small objects carried by people, and larger objects such as furniture and even coffins painted with lacquer. Before lacquering, the surface is sometimes painted with pictures, inlaid with shell and other materials, or carved. The lacquer can be dusted with gold or silver and given further decorative treatments.\\nEast Asian countries have long traditions of lacquer work, going back several thousand years in the cases of China, Japan and Korea. The best known lacquer, an urushiol-based lacquer common in East Asia, is derived from the dried sap of Toxicodendron vernicifluum. Other types of lacquers are processed from a variety of plants and insects. The traditions of lacquer work in Southeast Asia and the Americas are also ancient and originated independently. True lacquer is not made outside Asia, but some imitations, such as Japanning in Europe, or parallel techniques, are often loosely referred to a \\"lacquer.\\""},{"page_url":"https://it.wikipedia.org/wiki/Orchestra_Sinfonica_Siciliana","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Palermo_Teatro_Politeama_BW_2012-10-09_16-44-27.jpg","page_title":"Orchestra Sinfonica Siciliana","context_page_description":"L'Orchestra Sinfonica Siciliana è una fondazione culturale italiana con sede a Palermo."},{"page_url":"https://nl.wikipedia.org/wiki/Kleurlading","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Quark_colourchange2.png","page_title":"Kleurlading","context_page_description":"In de deeltjesfysica is kleurlading een eigenschap van quarks en gluonen, die gerelateerd is aan de sterke wisselwerking van de deeltjes in de theorie van kwantumchromodynamica. Kleurlading heeft analogieën met de notie van elektrische lading van de deeltjes, maar vanwege de wiskundige complicaties van QCD zijn er veel technische verschillen. De \\"kleur\\" van quarks en gluonen staat volledig los van visuele perceptie van kleur. Het is een grillig gekozen naam voor een eigenschap die zich bijna niet manifesteert bij afstanden boven de grootte van een atoomkern. De term kleur werd gekozen omdat de abstracte eigenschap, waaraan deze term refereert, betrekking heeft op drie aspecten, dit naar analogie met de drie primaire kleuren rood, groen en blauw. Ter vergelijking: elektromagnetische lading heeft één enkel aspect, dat de waarden positief of negatief kan aannemen.\\nIn 1964, kort nadat het bestaan van quarks voor het eerst werd voorgesteld, introduceerde Oscar Greenberg het begrip \\"kleurlading\\" om uit te leggen hoe quarks binnen een aantal hadronen in verder identieke kwantummechanische toestanden naast elkaar kunnen bestaan zonder het uitsluitingsprincipe van Pauli te overtreden."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stra%C3%9Fen_und_Pl%C3%A4tze_in_Berlin-Kaulsdorf","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4f/Drausnitzer_Stra%C3%9Fe%2C_Berlin-Kaulsdorf%2C_783-665%2C-118.jpg","page_title":"Liste der Straßen und Plätze in Berlin-Kaulsdorf","context_page_description":"Die Liste der Straßen und Plätze in Berlin-Kaulsdorf beschreibt das Straßensystem des Ortsteils Kaulsdorf im Bezirk Marzahn-Hellersdorf mit den entsprechenden historischen Bezügen. Gleichzeitig ist diese Zusammenstellung eine der Listen aller Berliner Straßen und Plätze."},{"page_url":"https://pl.wikipedia.org/wiki/Nepomucena_Kostecka","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Nepomucena_Kostecka_%2876911%29.jpg","page_title":"Nepomucena Kostecka","context_page_description":"Nepomucena Kostecka, z domu Żółkowska – polska aktorka."},{"page_url":"https://sv.wikipedia.org/wiki/Sobralia_decora","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Sobralia_sessilis_%28S._decora%29_-_habitat.jpg","page_title":"Sobralia decora","context_page_description":"Sobralia decora är en orkidéart som beskrevs av James Bateman. Sobralia decora ingår i släktet Sobralia och familjen orkidéer. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://en.wikipedia.org/wiki/LGBT_Mormon_people_and_organizations","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Dabakis.JPG","page_title":"LGBT Mormon people and organizations","context_page_description":"Although the historical record is often scarce, evidence points to LGBT individuals having existed in the Mormon community since its beginnings, and estimates of the number of LGBTQ former and current Mormons range from 4 to 10% of the total membership of the LDS Church. However, it wasn't until the late 1950s that top LDS leaders began regularly discussing queer people in public addresses. Since the 1970s a greater number of LGBT individuals with Mormon connections have received media coverage."},{"page_url":"https://de.wikipedia.org/wiki/Action_Replay","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Action_replay_ds.JPG","page_title":"Action Replay","context_page_description":"Action Replay ist ein Markenname der Firma Datel, unter dem ein Cheatmodul für Spielkonsolen und Computer verkauft wird. Das Steckmodul ist zurzeit für Nintendo GameCube, Game Boy Advance, PlayStation 2, Xbox, Nintendo DS, Nintendo Wii, PlayStation Portable und Nintendo 3DS erhältlich."},{"page_url":"https://it.wikipedia.org/wiki/Teologia_dell%27Olocausto","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Mnachem_Risikoff.JPG","page_title":"Teologia dell'Olocausto","context_page_description":"Teologia dell'Olocausto\\nsi riferisce ad un corpo di dibattiti e riflessioni teologiche e filosofiche, e relativa letteratura, nell'ambito dell'Ebraismo, che tenta di affrontare con diverse opinioni contrastanti, il ruolo di Dio nell'universo e nel mondo del genere umano, alla luce dell'Olocausto avvenuto dai primi anni 1930 fino al 1945, quando circa 11 milioni di persone, tra cui 6 milioni di Ebrei, sono stati sterminati in un genocidio perpetrato dal regime nazista e suoi alleati. La \\"Teologia dell'Olocausto\\" viene anche definita come \\"Theologie nach Auschwitz\\" (dal tedesco: \\"teologia dopo Auschwitz\\" o \\"teologia post-Auschwitz\\"), a causa della pratica comune di utilizzare Auschwitz come sineddoche dell'Olocausto nel suo complesso."},{"page_url":"https://en.wikipedia.org/wiki/Porter_County_Memorial_Opera_Hall","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/OH_NE_view_2-26-14_075.jpg","page_title":"Porter County Memorial Opera Hall","context_page_description":"The Porter County Memorial Hall, also known as Memorial Opera House, is an historic Grand Army of the Republic memorial hall located in Valparaiso, Indiana. It was the meeting place of Chaplain Brown GAR Post No. 106, one of 592 GAR posts in Indiana. Designed in 1892 by a local architect, Charles F. Lembke., using Romanesque styling, it was built in 1892-3 to seat 100 people. It was also used as the local opera house.\\nLocal legend says that Wm Jennings Bryan spoke at the hall during the 1896 presidential campaign. Others who have been to the hall include Theodore Roosevelt, John Phillips Sousa, Marx Brothers. Decline began with the advent of the movies, for which it was converted. By the time of World War II it was an abandoned building. Beginning in 1955, the Community Theatre Guild leased the property and began maintaining it once again for theater productions, continuing to do so under a lease agreement with Porter County until the county again took full possession in the late 1990s to facilitate structural renovation and restoration."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%93%D0%B5%D0%BE%D0%B3%D1%80%D0%B0%D1%84%D1%96%D1%8F_%D0%9F%D0%B0%D0%BD%D0%B0%D0%BC%D0%B8","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b0/Satellite_image_of_Panama_in_March_2003.jpg","page_title":"Географія Панами","context_page_description":"Панама — північноамериканська країна, що знаходиться на крайньому півдні континенту ⮷. Загальна площа країни 75 420 км², з яких на суходіл припадає 74 340 км², а на поверхню внутрішніх вод — 1 080 км². Площа країни втричі більша за площу Луганської області України."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8B%D6%80%D5%A1%D5%A3%D5%B6%D5%A4%D5%A1%D5%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Lennnakan.jpg","page_title":"Ջրագնդակ","context_page_description":"Ջրագնդակ, թիմային սպորտաձև գնդակով, որտեղ երկու հակառակորդ թիմեր փորձում են գնդակը մտցնել հակառակորդի դարպասը: Խաղերը անցկացվում են լողավազաններում։ Ոչ պաշտոնական, ընկերական հանդիպումները կարող են անցկացվել բացօթյա լողավազաններում։\\nԱյն հայտնաբերվել է XIX դարի երկրորդ կեսին Մեծ Բրիտանիայում Վիլյամ Վիլսոնի կողմից։ Խաղի ստեղծման նախադրյալը հանդիսացավ ռեգբին: Խաղի նախորդ տարբերակներում թույլատրվում էր գնդակի համար պայքարը ուժի միջոցով՝ հակառակորդին կարելի էր պահել ջրի տակ, որպեսզի խլեն գնդակը։ Դարպասապահը գտնվում էր դաշտից դուրս, և պետք է աշխատել որսալ գնդակը։ Խաղը ձեռք բերեց ժամանակակից տեսք 1880-ական թվականներին։ Ջրագնդակ խաղում են աշխարհի գրեթե բոլոր երկրներում։ Խաղը առավել հայտնի է Հունգարիայում և նախկին Հարավսլավիայում:"},{"page_url":"https://fr.wikipedia.org/wiki/Gare_d%27Oku","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/JRE-tohoku-main-line-oku-station.jpg","page_title":"Gare d'Oku","context_page_description":"La gare d'Oku est une gare ferroviaire de la ville de Tokyo au Japon. Elle est située dans l'arrondissement de Kita. La gare est exploitée par la compagnie JR East."},{"page_url":"https://en.wikipedia.org/wiki/Lester_Barnard","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Lester_S_Barnard_Mo_State.jpg","page_title":"Lester Barnard","context_page_description":"Lester Smith Barnard was an American football, basketball, baseball, and track coach. He served as the head football coach at West Tennessee Normal School—now known as the University of Memphis—from 1922 to 1923 and Central Michigan University from 1924 to 1925, compiling a career college football coaching record of 22–7–6. Barnard was also the head basketball coach at West Tennessee from 1922 to 1924 and Central Michigan from 1924 to 1926, tallying a career college basketball mark of 22–37. He was a twin brother of Chester S. Barnard. In 1985, he died at the age of 90 in California."},{"page_url":"https://pl.wikipedia.org/wiki/Bitwa_pod_Rac%C5%82awicami","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Bitwa_pod_Raclawicami.jpg","page_title":"Bitwa pod Racławicami","context_page_description":"Bitwa pod Racławicami – zbrojne starcie wojsk polskich, pod dowództwem naczelnika Tadeusza Kościuszki z wojskami rosyjskimi, pod dowództwem generała majora Aleksandra Tormasowa. Bitwa miała miejsce 4 kwietnia 1794, w czasie insurekcji kościuszkowskiej, pod wsią Racławice, znajdującą się obecnie w powiecie miechowskim, w województwie małopolskim.\\nW wyniku wygranej wojsk polskich, pomimo niezbyt dużego znaczenia militarnego, pozwoliła podnieść morale powstańców już w dwanaście dni po rozpoczęciu powstania."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D1%8A%D0%BA_%D0%BD%D0%B0_%D1%81%D0%B2%D0%B5%D1%82%D0%BE%D0%B2%D0%BD%D0%BE%D1%82%D0%BE_%D0%BA%D1%83%D0%BB%D1%82%D1%83%D1%80%D0%BD%D0%BE_%D0%B8_%D0%BF%D1%80%D0%B8%D1%80%D0%BE%D0%B4%D0%BD%D0%BE_%D0%BD%D0%B0%D1%81%D0%BB%D0%B5%D0%B4%D1%81%D1%82%D0%B2%D0%BE_%D0%BD%D0%B0_%D0%AE%D0%9D%D0%95%D0%A1%D0%9A%D0%9E_%D0%B2_%D0%90%D1%84%D1%80%D0%B8%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/TUNISIE_KAIROUAN_03.jpg","page_title":"Списък на световното културно и природно наследство на ЮНЕСКО в Африка","context_page_description":"Това е списък на обектите от световното културно и природно наследство на ЮНЕСКО в Африка. На континента се намират 78 обекта, от които 42 са културни, 33 природни и 3 със смесено значение."},{"page_url":"https://lmo.wikipedia.org/wiki/Wattwil","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Wattwil_stacidomo_595.jpg","page_title":"Wattwil","context_page_description":"Wattwil a l'è un cumün svizzer del distret eletural de Toggenburg, in del Canton San Gal. La süperfiss del teritori del cumün l'è de 43.93 km² e in del Dicember 2011 al gh'eva una popolazion de 8108 abitant.\\nEl cumün de Wattwil al se tröva a una altitüden de 610 meter sura al livel del mar e l'è tacaa ai cumün de Neckertal, Bütschwil, Ebnat-Kappel, Ernetschwil, Goldingen, Gommiswald, Hemberg, Krinau, Lichtensteig, Mosnang, Oberhelfenschwil, Sankt Gallenkappel. La popolaziun l'è in magioranza de lengua todesca."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%85%D8%AD%D9%85%D8%AF_%D9%85%D8%AE%D8%A8%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Mokhber_04.jpg","page_title":"محمد مخبر","context_page_description":"محمد مخبر، رئیس ستاد اجرایی فرمان امام است که از سال ۱۳۸۶ در این ستاد فعالیت دارد و پیش از این معاونت بازرگانی و حمل و نقل بنیاد مستضعفان و ریاست هیئت مدیره بانک سینا و معاونت استانداری خوزستان را بر عهده داشته‌است. او همچنین پیش از فعالیت در بنیاد، در سِمت معاون اجرایی و مدیر عامل شرکت مخابرات خوزستان و مدیر عامل شرکت مخابرات دزفول مشغول بوده است.\\nوی دارای دو مدرک دکتری، شامل دکتری حقوق بین الملل و دکترای رشته مدیریت می‌باشد. او همچنین دارای مدرک کارشناسی ارشد در رشته مدیریت با گرایش سیستم‌ها است."},{"page_url":"https://sv.wikipedia.org/wiki/Karl_Lasch","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/General_Government_for_the_occupied_Polish_territories.png","page_title":"Karl Lasch","context_page_description":"Karl Lasch, född 29 december 1904 i Kassel, död 3 juni 1942 i Breslau, var en tysk nazistisk politiker. Han var promoverad jurist och Sturmbannführer i SA."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%B0%D0%BB%D0%BA%D0%BE%D0%BC_%D0%9C%D0%B0%D0%BA%D0%BB%D1%96%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Malcolm_McLean_at_railing%2C_Port_Newark%2C_1957_%287312751706%29.jpg","page_title":"Малком Маклін","context_page_description":"Малькольм Перселл Маклін американський бізнесмен. Транспортний підприємць, який розробив сучасний інтермодальний транспортний контейнер, який революціонізував транспорт і міжнародну торгівлю в другій половині ХХ століття. Контейнеризація призвела до значного зменшення витрат на вантажні перевезення, усунувши необхідність повторної взаємодії з окремими вантажами, а також підвищення надійності, зниження крадіжок вантажів і скорочення витрат на запаси за рахунок скорочення часу перевезення."},{"page_url":"https://en.wikipedia.org/wiki/Rolls_family","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Panhard_%26_Levassor_autocar%2C_C_S_Rolls_driver_and_George_V.jpg","page_title":"Rolls family","context_page_description":"The Rolls family were substantial landowners and benefactors in and around Monmouth in south east Wales. Charles Stewart Rolls was the co-founder of the Rolls-Royce company. The ascent of the family to the aristocracy was through marriage.\\nThe family's arms were described in 1852 as:\\nQuarterly: 1st and 4th, or, on a fesse, dancettée, with plain cotises between three billets, sa., each charged with a lion, rampant, of the field, as many bezants; 2nd, gu., an eagle, displayed, barry of six, erminois and az.; 3rd, or, a saltier, sa., in chief, a leopard's face, of the second."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%A9%DB%8C%D9%85_%DB%8C%D8%A7%D9%86%DA%AF_%D8%AF%D8%A7%D8%A6%D9%87","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/41/Kim_Yong-Dae.jpg","page_title":"کیم یانگ دائه","context_page_description":"کیم یانگ دائه یک بازیکن فوتبال اهل کره جنوبی است.\\nوی همچنین در تیم‌های ملی فوتبال کره جنوبی کره جنوبی کره جنوبی بازی کرده‌است."},{"page_url":"https://es.wikipedia.org/wiki/Cruzpampa","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Cruzpampa_00266.jpg","page_title":"Cruzpampa","context_page_description":"Cruzpampa es el nombre de un conjunto arqueológico del Perú, en el departamento de Huánuco."},{"page_url":"https://pl.wikipedia.org/wiki/Krobielewko","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/MOs810%2C_WG_2015_8_%28Glaz_Edka%2C_Edek_erratic%29_%282%29.JPG","page_title":"Krobielewko","context_page_description":"Krobielewko – wieś w Polsce położona w województwie lubuskim w powiecie międzyrzeckim w gminie Skwierzyna. Siedziba sołectwa.\\nW latach 1945-54 siedziba gminy Krobielewko. W latach 1975–1998 miejscowość administracyjnie należała do województwa gorzowskiego."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%9B%E0%B8%A3%E0%B8%B0%E0%B8%A7%E0%B8%B1%E0%B8%95%E0%B8%B4%E0%B8%A8%E0%B8%B2%E0%B8%AA%E0%B8%95%E0%B8%A3%E0%B9%8C%E0%B8%82%E0%B8%AD%E0%B8%87%E0%B8%88%E0%B8%B4%E0%B8%95%E0%B8%A3%E0%B8%81%E0%B8%A3%E0%B8%A3%E0%B8%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/China.Terracotta_statues007.jpg","page_title":"ประวัติศาสตร์ของจิตรกรรม","context_page_description":"ประวัติศาสตร์ของจิตรกรรม เริ่มสร้างกันมาตั้งแต่ก่อนประวัติศาสตร์และเผยแพร่ไปในทุกวัฒนธรรมและทุกที่ตั้งทางภูมิศาสตร์ในโลกจนกระทั่งปัจจุบันนี้ จนกระทั่งต้นคริสต์ศตวรรที่ 20 จิตรกรรมจะเป็นการเขียนศิลปะแสดงลักษณ์, ศิลปะศาสนา หรือศิลปะคลาสสิก หลังจากนั้นจึงมีการเริ่มเขียนจิตรกรรมที่เป็นแต่เพียงศิลปะนามธรรม และต่อมาศิลป์มโนทัศน์\\nการวิวัฒนาการของจิตรกรรมตะวันตกคล้ายคลึงกับการวิวัฒนาการของจิตรกรรมตะวันออกโดยทั่วไปในสองสามร้อยปีหลัง ศิลปะแอฟริกา, ศิลปะอิสลาม, ศิลปะอินเดีย, ศิลปะจีน, และศิลปะญี่ปุ่น แต่ละอย่างที่กล่าวมาต่างก็มีอิทธิพลสำคัญต่อศิลปะตะวันตก และในที่สุดศิลปะก็กลับไปมีอิทธิพลต่อศิลปะตะวันออก"},{"page_url":"https://fr.wikipedia.org/wiki/Georges_Borchard","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Georges_Borchard_en_1907.jpg","page_title":"Georges Borchard","context_page_description":"Georges Borchard est un joueur français de rugby à XV, l'un de ceux qui ont découvert le Tournoi des Cinq Nations."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Notre-Dame-de-la-Purification_de_Lauris","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/78/ND_de_la_Purification_-_Orgue.JPG","page_title":"Église Notre-Dame-de-la-Purification de Lauris","context_page_description":"L'église Notre-Dame-de-la-Purification est l'église paroissiale de la commune de Lauris, dans le Vaucluse. Elle est classée au titre des monuments historiques depuis 1990."},{"page_url":"https://cy.wikipedia.org/wiki/SETD2","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/PBB_GE_SETD2_215038_s_at_fs.png","page_title":"SETD2","context_page_description":"Protein sy'n cael ei godio yn y corff dynol gan y genyn SETD2 yw SETD2 a elwir hefyd yn SET domain containing 2. Segment o DNA yw'r genyn, sy'n amgodio ffwythiant arbennig. Mae'r genyn yma wedi ei leoli ar yr edefyn ôl o gromosom dynol 3, band 3p21.31."},{"page_url":"https://fr.wikipedia.org/wiki/Architecture_des_temples_hindouistes","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Ettumanoor_temple_north_gate.JPG","page_title":"Architecture des temples hindouistes","context_page_description":"L'architecture des temples hindous présente une grande variété selon les époques, les matériaux utilisés, les régions et les cultures, initialement en Inde. De nombreux temples de religion hindoue se trouvent en dehors de l'Inde, soit dans les pays qui ont été dirigés par des souverains de religion hindoue, soit dans les régions avec une forte immigration de population indienne.\\nLe temple hindou est, avant tout, la demeure de la divinité. Au cœur du sanctuaire se trouve sa statue ; pour la divinité sont célébrés les rituels, dont la puja, le rite d'offrande et d'adoration. Mais les rituels, comme la puja, sont souvent effectués en dehors du temple, comme à la maison ou dans la rue. Le temple est un lieu pour le darshan, pour la pūjā, la méditation, parmi les autres activités religieuses qui s'effectuent à l'abri du temple.\\nLes temples hindouistes sont dédiés, d'habitude, à une divinité primaire, appelée la divinité tutélaire, et à d’autres divinités subalternes associées à la divinité principale. En matière d'architecture on peut dégager quelques règles générales."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A7%D0%BE%D0%BD%D0%B1%D0%BE%D0%BA%D1%87%D1%83%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Korean_abalone_porridge-Jeonbokjuk-02.jpg","page_title":"Чонбокчук","context_page_description":"Чонбокчук — разновидность рисовой каши с морским ушком и белым рисом. Морское ушко считалось в Корее престижной едой и часто подавалось королю. Это блюдо является региональным деликатесом острова Чеджудо. Чонбокчук — не только деликатес, но и питательное блюдо для больных или пожилых людей. Чонбокчук может быть приготовлен как с внутренними органами ушка, так и только с мышечной тканью. Последний внешне более светлый, цвета слоновой кости."},{"page_url":"https://de.wikipedia.org/wiki/Abtei_Marienstatt","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Thomas_Denter.jpg","page_title":"Abtei Marienstatt","context_page_description":"Die Abtei Marienstatt ist ein Zisterzienserkloster und Wallfahrtsort in der Ortsgemeinde Streithausen, Westerwaldkreis, Rheinland-Pfalz. Sie liegt in einem Tal vier Kilometer von Hachenburg entfernt direkt an der Nister.\\nDer Klosterort Marienstatt umfasst die Abtei selbst, eine frühgotische Basilika mit der größten Orgel im Westerwald, eine Bibliothek, ein Brauhaus mit Restaurant, eine Buch- und Kunsthandlung, ein Gästehaus und ein Gymnasium in privater Trägerschaft, das altsprachlich orientiert arbeitet."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Grundschulen_in_Dresden","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/DD-49.Grundschule.jpg","page_title":"Liste der Grundschulen in Dresden","context_page_description":"Die Liste der Grundschulen in Dresden führt alle bestehenden öffentlichen und freien Grundschulen in der sächsischen Landeshauptstadt Dresden auf."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D1%8B%D0%B1%D0%BE%D1%80%D1%8B_%D0%B2_%D0%A1%D0%B5%D0%BD%D0%B0%D1%82_%D0%A1%D0%A8%D0%90_%D0%BE%D1%82_%D0%9A%D0%B0%D0%BB%D0%B8%D1%84%D0%BE%D1%80%D0%BD%D0%B8%D0%B8_(1950)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Earl_Warren_Portrait%2C_half_figure%2C_seated%2C_facing_front%2C_as_Governor.jpg","page_title":"Выборы в Сенат США от Калифорнии (1950)","context_page_description":"Выборы в Сенат США от Калифорнии прошли 7 ноября 1950 года. Предвыборная кампания сопровождалась взаимными обвинениями и оскорблениями. Кандидат республиканской партии, Конгрессмен Ричард Никсон победил кандидата от демократов, Хелен Гаган Дуглас. Действующий сенатор-демократ Шеридан Доуни на очередной срок не баллотировался — он выбыл из гонки ещё на стадии праймериз.\\nНиксон и Дуглас объявили о своём участии в выборах ещё в конце 1949 года. В марте 1950 действующий сенатор Доуни объявил, что завершает политическую карьеру. После этого, о своей кандидатуре объявил издатель газеты «Los Angeles Daily News» Манчестер Боди. На стадии праймериз Боди часто отмечал, что взгляды Дуглас «чересчур левые». Именно он первым сравнил Дуглас и конгрессмена из Нью-Йорка Вито Маркантонио. Праймериз у республиканцев были менее конкурентными: Никсон был явным фаворитом и серьезной оппозиции не имел.\\nНиксон и Дуглас выиграли праймериз республиканской и демократической партии соответственно, Манчестер Боди же занял второе место."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Eintr%C3%A4ge_im_National_Register_of_Historic_Places_im_Nicollet_County","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8e/2009-0805-MN-StPeter-MontogomeryHouse.jpg","page_title":"Liste der Einträge im National Register of Historic Places im Nicollet County","context_page_description":"Die Liste der Einträge im National Register of Historic Places im Nicollet County in Minnesota führt alle Bauwerke und historischen Stätten im Nicollet County auf, die in das National Register of Historic Places aufgenommen wurden."},{"page_url":"https://hu.wikipedia.org/wiki/Jan%C3%A1ky_Istv%C3%A1n_(%C3%A9p%C3%ADt%C3%A9sz,_1938%E2%80%932012)","image_url":"https://upload.wikimedia.org/wikipedia/hu/7/79/NAKI_1975b.jpg","page_title":"Janáky István (építész, 1938–2012)","context_page_description":"Janáky István képzőművészeti indíttatású konceptuális építész, a kortárs magyar regionalista építészet iskolateremtő alakja, Ybl-díjas DLA egyetemi docens. Mesterei közé tartozott id. Janáky István, Szendrői Jenő és Arnóth Lajos, de jelentős mértékben hatott rá Földesi Lajos, Gulyás Zoltán, Molnár Péter és Molnár Farkas munkássága is."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_saints_du_XXe_si%C3%A8cle","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/PilarSanFrBor.jpg","page_title":"Liste des saints du XXe siècle","context_page_description":"Cette liste de saints concerne les saints, bienheureux, et vénérables reconnus comme tels par l'Église catholique, ayant vécu au XXᵉ siècle. Sur cette période, l'Église a donné comme modèles évangéliques 152 saints et 2 038 bienheureux."},{"page_url":"https://de.wikipedia.org/wiki/Alfa_Romeo_Nuvola","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/AR-Nuvola-1.jpg","page_title":"Alfa Romeo Nuvola","context_page_description":"Der Alfa Romeo Nuvola ist ein fahrbereites Konzeptfahrzeug des italienischen Automobilherstellers Alfa Romeo, das erstmals 1996 auf dem Pariser Autosalon vorgestellt wurde. Das Design des zweitürigen Sportcoupés kombinierte klassische Gestaltungselemente mit aktuellen Konstruktionsmerkmalen."},{"page_url":"https://pl.wikipedia.org/wiki/Gminy_w_Szwecji","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Tyres%C3%B6_Municipality_in_Stockholm_County.png","page_title":"Gminy w Szwecji","context_page_description":"Szwecja podzielona jest na 21 regionów administracyjnych i 290 gmin. Niniejsza tabela zawiera listę szwedzkich gmin."},{"page_url":"https://ru.wikipedia.org/wiki/Space_Engineers","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Space_Engineers_6.jpg","page_title":"Space Engineers","context_page_description":"Space Engineers — воксельная игра-песочница о строительстве и обслуживании космических структур. Игра стала доступна в Steam Early Access с 23 октября 2013 года.\\n28 февраля 2019 года состоялся релиз игры на платформе Windows.\\nИгра основана на графическом движке VRage 2.0 собственной разработки компании-создателя Keen Software House."},{"page_url":"https://de.wikipedia.org/wiki/Jakow_Timofejewitsch_Tscherewitschenko","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Yakov_Cherevichenko.jpg","page_title":"Jakow Timofejewitsch Tscherewitschenko","context_page_description":"Jakow Timofejewitsch Tscherewitschenko war im Zweiten Weltkrieg ein sowjetischer Generaloberst und Armeeführer."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0_(%D1%82%D0%B8%D0%BF_%D1%80%D0%B5%D1%87%D0%BD%D1%8B%D1%85_%D1%81%D1%83%D0%B4%D0%BE%D0%B2)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/%D0%A2%D0%B5%D0%BF%D0%BB%D0%BE%D1%85%D0%BE%D0%B4_%D0%90%D0%B2%D1%80%D0%BE%D1%80%D0%B0_%D1%82%D0%B8%D0%BF%D0%B0_%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0.jpg","page_title":"Москва (тип речных судов)","context_page_description":"«Москва́» — серия двухпалубных пассажирских речных теплоходов, предназначенных для водных транспортных перевозок на местных линиях, а также для работы на прогулочных и экскурсионных маршрутах.\\nВ оригинальном виде теплоход имеет закрытый пассажирский салон с мягкими и комфортными креслами, также пассажиры могут размещаться на скамейках, установленных на крыше надстройки, под навесом, за ходовой рубкой. Благодаря своим техническим характеристикам и неприхотливости в обслуживании теплоходы типа «Москва» получили популярность в СССР и за его пределами. После изготовления теплоходы получали наименования, в Союзе, «Москва-цифра» например «Москва-80»."},{"page_url":"https://fr.wikipedia.org/wiki/Universit%C3%A9_d%E2%80%99Antsiranana","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Biblioth%C3%A8que_Universitaire.jpg","page_title":"Université d’Antsiranana","context_page_description":"L'université d'Antsiranana est un établissement public d'enseignement supérieur situé tout près du Pain de Sucre à Antsiranana, une ville portuaire du nord de Madagascar."},{"page_url":"https://it.wikipedia.org/wiki/AFI%27s_100_Years..._100_Stars","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Busterkeaton_edit.jpg","page_title":"AFI's 100 Years... 100 Stars","context_page_description":"L'AFI's 100 Years... 100 Stars è una lista che fa parte delle AFI 100 Years... series, stilate annualmente dall'American Film Institute dal 1998, che comprende le cinquanta più grandi star del cinema statunitense.\\nÈ stata resa pubblica il 16 giugno 1999 in uno speciale televisivo della CBS, nel corso del quale 50 star contemporanee hanno presentato i 50 nominativi della lista.\\nPer la selezione dei 500 candidati è stato adottato un criterio cronologico: il debutto sullo schermo cinematografico non doveva essere successivo al 1950 o, nell'eventualità lo fosse, la carriera dell'attore doveva essere conclusa in modo definitivo, per il suo decesso. Perciò figurano in lista James Dean, Grace Kelly e Audrey Hepburn, che hanno debuttato dopo quella data, ma sono morti rispettivamente nel 1955, nel 1982 e nel 1993. Se il debutto della celebrità risale esattamente al 1950, l'attore può comunque far parte della lista, infatti nella lista compaiono attori come Marlon Brando e Sophia Loren, i quali hanno debuttato proprio nel 1950."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%96%B0%E8%A5%BF%E7%8F%AD%E7%89%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Map_of_the_Viceroyalty_of_New_Spain.svg","page_title":"新西班牙","context_page_description":"新西班牙总督辖区，西班牙管理北美洲和菲律宾的一个殖民地总督辖地，首府位于墨西哥城。新西班牙总督的管辖范围包含今墨西哥、中美洲、美国加利福尼亚州、内华达州、犹他州、科罗拉多州、亚利桑那州、新墨西哥州、得克萨斯州、今日加拿大英属哥伦比亚的西南部，加上危地马拉都督府和古巴都督府，以及亚洲的菲律宾都督府。\\n中国明代传教士艾儒略所著《职方外纪》称为“新以西把尼亚”。\\n1535年后，殖民地开始由新西班牙总督实行君权统治，总督由西班牙国王指派。首府设在墨西哥城。\\n新西班牙的领土有些被其他欧洲强权夺取，有些独立建国，而其核心区域则一直在西班牙统治下，直到1821年独立成墨西哥第一帝国，该帝国解体后成为今日的墨西哥和中美洲。新西班牙的行政区划高度在地化，其分区以气候、地形、原住民人口密度进行划分。墨西哥中部与南部原住民人口密度高，拥有复杂的社会、政治和经济组织。墨西哥北部的原住民则是游牧或半游牧民族，本来无法发展成密集人口的社会。然而1540年代于萨卡特卡斯发现了银矿后，开始涌入更多的定居人口。银矿不只是新西班牙的经济命脉，同时也是西班牙快速致富的关键，改变了全球经济。新西班牙是菲律宾贸易在新世界的终点站，使得该地成为西班牙新世界帝国与亚洲帝国之间的重要连接点。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D1%83%D0%B7%D0%B5%D1%97_%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/World_leaders_at_the_32nd_G8_Summit%2C_Strelna%2C_Russia_-_20060716.jpg","page_title":"Музеї Санкт-Петербурга","context_page_description":"Список музеїв Санкт-Петербурга:\\nУ Санкт-Петербурзі існує понад 200 музеїв та їхніх філій.\\nДо списку включені більшість загальнодоступних музеїв Санкт-Петербурга.\\nСаме в Санкт-Петербурзі вперше в Росії відкрилися публічні музеї. З 1702 року були видані укази Імператора Петра Ι про збирання та зберіганні моделей та різних рідкісних предметів. 1714 року засновано перший державний загальнодоступний музей — Кунсткамера, до складу якої увійшли «Кунскабінет» і «Мюнскабінет»."},{"page_url":"https://en.wikipedia.org/wiki/Chickasaw_Nation","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Chickasaw_Nation_map.png","page_title":"Chickasaw Nation","context_page_description":"The Chickasaw Nation is a federally recognized Native American nation, located in Oklahoma in the United States. The Chickasaw Nation originated in its homeland of the American Southeast, with territory in what is defined as modern-day Mississippi, Tennessee, Alabama and Kentucky.\\nIn the eighteenth and nineteenth centuries, European Americans knew the Chickasaw as one of the historic Five Civilized Tribes, all of whom were based in what became the Southeastern United States."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%96%B0%E4%B8%89%E6%B2%B3%E5%B3%B6%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Keisei_Shinmikawashima_sta_002.jpg","page_title":"新三河島站","context_page_description":"新三河島車站是位於日本東京都荒川區西日暮里六丁目，屬於京成電鐵本線的鐵路車站。車站編號是KS03。"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%BD%91%E7%BB%9C%E5%B9%BF%E6%92%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Sample_Webcast_Screenshot.png","page_title":"网络广播","context_page_description":"網路廣播是使用串流媒體技術、通過網際網路將單個內容源分發給眾多同時收聽或觀看者的媒體呈現方式。網路廣播可以是實況或按需分發。基本上，網路廣播是通過網際網路進行「廣播」。\\n大型的網路廣播平台包括現有的廣播電台和電視台，以及大量僅限於網際網路平台的「電台」。網路廣播通常包括提供非互動式線性流或事件。權利和許可機構向希望使用受著作權保護的材料進行網際網路廣播的人提供具體的「網路廣播許可」。\\n網路廣播在商業部門廣泛應用於投資者關係介紹、資訊化教學和相關通信活動。然而，網路會議與網路會議不太相同，網路會議通常是為多對多互動而設計。\\n廉價、易存取的網路廣播技術已使獨立媒體蓬勃發展。已有不少引人關注的獨立節目通過廣播定期線上播放。這些節目通常由普通市民在家中製作，範圍涵蓋有關電腦、技術、新聞等諸多興趣和主題，並在不斷增加新的節目。\\n網路廣播與Podcast的不同之處在於，網路廣播是直播，而Podcast是將媒體檔案上傳、存放到網際網路上。"},{"page_url":"https://en.wikipedia.org/wiki/Marija_Au%C5%A1rin%C4%97_Pavilionien%C4%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Ausrine_Marija_Povilioniene_by_Augustas_Didzgalvis.jpg","page_title":"Marija Aušrinė Pavilionienė","context_page_description":"Marija Aušrinė Pavilionienė is a Lithuanian philologist, professor, human rights activist, feminist writer and politician. She had been a member of Seimas from 2004 to 2008 as a member of Liberal Democratic Party of Lithuania and since 2009 as a member of Social Democratic Party of Lithuania.\\nMarija Aušrinė was born in the family of actors Vladas Fedotas-Sipavičius and Jadvyga Ramanauskaitė and finished the 23rd Vilnius School. In 1967 she graduated from Vilnius State University, continuing her studies in American literature problems. In 1977 she maintained a thesis for a PhD degree in Philology in Taras Shevchenko National University of Kyiv.\\nHer husband Rolandas Pavilionis was a Member of the European Parliament and had been a dean of Vilnius University from 1990 to 2000. The two had two sons, one of whom is an ambassador to the United States."},{"page_url":"https://fr.wikipedia.org/wiki/Tadeusz_Zwiefka","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Tadeusz_Zwiefka_%2826-05-2009%29.jpg","page_title":"Tadeusz Zwiefka","context_page_description":"Tadeusz Antoni Zwiefka, né le 28 décembre 1954, est un homme politique polonais, membre de la Plate-forme civique."},{"page_url":"https://es.wikipedia.org/wiki/Elecciones_generales_de_Uruguay_de_2009","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Papeleta_anulaci%C3%B3n_Ley_de_Caducidad.jpg","page_title":"Elecciones generales de Uruguay de 2009","context_page_description":"Las elecciones generales del Uruguay se llevaron a cabo en dos vueltas. La primera tuvo lugar el día domingo 25 de octubre de 2009 y la segunda el día domingo 22 de noviembre de 2009. En esta última instancia resultó vencedora la fórmula presidencial del Frente Amplio, integrada por José Mujica y Danilo Astori."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_H%C3%B6hn","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ea/MK11331_H%C3%B6hn-Sch%C3%B6nberg_Kirche_StJosef_und_Pfarrhaus.jpg","page_title":"Liste der Kulturdenkmäler in Höhn","context_page_description":"In der Liste der Kulturdenkmäler in Höhn sind alle Kulturdenkmäler der rheinland-pfälzischen Ortsgemeinde Höhn einschließlich des Ortsteils Schönberg aufgeführt. Im Ortsteil Neuhochstein sind keine Kulturdenkmäler ausgewiesen. Grundlage ist die Denkmalliste des Landes Rheinland-Pfalz."},{"page_url":"https://fr.wikipedia.org/wiki/Colonne_de_Santa_Felicita","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a2/Colonna_di_Santa_Felicita.JPG","page_title":"Colonne de Santa Felicita","context_page_description":"La Colonne de Santa Felicita est une colonne commémorative comportant un chapiteau corinthien, située face à l'église de Santa Felicita à Florence."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%94%B0%E5%8E%9F%E5%9D%82%E9%A7%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Tabaruzaka_station_1.jpg","page_title":"田原坂駅","context_page_description":"田原坂駅は、熊本県熊本市北区植木町轟にある、九州旅客鉄道鹿児島本線の駅である。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A5%D1%83%D0%B4%D0%BE%D0%B6%D0%B5%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D1%8B%D0%B9_%D0%BC%D1%83%D0%B7%D0%B5%D0%B9_%D0%BD%D0%B0_%D0%BC%D0%BE%D1%80%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/PMMK.JPG","page_title":"Художественный музей на море","context_page_description":"Художественный музей на море, также известный по сокращённым названием Mu.ZEE — художественный музей в Остенде, Бельгия. Музей специализируется на бельгийском искусстве после 1830. У музея имеется два филиала, дом Джеймса Энсора в Остенде и музей Пермеке в Яббеке."},{"page_url":"https://hr.wikipedia.org/wiki/Iseo","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/96/LagoIseo.jpg","page_title":"Iseo","context_page_description":"Jezero Iseo je šesto jezero po veličini u Italiji, četvrto u Lombardiji.\\nJezero leži u podnožju Alpa u dolini Camonica između gradova Brescia i Bergamo. Upravno je teritorij jezera podjeljen između pokrajina Brescia i Bergamo. Dolina Camonico je vrlo industrijalizirana, no unatoč tome prirodni okoliš je još uvijek dobro očuvan. Nekad je uz sjeverni dio jezera išao vrlo gust cestovni promet prema Švicarskoj, na uskoj i opasnoj cesti, tako da su mnogi automobili završili u vodama jezera. Danas se taj cestovni pravac puno rjeđe koristi jer je probijena puno sigurnija nova cesta kroz planine.\\nNa sredini jezera nalazi se otok Monte Isola, najveći jezerski otok u Južnoj Europi."},{"page_url":"https://bg.wikipedia.org/wiki/Amphiglossus_mandady","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Amphiglossus_mandady_distribution.png","page_title":"Amphiglossus mandady","context_page_description":"Amphiglossus mandady е вид влечуго от семейство Сцинкови."},{"page_url":"https://it.wikipedia.org/wiki/Sentiero_delle_Orobie","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/67/Sfinge_Ornica.jpg","page_title":"Sentiero delle Orobie","context_page_description":"Il sentiero delle Orobie è un sentiero montano, o alta via, che collega diversi rifugi e bivacchi delle Alpi Orobie, in provincia di Bergamo. Il sentiero si divide in due parti principali: la prima parte inizia dalla valle dello Stabina e si congiunge al tratto orientale presso il rifugio Fratelli Calvi.\\nLa seconda parte, la più conosciuta anche per la gara di interesse internazionale, invece, parte dall'ambiente calcareo della val Canale, si congiunge all'alta valle Brembana, percorre l'alta valle Seriana, attraversa la valle di Scalve, e si conclude nello spettacolare ambiente dolomitico della conca della Presolana, luogo privilegiato dal movimento degli arrampicatori, non solo bergamaschi."},{"page_url":"https://ast.wikipedia.org/wiki/Suillus_grevillei","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Suillus_grevillei_LC0109.jpg","page_title":"Suillus grevillei","context_page_description":".\\nSuillus grevillei, conocíu col nome común de boletu elegante, ye un fungu basidiomiceto del orde Boletales, qu'habita preferentemente en montes y plantíos de delles especies d'alerces, colos que forma asociaciones micorrícicas. Puede atopáse-y n'Europa, Norte d'Asia, Corea, Xapón, América del Norte, Australia y Nueva Zelanda. El cuerpu granible apruz dende branu a mediaos de seronda. Ye un fungu comestible, anque pocu apreciáu. Al igual que nel restu d'especies del xéneru Suillus, ye recomendable retirar la cutícula mafosa. Denominar col epítetu específicu \\"grevillei\\" n'homenaxe al micólogu escocés R. K. Greville."},{"page_url":"https://uz.wikipedia.org/wiki/Barbi%C3%A8res","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0e/Map_commune_FR_insee_code_26023.png","page_title":"Barbières","context_page_description":"Barbières Fransiyaning Rhône-Alpes mintaqasida joylashgan kommunadir. Drôme departamenti Valence tumani tarkibiga kiradi."},{"page_url":"https://pt.wikipedia.org/wiki/Televis%C3%A3o_na_Bulg%C3%A1ria","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/KinoNova.png","page_title":"Televisão na Bulgária","context_page_description":"A televisão na Bulgária foi introduzida em 1959. Embora o mercado da mídia búlgara seja pequeno, é altamente competitivos da Europa Central e Oriental. Participantes globais como a News Corporation, a Modern Times Group, a Central European Media Enterprises, a HD Sofia TV e a Fox Broadcasting Company, entre outras, operam os maiores e mais populares veículos de comunicação do país."},{"page_url":"https://it.wikipedia.org/wiki/Ca%27_Dario","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Claude_Monet_-_Palazzo_Dario%2C_Venice.JPG","page_title":"Ca' Dario","context_page_description":"Ca' Dario è un palazzo di Venezia, situato al civico 353 nel sestiere di Dorsoduro, che si affaccia direttamente sul Canal Grande. L'edificio è famoso per una serie non correlata di eventi spiacevoli successi ad alcuni dei suoi proprietari. Questo ha alimentato una suggestione popolare che vede l'edificio come \\"maledetto\\"."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B9%E3%82%AD%E3%83%AB%E3%83%88%E3%82%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Bundesarchiv_Bild_146-1985-101-36A%2C_Berlin%2C_Jo_Jo-Spiel.jpg","page_title":"スキルトイ","context_page_description":"スキルトイとは、 器用さや技術を要する玩具およびその玩具芸の事を意味する。広義ではパフォーマンス等に用いられる小道具も含まれる。 操作したり、回転させたり、投げたり、単に遊んだりすることができる。 ほとんどのスキルトイは一人で使用するが、フットバッグ、 ジャグリングなど、複数人で行うものもある。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%97%D0%B0%D0%B4%D0%BD%D0%B5%D0%BF%D0%B5%D1%82%D0%B5%D0%BB%D1%8C%D0%BD%D0%B0%D1%8F_%D0%B4%D0%B2%D0%B5%D1%80%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Tractor_belarus.jpg","page_title":"Заднепетельная дверь","context_page_description":"Заднепетельная дверь — тип двери, которая крепится шарнирно своим задним краем к тыльной части автомобиля. Из-за множества проблем заднепетельных дверей их использование в современных автомобилях встречается довольно редко."},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_S%C3%B6hnen_und_T%C3%B6chtern_der_Stadt_Buffalo","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/William_B_Kean.JPG","page_title":"Liste von Söhnen und Töchtern der Stadt Buffalo","context_page_description":"Dies ist eine Liste bekannter Persönlichkeiten, die in der US-amerikanischen Stadt Buffalo geboren wurden. Die Liste erhebt keinen Anspruch auf Vollständigkeit."},{"page_url":"https://eu.wikipedia.org/wiki/Schliengen","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/BW41_Schliengen.jpg","page_title":"Schliengen","context_page_description":"Schliengen Alemaniako udalerria da. Baden-Württemberg estatuan kokatuta dago, Lörrach barrutian. 2014an 5.386 biztanle zituen 37,46 kilometro koadrotan banatuta."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%A2%A8%E8%B6%8A%E5%B1%B1_(%E4%B8%8A%E6%9D%BE%E7%94%BA)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Mount_Kiso-Mae_from_Mount_Kisokoma_2010-9-26.jpg","page_title":"風越山 (上松町)","context_page_description":"風越山は、木曽山脈の宝剣岳から三ノ沢岳を経て西に延びた独標尾根上にある標高1,699mの山。山体すべてが長野県木曽郡上松町に属し、山頂には二等三角点がある。"},{"page_url":"https://en.wikipedia.org/wiki/Cuckoo_Line","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Cuckoo_Accident_AC_Elliott.jpg","page_title":"Cuckoo Line","context_page_description":"The Cuckoo Line is an informal name for the now defunct railway service which linked Polegate and Eridge in East Sussex, England, from 1880 to 1968. It was nicknamed the Cuckoo Line by drivers, from a tradition observed at the annual fair at Heathfield, a station on the route. At the fair, which was held each April, a lady would release a cuckoo from a basket, it being supposedly the 'first cuckoo of spring'.\\nThe railway line served the following Sussex communities: Polegate, Hailsham, Hellingly, Horam for Waldron, Heathfield, Mayfield, Rotherfield and Eridge. Services continued through Eridge and onward via Groombridge to Tunbridge Wells.\\nThe Hailsham-Eridge section closed in 1965, the Polegate-Hailsham branch surviving until 1968. Eridge-Tunbridge Wells closed in 1985, and this line has been resurrected as the Spa Valley Railway."},{"page_url":"https://war.wikipedia.org/wiki/Capreolus","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Capreolus_capreolus_2_Jojo.jpg","page_title":"Capreolus","context_page_description":"An Capreolus in uska genus han Mammalia. An Capreolus in nahilalakip ha familia nga Cervidae.\\nAn kladograma hini sumala ha Catalogue of Life:"},{"page_url":"https://nl.wikipedia.org/wiki/Epinette","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Epinette.PNG","page_title":"Epinette","context_page_description":"Een epinette is een snaarinstrument, een soort plankciter van ongeveer 1,5 meter lang. Het werd vroeger bespeeld met een stokje, maar tegenwoordig ook met de vingers.\\nHet epinette is een traditioneel muziekinstrument: het was het orgel van de arme kerken. Tegenwoordig zijn de dulcimer in Amerika en de citera in Hongarije dit nog.\\nEen epinette is doorgaans diatonisch, maar er zijn ook chromatische. Het instrument is familie van de hommel.\\nHet heeft twee groepen snaren:\\nmelodiesnaren\\nbourdonsnaren\\nMen bespeelt het met een plectrum in de rechterhand, en de linkerhand op de snaren als op een piano. Men maakt hierbij de noodzakelijke bewegingen met alleen de rechterhand, in tegenstelling met de oude methode waarbij in de linkerhand een stokje gehouden wordt terwijl de rechterhand een zeer ritmische beweging maakt over alle snaren.\\nHet epinette kende zijn hoogtepunt van 1918 tot 1935. Het werd gebruikt om oude melodietjes te begeleiden. Mazurka's, polka's, walsen en bourrées hebben vroeger veel componisten geïnspireerd, bijvoorbeeld Joseph Bodin de Boismortier, Vivaldi en Chedeville.\\nEr zijn nog diverse muziekgroepen die dit instrument bespelen."},{"page_url":"https://ca.wikipedia.org/wiki/Joseph_Privat_de_Moli%C3%A8res","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Privat_de_Moli%C3%A8res.png","page_title":"Joseph Privat de Molières","context_page_description":"Joseph Privat de Molières va ser un físic i matemàtic francès del segle XVIII professor del Collège Royal."},{"page_url":"https://hu.wikipedia.org/wiki/El_Hierro","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Collage_El_Hierro.jpg","page_title":"El Hierro","context_page_description":"El Hierro a maga 278 km²-es területével a Kanári-szigetek legnyugatibb tagja, és emellett a hét nagyobb sziget közül ez a legkisebb. Ez nem mindig volt így, ám ezelőtt mintegy 50 ezer évvel egy nagy földrengés eredményeként a tengerbe süllyedt a sziget északnyugati harmada. Szerte a szigeten mintegy ötszáz vulkáni kúp látható."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%AD%E0%B8%B2%E0%B8%81%E0%B8%B4%E0%B9%80%E0%B8%AD%E0%B8%B0_%E0%B8%AD%E0%B8%B2%E0%B9%80%E0%B8%9A%E0%B8%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/AkieAbe%2C_2007Apr27.jpg","page_title":"อากิเอะ อาเบะ","context_page_description":"อากิเอะ อาเบะ หรือที่รู้จักในนาม ดีเจอักกี เป็นภรรยาของชินโซ อาเบะนายกรัฐมนตรีคนปัจจุบันของญี่ปุ่น"},{"page_url":"https://pl.wikipedia.org/wiki/Hubbard_(lodowiec)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Hubbard_landsat-tn.jpg","page_title":"Hubbard (lodowiec)","context_page_description":"Hubbard – lodowiec znajdujący się na Alasce w Stanach Zjednoczonych oraz częściowo na Jukonie w Kanadzie. Jest największym uchodzącym do wody lodowcem Ameryki Północnej oraz największym tego typu niepolarnym lodowcem na świecie. W przeciwieństwie do większości znanych lodowców, od czasu, gdy został pierwszy raz naniesiony na mapy w 1895 roku, posuwa się naprzód w głąb Zatoki Alaski i przyrasta na grubość.\\nPowierzchnia lodowca Hubbard wynosi 2450 km². Swój początek bierze na stokach, wysokiego na 5959 m n.p.m., Mount Logan w kanadyjskim Jukonie. Spływa stamtąd, kończąc swój bieg w wodach zatoki Disenchantment Bay i Fiordu Russella w pobliżu Yakutat na Alasce.\\nObecna długość lodowca wynosi około 123 km. Jego cielące się wciąż czoło sięga 11,4 km w głąb zatoki, a jego wysokość wynosi, zależnie od pory roku, od 60 do 100 m ponad poziomem morza. Krzywoliniowa szerokość czoła wynosi obecnie 11,5 km. Pomiary wykonane w latach 1986 i 1991 wykazały, że jego łożysko, w odległości 1,5 km do czoła w górę biegu, jest położone na głębokości 414 m poniżej poziomu morza. Zachodnia część lodowca na długości 2 km od czoła złożona jest z lodu pochodzącego z lodowca Valerie."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%82%A4%E3%83%80%E3%83%9B%E5%B7%9E%E3%81%AE%E6%97%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Flag_of_Idaho.svg","page_title":"アイダホ州の旗","context_page_description":"アイダホ州の旗は、アメリカ合衆国アイダホ州の州旗。青地に州章がデザインされている。公式の記述によると、州旗の周りに金色で縁取りされているのが正式だが、多くの版で縁取りがないものもある。\\n州章には、鉱夫及び女性が登場し、平等、自由、正義を象徴している。またアイダホ州の主要な天然資源である鉱物、森林、田園、野生動物が示されている。\\nこの旗は、1899年の米西戦争の際にアイダホ第一連隊によって使用された旗に基づいてデザインされた。1907年3月12日に承認され、1957年に少し変更された。"},{"page_url":"https://bar.wikipedia.org/wiki/Zapotekn","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b9/Panorama_of_Monte_Alban_from_the_South_Platform.jpg","page_title":"Zapotekn","context_page_description":"De Zapotekn woan a oids Voik in Mesoamerica. So richti sans noch de Oimekn afbliaht. Eana oide Haubtschtod Monte Alban woa a wichtigs Haundlszentrum in Isthmus owi bis za de Maya. Und in Nuadn aufi in de Kapitale vo Teotihuacan. In dera Schtod haums sogoa an eignan Schtodteu bsidlt ghobd, in dem se sogoa de oanzign Schriftfund dahoidn hom."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_kulturn%C3%ADch_pam%C3%A1tek_v_B%C5%99eclavi","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/%C5%A0kola_%28Po%C5%A1torn%C3%A1%29.JPG","page_title":"Seznam kulturních památek v Břeclavi","context_page_description":"Tento seznam nemovitých kulturních památek ve městě Břeclav v okrese Břeclav vychází z Ústředního seznamu kulturních památek ČR, který na základě zákona č. 20/1987 Sb., o státní památkové péči, vede Národní památkový ústav jako ústřední organizace státní památkové péče. Údaje jsou průběžně upřesňovány, přesto mohou obsahovat i řadu věcných a formálních chyb a nepřesností či být neaktuální.\\nPokud byly některé části dotčeného území vyčleněny do samostatných seznamů, měly by být odkazy na tyto dílčí seznamy uvedeny v úvodu tohoto seznamu nebo v úvodu příslušné sekce seznamu."},{"page_url":"https://de.wikipedia.org/wiki/Georg_von_Wessel","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Georg_Christianowitsch_von_Wessel.jpg","page_title":"Georg von Wessel","context_page_description":"Georg Christianowitsch von Wessel war ein deutschbaltisch-russischer Artillerieoffizier der Kaiserlich Russischen Armee, Ingenieur und Hochschullehrer."},{"page_url":"https://es.wikipedia.org/wiki/D%C3%ADa_Mundial_de_la_Visi%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/WSD-Logo-2019-Open_Spanish-286x400.png","page_title":"Día Mundial de la Visión","context_page_description":"El segundo jueves del mes de octubre se celebra el Día Mundial de la Visión."},{"page_url":"https://de.wikipedia.org/wiki/The_Charm_the_Fury","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/The_Charm_the_Fury_-_Wacken_Open_Air_2018_03.jpg","page_title":"The Charm the Fury","context_page_description":"The Charm the Fury war eine 2010 gegründete Metalcore-/Post-Hardcore-Band aus Amsterdam, Niederlande. Die Band stand zuletzt bei Arising Empire und bei Nuclear Blast unter Vertrag."},{"page_url":"https://es.wikipedia.org/wiki/South_Williamsport","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d1/South_Williamsport_Pennsylvania_Panorama.jpg","page_title":"South Williamsport","context_page_description":"South Williamsport es un borough ubicado en el condado de Lycoming en el estado estadounidense de Pensilvania. En el año 2000 tenía una población de 6,412 habitantes y una densidad poblacional de 1,318.1 personas por km².​"},{"page_url":"https://en.wikipedia.org/wiki/Major_Taylor","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Marshall_Taylor_family.jpg","page_title":"Major Taylor","context_page_description":"Marshall Walter \\"Major\\" Taylor was an American professional cyclist. He was born and raised in Indianapolis, where he worked in bicycle shops and began racing multiple distances in the track and road disciplines of cycling. As a teenager, he moved to Worcester, Massachusetts, with his trainer and had a successful amateur career, which included breaking track records.\\nTaylor turned professional in 1896, at the age of 18, living in cities on the East Coast and participating in multiple track events including six-day races. He moved his focus to the sprint event in 1897, competing in a national racing circuit, winning many races and gaining popularity with the public. Between 1898 and 1899, he set numerous world records in race distances ranging from the quarter-mile to the two-mile.\\nTaylor won the sprint event at the 1899 world track championships to become the first African American to achieve the level of cycling world champion and the second black athlete to win a world championship in any sport. He was also a national sprint champion in 1899 and 1900. He raced in the U.S., Europe and Australasia between 1901 and 1904, beating the world's best riders."},{"page_url":"https://en.wikipedia.org/wiki/Seth_Stammler","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Seth_Stammler_Army_vs_NY_Red_Bulls-TWG-037.jpg","page_title":"Seth Stammler","context_page_description":"Seth Stammler is a retired American soccer player."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%AF%B8%EA%B5%AD_%EC%84%B1%EA%B3%B5%ED%9A%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/ECUSA_Southern_Ohio.png","page_title":"미국 성공회","context_page_description":"미국성공회는 미국의 성공회이며, 세계성공회공동체에 속해 있다.\\n미국성공회의 신도수는 약 300만명이고, 8개의 관구가 소속 되어있다. 그리고 역대 미국 대통령 가운데 12명을 배출한 기독교 교파이다."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%95%E1%83%94%E1%83%9A%E1%83%95%E1%83%98%E1%83%A9%E1%83%98%E1%83%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Welwitschia_mirabilis_MHNT.BOT.2015.2.2.jpg","page_title":"ველვიჩია","context_page_description":"ველვიჩია — შიშველთესლოვანი ორსახლიანი მცენარე ველვიჩიასებრთა ოჯახისა.\\nიზრდება მხოლოდ სამხრეთ-დასავლეთ ანგოლის ქვიან ნიადაგზე, ნამიბისა და კალაჰარის უდაბნოებში. მისი გრძელი და მძლავრი ფესვი ნიადაგში გრუნტის წყლებამდე ეშვება, აქვს დაბალი და მსხვილი ღერო, რომლის დიდი ნაწილი ნიადაგშია ჩამალული, მიწის ზემოთ კი მხოლოდ 50 სმ-ითაა ამოწეული. ღერო წვერში უნაგირივით არის ჩაზნექილი და მასზე ორი 3 მ-მდე სიგრძის ღვედისებრი ფოთოლია.\\nველვიჩია 100 წელზე მეტს ცოცხლობს და ფოთლებსაც ბოლომდე ინარჩუნებს."},{"page_url":"https://lb.wikipedia.org/wiki/Guimar%C3%A3es","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8d/Guimar%C3%A3es-Igreja-de-Nossa-Senhora-da-Oliveira.jpg","page_title":"Guimarães","context_page_description":"Guimarães [ gimɐ'ɾɐ̃ĩʃ ] ass eng Stad mat ronn 52.000 Awunner am Norde vu Portugal am Distrikt Braga. Si war déi éischt Haaptstad vum Land a gëtt dowéinst och Wéi vun der Natioun genannt.\\nD'Alstad vu Guimarães gehéiert zu der Weltierfschaft vun der UNESCO."},{"page_url":"https://en.wikipedia.org/wiki/Romanian_armies_in_the_Battle_of_Stalingrad","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Eastern_Front_1942-11_to_1943-03.png","page_title":"Romanian armies in the Battle of Stalingrad","context_page_description":"Two Romanian armies, the Third and the Fourth, were involved in the Battle of Stalingrad, helping to protect the northern and southern flanks respectively of the German 6th Army as it tried to conquer the city of Stalingrad, defended by the Soviet Red Army in mid to late 1942. Overpowered and poorly equipped, these forces were unable to stop the Soviet November offensive, which punched through both flanks and left the 6th Army encircled in Stalingrad. The Romanians suffered enormous losses, which effectively ended their offensive capability on the Eastern Front for the remainder of the war."},{"page_url":"https://en.wikipedia.org/wiki/Peace_Palace_(Cambodia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Vimean_Santepheap.JPG","page_title":"Peace Palace (Cambodia)","context_page_description":"The Peace Palace, also known as the Office of the Prime Minister of Cambodia, is the principal workplace of the Prime Minister of Cambodia. It is located in Phnom Penh. The building was officially inaugurated by King Norodom Sihamoni on 19 October 2010. Its overall cost was US$50 million. Aside from being the office of the Prime Minister, the Peace Palace has also chaired the East Asia Summit in 2012 and many other meetings with foreign leaders."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%85%D8%AA%D8%AD%D9%81_%D9%85%D8%AC%D9%85%D8%B9_%D8%A7%D9%84%D9%81%D9%86%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Art_Complex_Museum%2C_Duxbury_MA.jpg","page_title":"متحف مجمع الفنون","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nمتحف مجمع الفنون متحف فى امريكا."},{"page_url":"https://en.wikipedia.org/wiki/Tokoname_Station","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/MSN-TA22.png","page_title":"Tokoname Station","context_page_description":"Tokoname Station is a junction railway station in the city of Tokoname, Aichi, Japan, operated by Meitetsu."},{"page_url":"https://id.wikipedia.org/wiki/Molenvliet","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Candra_Naya.JPG","page_title":"Molenvliet","context_page_description":"Molenvliet adalah sebuah kanal dan nama daerah di sekitar kanal tersebut di Batavia, Hindia Belanda, yang selanjutnya menjadi bagian dari Jakarta, Indonesia. Setelah awal tahun 1960-an, daerah ini dikenal sebagai Jalan Gajah Mada dan Jalan Hayam Wuruk. Dibangun di bawah pimpinan kapiten Tionghoa bernama Phoa Beng Gan pada abad ke-17 untuk mengeringkan rawa-rawa di selatan Batavia, kanal Molenvliet kemudian dialiri oleh aliran Ciliwung dan Kali Krukut. Daerah ini menghubungkan Oud Batavia dan Weltevreden serta menjadi daerah komersial dan permukiman elite."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%98%86%E9%99%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Koyaike_2.jpg","page_title":"昆陽","context_page_description":"昆陽は、兵庫県伊丹市の地名。現行の行政地名は町丁が昆陽一丁目から昆陽八丁目まであり、2007年までは昆陽1〜8丁目からやや離れた南方に大字昆陽が存在した。\\n本項では、旧大字昆陽の一部であった昆陽泉町、昆陽池、昆陽北、昆陽東、昆陽南についても解説する。"},{"page_url":"https://pl.wikipedia.org/wiki/Barbara_Morgan","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/ff/Morgan_.jpg","page_title":"Barbara Morgan","context_page_description":"Barbara Radding Morgan – amerykańska nauczycielka i astronautka."},{"page_url":"https://eo.wikipedia.org/wiki/Sevilo","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Metropolparasolnov2011001.jpg","page_title":"Sevilo","context_page_description":"Sevilo aŭ ankaŭ Seviljo estas hispana urbo ĉe rivero Gvadalkiviro. Ĝi sidas sudokcidente en Iberia duoninsulo, kaj estas ĉefurbo de la Aŭtonoma Komunumo Andaluzio kaj de la samnoma provinco.\\nSevilo estas la kvara hispana urbo laŭ loĝantaro kun 699145 loĝantoj. Ĝia historia urboparto estas la plej vasta de Hispanio kaj unu el la tri plej grandaj de tuta Eŭropo kune al Venecio kaj Ĝenovo, kun 3,94 kvadrataj kilometroj, kaj ĝia historia urboparto unu el la plej grandaj de Hispanio. Inter ĝiaj plej karakterizaj monumentoj troviĝas la katedralo, la Alkazaro, la Ĝenerala Arkivo de Indioj kaj la Ora Turo, el kiuj la unuaj tri estis deklaritaj Monda heredaĵo de Unesko kiel tutaĵo en 1987.\\nLa haveno de Sevilo, situanta je 80 km de la Atlantika oceano, estas la sola marhaveno de Hispanio en interna urbo, ĉar la rivero Gvadalkiviro estas navigebla ekde la enfluejo en Sanlúcar de Barrameda ĝis la sevila ĉefurbo, kvankam la grando de la ŝipoj kiuj aliras al la urbo estas limigita per kluzo kun kareno maksimume 8,5 m kaj la Ponto de la 5a Centjariĝo kiu limigas la aeran karenon je 42 m.\\nSevilo disponas je disvolviĝinta reto de transporto per ŝoseo kaj fervojo, same kiel internacia flughaveno."},{"page_url":"https://tr.wikipedia.org/wiki/Basamak_piramidi","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Smaller_IMG_1512.jpg","page_title":"Basamak piramidi","context_page_description":"Basamak piramidi, normal bir piramidi andıran, ancak basamaklar halinde yükselen mimari yapılara verilen addır. Farklı kültürlerde farklı örnekleri bulunan basamak piramitlerinin genellikle tapınak yahut mezar olacak şekilde inşa edildiği görülse de, bu iki özelliğin aynı anda var olduğu örnekler de bulunmaktadır."},{"page_url":"https://it.wikipedia.org/wiki/Guerre_ottomano-asburgiche","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Andrea_Doria.jpg","page_title":"Guerre ottomano-asburgiche","context_page_description":"Le guerre ottomano-asburgiche comprendono un insieme di conflitti militari che contrapposero l'Impero ottomano e la Casa d'Asburgo tra il XVI ed il XIX secolo.\\nLe guerre si consumarono principalmente tramite campagne terrestri sul suolo ungherese ma ebbero anche importanti ripercussioni sullo scacchiere mediterraneo, dovute alla contesa dei Turchi non solo con gli Asburgo d'Austria ma anche con gli Asburgo di Spagna.\\nLe iniziali campagne dei Turchi in Europa orientale si chiusero con un grande successo: la decisiva vittoria ottomana a Mohács trasformò il Regno d'Ungheria in uno stato vassallo dell'Impero ottomano. Gli Asburgo, nonostante gli appoggi garantiti loro dallo status di sovrani del Sacro Romano Impero Germanico, non riuscirono, per tutto il XVI secolo, a riconquistare l'Ungheria.\\nLa situazione di guerra costante che interessò l'Europa nel Seicento smosse le acque in favore dell'Austria. Seppur provati dagli impegni della Guerra dei Trent'anni ed ormai privi della sovranità sull'antico impero germanico, gli Asburgo seppero infliggere pesanti sconfitte ad Istanbul nella seconda metà del secolo, annettendo buona parte delle terre ungheresi."},{"page_url":"https://en.wikipedia.org/wiki/Fred_W._Hastings","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Senator_Fred_W._Hastings.jpg","page_title":"Fred W. Hastings","context_page_description":"Fred W. Hastings was an American politician in the state of Washington. He served in the Washington State Senate and Washington House of Representatives. From 1929 to 1931, he was President pro tempore of the Senate. He died in 1932."},{"page_url":"https://vi.wikipedia.org/wiki/Zea_mexicana","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Maize-teosinte.jpg","page_title":"Zea mexicana","context_page_description":"Zea mexicana là một loài thực vật có hoa trong họ Hòa thảo. Loài này được Kuntze miêu tả khoa học đầu tiên năm 1904."},{"page_url":"https://he.wikipedia.org/wiki/%D7%95%D7%99%D7%A7%D7%98%D7%95%D7%A8_%D7%93%D7%95%D7%A8%D7%91%D7%90%D7%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Victor_Durbal_03408.JPG","page_title":"ויקטור דורבאל","context_page_description":"גנרל של דיוויזיה ויקטור לואיס לוסיאן דורבאל היה מפקד בכיר בצבא צרפת במלחמת העולם הראשונה."},{"page_url":"https://es.wikipedia.org/wiki/Almug%C3%A1bares","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Estandarte_Almugabar.gif","page_title":"Almugábares","context_page_description":"Almugábares, Compañía Almogávar de Zaragoza es una asociación cultural de recreación histórica que participa en eventos medievales. Recrea una compañía de almogávares de la Corona de Aragón entre los siglos XII y XIV, sus guerreros, sus familias y acompañantes en campañas bélicas.\\nLa asociación tiene los siguientes fines:\\nFomentar la cultura histórica.\\nDesarrollar actividades socioculturales.\\nRecuperar las tradiciones, historia medieval y manifestaciones artísticas aragonesas y de la Ciudad de Zaragoza.\\nLa defensa y difusión del patrimonio histórico, artístico y cultural.\\nConocer y difundir la historia medieval de Aragón y de la ciudad de Zaragoza\\nPara ello, se trasladan a la edad media, y reviven su modo de vida, tanto en vestimenta, armamento y costumbres. Sus integrantes organizan o participan en batallas, lizas, torneos, desfiles, paradas militares, exequias, acontecimientos medievales… en los eventos a los que acuden. El grupo también realiza exposiciones y charlas de “La Moneda en La Corona de Aragón”. Así como exposiciones de ropa, armamento, presentaciones y conferencias sobre: “Los Almogávares en la Corona de Aragón\\"."},{"page_url":"https://fr.wikipedia.org/wiki/Renfe-SNCF_en_Coop%C3%A9ration","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/J20_677_Bf_Perpignan%2C_9_100_221_Renfe.jpg","page_title":"Renfe-SNCF en Coopération","context_page_description":"Renfe-SNCF en Coopération est la dénomination commerciale des services ferroviaires de Grande vitesse entre la France et l’Espagne. Actuellement, l’offre de Renfe-SNCF en Coopération possède quatre rames qui permettent de relier des grandes villes des deux pays.\\nCette coopération a été renouvelée pour 2016 pour la grande vitesse.\\nElle existe depuis le 15 décembre 2013 et remplace donc les trains de nuit internationaux « Elipsos Trenhotel ».\\nEn 2015, elle connecte 21 destinations par 64 relations.\\nEn 2014, elle a transporté 1 875 000 voyageurs et 2 017 500 en 2015."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A0%D1%96%D1%87%D0%BA%D0%B8_%D0%A5%D0%B5%D1%80%D1%81%D0%BE%D0%BD%D1%81%D1%8C%D0%BA%D0%BE%D1%97_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/uk/a/a3/Ingulec%27_Mykil%27ske.JPG","page_title":"Річки Херсонської області","context_page_description":"Річки Херсонської області - річки на території Херсонщини."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%BE%D1%87%D1%91%D1%82%D0%BD%D1%8B%D0%B5_%D0%B7%D0%B2%D0%B0%D0%BD%D0%B8%D1%8F_%D0%90%D0%B7%D0%B5%D1%80%D0%B1%D0%B0%D0%B9%D0%B4%D0%B6%D0%B0%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/AZ_fexri_adlarinin_siyahilar%C4%B1.png","page_title":"Почётные звания Азербайджана","context_page_description":"Почётные звания Азербайджана — государственные награды Республики Азербайджана. Президент Азербайджанской Республики присваивает почётное звание по личной инициативе, а также по предложению Национального Собрания и Кабинета Министров. Награждённым почётными званиями вручается единый «Почётный знак Азербайджана»."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%80%E3%82%A4%E3%83%AF%E3%83%9C%E3%82%A6%E3%83%9B%E3%83%BC%E3%83%AB%E3%83%87%E3%82%A3%E3%83%B3%E3%82%B0%E3%82%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Midosuji-Daiwa-Bldg01.jpg","page_title":"ダイワボウホールディングス","context_page_description":"ダイワボウホールディングス株式会社は、日本のOA機器の販売を行う商社や繊維メーカーを統括する持株会社である。本社は大阪市。"},{"page_url":"https://sv.wikipedia.org/wiki/Raml%C3%B6sa_(stadsdel)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Raml%C3%B6sa_brunn_1816_2.jpg","page_title":"Ramlösa (stadsdel)","context_page_description":"Ramlösa är en stadsdel i den södra delen av Helsingborg. Den 31 december 2018 hade statistikområdet Ramlösa 4 414 invånare.\\nRamlösa är starkt förknippat med Ramlösa hälsobrunn och det mineralvatten som sedan länge är känt långt utanför både Skånes och Sveriges gränser. Under 1800-talets byggdes det mycket i Ramlösa och i stigande utsträckning blev brunnen en mötesplats för folk ur den skånska societeten. Ramlösa Hälsobrunn AB hämtar alltjämt sitt vatten via kulvertsystem från Ramlösadalen, men själva produktionen har flyttat upp till det närbelägna Ättekulla."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%B1%D9%8A%D8%AA%D8%B4%D9%85%D9%88%D9%86%D8%AF_%D9%87%D9%8A%D9%84,_%D8%A7%D9%88%D9%86%D8%AA%D8%A7%D8%B1%D9%8A%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Town_of_Richmond_Hill.JPG","page_title":"ريتشموند هيل, اونتاريو","context_page_description":"ريتشموند هيل, اونتاريو مدينه فى كندا."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%9C%8B%E7%AB%8B%E6%96%B0%E7%AB%B9%E6%95%99%E8%82%B2%E5%A4%A7%E5%AD%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/NHCUE_Gate.jpg","page_title":"國立新竹教育大學","context_page_description":"國立新竹教育大學，簡稱竹教、竹大、竹教大、新竹教大，舊稱則有竹師、新竹師院，是過去位於臺灣新竹市東區的一所教育大學，為今日國立清華大學南大校區前身。1940年4月創校，名為「臺灣總督府新竹師範學校」。1946年9月，更名為「臺灣省立新竹師範學校」。1965年8月，升格改制為「臺灣省立新竹師範專科學校」，設五年制國校師資科、國校美術師資科及二年制幼兒教育師資科。1987年7月，升格改制為「臺灣省立新竹師範學院」，設初等教育、語文教育、數理教育、社會科教育及美勞教育等五個學系，並附設二年制幼兒教育師資科。1991年7月，改隸教育部成為「國立新竹師範學院」。2005年8月，經行政院核定通過更名為「國立新竹教育大學」，為臺灣7所教育大學之一，改制成教育大學後，分為教育學院、理學院、及人文社會與藝術學院。同時為了因應臺灣教師需求的萎縮，除了教育學院的教育與學習科技學系、幼兒教育學系、特殊教育學系仍然保留師資培育架構外，其餘各系所已經轉型成一般大學架構，藉此增強和其他大學競爭的能力。自2006年開始，竹教大連續2年獲得教育部獎勵大學教學卓越計畫補助，在2007年也被教育部列為25所繁星計畫優質大學之一。\\n2016年10月14日，教育部核定竹教大與清大的合併案。11月1日，兩校正式合併為「國立清華大學」，106學年度起開始招生。"},{"page_url":"https://en.wikipedia.org/wiki/List_of_American_Civil_War_generals_(Confederate)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Portrait_of_George_Baird_Hodge%2C_head_and_shoulders%2C_facing_right.jpg","page_title":"List of American Civil War generals (Confederate)","context_page_description":"Assigned to duty by E. Kirby Smith\\nIncomplete appointments\\nState militia generals\\nThe Confederate and United States processes for appointment, nomination and confirmation of general officers were essentially the same. The military laws of the United States required that a person be nominated as a general officer by the president and be confirmed by the Senate and that his commission be signed and sealed by the president.\\nDespite legal interpretations that would preclude posthumous confirmation of appointments or delivery of commissions, the U.S. Senate and the Confederate Senate confirmed a few appointments of officers known to be dead and did not recall or revoke a few other confirmed appointments for officers who had recently died or died before receiving their commissions. No brevet appointments were made in the Confederate States Army but twenty acting or temporary general officers were authorized by and appointed under Confederate States law. At least one State militia had at least one brevet general.\\nAlthough not as prevalent as in the Union Army, some dates of rank in the Confederate States Army were before the date of appointment or commission."},{"page_url":"https://hu.wikipedia.org/wiki/Per_Ciljan_Skjelbred","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/08/Per_Ciljan_Skjelbres.jpg","page_title":"Per Ciljan Skjelbred","context_page_description":"Per Ciljan Skjelbred norvég labdarúgó, 2014 óta a német Hertha BSC középpályása. Korábban a Rosenborg és a Hamburger SV játékosa volt, 43 alkalommal ölthette magára a válogatott mezét, valamint viselhette a csapatkapitányi karszalagot is. 2017. február 22-én, 29 évesen lemondta a válogatottságot."},{"page_url":"https://en.wikipedia.org/wiki/Washingtonian_Hall","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Washingtonian_Hall_Summer_2013.JPG","page_title":"Washingtonian Hall","context_page_description":"Washingtonian Hall, also known as Amos Patterson House, is a historic home located at Endwell in Broome County, New York. It is a two-story, five bay, center entrance, frame Federal style house built in 1799–1800. It was moved a short distance from its original site in 1924 and subsequently remodeled in the Colonial Revival style. Also on the property are contributing structures dating to the mid-1920s including a carriage barn, small frame horse barn, pergola, brick driveway, garden house, and picket fence.\\nIt was listed on the National Register of Historic Places in 1996."},{"page_url":"https://ca.wikipedia.org/wiki/Patinatge_de_velocitat_als_Jocs_Ol%C3%ADmpics_d%27hivern_de_2006_-_5000_metres_femenins","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Clara_Hughes_at_WC_2007_in_Heerenveen.jpg","page_title":"Patinatge de velocitat als Jocs Olímpics d'hivern de 2006 - 5000 metres femenins","context_page_description":"Als Jocs Olímpics d'hivern de 2006 celebrats a la ciutat de Torí es disputà una prova de patinatge de velocitat sobre gel sobre una distància de 5.000 metres en categoria femenina que formà part del programa oficial dels Jocs.\\nLa prova es realitzà el dia 25 de febrer de 2006 a les instal·lacions de l'Oval Lingotto de la ciutat de Torí. Participaren un total de 16 patinadores de velocitat de 10 comitès nacionals diferents."},{"page_url":"https://eo.wikipedia.org/wiki/Glan_(Nahe)","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/64/Lauterecken_merian.jpeg","page_title":"Glan (Nahe)","context_page_description":"La Glan estas 90 km longa rivero en Sarlando kaj Rejnlando-Palatinato. Kiel plej gra londa flankrivero de la rivero Nahe ĝi deakvigas la plej grandan areon dekstre de la rivero. Ĝia eksterordinare granda akvokolekta areo de 1201 km² venas de tio, ke la Nordpalatinata Montlando gvidas preskaŭ ĉiuj akvejoj de la regiono al la Glan.\\nLa fonto de la Glan estas en Sarlando, sed dum 68 km ĝi fluas tra la nordokcidento de Palatinato, kies plej longa rivero ĝi estas."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A0%D7%95%D7%A8%D7%95%D7%95%D7%92%D7%99%D7%AA_%D7%97%D7%93%D7%A9%D7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Ivaraasen.jpg","page_title":"נורווגית חדשה","context_page_description":"נורווגית חדשה היא אחת משתי הצורות של השפה הנורווגית. שפה זו היא חלק מענף השפות הגרמאניות. כ-15% מאוכלוסיית נורווגיה משתמשת בה כשפה כתובה ומדוברת ראשית.\\nנורווגית חדשה ונורווגית ספרותית אינן ניבים - הן פשוט שתי דרכים שונות לדבר ולכתוב את אותה שפה - הנורווגית. אנשים מעטים מדברים את שתיהן באופן מילולי, אך יש ניבים אשר יותר קרובים לנורווגית ספרותית מאשר נורווגית חדשה, או להפך. בשביל ניבים אשר קרובים לשתיהן באותה המידה, מחליטה הממשלה המחוזית מה השפה המלומדת; או שהורי התלמידים מחליטים בשביל בתי-ספר המלמדים את שתי הצורות."},{"page_url":"https://pl.wikipedia.org/wiki/Dry_Ridge","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Saint_John_the_Baptist_Catholic_Church_%28Dry_Ridge%2C_Ohio%29_-_exterior.jpg","page_title":"Dry Ridge","context_page_description":"Dry Ridge – jednostka osadnicza w Stanach Zjednoczonych, w stanie Ohio, w hrabstwie Hamilton."},{"page_url":"https://pt.wikipedia.org/wiki/Modelo_de_Hopfield","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Energy_landscape.png","page_title":"Modelo de Hopfield","context_page_description":"Um modelo de Hopfield, também chamado de rede Hopfield, é uma forma de rede neural artificial recorrente popularizada por John Hopfield em 1982, mas descrita anteriormente por W. A. Little em 1974. Redes Hopfield servem como sistemas de memória de conteúdo direcionável com nós de limite binário. Garante-se que elas convertem a um mínimo local, mas às vezes convergirão a um falso padrão em vez de um padrão estabelecido. Redes Hopfield também oferecem um modelo para a compreensão da memória humana."},{"page_url":"https://es.wikipedia.org/wiki/L%C3%B3gica","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Time_Saving_Truth_from_Falsehood_and_Envy.jpg","page_title":"Lógica","context_page_description":"La lógica es la ciencia formal y rama tanto de la filosofía como de las matemáticas que estudia los principios de la demostración y la inferencia válida, ​ las falacias, las paradojas y la noción de verdad.​\\nLa lógica matemática es la rama más matemática de la lógica, que estudia la inferencia mediante sistemas formales como la lógica proposicional, la lógica de primer orden y la lógica modal. La lógica computacional es la aplicación de la lógica matemática a las ciencias de la computación. La lógica filosófica utiliza los métodos y resultados de la lógica moderna para el estudio de problemas filosóficos.\\nLos orígenes de la lógica se remontan a la Edad Antigua, con brotes independientes en China, India y Grecia. Desde entonces, la lógica tradicionalmente se considera una rama de la filosofía, pero en el siglo XX la lógica ha pasado a ser principalmente la lógica matemática, y por lo tanto ahora también se considera parte de las matemáticas, e incluso una ciencia formal independiente."},{"page_url":"https://en.wikipedia.org/wiki/Marie_Duplessis","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Alphonsine_Plessis_passport_1846.jpg","page_title":"Marie Duplessis","context_page_description":"Marie Duplessis was a French courtesan and mistress to a number of prominent and wealthy men. She was the inspiration for Marguerite Gautier, the main character of the 1848 novel La Dame aux Camélias by Alexandre Dumas the younger, one of Duplessis' lovers. Much of what is known about her has been derived from the literary persona and contemporary legends."},{"page_url":"https://en.wikipedia.org/wiki/Lakeside_Academy_(Lachine)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Lakeside_Academy.jpg","page_title":"Lakeside Academy (Lachine)","context_page_description":"Lakeside Academy is a public secondary school in the borough of Lachine of Montreal, Quebec, Canada. Part of the Lester B. Pearson School Board, the school was created in 2001 when two former high schools, Lachine High School and Bishop Whelan High School, were amalgamated. Lakeside has offered the International Baccalaureate Middle Years Program since 2001 to the Enriched students and to all its students since 2010, and it served as the set for the 2009 film The Trotsky.\\nThe communities that have the majority of students include the Montreal boroughs of Lachine, LaSalle, and Verdun; and the municipalities of Dorval, Kahnawake, and Montreal West.\\nIt offers many extra curricular sports - volleyball, soccer, touch football, flag football, rugby, basketball, indoor soccer, badminton, track and field and swimming.\\nEvery year the school puts on a play, a variety show and a music concert. It also has senior FRC robotics team and a junior Lego robotics team, In 2016 the school incorporated robotics into its Sec 1 curriculum.\\nIn 2012, the school hosted a fundraiser with The Montreal Jubilation Gospel Choir.\\nThe school was slated with closure on the 30 June 2016."},{"page_url":"https://eo.wikipedia.org/wiki/Tam%C3%A1s_Szekeres","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Keresztes_Ildiko_2010_5.jpg","page_title":"Tamás Szekeres","context_page_description":"Tamás Szekeres [tamAŝ sekereŝ], laŭ hungarlingve kutima sinsekvo Szekeres Tamás estas hungara ŝlagrokomponisto, gitaristo, tekstopoeto, orkestrestro, muzikinstruisto.\\nTamás Szekeres naskiĝis la 12-an de marto 1964 en Budapeŝto."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Saint-Martin_de_Triel-sur-Seine","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Triel-sur-Seine_%2878%29%2C_%C3%A9glise_Saint-Martin%2C_croisillon_nord%2C_vue_vers_l%27ouest_dans_le_bas-c%C3%B4t%C3%A9.JPG","page_title":"Église Saint-Martin de Triel-sur-Seine","context_page_description":"L'église Saint-Martin est une église catholique paroissiale située à Triel-sur-Seine, en France. C'est un vaste édifice issu de quatre époques différentes. En raison des agrandissements successifs entre la fin du XVᵉ siècle et le milieu du XVIᵉ siècle, le plan est devenu très complexe, et la nef gothique du second quart du XIIᵉ siècle ne représente plus qu'une partie infime de la superficie totale. À l'origine, est une église d'un plan cruciforme régulier. Les voûtes de son vaisseau central s'effondrent probablement au bout de deux générations, ce qui motive la reconstruction des parties hautes au début du XIVᵉ siècle. Elles se caractérisent par un triforium de style gothique rayonnant particulièrement élégant. L'église conserve toutefois le défaut d'un vaisseau central et d'un transept trop étroits, et les habitants y remédient à la fin du XVᵉ siècle en équipant l'église d'un second bas-côté sur tout son flanc sud, et d'une grande chapelle de deux vaisseaux au nord du transept et du chœur. Ces parties sont de style gothique flamboyant, et plus soignées et plus homogènes à l'extérieur qu'à l'intérieur, où le raccordement avec les parties anciennes est malaisé."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A5%D1%80%D0%BE%D0%BD%D0%BE%D0%BB%D0%BE%D0%B3%D0%B8%D1%98%D0%B0_%D0%A4%D0%9D%D0%A0%D0%88_%D0%B8_%D0%9A%D0%9F%D0%88_%D0%BE%D0%BA%D1%82%D0%BE%D0%B1%D0%B0%D1%80_1946.","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Zarko_Zrenjanin_monument.jpg","page_title":"Хронологија ФНРЈ и КПЈ октобар 1946.","context_page_description":"Хронолошки преглед важнијих догађаја везаних за друштвено-политичка дешавања у Демократској Федеративној Југославији и деловање Комунистичке партије Југославије, као и општа политичка, друштвена, спортска и културна дешавања која су се догодила у току октобра месеца 1946. године."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%AE%9E%E5%8C%85%E5%8B%BF%E5%8E%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Sarawakbintulusebauh.png","page_title":"实包勿县","context_page_description":"实巴荷县是砂拉越民都鲁省的一个县，总面积有5229.48平方公里，人口约2.1万。县里有4个小镇，6个甘榜和202个长屋，多数的地区可以通过陆路交通到达，但一些较深郊地区还是需要通过水路到达如：乌鲁班丹 宾友 和乌鲁浙拉隆。"},{"page_url":"https://sv.wikipedia.org/wiki/Masdevallia_livingstoneana","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Masdevallia_livingstoneana_Orchi_049.jpg","page_title":"Masdevallia livingstoneana","context_page_description":"Masdevallia livingstoneana är en orkidéart som beskrevs av Benedict Roezl och Heinrich Gustav Reichenbach. Masdevallia livingstoneana ingår i släktet Masdevallia och familjen orkidéer. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://ast.wikipedia.org/wiki/Ana_d%27Austria_(reina_de_Francia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Signature_of_Anne_of_Austria%2C_Queen_mother_of_France_in_1641.png","page_title":"Ana d'Austria (reina de Francia)","context_page_description":"Ana María Mauricia d'Austria y Austria-Estiria foi infanta d'España por ser fía de los reis Felipe III d'España y Margarita d'Austria-Estiria, y reina consorte de Francia y de Navarra pol so matrimoniu con Lluis XIII. Frutu d'esti matrimoniu nació'l famosu Rei Sol, Lluis XIV de Francia."},{"page_url":"https://de.wikipedia.org/wiki/Kiefernzapfenwanze","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Gastrodes.grossipes.-.lindsey.jpg","page_title":"Kiefernzapfenwanze","context_page_description":"Die Kiefernzapfenwanze ist eine Wanze aus der Familie der Rhyparochromidae."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%9C%E0%A5%8B%E0%A4%B8%E0%A5%87%E0%A4%AB_%E0%A4%B2%E0%A5%81%E0%A4%88_%E0%A4%B2%E0%A4%BE%E0%A4%97%E0%A5%8D%E0%A4%B0%E0%A4%BE%E0%A4%82%E0%A4%9C","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/19/Lagrange_portrait.jpg","page_title":"जोसेफ लुई लाग्रांज","context_page_description":"जोसेफ लुई लाग्रांज फ्रांस के गणितज्ञ थे। इनका जन्म 25 जनवरी 1736 ई. को ट्यूरिन में हुआ। 17 वर्ष की अल्पायु में ये राजकीय सैनिक अकादमी में गणित के प्रोफेसर नियुक्त हुए। गणित एवं खगोल शास्त्र को इनकी देन अपूर्व है। खगोल शास्त्र में इन्होंने \\"चंद्र-मुक्ति-सिद्धांत\\" तथा \\"बृहस्पति के चार उपग्रह संबंधी सिद्धांत\\" की व्याख्या पर अनेक अन्वेषण किए। 1766 ई. में ये बर्लिन में गणित के प्रोफेसर नियुक्त हुए। तदुपरांत लाग्रांज ने समीकरणों एवं संख्याओं के सिद्धांतों पर अनेक खोजें कीं और द्विघातीय अनिर्णीत समीकरण का हल दिया, तृतीय वर्ण के सारणिकों का सूची स्तंभ संबंधी अन्वेषणों में खूब प्रयोग किया और विचरण करलन की सहायता से काल्पनिक-वेग-सिद्धांत से यंत्रविज्ञान की संपूर्ण पद्धतियों का निगमन किया। इनके अतिरिक्त इन्होंने संभाव्यता, परिमित अंतर, आरोह सितत भिन्नों और दीर्घवृत्तीय समकलों पर भी अनेक अन्वेषण किए। इनके प्रसिद्ध ग्रंथ \\"मेकानिक अनालितिक\\", \\"लसों स्यूर न काल्क्युल दे फौंक्स्यों\\", रेजोल्यूस्यो देजोक्वास्यों न्यूमेरिक और \\"नूवैल मेथौद पूर रेज़ूद्र लेजाक्वस्यों लितेराल पार ल मुअइयें द सेरि\\" है। 10 अप्रैल 1813 ई. को पैरिस में इनका देहांत हो गया।"},{"page_url":"https://da.wikipedia.org/wiki/Komfur","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Aga_gc3.jpg","page_title":"Komfur","context_page_description":"Et komfur er en anordning i køkkenet til at opvarme gryder, pander osv. med, for det meste brugt i sammenhæng med madlavning. Der findes mange forskellige former for komfurer. I starten var komfuret egentlig bare en brændeovn med huller til gryder for oven, men der findes nu til dags mange forskellige, som fx gaskomfur og induktionskomfur."},{"page_url":"https://de.wikipedia.org/wiki/Filmjahr_2008","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Heath_Ledger.jpg","page_title":"Filmjahr 2008","context_page_description":"Die zehn erfolgreichsten Filme an den deutschen Kinokassen nach Besucherzahlen:"},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Pompei","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Campanile_Pompei_08_-_Vs_Vesuvio.jpg","page_title":"Pompei","context_page_description":"Pompei sī Italia Campania toā-khu Napoli Séng ê chi̍t ê comune."},{"page_url":"https://cs.wikipedia.org/wiki/Horn%C3%AD_Radslavice","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Horn%C3%AD_Radslavice%2C_lower_part.jpg","page_title":"Horní Radslavice","context_page_description":"Horní Radslavice jsou obec v okrese Žďár nad Sázavou v Kraji Vysočina, ležící 9 km západně od Velkého Meziříčí. Žije zde 87 obyvatel.\\nSousedními obcemi sídla jsou Uhřínov, Otín, Svatoslav, Pavlínov, Bochovice a Horní Heřmanice."},{"page_url":"https://tr.wikipedia.org/wiki/1920_Yunan_Yaz_Taarruzu","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Turkish_Prisoners_%28Izmit_1920%29.jpg","page_title":"1920 Yunan Yaz Taarruzu","context_page_description":"1920 Yunan Yaz Taarruzu, İngiliz kuvvetleri tarafından desteklenen Yunan ordusunun, Marmara Denizi'nin güney bölgesini ve Ege Bölgesi'ni, Ankara'daki geçici Büyük Millet Meclisi Hükûmeti'ne bağlı Kuvâ-yi Milliye'den ele geçirmek için yaptığı taarruzdur. Buna ek olarak, Anadolu'daki direniş hareketini ezmeye çalışan İstanbul'daki Osmanlı Hükûmeti'ne bağlı Kuvâ-yi İnzibâtiye tarafından Yunan ve İngiliz kuvvetleri desteklendi. Taarruz, Batı Cephesi'nin bir parçasıydı ve İngiliz birliklerinin ilerleyen Yunan ordusuna yardım ettiği birkaç angajmandan biriydi. İngiliz askerleri aktif olarak Marmara Denizi kıyı kasabalarını işgal etti. İtilaf Devletleri'nin onayı ile Yunanlar, 22 Haziran 1920'de saldırıya başladı ve 'Milne Hattı'nı geçti. 'Milne Hattı', Paris'te ortaya konan Yunanistan ile Türkiye arasındaki sınır çizgisi oldu. Batı Anadolu'da az sayıda ve kötü donanımlı birlikleri olduğu için Türklerin direnci sınırlıydı. Doğu ve güney cephelerinde de meşguldüler. Birtakım muhalefetin ardından, Mustafa Kemal Paşa'nın emriyle Eskişehir'e çekildiler."},{"page_url":"https://nl.wikipedia.org/wiki/Nationaal_Park_Bayerischer_Wald","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Nationalpark_Bayerischer_Wald.jpg","page_title":"Nationaal Park Bayerischer Wald","context_page_description":"Het Nationaal Park Bayerischer Wald werd in 1970 het eerste Nationale park van Duitsland. Sinds de uitbreiding van 1997 heeft het een oppervlakte van 24.250 hectare. Samen met het Bohemer Woud in Tsjechië vormt het \\"Bayerische Woud\\" het grootste samenhangende bos van Centraal-Europa.\\nHet nationale park is in 1972 erkend door de International Union for Conservation of Nature and Natural Ressources. In 1986 gevolgd door het Europadiploms der Kategorie A van de Raad van Europa.\\nDe organisatie heeft 200 man personeel. Het hoofdkantoor is gevestigd in Grafenau."},{"page_url":"https://ur.wikipedia.org/wiki/%DA%AF%D8%A7%D8%B1%DA%88%D9%86%D8%B1_%D8%A2%D8%B1%D9%85%DB%8C_%D8%A7%DB%8C%D8%A6%D8%B1%D9%81%DB%8C%D9%84%DA%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Gardner_Army_Airfield_-_USGS_Topo.jpg","page_title":"گارڈنر آرمی ایئرفیلڈ","context_page_description":"گارڈنر آرمی ایئرفیلڈ ریاستہائے متحدہ امریکا کا ایک فوجی اڈا جو کیرن کاؤنٹی، کیلیفورنیا میں واقع ہے۔"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A2%D0%B0%D0%BD%D0%B0%D0%BA%D0%B0_%D0%90%D1%81%D1%83%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Asuna_Tanaka_2012_%28cropped%29.jpg","page_title":"Танака Асуна","context_page_description":"Танака Асуна — японська футболістка, олімпійська медалістка."},{"page_url":"https://de.wikipedia.org/wiki/J%C3%BCdischer_Friedhof_(Affaltrach)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Affaltrachjudenfriedhof-04.JPG","page_title":"Jüdischer Friedhof (Affaltrach)","context_page_description":"Der Jüdische Friedhof in Affaltrach, einem Ortsteil der Gemeinde Obersulm im Landkreis Heilbronn im nördlichen Baden-Württemberg, diente ab etwa 1670 bis 1942 den Juden aus Affaltrach und weiteren umliegenden jüdischen Gemeinden als Begräbnisplatz."},{"page_url":"https://fr.wikipedia.org/wiki/Pujols-sur-Ciron","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Pujols-sur-Ciron_Bourg_4.jpg","page_title":"Pujols-sur-Ciron","context_page_description":"Pujols-sur-Ciron est une commune du Sud-Ouest de la France, située dans le département de la Gironde, en région Nouvelle-Aquitaine."},{"page_url":"https://tl.wikipedia.org/wiki/Estasyong_North_Avenue_(Ika-3_Linya)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/MRT-3_North_Avenue_Station_Platform_1.jpg","page_title":"Estasyong North Avenue (Ika-3 Linya)","context_page_description":"Ang Estasyon ng North Avenue o Himpilang North Avenue ay isang estasyon sa Linyang Dilaw. Ang himpilan ay isa sa maraming mga himpilang nakaakyat sa lupa. Nagsisilbi ang himpilan para sa \\"North Triangle\\" ng Lungsod Quezon. Ipinangalan ito sa Abenida North na malapit sa himpilan.\\nAng himpilan ay ang hilagang hangganan ng MRT-3 kung saan nagwawakas ang ruta ng mga treng MRT-3 mula sa Abenida Taft. Ito rin ang unang himpilan para sa mga tren na patungong Abenida Taft. Malapit ang himpilan sa Trinoma."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Wurzen_(A%E2%80%93J)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/WUR-Finstere-Gasse-Pfl1.jpg","page_title":"Liste der Kulturdenkmale in Wurzen (A–J)","context_page_description":"Die Liste der Kulturdenkmale in Wurzen enthält die Kulturdenkmale in Wurzen. Die Anmerkungen sind zu beachten.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale in Sachsen.\\nAufgrund der großen Anzahl von Kulturdenkmalen ist die Liste aufgeteilt in die\\nListe der Kulturdenkmale in Wurzen (A–J)\\nListe der Kulturdenkmale in Wurzen"},{"page_url":"https://sv.wikipedia.org/wiki/Lista_%C3%B6ver_fornl%C3%A4mningar_i_K%C3%A4vlinge_kommun","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/V%C3%A4stra_Karaby_25-2%2C_H%C3%B6g.jpg","page_title":"Lista över fornlämningar i Kävlinge kommun","context_page_description":"Lista över fornlämningar i Kävlinge kommun är en förteckning av ett urval av de fornlämningar som finns i Kävlinge kommun."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%81%AB%E3%81%A3%E3%81%BD%E3%82%93%E4%B8%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Nipponmaru-Yokohama.JPG","page_title":"にっぽん丸","context_page_description":"にっぽん丸は、商船三井客船が運航する、外航クルーズ客船である。内閣府が実施する青年国際交流事業「世界青年の船」と「東南アジア青年の船」でも使用されている。"},{"page_url":"https://arz.wikipedia.org/wiki/%D9%85%D8%A7%D8%AC%D9%86%D9%88%D8%B3_%D9%83%D8%A7%D9%87%D9%86%D8%A8%D9%8A%D8%B1%D8%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Magnus_Kahnberg2.JPG","page_title":"ماجنوس كاهنبيرج","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nماجنوس كاهنبيرج لاعب هوكى الجليد من السويد."},{"page_url":"https://fr.wikipedia.org/wiki/The_Last_Kingdom","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f5/Britain_802_de.svg","page_title":"The Last Kingdom","context_page_description":"The Last Kingdom est une série télévisée britannique, diffusée d'abord à partir du 10 octobre 2015 sur BBC America aux États-Unis et à partir du 22 octobre sur BBC Two au Royaume-Uni. La deuxième saison a été coproduite par la BBC et Netflix. Netflix est devenu le seul diffuseur depuis la troisième saison. Il s'agit de l'adaptation des romans historiques Les Histoires saxonnes de Bernard Cornwell.\\nEn Belgique, la série est diffusée depuis le 5 mars 2017 sur La Deux et en France sur Numéro 23. Au Québec et Nouveau-Brunswick, elle est disponible sur Netflix. Elle reste encore inédite dans les autres pays francophones."},{"page_url":"https://fr.wikipedia.org/wiki/Sites_m%C3%A9galithiques_de_la_Mayenne","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Saint_Pierre_des_Nids_53_Pierre_au_diable_03.jpg","page_title":"Sites mégalithiques de la Mayenne","context_page_description":"Cet article recense les sites mégalithiques de la Mayenne, en France."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Bauwerke_der_norddeutschen_und_rheinischen_Backsteingotik_in_Deutschland","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Heiligengrabe_Blutkapelle_2016_W.jpg","page_title":"Liste der Bauwerke der norddeutschen und rheinischen Backsteingotik in Deutschland","context_page_description":"Die Liste der Bauwerke der norddeutschen und rheinischen Backsteingotik in Deutschland ist Teil des Listenwerks Backsteinbauwerke der Gotik, der möglichst vollständigen Erfassung aller gotischen Backsteinbauten in Europa. Aufgenommen sind nur Bauwerke, an denen der Backstein irgendwo zutage tritt oder, bei geschlämmten Oberflächen, wenigstens die Backsteinstruktur von Mauerwerk erkennbar ist.\\nDie gotischen Backsteinbauwerke in diesen Regionen Deutschlands sind Teil des geographisch zusammenhängenden Bestandes der nördlichen Backsteingotik, der sich von der Straße von Dover bis nach Galizien erstreckt.\\nUmfang:\\nDiese Liste umfasst 1633 Bauwerke und Gruppen von Bauwerken.\\nNavigation:\\nDurch Anklicken der Pfeile an den Zeilenanfängen gelangt man aufwärts zum Kopf der jeweiligen Teilliste und zu den darüber platzierten Navigationsleisten. Abwärts gelangt man zu den Navigationsleisten unterhalb der Teilliste und dem Kopf der nächsten Teilliste.\\nSchriftbild/Schriftstile: Wo Bauten in mehreren Orten einer Gemeinde in Folge aufgeführt sind, wurde der Gemeindename beim erstgenannten Ort/Ortsteil fett gesetzt. Die Namen so gruppierter Ortsteile sind kursiv gesetzt.\\nGliederung:"},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A3%D8%AF%D8%B1%D8%A7%D9%86%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Adrano-Panorama.JPG","page_title":"أدرانو","context_page_description":"أذرنو مدينة في الجزء الشرقي من جزيرة صقلية الإيطالية ضمن مقاطعة كاتانيا. وتقع على بعد حوالي 41 كيلومتر شمال غرب مدينة قطانية. بالقرب من سفح جبل إتنا، عند نقطة التقاء نهري سيميتو وسالسو. عدد سكانها 35,611 نسمة. وهي المركز التجاري للمنطقة حيث ينمو الزيتون والحمضيات."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%AA%E0%AF%81%E0%AE%A4%E0%AF%81%E0%AE%9A%E0%AF%8D%E0%AE%9A%E0%AF%87%E0%AE%B0%E0%AE%BF","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4b/Puducherry_Immaculate_Conception_Cathedral_retouched.jpg","page_title":"புதுச்சேரி","context_page_description":"புதுச்சேரி அல்லது பாண்டிச்சேரி எனவும் இந்த ஒன்றியப் பகுதி அழைக்கப்படுகின்றது. சென்னை மாநகரில் இருந்து 170 கி.மீ. தொலைவில், இந்திய நடுவண் அரசின் ஒன்றியப் பகுதியாக வங்கக் கடலோரத்தில் அமைந்துள்ளது. முன்பு இந்த நகரம் பிரெஞ்சு நாட்டின் ஒரு பகுதியாக இருந்தது. புதுச்சேரி, ஏறக்குறைய இருநூறு ஆண்டுகளுக்கு மேல் பிரெஞ்சுக்காரர்களின் ஆதிக்கத்தில் இருந்தது. இதனை சுருக்கமாக புதுவை என்றும் அழைக்கப்படுகின்றது\\nஅதனால் இங்குள்ள அடித்தட்டு மக்களும் பிரெஞ்சுச் சொற்களை, மிகச் சாதாரணமாகப் பயன்படுத்துகின்றனர். ஆந்திர மாநிலத்தின், காக்கி நாடாவுக்கு அருகாமையில் உள்ள ஏனாம் நகரும், தமிழகத்தின், நாகப்பட்டினத்தின் அருகாமையில் உள்ள காரைக்கால் நகரும், கேரள மாநிலத்தின் கோழிக்கோட்டுக்கு அருகில் உள்ள மாஹே நகரும், இந்த மாநிலத்தின் ஆட்சிப் பகுதிகளாக விளங்குகின்றன.\\nஆகையால், ஆங்கிலம், பிரெஞ்சு, தமிழ் மொழிகளுடன், தெலுங்கு, மலையாளம் மொழி பேசும் மக்களும் சிறுபான்மையினராக இங்கு வாழ்ந்து வருகின்றனர்."},{"page_url":"https://en.wikipedia.org/wiki/Johannes_Hermanus_Michiel_Kock","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Johannes_Hermanus_Michiel_Kock.jpg","page_title":"Johannes Hermanus Michiel Kock","context_page_description":"Johannes Hermanus Michiel 'Jan' Kock was a Boer general and politician."},{"page_url":"https://es.wikipedia.org/wiki/Corralito_(C%C3%B3rdoba)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Escudo_de_Corralito_%28Cordoba%29.jpg","page_title":"Corralito (Córdoba)","context_page_description":"Corralito es una localidad situada en el departamento Tercero Arriba, Pedanía El Salto, provincia de Córdoba, Argentina.\\nSe encuentra situada sobre la ruta provincial 9, a 100 km de la capital provincial, la ciudad de Córdoba.​\\nLa principal actividad económica de la localidad es la agricultura seguida por la ganadería, siendo el principal cultivo la soja.\\nEntre los principales emprendimientos industriales de Corralito, se encuentra una planta dedicada al almacenamiento y conservación de cereales, para luego ser trasladados a la planta de deshidratación de alimentos y producción de aceites ubicada en la localidad de General Deheza, Córdoba, así como también una empresa local dedicada a la producción de aceite, llamada Trisoil."},{"page_url":"https://it.wikipedia.org/wiki/Crisi_venezuelana_del_1902-1903","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Caricature_of_Cipriano_Castro.jpg","page_title":"Crisi venezuelana del 1902-1903","context_page_description":"La Crisi venezuelana del 1902-1903 fu un blocco navale, durato dal dicembre 1902 al febbraio 1903, imposto da Gran Bretagna, Impero tedesco e Regno d'Italia nei confronti del Venezuela a seguito del rifiuto da parte del presidente venezuelano Cipriano Castro di pagare il debito estero e i danni subiti a cittadini europei durante la recente guerra civile venezuelana.\\nCastro pensava che, in virtù della Dottrina Monroe, gli Stati Uniti avrebbero impedito eventuali azioni militari da parte di stati europei, ma al momento gli Stati Uniti videro tale dottrina come riguardante solo un eventuale occupazione territoriale, non un divieto di interventi militari. Con la promessa da parte degli stati europei coinvolti che non ci sarebbe stata nessuna occupazione, il governo statunitense diede il via libera all'intervento. La flotta anglo-italo-tedesca impose il blocco navale, riuscendo facilmente a neutralizzare le navi della marina venezuelana, ma Castro rifiutò di cedere, preferendo presentare alcune delle richieste a un arbitrato internazionale, arbitrato che Castro aveva precedentemente rifiutato."},{"page_url":"https://nl.wikipedia.org/wiki/Cumbia","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Monumento_a_la_cumbia.JPG","page_title":"Cumbia","context_page_description":"Cumbia is een Colombiaanse muziek- en dansstijl die bestaat uit een mengeling van Spaanse muziek en Afrikaanse muziek die door slaven werd meegebracht.\\nCumbia is complexe, ritmische muziek die ontstond aan de Colombiaanse Atlantische kust. Oorspronkelijk bestond cumbia alleen uit percussie en zang. Moderne groepen gebruiken tegenwoordig echter ook blaasinstrumenten en keyboard.\\nEr zijn verschillende verklaringen voor de bijbehorende dans. Wellicht komt de dans uit het Afrikaanse Guinee waar een dans onder de naam cumbe bestond. De dans verbeeldt waarschijnlijk het hof maken van de man aan de vrouw, terwijl anderen er op wijzen dat het typische voetenwerk van de man wellicht zijn oorsprong vindt in de pogingen van de aan de enkels geketende slaven om te dansen.\\nDe cumbia kreeg vaste voet aan de grond in de jaren veertig van de 20e eeuw toen de muziek zich verspreidde van het platteland naar de stad. Onder invloed van samba, bigband en porro ontwikkelde de muziek zich tot zijn huidige vorm. Artiesten als Lucho Bermudez verfijnden de muziekstijl die in de jaren vijftig zijn hoogtepunt beleefde."},{"page_url":"https://es.wikipedia.org/wiki/Celestino_Mart%C3%ADnez_S%C3%A1nchez","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Celestino-Mart%C3%ADnez.jpg","page_title":"Celestino Martínez Sánchez","context_page_description":"Celestino Martínez Sánchez fue un pintor, grabador y litógrafo del siglo XIX. Es reconocido tanto en Colombia como en Venezuela como un artista que sirvió de puente entre la pintura del siglo XVIII y el fotograbado del siglo XIX. Es también conocido por la autoría del dibujo El llanero domador, que aparece en la portada del primer número de la revista El Cojo Ilustrado."},{"page_url":"https://ro.wikipedia.org/wiki/Ko%C8%99leak%C3%AE,_Pidvoloci%C3%AEsk","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Koshlaky_s.png","page_title":"Koșleakî, Pidvolociîsk","context_page_description":"Koșleakî este localitatea de reședință a comunei Koșleakî din raionul Pidvolociîsk, regiunea Ternopil, Ucraina."},{"page_url":"https://ca.wikipedia.org/wiki/Stefano_Golinelli","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Stefano_Golinelli.jpg","page_title":"Stefano Golinelli","context_page_description":"Stefano Golinelli, va ser un virtuós del piano i compositor italià.\\nDesprés d'estudiar en la seva vila natal el piano amb B. Dopelli i la composició amb el mestre Nicola Vaccai, el 1840 als vint-i-dos anys fou nomenat per Rossini professor de piano del Liceu Musical de Bolonya, on va tenir entre altres alumnes a Tofano, càrrec que va ocupar fins al 1871. Durant una visita de Hiller el definí com el millor pianista italià del moment i l'animà per que es dediqués a la carrera concertística. Va donar concerts a Itàlia i, posteriorment, a França, Alemanya i Anglaterra. Durant els últims anys de la seva vida es dedicà exclusivament a la composició.\\nEncara que autor d'algunes variacions i fantasies vers temes d'òpera, fou un dels primers compositors italians atret per les experiències europees. Així ho demostren les seves 5 Sonates, les seves 7 Tocates, les tres sèries de Preludis, i els 3 Nocturns op. 7 i, sobre tot, els 12 Estudis op. 15, dedicats a Hiller, que interessaren favorablement a Schumann, el qual, el 1844, els qualificà en la seva revista com <unes de les composicions més interessants de l'època, inesperat signe de vida a Itàlia>."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%A1%BA%E4%B9%89%E7%AB%99_(%E5%9C%B0%E9%93%81)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/%E5%9C%B0%E9%93%81%E9%A1%BA%E4%B9%89%E7%AB%99%E7%AB%99%E5%8E%85.JPG","page_title":"顺义站 (地铁)","context_page_description":"顺义站位于北京市顺义区城区中心附近，是北京地铁15号线的一座车站。"},{"page_url":"https://it.wikipedia.org/wiki/8th_Fighter_Wing","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/82/80thfightersquadron.jpg","page_title":"8th Fighter Wing","context_page_description":"L'8th Fighter Wing è uno stormo Caccia della U.S.Pacific Air Forces, inquadrato nella Seventh Air Force. Il suo quartier generale è situato presso la base aerea di Kunsan, in Corea del Sud."},{"page_url":"https://no.wikipedia.org/wiki/Vallsta","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ee/Vallsta_J%C3%A4rnv%C3%A4gsstation.JPG","page_title":"Vallsta","context_page_description":"Vallsta er et tettsted i Bollnäs kommune i Gävleborgs län i landskapet Hälsingland i Sverige. I 2010 hadde tettstedet 277 innbyggere."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D1%80%D0%B0%D0%B3%D0%B5%D0%BB%D1%8C_(%D0%BF%D0%B5%D1%80%D0%B5%D0%B2%D0%B0%D0%BB)","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1a/Pragel03.jpg","page_title":"Прагель (перевал)","context_page_description":"Пра́гель или Пра́гельпасс — высокогорный перевал в Альпах, Швейцария, соединяющий долины Муотаталь и Клёнталь.\\nЕго высота — 1 548 метров над уровнем моря. Он соединяет населённые пункты Муотаталь и Нетшталь.\\nЧерез перевал идёт построенная в 1974 - 1976 годах дорога, параллельная дороге через перевал Клаузен, и имеющая максимальную крутизну подъёма 18 %. Дорога открыта с октября по май. Восточный участок дороги через перевал закрыт для движения авто- и мототранспорта по субботам и воскресеньям, что удобно для велотуристов.\\nЧерез перевал компанией Auto AG Schwyz осуществляется автобусное сообщение, но в 2009 году поднимался вопрос о его прекращении из-за малочисленности пассажиров, и в летнее время рейсы осуществлялись только по выходным дням."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A6%D0%B5%D1%80%D0%BA%D0%B2%D0%B0_%D0%A0%D1%96%D0%B7%D0%B4%D0%B2%D0%B0_%D0%9F%D1%80%D0%B5%D1%81%D0%B2%D1%8F%D1%82%D0%BE%D1%97_%D0%91%D0%BE%D0%B3%D0%BE%D1%80%D0%BE%D0%B4%D0%B8%D1%86%D1%96_(%D0%9A%D0%BE%D1%81%D1%82%D1%8F%D0%BD%D1%82%D1%96%D0%B2%D0%BA%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Ukr_Kh_Zmiy_Konst_Church_2014.jpg","page_title":"Церква Різдва Пресвятої Богородиці (Костянтівка)","context_page_description":"Церква Різдва Пресвятої Богородиці — православна церква у селі Костянтівка, Зміївський район, Харківська область. Входить до Зміївського округу Ізюмської єпархії Української православної церкви.\\nСучасна церква, є перебудованим сільським клубом який освячено 13 вересня 2014 року. Але з XVII століття, у селі існувала попередня Різдво-Богородицька церква, яка була зруйнована в 1963 році."},{"page_url":"https://en.wikipedia.org/wiki/Byzantine%E2%80%93Bulgarian_war_of_913%E2%80%93927","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Sack_of_Thessalonica_by_Arabs%2C_904.png","page_title":"Byzantine–Bulgarian war of 913–927","context_page_description":"The Byzantine–Bulgarian war of 913–927 was fought between the Bulgarian Empire and the Byzantine Empire for more than a decade. Although the war was provoked by the Byzantine emperor Alexander's decision to discontinue paying an annual tribute to Bulgaria, the military and ideological initiative was held by Simeon I of Bulgaria, who demanded to be recognized as Tsar and made it clear that he aimed to conquer not only Constantinople but the rest of the Byzantine Empire, as well.\\nIn 917, the Bulgarian army dealt a crushing defeat to the Byzantines at the Battle of Achelous, resulting in Bulgaria's total military supremacy in the Balkans. The Bulgarians again defeated the Byzantines at Katasyrtai in 917, Pegae in 921 and Constantinople in 922. The Bulgarians also captured the important city of Adrianople in Thrace and seized the capital of the Theme of Hellas, Thebes, deep in southern Greece. Following the disaster at Achelous, Byzantine diplomacy incited the Principality of Serbia to attack Bulgaria from the west, but this assault was easily contained."},{"page_url":"https://es.wikipedia.org/wiki/Troncal_Amaz%C3%B3nica","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Bandera_de_Archidona.png","page_title":"Troncal Amazónica","context_page_description":"La Troncal Amazónica es una carretera ecuatoriana, con avances en diferentes niveles en 5 provincias amazónicas:Provincia de Sucumbíos, Provincia de Napo, Provincia de Pastaza, Provincia de Morona Santiago, Provincia de Zamora Chinchipe\\nSu inicio norte es la localidad de Puerto El Carmen, en la frontera con Colombia. Su término sur es la ciudad de Zamora, cerca de la frontera con Perú."},{"page_url":"https://pl.wikipedia.org/wiki/Rebelia_p%C3%B3%C5%82nocno-zachodnia","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Battle_of_Fish_Creek.jpg","page_title":"Rebelia północno-zachodnia","context_page_description":"Rebelia północno-zachodnia – bunt Metysów w Kanadzie w 1885 roku.\\nPo utworzeniu Manitoby i spacyfikowaniu rebelii nad Red River większość Metysów przeniosła się na zachód do dzisiejszego Saskatchewan, gdzie dalej mogli prowadzić życie wolnych osiedleńców. Jednakże w piętnaście lat później historia zaczęła się powtarzać. Intensywny napływ emigrantów przesunął granice osadnictwa. W granicach osiedli metyskich zaczęli się pojawiać rządowi geodeci i oddziały Kanadyjskiej Królewskiej Policji Konnej. Wytyczanie nowych działek powodowało wśród Metysów poczucie zagrożenia. Metysi uzyskali także poparcie części Indian, którzy obawiali się utraty swych terenów. W ten sposób zrodziła się druga z kolei rebelia Metysów.\\nPoczątkowo zbuntowani Metysi próbowali działań pokojowych. Mieli nadzieję, że podobnie jak w 1870, po zakończeniu poprzedniej rebelii, uda się uzyskać polubowne rozwiązanie. Metysi przywołali swego dawnego przywódcę Louisa Riela. Jednak próby wymuszenia na rządzie federalnym ustępstw nie powiodły się. Rząd federalny był w dużo korzystniejszej sytuacji, niż piętnaście lat wcześniej."},{"page_url":"https://fi.wikipedia.org/wiki/Roberta_Torre","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Roberta_la_fabbrica.jpg","page_title":"Roberta Torre","context_page_description":"Roberta Torre on italialainen elokuvaohjaaja. Hänen teostensa joukossa ovat Tano da morire ja Angela.\\nTorre voitti vuonna 1998 parhaan uuden ohjaajan David di Donatello -palkinnon."},{"page_url":"https://fr.wikipedia.org/wiki/Alitalia","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/I-BIXP_-_Airbus_A321-112_-_Alitalia_%2831797985201%29.jpg","page_title":"Alitalia","context_page_description":"Alitalia, ou de son nom complet Alitalia - Società Aerea Italiana, est la première compagnie aérienne italienne. Elle est créée en 1946. En difficulté chronique, elle subit une première tentative de privatisation en 2006, puis est privatisée en 2008 au travers de la structure Compagnie aérienne italienne, tout en étant fusionnée avec Air One. En 2014, elle est partiellement acquise par la compagnie Etihad à hauteur de 49 %. En avril 2017, suite au refus par référendum interne d'un énième plan de restructuration, le gouvernement annonce que dans six mois Alitalia sera soit vendue soit mise en faillite, après trente ans de pertes. La procédure de mise en faillite d'Alitalia a débuté le 2 mai 2017.\\nDepuis juillet 2001, elle fait partie de l’alliance Skyteam et est également membre de Skyteam Cargo. Son chiffre d’affaires s’élève à plus de 5 milliards d’euros. Sa flotte comprend 122 appareils en opération et l’effectif du personnel était d'environ 12 500 employés. Elle transporte plus de 22 millions de passagers par an."},{"page_url":"https://es.wikipedia.org/wiki/La_ejecuci%C3%B3n_de_Lady_Jane_Grey","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Lady_Jane_Grey_execution_Jane_face.png","page_title":"La ejecución de Lady Jane Grey","context_page_description":"La ejecución de Lady Jane Grey es una pintura al óleo obra de Paul Delaroche realizada en 1833 y exhibida en la National Gallery de Londres.\\nEnormemente popular en las décadas inmediatamente posteriores, esta obra, al igual que otras pinturas realistas de temas históricos, perdió el favor de la crítica durante el siglo XX, permaneciendo almacenada durante décadas y llegando a considerarse una obra perdida. Restaurada y exhibida de nuevo desde 1975, la pintura volvió a ganar popularidad, especialmente entre el público joven."},{"page_url":"https://no.wikipedia.org/wiki/Porsgrunnsbrua","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Porsgrunnsbrua.JPG","page_title":"Porsgrunnsbrua","context_page_description":"Porsgrunnsbrua er en klaffebru av betong i Porsgrunn kommune i Telemark. Brua ble tatt i bruk i 1958 og forbinder østre og vestre bydel av Porsgrunn by. Lokalt kalles bydelene «Østsia» og «Vessia». Den krysser elva litt ovenfor der hvor Skiensvassdraget munner ut i Frierfjorden. Fri seilingshøyde ved normal vannstand er 8 meter."},{"page_url":"https://en.wikipedia.org/wiki/Central_place_theory","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Christaller_model_1.svg","page_title":"Central place theory","context_page_description":"Central place theory is a geographical theory that seeks to explain the number, size and location of human settlements in a residential system. It was introduced in 1933 to explain the spatial distribution of cities across the landscape. The theory was first analyzed by German geographer Walter Christaller, who asserted that settlements simply functioned as 'central places' providing services to surrounding areas."},{"page_url":"https://hu.wikipedia.org/wiki/H%C3%B3dos_Imre","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Hodos_imre_csarnok.jpg","page_title":"Hódos Imre","context_page_description":"Hódos Imre olimpiai bajnok birkózó."},{"page_url":"https://cy.wikipedia.org/wiki/Llandegla","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Eglwys_Sant_Tegla%2C_Llandegla%2C_Rhuthun%3B_sometimes_miss-spelt_St_Tecla_37.JPG","page_title":"Llandegla","context_page_description":"Pentref, plwyf a chymuned yn ne-ddwyrain Sir Ddinbych yw Llandegla. Fe'i lleolir ar groesffordd ar lôn yr A525, tua hanner ffordd rhwng Dinbych a Wrecsam. Enwir y pentref a'r plwyf ar ôl Sant Tegla.\\nCynrychiolir yr ardal hon yn y Cynulliad Cenedlaethol gan Darren Millar a'r Aelod Seneddol yw David Jones."},{"page_url":"https://ro.wikipedia.org/wiki/Oberweningen","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0c/Karte_Gemeinde_Oberweningen_2007.png","page_title":"Oberweningen","context_page_description":"Oberweningen este un oraș în Elveția."},{"page_url":"https://de.wikipedia.org/wiki/Kamele","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Camel_in_Mongolia.jpg","page_title":"Kamele","context_page_description":"Die Kamele sind eine Säugetierfamilie aus der Ordnung der Paarhufer, innerhalb derer sie die einzige rezente Familie der Unterordnung der Schwielensohler darstellen. Sie lassen sich in zwei Gruppen unterteilen. Die erste Gruppe bilden die Altweltkamele mit dem Dromedar oder Einhöckrigen Kamel und dem Trampeltier oder Zweihöckrigen Kamel, auch Großkamele genannt. Die zweite Gruppe umfasst die Neuweltkamele mit den Gattungen Lama und Vikunja, die höckerlosen Kleinkamele."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%B5%D1%80%D1%85%D0%BD%D0%B8%D0%B9_%D0%91%D0%B0%D1%81%D0%BA%D1%83%D0%BD%D1%87%D0%B0%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Verkhny_Baskunchak_1.JPG","page_title":"Верхний Баскунчак","context_page_description":"Ве́рхний Баскунча́к — рабочий посёлок в Ахтубинском районе Астраханской области России, административный центр муниципального образования «Посёлок Верхний Баскунчак».\\nРасположен в восточной части области, в 41 км к востоку от Ахтубинска, в 15 км к югу от границы с Казахстаном.\\nУзловая железнодорожная станция Верхний Баскунчак Приволжской железной дороги.\\nНаселение 8,5 тыс. человек. Глава администрации Тикеев Шагит Зейнишович."},{"page_url":"https://de.wikipedia.org/wiki/Oberleitungsbus_Innsbruck","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Innsbruck_-_Innenstadt_-_Gleis-_und_Oberleitungsplan_1960.jpg","page_title":"Oberleitungsbus Innsbruck","context_page_description":"Der Oberleitungsbus Innsbruck war ein Oberleitungsbus-Betrieb in Österreich. Es bestanden dabei zwei zeitlich voneinander unabhängige Netze – das erste vom 8. April 1944 bis zum 29. Februar 1976, das zweite vom 17. Dezember 1988 bis zum 25. Februar 2007. In beiden Fällen ergänzte der Oberleitungsbus die Straßenbahn Innsbruck. Wie die Straßenbahn wurde auch der Oberleitungsbus von den Innsbrucker Verkehrsbetrieben betrieben."},{"page_url":"https://ca.wikipedia.org/wiki/Llista_de_monuments_de_Fla%C3%A7%C3%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Llinda_al_carrer_Sant_Josep%2C_10_%28Fla%C3%A7%C3%A0%29_-_Detall.jpg","page_title":"Llista de monuments de Flaçà","context_page_description":"Llista de monuments de Flaçà inclosos en l'Inventari del Patrimoni Arquitectònic Català pel municipi de Flaçà. Inclou els inscrits en el Registre de Béns Culturals d'Interès Nacional amb la classificació de monuments històrics, els Béns Culturals d'Interès Local de caràcter immoble i la resta de béns arquitectònics integrants del patrimoni cultural català."},{"page_url":"https://pl.wikipedia.org/wiki/Sekretarz_skarbu_Stan%C3%B3w_Zjednoczonych","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Cortelyou-george-bruce.jpg","page_title":"Sekretarz skarbu Stanów Zjednoczonych","context_page_description":"Sekretarz Skarbu Stanów Zjednoczonych – członek Gabinetu Stanów Zjednoczonych stojący na czele Departamentu Skarbu. W gestii sekretarza skarbu są wszystkie sprawy związane z finansami i podatkami państwa. Pełni on funkcję analogiczną do ministra finansów w innych krajach. Sekretarz skarbu jest piątym w linii sukcesji prezydenckiej Stanów Zjednoczonych."},{"page_url":"https://es.wikipedia.org/wiki/Villes_et_pays_d%27art_et_d%27histoire","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/84/Cath%C3%A9drale_de_Ch%C3%A2lons_en_Champagne.JPG","page_title":"Villes et pays d'art et d'histoire","context_page_description":"Villes et pays d’art et d’histoire es una marca, distintivo o etiqueta oficial francesa asignada desde 1985 por el Ministerio de Cultura de Francia a los municipios o países franceses que se comprometan en una política de animación y revalorización de sus patrimonios construidos, naturales, e industriales, así como de la arquitectura. Esta etiqueta sucede a otra etiqueta similar anterior, «Ville d’art», desaparecida en 2005.\\nEste compromiso es fijado por un convenio elaborado con la «Dirección general de los patrimonios», la «Dirección regional de los Asuntos culturales» DRAC y las colectividades interesadas. Este convenio implica un apoyo financiero y técnico por parte del Ministerio e geners la obligación, para las colectividades, de recurrir a un personal cualificado y autorizado por el Ministerio.\\nEl «Consejo nacional de las ciudades y países de arte e historia», creado en 1995, participa en el desarrollo y en la orientación general de la política de la red y emite un dictamen sobre las candidaturas a tal distintivo, así como las retiradas por incumplimiento del marco establecido por el convenio. La DRAC garantiza la aplicación de la política de la red a nivel regional."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%A8%D1%82%D0%B0%D1%81%D1%84%D1%83%D1%80%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Stassfurt_Bodebruecke.jpg","page_title":"Штасфурт","context_page_description":"Штасфурт — Германия Федеративтік Республикасының Саксония-Анхальт жерінде орналасқан қала. Зальцланд ауданының құрамына енеді.\\nҚаланың тұрақты тұрғындарының саны 28 605 адамды құрайды. Алып жатқан жер аумағы 58,21 км² шамасында. Мемлекет ішінде бекітілген ресми коды — 15 0 89 310. Қаланың басшысы — Мартин Кризель.\\nҚаланың өзі әкімшілік құрылымы бойынша 4 қалалық ауданға бөлінеді."},{"page_url":"https://pl.wikipedia.org/wiki/Montendry","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Vallon_de_Montendry_vu_de_Ch%C3%A2teauneuf_%28%C3%A9t%C3%A9_2019%29.JPG","page_title":"Montendry","context_page_description":"Montendry – miejscowość i gmina we Francji, w regionie Owernia-Rodan-Alpy, w departamencie Sabaudia.\\nWedług danych na rok 1990 gminę zamieszkiwało 36 osób, a gęstość zaludnienia wynosiła 4 osób/km²."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B8%D0%BD%D0%B3%D0%B5%D0%BC-%D0%9A%D0%B0%D0%BD%D1%8C%D0%BE%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Bingham_Canyon_mine_2007_-_NASA_Image.jpg","page_title":"Бингем-Каньон","context_page_description":"Бингем-Каньон, Бингхем-Каньон — горнопромышленный пункт на Западе США, в штате Юта, в горах Окер, к югу от Большого солёного озера. Один из крупнейших карьеров в мире, где ведётся разработка гигантского меднопорфирового месторождения oткрытым способом. Карьер находится к юго-западу от города Солт-Лейк-Сити.\\nМедная руда здесь была впервые обнаружена в 1850 году, и с 1863 года началась разработка карьера, которая продолжается по сей день.\\nС начала прошлого века рудник Бингхем-Каньон принадлежал компании Kennecott Utah Copper. В результате сложностей, наступивших после нефтяного кризиса 1973 году, компания была приобретена британской British Petroleum, а затем продана британскому холдингу Rio Tinto, которому и принадлежит в настоящее время.\\nС 1966 года внесён в реестр Национальных исторических памятников США под названием Bingham Canyon Open Pit Copper Mine."}]`),L={name:"App",components:{PoemCard:P},data(){return{searchQuery:"",visibleCount:4,poemsData:M,isLoading:!1}},computed:{filteredPoems(){const a=this.searchQuery.trim().toLowerCase();return a?this.poemsData.filter(e=>e.page_title&&e.page_title.toLowerCase().includes(a)||e.context_page_description&&e.context_page_description.toLowerCase().includes(a)):this.poemsData},displayedPoems(){return this.searchQuery.trim()?this.filteredPoems:this.filteredPoems.slice(0,this.visibleCount)},hasMorePoems(){return!this.searchQuery.trim()&&this.visibleCount<this.poemsData.length}},methods:{async loadMore(){this.isLoading=!0,await new Promise(a=>setTimeout(a,1e3)),this.visibleCount+=4,this.isLoading=!1}}},T={class:"search-container"},F={class:"card-container"},G={key:0,class:"empty-state"},I=["disabled"],R={key:0},H={key:1};function N(a,e,s,m,o,r){const d=h("PoemCard");return t(),n("section",null,[e[4]||(e[4]=i("div",{class:"top-banner"},[i("div",{class:"top-banner-title"},[i("div",{class:"top-banner-title-text"},"🤔AI Techniques🧠")])],-1)),i("div",T,[e[3]||(e[3]=i("span",{class:"search-icon"},"🔍",-1)),_(i("input",{type:"text",class:"search-input","onUpdate:modelValue":e[0]||(e[0]=l=>o.searchQuery=l),placeholder:"Search..."},null,512),[[k,o.searchQuery]]),o.searchQuery?(t(),n("button",{key:0,class:"clear-search",onClick:e[1]||(e[1]=l=>o.searchQuery="")}," ✕ ")):p("",!0)]),i("div",F,[(t(!0),n(w,null,b(r.displayedPoems,(l,c)=>(t(),f(d,{key:c,poem:l},null,8,["poem"]))),128)),r.displayedPoems.length===0?(t(),n("div",G,' No results found for "'+u(o.searchQuery)+'". ',1)):p("",!0)]),r.hasMorePoems?(t(),n("button",{key:0,class:"load-more-button",disabled:o.isLoading,onClick:e[2]||(e[2]=(...l)=>r.loadMore&&r.loadMore(...l))},[o.isLoading?(t(),n("span",H,"Loading...")):(t(),n("span",R,"See more"))],8,I)):p("",!0)])}const K=g(L,[["render",N],["__scopeId","data-v-e9dbecdc"]])